INSERT INTO `names` VALUES (1,'Ada',' Ada yra Moteriškas vardas.','Trumpa reikšmė: kilminga.','Vardo reikšmė: Ada – iš germanų adal “kilminga”. Taip pat gali būti kilęs iš hebrajų adha “ornamentas, papuošimas, aušra”.',' Ada yra vokiečių kilmės vardas.'),(2,'Adalbertas',' Adalbertas yra Vyriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Adalbertas – iš vok. adal “kilmingas” + beraht “spindintis, žymus”.',' Adalbertas yra vokiečių kilmės vardas.'),(3,'Akvilinas',' Akvilinas yra Vyriškas vardas.','Trumpa reikšmė: „ereliška, ereliškas“.','Vardo reikšmė: (2) lot., trump. Akvilas, Akvilius, Linas, Inas, iš lot. Aquilinus: lot. aąuilinus „erelio, ereliškas',' Akvilinas yra lotynų kilmės vardas.'),(4,'Akvilina',' Akvilina yra Moteriškas vardas.','Trumpa reikšmė: „ereliška, ereliškas“.','Vardo reikšmė: (2) lot., trump. Akvilė, Lina, Ina, iš lot. Aquilina: lot. aquilina „erelio, ereliška',' Akvilina yra lotynų kilmės vardas.'),(5,'Akvilė',' Akvilė yra Moteriškas vardas.','Trumpa reikšmė: „erelis“.','Vardo reikšmė: (2) trump. Vilė, tarm. Akvilia piet. aukšt. (dz.), Akvilė yra liet. trumpinys iš Akvilina',' Akvilė yra lotynų kilmės vardas.'),(6,'Aistis',' Aistis yra Vyriškas vardas.','Trumpa reikšmė:  iš baltų genties pavadinimo „aistis, aisčiai“.','Vardo reikšmė: Tai dvasinio bei fizinio komforto siekimas. Esate ambicingas ir impulsyvus, turite stiprią valią. Esate labai pasitikintis savimi. Norėtumėte ką nors pakeisti pagal save. Esate , ryžtingas, ambicinngas.  Turite vystyti savo komunikabilumą.',' Aistis yra lietuvių kilmės vardas.'),(7,'Akvilas',' Akvilas yra Vyriškas vardas.','Trumpa reikšmė: „erelis“.','Vardo reikšmė: (2) lot., var. Akvilius (2), trump. Vilius, tarm. Akvilis, Vilis vak. ir šiaur. žem., iš lot. Aąuila: lot. aąuila „erelis',' Akvilas yra lotynų kilmės vardas.'),(8,'Aistė',' Aistė yra Moteriškas vardas.','Trumpa reikšmė:  iš baltų genties pavadinimo „aistis, aisčiai“.','Vardo reikšmė: Tai dvasinio bei fizinio komforto siekimas. Esate ambicingaa ir impulsyvi, turite stiprią valią. Esate labai pasitikinti savimi. Norėtumėte ką nors pakeisti pagal save. Esate , ryžtinga, ambicinnga.  Turite vystyti savo komunikabilumą.',' Aistė yra lietuvių kilmės vardas.'),(9,'Aidis',' Aidis, Aidys yra Vyriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Tai dvasinio bei fizinio komforto siekimas. Esate ambicingas ir impulsyvus, turite stiprią valią. Esate labai pasitikintis savimi. Norėtumėte ką nors pakeisti pagal save. Esate , ryžtingas, ambicinngas.  Turite vystyti savo komunikabilumą.',' Aidis, Aidys yra Lietuvių kilmės vardas.'),(10,'Airė',' Airė yra Moteriškas vardas.','Trumpa reikšmė: „žiedas“.','Vardo reikšmė: Tai dvasinio bei fizinio komforto siekimas. Esate ambicingaa ir impulsyvi, turite stiprią valią. Esate labai pasitikinti savimi. Norėtumėte ką nors pakeisti pagal save. Esate , ryžtinga, ambicinnga.  Turite vystyti savo komunikabilumą.',' Airė yra hebrajų kilmės vardas.'),(11,'Aidė',' Aidė yra Moteriškas vardas.','Trumpa reikšmė: „aidas“.','Vardo reikšmė: Tai dvasinio bei fizinio komforto siekimas. Esate ambicinga ir impulsyvi, turite stiprią valią. Esate labai pasitikinti savimi. Norėtumėte ką nors pakeisti pagal save. Esate , ryžtinga, ambicinnga.  Turite vystyti savo komunikabilumą.',' Aidė yra lietuvių kilmės vardas.'),(12,'Alda',' Alda, Aldė yra Moteriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Alda, Aldė - liet. trumpinys iš Aldona.',' Alda, Aldė yra  kilmės vardas.'),(13,'Albutas',' Albutas yra Vyriškas vardas.','Trumpa reikšmė: al- (aliai vienas „kiekvienas“) + but- (būti) – „kiekvienam esantis, -i“.','Vardo reikšmė: Albutas – (1) liet., trump. Albas: al— (:liet. al-iai, aliai vienas „kiekvienas, plg. graik. allos „kitas, got, alja „kitas) + but-(:liet. but-as, būti)',' Albutas yra lietuvių kilmės vardas.'),(14,'Albutė',' Albutė yra Moteriškas vardas.','Trumpa reikšmė: al- (aliai vienas „kiekvienas“) + but- (būti) – „kiekvienam esantis, -i“.','Vardo reikšmė: Panšūs vardai: Albutas, Albina, Albertas',' Albutė yra lietuvių kilmės vardas.'),(15,'Albinas',' Albinas yra Vyriškas vardas.','Trumpa reikšmė: „balta, -as; skaisti, -us“.','Vardo reikšmė: (2) lot., trump. Albas, tarm. Albinas ryt. ir vak. aukšt., Albynas, Elbas, Elbys vak. liet., Elbinas vak. aukšt., Elbynas žem. (Laukuva), Alba, Albė, Albis vak. aukšt. (Jurbarkas), Albė, Albis piet. žem., iš lot. Albinus: lot. albus „baltas, skaistus',' Albinas yra lotynų kilmės vardas.'),(16,'Alfreda',' Alfreda yra Moteriškas vardas.','Trumpa reikšmė: alf „elfas“ (mitinė būtybė) + rad „patarimas“.','Vardo reikšmė: (1), (2) germ., trump. Alfa, Freda, baž. lot. Alfreda, kuris iš vyr. v. Alfredus, žr. Alfredas',' Alfreda yra vokiečių kilmės vardas.'),(17,'Albina',' Albina yra Moteriškas vardas.','Trumpa reikšmė: „balta, -as; skaisti, -us“.','Vardo reikšmė: (2) lot., trump. Alba, Albė, tarm. Albinė, Albė vak. liet., vak. žem., Elbė piet. žem. (švd.), iš lot. Albina, kuris iš vyr. v. Albinus, žr. Albinas',' Albina yra lotynų kilmės vardas.'),(18,'Alfonsas',' Alfonsas yra Vyriškas vardas.','Trumpa reikšmė: adal „kilmingas, kilnus“ + funs „karštas, ūmus“.','Vardo reikšmė: .',' Alfonsas yra vokiečių kilmės vardas.'),(19,'Albertina',' Albertina yra Moteriškas vardas.','Trumpa reikšmė: adal „kilmingas“ + beraht „spindintis, žymus“.','Vardo reikšmė: (2) germ., trump. Alberta, Alba, iš sulotyninto germ. Albertina, kuris yra priesagos -ina vedinys iš Alberta',' Albertina yra vokiečių kilmės vardas.'),(20,'Alfonsa',' Alfonsa yra Moteriškas vardas.','Trumpa reikšmė: adal „kilmingas, kilnus“ + funs „karštas, ūmus“.','Vardo reikšmė: (1) germ., trump. Alfa, tarm, Alponsa vak. aukšt., Alpinė, Alpa, Alpunė ryt. aukšt., baž. lot. Alfonsa, Alphonsa, kuris iš vyr. v. Alfonsus, Alphonsus, žr. Alfonsas ',' Alfonsa yra Vokiečių kilmės vardas.'),(21,'Albertas',' Albertas yra Vyriškas vardas.','Trumpa reikšmė: adal „kilmingas“ + beraht „spindintis, žymus“.','Vardo reikšmė: (1) germ., trump. Albas, tarm. Albrys vak. liet., Al’bus piet. aukšt. (dz.), Elbertas piet. žem. (švd.), iš sulotyninto germ. Albertus, kuris yra trumpinys iš germ. Adalbert, žr. Adalbertas ',' Albertas yra vokiečių kilmės vardas.'),(22,'Alfas',' Alfas yra Vyriškas vardas.','Trumpa reikšmė: „pirmagimis, pirmagimė“; alfa – pirmoji graikų abėcėlės raidė.','Vardo reikšmė: (l) liet. trumpinys iš Alfonsas ir Alfredas',' Alfas yra graikų kilmės vardas.'),(23,'Alberta',' Alberta yra Moteriškas vardas.','Trumpa reikšmė: adal „kilmingas“ + beraht „spindintis, žymus“.','Vardo reikšmė: (1) germ., trump. Alba, Albė, iš sulotyninto germ. Alberta, kuris iš vyr. v. Albertas',' Alberta yra vokiečių kilmės vardas.'),(24,'Alfa',' Alfa yra Moteriškas vardas.','Trumpa reikšmė: „pirmagimis, pirmagimė“; alfa – pirmoji graikų abėcėlės raidė.','Vardo reikšmė: (1) liet, trumpinys iš Alfonsa ir Alfreda',' Alfa yra graikų kilmės vardas.'),(25,'Albas',' Albas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Albinas: „balta, -as; skaisti, -us“.','Vardo reikšmė: (1) liet. trumpinys iš Albinas ir Albertas',' Albas yra lotynų kilmės vardas.'),(26,'Aleta',' Aleta yra Moteriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Aleta – pranc., trump. Alė, iš sulotyninto prancūzų Aletta, kuris iš pranc. Alette, o šis yra vardo Adela mažybinė forma, žr. Adelė.',' Aleta yra Prancūzų kilmės vardas.'),(27,'Alba',' Alba, Aibė yra Moteriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Alba, Aibė – liet. trumpinys iš Albina ir Alberta.',' Alba, Aibė yra Vokiečių kilmės vardas.'),(28,'Alantas',' Alantas yra Vyriškas vardas.','Trumpa reikšmė: iš upėvardžio Alantas (Kartena); sen. lietuvių alėti – „linksmai tekėti, bėgti“.','Vardo reikšmė: (1) liet., iš upėvardžio A.lantas (Kartena)',' Alantas yra lietuvių kilmės vardas.'),(29,'Alena',' Alena yra Moteriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Alena – 1. vok. trumpinys iš Magdalena, 2. sulietuvintas vardo Elena variantas.',' Alena yra Lotynų kilmės vardas.'),(30,'Alanta',' Alanta yra Moteriškas vardas.','Trumpa reikšmė: iš upėvardžio Alanta (Molėtai); sen. lietuvių alėti – linksmai tekėti, bėgti.','Vardo reikšmė: (3b) liet., iš upėvardžio Alanta (Molėtai)',' Alanta yra lietuvių kilmės vardas.'),(31,'Alginas',' Alginas yra Vyriškas vardas.','Trumpa reikšmė: al- (alei vienas „kiekvienas“) + gin- (ginti) – „visus ginantis“.','Vardo reikšmė: (1) liet., trump. Algis, al- (žr. Albutas) + gin- (: liet. gin-ti, gin-a)',' Alginas yra lietuvių kilmės vardas.'),(32,'Aleksys',' Aleksys, Aleksius yra Vyriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Aleksys, Aleksius – (4), (2) graik., trump, Alius, tarm. Eleksis šiaur. žem., Elius piet. žem. (švd.), per vid. lot. Alexis, Alexius iš graik. Aleksios – „gynėjas“: graik. alekso „ginti, saugoti.',' Aleksys, Aleksius yra Graikų kilmės vardas.'),(33,'Aleksė',' Aleksė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Aleksandra, Aleksandras – graikų alekso „saugoti, ginti“ + aner (andros) „žmogus“.','Vardo reikšmė: (1) liet. trumpinys iš Aleksandra',' Aleksė yra graikų kilmės vardas.'),(34,'Alanas',' Alanas yra Vyriškas vardas.','Trumpa reikšmė: „santaika“.','Vardo reikšmė: Alanas – (2) kelt., trump. Alys, Alius, iš sulotyninto kelt. Alanus: kelt. alun – santaika.',' Alanas yra keltų kilmės vardas.'),(35,'Algina',' Algina, Algina, Alginė yra Moteriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Algina, Algina, Alginė – (3b), (1), (1) liet., trump. Algė, iš vyr, v. Alginas.',' Algina, Algina, Alginė yra Lietuvių kilmės vardas.'),(36,'Algimantė',' Algimantė yra Moteriškas vardas.','Trumpa reikšmė: alg- (alga „atlyginimas, atpildas“) + mant- (mantus „sumanus“, manta „turtas“).','Vardo reikšmė: (1) liet., trump. Algė, tarm. trump. Algima (Tauragė), iš vyr. v. Algimantas',' Algimantė yra lietuvių kilmės vardas.'),(37,'Aleksas',' Aleksas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Aleksandra, Aleksandras; Reiškia \"saugantis, apginantis žmogus\"; Graikų žodžių \"alekso\" - „saugoti, ginti“ + \"aner\" (andros) - „žmogus“ junginys..','Vardo reikšmė: 