us, -i “.','Vardo reikšmė: Alkantas – liet., trump. Alkas, al- (žr. Albutas) + kant- (: liet. pa-kant-us, kant-rus)',' Alkantas yra lietuvių kilmės vardas.'),(45,'Aldonas',' Aldonas yra Vyriškas vardas.','Trumpa reikšmė: baltarusių: Aldonia iš graikų eudokia „palankumas, maloningumas“.','Vardo reikšmė: Aldonas – liet., trump. Aldas, Aldis, iš liet. avd. Aldonas, kuris yra priesagos -onas vedinys iš liet. šaknies ald-: ald-ėti „aidėti, skambėti, ald-oti „rėkauti.',' Aldonas yra slavų kilmės vardas.'),(46,'Algeda',' Algeda, Algeda, Algedė yra Moteriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Algeda – liet., trump. Algė, iš vyr. v. Algedas.',' Algeda, Algeda, Algedė yra Lietuvių kilmės vardas.'),(47,'Aldona',' Aldona yra Moteriškas vardas.','Trumpa reikšmė: baltarusių: Aldonia iš graikų eudokia „palankumas, maloningumas“.','Vardo reikšmė: Aldona – liet., trump. Alda. Aldė, tarm. Aldonia ryt. aukšt. (Dusetos), Aldonė šiaur. aukšt. (Žeimelis), Aldonė piet. aukst. (dz.), 1. liet., iš liet., avd. Aldonas, 2. suliet., iš brus. Aldonia. kuris iš graik. Eudokia, graik. eudokia „palankumas, maloningumas.',' Aldona yra slavų kilmės vardas.'),(48,'Aliodija',' Aliodija, Alodija yra Moteriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Alodija – pranc., trump. Alė, iš sulotyninto pranc. Alodia — „vieversėlis”.',' Aliodija, Alodija yra Prancūzų kilmės vardas.'),(49,'Alina',' Alina yra Moteriškas vardas.','Trumpa reikšmė: „puikioji“.','Vardo reikšmė: Alina – arab., trump. Alė, Lina, iš sulotyninto arabų Alina — „puikioji.',' Alina yra arabų kilmės vardas.'),(50,'Algė',' Algė yra Moteriškas vardas.','Trumpa reikšmė: trumpiniai iš Algimantas, Algimantė arba Algirdas, Algirdė arba Algvilas, Algvilė.','Vardo reikšmė: Algė – tai lietuviškų vardų trumpinys iš vardų, kurie prasideda su Al-g-, Alg-: Algimantė, Algirdė ir kt. Algė – vyriško vardo Algis alternatyva.',' Algė yra lietuvių kilmės vardas.'),(51,'Algaudas',' Algaudas yra Vyriškas vardas.','Trumpa reikšmė: al- (aliai vienas) + gaud (gaudyti) – „visus gaudantis, -i“.','Vardo reikšmė: Algaudas – suliet. prūs., trump. Algas, al-(žr. Albutas) + gaud- (: liet. gaud-yti, plg. gauti).',' Algaudas yra lietuvių kilmės vardas.'),(52,'Alicija',' Alicija yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Aleksandra arba Elizabeth (Elžbieta).','Vardo reikšmė: Vardadienis: vasario 15d., birželio 21d., rugpjūčio 24d.',' Alicija yra prancūzų kilmės vardas.'),(53,'Algvilė',' Algvilė yra Moteriškas vardas.','Trumpa reikšmė: alg- (alga „atpildas, atlyginimas“) + vil- (viltis) – „atpildo besiviliantis, -i“.','Vardo reikšmė: Algvilė – liet., trurnp, Algė, iš vyr. v. Algvilas.',' Algvilė yra lietuvių kilmės vardas.'),(54,'Algauda',' Algauda, Algauda, Algaudė yra Moteriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Algauda, Algaudė – suliet. prūs., trump. Algė, iš vyr. v. Algaudas.',' Algauda, Algauda, Algaudė yra Lietuvių kilmės vardas.'),(55,'Algvilas',' Algvilas yra Vyriškas vardas.','Trumpa reikšmė: alg- (alga „atpildas, atlyginimas“) + vil- (viltis) – „atpildo besiviliantis, -i“ Viltis.','Vardo reikšmė: Algvilas – liet., trump. Algis, alg- (žr. Algimantas) + vil- (:liet. vil-tis, vil-iasi „tikėtis, vil-tis).',' Algvilas yra lietuvių kilmės vardas.'),(56,'Algardė',' Algardė yra Moteriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Algardė – suliet. prūs., trump. Algė, iš vyr. v. Algardas.',' Algardė yra Lotynų kilmės vardas.'),(57,'Algminas',' Algminas yra Vyriškas vardas.','Trumpa reikšmė: al- (aliai vienas) + min- (minėti) – „visų minimas, -a“.','Vardo reikšmė: Algminas – liet., trump. Algis, alg- (žr. Algimantas) + min- (: liet. min-ėti, min-ti, mena, mine).',' Algminas yra lietuvių kilmės vardas.'),(58,'Algardas',' Algardas yra  vardas.','Trumpa reikšmė: Ryžtingas, atkaklus.','Vardo reikšmė: Algardas – suliet. prūs., trump. Algas, al-(žr. Albinas) + gard- (:liet. gard-inti „pranešti, garsinti, plg. prūs. gerd-aut „sakyti).',' Algardas yra Lotynų kilmės vardas.'),(59,'Algmina',' Algmina, Algmina, Algminė yra Moteriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Algmina, Algminė – liet., trump. Algė, iš vyr. v. Algminas.',' Algmina, Algmina, Algminė yra Lotynų kilmės vardas.'),(60,'Alfredas',' Alfredas yra Vyriškas vardas.','Trumpa reikšmė: alf „elfas“ (mitinė būtybė) + rad „patarimas“.','Vardo reikšmė: Alfredas – trump. Alfas, Fredas, tarm. Alpredas, Elpredas piet. žem., Alfridas, Alpridas vak. žem., baž. lot. Alfredus, Alfridus per anglosaksų Alfred iš sen. germ. Alfrad — „geras patarėjas“: alf- „elfas (mitinė germ. būtybė) + rad „patarimas“.',' Alfredas yra vokiečių kilmės vardas.'),(61,'Alminta',' Alminta, Alminta, Almintė yra Moteriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Alminta, Almintė – liet., trump. Almė: iš vyr. v. Almintas.',' Alminta, Alminta, Almintė yra lietuvių kilmės vardas.'),(62,'Algis',' Algis yra Vyriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Algis – liet. trumpinys iš avd. su Al-g-, Alg-: Algedas, Algirdas, Algimantas ir kt.',' Algis yra Lietuvių kilmės vardas.'),(63,'Alminas',' Alminas yra Vyriškas vardas.','Trumpa reikšmė: al- (aliai vienas) + min- (minėti) – „visų minima, -as“.','Vardo reikšmė: Alminas – liet., trump. Almis: al- (žr. Albutas) + min- (žr. Algminas).',' Alminas yra lietuvių kilmės vardas.'),(64,'Algirdas',' Algirdas yra Vyriškas vardas.','Trumpa reikšmė: al- (aliai vienas) + gird- (girdėti, girdas „žinia, gandas“) – „visa girdintis, -i“.','Vardo reikšmė: Vardadienis: Vasario 11 d., Liepos 9d., Gruodžio 28 d.',' Algirdas yra lietuvių kilmės vardas.'),(65,'Almina',' Almina, Almina, Alminė yra Moteriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Almina, Alminė – liet., trump. Almė: iš vyr. v. Alminas.',' Almina, Almina, Alminė yra Lietuvių kilmės vardas.'),(66,'Almilė',' Almilė yra Moteriškas vardas.','Trumpa reikšmė: al- (aliai vienas) + mil- (pamilti) – „visų mylimas, -a“.','Vardo reikšmė: Almilė – liet., trump. Almė, iš vyr. v. Almilas.',' Almilė yra lietuvių kilmės vardas.'),(67,'Algirda',' Algirda, Algirda, Algirdė yra Moteriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Algirda, Algirdė – liet., trump. Algė, iš vyr. v. Algirdas.',' Algirda, Algirda, Algirdė yra Lietuvių kilmės vardas.'),(68,'Algintas',' Algintas yra Vyriškas vardas.','Trumpa reikšmė: al- (aliai vienas) + gin- (ginti) – „visus ginantis, -i“.','Vardo reikšmė: Algintas – liet., trump. Algis, al- (žr. Albutas) + gint- (: liet. gint-as, ginti).',' Algintas yra lietuvių kilmės vardas.'),(69,'Almilas',' Almilas yra Vyriškas vardas.','Trumpa reikšmė: al- (aliai vienas) + mil- (pamilti) – „visų mylimas, -a“.','Vardo reikšmė: Almilas – liet., trump. Almis, al- (žr. Albutas) + mil-(: liet. pa-mil-ti, pa-mil-o).',' Almilas yra lietuvių kilmės vardas.'),(70,'Almė',' Almė yra Moteriškas vardas.','Trumpa reikšmė: lietuvių trumpinys iš Almana, -as; Almanta, -as; Alminė, -as.','Vardo reikšmė: Almė – liet., trumpinys iš mot. v. su Al-m-: Almana, Almanta, Alminė ir kt.',' Almė yra lietuvių kilmės vardas.'),(71,'Alginta',' Alginta, Alginta, Algintė yra Moteriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Alginta, Algintė – liet., trump. Algė, iš vyr. v. Algintas.',' Alginta, Alginta, Algintė yra Lietuvių kilmės vardas.'),(72,'Almantas',' Almantas yra Vyriškas vardas.','Trumpa reikšmė: al- (aliai vienas) + mant- (mantus „sumanus“, manta „turtas“) – „visa išmananti, -is“.','Vardo reikšmė: Almantas - liet., trump. Almas, al- (žr. Albutas) + mant- (ŽR. ',' Almantas yra lietuvių kilmės vardas.'),(73,'Almanta',' Almanta, Almanta, Almantė yra Moteriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Almanta, Almantė – liet., trump. Almė, iš vyr. v. Almantas.',' Almanta, Almanta, Almantė yra Lietuvių kilmės vardas.'),(74,'Almanas',' Almanas yra Vyriškas vardas.','Trumpa reikšmė: al- (aliai vienas) + man- (manyti, sumanus) – „visa išmananti, -is“.','Vardo reikšmė: Almanas – liet. ir prūs., trump. Almas, al-(žr. Albutas) + man- (: liet. man-yti, su-manus).',' Almanas yra lietuvių kilmės vardas.'),(75,'Almana',' Almana, Almana, Almanė yra Moteriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Almana, Almanė – liet. ir prūs., trump. Almė, tarm. Almonė vak. liet., žem., iš vyr. v. Almanas.',' Almana, Almana, Almanė yra Lietuvių kilmės vardas.'),(76,'Almas',' Almas yra Vyriškas vardas.','Trumpa reikšmė: „maitinanti, -is; palaimą teikianti, -is“.','Vardo reikšmė: Almas – (1) lot., iš lot. Almus: lot. almus „maitinantis, palaimą teikiantis.',' Almas yra lotynų kilmės vardas.'),(77,'Alvilė',' Alvilė yra Moteriškas vardas.','Trumpa reikšmė: al- (alei vienas „kiekvienas“) + vil- (viltis) – „visų viltis“.','Vardo reikšmė: Alvilė – (1), (2) liet., trump. Alvė, iš vyr. v. Alvilas.',' Alvilė yra lietuvių kilmės vardas.'),(78,'Alvydas',' Alvydas yra Vyriškas vardas.','Trumpa reikšmė: al- (aliai vienas) + vyd (prūsiškai widdai „matė“, lietuviškai išvydo) – „visa matantis“.','Vardo reikšmė: Alvydas – (1) suliet. prūs., trump, Alvys, Alvis, tarm. Elvydas piet. žem. (švd.), al- (žr. Albutas) + vyd- (: prus. widdai „matė“, liet. iš-vyd-o).',' Alvydas yra lietuvių kilmės vardas.'),(79,'Alvilas',' Alvilas yra Vyriškas vardas.','Trumpa reikšmė: al- (alei vienas „kiekvienas“) + vil- (viltis) – „visų viltis“.','Vardo reikšmė: Alvilas – (1) liet., trump. Alvys, Alvis, al- (žr. Albutas) + vil- (žr. Algvilas).',' Alvilas yra lietuvių kilmės vardas.'),(80,'Alma',' Alma yra Moteriškas vardas.','Trumpa reikšmė: „maitinanti, -is; palaimą teikianti, -is“.','Vardo reikšmė: Alma – (1) lot., iš lot. Alma: lot. alma „maitinanti, palaimą teikianti.',' Alma yra lotynų kilmės vardas.'),(81,'Alkmenas',' Alkmenas yra Vyriškas vardas.','Trumpa reikšmė: sulietuvintas prūsų: alk- (alkas „šventa giraitė, aukojimo vieta“) + men (minėti).','Vardo reikšmė: Šis vardas stiprina Jūsų lyderio, vadovo sugebėjimus.Galite lengviau sukaupti žinių apie gyvenimo paslaptis, patirtį. Protas tampa analitiškesnis, sugebate giliau įsiskverbti į reiškinių esmę.Atsiranda noras veikti ryžtingiau. Jus jau nebe taip lengva apkvailinti.',' Alkmenas yra lietuvių kilmės vardas.'),(82,'Alvyda',' Alvyda, Alvyda, Alvydė yra Moteriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Alvė, iš vyr. v. Alvydas.','Vardo reikšmė: Vardadienis : Liepos 20d., Gegužės 13d.',' Alvyda, Alvyda, Alvydė yra Lietuvių kilmės vardas.'),(83,'Alvė',' Alvė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Alvyda, -as arba Alvilė, -as.','Vardo reikšmė: Alvė – (2) liet., trumpinys iš mot. v. su Al-v-: Alvyda, Alvilė.',' Alvė yra lietuvių kilmės vardas.'),(84,'Alkmena',' Alkmena, Alkmena, Alkmenė yra Moteriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Alkė, iš vyr. v. Alkmenas.','Vardo reikšmė: Alkmena, Alkmenė – (3b), (1), (1) suliet. prūs., trump. Alkė, iš vyr. v. Alkmenas.',' Alkmena, Alkmena, Alkmenė yra Lietuvių kilmės vardas.'),(85,'Aiva',' Aiva yra Moteriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Aiva – (1) — liet. trumpinys iš Alvyra.',' Aiva yra Lietuvių kilmės vardas.'),(86,'Alkis',' Alkis yra Vyriškas vardas.','Trumpa reikšmė: alkas „šventa giraitė, aukų kalnas, aukojimo vieta“.','Vardo reikšmė: Alkis – (2) liet., iš Vilniaus įkūrimo legendos milžino v. Alkis, galūnės vedinys iš liet. alkas, alka „Šventa giraitė, aukų kalnas, aukojimo vieta.',' Alkis yra lietuvių kilmės vardas.'),(87,'Aluona',' Aluona yra Moteriškas vardas.','Trumpa reikšmė: iš upėvardžio Aluona (Josvainiai).','Vardo reikšmė: Aluona – (3) liet., iš upėvardžio Aluona (Josvainiai).',' Aluona yra lietuvių kilmės vardas.'),(88,'Atautas',' Atautas yra Vyriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Atautas – (1) liet., trump. Altis, Alys, al- (žr. Albutas) + taut- (: liet. taut-a).',' Atautas yra Lietuvių kilmės vardas.'),(89,'Altautė',' Altautė yra Moteriškas vardas.','Trumpa reikšmė: al- (aliai vienas „kiekvienas“) + taut- (tauta).','Vardo reikšmė: Altautė – (1) liet., trump. Altė, Alė, iš vyr. v. Altautas.',' Altautė yra lietuvių kilmės vardas.'),(90,'Aloyzas',' Aloyzas yra Vyriškas vardas.','Trumpa reikšmė: „visa išmanantis“.','Vardo reikšmė: Aloyzas – (2) germ., trump. Alyzas, Alys, Alius, tarm. Alyzius piet. aukšt. (dz.), Eliojyzas, Elius piet. žem. (švd.), iš sulotyninto germ. Aloysius, Aloisius, kuris iš germ. Alwis: sen. vok. aukšt. al „visa + wisi „išmintingas“.',' Aloyzas yra vokiečių kilmės vardas.'),(91,'Andrė',' Andrė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Andrėja, Andriejus.','Vardo reikšmė: Andrė – (2) sulietuvintas, graikų kilmės vardo trumpinys iš Andrėja , taip pat galūnės vedinys iš vyr. v. Andrius.',' Andrė yra graikų kilmės vardas.'),(92,'Aloyza',' Aloyza yra Moteriškas vardas.','Trumpa reikšmė: „visa išmanantis“.','Vardo reikšmė: Aloyza – (2) germ., trump. Alyzė, Alė, iš sulotyninto germ. Aloisia, kuris iš vyr. v. Aloisius, žr. Aloyzas.',' Aloyza yra vokiečių kilmės vardas.'),(93,'Anastazija',' Anastazija yra Moteriškas vardas.','Trumpa reikšmė: „prisikėlęs, prisikėlusi“.','Vardo reikšmė: Vardadienis: Lapkričio 11d., gruodžio 25d.',' Anastazija yra graikų kilmės vardas.'),(94,'Alna',' Alna yra Moteriškas vardas.','Trumpa reikšmė: iš upėvardžio Alna buvusiuose Rytprūsiuose.','Vardo reikšmė: Šis vardas stiprina Jūsų lyderio, sugebėjimus.Galite lengviau sukaupti žinių apie gyvenimo paslaptis ir panaudoti praktikoje. Protas tampa analitiškesnis, sugebate giliau įsiskverbti į reiškinių esmę. Atsiranda noras veikti ryžtingiau. Jus jau nebe taip lengva apkvailinti.',' Alna yra lietuvių kilmės vardas.'),(95,'Anastazas',' Anastazas yra Vyriškas vardas.','Trumpa reikšmė: „prisikėlęs, prisikėlusi“.','Vardo reikšmė: Vardadienis: Sausio 22d., balandžio 27d.',' Anastazas yra graikų kilmės vardas.'),(96,'Almuonė',' Almuonė yra Moteriškas vardas.','Trumpa reikšmė: (1) liet., iš upėvardžio Almuonė (buv. Rytprūsiuose).','Vardo reikšmė: Almuonė – (1) liet., iš upėvardžio Almuonė (buv. Rytprūsiuose).',' Almuonė yra Lietuvių kilmės vardas.'),(97,'Almis',' Almis yra Vyriškas vardas.','Trumpa reikšmė: lietuvių trumpinys iš Almana, -as; Almanta, -as; Alminė, -as.','Vardo reikšmė: Almis – (2) liet., trumpinys iš v. su Al-m-: Almantas, Almanas, Alminas.',' Almis yra lietuvių kilmės vardas.'),(98,'Almintas',' Almintas yra Vyriškas vardas.','Trumpa reikšmė: lietuvių: al- (aliai vienas) + min- (mint, mintis) – „visų minima, -as“.','Vardo reikšmė: Almintas – (1) liet., trump. Almis, al- (žr. Abutas) + mint- (: liet. minti, mint-is).',' Almintas yra lietuvių kilmės vardas.'),(99,'Anakcetas',' Anakcetas yra Vyriškas vardas.','Trumpa reikšmė: „pašauktas“.','Vardo reikšmė: Vardo Anakcetas pirmoji raidė A, kuri simbolizuoja norą imtis naujų planų ir juos įgyvendinti. Esate imlus ir nepriklausomas, turite stiprią valią ir intuiciją. Jus ne taip paprasta pažeisti; labai pasitikite savimi. Esate stiprus, ryžtingas, atkaklus , jums būdingas užsispyrimas . ',' Anakcetas yra Graikų kilmės vardas.'),(100,'Aminta',' Aminta yra Moteriškas vardas.','Trumpa reikšmė: „apginta“.','Vardo reikšmė: Alminta – (2) graik., trump. Inta, iš sulotyninto graik. Aminta, Amynta — „apginta“: graik. amyno „ginti“.',' Aminta yra graikų kilmės vardas.'),(101,'Ambraziejus',' Ambraziejus yra Vyriškas vardas.','Trumpa reikšmė: „nemirtingas“.','Vardo reikšmė: Vardo Ambraziejus pirmoji raidė A, kuri simbolizuoja norą imtis naujų planų ir juos įgyvendinti. Esate imli ir nepriklausoma, turite stiprią valią ir intuiciją. Tai – galingas vardas, suteikiantis Jums gero lyderio savybių. Šio vardo savininkai pasižymės puikia nuojauta, intucija.',' Ambraziejus yra graikų kilmės vardas.'),(102,'Amelija',' Amelija yra Moteriškas vardas.','Trumpa reikšmė: „kova“.','Vardo reikšmė: Amelija – žr. Amalija, tarm. Ameliūnė žem. (švd.).',' Amelija yra vokiečių kilmės vardas.'),(103,'Amarilė',' Amarilė yra Moteriškas vardas.','Trumpa reikšmė: „gaivus šaltinis“.','Vardo reikšmė: Amarilė – (2) graik., trump. Marilė, iš sulotyninto graik. Amaryllis — „gaivus šaltinis.',' Amarilė yra graikų kilmės vardas.'),(104,'Amandas',' Amandas yra Vyriškas vardas.','Trumpa reikšmė: „mylėtina, -as“.','Vardo reikšmė: Amandas – (1) lot., trump. Mandas, iš lot. Amandus: lot. amandus „mylėtinas“.',' Amandas yra lotynų kilmės vardas.'),(105,'Amalija',' Amalija yra Moteriškas vardas.','Trumpa reikšmė: „kova“.','Vardo reikšmė: Vardadienis: Balandžio 21d., Liepos 10d.',' Amalija yra vokiečių kilmės vardas.'),(106,'Amanda',' Amanda yra Moteriškas vardas.','Trumpa reikšmė: „mylėtina, -as“.','Vardo reikšmė: Amanda – (1) lot., trump. Manda, iš lot. Amanda: lot. amanda „mylėtina“.',' Amanda yra lotynų kilmės vardas.'),(107,'Alvys',' Alvys, Alvis yra Vyriškas vardas.','Trumpa reikšmė: liet., trumpinys iš vardų su Al-v-: Alvydas, Alvitas.','Vardo reikšmė: Alvys, Alvis – (4), (2) liet., trumpinys iš vardų su Al-v-: Alvydas, Alvitas.',' Alvys, Alvis yra Lietuvių kilmės vardas.'),(108,'Alvinas',' Alvinas yra Vyriškas vardas.','Trumpa reikšmė: „kilnus draugas“.','Vardo reikšmė: Alvinas – (1) germ., trump. Alvys, Alvis, iš germ. Alvin — „kilnus draugas“, al- kilęs iš adal „kilnus“ + wini „draugas“.',' Alvinas yra vokiečių kilmės vardas.'),(109,'Alvyra',' Alvyra yra Moteriškas vardas.','Trumpa reikšmė: „apsauga, saugotoja, -as“.','Vardo reikšmė: Alvyra – (2) germ., trump. Alva, iš sulotyninto germ. Alvira, kuris iš gotų Alwara: got. alls „visas + wards „apsauga, saugotoja.',' Alvyra yra vokiečių kilmės vardas.'),(110,'Antanė',' Antanė yra Moteriškas vardas.','Trumpa reikšmė: antius „laimingas, džiaugsmingas“.','Vardo reikšmė: Antanės nuolat siekia išskirtinės sėkmės, veržiasi sukurti kažką nauja. Jaučia fizinių ir dvasinių galių perteklių, yra kupini valdžios ir įtakos geismo. Jiems nėra svetimi ir tokie dalykai, kaip atsakomybės jausmas, besąlygiškas teisingumas, maksimalus praktiškumo troškimas.',' Antanė yra graikų kilmės vardas.'),(111,'Alvina',' Alvina yra Moteriškas vardas.','Trumpa reikšmė: „kilnus draugas“.','Vardo reikšmė: Alvina – (2) germ., trump. Alva, iš sulotyninto germ. Alvina, kuris iš vyr. v. Alvinas.',' Alvina yra vokiečių kilmės vardas.'),(112,'Antanas',' Antanas yra Vyriškas vardas.','Trumpa reikšmė: antius „laimingas, džiaugsmingas“.','Vardo reikšmė: Antanai nuolat siekia išskirtinės sėkmės, veržiasi sukurti kažką nauja, daryti pribloškiantį įspūdį. Jaučia fizinių ir dvasinių galių perteklių. Jiems nėra svetimi ir tokie dalykai, kaip atsakomybės jausmas, besąlygiškas teisingumas, maksimalus praktiškos siekimas.',' Antanas yra graikų kilmės vardas.'),(113,'Ansas',' Ansas yra Vyriškas vardas.','Trumpa reikšmė: vak. liet. iš vok. Hans, žr. Jonas.','Vardo reikšmė: Ansas – (1) vak. liet. iš vok. Hans, žr. Jonas.',' Ansas yra vokiečių kilmės vardas.'),(114,'Anta',' Anta yra Moteriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Antanė ir Antanina.','Vardo reikšmė: Šis vardas daro Jus praktiškesniu, efektyvesniu, tvarkingesniu ir priklausomesniu. Jūs jaučiatės esąs principingesnis, doresnis ir ryžtingesnis. Ateityje įgysite daugiau organizacinių sugebėjimų. ',' Anta yra lietuvių kilmės vardas.'),(115,'Ankantas',' Ankantas yra Vyriškas vardas.','Trumpa reikšmė: an- (prielinksnis ant) + kant- (kantrus).','Vardo reikšmė: Sugebate geriau įvertinti detales, jas greičiau pastebite. Jūsų sąmoningumo lygis kyla, o taip pat ilgesnį laiką sugebate atkakliau dirbti. Šis vardas Jums leidžia tapti visuomenės ramsčiu. Draugai, pažįstami ir šeima vertina Jūsų nuomonę.',' Ankantas yra lietuvių kilmės vardas.'),(116,'Anys',' Anys yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Anakletas arba Anastazas.','Vardo reikšmė: (4) liet. trumpinys iš Anakletas, Anastazas ir kt.',' Anys yra graikų kilmės vardas.'),(117,'Anicetas',' Anicetas yra Vyriškas vardas.','Trumpa reikšmė: „nenugalima, -as“.','Vardo reikšmė: Anicetas- iš graikų “nenugalimas”.',' Anicetas yra graikų kilmės vardas.'),(118,'Aniceta',' Aniceta yra Moteriškas vardas.','Trumpa reikšmė: „nenugalima, -as“.','Vardo reikšmė: Aniceta- iš graikų “nenugalimas”.',' Aniceta yra graikų kilmės vardas.'),(119,'Angelius',' Angelius yra Vyriškas vardas.','Trumpa reikšmė: „pranešėja, -as“.','Vardo reikšmė: Jūsų charakteris nepastovus. Nuolatinė nuomonės kaita, emocionalus nepastovumas, intriguojančių pojūčių poreikis tokius žmones gali įstumti į ilgalaikę depresiją. Jums reikia vengti ginčų, nes tai labai stipriai veikia nervinę sistemą.',' Angelius yra graikų kilmės vardas.'),(120,'Anelius',' Anelius yra Vyriškas vardas.','Trumpa reikšmė: „pranešėja, -as“ (iš Angelė, Angelius).','Vardo reikšmė: Anelius- (2) graik., trump. Anys, Nelius, tarm. Anielius piet. aukšt. žem., sulietuvintas pagal mot. v. Anelė iš vyr. v. Angelius.',' Anelius yra graikų kilmės vardas.'),(121,'Angelė',' Angelė yra Moteriškas vardas.','Trumpa reikšmė: „pranešėja, -as“.','Vardo reikšmė: Šio vardo savininkams patartina valdyti savo charakterį, užuot audringai prieštaravus – patylėti. Kadangi jie trokšta lyderiauti, reikėtų norus kontroliuoti. Taip pat reikėtų mokytis, kaip racionaliau tvarkyti savo finansus.',' Angelė yra graikų kilmės vardas.'),(122,'Anelė',' Anelė yra Moteriškas vardas.','Trumpa reikšmė: „pranešėja, -as“ (iš Angelė, Angelius).','Vardo reikšmė: Šio vardo savininkai labai gilinasi į gyvenimo paslaptis. Jų gyvenimo kredo – susirasti tokią vietą, kur galėtų tiesiogiai duoti naudą aplinkiniams. Žinoma, didžiausią naudą gali pateikti tada, kai suranda kelią nuo materialaus į dvasinį.',' Anelė yra graikų kilmės vardas.'),(123,'Arėjas',' Arėjas yra Vyriškas vardas.','Trumpa reikšmė: Ares – graikų karo dievas.','Vardo reikšmė: Arėjas- iš graikų “karo Dievas”.',' Arėjas yra graikų kilmės vardas.'),(124,'Andriejus',' Andriejus yra Vyriškas vardas.','Trumpa reikšmė: „vyriška, -as; drąsi, -us“.','Vardo reikšmė: Jus visi labai myli, gerbia lengvai surandate kontaktus su bet kokiais žmonėmis. Plačiai žvelgiate į pasaulį ir matote daugiau nei kiti, neišskiriant tarptautinių ryšių ir didžių socialinių permainų.',' Andriejus yra graikų kilmės vardas.'),(125,'Arbutas',' Arbutas yra Vyriškas vardas.','Trumpa reikšmė: ar- (ar „taip pat, irgi“) + but- (būti) – „esantis, egzistuojantis“..','Vardo reikšmė: Arbutas – (1) liet. ir prūs., trump. Arbas, Būtys, ar- (: liet. ar, er „taip pat, irgi, latv. ari, prūs. er „t. p.“) + but- (žr. Albutas).',' Arbutas yra lietuvių kilmės vardas.'),(126,'Aras',' Aras yra Vyriškas vardas.','Trumpa reikšmė: „erelis“.','Vardo reikšmė: Aras – (4) liet. 1. trumpinys iš Arūnas, taip pat trumpinys iš vardų su Ar-: Arbutas, Arvaidas, 2. liet.: aras „erelis”',' Aras yra lietuvių kilmės vardas.'),(127,'Andrėja',' Andrėja yra Moteriškas vardas.','Trumpa reikšmė: „vyriška, -as; drąsi, -us“.','Vardo reikšmė: Šio vardo savininkai sugeba gerai išreikšti savo jausmus, mintis tačiau linkę dramatizuoti. Domisi filosofija ir metafizika. Jums kartais labai pasiseka – gauti netikėtą palikimą ar valstybinę premiją. Esate gimęs po laiminga žvaigžde.',' Andrėja yra graikų kilmės vardas.'),(128,'Apolonijus',' Apolonijus yra Vyriškas vardas.','Trumpa reikšmė: „priklausantis Apolonui“ (Apolonas – romėnų ir graikų saulės dievas, menų globėjas).','Vardo reikšmė: Neigiamos savybės: išlaidumas, paviršutiniškumas, plepumas. Kartais ima per daug savimi pasitikėti norėdami sukelti įspūdį ir patikti kitiems. Dažnai išnaudoja įgimtą patrauklumą, kad užkariautų kažkieno simpatiją, ir taip lengvai pasiekia savo tikslą.',' Apolonijus yra lotynų kilmės vardas.'),(129,'Apolonija',' Apolonija yra Moteriškas vardas.','Trumpa reikšmė: „priklausantis Apolonui“ (Apolonas – romėnų ir graikų saulės dievas, menų globėjas).','Vardo reikšmė: Apolonijų gerosios savybės: laki vaizduotė, gabumai menui, muzikalumai ir dramai, reikalaujančiai išradingumo. švelnumas, geraširdiškumas. Meilė, romantika, nes jas supa draugai ir gerbėjai. ',' Apolonija yra lotynų kilmės vardas.'),(130,'Apolinaras',' Apolinaras yra Vyriškas vardas.','Trumpa reikšmė: „apoloniškas, -a“ (Apolonas – romėnų ir graikų saulės dievas, menų globėjas).','Vardo reikšmė: Jų vedybos turi remtis abipusiu supratimu. Gali būti nusikaltamų grupuočių vadai.',' Apolinaras yra lotynų kilmės vardas.'),(131,'Apolinarija',' Apolinarija yra Moteriškas vardas.','Trumpa reikšmė: „apoloniškas, -a“ (Apolonas – romėnų ir graikų saulės dievas, menų globėjas).','Vardo reikšmė: Vardadienis: Sausio 8d., liepos 23d.',' Apolinarija yra lotynų kilmės vardas.'),(132,'Anzelmina',' Anzelmina yra Moteriškas vardas.','Trumpa reikšmė: ans „dievas“ + helm „šalmas“ – „dievo šalmas“ + mažybinė priesaga -in.','Vardo reikšmė: Anzelmina – (2) germ., trump. Anzelma, Zelma, iš sulotyninto germ. Anselmina, kuris yra priesagos -ina vedinys iš Anzelma, žr. Anzelma.',' Anzelmina yra vokiečių kilmės vardas.'),(133,'Anzelma',' Anzelma yra Moteriškas vardas.','Trumpa reikšmė: ans „dievas“ + helm „šalmas“ – „dievo šalmas“.','Vardo reikšmė: (2) germ., trump. Zelma,, iš sulotyninto germ. Anselma, kuris iš vyr. v. Anselmus, žr. Anzelmas',' Anzelma yra vokiečių kilmės vardas.'),(134,'Anzelmas',' Anzelmas yra Vyriškas vardas.','Trumpa reikšmė: ans „dievas“ + helm „šalmas“ – „dievo šalmas“.','Vardo reikšmė: Vardadienis: Kovo 18d., Balandžio 21d.',' Anzelmas yra vokiečių kilmės vardas.'),(135,'Anupras',' Anupras yra Vyriškas vardas.','Trumpa reikšmė: „šventasis jautis“.','Vardo reikšmė: Anupras – (2) egipt., trump, Anys, tarm. Anupris šiaur. žem., iš sulotyninto egiptiečių Onuphrius — „šventasis jautis“',' Anupras yra egiptiečių kilmės vardas.'),(136,'Antonijus',' Antonijus yra Vyriškas vardas.','Trumpa reikšmė: antius „laimingas, džiaugsmingas“.','Vardo reikšmė: Antonijus – (1) lot., trump. Antas, Tonius, Tonis, iš lot. Antonius, kuris iš sen. romėnų giminės vardo Antius.',' Antonijus yra graikų kilmės vardas.'),(137,'Antonija',' Antonija yra Moteriškas vardas.','Trumpa reikšmė: „laimingas, -a; džiaugsmingas, -a“.','Vardo reikšmė: Antonija – (1) lot., trump, Anta, Tonė, tarm. Antonė žem., iš lot. Antonia, kuris iš vyr. v. Antonius, žr. Antonijus.',' Antonija yra graikų kilmės vardas.'),(138,'Arminas',' Arminas yra Vyriškas vardas.','Trumpa reikšmė: ar- (ar „taip pat, irgi“) + min- (minėti) – „irgi minimas, -a“.','Vardo reikšmė: Arminai filosofiškai žiūri į gyvenimą. Teatras, interjero dizainas, muzika – sritys, kurios jiems patinka. Tiki sėkme, todėl kartais gali save palepinti maloniomis smulkmenomis. Atsitinka ir taip, kad praturtėja netikėtai, pavyzdžiui, paveldi solidų palikimą.',' Arminas yra lietuvių kilmės vardas.'),(139,'Antas',' Antas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Antanas: antius „laimingas, džiaugsmingas“.','Vardo reikšmė: Antas – (1) liet. trumpinys iš Antanas.',' Antas yra graikų kilmės vardas.'),(140,'Antanina',' Antanina yra Moteriškas vardas.','Trumpa reikšmė: antius „laimingas, džiaugsmingas, -a“.','Vardo reikšmė: Vardadienis: Kovo 1d., gegužės 4d.',' Antanina yra graikų kilmės vardas.'),(141,'Armantė',' Armantė yra  vardas.','Trumpa reikšmė: liet., trump. Arė, Mantė, iš vyr. v. Armantas.','Vardo reikšmė: Armantė – (1) liet., trump. Arė, Mantė, iš vyr. v. Armantas.',' Armantė yra lietuvių kilmės vardas.'),(142,'Armantas',' Armantas yra Vyriškas vardas.','Trumpa reikšmė: ar- (ar „taip pat, irgi“) + mant- (mantus „sumanus“) – „irgi protingas, -a“.','Vardo reikšmė: Jūsų charakteris nepastovus. Sugebate geriau įvertinti detales, jas greičiau pastebite. Jūsų sąmoningumo lygis kyla, o taip pat ilgesnį laiką sugebate atkakliau dirbti. Šis vardas Jums leidžia tapti visuomenės ramsčiu. Draugai, pažįstami ir šeima vertina Jūsų nuomonę.',' Armantas yra lietuvių kilmės vardas.'),(143,'Arkadijus',' Arkadijus yra Vyriškas vardas.','Trumpa reikšmė: „arkadietis, Arkadijos gyventojas“.','Vardo reikšmė: Jūsų charakteris nepastovus. Nuolatinė nuomonės kaita, emocionalus nepastovumas, intriguojančių pojūčių poreikis tokius žmones gali įstumti į ilgalaikę depresiją. Jums reikia vengti ginčų, nes tai labai stipriai veikia nervinę sistemą.Draugai, pažįstami ir šeima vertina Jūsų nuomonę ir norus.',' Arkadijus yra graikų kilmės vardas.'),(144,'Arkadas',' Arkadas yra Vyriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Arkadijus.','Vardo reikšmė: Šio vardo savininkams patartina valdyti savo charakterį, užuot audringai prieštaravus – patylėti. Kadangi jie trokšta lyderiauti, reikėtų norus kontroliuoti. Taip pat reikėtų mokytis, kaip racionaliau tvarkyti savo finansus.Tos savybės rodo savo teisių žinojimą, nepajudinamą valios jėgą.',' Arkadas yra graikų kilmės vardas.'),(145,'Aristidas',' Aristidas yra Vyriškas vardas.','Trumpa reikšmė: „geriausia, -as; kilminga, -as“.','Vardo reikšmė: Aristidas – (2) graik. trump. Aristas, Tidas, iš sulotyninto graik. Aristides: graik. aristos „geriausias, kilmingas“.',' Aristidas yra graikų kilmės vardas.'),(146,'Arys',' Arys yra Vyriškas vardas.','Trumpa reikšmė: liet., trumpinys iš avd. su Ar(i)-: Arimantas, Arminas ir kt.','Vardo reikšmė: Arys – (4) liet., trumpinys iš avd. su Ar(i)-: Arimantas, Arminas ir kt. ',' Arys yra lietuvių kilmės vardas.'),(147,'Arimantė',' Arimantė yra Moteriškas vardas.','Trumpa reikšmė: ar- (ar „taip pat, irgi“) + mant- (mantus „sumanus“) – „irgi protingas, -a“.','Vardo reikšmė: Arimantas – iš liet. trumpinio Arys.',' Arimantė yra lietuvių kilmės vardas.'),(148,'Arimantas',' Arimantas yra Vyriškas vardas.','Trumpa reikšmė: ar- (ar „taip pat, irgi“) + mant- (mantus „sumanus“) – „irgi protingas, -a“.','Vardo reikšmė: Arimantas – iš liet. trumpinio Arys.',' Arimantas yra lietuvių kilmės vardas.'),(149,'Arvė',' Arvė yra Moteriškas vardas.','Trumpa reikšmė: liet, trumpinys iš vardų su Ar-v-: Arvaidė, Arvyda ir kt..','Vardo reikšmė: Šio vardo turėtojos dažniausiai pasižymi gera intucija, ryžtingumu ir puikia sveikata.',' Arvė yra lietuvių kilmės vardas.'),(150,'Arijus',' Arijus yra Vyriškas vardas.','Trumpa reikšmė: Ares – graikų karo dievas.','Vardo reikšmė: Arijus- iš graikų “karo Dievas”.',' Arijus yra graikų kilmės vardas.'),(151,'Arvaldė',' Arvaldė yra Moteriškas vardas.','Trumpa reikšmė: sulietuvintas prūsų: ar- (ar „taip pat, irgi“) + vald- (valdyti).','Vardo reikšmė: Jums reikėtų išmokti atleisti, vengti kvailų poelgių ir įpročių, tokių, kaip persivalgymo, įsitraukimo į girtuoklystę ar palaidą gyvenimą. Nors ir šios savybės rodo silpną valią, bet Jūs esate nuoširdus , nemeluojate ir iš gyvenimo norite pasiimti viskas kas geriausia.',' Arvaldė yra lietuvių kilmės vardas.'),(152,'Argintas',' Argintas yra Vyriškas vardas.','Trumpa reikšmė: ar- (ar „taip pat, irgi“) + gin- (ginti) – „gynėja, -as“.','Vardo reikšmė: Šio vardo savininkai sugeba gerai išreikšti savo jausmus, mintis tačiau linkę dramatizuoti. Domisi filosofija ir metafizika, psichologija ir parapsichologija. Jums kartais labai pasiseka – gauti netikėtą palikimą ar valstybinę premiją. Esate gimęs po laiminga žvaigžde.',' Argintas yra lietuvių kilmės vardas.'),(153,'Arvaidas',' Arvaidas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump, Arvas, Arvys, ar- (žr. Arbutas) + vald- (: liet. vald-yti).','Vardo reikšmė: Jus visi labai gerbia, lengvai surandate kontaktus su bet kokiais žmonėmis. Plačiai žvelgiate į pasaulį ir matote daugiau nei kiti, neišskiriant tarptautinių ryšių ir didžių socialinių permainų. Tos savybės rodo savo teisių žinojimą, nepajudinamą valios galią.',' Arvaidas yra lietuvių kilmės vardas.'),(154,'Arvaidas',' Arvaidas yra Vyriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Šio vardo savininkai labai gilinasi į gyvenimo paslaptis turi labai išmintingą protą – idealistai,. Jų gyvenimo noras – susirasti tokią vietą, kur galėtų tiesiogiai duoti naudą aplinkiniams. Žinoma, didžiausią naudą gali pateikti tada, kai suranda kelią nuo materialaus į dvasinį.',' Arvaidas yra lietuvių kilmės vardas.'),(155,'Argaudas',' Argaudas yra Vyriškas vardas.','Trumpa reikšmė: ar- (ar „taip pat, irgi“) + gaud- (gaudyti) – „gaudančioji, -ysis“.','Vardo reikšmė: Vardadienis: Sausio 30d., rugpjūčio 19d.',' Argaudas yra lietuvių kilmės vardas.'),(156,'Arūnas',' Arūnas yra Vyriškas vardas.','Trumpa reikšmė: aras „erelis“ + -ūnas.','Vardo reikšmė: Arūnams patariama kontroliuoti savo charakterį, mažiau kištis į konfliktus – patylėti. Nors ir kaip jie trokšta lyderiauti, reikėtų norus kontroliuoti. Taip pat reikėtų išmokti elgtis su savo pinigais.',' Arūnas yra lietuvių kilmės vardas.'),(157,'Arūnė',' Arūnė yra Moteriškas vardas.','Trumpa reikšmė: aras „erelis“ + -ūnas.','Vardo reikšmė: Arūnėms patartina valdyti savo charakterį, užuot audringai prieštaravus – patylėti. Kadangi jos trokšta lyderiauti, reikėtų norus kontroliuoti. Taip pat reikėtų mokytis, kaip racionaliau tvarkyti savo finansus.',' Arūnė yra lietuvių kilmės vardas.'),(158,'Artūras',' Artūras yra Vyriškas vardas.','Trumpa reikšmė: „tvirtas lokys, stiprus kaip lokys“.','Vardo reikšmė: Artūrai sapnuoja nuostabius sapnus, iš kurių kartais semiasi naujų idėjų. Stengiasi suprasti slaptą sapnų esmę, gilinasi į ezoterikos paslaptis.',' Artūras yra keltų kilmės vardas.'),(159,'Arfautas',' Arfautas yra  vardas.','Trumpa reikšmė: liet., trump. Artys, Tautas, ar- (žr. Arbutas) + taut- (žr. Altautas).','Vardo reikšmė: Panšūs vardai: Altautas, Artys, Arbutas.',' Arfautas yra lietuvių kilmės vardas.'),(160,'Artautė',' Artautė yra Moteriškas vardas.','Trumpa reikšmė: ar- (ar „taip pat, irgi“) + taut- (tauta) – „irgi už tautą“..','Vardo reikšmė: Artautė – (1) liet., trump. Artė, Tautė, iš vyr. v. Artautas.',' Artautė yra lietuvių kilmės vardas.'),(161,'Astrida',' Astrida yra Moteriškas vardas.','Trumpa reikšmė: ans „dievas“ + rida „joti“ – „dievo jojimas“.','Vardo reikšmė: Jūsų charakteris nepastovus. Nuolatinė nuomonės kaita, emocionalus nepastovumas, intriguojančių pojūčių poreikis tokius žmones gali įstumti į ilgalaikę depresiją. Jums reikia vengti ginčų, nes tai labai stipriai veikia nervinę sistemą.Draugai, pažįstami ir šeima vertina Jūsų nuomonę ir norus.',' Astrida yra skandinavų kilmės vardas.'),(162,'Arnoldas',' Arnoldas yra Vyriškas vardas.','Trumpa reikšmė: arn- „erelis“ + waltan „valdyti“.','Vardo reikšmė: Jūsų charakteris nepastovus. Sugebate geriau įvertinti detales, jas greičiau pastebite. Jūsų sąmoningumo lygis kyla, o taip pat ilgesnį laiką sugebate atkakliau dirbti. Šis vardas Jums leidžia tapti visuomenės ramsčiu. Draugai, pažįstami ir šeima vertina Jūsų nuomonę.',' Arnoldas yra vokiečių kilmės vardas.'),(163,'Astra',' Astra yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Astrida: ans „dievas“ + rida „joti“ – „dievo jojimas“.','Vardo reikšmė: Astra – (2) liet. trumpinys iš Astrida.',' Astra yra skandinavų kilmės vardas.'),(164,'Astijus',' Astijus yra Vyriškas vardas.','Trumpa reikšmė: „miestas“.','Vardo reikšmė: Astijus – (1) graik., trump. Astas, iš sulotyninto graik. Astius : graik. asty „miestas“ .',' Astijus yra graikų kilmės vardas.'),(165,'Arnas',' Arnas yra Vyriškas vardas.','Trumpa reikšmė: „erelis“.','Vardo reikšmė: Arnas – (1) germ., iš germ. Arn, Arno, kuris yra dvikamienių vardų su Arn- (Arnold, Arnulf) trumpinys: sen. vok. aukšt. arn- „erelis“.',' Arnas yra vokiečių kilmės vardas.'),(166,'Asterijus',' Asterijus yra Vyriškas vardas.','Trumpa reikšmė: „žvaigždiška, žvaigždiškas“.','Vardo reikšmė: Asterijus – (1) graik., trump. Asteras, iš sulotyninto graik. Asterius: graik. asterios „žvaigždžių, žvaigždiškas',' Asterijus yra graikų kilmės vardas.'),(167,'Armintas',' Armintas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Arys, ar- (žr. Arbutas) + mint- (žr. Almintas).','Vardo reikšmė: Armintas – (1) liet., trump. Arys, ar- (žr. Arbutas) + mint- (žr. Almintas).',' Armintas yra lietuvių kilmės vardas.'),(168,'Asterija',' Asterija yra Moteriškas vardas.','Trumpa reikšmė: „žvaigždiška, žvaigždiškas“.','Vardo reikšmė: (1) graik., trump. Astera, iš sulotyninto graik. Asteria, kuris iš vyr. v. Asterijus',' Asterija yra graikų kilmės vardas.'),(169,'Astas',' Astas yra Vyriškas vardas.','Trumpa reikšmė: Lyderis.','Vardo reikšmė: Astas (2) liet. trumpinys iš Astijus.',' Astas yra lietuvių kilmės vardas.'),(170,'Astė',' Astė yra Moteriškas vardas.','Trumpa reikšmė: Stiprus ryžtingas.','Vardo reikšmė: Šio vardo savininkė pasižymi tvirtu charakteriu, ryžtu ir ištverme. Turi neeilinių sugebėjimų archeologijos srityse.',' Astė yra lietuvių kilmės vardas.'),(171,'Asta',' Asta yra Moteriškas vardas.','Trumpa reikšmė:  iš Anastazija: „prisikėlęs, prisikėlusi“.','Vardo reikšmė: Asta – (2) liet. trumpinys iš Anastazija, Augusta ir kt.',' Asta yra graikų kilmės vardas.'),(172,'Arvystė',' Arvystė yra Moteriškas vardas.','Trumpa reikšmė: ar- (ar „taip pat, irgi“) + vyst- (iš-vysti, iš-vysta).','Vardo reikšmė: Arvystė – (l) liet. ir prūs., trump. Arvė, iš vyr. v. Arvystas.',' Arvystė yra lietuvių kilmės vardas.'),(173,'Arvystas',' Arvystas yra Vyriškas vardas.','Trumpa reikšmė: ar- (ar „taip pat, irgi“) + vyst- (iš-vysti, iš-vysta).','Vardo reikšmė: Arvystas – (1) liet. ir prūs., trump. Arvys, Arvis, ar- (žr. Arbutas) + vyst- (: liet. iš-vysti, iš-vysta).',' Arvystas yra lietuvių kilmės vardas.'),(174,'Arvilė',' Arvilė yra Moteriškas vardas.','Trumpa reikšmė: ar- (ar „taip pat, irgi“) + vil- (viltis).','Vardo reikšmė: Vardadienis: Vasario 4 d., liepos 17 d.',' Arvilė yra lietuvių kilmės vardas.'),(175,'Arvilas',' Arvilas yra Vyriškas vardas.','Trumpa reikšmė: ar- (ar „taip pat, irgi“) + vil- (viltis).','Vardo reikšmė: Arvilas – (1) suliet. prūs., trump. Arvys, Arvis, ar- (žr. Arbutas) + vil- (žr. Alvilas)',' Arvilas yra lietuvių kilmės vardas.'),(176,'Audingas',' Audingas yra Vyriškas vardas.','Trumpa reikšmė: sulietuvintas prūsų: au (prūsiškai „be, nuo, šalin“) + ding- (dingoti „nujausti, numanyti“) – „nujaučiantis, -i“.','Vardo reikšmė: Audingas – (1) liet., trump. Audys: au- (žr. Aubartas) + ding- (: prūs. po-dingan „patiktų“, plg. liet. ding-oti „nujausti, numanyti“).',' Audingas yra lietuvių kilmės vardas.'),(177,'Arvydas',' Arvydas yra Vyriškas vardas.','Trumpa reikšmė: ar- (ar „taip pat, irgi“) + vyd (prūsiškai widdai „matė“, lietuviškai išvydo).','Vardo reikšmė: Arvydas – (1) liet. ir prūs., trump. Arvys, Arvis, ar- (žr. Arbutas) + vyd- (žr. Alvydas).',' Arvydas yra lietuvių kilmės vardas.'),(178,'Audangė',' Audangė yra Moteriškas vardas.','Trumpa reikšmė: au (prūsiškai „be, nuo, šalin“) + dang- (dang-intis „greitai bėgti“) – „greitai šalin bėgantis, -i“.','Vardo reikšmė: Audangė – (1) suliet. prūs., trump. Audė, iš vyr. v. Audangas.',' Audangė yra prūsų kilmės vardas.'),(179,'Audangas',' Audangas yra Vyriškas vardas.','Trumpa reikšmė: au (prūsiškai „be, nuo, šalin“) + dang- (dang-intis „greitai bėgti“) – „greitai šalin bėgantis, -i“.','Vardo reikšmė: Audangas – (1) suliet. prūs., trump. Audas, Audys, au- (žr. Aubartas) + dang- (: liet. dang-intis, deng-ti „greitai bėgti“).',' Audangas yra prūsų kilmės vardas.'),(180,'Aubartė',' Aubartė yra Moteriškas vardas.','Trumpa reikšmė: sulietuvintas prūsų: au (prūsiškai „be, nuo, šalin“) + bart- (barti) – „be barnių“.','Vardo reikšmė: Aubartė – (1) liet., trump. Bartė, iš vyr. v. Aubartas.',' Aubartė yra lietuvių kilmės vardas.'),(181,'Aubartas',' Aubartas yra Vyriškas vardas.','Trumpa reikšmė: sulietuvintas prūsų: au (prūsiškai „be, nuo, šalin“) + bart- (barti) – „be barnių“.','Vardo reikšmė: (l) liet., trump. Bartas, au- (: prūs. au „nuo, be, šalin“, plg. liet. au-monėm „be nuovokos) + bart- (: liet. barti sen. reikšme „kovoti“, plg. rus. borotjsia „kovoti“)',' Aubartas yra lietuvių kilmės vardas.'),(182,'Atėnė',' Atėnė yra Moteriškas vardas.','Trumpa reikšmė: graikų išminties deivė Atėnė.','Vardo reikšmė: Atėnė – Dzeuso ir Heros dukra. Tai išminties, karo deivė Žmonėms, kuriuos globoja Atėnė, gerai sekasi verslas.',' Atėnė yra graikų kilmės vardas.'),(183,'Atanazas',' Atanazas yra Vyriškas vardas.','Trumpa reikšmė: „nemirtingumas“.','Vardo reikšmė: Atanazas – (2) graik., trump. A tas, iš sulotynin-to graik. Athanasius, graik. athanasia „nemirtingumas“.',' Atanazas yra graikų kilmės vardas.'),(184,'Atalija',' Atalija yra Moteriškas vardas.','Trumpa reikšmė: „atlietė, Atalijos miesto Mažojoje Azijoje gyventoja“.','Vardo reikšmė: Atalija – (1) graik., trump. Atalė, Talė, iš sulotyninto graik. Atalia – „atalietė, Atalijos miesto (Mažojoje Azijoje) gyventoja“.',' Atalija yra graikų kilmės vardas.'),(185,'Ašvilė',' Ašvilė yra Vyriškas vardas.','Trumpa reikšmė: trumpiniai iš Algimantas, Algimantė arba Algirdas, Algirdė arba Algvilas, Algvilė.','Vardo reikšmė: Vardo Ašvilė pirmoji raidė A, kuri simbolizuoja norą imtis naujų planų ir juos įgyvendinti.Tampate reiklesnis sau pačiam ir kitiems. Esate imlus ir nepriklausomas, turite stiprią valią ir intuiciją.',' Ašvilė yra lietuvių kilmės vardas.'),(186,'Ašvydas',' Ašvydas yra Vyriškas vardas.','Trumpa reikšmė: aš- (až, ažu „užu“) + vyd (prūsiškai widdai „matė“, lietuviškai išvydo).','Vardo reikšmė: Ašvydas – (1) liet., trump. Ašvys, aš- (žr. Ašmantas) + vyd- (žr. Alvydas).',' Ašvydas yra lietuvių kilmės vardas.'),(187,'Ašvilas',' Ašvilas yra Vyriškas vardas.','Trumpa reikšmė: aš- (až, ažu „užu“) + vil (viltis) – „už vilties ribų“.','Vardo reikšmė: Ašvilas – (1) liet,. trump. Ašvys: aš- (žr. Ašmantas) + vil- (žr. Alvilas).',' Ašvilas yra lietuvių kilmės vardas.'),(188,'Augenis',' Augenis yra Vyriškas vardas.','Trumpa reikšmė: augus, -i „augalotas, -a; aukštas, -a“.','Vardo reikšmė: Augenis – (2) liet., trump. Augis, priesagos -enis vedinys iš Augas.',' Augenis yra lietuvių kilmės vardas.'),(189,'Augenė',' Augenė yra Moteriškas vardas.','Trumpa reikšmė: augus, -i „augalotas, -a; aukštas, -a“.','Vardo reikšmė: Augenė – (2) liet., trump. Augė, iš vyr. v. Augenis.',' Augenė yra lietuvių kilmės vardas.'),(190,'Ašmantė',' Ašmantė yra Moteriškas vardas.','Trumpa reikšmė: aš- (až, ažu „užu“) + mant- (mantus „sumanus“) – „už sumanumo, proto ribų“.','Vardo reikšmė: Ašmantė – (1) liet., trump. Ašmė, iš vyr. v. Ašmantas.',' Ašmantė yra lietuvių kilmės vardas.'),(191,'Augedas',' Augedas yra Vyriškas vardas.','Trumpa reikšmė: au (prūsiškai „be, nuo, šalin“) + ged- (gedauti, gedėti „ilgėtis“).','Vardo reikšmė: (1) liet., trump. Augis, au- (žr. Aubartas) + ged- (žr. Algedas)',' Augedas yra lietuvių kilmės vardas.'),(192,'Ašmantas',' Ašmantas yra Vyriškas vardas.','Trumpa reikšmė: aš- (až, ažu „užu“) + mant- (mantus „sumanus“) – „už sumanumo, proto ribų“.','Vardo reikšmė: Ašmantas – (l) liet., trump. Ašmys, aš- iš až-(: liet. priel. až, ažu „už“) + mant- (žr. Algimantas).',' Ašmantas yra lietuvių kilmės vardas.'),(193,'Augė',' Augė yra Moteriškas vardas.','Trumpa reikšmė: augus, -i „augalotas, -a; aukštas, -a“.','Vardo reikšmė: Augė – (2) liet., iš vyr. Augis.',' Augė yra lietuvių kilmės vardas.'),(194,'Augas',' Augas yra Vyriškas vardas.','Trumpa reikšmė: Augalotas.','Vardo reikšmė: Augas – (2) liet.: liet. augus „augalotas“.',' Augas yra lietuvių kilmės vardas.'),(195,'Augantė',' Augantė yra Moteriškas vardas.','Trumpa reikšmė: augus, -i „augalotas, -a; aukštas, -a“.','Vardo reikšmė: Augantė -(1) liet., trump. A ugė, iš vyr. v. Augantas.',' Augantė yra lietuvių kilmės vardas.'),(196,'Augantas',' Augantas yra Vyriškas vardas.','Trumpa reikšmė: augus, -i „augalotas, -a; aukštas, -a“.','Vardo reikšmė: Augantas – (1) liet., Irump. Augas: priesagos -antas vedinys iš liet. augus „augalotas“.',' Augantas yra lietuvių kilmės vardas.'),(197,'Audrūnas',' Audrūnas yra Vyriškas vardas.','Trumpa reikšmė: Audrūnas - (1) liet., priesagos -ūnas vedinys iš liet. audra..','Vardo reikšmė: Audrūnas – (1) liet., priesagos -ūnas vedinys iš liet. audra.',' Audrūnas yra lietuvių kilmės vardas.'),(198,'Audrūnė',' Audrūnė yra Moteriškas vardas.','Trumpa reikšmė: „audra“ + priesagos.','Vardo reikšmė: Audrūnė (1) liet., priesagos -ūnė vedinys iš liet. audra',' Audrūnė yra lietuvių kilmės vardas.'),(199,'Audronė',' Audronė yra Moteriškas vardas.','Trumpa reikšmė: „audra“ + priesagos.','Vardo reikšmė: Audronė – (2) liet., priesagos -onė vedinys iš liet. audra.',' Audronė yra lietuvių kilmės vardas.'),(200,'Aventinas',' Aventinas yra Vyriškas vardas.','Trumpa reikšmė: lot., trump. Aventas, iš lot. Aventinus: lot. Aventinus — viena iš septynių Romos kalvų..','Vardo reikšmė: Aventinas – (2) lot., trump. Aventas, iš lot. Aventinus: lot. Aventinus — viena iš septynių Romos kalvų.',' Aventinas yra lotynų kilmės vardas.'),(201,'Aušvydas',' Aušvydas yra Vyriškas vardas.','Trumpa reikšmė: auš- (aušti) + vyd- (prūsiškai widdai „matė“, lietuviškai iš-vydo) – „su aušra išvydęs, -usi“.','Vardo reikšmė: Aušvydas – (1) liet., trump. Vydas, auš- (: liet. auš-ti, auš-ra) + vyd- (žr. Alvydas).',' Aušvydas yra lietuvių kilmės vardas.'),(202,'Audrė',' Audrė yra Moteriškas vardas.','Trumpa reikšmė: „audra“.','Vardo reikšmė: Audrė – (2) liet.: metatoninis galūnės vedinys iš liet. audra.',' Audrė yra lietuvių kilmės vardas.'),(203,'Audra',' Audra yra Moteriškas vardas.','Trumpa reikšmė: „audra“.','Vardo reikšmė: .',' Audra yra lietuvių kilmės vardas.'),(204,'Augūnė',' Augūnė yra Moteriškas vardas.','Trumpa reikšmė: augus „augalotas, didelis“.','Vardo reikšmė: Augūnė – (1) liet., trump. Augė, iš vyr. v. Augūnas.',' Augūnė yra lietuvių kilmės vardas.'),(205,'Augūnas',' Augūnas yra Vyriškas vardas.','Trumpa reikšmė: augus „augalotas, didelis“.','Vardo reikšmė: Augūnas – (1) liet., trump. Augius, priesagos -ūnas vedinys iš avd. Augas.',' Augūnas yra lietuvių kilmės vardas.'),(206,'Augraudė',' Augraudė yra Moteriškas vardas.','Trumpa reikšmė: aug- (augti) + graud- (graudus reikšme „smarkus, rūstus“) – „augantis smarkuolis“.','Vardo reikšmė: (1) suliet. prūs., trump. Augė, iš vyr. v. Augraudas',' Augraudė yra lietuvių kilmės vardas.'),(207,'Augraudas',' Augraudas yra Vyriškas vardas.','Trumpa reikšmė: aug- (augti) + graud- (graudus reikšme „smarkus, rūstus“) – „augantis smarkuolis“.','Vardo reikšmė: Augraudas – (1) suliet. prūs., trump. Augas, au- (žr. Aubartas) + graud- (: liet. graud-us „smarkus, rūstus“, prūs. en-graudis „pasigailėk“).',' Augraudas yra lietuvių kilmės vardas.'),(208,'Augminas',' Augminas yra Vyriškas vardas.','Trumpa reikšmė: aug- (augti) + min- (minėti) – „augantis ir minimas“.','Vardo reikšmė: Augminas – (1) liet., trump. Augis, aug- (žr. Augmantas) + min- (žr. Algminas).',' Augminas yra lietuvių kilmės vardas.'),(209,'Augmilė',' Augmilė yra Moteriškas vardas.','Trumpa reikšmė: aug- (augti) + mil- (pa-milti) – „augantis ir mylimas“.','Vardo reikšmė: Vardo Augmilė pirmoji raidė A, kuri simbolizuoja norą imtis naujų planų ir juos įgyvendinti.Tampate reiklesnis sau pačiam ir kitiems. Esate imlus ir nepriklausomas, turite stiprią valią ir intuiciją. ',' Augmilė yra lietuvių kilmės vardas.'),(210,'Augmilas',' Augmilas yra Vyriškas vardas.','Trumpa reikšmė: aug- (augti) + mil- (pa-milti) – „augantis ir mylimas“.','Vardo reikšmė: Augmilas – (1) liet., trump. Augis, aug- (žr. Augmantas) + mil- (žr. Almilas).',' Augmilas yra lietuvių kilmės vardas.'),(211,'Augmantė',' Augmantė yra Moteriškas vardas.','Trumpa reikšmė: aug- (augti) + mant- (mantus „sumanus, protingas“) – „augantis ir protingas“.','Vardo reikšmė: Augmantė – (1) liet., trump. Augė, iš vyr. v. Augmantas.',' Augmantė yra lietuvių kilmės vardas.'),(212,'Augmantas',' Augmantas yra Vyriškas vardas.','Trumpa reikšmė: aug- (augti) + mant- (mantus „sumanus, protingas“) – „augantis ir protingas“.','Vardo reikšmė: Augmantas – (1) liet., trump. Augas, aug-(: liet. aug-ti) + mant- (žr. Algimantas)',' Augmantas yra lietuvių kilmės vardas.'),(213,'Aumantė',' Aumantė yra Moteriškas vardas.','Trumpa reikšmė: au (prūsiškai „be, nuo, šalin“) + mant- (mantus „sumanus“).','Vardo reikšmė: Aumantė – (1) liet., trump. Aumė, Mantė, iš vyr. v. Aumantas.',' Aumantė yra lietuvių kilmės vardas.'),(214,'Aumantas',' Aumantas yra Vyriškas vardas.','Trumpa reikšmė: au (prūsiškai „be, nuo, šalin“) + mant- (mantus „sumanus“).','Vardo reikšmė: Aumantas – (1) liet., trump. Aumis, Mantas, au- (žr. Aubartas) + mant- (žr. Algimantas).',' Aumantas yra lietuvių kilmės vardas.'),(215,'Auksuolė',' Auksuolė yra Moteriškas vardas.','Trumpa reikšmė: „auksinė“.','Vardo reikšmė: Auksuolė – (2) liet., trump. Auksė: priesagos -uolė vedinys iš liet. auksas, vertinys iš lot. Aurelia, žr. Aurelija.',' Auksuolė yra lietuvių kilmės vardas.'),(216,'Auksė',' Auksė yra Moteriškas vardas.','Trumpa reikšmė: „auksinė, auksinis“.','Vardo reikšmė: Auksės turi savybių, būdingų skaičiaus “devyni” vibracijai. Jos dvelkia gerumu, dosnumu silpniesiems bei vargšams. ',' Auksė yra lietuvių kilmės vardas.'),(217,'Augvinas',' Augvinas yra Vyriškas vardas.','Trumpa reikšmė: aug- (augti) + vin- (baltų vaina „priežastis, kaltė“).','Vardo reikšmė: Augvinas – (1) liet., trump. Augis, aug- (žr. Augmantas) + vin- (sen. liet. vin- su balsių kaita iš vaina „priežastis, kaltė“).',' Augvinas yra lietuvių kilmės vardas.'),(218,'Augvilė',' Augvilė yra Moteriškas vardas.','Trumpa reikšmė: aug- (augti) +vil- (viltis).','Vardo reikšmė: Augvilė – (1), (2) liet., trump. Augė, iš vyr. v. Augvilas.',' Augvilė yra lietuvių kilmės vardas.'),(219,'Augvilas',' Augvilas yra Vyriškas vardas.','Trumpa reikšmė: aug- (augti) +vil- (viltis).','Vardo reikšmė: Augvilas – (1) liet., trump. Augis, aug- (žr. Augmantas) + vil- (žr. Alvilas).',' Augvilas yra lietuvių kilmės vardas.'),(220,'Augvydas',' Augvydas yra Vyriškas vardas.','Trumpa reikšmė: aug- (augti) + vyd- (iš-vydo).','Vardo reikšmė: Augvydas – (1) liet., trump. Augis, aug- (žr. Augmantas) + vyd- (žr. Alvydas).',' Augvydas yra lietuvių kilmės vardas.'),(221,'Augutis',' Augutis yra Vyriškas vardas.','Trumpa reikšmė: augus, -i „augalotas, -a; aukštas, -a“ + mažybinė priesaga -ut-.','Vardo reikšmė: Augutis – (2) liet., trump. Augius: priesagos -utis vedinys iš avd. Augas.',' Augutis yra lietuvių kilmės vardas.'),(222,'Augutė',' Augutė yra Moteriškas vardas.','Trumpa reikšmė: augus, -i „augalotas, -a; aukštas, -a“ + mažybinė priesaga -ut-.','Vardo reikšmė: Augutė – (2) liet., trump. Augė, iš vyr. v. Augutis.',' Augutė yra lietuvių kilmės vardas.'),(223,'Augustinas',' Augustinas yra Vyriškas vardas.','Trumpa reikšmė: „didžiai garbingas, didingas“ + -in-.','Vardo reikšmė: Vardadienis: Balandžio 29 d., gegužės 27 d., gegužės 28 d.',' Augustinas yra lotynų kilmės vardas.'),(224,'Aušrinė',' Aušrinė yra Moteriškas vardas.','Trumpa reikšmė: „aušra“ + -inė, mitologinės lietuvių pagonių grožio dievaitės vardas.','Vardo reikšmė: Vardadienis: Liepos 25 d., rugpjūčio 27 d.',' Aušrinė yra lietuvių kilmės vardas.'),(225,'Augustina',' Augustina yra Moteriškas vardas.','Trumpa reikšmė: „didžiai garbingas, didingas“ + -in-.','Vardo reikšmė: Augustina – (2) lot., trump. Augustė, Gustina, Gustė, tarm. Austyna vak. liet., iš lot. Augustina, kuris iš vyr. v. Augustinus, žr. Augustinas.',' Augustina yra lotynų kilmės vardas.'),(226,'Aušrė',' Aušrė yra Moteriškas vardas.','Trumpa reikšmė: aušra „tyra, -as kaip aušra“.','Vardo reikšmė: (2) liet., galūnės vedinys iš liet. aušra',' Aušrė yra lietuvių kilmės vardas.'),(227,'Augustas',' Augustas yra Vyriškas vardas.','Trumpa reikšmė: „didžiai garbingas, didingas“.','Vardo reikšmė: Vyras šiuo vardu nepakęs melo ir ko gero bus aršus teisybės gynėjas. Jo gyvenime bus daug permainų, todėl jo šeimos nariai neturėtų stebėtis intensyviu šio vyro gyenimo tempu ar dažnu nuovargiu. Savo partnerius ir šeimą jis bus linkęs ginti be gailesčio, bet lygiai taip pat nepakęs neištikimybės.',' Augustas yra lotynų kilmės vardas.'),(228,'Austėja',' Austėja yra Moteriškas vardas.','Trumpa reikšmė: aust- (austi, austas) + -ėja „audėja“ . Senovės lietuvių tikėjimo deivė - bičių globėja..','Vardo reikšmė: Tėvams vertėtų nuo mažens mokyti dukrą paprastų kasdieninių darbelių, kad išugdytų poreikį įgyvendinti savo planus. Nes būtent nemokėjimas praktiškai įgyvendinti savo norų gali pastoviai stabdyti šios nuostabios asmenybės atsiskleidimui.',' Austėja yra lietuvių kilmės vardas.'),(229,'Aušra',' Aušra yra Moteriškas vardas.','Trumpa reikšmė: aušra „tyra, -as kaip aušra“.','Vardo reikšmė: Aušra – (4) liet.: liet. aušra.',' Aušra yra lietuvių kilmės vardas.'),(230,'Austė',' Austė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Austėja: aust- (austi, austas) + -ėja „audėja“.','Vardo reikšmė: Austė – (2) liet. trumpinys iš Austėja.',' Austė yra lietuvių kilmės vardas.'),(231,'Aurimė',' Aurimė yra Moteriškas vardas.','Trumpa reikšmė: au (prūsiškai „be, nuo, šalin“) + rim- (rimti, rimo).','Vardo reikšmė: Aurimė – (1) liet., trump. Aurė, iš vyr. v. Aurimas.',' Aurimė yra lietuvių kilmės vardas.'),(232,'Aurimas',' Aurimas yra Vyriškas vardas.','Trumpa reikšmė: au (prūsiškai „be, nuo, šalin“) + rim- (rimti, rimo).','Vardo reikšmė: Aurimas – (1) liet., trump. Aurys, Aurius, Auris: au- (žr. Aubartas) + rim- (: liet. rim-ti, rim-o).',' Aurimas yra lietuvių kilmės vardas.'),(233,'Aurelijus',' Aurelijus yra Vyriškas vardas.','Trumpa reikšmė: „auksinė, auksinis“.','Vardo reikšmė: Aurelijai puikūs darbuotojai. Jie mėgsta dirbti kolektyve, o ne vieni.',' Aurelijus yra lotynų kilmės vardas.'),(234,'Aurelijonas',' Aurelijonas yra Vyriškas vardas.','Trumpa reikšmė: lot., trump. Aurelis, Auras, iš lot. Aurelianus, kuris yra priesagos -anus vedinys iš Aurelius,žr. Aurelijus.','Vardo reikšmė: Aurelijonas – (2) lot., trump. Aurelis, Auras, iš lot. Aurelianus, kuris yra priesagos -anus vedinys iš Aurelius,žr. Aurelijus.',' Aurelijonas yra Lotynų kilmės vardas.'),(235,'Aurelija',' Aurelija yra Moteriškas vardas.','Trumpa reikšmė: „auksinė, auksinis“.','Vardo reikšmė: Aurelijos puikios darbuotojos. Jos mėgsta dirbti kolektyve, o ne vienos. Jos puikios mokytojos, rašytojos, žurnalistės, politikės, filosofės. ',' Aurelija yra lotynų kilmės vardas.'),(236,'Aurėja',' Aurėja yra Moteriškas vardas.','Trumpa reikšmė: aurea „auksinė“.','Vardo reikšmė: Aurėja – (1) lot., trump. Aura, iš lot. Aurea: lot. aurea „auksinė“.',' Aurėja yra lotynų kilmės vardas.'),(237,'Aurė',' Aurė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Aurelija, Aurelijus „auksinė, auksinis“.','Vardo reikšmė: Aurė – (2) liet., trumpinys iš Aurimė.',' Aurė yra lotynų kilmės vardas.'),(238,'Aura',' Aura yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Aurelija, Aurelijus „auksinė, auksinis“.','Vardo reikšmė: Aura – (1) liet. trumpinys iš Aurelija.',' Aura yra lotynų kilmės vardas.'),(239,'Banga',' Banga yra Moteriškas vardas.','Trumpa reikšmė: „banga“.','Vardo reikšmė: Šis vardas simbolizuoja norą imtis naujų planų ir juos įgyvendinti.Tampate reiklesnis sau pačiam ir kitiems. Esate imlus ir nepriklausomas, turite stiprią valią ir intuiciją. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Banga yra lietuvių kilmės vardas.'),(240,'Baltramiejus',' Baltramiejus yra Vyriškas vardas.','Trumpa reikšmė: Bar-Talmaj „Tomajo sūnus“, aramėjiškas graikų Ptolomėjo vardas.','Vardo reikšmė: .',' Baltramiejus yra aramėjų kilmės vardas.'),(241,'Baltys',' Baltys yra Vyriškas vardas.','Trumpa reikšmė: „baltas“ reikšme „švarus, tyras“.','Vardo reikšmė: Baltys – (4) liet., iš sen. avd. Baltys: liet. baltas.',' Baltys yra lietuvių kilmės vardas.'),(242,'Baltenis',' Baltenis yra Vyriškas vardas.','Trumpa reikšmė: „baltas“ + -en- – „švarus, tyras“.','Vardo reikšmė: Baltenis – (2) liet., trump. Baltys, Balčius, priesagos -enis vedinys iš sen. avd. Baltys: liet. baltas.',' Baltenis yra lietuvių kilmės vardas.'),(243,'Baltenė',' Baltenė yra Moteriškas vardas.','Trumpa reikšmė: „baltas“ + -en- – „švarus, tyras“.','Vardo reikšmė: Baltenė – (2) liet., trump. Baltė, iš vyr. v. Baltenis.',' Baltenė yra lietuvių kilmės vardas.'),(244,'Baltazaras',' Baltazaras yra Vyriškas vardas.','Trumpa reikšmė: „tepadeda dievas Belas karaliui“, „tas, kurį saugo dievas“.','Vardo reikšmė: Baltazaras – (1), (2) asir. ir babil., trump. Baltas, iš sulotyninto hebr. Baltasar, Balthassar, kuris iš asir. ir babil. Bel-šar-uššur — „tepadeda (dievas) Belas karaliui“.',' Baltazaras yra asirų kilmės vardas.'),(245,'Balys',' Balys yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Boleslovas: bolje „daugiau“ + slava „šlovė“ – „dar šlovingesnis“.','Vardo reikšmė: Balys – (4) liet. trumpinys iš Boleslovas.',' Balys yra slavų kilmės vardas.'),(246,'Balandis',' Balandis yra Vyriškas vardas.','Trumpa reikšmė: liet., iš sen. avd. Balandis, liet. balandis.','Vardo reikšmė: Balandis – (2) liet., iš sen. avd. Balandis, liet. balandis.',' Balandis yra lietuvių kilmės vardas.'),(247,'Balandė',' Balandė yra Moteriškas vardas.','Trumpa reikšmė: liet., iš vyr. v. Balandis.','Vardo reikšmė: Balandė (2) liet., iš vyr. v. Balandis.',' Balandė yra lietuvių kilmės vardas.'),(248,'Barmantas',' Barmantas yra Vyriškas vardas.','Trumpa reikšmė: bar- (barti reikšme „kovoti“, plg. rusų „borotsia“) + mant- (mantus „sumanus“).','Vardo reikšmė: Barmantas – (1) liet., trump. Barys, bar- (žr. Bargailas) + mani- (: liet. mant-tus „sumanus“).',' Barmantas yra lietuvių kilmės vardas.'),(249,'Barmantė',' Barmantė yra Moteriškas vardas.','Trumpa reikšmė: bar- (barti reikšme „kovoti“, plg. rusų „borotsia“) + mant- (mantus „sumanus“).','Vardo reikšmė: Barmantė – (1) liet., trump. Bara, Barė, iš vyr. v. Barmantas.',' Barmantė yra lietuvių kilmės vardas.'),(250,'Barkintas',' Barkintas yra Vyriškas vardas.','Trumpa reikšmė: bar- (barti reikšme „kovoti“, plg. rusų „borotsia“) + kint- (kentėti) – „kantriai kovojantis, -i“.','Vardo reikšmė: Barkintas – (1) liet. ir prūs., trump. Barys, Kintas, bar- (žr. Bargailas) + kint- (: liet. kint- su balsių kaita kent-ėti, plg. žiem-kint-is).',' Barkintas yra lietuvių kilmės vardas.'),(251,'Barys',' Barys yra Vyriškas vardas.','Trumpa reikšmė: liet., trumpinys iš avd. su Bar-: Bargailas, Barkintas.','Vardo reikšmė: Šis vardas simbolizuoja norą imtis naujų planų ir juos įgyvendinti.Tampate reiklesnis sau pačiam ir kitiems. Esate imlus ir nepriklausomas, turite stiprią valią ir intuiciją. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai',' Barys yra lietuvių kilmės vardas.'),(252,'Barintas',' Barintas yra Vyriškas vardas.','Trumpa reikšmė: bar- (barti reikšme „kovoti“, plg. rusų „borotsia“) + -intas.','Vardo reikšmė: Barintas – (1) suliet. prūs., trump. Barys, priesagos -intas vedinys iš sen. trump. Barys.',' Barintas yra lietuvių kilmės vardas.'),(253,'Bargailė',' Bargailė yra Moteriškas vardas.','Trumpa reikšmė: bar- (barti reikšme „kovoti“, plg. rusų „borotsia“) + gai- (gailas „stiprus“) – „stiprus kovotojas, -a“.','Vardo reikšmė: Bargailė – (1) liet., trump. Bara, Barė, iš vyr. avd. Bargaila, žr. Bargailas.',' Bargailė yra lietuvių kilmės vardas.'),(254,'Bargailas',' Bargailas yra Vyriškas vardas.','Trumpa reikšmė: bar- (barti reikšme „kovoti“, plg. rusų „borotsia“) + gai- (gailas „stiprus“) – „stiprus kovotojas, -a“.','Vardo reikšmė: Bargailas – (1) liet., sen. var. Bargaila, trump. Barys, bar- (: barti sen. reikšme „kovoti“, plg. rus. borotjsia „kovoti“) + gail (: sen. liet. gailas „stiprus“).',' Bargailas yra lietuvių kilmės vardas.'),(255,'Barbora',' Barbora yra Moteriškas vardas.','Trumpa reikšmė: barbara „svetimšalė“.','Vardo reikšmė: Galima sakyti, kad Barboroms labai svarbi materialinė padėtis. Joms naudingiausios profesijos – verslas ir komercija.',' Barbora yra graikų kilmės vardas.'),(256,'Barė',' Barė yra Moteriškas vardas.','Trumpa reikšmė: liet.: trumpinys iš mot. v. su Bar-: Barkintė, Bartautė, Barvydė ir kt., 2. liet. trumpinys iš Barbora.','Vardo reikšmė: Barė – (2) 1. liet.: trumpinys iš mot. v. su Bar-: Barkintė, Bartautė, Barvydė ir kt., 2. liet. trumpinys iš Barbora.',' Barė yra lietuvių kilmės vardas.'),(257,'Baniūtė',' Baniūtė yra Moteriškas vardas.','Trumpa reikšmė: iš Benedikta: benedicta „palaiminta“.','Vardo reikšmė: Baniūtė – (2) liet., sen var. Baniuta. trump. Banė, Benė, tarm. Banutė, Beniutė vak. liet., lietuviškas priesagos -utė (mažyb.) vedinys iš sen. trumpinio Banė, Benė, kuris tikriausiai iš Benedikta.',' Baniūtė yra lotynų kilmės vardas.'),(258,'Barbė',' Barbė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Barbora: barbara „svetimšalė“.','Vardo reikšmė: Barbė – (2) liet. trumpinys iš Barbora.',' Barbė yra graikų kilmės vardas.'),(259,'Banguolis',' Banguolis yra Vyriškas vardas.','Trumpa reikšmė: „banga“ + -uolis.','Vardo reikšmė: Banguolis – (2) liet., trump. Bangius, priesagos -uolis vedinys iš liet. banga.',' Banguolis yra lietuvių kilmės vardas.'),(260,'Banguolė',' Banguolė yra Moteriškas vardas.','Trumpa reikšmė: „banga“ + -uolis.','Vardo reikšmė: Banguolė – (2) liet. trump. Banga, Bangė, iš vyr. v. Banguolis.',' Banguolė yra lietuvių kilmės vardas.'),(261,'Bartvilė',' Bartvilė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Bartė, iš vyr. v. Bartvilas.','Vardo reikšmė: Bartvilė – (1), (2) liet., trump. Bartė, iš vyr. v. Bartvilas.',' Bartvilė yra lietuvių kilmės vardas.'),(262,'Barutė',' Barutė yra Moteriškas vardas.','Trumpa reikšmė: jotv. ir liet.: trump. Bara, Barė, iš vyr. v. Barutis.','Vardo reikšmė: Barutė – (2) jotv. ir liet.: trump. Bara, Barė, iš vyr. v. Barutis.',' Barutė yra lietuvių kilmės vardas.'),(263,'Bartminas',' Bartminas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Bartas, Bartys, bart- (žr. Bartautas) + min- (: liet. min-ti, min-ėti).','Vardo reikšmė: Bartminas – (1) liet., trump. Bartas, Bartys, bart- (žr. Bartautas) + min- (: liet. min-ti, min-ėti).',' Bartminas yra lietuvių kilmės vardas.'),(264,'Bartvilas',' Bartvilas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Bartas, Bartys, bart- (ŽR. Bartautas) + vil- (: liet. vil-tis,vil--iasi „tikėtis“).','Vardo reikšmė: Bartvilas – (1) liet., trump. Bartas, Bartys, bart- (ŽR. Bartautas) + vil- (: liet. vil-tis,vil–iasi „tikėtis“).',' Bartvilas yra lietuvių kilmės vardas.'),(265,'Bartenis',' Bartenis yra Vyriškas vardas.','Trumpa reikšmė: prūsų genties pavadinimas bartė + -en-.','Vardo reikšmė: Bartenis – (2) liet. ir prūs., trump. Bartas, Bartys, priesagos -enis vedinys iš sen. trumpinio Bartas, kuris iš avd. su Bar-t-: Bartautas, Bartminas ir kt.',' Bartenis yra prūsų kilmės vardas.'),(266,'Bartys',' Bartys yra Vyriškas vardas.','Trumpa reikšmė: liet., trumpinys iš Bartenis, Bartminas.','Vardo reikšmė: Bartys – (4) liet., trumpinys iš Bartenis, Bartminas ir kt. ',' Bartys yra lietuvių kilmės vardas.'),(267,'Bartenė',' Bartenė yra Moteriškas vardas.','Trumpa reikšmė: prūsų genties pavadinimas bartė + -en-.','Vardo reikšmė: Bartenė – (2) liet. ir prūs., trump. Bartė, iš vyr. v. Bartenis.',' Bartenė yra prūsų kilmės vardas.'),(268,'Bartė',' Bartė yra Moteriškas vardas.','Trumpa reikšmė: liet., trumpinys iš Bartautė, Bartminė ir suliet. prūs., iš sen. prūsų genties vardo bartai, žr. Bartas.','Vardo reikšmė: Bartė – (2) liet., trumpinys iš Bartautė, Bartminė ir suliet. prūs., iš sen. prūsų genties vardo bartai, žr. Bartas.',' Bartė yra prūsų kilmės vardas.'),(269,'Bartautė',' Bartautė yra Moteriškas vardas.','Trumpa reikšmė: bar- (barti reikšme „kovoti“, plg. rusų „borotsia“) + taut- (tauta ) – „kovojantis, -i už tautą“.','Vardo reikšmė: Bartautė – (l) liet., trump. Bartė, iš vyr. v. Bartautas.',' Bartautė yra lietuvių kilmės vardas.'),(270,'Bartautas',' Bartautas yra Vyriškas vardas.','Trumpa reikšmė: bar- (barti reikšme „kovoti“, plg. rusų „borotsia“) + taut- (tauta ) – „kovojantis, -i už tautą“.','Vardo reikšmė: Bartautas – (1) liet., trump. Bartas, bar- (: liet. bar-ti sen. reikšme „kovoti“, rus. bor-otj-sia „kovoti“ + taut- (: liet. tauta).',' Bartautas yra lietuvių kilmės vardas.'),(271,'Bartas',' Bartas yra Vyriškas vardas.','Trumpa reikšmė: sen. prūsų genties vardas..','Vardo reikšmė: Bartas – sulietietuvintas prūsiškas vardas. Kildinimas iš sen. prūsų genties vardo bartai (vns. bartas). Bartas yra trumpinys ir kartu alternatyva kitiems bendros kilmės vardams: Bartenis, Bartautas, Bartminas ir kt. rakt. liet.',' Bartas yra prūsų kilmės vardas.'),(272,'Barnabas',' Barnabas yra Vyriškas vardas.','Trumpa reikšmė: bar „sūnus“ + nabha „pranašystė“.','Vardo reikšmė: Barnabas – (2) aram., trump. Barnas, iš sulotyninto aram. Barnabas iš aramėjų Barnabhūa — „paguodos sūnus“: aram. bar „sūnus“ + nabha „pranašystė“.',' Barnabas yra aramėjų kilmės vardas.'),(273,'Beatrisa',' Beatrisa yra Moteriškas vardas.','Trumpa reikšmė: beatrix „laimę nešanti, -is“.','Vardo reikšmė: Beatrisa – (2) pranc., trump. Beata, Beta, iš prancūzų Beatrice, kuris yra lot. vardo Beatrix (kilm. Beatricis) prancūziškas variantas: lot. beatrix „laimę atnešanti“.',' Beatrisa yra prancūzų kilmės vardas.'),(274,'Beatričė',' Beatričė yra Moteriškas vardas.','Trumpa reikšmė: beatrix „laimę nešanti, -is“.','Vardo reikšmė: Beatričė visada kur nors skuba. Ji gali būti apdovanota meniniais gabumais, pasižymėti puikiu skoniu, mėgti sužibėti visuomenėje ir vakarėliuose. Darbšti, esant reikalui gali dirbti labai daug.',' Beatričė yra lotynų kilmės vardas.'),(275,'Beatas',' Beatas yra Vyriškas vardas.','Trumpa reikšmė: beatus „palaimintas“.','Vardo reikšmė: Beatas – (2) lot., trump. Betas, Atas, iš lot. Beatus: lot. beatus „palaimintas“.',' Beatas yra lotynų kilmės vardas.'),(276,'Beata',' Beata yra Moteriškas vardas.','Trumpa reikšmė: beatus „palaimintas“.','Vardo reikšmė: Beatos laimingos, turi puikią sveikatą.',' Beata yra lotynų kilmės vardas.'),(277,'Bazilijus',' Bazilijus yra Vyriškas vardas.','Trumpa reikšmė: „karališkas“.','Vardo reikšmė: Vardadienis: Sausio 2 d., birželio 14 d.',' Bazilijus yra graikų kilmės vardas.'),(278,'Bazilė',' Bazilė yra Moteriškas vardas.','Trumpa reikšmė: „karališka, karališkas“.','Vardo reikšmė: Vardadienis: Sausio 9 d., gegužės 17 d.',' Bazilė yra graikų kilmės vardas.'),(279,'Barvydas',' Barvydas yra Vyriškas vardas.','Trumpa reikšmė: bart- (barti reikšme „kovoti“, plg. rusų „borotsia“) + vyd- (iš-vydo).','Vardo reikšmė: Vardadienis: gegužės 5 d., rugpjūčio 29 d.',' Barvydas yra lietuvių kilmės vardas.'),(280,'Batilda',' Batilda yra Moteriškas vardas.','Trumpa reikšmė: germ., trump. Tilda, baž. lot. Bathildis iš germ. Bathilde: sen. vok. aukšt. badu „kova“ + hiltja „kova“.','Vardo reikšmė: Batilda – (1) germ., trump. Tilda, baž. lot. Bathildis iš germ. Bathilde: sen. vok. aukšt. badu „kova“ + hiltja „kova“.',' Batilda yra germanų kilmės vardas.'),(281,'Barvaldė',' Barvaldė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Barė, Barvė, iš vyr. v. Barvaldas.','Vardo reikšmė: Barvaldė – (1) liet., trump. Barė, Barvė, iš vyr. v. Barvaldas.',' Barvaldė yra Lietuvių kilmės vardas.'),(282,'Barvaldas',' Barvaldas yra vyriškas vardas.','Trumpa reikšmė: liet., trump. Barys, Barvas, bar- (žr. Bargailas) + vald- (:dyti liet. val).','Vardo reikšmė: Barvaldas – (1) liet., trump. Barys, Barvas, bar- (žr. Bargailas) + vald- (:dyti liet. val).',' Barvaldas yra lietuvių kilmės vardas.'),(283,'Barvainas',' Barvainas yra Vyriškas vardas.','Trumpa reikšmė: bar- (barti reikšme „kovoti“, plg. rusų „borotsia“) + vain- (senovės lietuvių vaina „priežastis, kaltė“).','Vardo reikšmė: Barvainas – (1) liet., trump. Barys, Barvas, bar- (žr. Bargailas) + vain- (: sen. liet. vaina „priežastis, kaltė“).',' Barvainas yra lietuvių kilmės vardas.'),(284,'Barutis',' Barutis yra Vyriškas vardas.','Trumpa reikšmė: jotv. ir liet., trump. Barys, priesagos -utis vedinys iš avd. su Bar- (Bargailas, Barkintas, Barvainas ir pan.) seno trumpinio.','Vardo reikšmė: Barutis – (2) jotv. ir liet., trump. Barys, priesagos -utis vedinys iš avd. su Bar- (Bargailas, Barkintas, Barvainas ir pan.) seno trumpinio.',' Barutis yra lietuvių kilmės vardas.'),(285,'Benjaminas',' Benjaminas yra Vyriškas vardas.','Trumpa reikšmė: „mylimasis sūnus“.','Vardo reikšmė: Vardadienis: Kovo mėn 31 d. – Benjaminų vardo diena.',' Benjaminas yra hebrajų kilmės vardas.'),(286,'Benius',' Benius yra Vyriškas vardas.','Trumpa reikšmė: „sūnus“.','Vardo reikšmė: Benius – (2) liet. trumpinys iš Benediktas.',' Benius yra hebrajų kilmės vardas.'),(287,'Benitas',' Benitas yra Vyriškas vardas.','Trumpa reikšmė: iš Benediktas, -a lotynų: „palaiminta, -as“.','Vardo reikšmė: Benitas – (2) ital., trump. Benas, Benys, iš Benito, kuris yra vardo Benediktas itališka ir ispaniška forma.',' Benitas yra italų kilmės vardas.'),(288,'Benita',' Benita yra Moteriškas vardas.','Trumpa reikšmė: iš Benediktas, -a lotynų: „palaiminta, -as“.','Vardo reikšmė: Benita – (2) ital., trump. Bena, Benė, iš Benita, kuris yra vardo Benedikta itališka ir ispaniška forrna.',' Benita yra italų kilmės vardas.'),(289,'Benignas',' Benignas yra Vyriškas vardas.','Trumpa reikšmė: Benignus „malonus“.','Vardo reikšmė: Vardadienis: vasario 13 d., spalio 31 d.',' Benignas yra lotynų kilmės vardas.'),(290,'Benys',' Benys yra Vyriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Benediktas.','Vardo reikšmė: Benys – (4) liet. trumpinys iš Benediktas.',' Benys yra lietuvių kilmės vardas.'),(291,'Benigna',' Benigna yra Moteriškas vardas.','Trumpa reikšmė: Benignus „malonus“.','Vardo reikšmė: Benigna – (2) lot., trump. Bena, Benė, tarm. Banigna ryt. aukšt., Benyna vak. liet., iš lot. Benigna, kuris iš vyr. v. Benignus, žr. Benignas.',' Benigna yra lotynų kilmės vardas.'),(292,'Benediktas',' Benediktas yra Vyriškas vardas.','Trumpa reikšmė: benedictus „palaiminta, -as“.','Vardo reikšmė: Benediktams patarimas – nesistengti reikštis, kai sekasi, ir nekeikti likimo nesėkmės atvejais, taip pat nebūti tokiais ambicingais.',' Benediktas yra lotynų kilmės vardas.'),(293,'Benas',' Benas yra Vyriškas vardas.','Trumpa reikšmė: „sūnus“.','Vardo reikšmė: Benų kūno silpniausios vietos: rankos, plaučiai, nervų sistema. Jiems nereikėtų rūkyti bei vartoti alkoholį. Būtina kovoti su gobšumu, avantiūrizmu, išlaidumu, pagyrūniškumu, tingumu, darboholizmu.',' Benas yra hebrajų kilmės vardas.'),(294,'Benedikta',' Benedikta yra Moteriškas vardas.','Trumpa reikšmė: benedictus „palaiminta, -as“.','Vardo reikšmė: Su Benediktais gyvenimas nelengvas. Jie retai būna populiarūs, net jeigu gerbiami už charakterio tvirtumą. Sunku juos gerbti, todėl, kad jie vis taikosi primesti savo valią kitiems, iš savo atminties į juodą sąrašą įtraukia visus tuos , kurie nepritaria jų nuomonei.',' Benedikta yra lotynų kilmės vardas.'),(295,'Benadas',' Benadas yra Vyriškas vardas.','Trumpa reikšmė: trump. Nadas, - liet. trumpinys iš Benediktas.','Vardo reikšmė: Benadas – (2), (1) trump. Nadas, – liet. trumpinys iš Benediktas.',' Benadas yra lietuvių kilmės vardas.'),(296,'Beivydas',' Beivydas yra Vyriškas vardas.','Trumpa reikšmė: bei- (bei) + vyd- (iš-vydo).','Vardo reikšmė: Beivydas – (1) liet., trump. Beivys, bei- (žr. Beinoras) + vyd- (žr. Barvydas).',' Beivydas yra lietuvių kilmės vardas.'),(297,'Beinoras',' Beinoras yra Vyriškas vardas.','Trumpa reikšmė: bei- (bei ) + nor- (norėti).','Vardo reikšmė: Beinoras – (l) liet., trump. Beinas, Beinys, bei- (: liet. bei „ar, bau“’, beig „ar, begu“, plg. dar vardus su Ar-: Arv-ydas, Arvaidas ir kt.) + nor- (:liet. nor-ėti).',' Beinoras yra lietuvių kilmės vardas.'),(298,'Bėržūna',' Bėržūna yra Moteriškas vardas.','Trumpa reikšmė: liet., iš upėvardžio Beržūna (Lazūnai).','Vardo reikšmė: Bėržūna – (1) liet., iš upėvardžio Beržūna (Lazūnai).',' Bėržūna yra lietuvių kilmės vardas.'),(299,'Beržas',' Beržas yra Vyriškas vardas.','Trumpa reikšmė: beržas, pasakos „Eglė žalčių karalienė“ Eglės sūnaus vardas.','Vardo reikšmė: Beržas – (1) liet., iš pasakos „Eglė žalčių karalienė“ Eglės sūnaus vardo Beržas: liet. beržas, plg. pvd. Beržas.',' Beržas yra lietuvių kilmės vardas.'),(300,'Bervainas',' Bervainas yra Vyriškas vardas.','Trumpa reikšmė: ber- (berti arba bernas reikšme „vaikas“ plg. latvių berns) + vain- (senovės lietuvių vaina „priežastis, kaltė“).','Vardo reikšmė: Bervainas – (1) liet., trump. Bervas, Bervys, ber- (žr. Bertautas) + vain- (žr. Barvainas).',' Bervainas yra lietuvių kilmės vardas.'),(301,'Bervainė',' Bervainė yra Moteriškas vardas.','Trumpa reikšmė: ber- (berti arba bernas reikšme „vaikas“ plg. latvių berns) + vain- (senovės lietuvių vaina „priežastis, kaltė“).','Vardo reikšmė: Bervainė – (1) liet., trump. Berė, Bervė, iš vyr. v. Bervainas.',' Bervainė yra lietuvių kilmės vardas.'),(302,'Bertoldas',' Bertoldas yra Vyriškas vardas.','Trumpa reikšmė: beraht „garsus, žymus“ + waltan „valdyti“.','Vardo reikšmė: Vardadienis: Kovo mėn 29 d. – Bertoldų vardo diena.',' Bertoldas yra vokiečių kilmės vardas.'),(303,'Bertautas',' Bertautas yra Vyriškas vardas.','Trumpa reikšmė: ber- (berti arba bernas reikšme „vaikas“ plg. latvių berns) + taut- (tauta).','Vardo reikšmė: Bertautas – (1) liet., trump. Bertas, Benys, ber-(: liet. ber-ti, plg. liet. ber-nas, latv. ber-ns „vaikas“, got. barn „t. p.“)+ taut- (: liet. tauta).',' Bertautas yra lietuvių kilmės vardas.'),(304,'Bertautė',' Bertautė yra Moteriškas vardas.','Trumpa reikšmė: trump. Bertė, iš vyr. v. Bertautas.','Vardo reikšmė: Bertautė – (1) liet., trump. Bertė, iš vyr. v. Bertautas.',' Bertautė yra lietuvių kilmės vardas.'),(305,'Berta',' Berta yra Moteriškas vardas.','Trumpa reikšmė: beraht „garsi, žymi“.','Vardo reikšmė: Vardadienis: Rugpjūčio 1 d., liepos 4 d., rugsėjo 3 d. – Bertų vardo diena.',' Berta yra vokiečių kilmės vardas.'),(306,'Bylotė',' Bylotė yra Moteriškas vardas.','Trumpa reikšmė: byloti „kalbėti, tarti“ + -ot- – „kalbantysis“.','Vardo reikšmė: Bylotė – (1) liet., trump. Bylė, iš vyr. v. Bylotas.',' Bylotė yra lietuvių kilmės vardas.'),(307,'Bernardas',' Bernardas yra Vyriškas vardas.','Trumpa reikšmė: bern „lokys“ + hart „stiprus, tvirtas“.','Vardo reikšmė: Bernardų neigiamos savybės: egocentriškumas, savimeilė, užsispyrimas, maniakiškumas, tironiškumas. Jiems patartina nepakliūti į neigiamų vibracijų srautus. Reikėtų vengti savimeilės, antagonizmo, ugdyti pusiausvyrą, kantrybę ir ramumą. Nusiraminti gali padėti prie kūno nešiojamas gabalėlis gintaro',' Bernardas yra vokiečių kilmės vardas.'),(308,'Bylotas',' Bylotas yra Vyriškas vardas.','Trumpa reikšmė: byloti „kalbėti, tarti“ + -ot- – „kalbantysis“.','Vardo reikšmė: Bylotas – (1) liet. ir prūs., trump. Bylius, priesagos -otas vedinys iš avd. Bylius.',' Bylotas yra lietuvių kilmės vardas.'),(309,'Bilminas',' Bilminas yra Vyriškas vardas.','Trumpa reikšmė: bil- (pra-bilti, bilus „šnekus“) + min- (minėti).','Vardo reikšmė: Bilminas – (1) liet., trump. Bilys, Bilius, bil- (žr. Bilginas) + min- (žr. Bartminas).',' Bilminas yra lietuvių kilmės vardas.'),(310,'Bernarda',' Bernarda yra Moteriškas vardas.','Trumpa reikšmė: bern „lokys“ + hart „stiprus, tvirtas“.','Vardo reikšmė: Bernarda – (1) sulot. germ., trump Bena, Benė, tarm. Bernada ryt. ir vak. aukšt., baž. lot. Bernarda, kuris iš vyr. v. Bernardus, žr. Bernardas.',' Bernarda yra vokiečių kilmės vardas.'),(311,'Bernadeta',' Bernadeta yra Moteriškas vardas.','Trumpa reikšmė: iš Benardas + -ette (mažybinė priesaga) senovės vokiečių kalboje: bern „lokys“ + hart „stiprus, tvirtas“.','Vardo reikšmė: Bernadetos apdovanotos ir prieštaringu įtariu charakteriu. Iš vienos pusės, jos siekia taikos ir ramybės, o iš kitos – trokšta būti dėmesio centre. Kai kada jos susipainioja ir nežino netgi ko nori.',' Bernadeta yra prancūzų, lotynų, vokiečių kilmės vardas.'),(312,'Bernadas',' Bernadas yra Vyriškas vardas.','Trumpa reikšmė: iš Benardas + -ette (mažybinė priesaga): bern „lokys“ + hart „stiprus, tvirtas“.','Vardo reikšmė: Bernadas – (2) trump. Nadas, — liet. trumpinys iš Bernardas.',' Bernadas yra vokiečių kilmės vardas.'),(313,'Benvenutas',' Benvenutas yra Vyriškas vardas.','Trumpa reikšmė: „mielai laukiamas“.','Vardo reikšmė: Benvenutas – (2) ital., trump. Benas, iš italų Benvenuto — „mielai laukiamas“.',' Benvenutas yra italų kilmės vardas.'),(314,'Bilmantė',' Bilmantė yra Moteriškas vardas.','Trumpa reikšmė: bil- (pra-bilti, bilus „šnekus“) + mant- (mantus „sumanus“).','Vardo reikšmė: Bilmantė – (1) liet., trump. Bilė, iš vyr. v. Bilmantas.',' Bilmantė yra lietuvių kilmės vardas.'),(315,'Bilmantas',' Bilmantas yra Vyriškas vardas.','Trumpa reikšmė: bil- (pra-bilti, bilus „šnekus“) + mant- (mantus „sumanus“).','Vardo reikšmė: Bilmantas – (1) liet., trump. Bilys, Bilius, bil- (žr. Bilginas) + mant- (:liet. mant-us „sumanus“, mant-a „turtas“).',' Bilmantas yra lietuvių kilmės vardas.'),(316,'Benonas',' Benonas yra Vyriškas vardas.','Trumpa reikšmė: „lokys“.','Vardo reikšmė: Benonas – (2), (1) sulot. germ., trump. Benas, baž. lot. Benno (kilm. Bennonis) iš germ. Benno, kuris yra germ. vardų su Bern-(Bernhard ir kt.) trumpinys: sen. vok. aukšt. bero (bern-) „lokys“.',' Benonas yra vokiečių kilmės vardas.'),(317,'Byvainė',' Byvainė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Byvė, iš vyr. v. Byvainas.','Vardo reikšmė: Byvainė – (1) liet., trump. Byvė, iš vyr. v. Byvainas.',' Byvainė yra lietuvių kilmės vardas.'),(318,'Bylius',' Bylius yra Vyriškas vardas.','Trumpa reikšmė: byloti „kalbėti, tarti“ – „kalbantysis“.','Vardo reikšmė: Bylius – (1) liet., liet. byl-oti „kalbėti, tarti“ galūnės vedinys.',' Bylius yra lietuvių kilmės vardas.'),(319,'Bilginas',' Bilginas yra Vyriškas vardas.','Trumpa reikšmė: bil- (pra-bilti, bilus „šnekus“) + gin- (ginti).','Vardo reikšmė: Bilginas – (1) liet., trump. Bilys, Bilius: bil- (: liet. bil-ti, bil-us ,,šnekus“) + gin- (:liet. gin-ti „užstoti“).',' Bilginas yra lietuvių kilmės vardas.'),(320,'Byvainas',' Byvainas yra Vyriškas vardas.','Trumpa reikšmė: by- (bijoti) + vain- (senovės lietuvių vaina „priežastis, kaltė“).','Vardo reikšmė: Byvainas – (1) liet., trump. Byvas, by- (žr. Bygailas) + vain- (žr. Barvainas).',' Byvainas yra lietuvių kilmės vardas.'),(321,'Benona',' Benona yra Moteriškas vardas.','Trumpa reikšmė: „lokys“.','Vardo reikšmė: Benona – (2) sulot. germ., trump. Bena, Benė: iš vyr. v. Benno, žr. Benonas.',' Benona yra vokiečių kilmės vardas.'),(322,'Bylenis',' Bylenis yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Bylius, priesagos –enis vedinys iš avd. Bylius.','Vardo reikšmė: Bylenis – (2) liet., trump. Bylius, priesagos –enis vedinys iš avd. Bylius.',' Bylenis yra lietuvių kilmės vardas.'),(323,'Bitė',' Bitė yra Moteriškas vardas.','Trumpa reikšmė: bitė – darbštumo simbolis.','Vardo reikšmė: Bitė – liet.: liet. bitė, plg. dar tos pačios reikšmės vardus Debora, Melita, bitė — darbštumo simbolis.',' Bitė yra lietuvių kilmės vardas.'),(324,'Bylenė',' Bylenė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Bylė, iš vyr. v. Bylenis.','Vardo reikšmė: Bylenė – (2) liet., trump. Bylė, iš vyr. v. Bylenis.',' Bylenė yra lietuvių kilmės vardas.'),(325,'Bytautė',' Bytautė yra Moteriškas vardas.','Trumpa reikšmė: by- (bijoti) + taut- (tauta).','Vardo reikšmė: Bytautė – (1) liet. ir prūs., trump. Bytė, iš vyr. v. Bytautas.',' Bytautė yra lietuvių kilmės vardas.'),(326,'Bylė',' Bylė yra Moteriškas vardas.','Trumpa reikšmė: liet.: iš vyr. v. Bylius.','Vardo reikšmė: Bylė – (1) liet.: iš vyr. v. Bylius.',' Bylė yra lietuvių kilmės vardas.'),(327,'Bytautas',' Bytautas yra Vyriškas vardas.','Trumpa reikšmė: by- (bijoti) + taut- (tauta).','Vardo reikšmė: Bytautas -(1) liet. ir prūs., trump. Bytis, by- (žr. Bygailas) + taut- (žr. Bartautas).',' Bytautas yra lietuvių kilmės vardas.'),(328,'Bygirdas',' Bygirdas yra Vyriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Bygas, Bygius, by- (žr. Bygailas) + gird- (: liet. gird-ėti, gird-as „žinia, gandas“).','Vardo reikšmė: Bygirdas – (1) suliet. prūs., trump. Bygas, Bygius, by- (žr. Bygailas) + gird- (: liet. gird-ėti, gird-as „žinia, gandas“).',' Bygirdas yra prūsų kilmės vardas.'),(329,'Birvydas',' Birvydas yra Vyriškas vardas.','Trumpa reikšmė: bir- (birti) + vyd- (iš-vydo).','Vardo reikšmė: Birvydas – (1) liet., trump. Biras: bir- (žr. Birmantas) + vyd (žr. Barvydas).',' Birvydas yra lietuvių kilmės vardas.'),(330,'Bygailė',' Bygailė yra Moteriškas vardas.','Trumpa reikšmė: by- (bijoti) + gail- + gai- (gailas „stiprus“) – „stiprus kovotojas, -a“.','Vardo reikšmė: Bygailė – (1) liet., trump. Byga, Bygė, iš vyr. avd. Bygaila, žr. Bygailas.',' Bygailė yra lietuvių kilmės vardas.'),(331,'Birutis',' Birutis yra Vyriškas vardas.','Trumpa reikšmė: birti + -ut-.','Vardo reikšmė: Birutis – (2) liet., trump. Biras, priesagos –utis vedinys iš sen. trump. Biras, kuris iš avd. su Bir-: Birmantas.',' Birutis yra lietuvių kilmės vardas.'),(332,'Bygailas',' Bygailas yra Vyriškas vardas.','Trumpa reikšmė: by- (bijoti) + gail- + gai- (gailas „stiprus“) – „stiprus kovotojas, -a“.','Vardo reikšmė: Bygailas – (1) liet., sen. var. Bygaila, trump. Bygas, by- (:liet. bij-oti, latv. bities „bijotis“, plg. vardus su Bug-: Bugvilas+ gail- (žr. Bargailas).',' Bygailas yra lietuvių kilmės vardas.'),(333,'Bronislovas',' Bronislovas yra Vyriškas vardas.','Trumpa reikšmė: braniti „ginti, saugoti“ + slava „šlovė“ – „šlovę ginantis“.','Vardo reikšmė: Bronislovas – (1) slav., sen. var. Bronislavas (1), trump. Bronys, Bronius, tarm. Branislavas, Branislovas, Branys, Branius ryt. aukšt., Bronius, Bronis piet. žem., baž. lot. Bronislaus iš slavų Bronislav (lenk. Bronislaw, čekų Branislav): sen. slav. braniti „ginti,saugoti“ + slava „šlovė“.',' Bronislovas yra slavų kilmės vardas.'),(334,'Birutė',' Birutė yra Moteriškas vardas.','Trumpa reikšmė: lietuvių kilmės vardas, kurio trumpinys: Birė, iš vyriško vardo Birutis..','Vardo reikšmė: Birutes gali kamuoti raumenų skausmai ir kraujo apytakos problemos. Joms reikėtų vengti prigimtinio potraukio alkoholiui.',' Birutė yra lietuvių kilmės vardas.'),(335,'Birmantė',' Birmantė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Birė, iš vyr. v. Birmantas.','Vardo reikšmė: Birmantė – (1) liet., trump. Birė, iš vyr. v. Birmantas.',' Birmantė yra lietuvių kilmės vardas.'),(336,'Birmantas',' Birmantas yra vyriškas vardas.','Trumpa reikšmė: liet., trump. Biras, bir- (: liet. bir-ti su balsių kaita iš ber-ti, žr. Bertautas) + mant- (žr. Bilmantas).','Vardo reikšmė: Birmantas – (1) liet., trump. Biras, bir- (: liet. bir-ti su balsių kaita iš ber-ti, žr. Bertautas) + mant- (žr. Bilmantas).',' Birmantas yra lietuvių kilmės vardas.'),(337,'Bronislova',' Bronislova yra Moteriškas vardas.','Trumpa reikšmė: braniti „ginti, saugoti“ + slava „šlovė“ – „šlovę ginantis“.','Vardo reikšmė: Bronislova – (1) slav., sen. var. Bronislava (2), trump. Bronė, tarm. Branislava, Branislova, Branė ryt. aukšt., Bronė piet. žem., ryt. aukšt., Bronia piet. aukšt. (dz.), baž. lot. Bronislava iš slavų Bronislava, kuri iš vyr. v. Bronislav, žr. Bronislovas.',' Bronislova yra slavų kilmės vardas.'),(338,'Bronys',' Bronys yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Bronislovas.','Vardo reikšmė: Broniams skirta per gyvenimą bent vieną kartą stoti prieš teismą. Jų gyvenime silpnas periodas apima dešimt pirmųjų sausio mėnesio dienų.',' Bronys yra slavų kilmės vardas.'),(339,'Birenis',' Birenis yra Vyriškas vardas.','Trumpa reikšmė: birti + -en-.','Vardo reikšmė: Birenis – (2) liet., trump. Biras, priesagos –enis vedinys iš sen. trump. Biras, kuris iš avd. su Bir-: Birmantas, Birvydas ir kt.',' Birenis yra lietuvių kilmės vardas.'),(340,'Bronė',' Bronė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Bronislovas.','Vardo reikšmė: Bronė – (2) liet. trumpinys iš Bronislova.',' Bronė yra slavų kilmės vardas.'),(341,'Birenė',' Birenė yra Moteriškas vardas.','Trumpa reikšmė: birti + -en-.','Vardo reikšmė: Birenė – (2) liet., trump Birė, iš vyr. v. Birenis.',' Birenė yra lietuvių kilmės vardas.'),(342,'Bilvinas',' Bilvinas yra Vyriškas vardas.','Trumpa reikšmė: bil- (pra-bilti, bilus „šnekus“) + vin- (vin/van kaita – senovės lietuvių vaina „priežastis, kaltė“).','Vardo reikšmė: Bilvinas – (1) liet. trump. Bilys, Bilius, bil- (žr. Bilginas)+ vin- (:sen. liet. vin- su balsių kaita iš vain-: vaina „priežastis, kaltė“.',' Bilvinas yra lietuvių kilmės vardas.'),(343,'Brigita',' Brigita yra Moteriškas vardas.','Trumpa reikšmė: „dorovės jėga“, airių mitologijos deivės vardas Brighid.','Vardo reikšmė: Brigitos išdidžios, nemėgstančios niekam įsipareigoti; nepriklausomos ir iš karto susierzina, jeigu kas nors bando apriboti jų laisvę.',' Brigita yra keltų kilmės vardas.'),(344,'Brigė',' Brigė yra Moteriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Brigė – (2) liet. trumpinys iš Brigita.',' Brigė yra lietuvių kilmės vardas.'),(345,'Bonifacas',' Bonifacas yra Vyriškas vardas.','Trumpa reikšmė: „gera lemiantis, -i“.','Vardo reikšmė: Kadangi Bonifacai labai individualūs, jiems geriausiai tinka pilka drabužių spalva. Jeigu juos traukia juoda spalva, tai reiškia, kad viskas juose protestuoja prieš nepasisekimus. Juoda spalva lyg ir atriboja juos nuo aplinkinių.',' Bonifacas yra lotynų kilmės vardas.'),(346,'Bonifacija',' Bonifacija yra Moteriškas vardas.','Trumpa reikšmė: „gera lemiantis, -i“.','Vardo reikšmė: Kadangi Bonifacai labai individualūs, jiems geriausiai tinka pilka drabužių spalva. Jeigu juos traukia juoda spalva, tai reiškia, kad viskas juose protestuoja prieš nepasisekimus. Juoda spalva lyg ir atriboja juos nuo aplinkinių.',' Bonifacija yra lotynų kilmės vardas.'),(347,'Bonaventūras',' Bonaventūras yra Vyriškas vardas.','Trumpa reikšmė: „gėrybes žadanti, -is“.','Vardo reikšmė: Bonaventūras – (2) lot., sen. var. Bonaventūra (2), trump. Bonas, baž. lot. Bonaventura – „gėrybes žadantis“ : lot. bona „gėrybės, turtas“ + ventūrus „ateisiantis, pažadėtas“.',' Bonaventūras yra lotynų kilmės vardas.'),(348,'Bonaventūra',' Bonaventūra yra Moteriškas vardas.','Trumpa reikšmė: „gėrybes žadanti, -is“.','Vardo reikšmė: Bonaventūra – (2) lot., trump. Bona, iš vyr. v. Bonaventūra, žr. Bonaventūras.',' Bonaventūra yra lotynų kilmės vardas.'),(349,'Bonas',' Bonas yra Vyriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Bonifacas ir kt.','Vardo reikšmė: Bonas – (2) liet. trumpinys iš Bonifacas ir kt.',' Bonas yra lietuvių kilmės vardas.'),(350,'Bolius',' Bolius yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Boleslovas: bolje „daugiau“ + slava „šlovė“.','Vardo reikšmė: (2) liet. trumpinys iš Boleslovas',' Bolius yra slavų kilmės vardas.'),(351,'Bona',' Bona yra Moteriškas vardas.','Trumpa reikšmė: bonus, bona „geras, gera“.','Vardo reikšmė: Bona – (2) 1. lot., iš lot. Bona: lot. bona „gera“, 2. liet. trumpinys iš Bonaventūra ir Bonifacija.',' Bona yra lotynų kilmės vardas.'),(352,'Blažys',' Blažys yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Blažiejus: „lepus, nerangus“.','Vardo reikšmė: Blažys – (4) liet. trumpinys iš Blažiejus.',' Blažys yra graikų kilmės vardas.'),(353,'Buivydas',' Buivydas yra Vyriškas vardas.','Trumpa reikšmė: bui- (buitis, būti) + vyd- (iš-vydo).','Vardo reikšmė: Buivydas – (1) liet., trump. Buivys, bui- (: liet. bui-tis, bū-ti: bi-ti „buvo“) + vyd- (žr. Barvydas).',' Buivydas yra lietuvių kilmės vardas.'),(354,'Blažiejus',' Blažiejus yra Vyriškas vardas.','Trumpa reikšmė: „lepus, nerangus“.','Vardo reikšmė: Blažiejus – (2) graik., trump. Blažys, tarm. Blažius piet. aukšt. (dz.), per lenkų Blazej iš sulotyninto graik. Blasius: graik. blaks „lepus, nerangus“.',' Blažiejus yra graikų kilmės vardas.'),(355,'Bugvilė',' Bugvilė yra Moteriškas vardas.','Trumpa reikšmė: bug- (buginti „bauginti“) + vil- (viltis).','Vardo reikšmė: Bugvilė – (1), (2) liet., trump. Bugė, iš vyr. v. Bugvilas.',' Bugvilė yra lietuvių kilmės vardas.'),(356,'Bugvilas',' Bugvilas yra Vyriškas vardas.','Trumpa reikšmė: bug- (buginti „bauginti“) + vil- (viltis).','Vardo reikšmė: Bugvilas – (1) liet., trump. Bugys, bug- (: liet. bug-inti „bauginti, baidyti“, bug-us „bailus“) + vil- (:liet. vil-tis, vil-iasi, vil-tis).',' Bugvilas yra lietuvių kilmės vardas.'),(357,'Bugailas',' Bugailas yra Vyriškas vardas.','Trumpa reikšmė: bu- (būti arga buginti „bauginti) + gail- (senovės lietuvių gailas „stiprus“) – „esantis stiprus“, „gąsdinantis savo stiprybe“.','Vardo reikšmė: Bugailas – (1) liet., sen. var. Bugaila, trump. Bugys, bu- (:liet. bu-tas, bū-ti ar bu- kilęw iš bug- : bug-inti „bauginti, baidyti“, bug-us „bailus“) + gail- (žr. Bargailas).',' Bugailas yra lietuvių kilmės vardas.'),(358,'Bugailė',' Bugailė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Bugė, iš vyr. avd. Bugaila, žr. Bugailas.','Vardo reikšmė: Bugailė – (1) liet., trump. Bugė, iš vyr. avd. Bugaila, žr. Bugailas.',' Bugailė yra lietuvių kilmės vardas.'),(359,'Budvilė',' Budvilė yra Moteriškas vardas.','Trumpa reikšmė: bud- (budinti) + vil- (viltis).','Vardo reikšmė: Budvilė – (1), (2) liet., trump. Budvė, iš vyr. v. Budvilas.',' Budvilė yra lietuvių kilmės vardas.'),(360,'Budvilas',' Budvilas yra Vyriškas vardas.','Trumpa reikšmė: bud- (budinti) + vil- (viltis).','Vardo reikšmė: Budvilas – (1) liet., trump. Budvys, bud- (žr. Budvydas) + vil- (žr. Bartvilas).',' Budvilas yra lietuvių kilmės vardas.'),(361,'Budvydas',' Budvydas yra Vyriškas vardas.','Trumpa reikšmė: bud- (budinti) + vyd- (iš-vydo).','Vardo reikšmė: Budvydas – (1) liet., trump. Budvys, bud- (: bud-ėti, bud-inti) + vyd- (žr. Barvydas).',' Budvydas yra lietuvių kilmės vardas.'),(362,'Budrė',' Budrė yra Moteriškas vardas.','Trumpa reikšmė: liet., iš vyr. v. Budrys, Budrius.','Vardo reikšmė: Budrė – (2) liet., iš vyr. v. Budrys, Budrius.',' Budrė yra lietuvių kilmės vardas.'),(363,'Brunonas',' Brunonas yra Vyriškas vardas.','Trumpa reikšmė: „rudasis lokys“.','Vardo reikšmė: Vardadienis: Gegužės 27 d., liepos 12 d., spalio 6 d. ',' Brunonas yra vokiečių kilmės vardas.'),(364,'Brunona',' Brunona yra Moteriškas vardas.','Trumpa reikšmė: „rudasis lokys“.','Vardo reikšmė: Brunona – (2) sulot. germ., trump. Bruna, Brunė, iš vyr. v. BRUNO,. žr. Brunonas',' Brunona yra vokiečių kilmės vardas.'),(365,'Bronius',' Bronius yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Bronislovas.','Vardo reikšmė: Taip jau yra, kad Broniams skirta per gyvenimą bent vieną kartą susidurti su teisėsauga. Jų gyvenime sunkus periodas – dešimt pirmųjų sausio mėnesio dienų.',' Bronius yra slavų kilmės vardas.'),(366,'Butautas',' Butautas yra Vyriškas vardas.','Trumpa reikšmė: bu- (būti) + taut- (tauta) – „būti su tauta“.','Vardo reikšmė: Butautas – (1) liet., trump. Butys, Būtys, bu- (žr. Bugailas) + taut- (žr. Bartautas).',' Butautas yra lietuvių kilmės vardas.'),(367,'Burvilė',' Burvilė yra Moteriškas vardas.','Trumpa reikšmė: bur- (burti „kerėti, žavėti“) + vil- (viltis).','Vardo reikšmė: Burvilė – (1), (2) liet., trump. Bura, Burvė, iš vyr. v. Burvilas.',' Burvilė yra lietuvių kilmės vardas.'),(368,'Bušė',' Bušė yra Moteriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Bušė – (2) vak. liet. trumpinys iš Barbušė, žr. Barbora.',' Bušė yra lietuvių kilmės vardas.'),(369,'Burvilas',' Burvilas yra Vyriškas vardas.','Trumpa reikšmė: bur- (burti „kerėti, žavėti“) + vil- (viltis).','Vardo reikšmė: Burvilas – (1) liet., trump. Buras, Burvys, bur- (žr. Burgailas) + vil- (žr. Bartvilas).',' Burvilas yra lietuvių kilmės vardas.'),(370,'Burvydas',' Burvydas yra Vyriškas vardas.','Trumpa reikšmė: bur- (burti „kerėti, žavėti“) + vyd- (iš-vydo).','Vardo reikšmė: Burvydas – (1) liet., trump. Buras, Burvys, bur- (žr. Burgailas)+ vyd- (žr. Barvydas).',' Burvydas yra lietuvių kilmės vardas.'),(371,'Burtautė',' Burtautė yra Moteriškas vardas.','Trumpa reikšmė: bur- (burti „kerėti, žavėti“) + taut- (tauta).','Vardo reikšmė: Burtautė – (1) liet., trump. Burtė, iš vyr. v. Burtautas.',' Burtautė yra lietuvių kilmės vardas.'),(372,'Burtautas',' Burtautas yra Vyriškas vardas.','Trumpa reikšmė: bur- (burti „kerėti, žavėti“) + taut- (tauta).','Vardo reikšmė: Burtautas – (1) liet., trump. Burtys, bur- (žr. Burgailas) + taut- (žr. Bartautas).',' Burtautas yra lietuvių kilmės vardas.'),(373,'Burkantas',' Burkantas yra Vyriškas vardas.','Trumpa reikšmė: bur- (burti „kerėti, žavėti“) + kant- (pa-kantus, kantrus).','Vardo reikšmė: Burkantas – (1) liet., trump. Buras, Burys, bur- (žr. Burgailas) + kant- (žr. Bukantas).',' Burkantas yra lietuvių kilmės vardas.'),(374,'Burgailas',' Burgailas yra Vyriškas vardas.','Trumpa reikšmė: bur- (burti „kerėti, žavėti“) + gail- (gailas „stiprus“) – „stipriai kerintis, -i“.','Vardo reikšmė: Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs.',' Burgailas yra lietuvių kilmės vardas.'),(375,'Burgailė',' Burgailė yra Moteriškas vardas.','Trumpa reikšmė: bur- (burti „kerėti, žavėti“) + gail- (gailas „stiprus“) – „stipriai kerintis, -i“.','Vardo reikšmė: Taigi šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs.',' Burgailė yra lietuvių kilmės vardas.'),(376,'Bukantas',' Bukantas yra Vyriškas vardas.','Trumpa reikšmė: bu- (būti arba buginti „bauginti) + kant- (pa-kantus, kantrus).','Vardo reikšmė: Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas.Mėgstate discipliną ir tvarką, konservatyvūs ir pedantiški, stengiatės palaikyti bendrai priimtas tradicijas ir tvarką.Kai kurie esate avantiūristai, nuotykių ieškotojai, užsispyrę žaidėjai : gyvenimas – teatras.',' Bukantas yra lietuvių kilmės vardas.'),(377,'Bukanta',' Bukanta, Bukanta, Bukantė yra Vyriškas vardas.','Trumpa reikšmė: sulietuvintas prūsų: ar- (ar „taip pat, irgi“) + vaid- (vaidytis, vaidentis „rodytis“).','Vardo reikšmė: (3b), (1), (1) liet. ir prūs., trump. Kantė, iš vyr. v. Bukantas',' Bukanta, Bukanta, Bukantė yra lietuvių kilmės vardas.'),(378,'Buivys',' Buivys yra Vyriškas vardas.','Trumpa reikšmė: liet., sen. trumpinys iš Buivydas.','Vardo reikšmė: Šis vardas leidžia Jums geriau įvertinti žmonių charakterius. Šis vardas suteikia Jums daugiau energijos, galite įgyti daugiau muzikinių, vaidybinių sugebėjimų.',' Buivys yra lietuvių kilmės vardas.'),(379,'Butmantė',' Butmantė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Butė, Būtė, iš vyr. v. Butmantas.','Vardo reikšmė: Taigi šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs.',' Butmantė yra lietuvių kilmės vardas.'),(380,'Butmantas',' Butmantas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Butys, Būtys, but- (žr. Butgailas) + mant- (žr. Bilmantas).','Vardo reikšmė: Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs.',' Butmantas yra lietuvių kilmės vardas.'),(381,'Butigeidė',' Butigeidė yra Moteriškas vardas.','Trumpa reikšmė: bu- (būti) + geid- (geidė).','Vardo reikšmė: Jis teikia Jums nepriklausomybės, individualumo, originalumo ir išradingumo. Jis suteikia Jums drąsos ir noro rizikuoti. Tampate ryžtingesnis ir tikslingesnis.Padidėja dėmesys visuomenės reikmėms, jaučiate poreikį pasitarnauti visuomenei.',' Butigeidė yra lietuvių kilmės vardas.'),(382,'Butigeidas',' Butigeidas yra Vyriškas vardas.','Trumpa reikšmė: bu- (būti) + geid- (geidė).','Vardo reikšmė: Jis teikia Jums nepriklausomybės, individualumo, originalumo ir išradingumo. Jis suteikia Jums drąsos ir noro rizikuoti. Tampate ryžtingesnis ir tikslingesnis.Padidėja dėmesys visuomenės reikmėms, jaučiate poreikį pasitarnauti visuomenei.',' Butigeidas yra lietuvių kilmės vardas.'),(383,'Butgintas',' Butgintas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Butys, Būtys, būt- (žr. Butgailas) + gint- (: liet. gint-as „užstotas“, ginti).','Vardo reikšmė: Šis vardas suteikia Jums daugiau energijos, galite įgyti daugiau muzikinių, vaidybinių sugebėjimų. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Butgintas yra lietuvių kilmės vardas.'),(384,'Butginas',' Butginas yra Vyriškas vardas.','Trumpa reikšmė: bu- (būti) + gin- (ginti).','Vardo reikšmė: Jis suteikia Jums drąsos ir noro rizikuoti. Tampate ryžtingesnis ir tikslingesnis.Padidėja dėmesys visuomenės reikmėms, jaučiate poreikį pasitarnauti visuomenei. Šis vardas leidžia Jums geriau įvertinti žmonių charakterius.',' Butginas yra lietuvių kilmės vardas.'),(385,'Butgailas',' Butgailas yra Vyriškas vardas.','Trumpa reikšmė: bu- (būti) + gail- (gailus reikšme „stiprus“).','Vardo reikšmė: Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas, tačiau dauguma Jūsų sugebate kažkokiu būdu disponuoti pakankamomis lėšomis ir problemų dėl išlaidumo nejaučiate, nes jums dažniausiai nuskyla būti santuokoje su pasiturinčias partneriais.',' Butgailas yra lietuvių kilmės vardas.'),(386,'Butgailė',' Butgailė yra Moteriškas vardas.','Trumpa reikšmė: bu- (būti arga buginti „bauginti) + gail- (senovės lietuvių gailas „stiprus“) – „esantis stiprus“, „gąsdinantis savo stiprybe“.','Vardo reikšmė: Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas, tačiau dauguma Jūsų sugebate kažkokiu būdu disponuoti pakankamomis lėšomis ir problemų dėl išlaidumo nejaučiate, nes jums dažniausiai nuskyla būti santuokoje su pasiturinčias partneriais.',' Butgailė yra lietuvių kilmės vardas.'),(387,'Butenis',' Butenis yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Butys, priesagos –enis vedinys iš sen. trump. Butys.','Vardo reikšmė: Butenis – (2) liet., trump. Butys, priesagos –enis vedinys iš sen. trump. Butys.',' Butenis yra lietuvių kilmės vardas.'),(388,'Butenė',' Butenė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Butė, iš vyr. v. Butenis.','Vardo reikšmė: Butenė – (2) liet., trump. Butė, iš vyr. v. Butenis.',' Butenė yra lietuvių kilmės vardas.'),(389,'Butautė',' Butautė yra Moteriškas vardas.','Trumpa reikšmė: bu- (būti) + taut- (tauta) – „būti su tauta“.','Vardo reikšmė: Butautė – (1) liet., trump. Butė, Būtė, iš vyr. v. Butautas.',' Butautė yra lietuvių kilmės vardas.'),(390,'Butvinas',' Butvinas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Butys, Būtys, but- (žr. Butgailas) + vin- (žr. Bilvinas).','Vardo reikšmė: Butvinas – (l) liet., trump. Butys, Būtys, but- (žr. Butgailas) + vin- (žr. Bilvinas).',' Butvinas yra lietuvių kilmės vardas.'),(391,'Buvainė',' Buvainė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Buvė, iš vyr. v. Buvainas.','Vardo reikšmė: Buvainė – (1) liet., trump. Buvė, iš vyr. v. Buvainas.',' Buvainė yra lietuvių kilmės vardas.'),(392,'Butvilė',' Butvilė yra Moteriškas vardas.','Trumpa reikšmė: but- (butas, būti) + vil- (viltis) – „esanti, gyva viltis“.','Vardo reikšmė: Butvilė – (1), (2) liet., trump. Butė, Būtė, iš vyr. v. Butvilas.',' Butvilė yra lietuvių kilmės vardas.'),(393,'Butvilas',' Butvilas yra Vyriškas vardas.','Trumpa reikšmė: but- (butas, būti) + vil- (viltis) – „esanti, gyva viltis“.','Vardo reikšmė: Butvilas – (1) liet., trump. Butys, Būtys, but- (žr. Butgailas) + vil- (žr. Bartvilas).',' Butvilas yra lietuvių kilmės vardas.'),(394,'Butvydas',' Butvydas yra Vyriškas vardas.','Trumpa reikšmė: bu- (būti) + vyd (iš-vydo).','Vardo reikšmė: Butvydas – (1) liet., trump, Butys, Būtys, but- (žr. Butgailas) + vyd- (žr. Barvydas).',' Butvydas yra lietuvių kilmės vardas.'),(395,'Butrimė',' Butrimė yra Moteriškas vardas.','Trumpa reikšmė: bu- (būti) + rim- (rimti).','Vardo reikšmė: Butrimė – (l) liet. ir prūs., trump. Butė, Būtė, iš vyr. v. Butrimas.',' Butrimė yra lietuvių kilmės vardas.'),(396,'Butrimas',' Butrimas yra Vyriškas vardas.','Trumpa reikšmė: bu- (būti) + rim- (rimti).','Vardo reikšmė: Butrimas – (1) liet. ir prūs., trump. Butys, Būtys, but- (žr. Butgailas) + rim- (: liet. rim-ti).',' Butrimas yra lietuvių kilmės vardas.'),(397,'Butnoras',' Butnoras yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Butys, Būtys, but- (žr. Butgailas) + nor- (žr. Beinoras).','Vardo reikšmė: Butnoras – (1) liet., trump. Butys, Būtys, but- (žr. Butgailas) + nor- (žr. Beinoras).',' Butnoras yra lietuvių kilmės vardas.'),(398,'Butmintas',' Butmintas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Butys, Būtys, but- (žr. Butgailas) + mint- (: liet. minti, mint-as, mint-is).','Vardo reikšmė: Butmintas – (1) liet., trump. Butys, Būtys, but- (žr. Butgailas) + mint- (: liet. minti, mint-as, mint-is).',' Butmintas yra lietuvių kilmės vardas.'),(399,'Butminas',' Butminas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Butys, Būtys, but- (žr. Butgailas) + min- (žr. Bartminas).','Vardo reikšmė: Butminas – (1) liet., trump. Butys, Būtys, but- (žr. Butgailas) + min- (žr. Bartminas).',' Butminas yra lietuvių kilmės vardas.'),(400,'Cecilius',' Cecilius yra Vyriškas vardas.','Trumpa reikšmė: trump. Cilas, - liet. trumpinys iš Cecilijus.','Vardo reikšmė: Cecilijai labai gerai jaučiasi visuomeniniame darbe. Niekas aiškiau nesugebės išaiškinti užduoties ar pavedimo kaip jia. Tačiau nemėgsta, kai juos bando “laikyti už trumpo pavadėlio”. Jie dirba dėl polinkio, o ne iš prievartos.',' Cecilius yra lotynų kilmės vardas.'),(401,'Cecilijus',' Cecilijus yra Vyriškas vardas.','Trumpa reikšmė: caecus „aklas“.','Vardo reikšmė: Cecilijai labai gerai jaučiasi visuomeniniame darbe. Niekas aiškiau nesugebės išaiškinti užduoties ar pavedimo kaip jis. Tačiau nemėgsta, kai juos bando “laikyti už trumpo pavadėlio”. Jie dirba iš idėjos o ne ieškodami naudos sau pačiam.',' Cecilijus yra lotynų kilmės vardas.'),(402,'Celė',' Celė yra Moteriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Celina ir kt.','Vardo reikšmė: Celė – (2) liet. trumpinys iš Celina ir kt.',' Celė yra lietuvių kilmės vardas.'),(403,'Celerina',' Celerina yra Moteriškas vardas.','Trumpa reikšmė: celer „greitas“.','Vardo reikšmė: Celerina – (2) lot., trump. Celera, Celė, iš lot. Celerina, kuris iš vyr. v. Celerinas.',' Celerina yra lotynų kilmės vardas.'),(404,'Cecilė',' Cecilė yra Moteriškas vardas.','Trumpa reikšmė: caeca „aklas“.','Vardo reikšmė: Cecilijos puikios mokytojos, astrologės, istorikės, chemikės medikės, radijo ir televizijos darbuotojos.',' Cecilė yra lotynų kilmės vardas.'),(405,'Cecilija',' Cecilija yra Moteriškas vardas.','Trumpa reikšmė: caecus „aklas“.','Vardo reikšmė: Cecilijų laimingi skaičiai – 25 ir 28.',' Cecilija yra lotynų kilmės vardas.'),(406,'Cilas',' Cilas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Cecilijus, Cecilė lotynų: caecus „aklas“.','Vardo reikšmė: Cilas – (2) liet. trumpinys iš Cecilijus.',' Cilas yra lotynų kilmės vardas.'),(407,'Cilė',' Cilė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Cecilijus, Cecilė lotynų: caecus „aklas“.','Vardo reikšmė: Cilė – (2) liet. trumpinys iš Cecilė, Cecilija.',' Cilė yra lotynų kilmės vardas.'),(408,'Cezaris',' Cezaris yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Cezarijus: „ilgaplaukė, ilgaplaukis“.','Vardo reikšmė: Cezaris – (1) liet. trumpinys iš Cezarijus.',' Cezaris yra lotynų kilmės vardas.'),(409,'Cezarijus',' Cezarijus yra Vyriškas vardas.','Trumpa reikšmė: „ilgaplaukė, ilgaplaukis“.','Vardo reikšmė: Vardadienis: Sausio 12 d., rugpjūčio 27 d.',' Cezarijus yra lotynų kilmės vardas.'),(410,'Cezarija',' Cezarija yra Moteriškas vardas.','Trumpa reikšmė: „ilgaplaukė, ilgaplaukis“.','Vardo reikšmė: Cezarija – (l) lot., trump. Cezarė, Cezara, iš lot. Caesaria, kuris iš vyr. v. Caesarius, žr. Cezarijus.',' Cezarija yra lotynų kilmės vardas.'),(411,'Cezaras',' Cezaras yra Vyriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Cezarijus.','Vardo reikšmė: Cezaras – (2) liet. trumpinys iš Cezarijus.',' Cezaras yra lietuvių kilmės vardas.'),(412,'Celsas',' Celsas yra Vyriškas vardas.','Trumpa reikšmė: celsus „aukštas, kilnus“.','Vardo reikšmė: Celsas – (1) lot., iš lot, Celsus: lot. celsus „aukštas, kilnus“.',' Celsas yra lotynų kilmės vardas.'),(413,'Celina',' Celina yra Moteriškas vardas.','Trumpa reikšmė: „dangiška“.','Vardo reikšmė: Celina – (2) lot., trump. Celė: iš lot. Coelina lot. coelina „dangaus, dangiška“.',' Celina yra lotynų kilmės vardas.'),(414,'Celijus',' Celijus yra Vyriškas vardas.','Trumpa reikšmė: caelum „dangus“.','Vardo reikšmė: Celijus – (1) lot., trump. Celius, iš lot. Celius: lot. caelum „dangus“.',' Celijus yra lotynų kilmės vardas.'),(415,'Celestinas',' Celestinas yra Vyriškas vardas.','Trumpa reikšmė: caelestinus, caelestina „dangiška, dangiškas“.','Vardo reikšmė: Vardadienis: Balandžio 6 d., gegužės 19 d.',' Celestinas yra lotynų kilmės vardas.'),(416,'Celestas',' Celestas yra Vyriškas vardas.','Trumpa reikšmė: „dangiška, dangiškas“.','Vardo reikšmė: Celestas – (2) liet. trumpinys iš Celestinas.',' Celestas yra lotynų kilmės vardas.'),(417,'Celestina',' Celestina yra Moteriškas vardas.','Trumpa reikšmė: caelestinus, caelestina „dangiška, dangiškas“.','Vardo reikšmė: Celestina – (2) lot., trump. Celesta, Celė, iš lot. Caelestina, Coelestina: lot. caelestina „dangaus, dangiška“.',' Celestina yra lotynų kilmės vardas.'),(418,'Celesta',' Celesta yra Moteriškas vardas.','Trumpa reikšmė: „dangiška, dangiškas“.','Vardo reikšmė: Celesta – (2) liet. trumpinys iš Celestina.',' Celesta yra lotynų kilmės vardas.'),(419,'Celerinas',' Celerinas yra Vyriškas vardas.','Trumpa reikšmė: celer „greitas“.','Vardo reikšmė: Celerinas – (2) lot., trump. Celeras, Celas, iš lot. Celerinus, lot. celer „greitas, vikrus“.',' Celerinas yra lotynų kilmės vardas.'),(420,'Česė',' Česė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Česlova, Česlovas: čest „garbė“.','Vardo reikšmė: Česė – (2) liet. trumpinys iš Česlova.',' Česė yra slavų kilmės vardas.'),(421,'Česlova',' Česlova yra Moteriškas vardas.','Trumpa reikšmė: čest „garbė“ + slava „šlovė“.','Vardo reikšmė: Česlovams geriausia gyvenimo draugė ta, kuri turi platų pažiūrų ratą, jai svetimas pavydo jausmas. Joms reikėtų turėti netgi artistiškų bruožų, kad sugebėtų išlaikyti jų interesus, vertintų jų plačius mastus ir drąsius entuziazmo protrūkius.',' Česlova yra slavų kilmės vardas.'),(422,'Česlovas',' Česlovas yra Vyriškas vardas.','Trumpa reikšmė: čest „garbė“ + slava „šlovė“.','Vardo reikšmė: Česlovams geriausia gyvenimo draugė ta, kuri turi platų pažiūrų ratą, jai svetimas pavydo jausmas. Joms reikėtų turėti netgi artistiškų bruožų, kad sugebėtų išlaikyti jų interesus, vertintų jų plačius mastus ir drąsius entuziazmo protrūkius.',' Česlovas yra slavų kilmės vardas.'),(423,'Čiovydas',' Čiovydas yra Vyriškas vardas.','Trumpa reikšmė: čio- (čion „čia“) + vyd- (iš-vydo).','Vardo reikšmė: Čiovydas – (1) liet., trump. Vydas, čio- (: liet. čion „čia“) + vyd- (: liet. iš-vys-ti, iš-vyd-o).',' Čiovydas yra lietuvių kilmės vardas.'),(424,'Dalia',' Dalia yra Moteriškas vardas.','Trumpa reikšmė: dalia „likimas“, lietuvių pagonių mitologijos deivė Dalia – likimo dalytoja.','Vardo reikšmė: Dalios romantiškos idealistės, svajotojos ir labai dažnai jaučiasi įsimylėjusios. Jeigu suranda tikrąją meilę, tai jai atsiduoda visa savo siela ir kūnu. Jos optimistės ir atviraširdės ir netgi neturi minties, jog žmogus, kurį myli, galėtų būti neištikimas.',' Dalia yra lietuvių kilmės vardas.'),(425,'Dainora',' Dainora yra Moteriškas vardas.','Trumpa reikšmė: dain- (daina) + nor- (noras, norėti) – „norinti dainuoti“.','Vardo reikšmė: Dainorų darbo vieta dvelkia pasitikėjimo atmosfera, visada tvarkinga, nėra nieko nereikalingo. Jų darbo pobūdis labai įvairus. Trokšdamos žinių, jos įsisavina bet kurią profesiją. Mėgsta labai kruopščiai ir profesionaliai dirbti. Jos įstaigų vadovės, puikios chemikės, įvairių sričių inžinierės.',' Dainora yra lietuvių kilmės vardas.'),(426,'Dava',' Dava yra Moteriškas vardas.','Trumpa reikšmė: liet., Vydūno padarytas vardas iš sanskrito daiva „lemtis, dalia“.','Vardo reikšmė: Dava – (1) liet., Vydūno padarytas vardas iš sanskrito daiva „lemtis, dalia“.',' Dava yra lietuvių kilmės vardas.'),(427,'Dainė',' Dainė yra Moteriškas vardas.','Trumpa reikšmė: dain- (daina) – „dainininkas, dainininkė“.','Vardo reikšmė: Dainė – (2) liet., iš vyr. v. Dainys.',' Dainė yra lietuvių kilmės vardas.'),(428,'Daina',' Daina yra Moteriškas vardas.','Trumpa reikšmė: daina.','Vardo reikšmė: Dainos, labai etiškos asmenybės, kurios stengiasi visada rodyti geriausius rezultatus. Jų vardadienį globoja Jupiterio planeta, todėl jų pagrindinis bruožas – intelektas. Esa realistės todėl ir protas būna analitinis ir tai joms leidžia atlikti grandiozinius darbus.',' Daina yra lietuvių kilmės vardas.'),(429,'Dagnė',' Dagnė yra Moteriškas vardas.','Trumpa reikšmė: dagr „diena“ + ny „nauja“.','Vardo reikšmė: Dagnė – (2) skand, iš skand. Dagny: skand. dagr „diena“ + NY „nauja“.',' Dagnė yra skandinavų kilmės vardas.'),(430,'Dagmara',' Dagmara yra Moteriškas vardas.','Trumpa reikšmė: dagr „diena“ + maerr „garsi, žymi“.','Vardo reikšmė: Dagmara – (2) skand., trump. Dagmė, iš skand. Dagmar: skand. dagr „diena“ + maerr „garsi, žymi“.',' Dagmara yra skandinavų kilmės vardas.'),(431,'Dabinta',' Dabinta yra Moteriškas vardas.','Trumpa reikšmė: liet., iš upėvardžio Dabinta (Kruonis).','Vardo reikšmė: Dabinta – (4) liet., iš upėvardžio Dabinta (Kruonis).',' Dabinta yra lietuvių kilmės vardas.'),(432,'Dangiras',' Dangiras yra Vyriškas vardas.','Trumpa reikšmė: iškreiptas iš Daugirutis: dau- (daug) + gir- (giria „miškas“).','Vardo reikšmė: Dangiras – (1) liet., trump. Dangis, iškreiptas iš Daugiras.',' Dangiras yra lietuvių kilmės vardas.'),(433,'Dangira',' Dangira yra Moteriškas vardas.','Trumpa reikšmė: iškreiptas iš Daugirutis: dau- (daug) + gir- (giria „miškas“).','Vardo reikšmė: Dangira – (3a), (1) liet., trump. Dangė, iš vyr. v. Dangiras.',' Dangira yra lietuvių kilmės vardas.'),(434,'Dangė',' Dangė yra Moteriškas vardas.','Trumpa reikšmė: liet. dangus, vertinys, iš lot. vardų Celina, Celestina.','Vardo reikšmė: Dangė – (2) liet., liet. dangus, vertinys, iš lot. vardų Celina, Celestina.',' Dangė yra lietuvių kilmės vardas.'),(435,'Damijonas',' Damijonas yra Vyriškas vardas.','Trumpa reikšmė: damao „tramdyti“ – „tramdytojas, taikdarys“.','Vardo reikšmė: (2) graik., trump. Damas, iš sulotyninto graik. Damianus: graik. damao „tramdyti“',' Damijonas yra graikų kilmės vardas.'),(436,'Damazas',' Damazas yra Vyriškas vardas.','Trumpa reikšmė: damazo „malšinti“ – „malšintojas, taikdarys“.','Vardo reikšmė: Damazas – (2) graik., trump, Damas, iš sulotyninto graik. Damasus: graik. damazo „malšinti“.',' Damazas yra graikų kilmės vardas.'),(437,'Damas',' Damas yra Vyriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Damazas ir Damijonas.','Vardo reikšmė: Damas – (2) liet. trumpinys iš Damazas ir Damijonas.',' Damas yra lietuvių kilmės vardas.'),(438,'Dalius',' Dalius yra Vyriškas vardas.','Trumpa reikšmė: dalia „likimas“, lietuvių pagonių mitologijos deivė Dalia – likimo dalytoja.','Vardo reikšmė: Daliai – filosofai. Gali valandų valandas mąstyti ką padaryti dar geriau ir gilintis kodėl kiti daro ne taip kaip jie. ',' Dalius yra lietuvių kilmės vardas.'),(439,'Dargilė',' Dargilė yra moteriškas vardas.','Trumpa reikšmė: liet. ir prūs., trump. Darė, Dargė, iš vyr. v. Dargilas.','Vardo reikšmė: Dargilė – (l) liet. ir prūs., trump. Darė, Dargė, iš vyr. v. Dargilas.',' Dargilė yra lietuvių kilmės vardas.'),(440,'Dalija',' Dalija yra Moteriškas vardas.','Trumpa reikšmė: dahlia „jurginas“.','Vardo reikšmė: Dalija – (1) naujas lot., trump. Dalė, iš lot. botanikos termino Dahlia (variabilis) „jurginas“.',' Dalija yra lotynų kilmės vardas.'),(441,'Dargenė',' Dargenė yra Moteriškas vardas.','Trumpa reikšmė: liet. ir prūs., trump. Dargė, iš vyr. v. Dargenis.','Vardo reikšmė: Dargenė – (2) liet. ir prūs., trump. Dargė, iš vyr. v. Dargenis.',' Dargenė yra lietuvių kilmės vardas.'),(442,'Dargė',' Dargė yra Moteriškas vardas.','Trumpa reikšmė: liet., trumpinys iš mot. v. su Dar-g-: Dargailė, Dargaudė, Dargintė ir kt..','Vardo reikšmė: Dargė – (1) liet., trumpinys iš mot. v. su Dar-g-: Dargailė, Dargaudė, Dargintė ir kt.',' Dargė yra lietuvių kilmės vardas.'),(443,'Dalė',' Dalė yra Moteriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Dalija.','Vardo reikšmė: Dalė – (2) liet. trumpinys iš Dalija.',' Dalė yra lietuvių kilmės vardas.'),(444,'Dargas',' Dargas yra Vyriškas vardas.','Trumpa reikšmė: liet., trumpinys iš avd. su Darg-, Dar-g-: Dargvainas, Dargilas, Dargailas, Dargaudas ir kt.','Vardo reikšmė: Dargas – (1) liet., trumpinys iš avd. su Darg-, Dar-g-: Dargvainas, Dargilas, Dargailas, Dargaudas ir kt.',' Dargas yra lietuvių kilmės vardas.'),(445,'Dargailė',' Dargailė yra Moteriškas vardas.','Trumpa reikšmė: dar- (daryti) + gail- (gailas „stiprus“).','Vardo reikšmė: Dargailė – (1) liet., trump. Darė, Dargė, iš vyr. v. Dargaila, žr. Dargailas.',' Dargailė yra lietuvių kilmės vardas.'),(446,'Darbutas',' Darbutas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Daras, Darius, dar- (: liet. dar-yti) + but- (: liet. but-as, būti).','Vardo reikšmė: Darbutas – (1) liet., trump. Daras, Darius, dar- (: liet. dar-yti) + but- (: liet. but-as, būti).',' Darbutas yra lietuvių kilmės vardas.'),(447,'Darė',' Darė yra Moteriškas vardas.','Trumpa reikšmė: liet., trumpinys iš mot. v. su Dar-: Dargailė, Dargintė, Dartautė ir kt.','Vardo reikšmė: Darė – (2) liet., trumpinys iš mot. v. su Dar-: Dargailė, Dargintė, Dartautė ir kt.',' Darė yra lietuvių kilmės vardas.'),(448,'Darata',' Darata yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Dorotėja: doron „dovana“ + teos „dievas“ – „dievo dovana“.','Vardo reikšmė: Vardadienis: Vasario 6 d., spalio 30 d.',' Darata yra graikų kilmės vardas.'),(449,'Danutė',' Danutė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Danielė: „dievas mano teisėjas“.','Vardo reikšmė: Danutės savo profesijose labai specializuojasi ir tampa savo amato profesionalėmis . Stropios, atkaklios užtat dažnai pasirenka politikės karjerą.',' Danutė yra hebrajų, lietuvių kilmės vardas.'),(450,'Danielius',' Danielius yra Vyriškas vardas.','Trumpa reikšmė: „dievas mano teisėjas“.','Vardo reikšmė: Danieliai nesukurti vakarėliams, jie mieliau renkasi draugų ratą, keliones , turizmą. Puiki jų intuicija, kuri apsaugo juos nuo gyvenimo klaidingų posūkių.',' Danielius yra hebrajų kilmės vardas.'),(451,'Danguolė',' Danguolė yra Moteriškas vardas.','Trumpa reikšmė: dangus + -uol- „dangiškoji, dangiškasis“.','Vardo reikšmė: Danguolių loginis mąstymas – gyvenimo dovana. Jos gali tapti puikiomis psichologėmis , medikėmis.',' Danguolė yra lietuvių kilmės vardas.'),(452,'Dangirutis',' Dangirutis yra Vyriškas vardas.','Trumpa reikšmė: dau- (daug) + gir- (giria „miškas“) – „daugelio girių valdovas“.','Vardo reikšmė: Dangirutis – (2) liet., sen. var. Dangerutis, trump. Dangiras, Dangis, iškreiptas iš Daugirutis.',' Dangirutis yra lietuvių kilmės vardas.'),(453,'Dartautas',' Dartautas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Daras, Darys, Darius, dar- (žr. Darbutas) + taut- ( : liet. taut-a).','Vardo reikšmė: Dartautas – (1) liet., trump. Daras, Darys, Darius, dar- (žr. Darbutas) + taut- ( : liet. taut-a).',' Dartautas yra lietuvių kilmės vardas.'),(454,'Darmintas',' Darmintas yra Vyriškas vardas.','Trumpa reikšmė: dar- (dar) + min- (minėti) – „dar minimas, -a“.','Vardo reikšmė: Darmintas – (1) liet., trump. Daras, Darys, Darius, dar- (žr. Dar-butas) + mint- (: liet. minti, mint-is).',' Darmintas yra lietuvių kilmės vardas.'),(455,'Darmantas',' Darmantas yra Vyriškas vardas.','Trumpa reikšmė: dar- (daryti) + mant- (mantus „sumanus“).','Vardo reikšmė: Darmantas – (1) liet., trump. Daras, Darys, Darius: dar- (žr. Darbutas) + mant- (: liet. mant-us „sumanus“).',' Darmantas yra lietuvių kilmės vardas.'),(456,'Darmantė',' Darmantė yra Moteriškas vardas.','Trumpa reikšmė: dar- (daryti) + mant- (mantus „sumanus“).','Vardo reikšmė: Darmantė – (1) liet., trump. Darė, iš vyr. v. Darmantas.',' Darmantė yra lietuvių kilmės vardas.'),(457,'Darkintas',' Darkintas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Daras, Darys, Darius, dar- (žr. Dar-butas) + kint- (: liet. su balsių kaita iš kent-: kentėti, plg. žiem-kintis).','Vardo reikšmė: Darkintas – (l) liet., trump. Daras, Darys, Darius, dar- (žr. Dar-butas) + kint- (: liet. su balsių kaita iš kent-: kentėti, plg. žiem-kintis).',' Darkintas yra lietuvių kilmės vardas.'),(458,'Darius',' Darius yra Vyriškas vardas.','Trumpa reikšmė: 1. graikų: „turtuolis, turtų valdytojas“, 2. lietuvių dar- (daryti), 3. transatlantinio lakūno pavardė.','Vardo reikšmė: Dariams namai – tai jų tvirtovė, kurioje jie turi jaustis saugūs, atsipalaidavę. Savo gerbūvio kūrimui gali paaukoti pusę gyvenimo.',' Darius yra graikų kilmės vardas.'),(459,'Darijus',' Darijus yra Vyriškas vardas.','Trumpa reikšmė: „turtuolis, turtų valdytojas“.','Vardo reikšmė: Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas, tačiau dauguma Jūsų sugebate kažkokiu būdu disponuoti pakankamomis lėšomis ir problemų dėl išlaidumo nejaučiate, nes jums dažniausiai nuskyla būti santuokoje su pasiturinčias partneriais.',' Darijus yra graikų kilmės vardas.'),(460,'Darija',' Darija yra Moteriškas vardas.','Trumpa reikšmė: „turtuolis, turtų valdytojas“.','Vardo reikšmė: Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas, tačiau dauguma Jūsų sugebate kažkokiu būdu disponuoti pakankamomis lėšomis ir problemų dėl išlaidumo nejaučiate, nes jums dažniausiai nuskyla būti santuokoje su pasiturinčias partneriais.',' Darija yra graikų kilmės vardas.'),(461,'Dargvilė',' Dargvilė yra Moteriškas vardas.','Trumpa reikšmė: dar- (daryti) + vil- (vitis).','Vardo reikšmė: Jis suteikia Jums drąsos ir noro rizikuoti. Tampate ryžtingesnis ir tikslingesnis.Padidėja dėmesys visuomenės reikmėms, jaučiate poreikį pasitarnauti visuomenei. Šis vardas leidžia Jums geriau įvertinti žmonių charakterius.',' Dargvilė yra lietuvių kilmės vardas.'),(462,'Dargiris',' Dargiris yra Vyriškas vardas.','Trumpa reikšmė: lietuviškas vardas iš transatlantinių lakūnų Darius ir Girėnas pavardžių šaknų, šiems lakūnams pagerbti.','Vardo reikšmė: Šis vardas suteikia Jums daugiau energijos, galite įgyti daugiau muzikinių, vaidybinių sugebėjimų. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Dargiris yra lietuvių kilmės vardas.'),(463,'Dargvainė',' Dargvainė yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Dargė, iš vyr. v. Dargvainas.','Vardo reikšmė: Jis teikia Jums nepriklausomybės, individualumo, originalumo ir išradingumo. Jis suteikia Jums drąsos ir noro rizikuoti. Tampate ryžtingesnis ir tikslingesnis.Padidėja dėmesys visuomenės reikmėms, jaučiate poreikį pasitarnauti visuomenei. ',' Dargvainė yra lietuvių kilmės vardas.'),(464,'Dargirė',' Dargirė yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Darė, iš vyr. v. Dargiris.','Vardo reikšmė: Šis vardas suteikia Jums daugiau energijos, galite įgyti daugiau muzikinių, vaidybinių sugebėjimų. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Dargirė yra lietuvių kilmės vardas.'),(465,'Daugaudas',' Daugaudas yra Vyriškas vardas.','Trumpa reikšmė: dau- (daug) + gaud- (gaudyti, gauti) – „daug gaunantis“.','Vardo reikšmė: Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs.',' Daugaudas yra lietuvių kilmės vardas.'),(466,'Daugardas',' Daugardas yra Vyriškas vardas.','Trumpa reikšmė: dau- (daug) + gard (girdėti, garsus) – „daugeliui žinomas, garsus“.','Vardo reikšmė: Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas.Mėgstate discipliną ir tvarką, konservatyvūs ir pedantiški, stengiatės palaikyti bendrai priimtas tradicijas ir tvarką.Kai kurie esate avantiūristai, nuotykių ieškotojai, užsispyrę žaidėjai : gyvenimas – teatras.',' Daugardas yra lietuvių kilmės vardas.'),(467,'Daubaras',' Daubaras yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Daubas, Daubys, dau- iš daug- (: liet. daug, daug-inti) + bar- (: liet. bar-ti - sen. reikšme „kovoti“, plg. rus. borotj-sia „kovoti“).','Vardo reikšmė: Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs.',' Daubaras yra lietuvių kilmės vardas.'),(468,'Dasijus',' Dasijus yra Vyriškas vardas.','Trumpa reikšmė: dasys „tankiaplaukis“.','Vardo reikšmė: Šis vardas leidžia Jums geriau įvertinti žmonių charakterius. Šis vardas suteikia Jums daugiau energijos, galite įgyti daugiau muzikinių, vaidybinių sugebėjimų.',' Dasijus yra graikų kilmės vardas.'),(469,'Darvilė',' Darvilė yra moteriškas vardas.','Trumpa reikšmė: liet., trump. Darė, iš vyr. v. Darvilas.','Vardo reikšmė: Darvilė – (1), (2) liet., trump. Darė, iš vyr. v. Darvilas.',' Darvilė yra lietuvių kilmės vardas.'),(470,'Darvilas',' Darvilas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Daras, Darys, Darius, dar- (žr. Darbutas) + vil- (žr. Dargvilas).','Vardo reikšmė: Darvilas – (1) liet., trump. Daras, Darys, Darius, dar- (žr. Darbutas) + vil- (žr. Dargvilas).',' Darvilas yra lietuvių kilmės vardas.'),(471,'Darvydas',' Darvydas yra Vyriškas vardas.','Trumpa reikšmė: dar (daryti) + vyd- (iš-vydo).','Vardo reikšmė: Esate imlus ir nepriklausomas, turite stiprią valią ir intuiciją. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas.',' Darvydas yra lietuvių kilmės vardas.'),(472,'Daugmintas',' Daugmintas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Daugas, Daugys, daug- (žr. Daugmantas) + mint- (žr. Darmintas).','Vardo reikšmė: Šis vardas simbolizuoja norą imtis naujų idėjų ir jas įgyvendinti. Esate plačios atviros natūros, įžvalgūs, niekada neišgyvenate dėl niekniekių, imlus ir nepriklausomas, turite stiprią valią ir intuiciją. ',' Daugmintas yra lietuvių kilmės vardas.'),(473,'Daugmantė',' Daugmantė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Dauga, Daugė, iš vyr. v. Daugmantas.','Vardo reikšmė: Šis vardas simbolizuoja norą imtis naujų idėjų ir jas įgyvendinti. Esate plačios atviros natūros, įžvalgūs, niekada neišgyvenate dėl niekniekių, imlus ir nepriklausomas, turite stiprią valią ir intuiciją.',' Daugmantė yra lietuvių kilmės vardas.'),(474,'Darutis',' Darutis yra Vyriškas vardas.','Trumpa reikšmė: dar- (daryti) + -ut- – „ką nors darantis; veiklus, veikli“.','Vardo reikšmė: Jus ne taip paprasta pažeisti; labai pasitikite savimi. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs.',' Darutis yra lietuvių kilmės vardas.'),(475,'Daugmantas',' Daugmantas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Daugas, Daugys, daug- (:liet. daug, daug-inti) + mant- (žr. Darmantas).','Vardo reikšmė: Daugmantas – (1) liet., trump. Daugas, Daugys, daug- (:liet. daug, daug-inti) + mant- (žr. Darmantas).',' Daugmantas yra lietuvių kilmės vardas.'),(476,'Darutė',' Darutė yra Moteriškas vardas.','Trumpa reikšmė: dar- (daryti) + -ut- – „ką nors darantis; veiklus, veikli“.','Vardo reikšmė: Jus ne taip paprasta pažeisti; labai pasitikite savimi. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs.',' Darutė yra lietuvių kilmės vardas.'),(477,'Daugirutis',' Daugirutis yra Vyriškas vardas.','Trumpa reikšmė:  iš Daugiras: daug- (daug) + gir- (girti) – „daug giriamas, -a“.','Vardo reikšmė: (2) liet., trump. Daugas, Daugys, priesagos -utis vedinys iš Daugiras',' Daugirutis yra lietuvių kilmės vardas.'),(478,'Daugiras',' Daugiras yra Vyriškas vardas.','Trumpa reikšmė: dau- (daug) + gir- (giria „miškas“).','Vardo reikšmė: Tai – galingas vardas, suteikiantis Jums gero lyderio savybių. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Jis teikia Jums nepriklausomybės, individualumo, originalumo ir išradingumo.',' Daugiras yra lietuvių kilmės vardas.'),(479,'Darotas',' Darotas yra Vyriškas vardas.','Trumpa reikšmė: liet. ir prūs., trump. Daras, Darius, priesagos -otas vedinys iš sen. trump. Daras, kuris iš avd. su Dar-: Dargailas, Dargintas ir kt..','Vardo reikšmė: Darotas – (1) liet. ir prūs., trump. Daras, Darius, priesagos -otas vedinys iš sen. trump. Daras, kuris iš avd. su Dar-: Dargailas, Dargintas ir kt.',' Darotas yra prūsų kilmės vardas.'),(480,'Dartautė',' Dartautė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Darė, iš vyr. v. Dartautas.','Vardo reikšmė: Dartautė – (1) liet., trump. Darė, iš vyr. v. Dartautas.',' Dartautė yra lietuvių kilmės vardas.'),(481,'Daugintas',' Daugintas yra Vyriškas vardas.','Trumpa reikšmė: dau- (daug) + gin- (gintas „užstotas, apsaugotas“).','Vardo reikšmė: Daugintas – (1) liet., trump. Daugas, Daugys, dau- (žr. Daubaras) + gint- (: liet. gint-as „užstotas, saugotas“).',' Daugintas yra lietuvių kilmės vardas.'),(482,'Dauginas',' Dauginas yra Vyriškas vardas.','Trumpa reikšmė: dau- (daug) + gin- (ginti „užstoti, saugoti“).','Vardo reikšmė: Dauginas – (1) liet., trump. Daugas, Daugys, dau- (žr. Daubaras)+ gin- (: liet. gin-ti „užstoti, saugoti“)',' Dauginas yra lietuvių kilmės vardas.'),(483,'Daugilė',' Daugilė yra Moteriškas vardas.','Trumpa reikšmė: dau- (daug) + gil- (gildyti širdį).','Vardo reikšmė: Šis vardas stiprina Jūsų lyderio, vedlio sugebėjimus. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas.Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Daugilė yra lietuvių kilmės vardas.'),(484,'Daugilas',' Daugilas yra Vyriškas vardas.','Trumpa reikšmė: dau- (daug) + gil- (gildyti širdį).','Vardo reikšmė: Šis vardas stiprina Jūsų lyderio, vedlio sugebėjimus. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas.Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Daugilas yra lietuvių kilmės vardas.'),(485,'Daugenė',' Daugenė yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Dauga, Daugė, iš vyr. v. Daugenis.','Vardo reikšmė: Daugenė – (2) liet., trump. Dauga, Daugė, iš vyr. v. Daugenis.',' Daugenė yra lietuvių kilmės vardas.'),(486,'Daujotas',' Daujotas yra Vyriškas vardas.','Trumpa reikšmė: dau- (daug) + jot- (joti) – „daug jojęs, nukeliavęs“.','Vardo reikšmė: Daujotams vertėtų daugiau padirbėti darbą, kuriam puikiai sugeba vadovauti. Jie puikūs lyderiai daugelyje profesijų, bet prasti darbininkai , nes giliai tiki, kad esa gimę vadovauti.',' Daujotas yra lietuvių kilmės vardas.'),(487,'Daugėlas',' Daugėlas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Daugas, Daugys, dau- (žr. Daubaras)+ gėl- (: liet. gėl-a „didelis skausmas“).','Vardo reikšmė: Šis vardas stiprina Jūsų žinių troškimą. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis. Protas tampa analitiškesnis, sugebate giliau įsiskverbti į reiškinių esmę.',' Daugėlas yra lietuvių kilmės vardas.'),(488,'Daugvinas',' Daugvinas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Daugas, Daugys, daug- (žr. Daugmantas) + vin- (: sen. liet. vin- su balsių kaita iš vain-: vaina „kaltė, priežastis“).','Vardo reikšmė: Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis ir panaudoti praktikoje. Protas tampa analitiškesnis, sugebate giliau įsiskverbti į reiškinių esmę. Atsiranda noras veikti ryžtingiau. ',' Daugvinas yra lietuvių kilmės vardas.'),(489,'Daugvilė',' Daugvilė yra Moteriškas vardas.','Trumpa reikšmė: dau- (daug) + vil- (viltis) – „daug besiviliantis, -i“).','Vardo reikšmė: Jus jau nebe taip lengva apkvailinti.Tos savybės rodo savo teisių žinojimą, nepajudinamą valios galią. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Daugvilė yra lietuvių kilmės vardas.'),(490,'Daugvilas',' Daugvilas yra Vyriškas vardas.','Trumpa reikšmė: dau- (daug) + vil- (viltis) – „daug besiviliantis, -i“).','Vardo reikšmė: Jus jau nebe taip lengva apkvailinti.Tos savybės rodo savo teisių žinojimą, nepajudinamą valios galią. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Daugvilas yra lietuvių kilmės vardas.'),(491,'Daugvydas',' Daugvydas yra Vyriškas vardas.','Trumpa reikšmė: dau- (daug) + vyd- (iš-vydo) – „daug matęs, patyręs“.','Vardo reikšmė: Jūsų vardas stiprina Jūsų jautrumą ir sugebėjimą rūpintis kitais žmonėmis. Jis padeda Jums lengviau bendrauti su kitais, panaudoti taktą ir diplomatiją. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Sustiprėją taikdario ir patarėjo sugebėjimai. ',' Daugvydas yra lietuvių kilmės vardas.'),(492,'Daugvardas',' Daugvardas yra Vyriškas vardas.','Trumpa reikšmė: (1) liet., trump. Daugas, Daugys, daug- (žr. Daugmantas) + vard- (: liet. vard-uoti „burti“).','Vardo reikšmė: Daugvardas – (1) liet., trump. Daugas, Daugys, daug- (žr. Daugmantas) + vard- (: liet. vard-uoti „burti“).',' Daugvardas yra lietuvių kilmės vardas.'),(493,'Daugturas',' Daugturas yra Vyriškas vardas.','Trumpa reikšmė: (1) liet., trump. Daugas, Daugys, daug- (žr. Daugmantas) + tur- (: liet. tur-ėti).','Vardo reikšmė: Daugturas – (1) liet., trump. Daugas, Daugys, daug- (žr. Daugmantas) + tur- (: liet. tur-ėti).',' Daugturas yra lietuvių kilmės vardas.'),(494,'Daugotė',' Daugotė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Dauga, Daugė, iš vyr. v. Daugotas.','Vardo reikšmė: Jūs jaučiatės esąs principingesnis, doresnis ir ryžtingesnis. Ateityje įgysite daugiau organizacinių sugebėjimų.Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Esate plačios atviros natūros, įžvalgūs, niekada neišgyvenate dėl niekniekių. Dažniausiai Jūs intelektualinio darbo atstovai. ',' Daugotė yra lietuvių kilmės vardas.'),(495,'Dautartas',' Dautartas yra Vyriškas vardas.','Trumpa reikšmė: dau- (daug) + tar- (tarti) – „daug kalbantis, kalbus“.','Vardo reikšmė: Dautartas – (1) liet., trump. Dautas, Dautys, dau- (žr. Daubaras) + tart- (: liet. tart–as, tarti)',' Dautartas yra lietuvių kilmės vardas.'),(496,'Dautaras',' Dautaras yra Vyriškas vardas.','Trumpa reikšmė: dau- (daug) + tar- (tarti) – „daug kalbantis, kalbus“.','Vardo reikšmė: Dautaras – (1) liet. trump. Dautas, Dautys, dau- (žr. Daubaras) + tar- (: liet. tar-ti, tar-ia).',' Dautaras yra lietuvių kilmės vardas.'),(497,'Daunoras',' Daunoras yra Vyriškas vardas.','Trumpa reikšmė: dau- (daug) + nor- (norėti) – „daug norintis“.','Vardo reikšmė: Daunoras – (1) liet., trump. Daunas, Daunys, dau- (žr. Daubaras) + nor- (: liet. nor-ėti, nor-as).',' Daunoras yra lietuvių kilmės vardas.'),(498,'Daumintas',' Daumintas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Daumas, Daumys, dau- (žr. Daubaras) + mint- (žr. Darmintas).','Vardo reikšmė: Šio vardo savininkams patartina valdyti savo charakterį, užuot audringai prieštaravus – patylėti. Kadangi jie trokšta lyderiauti, reikėtų norus kontroliuoti. Taip pat reikėtų mokytis, kaip racionaliau tvarkyti savo pinigus.',' Daumintas yra lietuvių kilmės vardas.'),(499,'Daumilė',' Daumilė yra Moteriškas vardas.','Trumpa reikšmė: dau- (daug) + mil- (pa-milti).','Vardo reikšmė: Daumilė – (1), (2) liet., trump. Dauma, Daumė, iš vyr. v. Daumilas.',' Daumilė yra lietuvių kilmės vardas.'),(500,'Daumilas',' Daumilas yra Vyriškas vardas.','Trumpa reikšmė: dau- (daug) + mil- (pa-milti).','Vardo reikšmė: Daumilas – (1) liet., trump. Daumas, Daumys, dau- (žr. Daubaras) + mil- (: liet. pa-mil-ti).',' Daumilas yra lietuvių kilmės vardas.'),(501,'Daumantė',' Daumantė yra Moteriškas vardas.','Trumpa reikšmė: dau- (daug) + mant- (mantus „sumanus“).','Vardo reikšmė: Daumantės, turėdamos nepriekaištingą intelektą, tiesiai į akis rėžia savo nuomonę. Tai daro labai kategoriškai, visiškai nesiklausydamos kitų patarimų. Potraukis – žavėtis savimi.',' Daumantė yra lietuvių kilmės vardas.'),(502,'Daumantas',' Daumantas yra Vyriškas vardas.','Trumpa reikšmė: dau- (daug) + mant- (mantus „sumanus“).','Vardo reikšmė: Daumantas – (1) liet., trump. Daumas, Daumys, dau- (žr. Daubaras) + mant- (žr. Darmantas).',' Daumantas yra lietuvių kilmės vardas.'),(503,'Daukintas',' Daukintas yra Vyriškas vardas.','Trumpa reikšmė: (1) liet. ir prūs., trump. Daukas, Daukys, dau- (žr. Daubaras) + kint- (žr. Darkintas).','Vardo reikšmė: Daukintas – (1) liet. ir prūs., trump. Daukas, Daukys, dau- (žr. Daubaras) + kint- (žr. Darkintas).',' Daukintas yra lietuvių kilmės vardas.'),(504,'Daukantas',' Daukantas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Daukas, Daukys, dau- (žr. Daubaras) + kant- (: liet. pa-kant--tus, kant-rus).','Vardo reikšmė: Daukantas – (1) liet., trump. Daukas, Daukys, dau- (žr. Daubaras) + kant- (: liet. pa-kant–tus, kant-rus).',' Daukantas yra lietuvių kilmės vardas.'),(505,'Dirmantė',' Dirmantė yra Moteriškas vardas.','Trumpa reikšmė: dir- (dirbti) + mant- (mantus „sumanus“) – „darbštus ir protingas“.','Vardo reikšmė: Jus visi labai gerbia, lengvai surandate kontaktus su bet kokiais žmonėmis.Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Plačiai žvelgiate į pasaulį ir matote daugiau nei kiti, neišskiriant tarptautinių ryšių ir didžių socialinių permainų.',' Dirmantė yra lietuvių kilmės vardas.'),(506,'Dirmantas',' Dirmantas yra Vyriškas vardas.','Trumpa reikšmė: dir- (dirbti) + mant- (mantus „sumanus“) – „darbštus ir protingas“.','Vardo reikšmė: Jus visi labai gerbia, lengvai surandate kontaktus su bet kokiais žmonėmis.Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Plačiai žvelgiate į pasaulį ir matote daugiau nei kiti, neišskiriant tarptautinių ryšių ir didžių socialinių permainų.',' Dirmantas yra lietuvių kilmės vardas.'),(507,'Diksas',' Diksas yra Vyriškas vardas.','Trumpa reikšmė: vak. liet. trumpinys iš Bendiksas, žr. Benediktas.','Vardo reikšmė: Diksas – (2) vak. liet. trumpinys iš Bendiksas, žr. Benediktas.',' Diksas yra lietuvių kilmės vardas.'),(508,'Dinga',' Dinga yra Vyriškas vardas.','Trumpa reikšmė: liet., trumpinys iš Dingailė ir kt.','Vardo reikšmė: Jus visi labai gerbia, lengvai surandate kontaktus su bet kokiais žmonėmis.Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Plačiai žvelgiate į pasaulį ir matote daugiau nei kiti, neišskiriant tarptautinių ryšių ir didžių socialinių permainų.',' Dinga yra lietuvių kilmės vardas.'),(509,'Digna',' Digna yra Moteriškas vardas.','Trumpa reikšmė: digna „verta“.','Vardo reikšmė: Digna – (2) lot, iš lot. Digna: lot. digna „verta“',' Digna yra lotynų kilmės vardas.'),(510,'Diana',' Diana yra Moteriškas vardas.','Trumpa reikšmė: diva „deivė“, romėnų deivė Diana (Diviana), mėnulio ir medžioklės deivė.','Vardo reikšmė: Dianas traukia ugnis, todėl gali pasirinkti visai nemoterišką metalurgės profesiją. Visiškai netinka specialybės susietos su daugybe smulkmenų ar rutiniškos.',' Diana yra lotynų kilmės vardas.'),(511,'Deziderijus',' Deziderijus yra Vyriškas vardas.','Trumpa reikšmė: desiderium „laukimas, troškimas“.','Vardo reikšmė: Deziderijus – (1) lot., trump. Dezideras, iš lot. Desiderius: lot. desiderium „laukimas, troškimas“.',' Deziderijus yra lotynų kilmės vardas.'),(512,'Denys',' Denys yra Vyriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Dionyzas.','Vardo reikšmė: Denys – (4) liet. trumpinys iš Dionyzas.',' Denys yra lietuvių kilmės vardas.'),(513,'Deimilas',' Deimilas yra Vyriškas vardas.','Trumpa reikšmė: dei- (deivė) + mil- (pa-milti) – „deivių mylimas, -a“.','Vardo reikšmė: Deimilas – (1) liet., trump. Deimas, Deimys, dei- (žr. Deimantas) + mil- (žr. Daumilas).',' Deimilas yra lietuvių kilmės vardas.'),(514,'Deimilė',' Deimilė yra Moteriškas vardas.','Trumpa reikšmė: dei- (deivė) + mil- (pa-milti) – „deivių mylimas, -a“.','Vardo reikšmė: Deimilė – (1), (2) liet., trump. Deimė, iš vyr. v. Deimilas.',' Deimilė yra lietuvių kilmės vardas.'),(515,'Deimena',' Deimena yra Moteriškas vardas.','Trumpa reikšmė: dei- (deivė) + -en-, iš upėvardžio Deimena (Rytprūsiuose).','Vardo reikšmė: Deimena – (3b) liet., trump. Deimė, iš upėvardžio Deimena (buv. Rytprūsiuose).',' Deimena yra lietuvių kilmės vardas.'),(516,'Deimantas',' Deimantas yra Vyriškas vardas.','Trumpa reikšmė: 1. lietuvių: dei- (deivis, deivė) + mant- (mantus „sumanus“); 2. anglų: deimantas „brangus akmuo“.','Vardo reikšmė: Deimantas – (1) liet., trump. Deimas, Deimys, dei- (: liet. deivis, deivė) + mant- (žr. Darmantas).',' Deimantas yra lietuvių kilmės vardas.'),(517,'Deimantė',' Deimantė yra Moteriškas vardas.','Trumpa reikšmė: 1. lietuvių: dei- (deivis, deivė) + mant- (mantus „sumanus“); 2. anglų: deimantas „brangus akmuo“.','Vardo reikšmė: Deimantės – nedrausmingos, neretai gali pasielgti lengvabūdiškai dėl savo charakterio tokių savybių kaip: impulsyvumas, vėjavaikiškumas. Gyvenime linkusios eksperimentuoti todėl vienu gyvenimo partneriu neapsiriboja.',' Deimantė yra lietuvių kilmės vardas.'),(518,'Debora',' Debora yra Moteriškas vardas.','Trumpa reikšmė: „bitė“.','Vardo reikšmė: Debora – (2) hebr., baž. lot. Debora, kuris iš hebr. Debora – „bitė“.',' Debora yra hebrajų kilmės vardas.'),(519,'Domitas',' Domitas yra Vyriškas vardas.','Trumpa reikšmė: lot., trump. Domas, Domis, iš lot. Domitus: lot. domitus „sutramdytas“.','Vardo reikšmė: Domitas – (1) lot., trump. Domas, Domis, iš lot. Domitus: lot. domitus „sutramdytas“.',' Domitas yra lotynų kilmės vardas.'),(520,'Dominykas',' Dominykas yra Vyriškas vardas.','Trumpa reikšmė: „gimęs, -usi viešpaties dieną, t.y., sekmadienį“.','Vardo reikšmė: Dominykai turi retą šiais laikais savybę – auksines rankas. Tiktai tereikia užsiminti, kad nebėga vanduo iš čiaupo , ar tolete vanduo nenusileidžia jie kaip mat pulsis tvarkyti ir sutvarkys.',' Dominykas yra lotynų kilmės vardas.'),(521,'Dominyka',' Dominyka yra Moteriškas vardas.','Trumpa reikšmė: „gimęs, -usi viešpaties dieną, t.y., sekmadienį“.','Vardo reikšmė: Dominykos vardadienį globoja Neptūnas, kuris suteikia svajingumo, Neptūnas apgaubtas mistika, tai reiškia, kad Dominykos gali turėti ir atgamtiškų galių, gali matyti daugiau nei mato kiti. Įsiklausykite į jų sapnus.',' Dominyka yra lotynų kilmės vardas.'),(522,'Domilė',' Domilė yra Moteriškas vardas.','Trumpa reikšmė: do- (do-tas, do-vis „dovana“) + mil- (pa-milti) – „meilės dovana“.','Vardo reikšmė: Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas, tačiau dauguma Jūsų sugebate kažkokiu būdu disponuoti pakankamomis lėšomis ir problemų dėl išlaidumo nejaučiate, nes jums dažniausiai nuskyla būti santuokoje su pasiturinčias partneriais.',' Domilė yra lietuvių kilmės vardas.'),(523,'Domilas',' Domilas yra Vyriškas vardas.','Trumpa reikšmė: do- (do-tas, do-vis „dovana“) + mil- (pa-milti) – „meilės dovana“.','Vardo reikšmė: Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas, tačiau dauguma Jūsų sugebate kažkokiu būdu disponuoti pakankamomis lėšomis ir problemų dėl išlaidumo nejaučiate, nes jums dažniausiai nuskyla būti santuokoje su pasiturinčias partneriais.',' Domilas yra lietuvių kilmės vardas.'),(524,'Domicė',' Domicė yra Moteriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Domicėlė.','Vardo reikšmė: Jis suteikia Jums drąsos ir noro rizikuoti. Tampate ryžtingesnis ir tikslingesnis.Padidėja dėmesys visuomenės reikmėms, jaučiate poreikį pasitarnauti visuomenei. Šis vardas leidžia Jums geriau įvertinti žmonių charakterius.',' Domicė yra lietuvių kilmės vardas.'),(525,'Dovas',' Dovas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Dovydas: „mylimas“.','Vardo reikšmė: Dovydams reikėtų išmokti atleisti, vengti kvailų poelgių ir įpročių, tokių, kaip persivalgymo, įsitraukimo į girtuoklystę ar palaidą gyvenimą.',' Dovas yra hebrajų kilmės vardas.'),(526,'Domas',' Domas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Dominykas: „gimęs, -usi viešpaties dieną, t.y., sekmadienį“.','Vardo reikšmė: Dominykai mieliau dirba sau, nepaisant darbo pobūdžio (verslas ar intelektualus darbas). Jiems dažnokai gresia susirgti cukralige.',' Domas yra lotynų kilmės vardas.'),(527,'Domantė',' Domantė yra Moteriškas vardas.','Trumpa reikšmė: do- (dotas, dovis „davimas“) + mant- (mantus „sumanus“).','Vardo reikšmė: (1) liet., trump. Domė, iš vyr. v. Domantas',' Domantė yra lietuvių kilmės vardas.'),(528,'Dovaldė',' Dovaldė yra Moteriškas vardas.','Trumpa reikšmė: prūsų genties pavadinimas.','Vardo reikšmė: Vardadienis: Rugsėjo 7 d., spalio 16 d.',' Dovaldė yra lietuvių kilmės vardas.'),(529,'Dovaldas',' Dovaldas yra Vyriškas vardas.','Trumpa reikšmė: do- (dotas, dovis „davimas“) + vald- (valdyti).','Vardo reikšmė: Dovaldas – (1) liet., trump. Dovas, do- (žr. Domantas) + vald- (: liet. vald-yti).',' Dovaldas yra lietuvių kilmės vardas.'),(530,'Domantas',' Domantas yra Vyriškas vardas.','Trumpa reikšmė: do- (dotas, dovis „davimas“) + mant- (mantus „sumanus“).','Vardo reikšmė: Domantai dėl gerų savo savybių ir organizacinių sugebėjimų gana aukštai iškyla, įgyja turto ir garbės, teisingai ir tauriai naudojasi savo prakilnumu. Daug nuveikia įvairiose darbo ir mokslo srityse. Šeimoje laimingi, geri vyrai ir savo vaikų auklėtojai.',' Domantas yra lietuvių kilmės vardas.'),(531,'Dovainė',' Dovainė yra Moteriškas vardas.','Trumpa reikšmė: do- (dotas, dovis „davimas“) + vain- (baltų vaina „priežastis, kaltė“).','Vardo reikšmė: Šis vardas simbolizuoja norą imtis naujų idėjų ir jas įgyvendinti. Esate plačios atviros natūros, įžvalgūs, niekada neišgyvenate dėl niekniekių, imlus ir nepriklausomas, turite stiprią valią ir intuiciją. ',' Dovainė yra lietuvių kilmės vardas.'),(532,'Dovaidė',' Dovaidė yra Moteriškas vardas.','Trumpa reikšmė: do- (dotas, dovis „davimas“) + vaid- (vaidentis „rodytis“) – „besirodantis, besivaidenantis“.','Vardo reikšmė: Dovaidė – (1) liet., trump. Dovė, iš vyr. v. Dovaidas.',' Dovaidė yra lietuvių kilmės vardas.'),(533,'Doloresa',' Doloresa yra Moteriškas vardas.','Trumpa reikšmė: „sopulingoji, kenčiančioji“.','Vardo reikšmė: Jus ne taip paprasta pažeisti; labai pasitikite savimi. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs.',' Doloresa yra ispanų kilmės vardas.'),(534,'Dovaidas',' Dovaidas yra Vyriškas vardas.','Trumpa reikšmė: do- (dotas, dovis „davimas“) + vaid- (vaidentis „rodytis“) – „besirodantis, besivaidenantis“.','Vardo reikšmė: Dovaidas – (1) liet., trump. Dovas, do- (žr. Domantas) + vaid- (: liet. vaid-ytis, vaid-entis „rodytis“).',' Dovaidas yra lietuvių kilmės vardas.'),(535,'Dobilė',' Dobilė yra Moteriškas vardas.','Trumpa reikšmė: dobilas - laimės, sėkmės simbolis (keturlapis dobilas).','Vardo reikšmė: Dobilė – (1) liet., iš vyr. v. Dobilas.',' Dobilė yra lietuvių kilmės vardas.'),(536,'Dorotėjas',' Dorotėjas yra Vyriškas vardas.','Trumpa reikšmė: doron „dovana“ + teos „dievas“ – „dievo dovana“.','Vardo reikšmė: Tai – galingas vardas, suteikiantis Jums gero lyderio savybių. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Jis teikia Jums nepriklausomybės, individualumo, originalumo ir išradingumo.',' Dorotėjas yra graikų kilmės vardas.'),(537,'Dobilas',' Dobilas yra Vyriškas vardas.','Trumpa reikšmė: dobilas - laimės, sėkmės simbolis (keturlapis dobilas).','Vardo reikšmė: Dobilas – (3a) liet.: liet. dobilas.',' Dobilas yra lietuvių kilmės vardas.'),(538,'Doras',' Doras, Dorys yra Vyriškas vardas.','Trumpa reikšmė: prūsų genties pavadinimas.','Vardo reikšmė: (2), (4) liet. trumpinys iš Dorotėjas ir Teodoras',' Doras, Dorys yra prūsų kilmės vardas.'),(539,'Donatilė',' Donatilė yra Moteriškas vardas.','Trumpa reikšmė: donata „dovanota“ + -il- (mažybinė priesaga).','Vardo reikšmė: Donatilė – (2) lot., trump. Donata, Dona, iš lot. Donatilla, kuris yra priesagos -illa (mažyb.) vedinys iš Donata.',' Donatilė yra lotynų kilmės vardas.'),(540,'Donatas',' Donatas yra Vyriškas vardas.','Trumpa reikšmė: „dovanotas“.','Vardo reikšmė: Donatai tikrai geri psichologai, gydytojai, žiniuoniai. Bet jie geriau renkasi darbą, kuriame rezultatas apčiuopiamas , užtat retai jie tampa patarėjais , gydytojais, ar politikais. ',' Donatas yra lotynų kilmės vardas.'),(541,'Dromantas',' Dromantas yra Vyriškas vardas.','Trumpa reikšmė: dro- (drovus) + mant- (mantus „sumanus“).','Vardo reikšmė: Donata – (1) liet., trump. Dramas, dro- iš drov- (: liet. drov-us) + mant- (žr. Darmantas).',' Dromantas yra lietuvių kilmės vardas.'),(542,'Donata',' Donata yra Moteriškas vardas.','Trumpa reikšmė: „dovanota“.','Vardo reikšmė: Donatos tikrai geri psichologai, gydytojai, žiniuoniai. Bet jos geriau renkasi darbą, kuriame rezultatas apčiuopiamas , užtat retai jos tampa patarėjomis , gydytojomis, ar politikėmis. ',' Donata yra lotynų kilmės vardas.'),(543,'Donardas',' Donardas yra Vyriškas vardas.','Trumpa reikšmė: „dievo galybė“.','Vardo reikšmė: Donardas – (1) kelt., trump. Donas, Donis, iš sulotyninto pranc. Donardus, kuris iš keltų v. Duenerth — „dievo galybė“.',' Donardas yra keltų kilmės vardas.'),(544,'Dravys',' Dravys yra Vyriškas vardas.','Trumpa reikšmė: drūtas „stiprus, tvirtas“; plg. dravis „drevė“.','Vardo reikšmė: Šis vardas stiprina Jūsų lyderio, vedlio sugebėjimus. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas.Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Dravys yra lietuvių kilmės vardas.'),(545,'Donaldas',' Donaldas yra Vyriškas vardas.','Trumpa reikšmė: dubno „pasaulis“ + walos „galingas“ – „pasaulio galiūnas, -ė“.','Vardo reikšmė: Donaldai privalo kovoti su tokiomis silpnybėmis, kaip rūkymas, alkoholis ir narkotikai. Kitaip jie pražus. ',' Donaldas yra keltų kilmės vardas.'),(546,'Dravenis',' Dravenis yra Vyriškas vardas.','Trumpa reikšmė: drūtas „stiprus, tvirtas“ (kaip medis), plg. dravė „drevė“.','Vardo reikšmė: Dravenis – (2) liet. ir prūs., trump. Dravys, priesagos -enis vedinys iš sen. avd. Dravys.',' Dravenis yra lietuvių kilmės vardas.'),(547,'Dravenė',' Dravenė yra Moteriškas vardas.','Trumpa reikšmė: drūtas „stiprus, tvirtas“ (kaip medis), plg. dravė „drevė“.','Vardo reikšmė: Dravenė – (2) liet. ir prūs., trump. Dravė, iš vyr. v. Dravenis.',' Dravenė yra lietuvių kilmės vardas.'),(548,'Donalda',' Donalda yra Moteriškas vardas.','Trumpa reikšmė: dubno „pasaulis“ + walos „galingas“ – „pasaulio galiūnas, -ė“.','Vardo reikšmė: Donaldai privalo kovoti su tokiomis silpnybėmis, kaip rūkymas, alkoholis ir narkotikai. Kitaip jie pražus. ',' Donalda yra keltų kilmės vardas.'),(549,'Draudvilas',' Draudvilas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Draudys, draud-(: liet. draus-ti, draud-ė) + vil- (žr. Dargvilas).','Vardo reikšmė: Šis vardas stiprina Jūsų žinių troškimą. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis. Protas tampa analitiškesnis, sugebate giliau įsiskverbti į reiškinių esmę.',' Draudvilas yra lietuvių kilmės vardas.'),(550,'Draudvilė',' Draudvilė yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Draudė, iš vyr. v. Draudvilas.','Vardo reikšmė: Šis vardas stiprina Jūsų žinių troškimą. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis. Protas tampa analitiškesnis, sugebate giliau įsiskverbti į reiškinių esmę.',' Draudvilė yra lietuvių kilmės vardas.'),(551,'Drąsutis',' Drąsutis yra Vyriškas vardas.','Trumpa reikšmė: drąsus, drąsi.','Vardo reikšmė: (2) liet., trump. Drąsius, priesagos -utis vedinys iš avd. Drąsius',' Drąsutis yra lietuvių kilmės vardas.'),(552,'Drąsius',' Drąsius yra Vyriškas vardas.','Trumpa reikšmė: drąsus.','Vardo reikšmė: Drąsius – (2) liet.: liet. drąsus.',' Drąsius yra lietuvių kilmės vardas.'),(553,'Drąsutė',' Drąsutė yra Moteriškas vardas.','Trumpa reikšmė: drąsus, drąsi.','Vardo reikšmė: Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis ir panaudoti praktikoje. Protas tampa analitiškesnis, sugebate giliau įsiskverbti į reiškinių esmę. Atsiranda noras veikti ryžtingiau. ',' Drąsutė yra lietuvių kilmės vardas.'),(554,'Doviltas',' Doviltas yra Vyriškas vardas.','Trumpa reikšmė: do- (dotas, dovis „davimas“) + vilt- (viltis) – „duodantis viltį“.','Vardo reikšmė: Jus jau nebe taip lengva apkvailinti.Tos savybės rodo savo teisių žinojimą, nepajudinamą valios galią. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Doviltas yra lietuvių kilmės vardas.'),(555,'Dovilė',' Dovilė yra Moteriškas vardas.','Trumpa reikšmė: do- (dotas, dovis „davimas“) + vil- (viltis) – „duodanti viltį“.','Vardo reikšmė: Dovilės seksualios ir gražios. Gera su jomis bendrauti, kadangi jos moka išklausyti, nekenčia kai jas pertraukia pokalbio metu ir kitų nepertraukinėja. Tai vyrus žavi, jie Dovilėse mato kitokią moterį. Tačiau ištekėti tikrai neskuba, ilgai renkasi savo princą.',' Dovilė yra lietuvių kilmės vardas.'),(556,'Dovilas',' Dovilas yra Vyriškas vardas.','Trumpa reikšmė: do- (dotas, dovis „davimas“) + vil- (viltis) – „duodanti viltį“.','Vardo reikšmė: Jūsų vardas stiprina Jūsų jautrumą ir sugebėjimą rūpintis kitais žmonėmis. Jis padeda Jums lengviau bendrauti su kitais, panaudoti taktą ir diplomatiją. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Sustiprėją taikdario ir patarėjo sugebėjimai.',' Dovilas yra lietuvių kilmės vardas.'),(557,'Dovydas',' Dovydas yra Vyriškas vardas.','Trumpa reikšmė: „mylimas“.','Vardo reikšmė: Dovydai turi retą šiais laikais savybę – auksines rankas. Tiktai tereikia užsiminti, kad nebėga vanduo iš čiaupo, ar tualete vanduo nenusileidžia,- jie kaip mat puls tvarkyti ir, žinoma, sutvarkys.',' Dovydas yra hebrajų kilmės vardas.'),(558,'Dovė',' Dovė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Dovilė.','Vardo reikšmė: (1) liet., trumpinys iš mot. v. Dovaidė, Dovainė, Dovilė ir kt.',' Dovė yra lietuvių kilmės vardas.'),(559,'Džiugintas',' Džiugintas yra Vyriškas vardas.','Trumpa reikšmė: „džiugi, džiugus“.','Vardo reikšmė: Džiugintas – (1) liet., trump. Džiugas, Džiugys, džiu- iš džiug- (žr. Džiugailas) + gint- (žr Daugintas).',' Džiugintas yra lietuvių kilmės vardas.'),(560,'Džiugilė',' Džiugilė yra Moteriškas vardas.','Trumpa reikšmė: „džiugi, džiaugsminga“.','Vardo reikšmė: Džiugilė – (1), (2) liet., trump. Džiugė, iš vyr. v. Džiugilas.',' Džiugilė yra lietuvių kilmės vardas.'),(561,'Džiugenis',' Džiugenis yra Vyriškas vardas.','Trumpa reikšmė: „tas, kuris džiugus, -i“.','Vardo reikšmė: (2) liet., trump. Džiugas, Džiugys, priesagos -enis vedinys iš v. Džiugas',' Džiugenis yra lietuvių kilmės vardas.'),(562,'Džiugas',' Džiugas yra Vyriškas vardas.','Trumpa reikšmė: džiugus „linksmas“.','Vardo reikšmė: Vardadienis: Sausio 22 d., gegužės 8 d.',' Džiugas yra lietuvių kilmės vardas.'),(563,'Džiugenė',' Džiugenė yra Moteriškas vardas.','Trumpa reikšmė: „tas, kuris džiugus, -i“.','Vardo reikšmė: Jūs jaučiatės esąs principingesnis, doresnis ir ryžtingesnis. Ateityje įgysite daugiau organizacinių sugebėjimų.Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Esate plačios atviros natūros, įžvalgūs, niekada neišgyvenate dėl niekniekių. Dažniausiai Jūs intelektualinio darbo atstovai.',' Džiugenė yra lietuvių kilmės vardas.'),(564,'Džiugailė',' Džiugailė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Džiuga, Džiugė, iš vyr. avd. Džiugaila, žr. Džiugailas.','Vardo reikšmė: Džiugailė – (1) liet., trump. Džiuga, Džiugė, iš vyr. avd. Džiugaila, žr. Džiugailas.',' Džiugailė yra lietuvių kilmės vardas.'),(565,'Džiugailas',' Džiugailas yra Vyriškas vardas.','Trumpa reikšmė: 1) liet., sen. var. Džiugaila, trump. Džiugas, džiu- kilęs iš džiug- (: liet. nu-džiug-ti, džiug-us) + gail- (žr. Dargailas).','Vardo reikšmė: Džiugailas – (1) liet., sen. var. Džiugaila, trump. Džiugas, džiu- kilęs iš džiug- (: liet. nu-džiug-ti, džiug-us) + gail- (žr. Dargailas).',' Džiugailas yra lietuvių kilmės vardas.'),(566,'Dzidorius',' Dzidorius yra Vyriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Izidorius.','Vardo reikšmė: Dzidorius – (1) liet. trumpinys iš Izidorius.',' Dzidorius yra lietuvių kilmės vardas.'),(567,'Drovydas',' Drovydas yra Vyriškas vardas.','Trumpa reikšmė: dro- (drovus) + vyd- (iš-vydo).','Vardo reikšmė: Šio vardo savininkams patartina valdyti savo charakterį, užuot audringai prieštaravus – patylėti. Kadangi jie trokšta lyderiauti, reikėtų norus kontroliuoti. Taip pat reikėtų mokytis, kaip racionaliau tvarkyti savo pinigus.',' Drovydas yra lietuvių kilmės vardas.'),(568,'Dromantė',' Dromantė yra Moteriškas vardas.','Trumpa reikšmė: dro- (drovus) + mant- (mantus „sumanus“).','Vardo reikšmė: Dromantė – (1) liet., trump. Dromė, iš vyr. v. Dromantas.',' Dromantė yra lietuvių kilmės vardas.'),(569,'Eda',' Eda yra Moteriškas vardas.','Trumpa reikšmė: germ., trumpinys iš Edita.','Vardo reikšmė: Eda – (2) germ., trumpinys iš Edita.',' Eda yra germanų kilmės vardas.'),(570,'Egidė',' Egidė yra Moteriškas vardas.','Trumpa reikšmė: „skydo saugotojas“.','Vardo reikšmė: Egidė – (2) trump. Egė, Gidė, – liet. trumpinys iš Egidija.',' Egidė yra graikų kilmės vardas.'),(571,'Egidas',' Egidas yra Vyriškas vardas.','Trumpa reikšmė: „skydo saugotojas“.','Vardo reikšmė: Egidas – (2) trump. Egys, Egis, Gidas, Gidis, -liet. trumpinys iš Egidijus.',' Egidas yra graikų kilmės vardas.'),(572,'Egbertas',' Egbertas yra Vyriškas vardas.','Trumpa reikšmė: ecka „kardas“ + beraht „garsus, žymus“.','Vardo reikšmė: Jus visi labai gerbia, lengvai surandate kontaktus su bet kokiais žmonėmis.Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Plačiai žvelgiate į pasaulį ir matote daugiau nei kiti, neišskiriant tarptautinių ryšių ir didžių socialinių permainų.',' Egbertas yra vokiečių kilmės vardas.'),(573,'Edvinas',' Edvinas yra Vyriškas vardas.','Trumpa reikšmė: ead „turtas“ + wine „draugas“.','Vardo reikšmė: Edvinas – (1) angl., trump. Edvis, Edis, iš sulotyninto anglų Edvinus, Aeduinus, kuris iš sen. angl. Eadwine: sen. angl. ead „turtas“ + wine „draugas“.',' Edvinas yra anglų kilmės vardas.'),(574,'Edvina',' Edvina yra Moteriškas vardas.','Trumpa reikšmė: ead „turtas“ + wine „draugas“.','Vardo reikšmė: Edvina – (2), (1) angl., trump. Edvė, Eda, iš vyr. v. Edvinus, žr. Edvinas.',' Edvina yra anglų kilmės vardas.'),(575,'Eidė',' Eidė yra Moteriškas vardas.','Trumpa reikšmė: liet., trumpinys iš mot. v. su Ei-d-, Eid- : Eidgintė, Eidimtė, Eidminė ir kt.','Vardo reikšmė: Eidė – (2) liet., trumpinys iš mot. v. su Ei-d-, Eid- : Eidgintė, Eidimtė, Eidminė ir kt.',' Eidė yra lietuvių kilmės vardas.'),(576,'Edmundė',' Edmundė yra Moteriškas vardas.','Trumpa reikšmė: ead „turtas“ + munt „apsauga, gynėjas“.','Vardo reikšmė: Edmundė – (1) angl., trump. Edma, Edė, tarm. Edė, Edužė, Edušė vak. liet., iš vyr. v. Edmundus, žr. Edmundas.',' Edmundė yra anglų kilmės vardas.'),(577,'Edmundas',' Edmundas yra Vyriškas vardas.','Trumpa reikšmė: ead „turtas“ + munt „apsauga, gynėjas“.','Vardo reikšmė: Edmundai puikūs verslininkai, politikai, valtybinio darbo atstovai. Edmundams privalu vengti alkoholio ir narkotikų; tramdyti savo cholerišką charakterį.',' Edmundas yra anglų kilmės vardas.'),(578,'Edmas',' Edmas yra Vyriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Edmundas.','Vardo reikšmė: Edmas – (2) liet. trumpinys iš Edmundas.',' Edmas yra lietuvių kilmės vardas.'),(579,'Eidargė',' Eidargė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Eidė, iš vyr. v. Eidardas.','Vardo reikšmė: Eidargė – (1) liet., trump. Eidė, iš vyr. v. Eidardas.',' Eidargė yra lietuvių kilmės vardas.'),(580,'Eidargas',' Eidargas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Eidas, Eidys, ei-(žr. Eibaras) + darg- (: latv. dargs „brangus“).','Vardo reikšmė: Eidargas – (1) liet., trump. Eidas, Eidys, ei-(žr. Eibaras) + darg- (: latv. dargs „brangus“).',' Eidargas yra lietuvių kilmės vardas.'),(581,'Edma',' Edma yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Edmundė: ead „turtas“ + munt „apsauga, gynėjas“.','Vardo reikšmė: Edma – (2) liet. trumpinys iš Edmundė.',' Edma yra anglų kilmės vardas.'),(582,'Eibutė',' Eibutė yra Moteriškas vardas.','Trumpa reikšmė: liet. ir prūs., trump. Eibė, iš vyr. v. Eibutas.','Vardo reikšmė: Eibutė – (1) liet. ir prūs., trump. Eibė, iš vyr. v. Eibutas.',' Eibutė yra prūsų kilmės vardas.'),(583,'Edita',' Edita yra Moteriškas vardas.','Trumpa reikšmė: ead „turtas“ +gyth „kova.','Vardo reikšmė: Editų karjera – biznio sritys, jos puikiai žino koks turi būti vadovas.',' Edita yra anglų kilmės vardas.'),(584,'Eibutas',' Eibutas yra Vyriškas vardas.','Trumpa reikšmė: liet. ir prūs., trump. Eibas, Eibis, ei- (žr. Eibaras) + būt- (: liet. but-as, būti).','Vardo reikšmė: Eibutas – (1) liet. ir prūs., trump. Eibas, Eibis, ei- (žr. Eibaras) + būt- (: liet. but-as, būti).',' Eibutas yra prūsų kilmės vardas.'),(585,'Eidotas',' Eidotas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Eidas, Eidys, priesagos -otas vedinys iš sen. trump. Eidas, kuris iš avd. su Eid-: Eidgintas, Eidminas, Eidvydas ir kt.','Vardo reikšmė: Eidotas – (1) liet., trump. Eidas, Eidys, priesagos -otas vedinys iš sen. trump. Eidas, kuris iš avd. su Eid-: Eidgintas, Eidminas, Eidvydas ir kt.',' Eidotas yra lietuvių kilmės vardas.'),(586,'Eibartė',' Eibartė yra Moteriškas vardas.','Trumpa reikšmė: ei- (eiti) + bart- (barti senovine reikšme „kovoti“, plg rusų borotsia).','Vardo reikšmė: Eibartė – (1) liet., trump. Eibė, iš vyr. v. Eibartas.',' Eibartė yra lietuvių kilmės vardas.'),(587,'Eidminas',' Eidminas yra Vyriškas vardas.','Trumpa reikšmė: ei- (eiti) + mint- (mini, minėtas).','Vardo reikšmė: Eidminas – (1) liet., trump. Eidas, Eidys, eid-(žr. Eidgintas) + min- (: liet. min-ėti).',' Eidminas yra lietuvių kilmės vardas.'),(588,'Eibartas',' Eibartas yra Vyriškas vardas.','Trumpa reikšmė: ei- (eiti) + bart- (barti senovine reikšme „kovoti“, plg rusų borotsia).','Vardo reikšmė: Eibartas – (1) liet., trump. Eibas, Eibis, ei- (žr. Eibaras) + bart- (: liet. barti – sen. reikšme „kovoti“, plg. rus. bor-otjsia „kovoti).',' Eibartas yra lietuvių kilmės vardas.'),(589,'Edgaras',' Edgaras yra Vyriškas vardas.','Trumpa reikšmė: ead „turtas“ + gar „ietis“.','Vardo reikšmė: Edgarai gyvenime pasiekia labai daug. Jie reikalauja absoliučios asmeninės laisvės ir nepakenčia kitų kišimosi į jų reikalus.',' Edgaras yra anglų kilmės vardas.'),(590,'Eidmantė',' Eidmantė yra Moteriškas vardas.','Trumpa reikšmė: id- (eidlus „eiklus“) + mant- (mantus „sumanus“).','Vardo reikšmė: Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas, tačiau dauguma Jūsų sugebate kažkokiu būdu disponuoti pakankamomis lėšomis ir problemų dėl išlaidumo nejaučiate, nes jums dažniausiai nuskyla būti santuokoje su pasiturinčias partneriais.',' Eidmantė yra lietuvių kilmės vardas.'),(591,'Eibaras',' Eibaras yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Eibas, Eibis: ei- (: liet. ei-ti) + bar- (: liet. bar-ti — sen. reikšme „kovoti“, plg. rus. bor-otjsia „kovoti“).','Vardo reikšmė: Jis suteikia Jums drąsos ir noro rizikuoti. Tampate ryžtingesnis ir tikslingesnis.Padidėja dėmesys visuomenės reikmėms, jaučiate poreikį pasitarnauti visuomenei. Šis vardas leidžia Jums geriau įvertinti žmonių charakterius.',' Eibaras yra lietuvių kilmės vardas.'),(592,'Eidmantas',' Eidmantas yra Vyriškas vardas.','Trumpa reikšmė: id- (eidlus „eiklus“) + mant- (mantus „sumanus“).','Vardo reikšmė: Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas, tačiau dauguma Jūsų sugebate kažkokiu būdu disponuoti pakankamomis lėšomis ir problemų dėl išlaidumo nejaučiate, nes jums dažniausiai nuskyla būti santuokoje su pasiturinčias partneriais.',' Eidmantas yra lietuvių kilmės vardas.'),(593,'Egmontas',' Egmontas yra Vyriškas vardas.','Trumpa reikšmė: ecka „kardas“ + munt „apsauga, gynėjas“.','Vardo reikšmė: Egmontas – (1) germ., trump. Egis, iš germ. Egmont, kuris iš sen. germ. Egmunt: sen. vok. aukšt. ecka „kardas“ + munt „apsauga, gynėjas“.',' Egmontas yra vokiečių kilmės vardas.'),(594,'Eglė',' Eglė yra Moteriškas vardas.','Trumpa reikšmė: lietuvių eglė, lietuvių pasakos „Eglė žalčių karalienė“ veikėjos vardas.','Vardo reikšmė: Eglės žino kaip vyrą gerbti, užtat puikios šeimos moterys. Gimus vaikui jos pasišvenčia savo šeimai.',' Eglė yra lietuvių kilmės vardas.'),(595,'Eidintė',' Eidintė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Eidė, iš vyr. v. Eidintas.','Vardo reikšmė: Eidintė – (1) liet., trump. Eidė, iš vyr. v. Eidintas.',' Eidintė yra lietuvių kilmės vardas.'),(596,'Egilas',' Egilas yra Vyriškas vardas.','Trumpa reikšmė: agil „skydas“.','Vardo reikšmė: Egilas – (1), (2) germ., trump. Egys, Egis, Gilas, iš germ. trumpinio, kuris iš germ. v. Agilbert: sen. vok. aukšt. agil „skydas“ + beraht „garsus, žymus“',' Egilas yra vokiečių kilmės vardas.'),(597,'Eidintas',' Eidintas yra Vyriškas vardas.','Trumpa reikšmė: trump. Eidas, Eidys, priesagos -intas vedinys iš sen. trump. Eidas, kuris iš v. su Ei-d-, Eid-: Eidgintas, Eidimtas, Eidminas ir kt.','Vardo reikšmė: Eidintas – (1) liet., trump. Eidas, Eidys, priesagos -intas vedinys iš sen. trump. Eidas, kuris iš v. su Ei-d-, Eid-: Eidgintas, Eidimtas, Eidminas ir kt.',' Eidintas yra lietuvių kilmės vardas.'),(598,'Egidijus',' Egidijus yra Vyriškas vardas.','Trumpa reikšmė: „skydo saugotojas“.','Vardo reikšmė: Egidijai dėl savo neryžtingumo dažnai skursta. Jie domisi daug kuo, griebiasi šio bei to, bet pradėto darbo nemoka užbaigti. Kol sugalvoja naują, liūdi ir nieko neveikia.',' Egidijus yra graikų kilmės vardas.'),(599,'Eidinas',' Eidinas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Eidas, Eidys, priesagos -inas vedinys iš sen. trump. Eidas, kuris iš v. su Ei-d-, Eid-: Eidgintas, Eidimtas, Eidminas ir kt.','Vardo reikšmė: Jūs labai pasitikite savimi, ne taip paprasta pažeisti. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs. ',' Eidinas yra lietuvių kilmės vardas.'),(600,'Egidija',' Egidija yra Moteriškas vardas.','Trumpa reikšmė: „skydo saugotojas“.','Vardo reikšmė: Egidijos dėl savo neryžtingumo dažnai skursta. Jie domisi daug kuo, griebiasi šio bei to, bet pradėto darbo nemoka užbaigti. Kol sugalvoja naują, liūdi ir nieko neveikia.',' Egidija yra graikų kilmės vardas.'),(601,'Eidinė',' Eidinė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Eidė, iš vyr. v. Eidinas.','Vardo reikšmė: Jūs labai pasitikite savimi, ne taip paprasta pažeisti. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs.',' Eidinė yra lietuvių kilmės vardas.'),(602,'Eidimtė',' Eidimtė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Eidė, iš vyr. v. Eidimtas.','Vardo reikšmė: Šio vardo savininkai sugeba ilgam laikui prie ko nors prisirišti, tačiau jų partneriai dažnai pavargsta nuo emocinio jų nestabilumo. Šių žmonių stiprus energetinis laukas, jūs norite vadžias imti į savo rankas. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas.',' Eidimtė yra lietuvių kilmės vardas.'),(603,'Eidimtas',' Eidimtas yra Vyriškas vardas.','Trumpa reikšmė: ei- (eiti) + imt- (imtas, imti) – „pasiimtas kartu eiti“.','Vardo reikšmė: Šio vardo savininkai sugeba ilgam laikui prie ko nors prisirišti, tačiau jų partneriai dažnai pavargsta nuo emocinio jų nestabilumo. Šių žmonių stiprus energetinis laukas, jūs norite vadžias imti į savo rankas. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas.',' Eidimtas yra lietuvių kilmės vardas.'),(604,'Eidgintas',' Eidgintas yra Vyriškas vardas.','Trumpa reikšmė: ginti „užstoti“.','Vardo reikšmė: Tai – galingas vardas, suteikiantis Jums gero lyderio, vadovo savybių. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Jis teikia Jums nepriklausomybės, individualumo, originalumo ir išradingumo. ',' Eidgintas yra lietuvių kilmės vardas.'),(605,'Eigantas',' Eigantas yra Vyriškas vardas.','Trumpa reikšmė: ginti, gan-yti „saugoti.','Vardo reikšmė: Eigantas – (1) liet., trump. Eigas, Eigys, Eigis, ei- (žr. Eibaras) + gant- (: liet. ginti, gan-yti „saugoti“).',' Eigantas yra lietuvių kilmės vardas.'),(606,'Eidenis',' Eidenis yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Eidas, Eidys.','Vardo reikšmė: Eidenis – (2) liet., trump. Eidas, Eidys, priesagos -enis vedinys iš sen. trump. Eidas, kuris iš avd. su Ei-d-, Eid-: Eidgintas, Eidimtas, Eidminas ir kt.',' Eidenis yra lietuvių kilmės vardas.'),(607,'Eigailė',' Eigailė yra Moteriškas vardas.','Trumpa reikšmė: vyr. avd. Eigaila, žr. Eigailas.','Vardo reikšmė: Šio vardo savininkai linkę savyje ieškoti daugiau artistiškų, muzikinių sugebėjimų. Šis vardas praplečia Jūsų akiratį. ',' Eigailė yra prūsų kilmės vardas.'),(608,'Eigailas',' Eigailas yra vyriškas vardas.','Trumpa reikšmė: „stiprus“.','Vardo reikšmė: Šio vardo savininkai linkę savyje ieškoti daugiau artistiškų, muzikinių sugebėjimų. Šis vardas praplečia Jūsų akiratį. ',' Eigailas yra prūsų kilmės vardas.'),(609,'Eidenė',' Eidenė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Eidė, iš vyr. v. Eidenis.','Vardo reikšmė: Eidenė – (2) liet., trump. Eidė, iš vyr. v. Eidenis.',' Eidenė yra lietuvių kilmės vardas.'),(610,'Eidvinas',' Eidvinas yra Vyriškas vardas.','Trumpa reikšmė: „kaltė, priežastis“.','Vardo reikšmė: Norėtumėte dalyvauti politiniuose judėjimuose, Jus traukia psichologija ir spiritizmo praktika. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Eidvinas yra lietuvių kilmės vardas.'),(611,'Eidvilė',' Eidvilė yra Moteriškas vardas.','Trumpa reikšmė: eid- (eidlus „eiklus“) + vil- (viltis).','Vardo reikšmė: Šis vardas stiprina Jūsų lyderio, vadovo sugebėjimus. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Eidvilė yra lietuvių kilmės vardas.'),(612,'Eidvilas',' Eidvilas yra Vyriškas vardas.','Trumpa reikšmė: eid- (eidlus „eiklus“) + vil- (viltis).','Vardo reikšmė: Tai – galingas vardas, suteikiantis Jums gero lyderio, vadovo savybių. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Jis teikia Jums nepriklausomybės, individualumo, originalumo ir išradingumo. ',' Eidvilas yra lietuvių kilmės vardas.'),(613,'Eidvydas',' Eidvydas yra Vyriškas vardas.','Trumpa reikšmė: trump. Eidvys, Eidvis.','Vardo reikšmė: Eidvydas – (1) liet., trump. Eidvys, Eidvis, eid- (žr. Eidgintas) + vyd- (: liet. iš-vys-ti, iš-vyd-o).',' Eidvydas yra lietuvių kilmės vardas.'),(614,'Eiginas',' Eiginas yra vyriškas vardas.','Trumpa reikšmė: „užstoti“.','Vardo reikšmė: Eiginas – (1) liet., trump. Eigas, Eigys, Eigis, ei- (žr. Eibaras) + gin- (: liet. gin-ti „užstoti“).',' Eiginas yra lietuvių kilmės vardas.'),(615,'Eidvainė',' Eidvainė yra Moteriškas vardas.','Trumpa reikšmė: trump. Eidvė, iš vyr. v. Eidvainas.','Vardo reikšmė: Šio vardo savininkai linkę savyje ieškoti daugiau artistiškų, muzikinių sugebėjimų. Šis vardas praplečia Jūsų akiratį.',' Eidvainė yra lietuvių kilmės vardas.'),(616,'Eidvainas',' Eidvainas yra Vyriškas vardas.','Trumpa reikšmė: „kaltė, priežastis“.','Vardo reikšmė: Šio vardo savininkai linkę savyje ieškoti daugiau artistiškų, muzikinių sugebėjimų. Šis vardas praplečia Jūsų akiratį.',' Eidvainas yra lietuvių kilmės vardas.'),(617,'Eigilė',' Eigilė yra Moteriškas vardas.','Trumpa reikšmė: ei- (eiti) + gil- (dilgyti širdį).','Vardo reikšmė: Norėtumėte dalyvauti politiniuose judėjimuose, Jus traukia psichologija ir spiritizmo praktika. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Eigilė yra lietuvių kilmės vardas.'),(618,'Eigilas',' Eigilas yra Vyriškas vardas.','Trumpa reikšmė: ei- (eiti) + gil- (dilgyti širdį).','Vardo reikšmė: Norėtumėte dalyvauti politiniuose judėjimuose, Jus traukia psichologija ir spiritizmo praktika. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Eigilas yra lietuvių kilmės vardas.'),(619,'Eidravė',' Eidravė yra Moteriškas vardas.','Trumpa reikšmė: Eidrė, iš vyr. v. Eidravas.','Vardo reikšmė: Šis vardas stiprina Jūsų lyderio, vadovo sugebėjimus. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Eidravė yra prūsų kilmės vardas.'),(620,'Eidravas',' Eidravas yra Vyriškas vardas.','Trumpa reikšmė: liet. drūtas „stiprus, tvirtas (kaip medis).','Vardo reikšmė: Šis vardas stiprina Jūsų lyderio, vadovo sugebėjimus. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Eidravas yra prūsų kilmės vardas.'),(621,'Eigydė',' Eigydė yra Moteriškas vardas.','Trumpa reikšmė: trump. Eigė, iš vyr. v. Eigydas.','Vardo reikšmė: Eigydė – (1) liet., trump. Eigė, iš vyr. v. Eigydas.',' Eigydė yra lietuvių kilmės vardas.'),(622,'Eigydas',' Eigydas yra Vyriškas vardas.','Trumpa reikšmė: „gauti, pasiekti“.','Vardo reikšmė: Eigydas – (1) liet., trump. Eigas, Eigys, Eigis, ei- (žr. Eibaras) + gyd- (: prus. sen. gydaut „gauti, pasiekti“, liet. geis-ti, geid-ė).',' Eigydas yra lietuvių kilmės vardas.'),(623,'Eigenis',' Eigenis yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Eigas, Eigys, Eigis, priesagos -enis vedinys iš sen. trump. Eigas, kuris iš avd. su Ei-g-, Eig-: Eigailas, Eigilas, Eiginas ir kt.','Vardo reikšmė: Šis vardas stiprina Jūsų žinių siekimą. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis. Protas tampa analitiškesnis, sugebate giliau įsiskverbti į reiškinių esmę.',' Eigenis yra lietuvių kilmės vardas.'),(624,'Eidotė',' Eidotė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Eidė, iš vyr. v. Eidotas.','Vardo reikšmė: Šio vardo savininkai itin reiklūs sau pačiam ir kitiems. Nesprendžiate apie įvykius iš pirmo žvilgsnio. Jums prireiks daugiau laiko tobulėjimui. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. ',' Eidotė yra lietuvių kilmės vardas.'),(625,'Eigenė',' Eigenė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Eigė, iš vyr. v. Eigenis.','Vardo reikšmė: Šis vardas stiprina Jūsų žinių siekimą. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis. Protas tampa analitiškesnis, sugebate giliau įsiskverbti į reiškinių esmę.',' Eigenė yra lietuvių kilmės vardas.'),(626,'Eigėlas',' Eigėlas yra Vyriškas vardas.','Trumpa reikšmė: „didelis skausmas“.','Vardo reikšmė: Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis ir panaudoti praktikoje. Protas tampa analitiškesnis, sugebate giliau įsiskverbti į reiškinių esmę.',' Eigėlas yra prūsų kilmės vardas.'),(627,'Eigėlė',' Eigėlė yra Moteriškas vardas.','Trumpa reikšmė: liet. ir prūs., trump. Eigė, iš vyr. v. Eigėlas.','Vardo reikšmė: Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis ir panaudoti praktikoje. Protas tampa analitiškesnis, sugebate giliau įsiskverbti į reiškinių esmę.',' Eigėlė yra prūsų kilmės vardas.'),(628,'Eigedas',' Eigedas yra Vyriškas vardas.','Trumpa reikšmė: „ilgėtis“.','Vardo reikšmė: Jus jau nebe taip lengva apkvailinti.Tos savybės rodo savo teisių žinojimą, nepajudinamą valios galią. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. ',' Eigedas yra lietuvių kilmės vardas.'),(629,'Eigė',' Eigė yra Moteriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Jūsų vardas stiprina Jūsų jautrumą ir sugebėjimą rūpintis kitais žmonėmis. Jis padeda Jums lengviau bendrauti su kitais, panaudoti taktą ir diplomatiją. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Sustiprėją taikdario ir patarėjo sugebėjimai. ',' Eigė yra lietuvių kilmės vardas.'),(630,'Eigaudas',' Eigaudas yra Vyriškas vardas.','Trumpa reikšmė: Gauti.','Vardo reikšmė: Eigaudas – (1) liet., trump. Eigas, Eigys, Eigis, ei- (žr. Eibaras) + gaud- (: liet. gdud-yti, plg. gauti).',' Eigaudas yra lietuvių kilmės vardas.'),(631,'Everardas',' Everardas yra Vyriškas vardas.','Trumpa reikšmė: eber „šernas“ + hart „stiprus“.','Vardo reikšmė: Šio vardo savininkas yra labai draugiškas, ir rūpestingas. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai ir populiarumas. Jūsų sąmoningumo lygis kyla, o taip pat ilgesnį laiką sugebate atkakliau dirbti. Šis vardas Jums leidžia tapti visuomenės ramsčiu. ',' Everardas yra vokiečių kilmės vardas.'),(632,'Evelina',' Evelina yra Moteriškas vardas.','Trumpa reikšmė: „riešutas“.','Vardo reikšmė: Vardadienis: Gegužės 25 d., vasario 11 d., lapkričio 10 d. – Evelinos vardo diena.',' Evelina yra keltų kilmės vardas.'),(633,'Evaldas',' Evaldas yra Vyriškas vardas.','Trumpa reikšmė: ewa „teisė, įstatymas“ + baldan „valdyti“.','Vardo reikšmė: Evaldų pasirinktas kelias daugiausia būna susijęs su informatika ir žiniasklaida, mokslo duomenų apdorojimu arba kelionėmis. Gana dažnai tokie žmonės tampa sportininkais.',' Evaldas yra vokiečių kilmės vardas.'),(634,'Evalda',' Evalda yra Moteriškas vardas.','Trumpa reikšmė: ewa „teisė, įstatymas“ + baldan „valdyti“.','Vardo reikšmė: Evaldų pasirinktas kelias daugiausia būna susijęs su informatika ir žiniasklaida, mokslo duomenų apdorojimu arba kelionėmis. Gana dažnai tokie žmonės tampa sportininkais.',' Evalda yra vokiečių kilmės vardas.'),(635,'Euzebijus',' Euzebijus yra Vyriškas vardas.','Trumpa reikšmė: „pamaldus“.','Vardo reikšmė: Jūs jaučiatės esąs principingesnis, doresnis ir ryžtingesnis. Ateityje įgysite daugiau organizacinių sugebėjimų.Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Esate plačios atviros natūros, įžvalgūs, niekada neišgyvenate dėl niekniekių.',' Euzebijus yra graikų kilmės vardas.'),(636,'Euzebija',' Euzebija yra Moteriškas vardas.','Trumpa reikšmė: „pamaldus“.','Vardo reikšmė: Jūs jaučiatės esąs principingesnis, doresnis ir ryžtingesnis. Ateityje įgysite daugiau organizacinių sugebėjimų.Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Esate plačios atviros natūros, įžvalgūs, niekada neišgyvenate dėl niekniekių.',' Euzebija yra graikų kilmės vardas.'),(637,'Euzebas',' Euzebas yra Vyriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Euzebijus.','Vardo reikšmė: Šių vardų savininkų sėkmė – būti kolektyve tarp žmonių, todėl tikriausiai jie labai gerai jaučiasi savo šeimoje.Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jus traukia svaiginantys meilės nuotykiai ir pasirengimas bet kurią minutę pasinerti į eilinę avantiūrą. ',' Euzebas yra lietuvių kilmės vardas.'),(638,'Eutalija',' Eutalija yra Moteriškas vardas.','Trumpa reikšmė: „žydinti“.','Vardo reikšmė: Eutalija – (1) graik., trump. Eutalė, Talė, iš sulotyninto graik. Euthalia: graik. euthales „žydinti“.',' Eutalija yra lotynų kilmės vardas.'),(639,'Eutalė',' Eutalė yra Moteriškas vardas.','Trumpa reikšmė: „žydinti“.','Vardo reikšmė: Eutalė – (2) trump. Talė, — liet. trumpinys iš Eutalija.',' Eutalė yra lotynų kilmės vardas.'),(640,'Eustachijus',' Eustachijus yra Vyriškas vardas.','Trumpa reikšmė: „derlingas, gausus varpų“.','Vardo reikšmė: Šio vardo savininkams patartina valdyti savo charakterį, užuot audringai prieštaravus – patylėti. Kadangi jie trokšta lyderiauti, reikėtų norus kontroliuoti. Taip pat reikėtų mokytis, kaip racionaliau tvarkyti savo pinigus. ',' Eustachijus yra graikų kilmės vardas.'),(641,'Eigirdas',' Eigirdas yra Vyriškas vardas.','Trumpa reikšmė: ei- (eiti) + gird- (girdėti, girdas „žinia“).','Vardo reikšmė: Eigirdas – (1) liet., trump. Eigas, Eigys, Eigis, ei- (žr. Eibaras) + gird- (: liet. gird-ėti, gird-as „žinia“).',' Eigirdas yra lietuvių kilmės vardas.'),(642,'Eigintas',' Eigintas yra Vyriškas vardas.','Trumpa reikšmė: ei- (eiti) + gint- (ginti „užstoti, saugoti“).','Vardo reikšmė: (1) liet., trump. Eigas, Eigys, Eigis, ei- (žr. Eibaras) + gint- (: liet. ginti „užstoti“, gin-tas)',' Eigintas yra lietuvių kilmės vardas.'),(643,'Fulgis',' Fulgis yra Vyriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Fulgentas.','Vardo reikšmė: Jūs puikiai žinote savo teises, nepajudinamą valios jėgą. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Jūs jaučiatės esąs principingesnis, doresnis ir ryžtingesnis. Ateityje įgysite daugiau organizacinių sugebėjimų. ',' Fulgis yra lietuvių kilmės vardas.'),(644,'Fridas',' Fridas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Fridrikas.','Vardo reikšmė: Jus visi labai gerbia, lengvai surandate kontaktus su bet kokiais žmonėmis.Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Plačiai žvelgiate į pasaulį ir matote daugiau nei kiti, neišskiriant tarptautinių ryšių ir didžių socialinių permainų.',' Fridas yra vokiečių kilmės vardas.'),(645,'Fredas',' Fredas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Alfredas: alf „elfas“ (mitinė būtybė) + rad „patarimas“.','Vardo reikšmė: Fredas – (2) trumpinys iš Alfredas ir kt.',' Fredas yra vokiečių kilmės vardas.'),(646,'Frida',' Frida yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Fridrikas.','Vardo reikšmė: Jus visi labai gerbia, lengvai surandate kontaktus su bet kokiais žmonėmis.Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Plačiai žvelgiate į pasaulį ir matote daugiau nei kiti, neišskiriant tarptautinių ryšių ir didžių socialinių permainų.',' Frida yra vokiečių kilmės vardas.'),(647,'Fortūnatas',' Fortūnatas yra Vyriškas vardas.','Trumpa reikšmė: Fortunatus „laiminga, -as“.','Vardo reikšmė: Vardadienis: Vasario 27 d., gruodžio 24 d.',' Fortūnatas yra lotynų kilmės vardas.'),(648,'Fortūnata',' Fortūnata yra Moteriškas vardas.','Trumpa reikšmė: Fortunatus „laiminga, -as“.','Vardo reikšmė: Fortūnata – (2) lot., trump. Fortunė, Nata, iš lot. Fortūnata, kuris iš vyr. v. Fortunatus, žr. Fortūnatas.',' Fortūnata yra lotynų kilmės vardas.'),(649,'Florijonas',' Florijonas yra Vyriškas vardas.','Trumpa reikšmė: florus „žydintis“.','Vardo reikšmė: Kadangi Florijonai labai intelektualūs, todėl pasirenka rašytojo, dailininko, muzikanto, teatro kritiko profesijas. Ir dar, jie gali būti nuostabūs maisto gamintojai – virėjai.',' Florijonas yra lotynų kilmės vardas.'),(650,'Fabijus',' Fabijus yra Vyriškas vardas.','Trumpa reikšmė: „auginantis pupas“.','Vardo reikšmė: (1) lot., trump. Fabas, iš lot. Fabius, kuris iš romėnų sen. giminės vardo Fabius -„auginantis pupas“ : lot. faba „pupa“',' Fabijus yra lotynų kilmės vardas.'),(651,'Fausta',' Fausta yra Moteriškas vardas.','Trumpa reikšmė: faustus „laimingas“.','Vardo reikšmė: Faustos taupios, bet joms pinigai nėra taip aktualu kaip dvasiniai turtai. Faustos labai religingos, tikinčios karma.',' Fausta yra lotynų kilmės vardas.'),(652,'Fabijonas',' Fabijonas yra Vyriškas vardas.','Trumpa reikšmė: faba „pupa“ – „auginantis pupas“.','Vardo reikšmė: Fabijonai myli gyvūnus, užtat puikiai jaučiasi gamtoje , net vabalas ant medžio šakos jiems suteikia malonumo. Šeimoje jie ramūs, tiki kad moteris šeimos židinys.',' Fabijonas yra lotynų kilmės vardas.'),(653,'Fabija',' Fabija yra Moteriškas vardas.','Trumpa reikšmė: „auginantis pupas“.','Vardo reikšmė: Fabijos rekomenduotina kaip amuletą nešioti mėlyną safyrą ant nuogo kūno, pakeičiant jį juodu perlu',' Fabija yra lotynų kilmės vardas.'),(654,'Gabrielius',' Gabrielius yra Vyriškas vardas.','Trumpa reikšmė: „dievo karys, dievas mano stiprybė“.','Vardo reikšmė: (2) hebr., trump. Gabras, Gabrys, Gabrius, tarm. Garbrelis, Gabrus piet.aukšt. (dz.), Gabris žem., baž. lot. Gabriel, kuris iš hebr. Gabhri’el — „dievo karys, dievas mano stiprybė“',' Gabrielius yra hebrajų kilmės vardas.'),(655,'Gabrė',' Gabrė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Gabrielius, Gabrielė: „dievo karys, dievas mano stiprybė“.','Vardo reikšmė: (2) liet. trumpinys iš Gabrielė',' Gabrė yra hebrajų kilmės vardas.'),(656,'Gabrielė',' Gabrielė yra Moteriškas vardas.','Trumpa reikšmė: „dievo karys, dievas mano stiprybė“.','Vardo reikšmė: (2) hebr., trump. Gabrė, tarm. Gabrilia, Gabrinia piet. aukšt. (dz.), baž. lot. Gabriela, kuris iš vyr. v. Gabhriel, žr. Gabrielius',' Gabrielė yra hebrajų kilmės vardas.'),(657,'Gabija',' Gabija yra Moteriškas vardas.','Trumpa reikšmė: gab- (gobti „gaubti, glausti, guosti“) +-ij-, lietuvių pagonių ugnies deivės vardas Gabija.','Vardo reikšmė: (4) liet., trump. Gabė, iš liet. mitologinės būtybės vardo Gabija — židinio ugnies dievaitė: liet. gab- (:liet. gab-ia-gobia, gobti „gaubti, dengti, glausti, guosti“) + priesaga -ija',' Gabija yra lietuvių kilmės vardas.'),(658,'Emilė',' Emilė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Emilijus, Emilija.','Vardo reikšmė: (2) liet. trumpinys iš Emilija, tarm. Amilė ryt. aukšt., Amilia piet. aukšt. (dz.), v. Emilė trumpinys — Milė',' Emilė yra lotynų kilmės vardas.'),(659,'Emilija',' Emilija yra Moteriškas vardas.','Trumpa reikšmė: „veržlus, nepralenkiamas“.','Vardo reikšmė: (1) lot., trump. Emilė, Milė, tarm. Amilė ryt. aukšt., Amilia piet. aukšt. (dz.), Mylė žem., iš lot. Aemilia, kuris iš vyr. v. Aemilius, žr. Emilijus',' Emilija yra lotynų kilmės vardas.'),(660,'Emilas',' Emilas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Emilijus, Emilija.','Vardo reikšmė: Emilas – (2) liet. trumpinys iš Emilijonas.',' Emilas yra lotynų kilmės vardas.'),(661,'Emerita',' Emerita yra Moteriškas vardas.','Trumpa reikšmė: „nusipelniusi“.','Vardo reikšmė: Emerita – (2) lot., trump. Emera, Ema, iš lot. Emerita: lot. emerita „nusipelniusi“.',' Emerita yra lotynų kilmės vardas.'),(662,'Emerikas',' Emerikas yra Vyriškas vardas.','Trumpa reikšmė: amal „darbštus“ + richi „galingas“.','Vardo reikšmė: Jūs labai pasitikite savimi, ne taip paprasta pažeisti. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs. ',' Emerikas yra vokiečių kilmės vardas.'),(663,'Ema',' Ema yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Emanuelė: „dievas su mumis“.','Vardo reikšmė: Šio vardo savininkė labai tvarkinga moteris. Su ja nesutarsite jeigu atidėliosite problemų sprendimą, pastoviai vėluosite ar bandysite jai vadovauti. Šios moters nesutiksite grūstyje, bet ji visada žinos karščiausias naujienas. Ema vertins ramybę, stabilumą ir sunkiai pakęs miesto triukšmą.',' Ema yra hebrajų kilmės vardas.'),(664,'Elzė',' Elzė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Elzbieta: „prisiekiu dievu“.','Vardo reikšmė: Elzių loginis mąstymas – gyvenimo dovana. Jos gali tapti puikiomis psichologėmis , medikėmis.',' Elzė yra hebrajų kilmės vardas.'),(665,'Elžbieta',' Elžbieta yra Moteriškas vardas.','Trumpa reikšmė: „prisiekiu dievu“.','Vardo reikšmė: Elžbietų draugai dažniausiai biznieriai, rašytojai, literatai, žiniasklaidos darbuotojai. Savo kelią atranda švietimo sistemoje, finansinėje veikloje, prekybiniame biznyje, konsultacijų kontorose, labdaros veikloje. Turi nuostabių sugebėjimų. Puikios oratorės. Domisi metafizika.',' Elžbieta yra hebrajų kilmės vardas.'),(666,'Elvyras',' Elvyras yra Vyriškas vardas.','Trumpa reikšmė: „aukštoji, kilnioji“.','Vardo reikšmė: Elvyras – (2) isp., trump. Elvas, Elvys, iš mot. v. Elvyra.',' Elvyras yra ispanų kilmės vardas.'),(667,'Elvinas',' Elvinas yra Vyriškas vardas.','Trumpa reikšmė: adal „kilmingas“ + wini „draugas“.','Vardo reikšmė: (1) germ., trump. Elvas, Elvys, iš anglosaksų Elwin (vok. Alwin), kuris iš germ. Adalwin: sen. vok. aukšt. adal „kilmingas, kilnus“ + wini „draugas“',' Elvinas yra vokiečių kilmės vardas.'),(668,'Elvyra',' Elvyra yra Moteriškas vardas.','Trumpa reikšmė: „aukštoji, kilnioji“.','Vardo reikšmė: Elvyros gali tapti kuo panorėjusios, bet turi rinktis darbą su žmonėmis. Gydytojos, advokatės, patarėjos, organizatorės. Darbas su žmonėmis – jų pašaukimas. Jos nepakeičiamos ten, kur reikalingas susitarimo menas.',' Elvyra yra ispanų kilmės vardas.'),(669,'Elvina',' Elvina yra Moteriškas vardas.','Trumpa reikšmė: adal „kilmingas“ + wini „draugas“.','Vardo reikšmė: Elvina – (2) germ., trump. Elė, Elva, iš vyr. v. Elwin, žr. Elvinas.',' Elvina yra vokiečių kilmės vardas.'),(670,'Elva',' Elva yra Moteriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Elvyra ir kt.','Vardo reikšmė: Šio vardo savininkai linkę savyje ieškoti daugiau artistiškų, muzikinių sugebėjimų. Šis vardas praplečia Jūsų akiratį. ',' Elva yra vokiečių kilmės vardas.'),(671,'Elmis',' Elmis yra Vyriškas vardas.','Trumpa reikšmė: liet., iš ežero vardo Elmis (Anykščiai).','Vardo reikšmė: Norėtumėte dalyvauti politiniuose judėjimuose, Jus traukia psichologija ir spiritizmo praktika. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Elmis yra lietuvių kilmės vardas.'),(672,'Erdenis',' Erdenis yra Vyriškas vardas.','Trumpa reikšmė: erd- (erdvė) + -en-.','Vardo reikšmė: Šis vardas stiprina Jūsų lyderio, vadovo sugebėjimus. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Erdenis yra lietuvių kilmės vardas.'),(673,'Erdenė',' Erdenė yra Moteriškas vardas.','Trumpa reikšmė: erd- (erdvė) + -en-.','Vardo reikšmė: Šis vardas stiprina Jūsų lyderio, vadovo sugebėjimus. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Erdenė yra lietuvių kilmės vardas.'),(674,'Erdė',' Erdė yra Moteriškas vardas.','Trumpa reikšmė: liet., trumpinys iš mot. v. su Erd-: Erdvilė ir kt.','Vardo reikšmė: Erdė – (2) liet., trumpinys iš mot. v. su Erd-: Erdvilė ir kt.',' Erdė yra lietuvių kilmės vardas.'),(675,'Erčius',' Erčius yra Vyriškas vardas.','Trumpa reikšmė: „žmogus iš žemės, žmogus“.','Vardo reikšmė: Erčius – (2) var. Erdžius, — vak. liet. trumpinys iš Erdmonas (var. Ertmonas, Erkmonas), kuris iš vok. v. Erdmann — „žmogus iš žemės, žmogus“. Erdmann yra XVII a. vok. vertinys iš hebr. Adomas.',' Erčius yra lietuvių kilmės vardas.'),(676,'Erazmas',' Erazmas yra Vyriškas vardas.','Trumpa reikšmė: „mylimas, pageidaujamas“.','Vardo reikšmė: Šis vardas stiprina Jūsų žinių siekimą. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis. Protas tampa analitiškesnis, sugebate giliau įsiskverbti į reiškinių esmę.',' Erazmas yra graikų kilmės vardas.'),(677,'Erazma',' Erazma yra Moteriškas vardas.','Trumpa reikšmė: „mylimas, pageidaujamas“.','Vardo reikšmė: Šis vardas stiprina Jūsų žinių siekimą. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis. Protas tampa analitiškesnis, sugebate giliau įsiskverbti į reiškinių esmę.',' Erazma yra graikų kilmės vardas.'),(678,'Enrikas',' Enrikas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Henrikas „namų valdovas“.','Vardo reikšmė: Šio vardo savininkai itin reiklūs sau pačiam ir kitiems. Nesprendžiate apie įvykius iš pirmo žvilgsnio. Jums prireiks daugiau laiko tobulėjimui. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. ',' Enrikas yra italų kilmės vardas.'),(679,'Ernestina',' Ernestina yra Moteriškas vardas.','Trumpa reikšmė: ernust „rimtas“ + -in-.','Vardo reikšmė: Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis ir panaudoti praktikoje. Protas tampa analitiškesnis, sugebate giliau įsiskverbti į reiškinių esmę.',' Ernestina yra vokiečių kilmės vardas.'),(680,'Enrika',' Enrika yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Henrikas „namų valdovas“.','Vardo reikšmė: Kiekviena Enrika labai mėgsta keliauti, dėl to dažna šio vardo nešiotoja tampa poliglote ir lengvai įsisavina užsienio kalbas.',' Enrika yra italų kilmės vardas.'),(681,'Ernestas',' Ernestas yra Vyriškas vardas.','Trumpa reikšmė: ernst „rimtas“.','Vardo reikšmė: Ernestai visgi tėra tiktai žmonės, todėl gresia pavojus, kad jie gali nukrypti į kraštutinumus ir praradę bet kokį realybės jausmą, gali tapti nepavojingais keistuoliais, amžinais svajotojais.',' Ernestas yra vokiečių kilmės vardas.'),(682,'Emilius',' Emilius yra Vyriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Emilijus.','Vardo reikšmė: Emilius – (2) liet. trumpinys iš Emilijus.',' Emilius yra lietuvių kilmės vardas.'),(683,'Emilis',' Emilis yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Emilijus: „veržlus, nepralenkiamas“.','Vardo reikšmė: Vardadienis: Kovo 10 d., lapkričio 14 d.',' Emilis yra lotynų kilmės vardas.'),(684,'Ernesta',' Ernesta yra Moteriškas vardas.','Trumpa reikšmė: ernst „rimtas“.','Vardo reikšmė: Jūsų vardas stiprina Jūsų jautrumą ir sugebėjimą rūpintis kitais žmonėmis. Jis padeda Jums lengviau bendrauti su kitais, panaudoti taktą ir diplomatiją. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Sustiprėją taikdario ir patarėjo sugebėjimai.',' Ernesta yra vokiečių kilmės vardas.'),(685,'Erna',' Erna yra Vyriškas vardas.','Trumpa reikšmė: vok., trumpinys iš Ernesta.','Vardo reikšmė: Šio vardo savininkas yra labai draugiškas, ir rūpestingas. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai ir populiarumas. Jūsų sąmoningumo lygis kyla, o taip pat ilgesnį laiką sugebate atkakliau dirbti. Šis vardas Jums leidžia tapti visuomenės ramsčiu.',' Erna yra vokiečių kilmės vardas.'),(686,'Emilijus',' Emilijus yra Vyriškas vardas.','Trumpa reikšmė: „veržlus, nepralenkiamas“.','Vardo reikšmė: Jūs jaučiatės esąs principingesnis, doresnis ir ryžtingesnis. Ateityje įgysite daugiau organizacinių sugebėjimų.Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Esate plačios atviros natūros, įžvalgūs, niekada neišgyvenate dėl niekniekių. ',' Emilijus yra lotynų kilmės vardas.'),(687,'Erikas',' Erikas yra Vyriškas vardas.','Trumpa reikšmė: era „garbė“ + richi „galingas“.','Vardo reikšmė: Erikams šeima – tai jų namai, labai šeimyniški žmonės.',' Erikas yra vokiečių kilmės vardas.'),(688,'Emilijonas',' Emilijonas yra Vyriškas vardas.','Trumpa reikšmė: „veržlus, nepralenkiamas“.','Vardo reikšmė: Emilijonas – (2) lot., trump. Emilijus, Emilas, iš lot. Aemilianus, kuris yra priesagos -anus vedinys iš Aemilius, žr. Emilijus.',' Emilijonas yra lotynų kilmės vardas.'),(689,'Erika',' Erika yra Moteriškas vardas.','Trumpa reikšmė: era „garbė“ + richi „galingas“.','Vardo reikšmė: Erikos, turėdamos nepriekaištingą intelektą, tiesiai į akis rėžia savo nuomonę. Tai daro labai kategoriškai, visiškai nesiklausydamos kitų patarimų. Potraukis – žavėtis savimi.',' Erika yra vokiečių kilmės vardas.'),(690,'Emilijona',' Emilijona yra Moteriškas vardas.','Trumpa reikšmė: „veržlus, nepralenkiamas“.','Vardo reikšmė: Emilijona – (2) lot., trump. Emilija, Milė, tarm. Emilijonė žem., iš lot. Aemiliana, kuris iš vyr. v. Aemilianus, žr. Emilijonas.',' Emilijona yra lotynų kilmės vardas.'),(691,'Erdvilė',' Erdvilė yra Moteriškas vardas.','Trumpa reikšmė: erd- (erdvė) + vil- (viltis).','Vardo reikšmė: Erdvilė – (1), (2) liet., trump. Erdė, iš vyr. v. Erdvilas.',' Erdvilė yra lietuvių kilmės vardas.'),(692,'Erdvilas',' Erdvilas yra Vyriškas vardas.','Trumpa reikšmė: erd- (erdvė) + vil- (viltis).','Vardo reikšmė: Erdvilas – (1) liet., trump. Erdas, Erdys, erd- (: liet. erd-vė — sen. reikšme „laisvas žemės plotas“, plg. sen. vok. aukšt. erda „žemė“, sen. ind. ardha- „vieta, kraštas“) + vil- (žr. Eidvilas).',' Erdvilas yra lietuvių kilmės vardas.'),(693,'Erdmilas',' Erdmilas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Erdas, Erdmas, erd- (žr. Erdvilas) + mil- (žr. Eimilas).','Vardo reikšmė: Erdmilas – (1) liet., trump. Erdas, Erdmas, erd- (žr. Erdvilas) + mil- (žr. Eimilas).',' Erdmilas yra lietuvių kilmės vardas.'),(694,'Erdmilė',' Erdmilė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Erdė, Erdmė, iš vyr. v. Erdmilas.','Vardo reikšmė: Erdmilė – (1), (2) liet., trump. Erdė, Erdmė, iš vyr. v. Erdmilas.',' Erdmilė yra lietuvių kilmės vardas.'),(695,'Erdmė',' Erdmė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Erdmantas, Erdmantė: erd- (erdvė) + mant- (mantus „sumanus“) – „plačioje erdvėje žinomas kaip sumanus“.','Vardo reikšmė: Jus visi labai gerbia, lengvai surandate kontaktus su bet kokiais žmonėmis.Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Plačiai žvelgiate į pasaulį ir matote daugiau nei kiti, neišskiriant tarptautinių ryšių ir didžių socialinių permainų.',' Erdmė yra lietuvių kilmės vardas.'),(696,'Erdmas',' Erdmas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Erdmantas, Erdmantė: erd- (erdvė) + mant- (mantus „sumanus“) – „plačioje erdvėje žinomas kaip sumanus“.','Vardo reikšmė: Jus visi labai gerbia, lengvai surandate kontaktus su bet kokiais žmonėmis.Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Plačiai žvelgiate į pasaulį ir matote daugiau nei kiti, neišskiriant tarptautinių ryšių ir didžių socialinių permainų.',' Erdmas yra lietuvių kilmės vardas.'),(697,'Erdmantė',' Erdmantė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Erdė, Erdmė, Mantė, iš vyr. v. Erdmantas.','Vardo reikšmė: Erdmantė – (1) liet., trump. Erdė, Erdmė, Mantė, iš vyr. v. Erdmantas.',' Erdmantė yra lietuvių kilmės vardas.'),(698,'Erdmantas',' Erdmantas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Erdas, Erdys, Erdmas, Mantas, erd- (žr. Erdvilas)+mant-(žr. Eidmantas).','Vardo reikšmė: Erdmantas – (1) liet., trump. Erdas, Erdys, Erdmas, Mantas, erd- (žr. Erdvilas)+mant-(žr. Eidmantas).',' Erdmantas yra lietuvių kilmės vardas.'),(699,'Eulalija',' Eulalija yra Moteriškas vardas.','Trumpa reikšmė: „gražiakalbis, iškalbingas“.','Vardo reikšmė: Eulalija – (1) graik., trump. Eulalė, Lalė, iš sulotyninto graik. Eulalia : graik. eulalos „gražiakalbis“.',' Eulalija yra graikų kilmės vardas.'),(700,'Erdginas',' Erdginas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Erdas, Erdys, erd-(žr. Erdvilas) + gin- (žr. Eiginas).','Vardo reikšmė: Erdginas – (1) liet., trump. Erdas, Erdys, erd-(žr. Erdvilas) + gin- (žr. Eiginas).',' Erdginas yra lietuvių kilmės vardas.'),(701,'Eulalė',' Eulalė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys: „gražiakalbis, iškalbingas“.','Vardo reikšmė: Eulalė – (2) trump. Lalė, – liet. trumpinys iš Eulalija.',' Eulalė yra graikų kilmės vardas.'),(702,'Eugenijus',' Eugenijus yra Vyriškas vardas.','Trumpa reikšmė: „gerai gimęs, kilmingas“.','Vardo reikšmė: Eugenijai gyvenime, – labai patiklūs , dažnai greitai kuo nors susižavi taip pat greitai ir nusivilia.',' Eugenijus yra graikų kilmės vardas.'),(703,'Eugenija',' Eugenija yra Moteriškas vardas.','Trumpa reikšmė: \"gerai gimusi, kilminga\".','Vardo reikšmė: Eugenijos gyvenime dažnai susižavi ir greitai nusivilia, yra jausmingos, geidulingos ir nepastovios. Gyvena neramiai, kartais nedorai, vaikosi įvairių pasismaginimų. Linkusios į azartinius žaidimus, todėl iššvaisto savo gabumus ir energiją, nukrypdamos į menkaverčius malonumus.',' Eugenija yra graikų kilmės vardas.'),(704,'Eugenas',' Eugenas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Eugenija, Eugenijus: „gerai gimęs, klimingas“.','Vardo reikšmė: Eugenas – (2) trump. Genius, Genis, — liet. trumpinys iš Eugenijus.',' Eugenas yra graikų kilmės vardas.'),(705,'Eugenė',' Eugenė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Eugenija, Eugenijus: „gerai gimęs, klimingas“.','Vardo reikšmė: Eugenė – (2) trump. Genė, — liet. trumpinys iš Eugenija.',' Eugenė yra graikų kilmės vardas.'),(706,'Eufrozina',' Eufrozina yra Moteriškas vardas.','Trumpa reikšmė: „džiaugsmas, linksmumas“.','Vardo reikšmė: Eufrozina – (2) graik., trump. Frozė, Zina, tarm. Efrozina, Efrazina, Frazina ryt. aukšt., Eufruzina, Fruzė piet. žem., vak. aukšt., iš sulotyninto graik. Euphrosyna: graik. euphrosyne „džiaugsmas, linksmumas“.',' Eufrozina yra graikų kilmės vardas.'),(707,'Eufemija',' Eufemija yra Moteriškas vardas.','Trumpa reikšmė: „šlovė, geri žodžiai“.','Vardo reikšmė: Šio vardo savininkai savo gyvenimą dažniausiai pašvenčia visuomeninėms organizacijoms. Nemėgsta pagalbos iš šalies, jiems patinka viską daryti patiems. Esate užsispyrę darbuotojai, lengvai apsikraunantys įvairiausiais darbais; jų rankose negalimas tampa galimu. ',' Eufemija yra graikų kilmės vardas.'),(708,'Eufema',' Eufema yra Moteriškas vardas.','Trumpa reikšmė: trump. Fema, — liet. trumpinys iš Eufemija.','Vardo reikšmė: Šio vardo savininkai savo gyvenimą dažniausiai pašvenčia visuomeninėms organizacijoms. Nemėgsta pagalbos iš šalies, jiems patinka viską daryti patiems. Esate užsispyrę darbuotojai, lengvai apsikraunantys įvairiausiais darbais; jų rankose negalimas tampa galimu.',' Eufema yra lietuvių kilmės vardas.'),(709,'Eudora',' Eudora yra Moteriškas vardas.','Trumpa reikšmė: eu „gera“ + doron „dovan“.','Vardo reikšmė: Eudora – (2) graik., trump. Dora, iš sulotyninto graik. Eudora: graik. eu „gera“ + doron ,,dovana“.',' Eudora yra graikų kilmės vardas.'),(710,'Etmė',' Etmė yra Moteriškas vardas.','Trumpa reikšmė: Edma variantas iš Edmundė: ead „turtas“ + munt „apsauga, gynėjas“.','Vardo reikšmė: Šio vardo savininkams patinka viskas, kas puiku, ir jie patys nestokoja linksmo būdo. Neretai ir patys išoriškai itin patrauklūs, seksualūs, retkarčiais ir išdidūs, itin daug dėmesio skiria savo išvaizdai, jos priežiūrai. Jie pritaria laikmečiui, madoms, yra veiklūs, stengiasi atsiskleisti menui. ',' Etmė yra anglų kilmės vardas.'),(711,'Estera',' Estera yra Moteriškas vardas.','Trumpa reikšmė: „žvaigždė“.','Vardo reikšmė: Esterų profesijos bei užsiėmimai – puikios amatininkės, inžinierės, išradėjos, diplomatės, politikės-intrigantės, siekiančios tik sau naudos.',' Estera yra iraniečių kilmės vardas.'),(712,'Ervinas',' Ervinas yra Vyriškas vardas.','Trumpa reikšmė: era „garbė“ + wini „darugas“.','Vardo reikšmė: Ervinas – (1) germ., trump. Ervas, baž. lot. Ervinus iš germ. Erwin: sen. vok. aukšt. era „garbė“ + wini „draugas“.',' Ervinas yra vokiečių kilmės vardas.'),(713,'Estela',' Estela yra Moteriškas vardas.','Trumpa reikšmė: iš lotynų: stella „žvaigždė“.','Vardo reikšmė: Estelų sėkmei svarbu, kad materialiai jos būtų visiškai stabilios, tik taip jos gali save realizuoti. Reikėtų saugotis, kad materialinių vertybių nesumaišytų su dvasinėmis tada Estelos pražūtų.',' Estela yra ispanų kilmės vardas.'),(714,'Erta',' Erta yra Moteriškas vardas.','Trumpa reikšmė: „stiprioji“.','Vardo reikšmė: Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas, tačiau dauguma Jūsų sugebate kažkokiu būdu disponuoti pakankamomis lėšomis ir problemų dėl išlaidumo nejaučiate, nes jums dažniausiai nuskyla būti santuokoje su pasiturinčias partneriais.',' Erta yra vokiečių kilmės vardas.'),(715,'Elmyra',' Elmyra yra Moteriškas vardas.','Trumpa reikšmė: „valdovė, valdovas“.','Vardo reikšmė: Jis suteikia drąsos ir noro rizikuoti. Tampate ryžtingesnis ir tikslingesnis.Padidėja dėmesys visuomenės reikmėms, jaučiate poreikį pasitarnauti visuomenei. Šis vardas leidžia Jums geriau įvertinti žmonių charakterius.',' Elmyra yra arabų kilmės vardas.'),(716,'Elmaras',' Elmaras yra Vyriškas vardas.','Trumpa reikšmė: „garsus, žymus“.','Vardo reikšmė: Šis vardas suteikia Jums energijos, galite įgyti daugiau muzikinių, vaidybinių sugebėjimų. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Elmaras yra vokiečių kilmės vardas.'),(717,'Elma',' Elma yra Moteriškas vardas.','Trumpa reikšmė: „kilnioji“.','Vardo reikšmė: Jis teikia nepriklausomybės, individualumo, originalumo ir išradingumo. Jis suteikia Jums drąsos ir noro rizikuoti. Tampate ryžtingesnis ir tikslingesnis.Padidėja dėmesys visuomenės reikmėms, jaučiate poreikį pasitarnauti visuomenei. ',' Elma yra anglų kilmės vardas.'),(718,'Eliza',' Eliza yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Elzbieta hebrajų (sen. žydų): „prisiekiu dievu“.','Vardo reikšmė: Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs.',' Eliza yra italų kilmės vardas.'),(719,'Eligijus',' Eligijus yra Vyriškas vardas.','Trumpa reikšmė: eligo „išrinkti“.','Vardo reikšmė: Eligijus – (1) lot., trump. Eligas, Elis, Elius, iš lot. Eligius: lot. eligo „išrinkti“.',' Eligijus yra lotynų kilmės vardas.'),(720,'Eligas',' Eligas yra Vyriškas vardas.','Trumpa reikšmė: eligo „išrinkti“.','Vardo reikšmė: Šis vardas leidžia Jums geriau įvertinti žmonių charakterius. Šis vardas suteikia Jums daugiau energijos, galite įgyti daugiau muzikinių, vaidybinių sugebėjimų. Menas galima sakyti Jūsų pašaukimas.',' Eligas yra lotynų kilmės vardas.'),(721,'Elidijus',' Elidijus yra Vyriškas vardas.','Trumpa reikšmė: elido „išgydyti“.','Vardo reikšmė: Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs.',' Elidijus yra lotynų kilmės vardas.'),(722,'Elidas',' Elidas yra Vyriškas vardas.','Trumpa reikšmė: lot., trump. Elis, Elius, - liet. trumpinys iš Elidijus.','Vardo reikšmė: Elidas – (2) lot., trump. Elis, Elius, – liet. trumpinys iš Elidijus.',' Elidas yra lotynų kilmės vardas.'),(723,'Elfrida',' Elfrida yra Moteriškas vardas.','Trumpa reikšmė: elf „eltas“ + fridu „apsauga, taika“.','Vardo reikšmė: Elfrida – (2) germ., trump. Elė, Frida, iš germ. Elfrida: germ. elf „elfas“ + sen. vok. aukšt. fridu „apsauga, taika“.',' Elfrida yra vokiečių kilmės vardas.'),(724,'Eleonora',' Eleonora yra Moteriškas vardas.','Trumpa reikšmė: „dievas mano šviesa“.','Vardo reikšmė: Eleonoros drąsios ir impulsyvios, todėl dažnai pakliūva į įtemtas situacijas.',' Eleonora yra hebrajų kilmės vardas.'),(725,'Eivinas',' Eivinas yra Vyriškas vardas.','Trumpa reikšmė: ei- (eiti) + vin- (baltų vaina „kaltė, priežastis“) –„einantis su tikslu“.','Vardo reikšmė: Ateityje įgysite daugiau organizacinių sugebėjimų. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas, dar kitaip galima būtų Jus apibūdinti kaip avantiūristas.',' Eivinas yra lietuvių kilmės vardas.'),(726,'Elena',' Elena yra Moteriškas vardas.','Trumpa reikšmė: „šviesioji“.','Vardo reikšmė: Elenos suaugusios dažniausiai tampa medikėmis, prižiūrėtojomis, auklėmis. Joms materialinė gerovė nėra labai svarbi. ',' Elena yra graikų kilmės vardas.'),(727,'Eladijus',' Eladijus yra Vyriškas vardas.','Trumpa reikšmė: Hellados „Elada“ (taip vadinama Graikija) – „eladietis, Graikijos gyventojas“. Graikiškai hell- reiškia šviesą..','Vardo reikšmė: Eladijus – (1) graik., trump. Eladas, Elas, Elius, iš sulotyninto graik. Helladius: graik. Helas (kilm. Hellados) — Elada (= Graikija).',' Eladijus yra graikų kilmės vardas.'),(728,'Eivilė',' Eivilė yra Moteriškas vardas.','Trumpa reikšmė: ei- (eiti) + vil- (viltis).','Vardo reikšmė: Eivilė – (1), (2) liet., trump. Eivė, iš vyr. v. Eivilas.',' Eivilė yra lietuvių kilmės vardas.'),(729,'Eivilas',' Eivilas yra Vyriškas vardas.','Trumpa reikšmė: ei- (eiti) + vil- (viltis).','Vardo reikšmė: Eivilas – (1) liet., trump. Eivas, Eivys, ei- (žr. Eibaras) + vil- (žr. Eidvilas).',' Eivilas yra lietuvių kilmės vardas.'),(730,'Eladas',' Eladas yra Vyriškas vardas.','Trumpa reikšmė: graik., trump. Elas, Elius, - liet. trumpinys iš Eladijus.','Vardo reikšmė: Eladas – (2) graik., trump. Elas, Elius, – liet. trumpinys iš Eladijus.',' Eladas yra graikų kilmės vardas.'),(731,'Eivydas',' Eivydas yra Vyriškas vardas.','Trumpa reikšmė: ei- (eiti) + vyd- (iš-vydo).','Vardo reikšmė: Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs. ',' Eivydas yra lietuvių kilmės vardas.'),(732,'Ekvitas',' Ekvitas yra Vyriškas vardas.','Trumpa reikšmė: „raitelis, raitininkas“.','Vardo reikšmė: Ekvitas – (1) lot., trump. Ekvas, Ekvis, iš lot. Eąues: lot. eąues (kilm. eąuitis) „raitelis, raitininkas“.',' Ekvitas yra lotynų kilmės vardas.'),(733,'Eivenis',' Eivenis yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Eivas, Eivys.','Vardo reikšmė: Šis vardas leidžia Jums geriau įvertinti žmonių charakterius. Šis vardas suteikia Jums daugiau energijos, galite įgyti daugiau muzikinių, vaidybinių sugebėjimų. Menas galima sakyti Jūsų pašaukimas.',' Eivenis yra lietuvių kilmės vardas.'),(734,'Eivė',' Eivė yra Moteriškas vardas.','Trumpa reikšmė: liet., trumpinys iš mot. v. su Ei-v-: Eivydė , Eivilė, Eivinė ir kt.','Vardo reikšmė: Šis vardas leidžia Jums geriau įvertinti žmonių charakterius. Šis vardas suteikia Jums daugiau energijos, galite įgyti daugiau muzikinių, vaidybinių sugebėjimų. Menas galima sakyti Jūsų pašaukimas.',' Eivė yra lietuvių kilmės vardas.'),(735,'Eivenė',' Eivenė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Eivė, iš vyr. v. Eivenis.','Vardo reikšmė: Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs.',' Eivenė yra lietuvių kilmės vardas.'),(736,'Eivardas',' Eivardas yra Vyriškas vardas.','Trumpa reikšmė: „burti“.','Vardo reikšmė: Jis teikia nepriklausomybės, individualumo, originalumo ir išradingumo. Jis suteikia Jums drąsos ir noro rizikuoti. Tampate ryžtingesnis ir tikslingesnis.Padidėja dėmesys visuomenės reikmėms, jaučiate poreikį pasitarnauti visuomenei.',' Eivardas yra lietuvių kilmės vardas.'),(737,'Eitvilė',' Eitvilė yra Moteriškas vardas.','Trumpa reikšmė: ei- (eiti) + vil- (viltis).','Vardo reikšmė: Šis vardas suteikia Jums energijos, galite įgyti daugiau muzikinių, vaidybinių sugebėjimų. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Eitvilė yra lietuvių kilmės vardas.'),(738,'Eitvilas',' Eitvilas yra Vyriškas vardas.','Trumpa reikšmė: ei- (eiti) + vil- (viltis).','Vardo reikšmė: Šis vardas suteikia Jums energijos, galite įgyti daugiau muzikinių, vaidybinių sugebėjimų. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Eitvilas yra lietuvių kilmės vardas.'),(739,'Eivaidas',' Eivaidas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Eivas, Eivys, ei- (žr. Eibaras) + vaid- (: liet. vaid-ytis, vaidentis „rodytis).','Vardo reikšmė: Vardas jums suteikia drąsos ir noro rizikuoti. Tampate ryžtingesnis ir tikslingesnis.Padidėja dėmesys visuomenės reikmėms, jaučiate poreikį pasitarnauti visuomenei. Šis vardas taip pat leidžia Jums geriau įvertinti žmonių charakterius.',' Eivaidas yra lietuvių kilmės vardas.'),(740,'Eitvydas',' Eitvydas yra Vyriškas vardas.','Trumpa reikšmė: ei- (eiti) + vyd- (iš-vydo).','Vardo reikšmė: Eitvydas – (1) liet., trump. Eitas, Eitys, Vydas, eit- (žr. Eitmilas) + vyd- (žr. Eidvydas).',' Eitvydas yra lietuvių kilmės vardas.'),(741,'Eitviltas',' Eitviltas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Eitas, Eitys, eit- (žr. Eitmilas) + vilt- (: liet. viltis, vilt-is).','Vardo reikšmė: Eitviltas – (1) liet., trump. Eitas, Eitys, eit- (žr. Eitmilas) + vilt- (: liet. viltis, vilt-is).',' Eitviltas yra lietuvių kilmės vardas.'),(742,'Eitvaldė',' Eitvaldė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Eitė, iš vyr. v. Eitvaldas.','Vardo reikšmė: Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas, tačiau dauguma Jūsų sugebate kažkokiu būdu disponuoti pakankamomis lėšomis ir problemų dėl išlaidumo nejaučiate, nes jums dažniausiai nuskyla būti santuokoje su pasiturinčias partneriais.',' Eitvaldė yra lietuvių kilmės vardas.'),(743,'Eitvaldas',' Eitvaldas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Eitas, Eitys, Valdas, eit- (žr. Eitmilas) + vald- (žr. Eisvaldas).','Vardo reikšmė: Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas, tačiau dauguma Jūsų sugebate kažkokiu būdu disponuoti pakankamomis lėšomis ir problemų dėl išlaidumo nejaučiate, nes jums dažniausiai nuskyla būti santuokoje su pasiturinčias partneriais.',' Eitvaldas yra lietuvių kilmės vardas.'),(744,'Eitmilė',' Eitmilė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Eitė, Milė, iš vyr. v. Eitmilas.','Vardo reikšmė: Šio vardo savininkams patinka viskas, kas puiku, ir jie patys nestokoja linksmo būdo. Neretai ir patys išoriškai itin patrauklūs, seksualūs, retkarčiais ir išdidūs, itin daug dėmesio skiria savo išvaizdai, jos priežiūrai. Jie pritaria laikmečiui, madoms, yra veiklūs, stengiasi atsiskleisti menui.',' Eitmilė yra lietuvių kilmės vardas.'),(745,'Eitmilas',' Eitmilas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Eitys, Milius, eit- (: liet. eiti) + mil- (žr. Eimilas).','Vardo reikšmė: Šio vardo savininkams patinka viskas, kas puiku, ir jie patys nestokoja linksmo būdo. Neretai ir patys išoriškai itin patrauklūs, seksualūs, retkarčiais ir išdidūs, itin daug dėmesio skiria savo išvaizdai, jos priežiūrai. Jie pritaria laikmečiui, madoms, yra veiklūs, stengiasi atsiskleisti menui.',' Eitmilas yra lietuvių kilmės vardas.'),(746,'Eitenis',' Eitenis yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Eitas, Eitys, priesagos -enis vedinys iš sen. tump. Eitas, kuris iš avd. su Ei-t-, Eit-: Eitautas, Eitminas, Eitvydas ir kt.','Vardo reikšmė: Šio vardo savininkai savo gyvenimą dažniausiai pašvenčia visuomeninėms organizacijoms. Nemėgsta pagalbos iš šalies, jiems patinka viską daryti patiems. Esate užsispyrę darbuotojai, lengvai apsikraunantys įvairiausiais darbais; jų rankose negalimas tampa galimu.',' Eitenis yra lietuvių kilmės vardas.'),(747,'Eitenė',' Eitenė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Eitė, iš vyr. v. Eitenis.','Vardo reikšmė: Šio vardo savininkai savo gyvenimą dažniausiai pašvenčia visuomeninėms organizacijoms. Nemėgsta pagalbos iš šalies, jiems patinka viską daryti patiems. Esate užsispyrę darbuotojai, lengvai apsikraunantys įvairiausiais darbais; jų rankose negalimas tampa galimu.',' Eitenė yra lietuvių kilmės vardas.'),(748,'Eitautė',' Eitautė yra Moteriškas vardas.','Trumpa reikšmė: ei- (eiti) + taut- (tauta).','Vardo reikšmė: Eitautė – (1) liet., trump. Eitė, iš vyr. v. Eitautas.',' Eitautė yra lietuvių kilmės vardas.'),(749,'Eitė',' Eitė yra Moteriškas vardas.','Trumpa reikšmė: liet., trumpinys iš mot. v. su Ei-t-, Eit-: Eitautė, Eitminė, Eitvydė ir kt..','Vardo reikšmė: Taigi šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgstantis dovanoti ir gauti dovanas, sugeba būti labai svetingas. Šis vardas simbolizuoja norą imtis naujų planų ir juos įgyvendinti.',' Eitė yra lietuvių kilmės vardas.'),(750,'Eitautas',' Eitautas yra Vyriškas vardas.','Trumpa reikšmė: ei- (eiti) + taut- (tauta).','Vardo reikšmė: Šio vardo savininkai sugeba ilgam laikui prie ko nors prisirišti, tačiau jų partneriai dažnai pavargsta nuo emocinio jų nestabilumo. Šių žmonių stiprus energetinis laukas, jūs norite vadžias imti į savo rankas. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. ',' Eitautas yra lietuvių kilmės vardas.'),(751,'Eitaras',' Eitaras yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Eitas, Eitys, ei- (žr. Eibaras) + tar- (: liet. tar-ti).','Vardo reikšmė: Eitaras – (1) liet., trump. Eitas, Eitys, ei- (žr. Eibaras) + tar- (: liet. tar-ti)',' Eitaras yra lietuvių kilmės vardas.'),(752,'Eismantė',' Eismantė yra Moteriškas vardas.','Trumpa reikšmė: eis- (eislus „greitai einantis“) + mant- (mantus „sumanus“).','Vardo reikšmė: Jūs labai pasitikite savimi, ne taip paprasta pažeisti. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jūs atsargus, kartais netgi įtarus, mėgstate dovanoti ir gauti dovanas, sugebate būti labai svetingas. Esant reikalui, galite būti labai drąsus ir užsispyręs. ',' Eismantė yra lietuvių kilmės vardas.'),(753,'Eismantas',' Eismantas yra Vyriškas vardas.','Trumpa reikšmė: eis- (eislus „greitai einantis“) + mant- (mantus „sumanus“).','Vardo reikšmė: Jūs labai pasitikite savimi, ne taip paprasta pažeisti. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jūs atsargus, kartais netgi įtarus, mėgstate dovanoti ir gauti dovanas, sugebate būti labai svetingas. Esant reikalui, galite būti labai drąsus ir užsispyręs. ',' Eismantas yra lietuvių kilmės vardas.'),(754,'Eisvinas',' Eisvinas yra Vyriškas vardas.','Trumpa reikšmė: eis- (eislus „greitai einantis“) + vin- (baltų vaina „kaltė, priežastis“).','Vardo reikšmė: Tai – galingas vardas, suteikiantis Jums pasitikėjimo, gero lyderio, vadovo savybių. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Jis teikia Jums nepriklausomybės, individualumo, originalumo ir išradingumo.',' Eisvinas yra lietuvių kilmės vardas.'),(755,'Eiskantas',' Eiskantas yra Vyriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Eisys.','Vardo reikšmė: Šio vardo savininkai amžini klajokliai, lengvai įsisavinate užsienio kalbas. Šio vardo savininkas yra labai draugiškas, dėmesingas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas. Esant reikalui, gali būti labai drąsus ir labai atkaklus.',' Eiskantas yra prūsų kilmės vardas.'),(756,'Eikintas',' Eikintas yra Vyriškas vardas.','Trumpa reikšmė: liet. ir prūs., trump. Eikys.','Vardo reikšmė: Eikintas – (1) liet. ir prūs., trump. Eikys, ei- (žr. Eikantas) + kint- (: liet. kent-ėti, plg. žiem-kint-is).',' Eikintas yra prūsų kilmės vardas.'),(757,'Eisvydas',' Eisvydas yra Vyriškas vardas.','Trumpa reikšmė: eis- (eislus „greitai einantis“) + vyd- (iš-vydo).','Vardo reikšmė: Šio vardo savininkai linkę savyje ieškoti daugiau artistiškų, muzikinių sugebėjimų. Šis vardas leidžia jums matyti daugiau nei kitiems.',' Eisvydas yra lietuvių kilmės vardas.'),(758,'Eisys',' Eisys yra Vyriškas vardas.','Trumpa reikšmė: liet., trumpinys iš avd. su Eis-: Eiskantas, Eismantas, Eisvydas ir kt.','Vardo reikšmė: Eisys – (4) liet., trumpinys iš avd. su Eis-: Eiskantas, Eismantas, Eisvydas ir kt.',' Eisys yra lietuvių kilmės vardas.'),(759,'Eimutis',' Eimutis yra Vyriškas vardas.','Trumpa reikšmė: ei- (eiti) + min- (minėti) + -ut- (mažybinė priesaga).','Vardo reikšmė: Norėtumėte dalyvauti politiniuose judėjimuose. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Eimutis yra lietuvių kilmės vardas.'),(760,'Eikantas',' Eikantas yra Vyriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Eikys.','Vardo reikšmė: Šis vardas stiprina Jūsų lyderio, vadovo sugebėjimus. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Taip pat neabejingas psichologijai ir spiritizmo praktikai.',' Eikantas yra lietuvių kilmės vardas.'),(761,'Eimutė',' Eimutė yra Moteriškas vardas.','Trumpa reikšmė: ei- (eiti) + min- (minėti) + -ut- (mažybinė priesaga).','Vardo reikšmė: Norėtumėte dalyvauti politiniuose judėjimuose. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Dažniausiai Jūs intelektualinio darbo atstovai.',' Eimutė yra lietuvių kilmės vardas.'),(762,'Eisė',' Eisė yra Moteriškas vardas.','Trumpa reikšmė: liet., trumpinys iš mot. v. su Eis-: Eiskantė, Eismantė, Eisvydė.','Vardo reikšmė: Eisė – (2) liet., trumpinys iš mot. v. su Eis-: Eiskantė, Eismantė, Eisvydė ir kt.',' Eisė yra lietuvių kilmės vardas.'),(763,'Eisvaldė',' Eisvaldė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Eisvė, iš vyr. v. Eisvaldas.','Vardo reikšmė: Šis vardas stiprina Jūsų žinių siekimą. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis. Protas tampa analitiškesnis, sugebate labiau įsigilinti į reiškinių esmę.',' Eisvaldė yra lietuvių kilmės vardas.'),(764,'Eimintas',' Eimintas yra Vyriškas vardas.','Trumpa reikšmė: ei- (eiti) + min- (minėti) – „tas, apie kurį eina gamdas, kuris minimas“.','Vardo reikšmė: Šio vardo savininkai itin reiklūs sau pačiam ir kitiems. Nesprendžiate apie įvykius iš pirmo žvilgsnio. Gaila bet Jums prireiks daugiau laiko tobulėjimui. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai išmokstate kitas kalbas.',' Eimintas yra lietuvių kilmės vardas.'),(765,'Eisvaldas',' Eisvaldas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Eisvys, Valdas.','Vardo reikšmė: Šis vardas stiprina Jūsų žinių siekimą. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis. Protas tampa analitiškesnis, sugebate labiau įsigilinti į reiškinių esmę.',' Eisvaldas yra lietuvių kilmės vardas.'),(766,'Eirimtė',' Eirimtė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Eirė, Rimtė, iš vyr. v. Eirimtas.','Vardo reikšmė: Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis ir panaudoti praktikoje. Protas tampa praktiškesnis, sugebate giliau įsiskverbti į reiškinių esmę.',' Eirimtė yra lietuvių kilmės vardas.'),(767,'Eisra',' Eisra yra  vardas.','Trumpa reikšmė: liet., iš upėvardžio Eisra (Pagėgiai).','Vardo reikšmė: Jūsų vardo savybės rodo savo teisių žinojimą, nepajudinamą valios galią. Jums tai suteikia nepriklausomybės, individualumo, originalumo ir išradingumo savybių. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas.',' Eisra yra lietuvių kilmės vardas.'),(768,'Eirimtas',' Eirimtas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Eirys, Rimtas.','Vardo reikšmė: Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Galite lengviau sukaupti žinių apie gyvenimo paslaptis ir panaudoti praktikoje. Protas tampa praktiškesnis, sugebate giliau įsiskverbti į reiškinių esmę.',' Eirimtas yra lietuvių kilmės vardas.'),(769,'Eigutis',' Eigutis yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Eigas, Eigys, Eigis, priesagos -utis vedinys iš sen. trump. Eigas, kuris iš avd. su Ei-g-, Eig-: Eigailas, Eigėlas, Eigminas.','Vardo reikšmė: Jūsų vardas stiprina Jūsų jautrumą ir sugebėjimą rūpintis kitais žmonėmis. Jis padeda Jums lengviau bendrauti su kitais, panaudoti taktą ir diplomatiją. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Sustiprėją taikdario ir patarėjo sugebėjimai.',' Eigutis yra lietuvių kilmės vardas.'),(770,'Eismintas',' Eismintas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Eismys, Eisys.','Vardo reikšmė: Eismintas – (1) liet., trump. Eismys, Eisys, eis-(žr. Eiskantas) + mint- (žr. Eigmintas).',' Eismintas yra lietuvių kilmės vardas.'),(771,'Eiminas',' Eiminas yra Vyriškas vardas.','Trumpa reikšmė: ei- (eiti) + min- (minėti) – „tas, apie kurį eina gandas, kuris minimas“.','Vardo reikšmė: Šio vardo savininkas yra labai draugiškas, ir rūpestingas. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai ir populiarumas. Jūsų sąmoningumo lygis kyla, o taip pat ilgesnį laiką sugebate atkakliau dirbti. Šis vardas Jums leidžia tapti visuomenės ramsčiu.',' Eiminas yra lietuvių kilmės vardas.'),(772,'Eirimė',' Eirimė yra Moteriškas vardas.','Trumpa reikšmė: ei- (eiti) + rim- (rimti).','Vardo reikšmė: Jūs jaučiatės esąs principingesnis, doresnis ir ryžtingesnis. Ateityje įgysite daugiau organizacinių sugebėjimų.Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Esate plačios atviros natūros, įžvalgūs, niekada neišgyvenate dėl niekniekių. ',' Eirimė yra lietuvių kilmės vardas.'),(773,'Eigutė',' Eigutė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Eigė, iš vyr. v. Eigutis.','Vardo reikšmė: Jūsų vardas stiprina Jūsų jautrumą ir sugebėjimą rūpintis kitais žmonėmis. Jis padeda Jums lengviau bendrauti su kitais, panaudoti taktą ir diplomatiją. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Sustiprėją taikdario ir patarėjo sugebėjimai.',' Eigutė yra lietuvių kilmės vardas.'),(774,'Eirimas',' Eirimas yra Vyriškas vardas.','Trumpa reikšmė: ei- (eiti) + rim- (rimti).','Vardo reikšmė: Jūs jaučiatės esąs principingesnis, doresnis ir ryžtingesnis. Ateityje įgysite daugiau organizacinių sugebėjimų.Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. Esate plačios atviros natūros, įžvalgūs, niekada neišgyvenate dėl niekniekių.',' Eirimas yra lietuvių kilmės vardas.'),(775,'Eigotė',' Eigotė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Eigė, iš vyr. v. Eigotas.','Vardo reikšmė: Šių vardų savininkų sėkmė – būti kolektyve tarp žmonių, todėl tikriausiai jie labai gerai jaučiasi savo šeimoje.Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jus traukia svaiginantys meilės nuotykiai ir pasirengimas bet kurią minutę pasinerti į eilinę avantiūrą.',' Eigotė yra lietuvių kilmės vardas.'),(776,'Einoras',' Einoras yra Vyriškas vardas.','Trumpa reikšmė: ei-(eiti) + nor- (norėti) – „noriai visur einantis (-i)“.','Vardo reikšmė: Einoras – (1) liet., trump. Einas, Einys, Norys, ei- (žr. Eibaras) + nor- (: liet. nor-ėti, nor-as).',' Einoras yra lietuvių kilmės vardas.'),(777,'Eigotas',' Eigotas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Eigas, Eigys, Eigis, priesagos -otas vedinys iš sen. trump. Eigas, kuris iš avd. su Ei-g-, Eig-: Eigailas, Eigėlas, Eigminas.','Vardo reikšmė: Šio vardo savininkams patartina valdyti savo charakterį, užuot audringai prieštaravus – patylėti. Kadangi jie trokšta lyderiauti, reikėtų norus kontroliuoti. Taip pat reikėtų mokytis, kaip racionaliau tvarkyti savo pinigus.',' Eigotas yra lietuvių kilmės vardas.'),(778,'Eimilė',' Eimilė yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Eimė, Milė, iš vyr. v. Eimilas.','Vardo reikšmė: Jūs puikiai žinote savo teises, jaučiate nepajudinamą valios jėgą. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Jūs jaučiatės esąs principingesnis, doresnis ir ryžtingesnis. Ateityje įgysite daugiau organizacinių sugebėjimų. ',' Eimilė yra lietuvių kilmės vardas.'),(779,'Eimilas',' Eimilas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Eimas, Eimys, Milius.','Vardo reikšmė: Jūs puikiai žinote savo teises, jaučiate nepajudinamą valios jėgą. Traukia valdžia, garbė, titulai, pagarba ir apdovanojimai, prestižas ir populiarumas. Jūs jaučiatės esąs principingesnis, doresnis ir ryžtingesnis. Ateityje įgysite daugiau organizacinių sugebėjimų. ',' Eimilas yra lietuvių kilmės vardas.'),(780,'Eimė',' Eimė yra Moteriškas vardas.','Trumpa reikšmė: liet., trumpinys iš mot. v. su Ei-m-: Eimilė, Eimanė, Eiminė.','Vardo reikšmė: Eimė – (2) liet., trumpinys iš mot. v. su Ei-m-: Eimilė, Eimanė, Eiminė ir kt.',' Eimė yra lietuvių kilmės vardas.'),(781,'Einė',' Einė yra Moteriškas vardas.','Trumpa reikšmė: liet., trumpinys iš mot. v. su Ei-n-, Einorė ir kt.','Vardo reikšmė: Einė – (2) liet., trumpinys iš mot. v. su Ei-n-, Einorė ir kt.',' Einė yra lietuvių kilmės vardas.'),(782,'Eimantė',' Eimantė yra Moteriškas vardas.','Trumpa reikšmė: ei- (eiti) + mant- (mantus „sumanus“).','Vardo reikšmė: Eimantė – (1) liet ir prūs., trump. Eimė, Mantė, iš vyr. v. Eimantas.',' Eimantė yra lietuvių kilmės vardas.'),(783,'Einartas',' Einartas yra Vyriškas vardas.','Trumpa reikšmė: ei-(eiti) + nart- (nartus „atkaklus“) – „atkakliai žengiantis (-i)“.','Vardo reikšmė: Einartas – (1) liet., trump. Einas, Einys, ei-(žr. Eibaras) + nart- (: liet. nart-us „atkaklus“).',' Einartas yra lietuvių kilmės vardas.'),(784,'Eimantas',' Eimantas yra Vyriškas vardas.','Trumpa reikšmė: ei- (eiti) + mant- (mantus „sumanus“).','Vardo reikšmė: Eimantams patariama kontroliuoti savo charakterį, mažiau kištis į konfliktus – patylėti. Nors ir kaip jie trokšta lyderiauti, reikėtų norus kontroliuoti. Taip pat reikėtų išmokti elgtis su savo pinigais.',' Eimantas yra lietuvių kilmės vardas.'),(785,'Eigminas',' Eigminas yra Vyriškas vardas.','Trumpa reikšmė: eig- (eiglus „eiklus“ ) + min- (minėti) – „minimas kaip eiklus, spartuolis, energingas“.','Vardo reikšmė: Pagarba ir apdovanojimai, prestižas ir populiarumas – tai žodžiai, kurie Jus apibūdina. Jūs jaučiatės esąs principingesnis, doresnis ir ryžtingesnis. Ateityje įgysite daugiau organizacinių sugebėjimų. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. ',' Eigminas yra lietuvių kilmės vardas.'),(786,'Eimanė',' Eimanė yra Moteriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Jus visi labai gerbia, lengvai surandate kontaktus su bet kokiais žmonėmis. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Plačiai žvelgiate į pasaulį ir matote daugiau nei kiti, neišskiriant tarptautinių ryšių ir didžių socialinių permainų.',' Eimanė yra lietuvių kilmės vardas.'),(787,'Eigmantė',' Eigmantė yra Moteriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Pagarba ir apdovanojimai, prestižas ir populiarumas – tai žodžiai, kurie Jus apibūdina. Jūs jaučiatės esąs principingesnis, doresnis ir ryžtingesnis. Ateityje įgysite daugiau organizacinių sugebėjimų. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. ',' Eigmantė yra lietuvių kilmės vardas.'),(788,'Eimanas',' Eimanas yra Vyriškas vardas.','Trumpa reikšmė: liet. ir prūs., trump. Eimas, Eimys.','Vardo reikšmė: Jus visi labai gerbia, lengvai surandate kontaktus su bet kokiais žmonėmis. Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Plačiai žvelgiate į pasaulį ir matote daugiau nei kiti, neišskiriant tarptautinių ryšių ir didžių socialinių permainų.',' Eimanas yra lietuvių kilmės vardas.'),(789,'Eigmantas',' Eigmantas yra Vyriškas vardas.','Trumpa reikšmė: iet., trump. Eigas, Mantas.','Vardo reikšmė: Pagarba ir apdovanojimai, prestižas ir populiarumas – tai žodžiai, kurie Jus apibūdina. Jūs jaučiatės esąs principingesnis, doresnis ir ryžtingesnis. Ateityje įgysite daugiau organizacinių sugebėjimų. Mėgstate keliauti, lengvai įsisavinate užsienio kalbas. ',' Eigmantas yra lietuvių kilmės vardas.'),(790,'Fidelija',' Fidelija yra Moteriškas vardas.','Trumpa reikšmė: lotynų fidelis „ištikimas“.','Vardo reikšmė: Fidelija – (1) lot., trump. Fida, Fidė, iš lot. Fidelia, kuris iš vyr. v. Fidelis, žr. Fidelis.',' Fidelija yra lotynų kilmės vardas.'),(791,'Fernandas',' Fernandas yra Vyriškas vardas.','Trumpa reikšmė: fridu „taika“ + nand „drąsa, drąsus“.','Vardo reikšmė: Fernandas – isp., trump. Fernas, Nandas, iš isp. Fernando, kuris yra isp. trumpinys iš Ferdinandus, žr. Ferdinandas.',' Fernandas yra vokiečių kilmės vardas.'),(792,'Fernanda',' Fernanda yra Moteriškas vardas.','Trumpa reikšmė: fridu „taika“ + nand „drąsa, drąsus“.','Vardo reikšmė: Fernanda – (1) isp., trump. Ferna, Nanda, iš vyr. v. Fernando, žr. Fernandas.',' Fernanda yra vokiečių kilmės vardas.'),(793,'Ferdinandas',' Ferdinandas yra Vyriškas vardas.','Trumpa reikšmė: fridu „taika“ + nand „drąsa, drąsus“.','Vardo reikšmė: Ferdinandai – filosofai. Gali valandų valandas mąstyti ką padaryti dar geriau ir gilintis kodėl kiti daro ne taip kaip jie.',' Ferdinandas yra vokiečių, ispanų, italų kilmės vardas.'),(794,'Feliksas',' Feliksas yra Vyriškas vardas.','Trumpa reikšmė: felix „laimingas“.','Vardo reikšmė: Feliksams patinka avantiūros. Jie vieną dieną gali būti viename pasaulio krašte, o kitą – kitame.',' Feliksas yra lotynų kilmės vardas.'),(795,'Felicita',' Felicita yra Moteriškas vardas.','Trumpa reikšmė: felecitas „laimė“.','Vardo reikšmė: Vardadienis: Kovo 7 d., lapkričio 23 d.',' Felicita yra lotynų kilmės vardas.'),(796,'Felicijonas',' Felicijonas yra Vyriškas vardas.','Trumpa reikšmė: felix „laimingas“.','Vardo reikšmė: Felicijonas – (2) lot., trump. Felicijus, Felius, Felis, tarm. Pelicijonas ryt. ir piet. aukšt., iš lot. Felicianus, kuris yra priesagos -anus vedinys iš Felix, žr. Feliksas.',' Felicijonas yra lotynų kilmės vardas.'),(797,'Felicijus',' Felicijus yra Vyriškas vardas.','Trumpa reikšmė: variantas iš Feliksas: felix „laimingas“.','Vardo reikšmė: Felicijus – (1) lot., trump. Felius, Felis, lot. vardo Felix variantas, žr. Feliksas.',' Felicijus yra lotynų kilmės vardas.'),(798,'Felicija',' Felicija yra Moteriškas vardas.','Trumpa reikšmė: variantas iš Feliksas: felix „laimingas“.','Vardo reikšmė: Šio vardo savininkai savo gyvenimą dažniausiai pašvenčia visuomeninėms organizacijoms. Nemėgsta pagalbos iš šalies, jiems patinka viską daryti patiems. Esate užsispyrę darbuotojai, lengvai apsikraunantys įvairiausiais darbais; jų rankose negalimas tampa galimu.',' Felicija yra lotynų kilmės vardas.'),(799,'Felė',' Felė yra Moteriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Felicija.','Vardo reikšmė: Šio vardo savininkams patinka viskas, kas puiku, ir jie patys nestokoja linksmo būdo. Neretai ir patys išoriškai itin patrauklūs, seksualūs, retkarčiais ir išdidūs, itin daug dėmesio skiria savo išvaizdai, jos priežiūrai. Jie pritaria laikmečiui, madoms, yra veiklūs, stengiasi atsiskleisti menui.',' Felė yra lietuvių kilmės vardas.'),(800,'Faustinas',' Faustinas yra Vyriškas vardas.','Trumpa reikšmė: faustus „laimingas“ + -in-.','Vardo reikšmė: Vardadienis: Vasario 15., liepos 29 d.',' Faustinas yra lotynų kilmės vardas.'),(801,'Florentinas',' Florentinas yra Vyriškas vardas.','Trumpa reikšmė: „žydinti, -is“.','Vardo reikšmė: Florentinas – (2) lot., trump. Florentas, Floras, iš lot. Florentinus, kuris yra priesagos -inus vedinys iš Florentius, žr. Florentas.',' Florentinas yra lotynų kilmės vardas.'),(802,'Faustina',' Faustina yra Moteriškas vardas.','Trumpa reikšmė: faustus „laimingas“ + -in-.','Vardo reikšmė: Faustina – (2) lot., trump. Fausta, iš lot. Faustina, kuris iš vyr. v. Faustinus, žr. Faustinas.',' Faustina yra lotynų kilmės vardas.'),(803,'Floras',' Floras yra Vyriškas vardas.','Trumpa reikšmė: „žydinti, -is“.','Vardo reikšmė: Floras – (2) lot., tarm. Flioras, Pliorus piet. aukšt. (dz.), iš lot. Florus: lot. florus „žydintis“.',' Floras yra lotynų kilmės vardas.'),(804,'Faustas',' Faustas yra Vyriškas vardas.','Trumpa reikšmė: faustus „laimingas“.','Vardo reikšmė: Faustai taupūs, bet jiems pinigai nėra taip aktualu kaip dvasiniai turtai. Faustai labai religingi, tikintys karma.',' Faustas yra lotynų kilmės vardas.'),(805,'Florentina',' Florentina yra Moteriškas vardas.','Trumpa reikšmė: „žydinti, -is“.','Vardo reikšmė: Florentina – (2) lot., trump. Florenta, Flora, iš lot. Florentina, kuris iš vyr. v. Florentinus, žr. Florentinas.',' Florentina yra lotynų kilmės vardas.'),(806,'Flora',' Flora yra Moteriškas vardas.','Trumpa reikšmė: „žydinti, -is“.','Vardo reikšmė: Flora – (2) lot., iš lot. Flora, kuris iš mitologinio v. Flora — sen. italikų žiedų, pavasario ir jaunystės deivė: lot. flora „žydinti“.',' Flora yra lotynų kilmės vardas.'),(807,'Firminas',' Firminas yra Vyriškas vardas.','Trumpa reikšmė: firmus „tvirtas, stiprus“.','Vardo reikšmė: Jūs užsispyrę darbuotojai, lengvai apsikraunantys įvairiausiais darbais; jūsų rankose negalimas tampa galimu. Jūs intravertai, labai kantrūs, rimti ir melancholiškai nusiteikę žmonės.',' Firminas yra lotynų kilmės vardas.'),(808,'Flavija',' Flavija yra Moteriškas vardas.','Trumpa reikšmė: flavus „geltonas, aukso spalvos“.','Vardo reikšmė: Šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas, sugeba būti labai svetingas. Esant reikalui, gali būti labai drąsus ir labai užsispyręs. ',' Flavija yra lotynų kilmės vardas.'),(809,'Firmas',' Firmas yra Vyriškas vardas.','Trumpa reikšmė: firmus „tvirtas, stiprus“.','Vardo reikšmė: Jūs užsispyrę darbuotojai, lengvai apsikraunantys visokiausiais darbais; jūsų rankose negalimas tampa galimu. Jūs intravertai, labai kantrūs, rimti ir melancholiškai nusiteikę žmonės.',' Firmas yra lotynų kilmės vardas.'),(810,'Firmina',' Firmina yra Moteriškas vardas.','Trumpa reikšmė: firmus „tvirtas, stiprus“.','Vardo reikšmė: Jūs užsispyrę darbuotojai, lengvai apsikraunantys įvairiausiais darbais; jūsų rankose negalimas tampa galimu. Jūs intravertai, labai kantrūs, rimti ir melancholiškai nusiteikę žmonės. ',' Firmina yra lotynų kilmės vardas.'),(811,'Filomenas',' Filomenas yra Vyriškas vardas.','Trumpa reikšmė: „mylimas, -a“.','Vardo reikšmė: Filomenas – (2) graik., trump. Filas, iš sulotyninto graik. Philomenus: graik. philamenos „mylimas“.',' Filomenas yra graikų kilmės vardas.'),(812,'Filomena',' Filomena yra Moteriškas vardas.','Trumpa reikšmė: „mylimas, -a“.','Vardo reikšmė: Filomenos labai mėgsta tvarką ir discipliną. Jos paklūsta protingiems įsakymams. Nori, kad visi jų pavaldiniai elgtųsi panašiai kaip ir jos. Dėl to kartais iškyla problemų, nes namuose jos pavirsta tironėmis ir diktatorėmis.',' Filomena yra graikų kilmės vardas.'),(813,'Filomela',' Filomela yra Moteriškas vardas.','Trumpa reikšmė: „lakštingala“.','Vardo reikšmė: Filomela – (2) graik., trump. Filė, iš sulotyninto graik. Philomela, kuris iš graik. Philomele — „lakštingala“.',' Filomela yra graikų kilmės vardas.'),(814,'Fidentas',' Fidentas yra Vyriškas vardas.','Trumpa reikšmė: fidens „ištikimas“.','Vardo reikšmė: Fidentas – (2) lot., trump. Fidas iš lot. Fidentius, Fidens: lot. fidens (kilm. fidentis) „ištikimas“.',' Fidentas yra lotynų kilmės vardas.'),(815,'Fidelis',' Fidelis yra Vyriškas vardas.','Trumpa reikšmė: lotynų fidelis „ištikimas“.','Vardo reikšmė: Fideliai mėgsta labai įvairų ir nuolat besikeičiantį darbą. Kadangi mėgsta keliauti, tai gali būti kelionių agentūrų vadovais, kurjeriais, detektyvais. Traukia juos ir menai. Gali būti įvairių draugijų mecenatai. Tinka jiems ir politiko gyvenimas.',' Fidelis yra lotynų kilmės vardas.'),(816,'Gailutis',' Gailutis yra Vyriškas vardas.','Trumpa reikšmė: gailas „stiprus, smarkus“ + -ut- (mažybinė priesaga).','Vardo reikšmė: Gailutis – (2) liet., trump. Gailius, priesagos -utis vedinys iš sen. trump. Gailas.',' Gailutis yra lietuvių kilmės vardas.'),(817,'Gailius',' Gailius yra Vyriškas vardas.','Trumpa reikšmė: vardų Gailigedas (-ė), Gailiminas (-a, -ė), Gailutis (-ė) ir pan. trumpiniai: gailas „stiprus, smarkus“.','Vardo reikšmė: Gailius – (2) liet., trumpinys iš Gailigedas, Gailiminas ir kt.',' Gailius yra lietuvių kilmės vardas.'),(818,'Gailutė',' Gailutė yra Moteriškas vardas.','Trumpa reikšmė: gailas „stiprus, smarkus“ + -ut- (mažybinė priesaga).','Vardo reikšmė: Gailutė – (2) liet., trump. Gailė, iš vyr. v. Gailutis.',' Gailutė yra lietuvių kilmės vardas.'),(819,'Gailintas',' Gailintas yra Vyriškas vardas.','Trumpa reikšmė: gailas „stiprus, smarkus“, iš ežero pavadinimo (Merkinėje).','Vardo reikšmė: Gailintas – (1) liet., trump. Gailas, iš ežero vardo Gailintas (Merkinė)',' Gailintas yra lietuvių kilmės vardas.'),(820,'Gailiminas',' Gailiminas yra Vyriškas vardas.','Trumpa reikšmė: liet. ir prūs., trump. Gailius, gaili- (žr. Gailigedas) + min- (: liet. min-ti, min-ėti).','Vardo reikšmė: Gailiminas – (2) liet. ir prūs., trump. Gailius, gaili- (žr. Gailigedas) + min- (: liet. min-ti, min-ėti).',' Gailiminas yra prūsų kilmės vardas.'),(821,'Gailimantas',' Gailimantas yra Vyriškas vardas.','Trumpa reikšmė: „turtas“.','Vardo reikšmė: Gailimantas (1) liet., trump. Gailius, gaili- (žr. Gailigedas) + mant- (: liet. mant-us „sumanus“, mant-a „turtas“).',' Gailimantas yra lietuvių kilmės vardas.'),(822,'Gailimantė',' Gailimantė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Gailė, iš vyr. v. Gailimantas.','Vardo reikšmė: Gailimantė (1) liet., trump. Gailė, iš vyr. v. Gailimantas.',' Gailimantė yra lietuvių kilmės vardas.'),(823,'Gailigedas',' Gailigedas yra Vyriškas vardas.','Trumpa reikšmė: gailas „stiprus, smarkus“ + ged- (gedėti „ilgėtis“).','Vardo reikšmė: Gailigedas – (1) liet., trump. Gailius, gaili- (: liet. gailas „smarkus, stiprus“) + ged- (:liet. ged-auti „ilgėtis“).',' Gailigedas yra lietuvių kilmės vardas.'),(824,'Gailigedė',' Gailigedė yra Moteriškas vardas.','Trumpa reikšmė: gailas „stiprus, smarkus“ + ged- (gedėti „ilgėtis“).','Vardo reikšmė: Gailigedė – (1) liet., trump. Gailė, iš vyr. v. Gailigedas.',' Gailigedė yra lietuvių kilmės vardas.'),(825,'Gailenis',' Gailenis yra Vyriškas vardas.','Trumpa reikšmė: gailas „stiprus, smarkus“.','Vardo reikšmė: Šie vardo turėtojai turtus kraunasi rizikuodami finansinėmis akcijomis ir įkyriomis avantiūromis. Netgi patyrę pralaimėjimą, tokie žmonės sugeba vėl atkurti save. Pavojaus minutėmis jų fizinės jėgos labai padidėja.',' Gailenis yra lietuvių kilmės vardas.'),(826,'Gailenė',' Gailenė yra Moteriškas vardas.','Trumpa reikšmė: gailas „stiprus, smarkus“.','Vardo reikšmė: Šie vardo turėtojai turtus kraunasi rizikuodami finansinėmis akcijomis ir įkyriomis avantiūromis. Netgi patyrę pralaimėjimą, tokie žmonės sugeba vėl atkurti save. Pavojaus minutėmis jų fizinės jėgos labai padidėja.',' Gailenė yra lietuvių kilmės vardas.'),(827,'Gailas',' Gailas yra Vyriškas vardas.','Trumpa reikšmė: liet., trumpinys iš Gailigedas, Gailiminas.','Vardo reikšmė: Šie vardo savininkai mielai priima draugų pagalbą ne vien žodžiais, bet ir pinigais. Neteisingai panaudotos seksualinės energijos pertekliai gali jiems sutrikdyti sveikatą ir ištuštinti pinigines.',' Gailas yra lietuvių kilmės vardas.'),(828,'Gailė',' Gailė yra Moteriškas vardas.','Trumpa reikšmė: vardų Gailigedas (-ė), Gailiminas (-a, -ė), Gailutis (-ė) ir pan. trumpiniai: gailas „stiprus, smarkus“.','Vardo reikšmė: Šie vardo savininkai mielai priima draugų pagalbą ne vien žodžiais, bet ir pinigais. Neteisingai panaudotos seksualinės energijos pertekliai gali jiems sutrikdyti sveikatą ir ištuštinti pinigines.',' Gailė yra lietuvių kilmės vardas.'),(829,'Gaila',' Gaila yra Moteriškas vardas.','Trumpa reikšmė: vardų Gailigedas (-ė), Gailiminas (-a, -ė), Gailutis (-ė) ir pan. trumpiniai: gailas „stiprus, smarkus“.','Vardo reikšmė: Šie vardo savininkai mielai priima draugų pagalbą ne vien žodžiais, bet ir pinigais. Neteisingai panaudotos seksualinės energijos pertekliai gali jiems sutrikdyti sveikatą ir ištuštinti pinigines.',' Gaila yra lietuvių kilmės vardas.'),(830,'Galintas',' Galintas yra Vyriškas vardas.','Trumpa reikšmė: „galingas, daug galintis (-i)“.','Vardo reikšmė: Šie vardo turėtojai turtus kraunasi rizikuodami finansinėmis akcijomis ir įkyriomis avantiūromis. Netgi patyrę pralaimėjimą, tokie žmonės sugeba vėl atkurti save. Pavojaus minutėmis jų fizinės jėgos labai padidėja.',' Galintas yra lietuvių kilmės vardas.'),(831,'Galintė',' Galintė yra Moteriškas vardas.','Trumpa reikšmė: „galingas, daug galintis (-i)“.','Vardo reikšmė: Šie vardo turėtojai turtus kraunasi rizikuodami finansinėmis akcijomis ir įkyriomis avantiūromis. Netgi patyrę pralaimėjimą, tokie žmonės sugeba vėl atkurti save. Pavojaus minutėmis jų fizinės jėgos labai padidėja.',' Galintė yra lietuvių kilmės vardas.'),(832,'Galindas',' Galindas yra Vyriškas vardas.','Trumpa reikšmė: gal- (galėti, gali).','Vardo reikšmė: Galindas – (1) suliet. prūs., iš prūs. genties vardo galindai (vns. galindas).',' Galindas yra lietuvių kilmės vardas.'),(833,'Galindė',' Galindė yra Moteriškas vardas.','Trumpa reikšmė: gal- (galėti, gali).','Vardo reikšmė: Galindė – (1) suliet. prūs., iš vyr. v. Galindas.',' Galindė yra lietuvių kilmės vardas.'),(834,'Galia',' Galia yra Moteriškas vardas.','Trumpa reikšmė: galia „jėga, galybė“.','Vardo reikšmė: Jums labai reikšmingi faktai. Jūsų mintys ir veiksmai labai greiti, tačiau nedažnai įdiegiami praktiškai. Turite labai aiškų mąstymo būdą, atvirą charakterį. Mėgstate keisti profesijas, turite polinkį įsigyti kelias profesijas. Karjera jums labai daug ką reiškia.',' Galia yra lietuvių kilmės vardas.'),(835,'Gaja',' Gaja yra Moteriškas vardas.','Trumpa reikšmė: gaji „ištverminga, patvari“.','Vardo reikšmė: Jums labai reikšmingi faktai. Jūsų mintys ir veiksmai labai greiti, tačiau nedažnai įdiegiami praktiškai. Turite labai aiškų mąstymo būdą, atvirą charakterį. Mėgstate keisti profesijas, turite polinkį įsigyti kelias profesijas. Karjera jums labai daug ką reiškia.',' Gaja yra lietuvių kilmės vardas.'),(836,'Gaivys',' Gaivys yra Vyriškas vardas.','Trumpa reikšmė: liet., trumpinys iš Gaivilas.','Vardo reikšmė: Gaivys – (4) liet., trumpinys iš Gaivilas ir kt. ',' Gaivys yra lietuvių kilmės vardas.'),(837,'Gaivilė',' Gaivilė yra Moteriškas vardas.','Trumpa reikšmė: gai- (gaivus) + vil- (viltis).','Vardo reikšmė: Vardadienis: Sausio 24 d., spalio 8 d.',' Gaivilė yra lietuvių kilmės vardas.'),(838,'Gaivilas',' Gaivilas yra Vyriškas vardas.','Trumpa reikšmė: gai- (gaivus) + vil- (viltis).','Vardo reikšmė: Gaivilas – (1) liet., trump. Gaivys: gai- (: liet. gajus, gaivus) + vil- (: liet. vil-tis, vil-iasi, vil-tis).',' Gaivilas yra lietuvių kilmės vardas.'),(839,'Gaivenis',' Gaivenis yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Gaivys, priesagos -enis vedinys iš sen. trump. Gaivys.','Vardo reikšmė: Jums labai reikšmingi faktai. Jūsų mintys ir veiksmai labai greiti, tačiau nedažnai įdiegiami praktiškai. Turite labai aiškų mąstymo būdą, atvirą charakterį. Mėgstate keisti profesijas, turite polinkį įsigyti kelias profesijas. Karjera jums labai daug ką reiškia.',' Gaivenis yra lietuvių kilmės vardas.'),(840,'Gaivenė',' Gaivenė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Gaivė, iš vyr. v. Gaivenis.','Vardo reikšmė: Jums labai reikšmingi faktai. Jūsų mintys ir veiksmai labai greiti, tačiau nedažnai įdiegiami praktiškai. Turite labai aiškų mąstymo būdą, atvirą charakterį. Mėgstate keisti profesijas, turite polinkį įsigyti kelias profesijas. Karjera jums labai daug ką reiškia.',' Gaivenė yra lietuvių kilmės vardas.'),(841,'Gaivė',' Gaivė yra Moteriškas vardas.','Trumpa reikšmė: liet., trumpinys iš mot. v. Gaivilė.','Vardo reikšmė: Jus traukia politika ir bet kokia atvira visuomeninė veikla. Tai puikūs oratoriai, sugebantys žmones patraukti savo idėjomis. Visada praktiški, aktyvūs ir geri organizatoriai. Siekia prestižinio išsilavinimo.',' Gaivė yra lietuvių kilmės vardas.'),(842,'Gaiva',' Gaiva yra Moteriškas vardas.','Trumpa reikšmė: gaivi – „ta kuri gaivi, gyvybiška“.','Vardo reikšmė: Jus traukia politika ir bet kokia atvira visuomeninė veikla. Tai puikūs oratoriai, sugebantys žmones patraukti savo idėjomis. Visada praktiški, aktyvūs ir geri organizatoriai. Siekia prestižinio išsilavinimo.',' Gaiva yra lietuvių kilmės vardas.'),(843,'Gaudė',' Gaudė yra Moteriškas vardas.','Trumpa reikšmė: liet., trumpinys iš mot. v. Gaudrimė, Gaudvyda, Gaudvilė.','Vardo reikšmė: Jūsų mokslo žinios pasitarnauja jų garbei bei gerovei. Gera intuicija leidžia planuoti tolimą ateitį. Labai mokate prisiderinti prie žymiausių autoritetų. jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai.',' Gaudė yra lietuvių kilmės vardas.'),(844,'Gasparas',' Gasparas yra Vyriškas vardas.','Trumpa reikšmė: „iždininkas“.','Vardo reikšmė: Šių vardų savininkai visada randasi pačios triukšmingiausios kompanijos centre, mėgsta papasakoti keistų istorijų ar anekdotų. Jūs – aštrialiežuviai, linksmi, išradingi ir nesugebate nė minutei būti ramūs.',' Gasparas yra lotynų kilmės vardas.'),(845,'Gaudas',' Gaudas yra Vyriškas vardas.','Trumpa reikšmė: liet., trumpinys iš Gaudrimas, Gaudvydas, Gaudvilas ir kt.','Vardo reikšmė: Jūsų mokslo žinios pasitarnauja jų garbei bei gerovei. Gera intuicija leidžia planuoti tolimą ateitį. Labai mokate prisiderinti prie žymiausių autoritetų. jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai.',' Gaudas yra lietuvių kilmės vardas.'),(846,'Garsė',' Garsė yra Moteriškas vardas.','Trumpa reikšmė: „garsi“.','Vardo reikšmė: Garsė – (2) liet., galūnės vedinys iš liet. garsi.',' Garsė yra lietuvių kilmės vardas.'),(847,'Gantautas',' Gantautas yra Vyriškas vardas.','Trumpa reikšmė: gan- (ganyti „saugoti“) + taut- (tauta).','Vardo reikšmė: Gantautas – (1) liet., trump. Gantas, gan- (: liet. gan-yti „saugoti, plg. ginti)+ taut- (: liet. taut-a).',' Gantautas yra lietuvių kilmės vardas.'),(848,'Gantautė',' Gantautė yra Moteriškas vardas.','Trumpa reikšmė: gan- (ganyti „saugoti“) + taut- (tauta).','Vardo reikšmė: Gantautė – (1) liet., trump. Ganta, Gante, iš vyr. v. Gantautas.',' Gantautė yra lietuvių kilmės vardas.'),(849,'Gantas',' Gantas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Gantautas, Gantautė: gan- (ganyti „saugoti“) + taut- (tauta) – „saugantis tautą“.','Vardo reikšmė: Gantas – (2) liet., trumpinys iš avd. Gantautas.',' Gantas yra lietuvių kilmės vardas.'),(850,'Gandė',' Gandė yra Moteriškas vardas.','Trumpa reikšmė: „žinia, garsas“.','Vardo reikšmė: Jūs iš prigimties užprogramuoti lyderiai. jūs nepriklausomi ir individualūs, bet kokia kaina trokštantys garbės. labai judrūs, energingi, nenustygstantys vietoje, linksmi, draugiški.',' Gandė yra lietuvių kilmės vardas.'),(851,'Galmantė',' Galmantė yra Moteriškas vardas.','Trumpa reikšmė: gal- (galėti, gali) + mant- (mantus „sumanus“).','Vardo reikšmė: Vardadienis: Kovo 7 d., rugsėjo 18 d.',' Galmantė yra lietuvių kilmės vardas.'),(852,'Gaudvinas',' Gaudvinas yra Vyriškas vardas.','Trumpa reikšmė: dangus „dangiškoji, dangiškasis“.','Vardo reikšmė: Gaudvinas – (1) liet., trump. Gaudas, gaud- (žr. Gaudrimas) + vin- (sen. liet. vin- su balsių kaita iš vaina „kaltė, priežastis“).',' Gaudvinas yra lietuvių kilmės vardas.'),(853,'Gaudvilas',' Gaudvilas yra Vyriškas vardas.','Trumpa reikšmė: gaud- (gaudyti) + vil- (viltis).','Vardo reikšmė: Gaudvilas – (1) liet. ir prūs., trump. Gaudas, gaud- (žr. Gaudrimas) + vil- (žr. Gaivilas).',' Gaudvilas yra lietuvių kilmės vardas.'),(854,'Gaudvilė',' Gaudvilė yra Moteriškas vardas.','Trumpa reikšmė: gaud- (gaudyti) + vil- (viltis).','Vardo reikšmė: Gaudvilė – (1), (2) liet., trump. Gaudė, iš vyr. v. Gaudvilas.',' Gaudvilė yra lietuvių kilmės vardas.'),(855,'Gaudvydas',' Gaudvydas yra Vyriškas vardas.','Trumpa reikšmė: gaud- (gaudyti) + vyd- (iš-vyd).','Vardo reikšmė: Gaudvydas – (1) liet., trump. Gaudas, gaud- (žr. Gaudrimas) + vyd- (žr. Galvydas).',' Gaudvydas yra lietuvių kilmės vardas.'),(856,'Gedgantas',' Gedgantas yra Vyriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + gant- (ganyti „saugoti“).','Vardo reikšmė: Gedgantas – (1) liet., trump. Gedas, ged- (žr. Gedartas) + gant- (žr. Gantautas).',' Gedgantas yra lietuvių kilmės vardas.'),(857,'Gaudvaišas',' Gaudvaišas yra Vyriškas vardas.','Trumpa reikšmė: liet. ir prūs., trump. Gaudas, gaud- (žr. Gaudrimas) + vaiš- (:liet. vaiš-ės, plg. viešė — sen. reikšme „kiemas, kaimas“).','Vardo reikšmė: Šie vardo turėtojai turtus kraunasi rizikuodami finansinėmis akcijomis ir įkyriomis avantiūromis. Netgi patyrę pralaimėjimą, tokie žmonės sugeba vėl atkurti save. Pavojaus minutėmis jų fizinės jėgos labai padidėja.',' Gaudvaišas yra lietuvių kilmės vardas.'),(858,'Gedgailė',' Gedgailė yra Moteriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + gail- (gailas „stiprus, smarkus“).','Vardo reikšmė: Gedgailė – (1) liet., trump. Gedė, iš vyr. avd. Gedgaila, žr. Gedgailas.',' Gedgailė yra lietuvių kilmės vardas.'),(859,'Gedgailas',' Gedgailas yra Vyriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + gail- (gailas „stiprus, smarkus“).','Vardo reikšmė: Gedgailas – (1) liet., sen. var. Gedgaila, trump. Gedas, ged- (žr. Gedartas) + gail- (žr. Gailigedas).',' Gedgailas yra lietuvių kilmės vardas.'),(860,'Gedrimas',' Gedrimas yra Vyriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + rim- (rimti).','Vardo reikšmė: Gedrimas – (1) liet., trump. Gedas, Gedrys, ged- (žr. Gedartas) + rim- (žr. Gaudrimas).',' Gedrimas yra lietuvių kilmės vardas.'),(861,'Gaudrimė',' Gaudrimė yra Moteriškas vardas.','Trumpa reikšmė: gaud- (gaudyti) + rim- (rimti).','Vardo reikšmė: Gaudrimė – (1) liet., trump. Gaudrė, iš vyr. v. Gaudrimas.',' Gaudrimė yra lietuvių kilmės vardas.'),(862,'Gedenis',' Gedenis yra Vyriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + -en-.','Vardo reikšmė: Gedenis – (2) liet., trump. Gedas, priesagos -enis vedinys iš sen. trump. Gedas.',' Gedenis yra lietuvių kilmės vardas.'),(863,'Gedmintas',' Gedmintas yra Vyriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + mint- (minti, mintis) – „tas, kurio ilgimasi mintyse, kuris minimas“.','Vardo reikšmė: Gedmintas – (1) liet., trump. Gedas, Gedmas, ged- (žr. Gedartas) + mint- (: liet. minti, mena, mint-is).',' Gedmintas yra lietuvių kilmės vardas.'),(864,'Gaudrimas',' Gaudrimas yra Vyriškas vardas.','Trumpa reikšmė: gaud- (gaudyti) + rim- (rimti).','Vardo reikšmė: Gaudrimas – (1) liet., trump. Gaudrys, Gaudrius, gaud- (: liet. gaud-yti, plg. gau-ti) + rim- (: liet. rim-ti).',' Gaudrimas yra lietuvių kilmės vardas.'),(865,'Gedenė',' Gedenė yra Moteriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + -en-.','Vardo reikšmė: Gedenė – (2) liet., trump. Gedė, iš vyr. v. Gedenis.',' Gedenė yra lietuvių kilmės vardas.'),(866,'Gaudrė',' Gaudrė yra Moteriškas vardas.','Trumpa reikšmė: trumpiniai iš Gaudrimė, Gaudrimas: gaud- (gaudyti) + rim- (rimti) – „gaudantis rimtį, ieškantis ramybės“.','Vardo reikšmė: Gaudrė – (2) liet., trumpinys iš mot. v. Gaudrimė.',' Gaudrė yra lietuvių kilmės vardas.'),(867,'Gedbutė',' Gedbutė yra Moteriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Gedbutė – (1) liet., trump. Gedė, iš vyr. v. Gedbutas.',' Gedbutė yra lietuvių kilmės vardas.'),(868,'Gaudilė',' Gaudilė yra Moteriškas vardas.','Trumpa reikšmė: gaud- (gaudyti).','Vardo reikšmė: Gaudilė – (1), (2) suliet. prūs., trump. Gaudė, iš vyr. v. Gaudilas.',' Gaudilė yra lietuvių kilmės vardas.'),(869,'Gedbutas',' Gedbutas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Gedas, ged- (žr. Gedartas) + but- (: liet. but-as, būti).','Vardo reikšmė: Gedbutas – (1) liet., trump. Gedas, ged- (žr. Gedartas) + but- (: liet. but-as, būti).',' Gedbutas yra lietuvių kilmės vardas.'),(870,'Gaudilas',' Gaudilas yra Vyriškas vardas.','Trumpa reikšmė: gaud- (gaudyti).','Vardo reikšmė: (1) suliet. prūs., trump. Gaudas, priesagos -ilas vedinys iš sen. trump. Gaudas',' Gaudilas yra lietuvių kilmės vardas.'),(871,'Gedminas',' Gedminas yra Vyriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + min- (minėti).','Vardo reikšmė: Gedminas – (1) liet., trump. Gedas, Gedmas, ged- (žr. Gedartas) + min- (žr. Gailiminas).',' Gedminas yra lietuvių kilmės vardas.'),(872,'Gaudenis',' Gaudenis yra Vyriškas vardas.','Trumpa reikšmė: gaud- (gaudyti, gauti) – „gaunantis, pats savo laimę gaudantis“.','Vardo reikšmė: Gaudenis – (2) suliet. prūs., priesagos -enis vedinys iš sen. trump. Gaudas.',' Gaudenis yra lietuvių kilmės vardas.'),(873,'Gedautė',' Gedautė yra Moteriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + -aut-.','Vardo reikšmė: Jūs užsispyrę darbuotojai, lengvai apsikraunantys įvairiausiais darbais; jūsų rankose negalimas tampa galimu. Jūs intravertai, labai kantrūs, rimti ir melancholiškai nusiteikę žmonės.',' Gedautė yra lietuvių kilmės vardas.'),(874,'Gedvyga',' Gedvyga yra Moteriškas vardas.','Trumpa reikšmė: suliet. vok., trump. Gedvė, tarm. Gedvyga, Gedvisė vak. žem., sulietuvinta vok. vardo Hedwig forma, žr. Jadvyga.','Vardo reikšmė: Gedvyga – (2) suliet. vok., trump. Gedvė, tarm. Gedvyga, Gedvisė vak. žem., sulietuvinta vok. vardo Hedwig forma, žr. Jadvyga.',' Gedvyga yra vokiečių kilmės vardas.'),(875,'Gedvydas',' Gedvydas yra Vyriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + vyd- (iš-vydo).','Vardo reikšmė: Gedvydas – (1) liet., trump. Gedas, Gedvas, ged- (žr. Gedartas) + vyd- (žr. Galvydas).',' Gedvydas yra lietuvių kilmės vardas.'),(876,'Gedautas',' Gedautas yra Vyriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + -aut-.','Vardo reikšmė: Jūs užsispyrę darbuotojai, lengvai apsikraunantys įvairiausiais darbais; jūsų rankose negalimas tampa galimu. Jūs intravertai, labai kantrūs, rimti ir melancholiškai nusiteikę žmonės.',' Gedautas yra lietuvių kilmės vardas.'),(877,'Gaudenė',' Gaudenė yra Moteriškas vardas.','Trumpa reikšmė: gaud- (gaudyti, gauti) – „gaunantis, pats savo laimę gaudantis“.','Vardo reikšmė: Gaudenė – (2) suliet. prūs., trump. Gaudė, iš vyr. v. Gaudenis.',' Gaudenė yra lietuvių kilmės vardas.'),(878,'Gedmilė',' Gedmilė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Gedė, Gedmė, iš vyr. v. Gedmilas.','Vardo reikšmė: Jums sekasi nes sapnuojate nuostabius sapnus, iš kurių kartais galite passisemti naujų idėjų. Stengiatės suprasti slaptą sapnų esmę, gilinatės į ezoterikos paslaptis.',' Gedmilė yra lietuvių kilmės vardas.'),(879,'Gedas',' Gedas yra Vyriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“).','Vardo reikšmė: Gedai trokšta meilės ir giliai išgyvena, tačiau jie perdaug uždari, kad atskleistų savo jausmus. Užuot kalbėję apie jausmus, stengiasi tai įrodyti darbais. Įsidrąsina išreikšti savo jausmus tik tada, kai tvirtai įsitikina, kad nebus atstumti.',' Gedas yra lietuvių kilmės vardas.'),(880,'Gedmilas',' Gedmilas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Gedas, Gedmas, ged- (žr. Gedartas) + mil- (: liet. pa-mil-ti).','Vardo reikšmė: Jums sekasi nes sapnuojate nuostabius sapnus, iš kurių kartais galite passisemti naujų idėjų. Stengiatės suprasti slaptą sapnų esmę, gilinatės į ezoterikos paslaptis. ',' Gedmilas yra lietuvių kilmės vardas.'),(881,'Gedvė',' Gedvė yra Moteriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Gedvyga.','Vardo reikšmė: Gedvė – (2) liet. trumpinys iš Gedvyga.',' Gedvė yra lietuvių kilmės vardas.'),(882,'Gedvardas',' Gedvardas yra Vyriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + vard- (varduoti „burti“).','Vardo reikšmė: Gedvardas – (1) liet., trump. Gedas, Gedvas, ged- (žr. Gedartas) + vard- (: liet. varduoti „burti“).',' Gedvardas yra lietuvių kilmės vardas.'),(883,'Gedmantė',' Gedmantė yra Moteriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + mant- (mantus „sumanus“).','Vardo reikšmė: Gedmantė – (1) liet., trump. Gedė, Gedmė, iš vyr. v. Gedmantas.',' Gedmantė yra lietuvių kilmės vardas.'),(884,'Gedartė',' Gedartė yra Moteriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + tar- (tarti) – „tas, kurio ilgimasi, kurio vardas nuolat tariamas“.','Vardo reikšmė: Šie vardo turėtojai turtus kraunasi rizikuodami finansinėmis akcijomis ir įkyriomis avantiūromis. Netgi patyrę pralaimėjimą, tokie žmonės sugeba vėl atkurti save. Pavojaus minutėmis jų fizinės jėgos labai padidėja.',' Gedartė yra lietuvių kilmės vardas.'),(885,'Gedmantas',' Gedmantas yra Vyriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + mant- (mantus „sumanus“).','Vardo reikšmė: Šie vardo savininkai mielai priima draugų pagalbą ne vien žodžiais, bet ir pinigais. Neteisingai panaudotos seksualinės energijos pertekliai gali jiems sutrikdyti sveikatą ir ištuštinti pinigines.',' Gedmantas yra lietuvių kilmės vardas.'),(886,'Gedartas',' Gedartas yra Vyriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + tar- (tarti) – „tas, kurio ilgimasi, kurio vardas nuolat tariamas“.','Vardo reikšmė: Šie vardo turėtojai turtus kraunasi rizikuodami finansinėmis akcijomis ir įkyriomis avantiūromis. Netgi patyrę pralaimėjimą, tokie žmonės sugeba vėl atkurti save. Pavojaus minutėmis jų fizinės jėgos labai padidėja.',' Gedartas yra lietuvių kilmės vardas.'),(887,'Geismantė',' Geismantė yra Moteriškas vardas.','Trumpa reikšmė: gei- (geisti) + mant- (mantus „sumanus“).','Vardo reikšmė: Geismantė – (1) liet., trump. Geisma, Geismė, iš vyr. v. Geismantas.',' Geismantė yra lietuvių kilmės vardas.'),(888,'Geismantas',' Geismantas yra Vyriškas vardas.','Trumpa reikšmė: gei- (geisti) + mant- (mantus „sumanus“).','Vardo reikšmė: Geismantas – (1) liet., trump. Geismys, geis- (: liet. geis-ti) + mant- (žr. Gailimantas).',' Geismantas yra lietuvių kilmės vardas.'),(889,'Gedvaldė',' Gedvaldė yra Moteriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + vald- (valdyti) – „tas, kuris valdo ir kurio gedima (pasiilgstamas)“.','Vardo reikšmė: Jus traukia politika ir bet kokia atvira visuomeninė veikla. Tai puikūs oratoriai, sugebantys žmones patraukti savo idėjomis. Visada praktiški, aktyvūs ir geri organizatoriai. Siekia prestižinio išsilavinimo.',' Gedvaldė yra lietuvių kilmės vardas.'),(890,'Gausantė',' Gausantė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Gausė, iš upėvardžio Gausantė (Veliuona).','Vardo reikšmė: Jums labai reikšmingi faktai. Jūsų mintys ir veiksmai labai greiti, tačiau nedažnai įdiegiami praktiškai. Turite labai aiškų mąstymo būdą, atvirą charakterį. Mėgstate keisti profesijas, turite polinkį įsigyti kelias profesijas. Karjera jums labai daug ką reiškia.',' Gausantė yra lietuvių kilmės vardas.'),(891,'Gedvaldas',' Gedvaldas yra Vyriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + vald- (valdyti) – „tas, kuris valdo ir kurio gedima (pasiilgstamas)“.','Vardo reikšmė: Jus traukia politika ir bet kokia atvira visuomeninė veikla. Tai puikūs oratoriai, sugebantys žmones patraukti savo idėjomis. Visada praktiški, aktyvūs ir geri organizatoriai. Siekia prestižinio išsilavinimo.',' Gedvaldas yra lietuvių kilmės vardas.'),(892,'Gediminė',' Gediminė yra Moteriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + min- (minėti, mini) – „tas, kuris minimas, kurio ilgimasi).','Vardo reikšmė: Šių vardų savininkai visada randasi pačios triukšmingiausios kompanijos centre, mėgsta papasakoti keistų istorijų ar anekdotų. Jūs – aštrialiežuviai, linksmi, išradingi ir nesugebate nė minutei būti ramūs.',' Gediminė yra lietuvių kilmės vardas.'),(893,'Geidvilė',' Geidvilė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Geidė, iš vyr. v. Geidvilas.','Vardo reikšmė: Jūsų mokslo žinios pasitarnauja jų garbei bei gerovei. Gera intuicija leidžia planuoti tolimą ateitį. Labai mokate prisiderinti prie žymiausių autoritetų. jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai.',' Geidvilė yra lietuvių kilmės vardas.'),(894,'Gediminas',' Gediminas yra Vyriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + min- (minėti, mini) – „tas, kuris minimas, kurio ilgimasi).','Vardo reikšmė: Gediminai trokšta meilės ir giliai išgyvena, tačiau jie perdaug uždari, kad atskleistų savo jausmus. Užuot kalbėję apie jausmus, stengiasi tai įrodyti darbais. Įsidrąsina išreikšti savo jausmus tik tada, kai tvirtai įsitikina, kad nebus atstumti.',' Gediminas yra lietuvių kilmės vardas.'),(895,'Gedvainė',' Gedvainė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Gedė, Gedvė, iš vyr. v. Gedvainas.','Vardo reikšmė: Gedvainė – (1) liet., trump. Gedė, Gedvė, iš vyr. v. Gedvainas.',' Gedvainė yra lietuvių kilmės vardas.'),(896,'Geidvilas',' Geidvilas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Geidas, Geidys, geid- (žr. Geidbutas) + vil- (žr. Gaivilas).','Vardo reikšmė: Jūsų mokslo žinios pasitarnauja jų garbei bei gerovei. Gera intuicija leidžia planuoti tolimą ateitį. Labai mokate prisiderinti prie žymiausių autoritetų. jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai.',' Geidvilas yra lietuvių kilmės vardas.'),(897,'Gedvainas',' Gedvainas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Gedas, Gedvas, ged- (žr. Gedartas) + vain- (žr. Galvainas).','Vardo reikšmė: Gedvainas – (1) liet., trump. Gedas, Gedvas, ged- (žr. Gedartas) + vain- (žr. Galvainas).',' Gedvainas yra lietuvių kilmės vardas.'),(898,'Gedilė',' Gedilė yra Moteriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + -il- – „tas, kurio gedima, ilgimasi“.','Vardo reikšmė: Gedilė – (1), (2) liet. ir prūs., trump. Gedė, iš vyr. v. Gedilas.',' Gedilė yra lietuvių kilmės vardas.'),(899,'Geidutis',' Geidutis yra Vyriškas vardas.','Trumpa reikšmė: liet. ir prūs., trump. Geidas, Geidys, priesagos -utis vedinys iš sen. trump. Geidas, kuris iš Geidbutas, Geidvilas.','Vardo reikšmė: Geidutis – (2) liet. ir prūs., trump. Geidas, Geidys, priesagos -utis vedinys iš sen. trump. Geidas, kuris iš Geidbutas, Geidvilas ir kt.',' Geidutis yra lietuvių kilmės vardas.'),(900,'Gedilas',' Gedilas yra Vyriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + -il- – „tas, kurio gedima, ilgimasi“.','Vardo reikšmė: Gedilas – (1) liet. ir prūs., trump. Gedas, priesagos -ilas vedinys iš sen. trump. Gedas.',' Gedilas yra lietuvių kilmės vardas.'),(901,'Gedvaidas',' Gedvaidas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Gedas, Gedvas, ged- (žr. Gedartas) + vaid- (: liet. vaid-ytis, vaid-entis „rodytis“).','Vardo reikšmė: Gedvaidas – (1) liet., trump. Gedas, Gedvas, ged- (žr. Gedartas) + vaid- (: liet. vaid-ytis, vaid-entis „rodytis“).',' Gedvaidas yra lietuvių kilmės vardas.'),(902,'Geitautė',' Geitautė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Geitė, iš vyr. v. Geitautas.','Vardo reikšmė: Geitautė – (1) liet., trump. Geitė, iš vyr. v. Geitautas.',' Geitautė yra lietuvių kilmės vardas.'),(903,'Geidutė',' Geidutė yra Moteriškas vardas.','Trumpa reikšmė: liet. ir prūs., trump. Geidė, iš vyr. v. Geidutis.','Vardo reikšmė: Geidutė – (2) liet. ir prūs., trump. Geidė, iš vyr. v. Geidutis.',' Geidutė yra lietuvių kilmės vardas.'),(904,'Gedgaudas',' Gedgaudas yra Vyriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + gaud- (gaudyti).','Vardo reikšmė: (1) liet., trump. Gedas, ged- (žr. Gedartas) + gaud- (žr. Gaudrimas)',' Gedgaudas yra lietuvių kilmės vardas.'),(905,'Geitautas',' Geitautas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Geitys, gei- kilęs iš geid- (žr. Geidbutas) + taut- (žr. Gantautas).','Vardo reikšmė: Geitautas – (1) liet., trump. Geitys, gei- kilęs iš geid- (žr. Geidbutas) + taut- (žr. Gantautas).',' Geitautas yra lietuvių kilmės vardas.'),(906,'Gedutis',' Gedutis yra  vardas.','Trumpa reikšmė: liet. ir prūs., trump. Gedas, priesagos -utis vedinys iš Gedas.','Vardo reikšmė: Gedutis – (2) liet. ir prūs., trump. Gedas, priesagos -utis vedinys iš Gedas.',' Gedutis yra prūsų kilmės vardas.'),(907,'Geisvinas',' Geisvinas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Geisvys, geis- (žr. Geismantas) + vin- (žr. Gaudvinas).','Vardo reikšmė: Šie vardo turėtojai labai myli vaikus – tiek savus, tiek svetimus, tačiau be didesnio sentimentalumo. Vaikai jums – tas pats kas ir suaugę, tik laimingas vaikas turi savyje daugiau džiaugsmo, lūkesčių ateičiai.',' Geisvinas yra lietuvių kilmės vardas.'),(908,'Gema',' Gema yra Moteriškas vardas.','Trumpa reikšmė: gemma „brangakmenis“.','Vardo reikšmė: Jus globoja Saturnas. Jūsų mintys visada ramios, viskas apgalvota iki smulkmenų; retai kada pasireiškia impulsyvumas ir emocijos bei skubotumas. Jūs labai vertinate kiekvieną minutę ir kelyje į tikslą užimate tvirtą poziciją bei visada žinote, ko norite.',' Gema yra lotynų kilmės vardas.'),(909,'Geidė',' Geidė yra Moteriškas vardas.','Trumpa reikšmė: liet., trumpinys iš mot. v. Geidbutė, Geidvilė ir kt.','Vardo reikšmė: Jūsų gyvenimas kaip scenoje – jūsų replikos taiklios ir patikrintos, išvaizda nuo šukuosenos iki batų idealiai apgalvota. Savo esybe jūs esate ir niekada nepatenkinti tuo, ką turite. Visą laiką ieškote progų tobulėti.',' Geidė yra lietuvių kilmės vardas.'),(910,'Geidbutė',' Geidbutė yra Moteriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Geidė, iš vyr. v. Geidbutas.','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Kartais jie apie save suburia tvirtovės sieną, atskiriančią juos nuo aistrų ir instinktų, laikydami juos antraeiliais dalykais. Ir visgi jūsų protas bei energija nukreipti saviems egoistiniams tikslams įgyvendinti.',' Geidbutė yra lietuvių kilmės vardas.'),(911,'Gelvydas',' Gelvydas yra Vyriškas vardas.','Trumpa reikšmė: gel- (gelti „skaudėti“) + vyd- (iš-vydo) – „skausmo matęs“.','Vardo reikšmė: Gelvydas – (1) liet., trump. Gelvas, Gelvys, gel- (žr. Gelbutas) + vyd- (žr. Galvydas).',' Gelvydas yra lietuvių kilmės vardas.'),(912,'Gedutė',' Gedutė yra Moteriškas vardas.','Trumpa reikšmė: liet. ir prūs., trump. Gedė, iš vyr. v. Gedutis.','Vardo reikšmė: Gedutė – (2) liet. ir prūs., trump. Gedė, iš vyr. v. Gedutis.',' Gedutė yra lietuvių kilmės vardas.'),(913,'Geisvydas',' Geisvydas yra Vyriškas vardas.','Trumpa reikšmė: geis- (geisti) + (iš-vydo) – „išvydęs tai, ko geidžia“.','Vardo reikšmė: Šie vardo turėtojai labai myli vaikus – tiek savus, tiek svetimus, tačiau be didesnio sentimentalumo. Vaikai jums – tas pats kas ir suaugę, tik laimingas vaikas turi savyje daugiau džiaugsmo, lūkesčių ateičiai.',' Geisvydas yra lietuvių kilmės vardas.'),(914,'Geidbutas',' Geidbutas yra Vyriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Geidas, Geidys, geid- (: prūs. geide „laukti“, liet. geisti, geidė, pa-geid-duti) + but- (žr. Gedbutas).','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Kartais jie apie save suburia tvirtovės sieną, atskiriančią juos nuo aistrų ir instinktų, laikydami juos antraeiliais dalykais. Ir visgi jūsų protas bei energija nukreipti saviems egoistiniams tikslams įgyvendinti.',' Geidbutas yra prūsų kilmės vardas.'),(915,'Gedrimė',' Gedrimė yra Moteriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + rim- (rimti).','Vardo reikšmė: Gedrimė – (1) liet., trump. Gedė, Gedrė, iš vyr. v. Gedrimas.',' Gedrimė yra lietuvių kilmės vardas.'),(916,'Gelvardas',' Gelvardas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Gelvas, Gelvys, gel- (žr. Gelbutas) + vard- (žr. Gedvardas).','Vardo reikšmė: Gelvardas – (1) liet., trump. Gelvas, Gelvys, gel- (žr. Gelbutas) + vard- (žr. Gedvardas).',' Gelvardas yra lietuvių kilmės vardas.'),(917,'Gedvinas',' Gedvinas yra Vyriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + vin- (vaina „priežastis, kaltė“).','Vardo reikšmė: Gedvinas – (1) liet., trump. Gedas, Gedvys, ged- (žr. Gedartas) + vin- (žr. Gaudvinas).',' Gedvinas yra lietuvių kilmės vardas.'),(918,'Geistutis',' Geistutis yra Vyriškas vardas.','Trumpa reikšmė: liet. ir prūs., trump. Geistys, priesagos -utis vedinys iš sen. trump. Geistys, kuris iš Geistaras, Geistautas ir kt.','Vardo reikšmė: Jūsų vardo dieną valdo Venera. Pagrindinis jūsų bruožas – magnetizmas. Jūs stengiatės atitikti maksimalų galimybių potencialą. Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems.',' Geistutis yra lietuvių kilmės vardas.'),(919,'Geistutė',' Geistutė yra Moteriškas vardas.','Trumpa reikšmė: liet. ir prūs., trump. Geistė, iš vyr. v. Geistutis.','Vardo reikšmė: Jūsų vardo dieną valdo Venera. Pagrindinis jūsų bruožas – magnetizmas. Jūs stengiatės atitikti maksimalų galimybių potencialą. Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems.',' Geistutė yra lietuvių kilmės vardas.'),(920,'Geistys',' Geistys yra Vyriškas vardas.','Trumpa reikšmė: liet., trumpinys iš Geistaras, Geistartas ir kt.','Vardo reikšmė: Jūs galite būti geri teisininkai, medikai, literatūros tyrinėtojai, valstybės vadovai. Socialinis darbas, pedagogika, psichologija, netradicinė medicina – taip pat puikus pasirinkimas, nes jie moka visus išklausyti bei giliai analizuoti. Jus galite būti sapnų pasaulio aiškintojai.',' Geistys yra lietuvių kilmės vardas.'),(921,'Gedvilė',' Gedvilė yra Moteriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + vil- (viltis).','Vardo reikšmė: Jūsų gyvenimo verpetuose stipriausias noras – laiminga santuoka. Jūs puikūs originalių idėjų ir efektyvių sistemų šaltinis. Gyvenimas jums žavingas todėl, kad jūs patys suteikiate jam tam tikrą prieskonį.',' Gedvilė yra lietuvių kilmės vardas.'),(922,'Gelvainė',' Gelvainė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Gelvė, iš vyr. v. Gelvainas.','Vardo reikšmė: Gelvainė – (1) liet., trump. Gelvė, iš vyr. v. Gelvainas.',' Gelvainė yra lietuvių kilmės vardas.'),(923,'Geistenis',' Geistenis yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Geistys, priesagos -enis vedinys iš sen. trump. Geistys, kuris iš Geistaras, Geistautas ir kt..','Vardo reikšmė: Geistenis – (2) liet., trump. Geistys, priesagos -enis vedinys iš sen. trump. Geistys, kuris iš Geistaras, Geistautas ir kt.',' Geistenis yra lietuvių kilmės vardas.'),(924,'Gelminas',' Gelminas yra Vyriškas vardas.','Trumpa reikšmė: gel- (gelti širdį) + min- (minėti) – „tas kurio labai (skaudžiai) ilgimasi“.','Vardo reikšmė: (1) liet., trump. Gelmas, Gelmys, gel- (žr. Gelbutas) + min- (žr. Gailiminas)',' Gelminas yra lietuvių kilmės vardas.'),(925,'Gedvilas',' Gedvilas yra Vyriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + vil- (viltis).','Vardo reikšmė: Jūsų gyvenimo verpetuose stipriausias noras – laiminga santuoka. Jūs puikūs originalių idėjų ir efektyvių sistemų šaltinis. Gyvenimas jums žavingas todėl, kad jūs patys suteikiate jam tam tikrą prieskonį.',' Gedvilas yra lietuvių kilmės vardas.'),(926,'Gerimantė',' Gerimantė yra Moteriškas vardas.','Trumpa reikšmė: ger- (geras) + rim- (rimti).','Vardo reikšmė: Gerimantė – (1) liet., trump. Gerė, iš vyr. v. Gerimantas.',' Gerimantė yra lietuvių kilmės vardas.'),(927,'Geistenė',' Geistenė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Geistė, iš vyr. v. Geistenis.','Vardo reikšmė: Geistenė – (2) liet., trump. Geistė, iš vyr. v. Geistenis.',' Geistenė yra lietuvių kilmės vardas.'),(928,'Gerimantas',' Gerimantas yra Vyriškas vardas.','Trumpa reikšmė: ger- (geras) + rim- (rimti).','Vardo reikšmė: Gerimantas – (1) liet., trump. Geras, Gerys, geri- (: liet. geras) + mant- (žr. Gailimantas).',' Gerimantas yra lietuvių kilmės vardas.'),(929,'Geistė',' Geistė yra Moteriškas vardas.','Trumpa reikšmė: liet., trumpinys iš mot. v. Geistara, Geistautė ir kt.','Vardo reikšmė: Geistė – (2) liet., trumpinys iš mot. v. Geistara, Geistautė ir kt.',' Geistė yra lietuvių kilmės vardas.'),(930,'Gelgaudas',' Gelgaudas yra Vyriškas vardas.','Trumpa reikšmė: gel- (gelti širdį) + gaud- (gaudyti).','Vardo reikšmė: (1) liet., trump. Gelys, gel- (žr. Gelbutas) + gaud- (žr. Gaudrimas)',' Gelgaudas yra lietuvių kilmės vardas.'),(931,'Gerda',' Gerda yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Gertrūda, Gertrūdas: ger „ietis“ + trūt „stiprus, stipri“.','Vardo reikšmė: (1) vok., trumpinys iš Gertrūda',' Gerda yra vokiečių kilmės vardas.'),(932,'Geistautė',' Geistautė yra Moteriškas vardas.','Trumpa reikšmė: gei- (geisti) + taut- (tauta).','Vardo reikšmė: Geistautė – (1) liet. ir latv., trump. Geistė, iš vyr. v. Geistautas.',' Geistautė yra lietuvių kilmės vardas.'),(933,'Gerardas',' Gerardas yra Vyriškas vardas.','Trumpa reikšmė: vardas iš sen. vokiečių: „stiprus, drąsus“.','Vardo reikšmė: Gerardai turi ir blogybių. Viena jų – polinkis į egoizmą. Kartais gali būti ryžtingi, o kartais tiesiog užsispyrę. Dažnai kritikuoja kitus, teigdami, kad tie neturi pasiryžimo. Todėl toks iškreiptas supratimas gali atstumti nuo jų draugus ir šeimos narius.',' Gerardas yra vokiečių kilmės vardas.'),(934,'Geistautas',' Geistautas yra Vyriškas vardas.','Trumpa reikšmė: gei- (geisti) + taut- (tauta).','Vardo reikšmė: Geistautas – (1) liet. ir latv., trump. Geistys, geis- (žr. Geismantas) + taut- (žr. Gantautas).',' Geistautas yra lietuvių kilmės vardas.'),(935,'Geraldas',' Geraldas yra Vyriškas vardas.','Trumpa reikšmė: ger „ietis“ + altan „valdyti“ – „valdantis ietimi“.','Vardo reikšmė: Šie vardo turėtojai iš pažiūros atrodo abejingi viskam, tačiau tai tik elgesio maniera, po kuria slepiasi didžiuliai dvasiniai išgyvenimai. Jie emocijas slepia viduje, o tai greitai atsiliepia į jų sveikatą – virškinimo ir nervų sistemoms.',' Geraldas yra vokiečių kilmės vardas.'),(936,'Geistaras',' Geistaras yra Vyriškas vardas.','Trumpa reikšmė: liet. ir prūs., trump. Geistys, geis- (žr. Geismantas) + tar- (: liet. tar-ti, prūs. tar-in „balsas“).','Vardo reikšmė: Jūs labai atjaučiantys, todėl nėra geresnių slaugytojų už jus. Tačiau dvasinis mąstymas ribotas. Bažnyčią lankote tik dėl to, kad bijote, jog kiti gali blogai apie jus pagalvoti. Jūs puikiausiai suprantate savo prasižengimus šiame pasaulyje, tačiau anapusinis pasaulis jūsų nedomina.',' Geistaras yra prūsų kilmės vardas.'),(937,'Gėlė',' Gėlė yra Moteriškas vardas.','Trumpa reikšmė: liet.: liet. gėlė.','Vardo reikšmė: .',' Gėlė yra lietuvių kilmės vardas.'),(938,'Genovaitė',' Genovaitė yra Moteriškas vardas.','Trumpa reikšmė: geno „giminė“ + wefa „moteris“.','Vardo reikšmė: Genovaitė – (1) suliet. lot., trump. Genė, tarm. Ginutė, Genutė, Genusė ryt. aukšt., iš vid. lot. Genovefa, kuris greičiausiai yra germaniškos kilmės: germ. geno „giminė“ + wefa „moteris“.',' Genovaitė yra lotynų kilmės vardas.'),(939,'Gelbutas',' Gelbutas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Gelbas, gel- (: liet. gel-ti, gel-ia „skaudėti“) + but- (žr. Gedbutas).','Vardo reikšmė: Gelbutas – (1) liet., trump. Gelbas, gel- (: liet. gel-ti, gel-ia „skaudėti“) + but- (žr. Gedbutas).',' Gelbutas yra lietuvių kilmės vardas.'),(940,'Geivydas',' Geivydas yra Vyriškas vardas.','Trumpa reikšmė: geis- (geisti) + (iš-vydo) – „išvydęs tai, ko geidžia“.','Vardo reikšmė: Šie vardo turėtojai labai prisirišę prie šeimos. Sekso srityje jiems būtina dominuoti. Jei partnerei neprieštarauja, gali griebtis grubiausios fizinės jėgos. Kai jie susižavi ar kažko užsinori – geriau saugotis jų. Labai kūribingi ir užsispyrę žmonės.',' Geivydas yra lietuvių kilmės vardas.'),(941,'Genius',' Genius yra Vyriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Eugenijus ir kt.','Vardo reikšmė: Genius – (2) liet. trumpinys iš Eugenijus ir kt.',' Genius yra lietuvių kilmės vardas.'),(942,'Genė',' Genė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Genovaitė: geno „giminė“ + wefa „moteris“.','Vardo reikšmė: Genė – (2) liet. trumpinys iš Eugenė, Eugenija ir kt.',' Genė yra lotynų kilmės vardas.'),(943,'Gendvilė',' Gendvilė yra Moteriškas vardas.','Trumpa reikšmė: gend- (pasi- genda) + vil- (viltis).','Vardo reikšmė: Gendvilė – (1), (2) liet., trump. Gendė: iš vyr. v. Gendvilas.',' Gendvilė yra lietuvių kilmės vardas.'),(944,'Gendvilas',' Gendvilas yra Vyriškas vardas.','Trumpa reikšmė: gend- (pasi- genda) + vil- (viltis).','Vardo reikšmė: Gendvilas – (1) liet., trump. Gendas, Gendys, gend- (žr. Gendrimas) + vil- (žr. Gaivilas).',' Gendvilas yra lietuvių kilmės vardas.'),(945,'Gervydas',' Gervydas yra Vyriškas vardas.','Trumpa reikšmė: ger- (geras) + vyd- (iš-vydo).','Vardo reikšmė: Gervydas – (1) liet., trump. Gerys, ger- (žr. Germantas) + vyd- (žr. Galvydas).',' Gervydas yra lietuvių kilmės vardas.'),(946,'Gendrutis',' Gendrutis yra Vyriškas vardas.','Trumpa reikšmė: gend- (pasigenda) – „tas, kurio pasigendama“.','Vardo reikšmė: Gendrutis – (2) liet., trump. Gendrys, Gendrius: priesagos -utis vedinys iš sen. trump. Gendrys, Gendrius, kuris iš avd. Gendrimas.',' Gendrutis yra lietuvių kilmės vardas.'),(947,'Gervazas',' Gervazas yra Vyriškas vardas.','Trumpa reikšmė: „kovotojas“.','Vardo reikšmė: Jūs galite dirbti bet kokioje srityje, kur tik reikia protingai elgtis su pinigais. Jūs atkakliu darbu užsidirbate savo pinigus ir nesiimate lošti nesąžiningų žaidimų.',' Gervazas yra ispanų kilmės vardas.'),(948,'Gendrutė',' Gendrutė yra Moteriškas vardas.','Trumpa reikšmė: gend- (pasigenda) – „tas, kurio pasigendama“.','Vardo reikšmė: Gendrutė – (2) liet., sen. var. Gendruta, trump. Gendrė, – 1. liet., priesagos -utė vedinys iš Gendrė, 2. sulietuvintas vardo Gertrūda variantas.',' Gendrutė yra lietuvių kilmės vardas.'),(949,'Gerutis',' Gerutis yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Gerys, priesagos -utis vedinys iš sen. trump. Gerys, kuris iš Gerimantas, Germinas, Gertautas.','Vardo reikšmė: Gerutis – (2) liet., trump. Gerys, priesagos -utis vedinys iš sen. trump. Gerys, kuris iš Gerimantas, Germinas, Gertautas ir kt.',' Gerutis yra lietuvių kilmės vardas.'),(950,'Gendrimas',' Gendrimas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Gendrys, Gendrius, gend- (: liet. pasi-genda, pasigesti) + rim- (žr. Gaudrimas).','Vardo reikšmė: Jūsų gyvenimą veikia Merkurijus, kuris nulemia jūsų protinį aktyvumą, gyvumą, naujus įspūdžius, prekybines operacijas, kalbą ir rašybą, domėjimąsi kultiniais mokslais.',' Gendrimas yra lietuvių kilmės vardas.'),(951,'Gertrūda',' Gertrūda yra Moteriškas vardas.','Trumpa reikšmė: ger „ietis“ + trūt „stipri“.','Vardo reikšmė: Negatyvios vibracijos Gertrūdoms pateikia daugybę netikėtumų. Jos patiria transporto katastrofas, ištremiamos iš savo šalies arba miršta nuo svetimtaučio rankos.',' Gertrūda yra vokiečių kilmės vardas.'),(952,'Gendrė',' Gendrė yra Moteriškas vardas.','Trumpa reikšmė: gend- (pasi-genda) – „tas, kurio pasigendama, ilgimasi“; vardų Gendrimas (-a), Gendrutis (-ė) ir pan. trumpiniai..','Vardo reikšmė: Jūs – laisvi žmonės, kurie mėgsta permainas, nuotykius ir pasilinksminimus. Jie saugo savo laisvę ir, kaip paukštis be sparnų, negali egzistuoti be jos. Jie labai lengvai prisitaiko. Permainos – jiems malonumas, o bet koks trukdymas – katastrofa.',' Gendrė yra lietuvių kilmės vardas.'),(953,'Gerutė',' Gerutė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Gerė, iš vyr. v. Gerutis.','Vardo reikšmė: Jūs – laisvi žmonės, kurie mėgsta permainas, nuotykius ir pasilinksminimus. Jie saugo savo laisvę ir, kaip paukštis be sparnų, negali egzistuoti be jos. Jie labai lengvai prisitaiko. Permainos – jiems malonumas, o bet koks trukdymas – katastrofa.',' Gerutė yra lietuvių kilmės vardas.'),(954,'Gertautė',' Gertautė yra Moteriškas vardas.','Trumpa reikšmė: ger- (geras) + taut- (tauta).','Vardo reikšmė: Šie vardo turėtojai nuo vaikystės svajoja apie tolimus kraštus, naujas keliones ir egzotiką. Jie norėtų išbandyti gyvenime nors vieną kartą viską. Jiems visas gyvenimas – žaidimų aikštelė. Tokia nuostata gali jiems daug kainuoti, nes gali išsekti savi resursai – biologiniai ar socialiniai.',' Gertautė yra lietuvių kilmės vardas.'),(955,'Gertautas',' Gertautas yra Vyriškas vardas.','Trumpa reikšmė: ger- (geras) + taut- (tauta).','Vardo reikšmė: Šie vardo turėtojai nuo vaikystės svajoja apie tolimus kraštus, naujas keliones ir egzotiką. Jie norėtų išbandyti gyvenime nors vieną kartą viską. Jiems visas gyvenimas – žaidimų aikštelė. Tokia nuostata gali jiems daug kainuoti, nes gali išsekti savi resursai – biologiniai ar socialiniai.',' Gertautas yra lietuvių kilmės vardas.'),(956,'Gertarė',' Gertarė yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Gertė, iš vyr. v. Gertaras.','Vardo reikšmė: Šie vardo turėtojai mėgsta skaniai ir sočiai pavalgyti bei išgerti. Gali piktnaudžiauti seksu ir narkotikais. Jie turi talentą generuoti naujas idėjas; puikios rankos. Mėgsta visa, kas nauja ir neištirta. Jie protingi, tačiau mąstymo procesas, kaip ir pats gyvenimas, neorganizuotas ir išbarstytas.',' Gertarė yra lietuvių kilmės vardas.'),(957,'Gertaras',' Gertaras yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Gertas, Gertys, ger- (žr. Germantas) + tar- (žr. Geistaras).','Vardo reikšmė: Šie vardo turėtojai mėgsta skaniai ir sočiai pavalgyti bei išgerti. Gali piktnaudžiauti seksu ir narkotikais. Jie turi talentą generuoti naujas idėjas; puikios rankos. Mėgsta visa, kas nauja ir neištirta. Jie protingi, tačiau mąstymo procesas, kaip ir pats gyvenimas, neorganizuotas ir išbarstytas.',' Gertaras yra lietuvių kilmės vardas.'),(958,'Germinas',' Germinas yra Vyriškas vardas.','Trumpa reikšmė: ger- geras) + min- (minėti) – „minimas kaip geras“.','Vardo reikšmė: Jūs labai stiprus, valingas, kartais tiesiog nesuvaldomas charakteris, kuris pasireiškia visose gyvenimo sferose, taip pat ir su moterimis. Norėdami pasiekti savo, jie naudoja įvairius būdus, sugeba būti klastingi ir apgaunantys, dažnai tokiu elgesiu susikuria sau sunkumų ten, kur jų nėra.',' Germinas yra lietuvių kilmės vardas.'),(959,'Gerta',' Gerta yra Moteriškas vardas.','Trumpa reikšmė: vok., trumpinys iš Gertrūda.','Vardo reikšmė: Gerta – (1) vok., trumpinys iš Gertrūda.',' Gerta yra Vokiečių kilmės vardas.'),(960,'Germantė',' Germantė yra Moteriškas vardas.','Trumpa reikšmė: ger- (geras) + mant- (mantus „sumanus“).','Vardo reikšmė: Jūs labai stiprus, valingas, kartais tiesiog nesuvaldomas charakteris, kuris pasireiškia visose gyvenimo sferose, taip pat ir su moterimis. Norėdami pasiekti savo, jie naudoja įvairius būdus, sugeba būti klastingi ir apgaunantys, dažnai tokiu elgesiu susikuria sau sunkumų ten, kur jų nėra.',' Germantė yra lietuvių kilmės vardas.'),(961,'Iduna',' Iduna yra Moteriškas vardas.','Trumpa reikšmė: amžinos jaunystės deivės vardas.','Vardo reikšmė: Iduna – (2) skand., trump. Ida, iš skandinavų Iduna, kuris iš mitologinio v. Iduna — amžinos jaunystės deivė.',' Iduna yra skandinavų kilmės vardas.'),(962,'Idalija',' Idalija yra Moteriškas vardas.','Trumpa reikšmė: iš Ida sen. vokiečių: „dieviška moteris“.','Vardo reikšmė: Idalija – (1) ital., trump. Ida, iš italų Idalia, kuris yra priesaginis vedinys iš germ. Ida.',' Idalija yra italų kilmės vardas.'),(963,'Ida',' Ida yra Moteriškas vardas.','Trumpa reikšmė: „dieviška moteris“.','Vardo reikšmė: Vardadienis: Balandžio 13 d. rugsėjo 4 d.',' Ida yra vokiečių kilmės vardas.'),(964,'Giedrius',' Giedrius yra Vyriškas vardas.','Trumpa reikšmė: giedras „šviesus, saulėtas, tyras“.','Vardo reikšmė: Giedriai – tyros asmenybės, nes jų vardo vibracijos suteikia jiems didingų savybių. Jie visada apšviesti rampos šviesa. Tokį dėmesį pateisina ir stengiasi dirbti kitų labui. Turi daug vidinės energetikos ir gali būti puikiais mediumais. Dėl to daugelis tampa kunigais arba religiniais lyderiais.',' Giedrius yra lietuvių kilmės vardas.'),(965,'Giedrė',' Giedrė yra Moteriškas vardas.','Trumpa reikšmė: giedri „šviesi, saulėta, tyra“.','Vardo reikšmė: Iš negatyvių veiksnių reikėtų pažymėti Giedrių norą gyventi ne pagal pajamas. Būdamos nekantrios sunkiai pakelia buities sunkumus ir bet kokius prieštaravimus. Joms būdingas ir per didelis pasitikėjimas savimi, pasipūtimas ir puikybė.',' Giedrė yra lietuvių kilmės vardas.'),(966,'Giedra',' Giedra yra Moteriškas vardas.','Trumpa reikšmė: giedra „geras, šviesus, saulėtas oras“.','Vardo reikšmė: Giedra – (2) liet. : liet. giedra, plg. Giedrė.',' Giedra yra lietuvių kilmės vardas.'),(967,'Getautė',' Getautė yra Moteriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + taut- (tauta).','Vardo reikšmė: Getautė – (1) liet., trump. Getė, iš vyr. v. Getautas.',' Getautė yra lietuvių kilmės vardas.'),(968,'Getautas',' Getautas yra Vyriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + taut- (tauta).','Vardo reikšmė: Getautas – (1) liet., trump. Getas, Getys, ge- kilęs iš ged- (žr. Gedartas) + taut- (žr. Gantautas).',' Getautas yra lietuvių kilmės vardas.'),(969,'Gesvinas',' Gesvinas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Gesvas, Gesvys, ges- (žr. Geskantas) + vin- (žr. Gaudvinas).','Vardo reikšmė: Šiems vardų turėtojamss labai gerai sekasi turtiniuose reikaluose, ir jie triumfuoja investavę į labai brangius projektus. Jie stichiški ir plačių užmojų žmonės, kurių veiksmus sunku numatyti. Tai visų darbų meistrai !',' Gesvinas yra lietuvių kilmės vardas.'),(970,'Gilvilė',' Gilvilė yra Moteriškas vardas.','Trumpa reikšmė: gil- (gilti „skaudinti, jaudinti“) +vil- (viltis).','Vardo reikšmė: Šie vardo savininkai gali būti labai intelektualūs ir domėtis bet kuo, tačiau viskas kas susiję su paslaptimis, senove ir menu jį gali traukti labiausiai. Be to jam ypač gali sektis mechanikos ir elektronikos srityse. Tai protingo, talentingo ir mažai kuo pasikliaujančio žmogaus vardas.',' Gilvilė yra lietuvių kilmės vardas.'),(971,'Gestautė',' Gestautė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Gestė, iš vyr. v. Gestautas.','Vardo reikšmė: Gestautė – (1) liet., trump. Gestė, iš vyr. v. Gestautas.',' Gestautė yra lietuvių kilmės vardas.'),(972,'Gilvilas',' Gilvilas yra Vyriškas vardas.','Trumpa reikšmė: gil- (gilti „skaudinti, jaudinti“) +vil- (viltis).','Vardo reikšmė: Šie vardo savininkai gali būti labai intelektualūs ir domėtis bet kuo, tačiau viskas kas susiję su paslaptimis, senove ir menu jį gali traukti labiausiai. Be to jam ypač gali sektis mechanikos ir elektronikos srityse. Tai protingo, talentingo ir mažai kuo pasikliaujančio žmogaus vardas.',' Gilvilas yra lietuvių kilmės vardas.'),(973,'Gestautas',' Gestautas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Gestas, Gestys, ges- (žr. Geskantas) + taut- (žr. Gantautas).','Vardo reikšmė: Gestautas – (1) liet., trump. Gestas, Gestys, ges- (žr. Geskantas) + taut- (žr. Gantautas).',' Gestautas yra lietuvių kilmės vardas.'),(974,'Gilvydas',' Gilvydas yra Vyriškas vardas.','Trumpa reikšmė: gil- (gilti „skaudinti, jaudinti“) + vyd- (iš-vydo).','Vardo reikšmė: Šie vardo savininkai gali būti labai intelektualūs ir domėtis bet kuo, tačiau viskas kas susiję su paslaptimis, senove ir menu jį gali traukti labiausiai. Be to jam ypač gali sektis mechanikos ir elektronikos srityse. Tai protingo, talentingo ir mažai kuo pasikliaujančio žmogaus vardas.',' Gilvydas yra lietuvių kilmės vardas.'),(975,'Geskantas',' Geskantas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Gesas, Gesys, ges- (: liet. pasi-ges-ti) + kant- (žr. Galkantas).','Vardo reikšmė: Geskantas – (1) liet., trump. Gesas, Gesys, ges- (: liet. pasi-ges-ti) + kant- (žr. Galkantas).',' Geskantas yra lietuvių kilmės vardas.'),(976,'Geržadas',' Geržadas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Gerys, ger- (žr. Germantas) + žad- (: liet. ža-das, žad-ėti).','Vardo reikšmė: Vardadienis: Vasario mėn 26 d. – Geržado vardo diena.',' Geržadas yra lietuvių kilmės vardas.'),(977,'Gilvainė',' Gilvainė yra Moteriškas vardas.','Trumpa reikšmė: gil- (gilti „skaudinti, jaudinti“) + vain- (vaina „priežastis, kaltė“).','Vardo reikšmė: Jūsų gyvenimas kiaurai persmelktas jūsų įsitikinimų. Jūs švytite, intuityvūs, atviri, emocionalūs ir išradingi. Galite būti stiprūs dvasiškai. Jūsų teigiamos savybės: artistiškumas, potraukis į nežabotas linksmybes, polinkis į kūrybą, romantiškumas, aistringumas, linksmumas, platūs interesai.',' Gilvainė yra lietuvių kilmės vardas.'),(978,'Gilvainas',' Gilvainas yra Vyriškas vardas.','Trumpa reikšmė: gil- (gilti „skaudinti, jaudinti“) + vain- (vaina „priežastis, kaltė“).','Vardo reikšmė: Jūsų gyvenimas kiaurai persmelktas jūsų įsitikinimų. Jūs švytite, intuityvūs, atviri, emocionalūs ir išradingi. Galite būti stiprūs dvasiškai. Jūsų teigiamos savybės: artistiškumas, potraukis į nežabotas linksmybes, polinkis į kūrybą, romantiškumas, aistringumas, linksmumas, platūs interesai.',' Gilvainas yra lietuvių kilmės vardas.'),(979,'Gervilė',' Gervilė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Gerė, iš vyr. v. Gervilas.','Vardo reikšmė: Gervilė – (1), (2) liet., trump. Gerė, iš vyr. v. Gervilas.',' Gervilė yra lietuvių kilmės vardas.'),(980,'Gilmintas',' Gilmintas yra Vyriškas vardas.','Trumpa reikšmė: gil- (gilti „skaudinti, jaudinti“) + min- (minėti).','Vardo reikšmė: (1) liet., trump. Gilas, Gilmas, gil- (žr. Gilminas) + mint- (žr. Gedmintas)',' Gilmintas yra lietuvių kilmės vardas.'),(981,'Gintas',' Gintas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Gintautas, Gintaras gin- (ginti).','Vardo reikšmė: Gintai siaurų profesijų specialistai, tačiau tai tikri profesionalai. Jie kantrūs, pasitikintys, turi išskirtinių savybių. Reikėtų saugotis neigiamų vibracijų: nekantrumo, melancholijos, potraukio alkoholiui. Tingumo.',' Gintas yra lietuvių kilmės vardas.'),(982,'Gervilas',' Gervilas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Gerys, ger- (žr. Germantas) + vil- (žr. Gaivilas).','Vardo reikšmė: Gervilas – (1) liet., trump. Gerys, ger- (žr. Germantas) + vil- (žr. Gaivilas).',' Gervilas yra lietuvių kilmės vardas.'),(983,'Gilminas',' Gilminas yra Vyriškas vardas.','Trumpa reikšmė: gil- (gilti „skaudinti, jaudinti“) + min- (minėti).','Vardo reikšmė: Gilminas – (1) liet., trump. Gilas, Gilmas, gil- (: liet. gil-ti „skaudinti“) + min- (žr. Gailiminas).',' Gilminas yra lietuvių kilmės vardas.'),(984,'Gintarė',' Gintarė yra Moteriškas vardas.','Trumpa reikšmė: gin- (ginti) + tar- (tarti); brangakmenis gintaras.','Vardo reikšmė: Gintarės puikiai supranta pinigų svarbą, tačiau jų kaupimas – ne jų tikslas. Turėdamos pinigų, jos stengiasi juos investuoti į kokį nors patikimą biznį.',' Gintarė yra lietuvių kilmės vardas.'),(985,'Gildas',' Gildas yra Vyriškas vardas.','Trumpa reikšmė: liet.: liet. gild-yti (širdį).','Vardo reikšmė: Gildas – (1) liet.: liet. gild-yti (širdį).',' Gildas yra lietuvių kilmės vardas.'),(986,'Gintaras',' Gintaras yra Vyriškas vardas.','Trumpa reikšmė: liet. ir prūs., trump. Gintas, Gintis, gin- (: liet. gin-ti, gin-a „saugoti“) + tar- (žr. Geistaras).','Vardo reikšmė: Gintarų teigiamos savybės: ryžtingumas, solidumas, nenuramdomumas, atkaklumas. Aštuonetukas jiems papildomai suteikia profesionalumo, autoritetą, sugebėjimą, ambicingumo.',' Gintaras yra lietuvių kilmės vardas.'),(987,'Gilda',' Gilda yra Moteriškas vardas.','Trumpa reikšmė: gildyti (širdį) – „jaudinantis, -i; sukrečiantis, -i“.','Vardo reikšmė: Gilda – (1) liet., iš vyr. v. Gildas.',' Gilda yra lietuvių kilmės vardas.'),(988,'Gilbertas',' Gilbertas yra Vyriškas vardas.','Trumpa reikšmė: gisal- „įkaitas“ + beraht „garsus, žymus“.','Vardo reikšmė: Gilbertas – (1) germ., trump. Gilas, Bertas, iš vok. Gilbert, kuris iš germ. Gisalbert, Giselbert: germ. gisal- „įkaitas“ + beraht „garsus, žymus“.',' Gilbertas yra vokiečių kilmės vardas.'),(989,'Ginvilė',' Ginvilė yra Moteriškas vardas.','Trumpa reikšmė: gin- (ginti) + vil- (viltis).','Vardo reikšmė: Jūs esate tikri romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jūsų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose..',' Ginvilė yra lietuvių kilmės vardas.'),(990,'Giniotė',' Giniotė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Gina, iš vyr. v. Giniotas.','Vardo reikšmė: Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais',' Giniotė yra lietuvių kilmės vardas.'),(991,'Ginvilas',' Ginvilas yra Vyriškas vardas.','Trumpa reikšmė: gin- (ginti) + vil- (viltis).','Vardo reikšmė: Jūs esate tikri romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jūsų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose..',' Ginvilas yra lietuvių kilmės vardas.'),(992,'Giniotas',' Giniotas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Ginas, Ginius, priesagos -otas vedinys iš sen. trump. Ginas.','Vardo reikšmė: Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais',' Giniotas yra lietuvių kilmės vardas.'),(993,'Gilanda',' Gilanda yra Moteriškas vardas.','Trumpa reikšmė: iš upėvardžio Gilanda (Pagėgiai).','Vardo reikšmė: Jūs gerai numatote vedybų perspektyvas, ir jeigu vedate ar ištekate, tai tik su dideliu kraičiu. Kartais gaunate didelį palikimą iš tolimų giminaičių. Su antrąja puse gyvenate labai paslaptingą ir keistą gyvenimą.',' Gilanda yra lietuvių kilmės vardas.'),(994,'Gindvilė',' Gindvilė yra Moteriškas vardas.','Trumpa reikšmė: gin- (ginti) + vil- (viltis).','Vardo reikšmė: Jūs esate tikri romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jūsų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose..',' Gindvilė yra lietuvių kilmės vardas.'),(995,'Ginvydas',' Ginvydas yra Vyriškas vardas.','Trumpa reikšmė: gin- (ginti) + vyd- (iš-vydo).','Vardo reikšmė: Ginvydas – (1) liet., trump. Ginas, Ginius, gin- (žr. Gintaras) + vyd- (žr. Galvydas).',' Ginvydas yra lietuvių kilmės vardas.'),(996,'Gindvilas',' Gindvilas yra Vyriškas vardas.','Trumpa reikšmė: gin- (ginti) + vil- (viltis).','Vardo reikšmė: Jūs esate tikri romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jūsų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose..',' Gindvilas yra lietuvių kilmės vardas.'),(997,'Gindas',' Gindas yra Vyriškas vardas.','Trumpa reikšmė: liet. ir prūs., trumpinys iš Gindvilas.','Vardo reikšmė: Gindas – (2) liet. ir prūs., trumpinys iš Gindvilas.',' Gindas yra lietuvių kilmės vardas.'),(998,'Gintvilė',' Gintvilė yra Moteriškas vardas.','Trumpa reikšmė: gin- (ginti) + vil- (viltis).','Vardo reikšmė: Jūs esate tikri romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jūsų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose..',' Gintvilė yra lietuvių kilmės vardas.'),(999,'Gintvilas',' Gintvilas yra Vyriškas vardas.','Trumpa reikšmė: gin- (ginti) + vil- (viltis).','Vardo reikšmė: Gintvilas – (1) liet., trump. Gintas, gint- (žr. Gintvainas) + vil- (žr. Gaivilas).',' Gintvilas yra lietuvių kilmės vardas.'),(1000,'Gintvainė',' Gintvainė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Gintė, iš vyr. v. Gintvainas.','Vardo reikšmė: Gintvainė – (1) liet., trump. Gintė, iš vyr. v. Gintvainas.',' Gintvainė yra lietuvių kilmės vardas.'),(1001,'Giriotas',' Giriotas yra Vyriškas vardas.','Trumpa reikšmė: gir- (giria) + jot- (joti) – „giria jojantis, -i“.','Vardo reikšmė: Giriotas – (1) liet., trump. Girius, gir- (: liet. gir-ti, gir-ia) + jot- (: liet. joti, jot-ų).',' Giriotas yra lietuvių kilmės vardas.'),(1002,'Gintvainas',' Gintvainas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Gintas, gint- (: liet. ginti, gint-as) + vain- (žr. Galvainas).','Vardo reikšmė: Gintvainas – (1) liet., trump. Gintas, gint- (: liet. ginti, gint-as) + vain- (žr. Galvainas).',' Gintvainas yra lietuvių kilmės vardas.'),(1003,'Gina',' Gina yra Moteriškas vardas.','Trumpa reikšmė: ginti – „gynėjas, gynėja“.','Vardo reikšmė: Vardadienis: Kovo 31 d., gegužės 24 d.',' Gina yra lietuvių kilmės vardas.'),(1004,'Girėnas',' Girėnas yra Vyriškas vardas.','Trumpa reikšmė: gir- (giria „miškas“) – „girios gyventojas“; transatlantinio lakūno pavardė.','Vardo reikšmė: Girėnas – (1) liet., trump. Girius, iš transatlantinio lakūno pavardės Girėnas.',' Girėnas yra lietuvių kilmės vardas.'),(1005,'Gintys',' Gintys yra Vyriškas vardas.','Trumpa reikšmė: liet. ir prūs., trumpinys iš Gintaras, Gintautas, Gintvilas ir kt.','Vardo reikšmė: Gintys – (4) liet. ir prūs., trumpinys iš Gintaras, Gintautas, Gintvilas ir kt.',' Gintys yra lietuvių kilmės vardas.'),(1006,'Girdvilė',' Girdvilė yra Moteriškas vardas.','Trumpa reikšmė: gird- (girdėti) + vil- (viltis).','Vardo reikšmė: (1), (2) liet., trump. Girdė, iš vyr. v. Girdvilas',' Girdvilė yra lietuvių kilmės vardas.'),(1007,'Gintilė',' Gintilė yra Moteriškas vardas.','Trumpa reikšmė: liet. ir prūs., trump. Gintė, iš vyr. v. Gintilas.','Vardo reikšmė: Jūsų gyvenimas kaip scenoje – jūsų replikos taiklios ir patikrintos, išvaizda nuo šukuosenos iki batų idealiai apgalvota. Savo esybe jūs esate ir niekada nepatenkinti tuo, ką turite. Visą laiką ieškote progų tobulėti.',' Gintilė yra lietuvių kilmės vardas.'),(1008,'Gilvinas',' Gilvinas yra Vyriškas vardas.','Trumpa reikšmė: gil- (gilti „skaudinti“) + vin- (vin-/vain- vaina „priežastis, kaltė“) –„skaudi priežastis“.','Vardo reikšmė: Gilvinas – (1) liet., trump. Gilvas, Gilvys, gil- (žr. Gilminas) + vin- (žr. Gaudvinas).',' Gilvinas yra lietuvių kilmės vardas.'),(1009,'Girdvilas',' Girdvilas yra Vyriškas vardas.','Trumpa reikšmė: gird- (girdėti) + vil- (viltis).','Vardo reikšmė: Girdvilas – (1) liet., trump. Girdas, Girdys, gird- (žr. Girdmantas) + vil- (žr. Gaivilas).',' Girdvilas yra lietuvių kilmės vardas.'),(1010,'Gintilas',' Gintilas yra Vyriškas vardas.','Trumpa reikšmė: liet. ir prūs., trump. Gintys, priesagos -ilas vedinys iš sen. trump. Gintas.','Vardo reikšmė: Jūsų gyvenimas kaip scenoje – jūsų replikos taiklios ir patikrintos, išvaizda nuo šukuosenos iki batų idealiai apgalvota. Savo esybe jūs esate ir niekada nepatenkinti tuo, ką turite. Visą laiką ieškote progų tobulėti.',' Gintilas yra prūsų kilmės vardas.'),(1011,'Girdvydas',' Girdvydas yra Vyriškas vardas.','Trumpa reikšmė: gird- (girdėti) + vyd- (iš-vydo) – „daug girdėjęs, daug matęs“.','Vardo reikšmė: Girdvydas – (1) liet., trump. Girdas, Girdys, gird- (žr. Girdmantas) + vyd- (žr. Galvydas).',' Girdvydas yra lietuvių kilmės vardas.'),(1012,'Gintenis',' Gintenis yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Gintis, priesagos -enis vedinys iš sen. trump. Gintas..','Vardo reikšmė: Gintenis – (2) liet., trump. Gintis, priesagos -enis vedinys iš sen. trump. Gintas.',' Gintenis yra lietuvių kilmės vardas.'),(1013,'Gintenė',' Gintenė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Gintė, iš vyr. v. Gintenis.','Vardo reikšmė: Gintenė – (2) liet., trump. Gintė, iš vyr. v. Gintenis.',' Gintenė yra lietuvių kilmės vardas.'),(1014,'Girdvainė',' Girdvainė yra Moteriškas vardas.','Trumpa reikšmė: gird- (girdėti) + vain- (vaina „priežastis, kaltė“) – „gando, žinios priežastis“.','Vardo reikšmė: Girdvainė – (1) liet., trump. Girdė, iš vyr. v. Girdvainas.',' Girdvainė yra lietuvių kilmės vardas.'),(1015,'Girdvainas',' Girdvainas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Girdas, Girdys, gird- (žr. Girdmantas) + vain- (žr. Galvainas).','Vardo reikšmė: Girdvainas – (1) liet., trump. Girdas, Girdys, gird- (žr. Girdmantas) + vain- (žr. Galvainas).',' Girdvainas yra lietuvių kilmės vardas.'),(1016,'Gintautė',' Gintautė yra Moteriškas vardas.','Trumpa reikšmė: gin- (ginti) + taut- (tauta) – „ginantis (-i) tautą“.','Vardo reikšmė: Gintautė – (1) liet. ir prūs., trump. Ginta, Gintė, iš vyr. v. Gintautas.',' Gintautė yra lietuvių kilmės vardas.'),(1017,'Girtautė',' Girtautė yra Moteriškas vardas.','Trumpa reikšmė: gir- (giria) + taut- (tauta) – „girininkas“.','Vardo reikšmė: Girtautė – (1) liet., trump. Girė, iš vyr. v. Girtautas.',' Girtautė yra lietuvių kilmės vardas.'),(1018,'Girtautas',' Girtautas yra Vyriškas vardas.','Trumpa reikšmė: gir- (giria) + taut- (tauta) – „girininkas“.','Vardo reikšmė: Girtautas – (1) liet., trump. Giras, Girius, gir- (žr. Giriotas) + taut- (žr. Gantautas).',' Girtautas yra lietuvių kilmės vardas.'),(1019,'Girdutis',' Girdutis yra Vyriškas vardas.','Trumpa reikšmė: gird- (girdėti) + -ut- (mažybinė priesaga).','Vardo reikšmė: Girdutis – (2) liet. ir prūs., trump. Girdas, Girdys, priesagos -utis vedinys iš sen. trump. Girdas.',' Girdutis yra lietuvių kilmės vardas.'),(1020,'Gintautas',' Gintautas yra Vyriškas vardas.','Trumpa reikšmė: gin- (ginti) + taut- (tauta) – „ginantis (-i) tautą“.','Vardo reikšmė: Gintautai neigiamų savybių labai linkę blogybėms; seksualiniai maniakai. Jie nevalingi, išdidūs, pagyrūnai. Tokie veiksmai sukelia pašalinių pašaipias šypsenėles. Nemėgsta dirbti ir labai tingūs. Jie gudrūs ir naudojasi kitų silpnybėmis, tačiau patys bailūs ir nemėgsta stipresniųjų už save.',' Gintautas yra lietuvių kilmės vardas.'),(1021,'Girstys',' Girstys yra Vyriškas vardas.','Trumpa reikšmė: liet., trumpinys iš Girstautas.','Vardo reikšmė: Jūs užsispyrę darbuotojai, lengvai apsikraunantys įvairiausiais darbais; jūsų rankose negalimas tampa galimu. Jūs intravertai, labai kantrūs, rimti ir melancholiškai nusiteikę žmonės.',' Girstys yra lietuvių kilmės vardas.'),(1022,'Girdutė',' Girdutė yra Moteriškas vardas.','Trumpa reikšmė: gird- (girdėti) + -ut- (mažybinė priesaga).','Vardo reikšmė: Girdutė – (2) liet. ir prūs., trump. Girdė, iš vyr. v. Girdutis.',' Girdutė yra lietuvių kilmės vardas.'),(1023,'Girstenis',' Girstenis yra Vyriškas vardas.','Trumpa reikšmė: liet. ir prūs., trump. Girstys, priesagos -enis vedinys iš sen. trump. Girstys.','Vardo reikšmė: Girstenis – (2) liet. ir prūs., trump. Girstys, priesagos -enis vedinys iš sen. trump. Girstys.',' Girstenis yra lietuvių kilmės vardas.'),(1024,'Girdmantė',' Girdmantė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Girdė, iš vyr. v. Girdmantas.','Vardo reikšmė: Girdmantė – (1) liet., trump. Girdė, iš vyr. v. Girdmantas.',' Girdmantė yra lietuvių kilmės vardas.'),(1025,'Girdmantas',' Girdmantas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Girdas, Girdys, gird- (: liet. gird-ėti, gird-as „gandas, žinia“) + mant- (žr. Gailimantas).','Vardo reikšmė: Girdmantas – (1) liet., trump. Girdas, Girdys, gird- (: liet. gird-ėti, gird-as „gandas, žinia“) + mant- (žr. Gailimantas).',' Girdmantas yra lietuvių kilmės vardas.'),(1026,'Girstenė',' Girstenė yra  vardas.','Trumpa reikšmė: liet. ir prūs., trump. Girstė, iš vyr. v. Girstenis.','Vardo reikšmė: Girstenė – (2) liet. ir prūs., trump. Girstė, iš vyr. v. Girstenis.',' Girstenė yra lietuvių kilmės vardas.'),(1027,'Girdenė',' Girdenė yra Moteriškas vardas.','Trumpa reikšmė: gird- (girdėti, girdas „žinia, gandas“) + -en- – „girdintis, žinantis gandus“.','Vardo reikšmė: Girdenė – lietuviškos kilmės vardas mergaitei. Girdenės vardo trumpinys – Girdė, o Girdenės vardo atitikmuo vyrui – Girdenis.',' Girdenė yra lietuvių kilmės vardas.'),(1028,'Girstė',' Girstė yra Moteriškas vardas.','Trumpa reikšmė: liet., trumpinys iš Girstautė.','Vardo reikšmė: Girstė – (1) liet., trumpinys iš Girstautė.',' Girstė yra lietuvių kilmės vardas.'),(1029,'Girdenis',' Girdenis yra Vyriškas vardas.','Trumpa reikšmė: gird- (girdėti, girdas „žinia, gandas“) + -en- – „girdintis, žinantis gandus“.','Vardo reikšmė: Girdenis – lietuviškas vardas, kurio trumpinys – Girdys. Girdenis – priesagos -enis vedinys iš senovinio vardo trumpinio Girdas.',' Girdenis yra lietuvių kilmės vardas.'),(1030,'Girstautė',' Girstautė yra Moteriškas vardas.','Trumpa reikšmė: girs- (iš- girsti) + taut- (tauta).','Vardo reikšmė: Girstautė – (1) liet. ir prūs., trump. Girstė, iš vyr. v. Girstautas.',' Girstautė yra lietuvių kilmės vardas.'),(1031,'Gytenė',' Gytenė yra Moteriškas vardas.','Trumpa reikšmė: gy- (gyd-/ geid kaita – „geidauti, geidė“) – „geidžiantis, geidulingas“.','Vardo reikšmė: Gytenė – (2) liet., trump. Gytė, iš vyr. v. Gytenis.',' Gytenė yra lietuvių kilmės vardas.'),(1032,'Girstautas',' Girstautas yra Vyriškas vardas.','Trumpa reikšmė: girs- (iš- girsti) + taut- (tauta).','Vardo reikšmė: Vardadienis: Rugsėjo 4 d., gruodžio 24 d.',' Girstautas yra lietuvių kilmės vardas.'),(1033,'Gytė',' Gytė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Gytautas, Gytautė: gy- (gyd- geid „geidauti, geidė“) + taut- (tauta).','Vardo reikšmė: Vardadienis: Spalio 17 d., rugsėjo 11 d.',' Gytė yra lietuvių kilmės vardas.'),(1034,'Girmas',' Girmas yra Vyriškas vardas.','Trumpa reikšmė: liet., trumpinys iš Girmantas.','Vardo reikšmė: Girmas – (1) liet., trumpinys iš Girmantas.',' Girmas yra lietuvių kilmės vardas.'),(1035,'Gytautė',' Gytautė yra Moteriškas vardas.','Trumpa reikšmė: gy- (gyd- geid „geidauti, geidė“) + taut- (tauta).','Vardo reikšmė: Gytautė -(1) liet., trump. Gytė, iš vyr. v. Gytautas.',' Gytautė yra lietuvių kilmės vardas.'),(1036,'Girmantė',' Girmantė yra Moteriškas vardas.','Trumpa reikšmė: gir- (giria „miškas“) + mant- (mantus „sumanus“).','Vardo reikšmė: Vardadienis: Kovo 28 d., balandžio 18 d.',' Girmantė yra lietuvių kilmės vardas.'),(1037,'Gytautas',' Gytautas yra Vyriškas vardas.','Trumpa reikšmė: gy- (gyd- geid „geidauti, geidė“) + taut- (tauta).','Vardo reikšmė: Vardadienis: Vasario 1 d., rugsėjo 1 d.',' Gytautas yra lietuvių kilmės vardas.'),(1038,'Girmantas',' Girmantas yra Vyriškas vardas.','Trumpa reikšmė: gir- (giria „miškas“) + mant- (mantus „sumanus“).','Vardo reikšmė: Girmantas – (1) liet., trump. Girmas, gir- (žr. Giriotas) + mant- (žr. Gailimantas).',' Girmantas yra lietuvių kilmės vardas.'),(1039,'Girma',' Girma yra Moteriškas vardas.','Trumpa reikšmė: liet., trumpinys iš Girmantė.','Vardo reikšmė: Girma – (1) liet., trumpinys iš Girmantė.',' Girma yra lietuvių kilmės vardas.'),(1040,'Gita',' Gita yra Moteriškas vardas.','Trumpa reikšmė: vok., iš vok. Gita, Gitta, kuris yra vok. trumpinys iš Brigita.','Vardo reikšmė: Gita – (2) vok., iš vok. Gita, Gitta, kuris yra vok. trumpinys iš Brigita.',' Gita yra vokiečių kilmės vardas.'),(1041,'Giržadė',' Giržadė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Girė, iš vyr. v. Giržadas.','Vardo reikšmė: Giržadė – (1) liet., trump. Girė, iš vyr. v. Giržadas.',' Giržadė yra lietuvių kilmės vardas.'),(1042,'Girkantas',' Girkantas yra Vyriškas vardas.','Trumpa reikšmė: gir- (giria „miškas“) + kant- (pa-kantus, kantrus).','Vardo reikšmė: (1) liet., trump. Giras, Girius, gir-(žr. Giriotas) + kant- (žr. Galkantas)',' Girkantas yra lietuvių kilmės vardas.'),(1043,'Giržadas',' Giržadas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Giras, Girius, gir- (žr. Giriotas) + žad- (žr. Geržadas).','Vardo reikšmė: Giržadas – (1) liet., trump. Giras, Girius, gir- (žr. Giriotas) + žad- (žr. Geržadas).',' Giržadas yra lietuvių kilmės vardas.'),(1044,'Girvinas',' Girvinas yra Vyriškas vardas.','Trumpa reikšmė: gir- (giria „miškas“) + vin- (vaina „kaltė, priežastis“).','Vardo reikšmė: Jūsų gyvenimas kaip scenoje – jūsų replikos taiklios ir patikrintos, išvaizda nuo šukuosenos iki batų idealiai apgalvota. Savo esybe jūs esate ir niekada nepatenkinti tuo, ką turite. Visą laiką ieškote progų tobulėti.',' Girvinas yra lietuvių kilmės vardas.'),(1045,'Giriotė',' Giriotė yra Moteriškas vardas.','Trumpa reikšmė: gir- (giria) + jot- (joti) – „giria jojantis, -i“.','Vardo reikšmė: Jūsų gyvenimas kaip scenoje – jūsų replikos taiklios ir patikrintos, išvaizda nuo šukuosenos iki batų idealiai apgalvota. Savo esybe jūs esate ir niekada nepatenkinti tuo, ką turite. Visą laiką ieškote progų tobulėti.',' Giriotė yra lietuvių kilmės vardas.'),(1046,'Girvilė',' Girvilė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Girė, iš vyr. v. Girvilas.','Vardo reikšmė: Girvilė – (1), (2) liet., trump. Girė, iš vyr. v. Girvilas.',' Girvilė yra lietuvių kilmės vardas.'),(1047,'Girvilas',' Girvilas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Giras, Girius, gir- (žr. Giriotas) + vil- (žr. Gaivilas).','Vardo reikšmė: Girvilas – (1) liet., trump. Giras, Girius, gir- (žr. Giriotas) + vil- (žr. Gaivilas).',' Girvilas yra lietuvių kilmės vardas.'),(1048,'Girvydas',' Girvydas yra Vyriškas vardas.','Trumpa reikšmė: gir- (giria „miškas“) + vyd- (iš-vydo).','Vardo reikšmė: Jūsų gyvenimas kaip scenoje – jūsų replikos taiklios ir patikrintos, išvaizda nuo šukuosenos iki batų idealiai apgalvota. Savo esybe jūs esate ir niekada nepatenkinti tuo, ką turite. Visą laiką ieškote progų tobulėti.',' Girvydas yra lietuvių kilmės vardas.'),(1049,'Guoda',' Guoda yra Moteriškas vardas.','Trumpa reikšmė: guoda „garbė, pagarba“.','Vardo reikšmė: Šie vardo turėtojai labai myli vaikus – tiek savus, tiek svetimus, tačiau be didesnio sentimentalumo. Vaikai jums – tas pats kas ir suaugę, tik laimingas vaikas turi savyje daugiau džiaugsmo, lūkesčių ateičiai.',' Guoda yra lietuvių kilmės vardas.'),(1050,'Guntilda',' Guntilda yra Moteriškas vardas.','Trumpa reikšmė: gund „kova“ + hiltja „kova“.','Vardo reikšmė: Šie vardo turėtojai labai myli vaikus – tiek savus, tiek svetimus, tačiau be didesnio sentimentalumo. Vaikai jums – tas pats kas ir suaugę, tik laimingas vaikas turi savyje daugiau džiaugsmo, lūkesčių ateičiai.',' Guntilda yra vokiečių kilmės vardas.'),(1051,'Girvainė',' Girvainė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Girė, iš vyr. v. Girvainas.','Vardo reikšmė: Jus globoja Saturnas. Jūsų mintys visada ramios, viskas apgalvota iki smulkmenų; retai kada pasireiškia impulsyvumas ir emocijos bei skubotumas. Jūs labai vertinate kiekvieną minutę ir kelyje į tikslą užimate tvirtą poziciją bei visada žinote, ko norite.',' Girvainė yra lietuvių kilmės vardas.'),(1052,'Gotautas',' Gotautas yra Vyriškas vardas.','Trumpa reikšmė: go- (godyti „nujausti, nutuokti“) + taut- (tauta).','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Kartais jie apie save suburia tvirtovės sieną, atskiriančią juos nuo aistrų ir instinktų, laikydami juos antraeiliais dalykais. Ir visgi jūsų protas bei energija nukreipti saviems egoistiniams tikslams įgyvendinti.',' Gotautas yra lietuvių kilmės vardas.'),(1053,'Girvainas',' Girvainas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Giras, Girius, gir- (žr. Giriotas) + vain- (žr. Galvainas).','Vardo reikšmė: Jus globoja Saturnas. Jūsų mintys visada ramios, viskas apgalvota iki smulkmenų; retai kada pasireiškia impulsyvumas ir emocijos bei skubotumas. Jūs labai vertinate kiekvieną minutę ir kelyje į tikslą užimate tvirtą poziciją bei visada žinote, ko norite.',' Girvainas yra lietuvių kilmės vardas.'),(1054,'Gundė',' Gundė yra Moteriškas vardas.','Trumpa reikšmė: suliet. prūs., trumpinys iš mot. v. Jogundė, Nergundė, Sangundė ir kt.','Vardo reikšmė: Gundė – (2) suliet. prūs., trumpinys iš mot. v. Jogundė, Nergundė, Sangundė ir kt.',' Gundė yra lietuvių kilmės vardas.'),(1055,'Gotartas',' Gotartas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Gotas, go- iš god- (: liet. god-yti „nujausti, nutuokti“) + tart- (žr. Gedartas).','Vardo reikšmė: Gotartas – (1) liet., trump. Gotas, go- iš god- (: liet. god-yti „nujausti, nutuokti“) + tart- (žr. Gedartas).',' Gotartas yra lietuvių kilmės vardas.'),(1056,'Gostautė',' Gostautė yra Moteriškas vardas.','Trumpa reikšmė: gos- (gostis „atsipeikėti“) + taut- (tauta) – „pažadinantis tautą“.','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Kartais jie apie save suburia tvirtovės sieną, atskiriančią juos nuo aistrų ir instinktų, laikydami juos antraeiliais dalykais. Ir visgi jūsų protas bei energija nukreipti saviems egoistiniams tikslams įgyvendinti.',' Gostautė yra lietuvių kilmės vardas.'),(1057,'Gostautas',' Gostautas yra Vyriškas vardas.','Trumpa reikšmė: gos- (gostis „atsipeikėti“) + taut- (tauta) – „pažadinantis tautą“.','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Kartais jie apie save suburia tvirtovės sieną, atskiriančią juos nuo aistrų ir instinktų, laikydami juos antraeiliais dalykais. Ir visgi jūsų protas bei energija nukreipti saviems egoistiniams tikslams įgyvendinti.',' Gostautas yra lietuvių kilmės vardas.'),(1058,'Gostartas',' Gostartas yra Vyriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Gostys, gos- (: liet. gos-tis „atsipeikėti“) + tart- (žr. Gedartas).','Vardo reikšmė: Gostartas – (1) suliet. prūs., trump. Gostys, gos- (: liet. gos-tis „atsipeikėti“) + tart- (žr. Gedartas).',' Gostartas yra lietuvių kilmės vardas.'),(1059,'Gomantas',' Gomantas yra Vyriškas vardas.','Trumpa reikšmė: go- (sen. lietuvių goti „eiti“) + mant- (mantus „sumanus“).','Vardo reikšmė: Gomantas – (1) liet., trump. Gomas, go- (: liet. go-ti „eiti“) + mant- (žr. Gailimantas).',' Gomantas yra lietuvių kilmės vardas.'),(1060,'Gomantė',' Gomantė yra Moteriškas vardas.','Trumpa reikšmė: go- (sen. lietuvių goti „eiti“) + mant- (mantus „sumanus“).','Vardo reikšmė: Gomantė – (1) liet., trump. Gomė, iš vyr. v. Gomantas.',' Gomantė yra lietuvių kilmės vardas.'),(1061,'Goda',' Goda yra Moteriškas vardas.','Trumpa reikšmė: go- (godyti „nujausti, nutuokti“) – „turinti nuojautą, nutuokianti“.','Vardo reikšmė: (4) liet., iš sen. vyr. avd. Godas (plg. vv. Godai — Radviliškis), kuris yra sen. trumpinys iš God-tautas, virtusio Gotautas, iš God-tartas, virtusio Gotartas',' Goda yra lietuvių kilmės vardas.'),(1062,'Gytis',' Gytis yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Gytautas, Gytautė: gy- (gyd- geid „geidauti, geidė“) + taut- (tauta).','Vardo reikšmė: Jūsų vardo dieną valdo Venera. Pagrindinis jūsų bruožas – magnetizmas. Jūs stengiatės atitikti maksimalų galimybių potencialą. Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems. ',' Gytis yra lietuvių kilmės vardas.'),(1063,'Gytenis',' Gytenis yra Vyriškas vardas.','Trumpa reikšmė: gy- (gyd-/ geid kaita – „geidauti, geidė“) – „geidžiantis, geidulingas“.','Vardo reikšmė: Jūsų vardo dieną valdo Venera. Pagrindinis jūsų bruožas – magnetizmas. Jūs stengiatės atitikti maksimalų galimybių potencialą. Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems.',' Gytenis yra lietuvių kilmės vardas.'),(1064,'Gvidonas',' Gvidonas yra Vyriškas vardas.','Trumpa reikšmė: witu „giria, miškas“.','Vardo reikšmė: Jūsų gyvenimo verpetuose stipriausias noras – laiminga santuoka. Jūs puikūs originalių idėjų ir efektyvių sistemų šaltinis. Gyvenimas jums žavingas todėl, kad jūs patys suteikiate jam tam tikrą prieskonį.',' Gvidonas yra vokiečių kilmės vardas.'),(1065,'Gvidas',' Gvidas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Gvidonas: witu „giria, miškas“.','Vardo reikšmė: Gvidai meilės dalykuose stengiasi nurungti partnerį, tačiau tas, likdamas meilus ir paslaugus, turi stengtis neprarasti iniciatyvos.',' Gvidas yra vokiečių kilmės vardas.'),(1066,'Gutautė',' Gutautė yra Moteriškas vardas.','Trumpa reikšmė: gu- (guso, gusti „įprasti“) + taut- (tauta) – „įpratęs prie tautos“.','Vardo reikšmė: Gutautė – (1) liet., trump. Gutė, iš vyr. v. Gutautas.',' Gutautė yra lietuvių kilmės vardas.'),(1067,'Gutautas',' Gutautas yra Vyriškas vardas.','Trumpa reikšmė: gu- (guso, gusti „įprasti“) + taut- (tauta) – „įpratęs prie tautos“.','Vardo reikšmė: Gutautas – (1) liet., trump. Gutys, gu- kilęs iš gud- (žr. Gudminas) + taut (žr. Gantautas).',' Gutautas yra lietuvių kilmės vardas.'),(1068,'Gustina',' Gustina yra Moteriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Augustina.','Vardo reikšmė: Jūs galite būti geri teisininkai, medikai, literatūros tyrinėtojai, valstybės vadovai. Socialinis darbas, pedagogika, psichologija, netradicinė medicina – taip pat puikus pasirinkimas, nes jie moka visus išklausyti bei giliai analizuoti. Jus galite būti sapnų pasaulio aiškintojai.',' Gustina yra lietuvių kilmės vardas.'),(1069,'Gustavas',' Gustavas yra Vyriškas vardas.','Trumpa reikšmė: gu- „kova“ + stav- „lazda“ – „kovos įnagis“.','Vardo reikšmė: Gustus galima būtų apibendrinti trimis žodžiais: tikėjimas, viltis ir meilė. Nors sakoma, kad juos veikia Venera, tačiau daugeliu atveju jų meilę galima pavadinti labiau motiniška, negu jausmine. Meilėje jie vadovaujasi romantizmu ir idealizmu.',' Gustavas yra skandinavų kilmės vardas.'),(1070,'Gustė',' Gustė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Gustautė gusti „priprasti“ arba iš lotynų Augustė „garbinga, didinga“.','Vardo reikšmė: Gustė – (2) 1. liet. trumpinys iš Augustė, 2. liet., trumpinys iš Gustautė.',' Gustė yra lietuvių kilmės vardas.'),(1071,'Gustava',' Gustava yra Moteriškas vardas.','Trumpa reikšmė: gu- „kova“ + stav- „lazda“ – „kovos įnagis“.','Vardo reikšmė: Gustava – (1) skand., trump. Gustė, iš vyr. v. Gustavus, žr. Gustavas.',' Gustava yra skandinavų kilmės vardas.'),(1072,'Gustautas',' Gustautas yra Vyriškas vardas.','Trumpa reikšmė: gus- (gusti „priprasti“) + taut- (tauta).','Vardo reikšmė: Gustautas – (1) liet., trump. Gustas, Gustys, gus- kilęs iš gust- (, liet. gust-ų, gusti) + taut- (žr. Gantautas).',' Gustautas yra lietuvių kilmės vardas.'),(1073,'Gustautė',' Gustautė yra Moteriškas vardas.','Trumpa reikšmė: gus- (gusti „priprasti“) + taut- (tauta).','Vardo reikšmė: Gustautė – (1) liet., trump. Guste, iš vyr. v. Gustautas.',' Gustautė yra lietuvių kilmės vardas.'),(1074,'Guostė',' Guostė yra Moteriškas vardas.','Trumpa reikšmė: iš upėvardžio Guostė (Stakliškės).','Vardo reikšmė: Guostė – (1) liet., iš upėvardžio Guostė (Stakliškės).',' Guostė yra lietuvių kilmės vardas.'),(1075,'Gražinė',' Gražinė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Gražė, iš vyr. v. Gražinis.','Vardo reikšmė: Kartais Gražinos profesiją pasirenka finansų, statistikos, ekonomikos srityse. Susiklosčius negatyvioms aplinkybėms, Gražinos patiria finansinių sunkumų ir tada jos įpuola į depresiją',' Gražinė yra lietuvių kilmės vardas.'),(1076,'Gražina',' Gražina yra Moteriškas vardas.','Trumpa reikšmė: graži „gražuolė“, A. Mickevičiaus poemos „Gražina“ veikėja.','Vardo reikšmė: Vardadieniai: balandžio mėn. 1 d., rugsėjo mėn. 8 d., rugsėjo mėn. 26 d. – Gražinos vardo dienos.',' Gražina yra lietuvių kilmės vardas.'),(1077,'Gražė',' Gražė yra Moteriškas vardas.','Trumpa reikšmė: liet., trumpinys iš Gražina.','Vardo reikšmė: Kartais Gražinos profesiją pasirenka finansų, statistikos, ekonomikos srityse. Susiklosčius negatyvioms aplinkybėms, Gražinos patiria finansinių sunkumų ir tada jos įpuola į depresiją.',' Gražė yra lietuvių kilmės vardas.'),(1078,'Gratas',' Gratas yra Vyriškas vardas.','Trumpa reikšmė: grata „maloni, miela“.','Vardo reikšmė: Šie vardo turėtojai iš pažiūros atrodo abejingi viskam, tačiau tai tik elgesio maniera, po kuria slepiasi didžiuliai dvasiniai išgyvenimai. Jie emocijas slepia viduje, o tai greitai atsiliepia į jų sveikatą – virškinimo ir nervų sistemoms.',' Gratas yra lotynų kilmės vardas.'),(1079,'Grata',' Grata yra Moteriškas vardas.','Trumpa reikšmė: lot., iš lot. Grata: lot. grata „maloni, miela“.','Vardo reikšmė: Šie vardo turėtojai iš pažiūros atrodo abejingi viskam, tačiau tai tik elgesio maniera, po kuria slepiasi didžiuliai dvasiniai išgyvenimai. Jie emocijas slepia viduje, o tai greitai atsiliepia į jų sveikatą – virškinimo ir nervų sistemoms.',' Grata yra lotynų kilmės vardas.'),(1080,'Grasilda',' Grasilda yra Moteriškas vardas.','Trumpa reikšmė: grisja „pilkas“+ hild „kova“.','Vardo reikšmė: .',' Grasilda yra vokiečių kilmės vardas.'),(1081,'Gracius',' Gracius yra Vyriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Gracijonas, Gracijus.','Vardo reikšmė: Gracijai retai kada būna turtingi. Jie visiškai nemoka elgtis su savo finansais, todėl būtų protingiausia šiuos reikalus atiduoti žmonai arba artimiesiems.',' Gracius yra lotynų kilmės vardas.'),(1082,'Gracijus',' Gracijus yra Vyriškas vardas.','Trumpa reikšmė: gratia „žavumas, grakštumas“.','Vardo reikšmė: Gracijai retai kada būna turtingi. Jie visiškai nemoka elgtis su savo finansais, todėl būtų protingiausia šiuos reikalus atiduoti žmonai arba artimiesiems.',' Gracijus yra lotynų kilmės vardas.'),(1083,'Gracijonas',' Gracijonas yra Vyriškas vardas.','Trumpa reikšmė: gratia „žavumas, grakštumas“.','Vardo reikšmė: Gracijai retai kada būna turtingi. Jie visiškai nemoka elgtis su savo finansais, todėl būtų protingiausia šiuos reikalus atiduoti žmonai arba artimiesiems.',' Gracijonas yra lotynų kilmės vardas.'),(1084,'Gracija',' Gracija yra Moteriškas vardas.','Trumpa reikšmė: gratia „žavumas, grakštumas“.','Vardo reikšmė: Jūs labai atjaučiantys, todėl nėra geresnių slaugytojų už jus. Tačiau dvasinis mąstymas ribotas. Bažnyčią lankote tik dėl to, kad bijote, jog kiti gali blogai apie jus pagalvoti. Jūs puikiausiai suprantate savo prasižengimus šiame pasaulyje, tačiau anapusinis pasaulis jūsų nedomina.',' Gracija yra lotynų kilmės vardas.'),(1085,'Govartė',' Govartė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Govė, iš vyr. v. Govartas.','Vardo reikšmė: Govartė – (1) liet., trump. Govė, iš vyr. v. Govartas.',' Govartė yra lietuvių kilmės vardas.'),(1086,'Govartas',' Govartas yra vyriškas vardas.','Trumpa reikšmė: liet., trump. Govas, go- (žr. Gomantas) + vart- (: liet. vart-yti, vart-o).','Vardo reikšmė: Govartas – (1) liet., trump. Govas, go- (žr. Gomantas) + vart- (: liet. vart-yti, vart-o).',' Govartas yra lietuvių kilmės vardas.'),(1087,'Gotfridas',' Gotfridas yra Vyriškas vardas.','Trumpa reikšmė: got „dievas“ + fridu „taika“.','Vardo reikšmė: Gotfridas – (1) vok., trump. Gotas, Fridas, baž. lot. Godefridus, Gottfridus iš vok. Gottfried: sen. vok. aukšt. got „dievas“ + fridu „taika“.',' Gotfridas yra vokiečių kilmės vardas.'),(1088,'Grigas',' Grigas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Grigalius: „budriai budintis“.','Vardo reikšmė: Grigas – (2) liet. trumpinys iš Grigalius.',' Grigas yra graikų kilmės vardas.'),(1089,'Gotautė',' Gotautė yra Moteriškas vardas.','Trumpa reikšmė: go- (godyti „nujausti, nutuokti“) + taut- (tauta).','Vardo reikšmė: Gotautė – (1) liet., trump. Gotė, iš vyr. v. Gotautas.',' Gotautė yra lietuvių kilmės vardas.'),(1090,'Grigalius',' Grigalius yra Vyriškas vardas.','Trumpa reikšmė: „budriai budintis“.','Vardo reikšmė: Vardadienis: Sausio 2 d., gegužės 9 d., birželio 17 d., rugsėjo 3 d.',' Grigalius yra graikų kilmės vardas.'),(1091,'Gundas',' Gundas yra Vyriškas vardas.','Trumpa reikšmė: gundyti „kurstyti, prikalbėti“ – „gundytojas, kurstytojas“.','Vardo reikšmė: Šie vardo turėtojai labai prisirišę prie šeimos. Sekso srityje jiems būtina dominuoti. Jei partnerei neprieštarauja, gali griebtis grubiausios fizinės jėgos. Kai jie susižavi ar kažko užsinori – geriau saugotis jų. Labai kūribingi ir užsispyrę žmonės.',' Gundas yra lietuvių kilmės vardas.'),(1092,'Gražvilė',' Gražvilė yra Moteriškas vardas.','Trumpa reikšmė: graž- (gražus) + vil- (viltis) – „graži viltis“.','Vardo reikšmė: Gražvilė – (1), (2) liet., trump. Gražė, iš vyr. v. Gražvilas.',' Gražvilė yra lietuvių kilmės vardas.'),(1093,'Gunda',' Gunda yra Moteriškas vardas.','Trumpa reikšmė: gundyti – „gundytoja“.','Vardo reikšmė: Šie vardo turėtojai labai prisirišę prie šeimos. Sekso srityje jiems būtina dominuoti. Jei partnerei neprieštarauja, gali griebtis grubiausios fizinės jėgos. Kai jie susižavi ar kažko užsinori – geriau saugotis jų. Labai kūribingi ir užsispyrę žmonės.',' Gunda yra lietuvių kilmės vardas.'),(1094,'Gražvilas',' Gražvilas yra Vyriškas vardas.','Trumpa reikšmė: graž- (gražus) + vil- (viltis) – „graži viltis“.','Vardo reikšmė: Gražvilas – (1) liet., trump. Gražys, graž- (žr. Gražmantas) + vil- (žr. Gaivilas).',' Gražvilas yra lietuvių kilmės vardas.'),(1095,'Gudvinas',' Gudvinas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Gudvas, Gudvys, gud- (žr. Gudminas) + vin- (žr. Gaudvinas).','Vardo reikšmė: Šie vardo turėtojai labai prisirišę prie šeimos. Sekso srityje jiems būtina dominuoti. Jei partnerei neprieštarauja, gali griebtis grubiausios fizinės jėgos. Kai jie susižavi ar kažko užsinori – geriau saugotis jų. Labai kūribingi ir užsispyrę žmonės.',' Gudvinas yra lietuvių kilmės vardas.'),(1096,'Gražvydas',' Gražvydas yra Vyriškas vardas.','Trumpa reikšmė: graž- (gražus) + vyd- (iš-vydo) – „grožį išvydęs“.','Vardo reikšmė: Gražvydas – (1) liet., trump. Gražys, graž- (žr. Gražmantas) + vyd- (žr. Galvydas).',' Gražvydas yra lietuvių kilmės vardas.'),(1097,'Hermas',' Hermas yra Vyriškas vardas.','Trumpa reikšmė: Hermis,1. graik., iš sulotyninto graik. Hermes, kuris iš mitologinio graikų vardo Hermes — Hermis, dievų pasiuntinys, 2. liet. trumpinys iš vok. Hermanas.','Vardo reikšmė: Hermanai turi geros sveikatos ir nekreipia dėmesio į ligos simptomus. Nors jie lyderiai, tačiau turi gerą širdį ir dvasiškai pažeidžiami.',' Hermas yra graikų kilmės vardas.'),(1098,'Gudvilė',' Gudvilė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Gudvė, iš vyr. v. Gudvilas.','Vardo reikšmė: Gudvilė – (1), (2) liet., trump. Gudvė, iš vyr. v. Gudvilas.',' Gudvilė yra lietuvių kilmės vardas.'),(1099,'Hermanas',' Hermanas yra Vyriškas vardas.','Trumpa reikšmė: heri „kariuomenė“ + man „vyras“ – „kariuomenės vadas“.','Vardo reikšmė: Hermanai turi geros sveikatos ir nekreipia dėmesio į ligos simptomus. Nors jie lyderiai, tačiau turi gerą širdį ir dvasiškai pažeidžiami.',' Hermanas yra vokiečių kilmės vardas.'),(1100,'Gražvaldė',' Gražvaldė yra moteriškas vardas.','Trumpa reikšmė: liet., trump. Gražė, iš vyr. v. Gražvaldas.','Vardo reikšmė: Gražvaldė – (1) liet., trump. Gražė, iš vyr. v. Gražvaldas.',' Gražvaldė yra lietuvių kilmės vardas.'),(1101,'Herkus',' Herkus yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš iš Henrikas heim „namai“ + richi „galingas vadovas“ – „namų valdovas“.','Vardo reikšmė: Jūs – laisvi žmonės, kurie mėgsta permainas, nuotykius ir pasilinksminimus. Jie saugo savo laisvę ir, kaip paukštis be sparnų, negali egzistuoti be jos. Jie labai lengvai prisitaiko. Permainos – jiems malonumas, o bet koks trukdymas – katastrofa.',' Herkus yra vokiečių kilmės vardas.'),(1102,'Gražvaldas',' Gražvaldas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Gražys, graž- (žr. Gražmantas) + vald- (žr. Gedvaldas).','Vardo reikšmė: Gražvaldas – (1) liet., trump. Gražys, graž- (žr. Gražmantas) + vald- (žr. Gedvaldas).',' Gražvaldas yra lietuvių kilmės vardas.'),(1103,'Gudvilas',' Gudvilas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Gudvas, Gudvys, gud- (žr. Gudminas) + vil- (žr. Gaivilas).','Vardo reikšmė: Gudvilas – (1) liet., trump. Gudvas, Gudvys, gud- (žr. Gudminas) + vil- (žr. Gaivilas).',' Gudvilas yra lietuvių kilmės vardas.'),(1104,'Gudvainė',' Gudvainė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Gudvė, iš vyr. v. Gudvainas.','Vardo reikšmė: Šie vardo turėtojai labai prisirišę prie šeimos. Sekso srityje jiems būtina dominuoti. Jei partnerei neprieštarauja, gali griebtis grubiausios fizinės jėgos. Kai jie susižavi ar kažko užsinori – geriau saugotis jų. Labai kūribingi ir užsispyrę žmonės.',' Gudvainė yra lietuvių kilmės vardas.'),(1105,'Herbertas',' Herbertas yra Vyriškas vardas.','Trumpa reikšmė: heri „kariuomenė“ + beraht „garsus, žymus“.','Vardo reikšmė: Šie vardo turėtojai nuo vaikystės svajoja apie tolimus kraštus, naujas keliones ir egzotiką. Jie norėtų išbandyti gyvenime nors vieną kartą viską. Jiems visas gyvenimas – žaidimų aikštelė. Tokia nuostata gali jiems daug kainuoti, nes gali išsekti savi resursai – biologiniai ar socialiniai.',' Herbertas yra vokiečių kilmės vardas.'),(1106,'Gudvainas',' Gudvainas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Gudvas, Gudvys, gud- (žr. Gudminas) + vain- (žr. Galvainas).','Vardo reikšmė: Šie vardo turėtojai mėgsta skaniai ir sočiai pavalgyti bei išgerti. Gali piktnaudžiauti seksu ir narkotikais. Jie turi talentą generuoti naujas idėjas; puikios rankos. Mėgsta visa, kas nauja ir neištirta. Jie protingi, tačiau mąstymo procesas, kaip ir pats gyvenimas, neorganizuotas ir išbarstytas.',' Gudvainas yra lietuvių kilmės vardas.'),(1107,'Gražmintė',' Gražmintė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Gražė, iš vyr. v. Gražmintas.','Vardo reikšmė: Gražmintė – (1) liet., trump. Gražė, iš vyr. v. Gražmintas.',' Gražmintė yra lietuvių kilmės vardas.'),(1108,'Heraklis',' Heraklis yra Vyriškas vardas.','Trumpa reikšmė: „Heros šlovė“, Hera – graikų santuokos deivė; sen. graikų mitų didvyras, pagarsėjęs didele jėga.','Vardo reikšmė: Heraklis – (2) graik., sen. var. Heraklas, Heraklijus, Iraklijus, baž. lot. Heraklius iš graik. Herakles – „Heros šlovė“: Hera — sen. graikų santuokos deivė + kleos „šlovė“.',' Heraklis yra graikų kilmės vardas.'),(1109,'Gražmintas',' Gražmintas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Gražys, graž- (žr. Gražmantas) + mint- (žr. Gedmintas).','Vardo reikšmė: Gražmintas – (1) liet., trump. Gražys, graž- (žr. Gražmantas) + mint- (žr. Gedmintas).',' Gražmintas yra lietuvių kilmės vardas.'),(1110,'Gudrė',' Gudrė yra Moteriškas vardas.','Trumpa reikšmė: gudri.','Vardo reikšmė: Gudrė – (2) liet., galūnės vedinys iš liet. gudri.',' Gudrė yra lietuvių kilmės vardas.'),(1111,'Hubertas',' Hubertas yra Vyriškas vardas.','Trumpa reikšmė: hugu „dvasia“ + beraht „garsus, žymus“.','Vardo reikšmė: Hubertas – (1) germ., trump. Bertas, tarm. Ubertas, iš sulotyninto germ. Hubertus, kuris iš sen. germ. Hugubert: sen. vok. aukšt. hugu „dvasia“ + beraht „garsus, žymus“.',' Hubertas yra vokiečių kilmės vardas.'),(1112,'Henris',' Henris yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Henrikas heim „namai“ + richi „galingas vadovas“ – „namų valdovas“.','Vardo reikšmė: Henriai linkę į boheminį gyvenimą. Greitai užsiliepsnoja, labai impulsyvūs ir todėl kaip linkę romantiškiems meilės ryšiams.',' Henris yra vokiečių kilmės vardas.'),(1113,'Gražmantė',' Gražmantė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Gražė, iš vyr. v. Gražmantas.','Vardo reikšmė: Jūs labai stiprus, valingas, kartais tiesiog nesuvaldomas charakteris, kuris pasireiškia visose gyvenimo sferose, taip pat ir su moterimis. Norėdami pasiekti savo, jie naudoja įvairius būdus, sugeba būti klastingi ir apgaunantys, dažnai tokiu elgesiu susikuria sau sunkumų ten, kur jų nėra.',' Gražmantė yra lietuvių kilmės vardas.'),(1114,'Gudminas',' Gudminas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Gudmius, Gudmas, gud- (: liet. gusti, gud-o „prasti“) + min- (žr. Gailiminas).','Vardo reikšmė: Šiems vardų turėtojamss labai gerai sekasi turtiniuose reikaluose, ir jie triumfuoja investavę į labai brangius projektus. Jie stichiški ir plačių užmojų žmonės, kurių veiksmus sunku numatyti. Tai visų darbų meistrai !',' Gudminas yra lietuvių kilmės vardas.'),(1115,'Hortenzija',' Hortenzija yra Moteriškas vardas.','Trumpa reikšmė: „sodininkė“.','Vardo reikšmė: Šie vardo savininkai gali būti labai intelektualūs ir domėtis bet kuo, tačiau viskas kas susiję su paslaptimis, senove ir menu jį gali traukti labiausiai. Be to jam ypač gali sektis mechanikos ir elektronikos srityse. Tai protingo, talentingo ir mažai kuo pasikliaujančio žmogaus vardas. ',' Hortenzija yra lotynų kilmės vardas.'),(1116,'Henrikas',' Henrikas yra Vyriškas vardas.','Trumpa reikšmė: heim „namai“ + richi „galingas vadovas“ – „namų valdovas“.','Vardo reikšmė: Henrikų profesijos: išradėjai, pažangūs mokslininkai, hipnotizuotojai, politikai, medikai, žurnalistai',' Henrikas yra vokiečių kilmės vardas.'),(1117,'Gražmantas',' Gražmantas yra vyriškas vardas.','Trumpa reikšmė: liet., trump. Gražys, graž- (: liet. graž-us) + mant- (žr. Gailimantas).','Vardo reikšmė: Jūs labai stiprus, valingas, kartais tiesiog nesuvaldomas charakteris, kuris pasireiškia visose gyvenimo sferose, taip pat ir su moterimis. Norėdami pasiekti savo, jie naudoja įvairius būdus, sugeba būti klastingi ir apgaunantys, dažnai tokiu elgesiu susikuria sau sunkumų ten, kur jų nėra.',' Gražmantas yra lietuvių kilmės vardas.'),(1118,'Honorijus',' Honorijus yra Vyriškas vardas.','Trumpa reikšmė: honor „garbė“.','Vardo reikšmė: Honorijus – (1) lot., trump. Honoras, Honas, iš lot. Honorius: lot. honor „garbė“.',' Honorijus yra lotynų kilmės vardas.'),(1119,'Helmutas',' Helmutas yra Vyriškas vardas.','Trumpa reikšmė: helm „šalmas, apsauga“ + muot „nusistatymas, nusiteikimas“.','Vardo reikšmė: Helmutas – (1) vok., trump. Helmas, Helmis, iš vok. Helmut: sen. vok. aukšt. helm „šalmas, apsauga“ + muot „nusistatymas, nusiteikimas“.',' Helmutas yra vokiečių kilmės vardas.'),(1120,'Gražys',' Gražys yra Vyriškas vardas.','Trumpa reikšmė: liet., trumpinys iš Gražvydas, Gražvilas ir kt.','Vardo reikšmė: Gražys – (4) liet., trumpinys iš Gražvydas, Gražvilas ir kt.',' Gražys yra lietuvių kilmės vardas.'),(1121,'Grožvyda',' Grožvyda yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Grožė, iš Vydūno dramos „Amžina ugnis“ herojės vardo: grož- (: liet. grožis) + vyd- (: liet. iš-vysti, iš-vyd-o).','Vardo reikšmė: Šie vardo savininkai gali būti labai intelektualūs ir domėtis bet kuo, tačiau viskas kas susiję su paslaptimis, senove ir menu jį gali traukti labiausiai. Be to jam ypač gali sektis mechanikos ir elektronikos srityse. Tai protingo, talentingo ir mažai kuo pasikliaujančio žmogaus vardas. ',' Grožvyda yra lietuvių kilmės vardas.'),(1122,'Honoratas',' Honoratas yra Vyriškas vardas.','Trumpa reikšmė: honoratus „gerbiamas, -a“.','Vardo reikšmė: Honoratas – (2) lot., trump. Honoras, Honas, iš lot. Honoratus: lot. honoratus „gerbiamas, garbingas“.',' Honoratas yra lotynų kilmės vardas.'),(1123,'Heliodoras',' Heliodoras yra Vyriškas vardas.','Trumpa reikšmė: „saulės dovana“.','Vardo reikšmė: Heliodoras – (2) graik., trump. Helas, Doras, iš sulotyninto graik. Heliodorus: graik. helios „saulė“ + doron „dovana“.',' Heliodoras yra graikų kilmės vardas.'),(1124,'Gražinis',' Gražinis yra Vyriškas vardas.','Trumpa reikšmė: Gražus.','Vardo reikšmė: Jūsų gyvenimas kiaurai persmelktas jūsų įsitikinimų. Jūs švytite, intuityvūs, atviri, emocionalūs ir išradingi. Galite būti stiprūs dvasiškai. Jūsų teigiamos savybės: artistiškumas, potraukis į nežabotas linksmybes, polinkis į kūrybą, romantiškumas, aistringumas, linksmumas, platūs interesai.',' Gražinis yra lietuvių kilmės vardas.'),(1125,'Honorata',' Honorata yra Moteriškas vardas.','Trumpa reikšmė: honoratus „gerbiamas, -a“.','Vardo reikšmė: Honorata – (2) lot., trump. Honora, Hona, tarm. Onorata piet. aukšt., Genorata ryt. aukšt. (Kupiškis), iš lot. Honorata: lot. honorata „gerbiama, garbinga“',' Honorata yra lotynų kilmės vardas.'),(1126,'Helianta',' Helianta yra Moteriškas vardas.','Trumpa reikšmė: „pakalnutė“.','Vardo reikšmė: Helianta – (1) graik., trump. Helė, iš graik. Helianthe – „pakalnutė“: graik. helios„saulė“ + anthos „žiedas“.',' Helianta yra graikų kilmės vardas.'),(1127,'Grintautė',' Grintautė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Grinė, Grintė, iš vyr. v. Grintautas.','Vardo reikšmė: Grintautė – (1) liet., trump. Grinė, Grintė, iš vyr. v. Grintautas.',' Grintautė yra Lietuvių kilmės vardas.'),(1128,'Imantė',' Imantė yra Moteriškas vardas.','Trumpa reikšmė: liet. ir latv., trump. Imė, Mantė, iš vyr. v. Imantas.','Vardo reikšmė: Imantė – (1) liet. ir latv., trump. Imė, Mantė, iš vyr. v. Imantas.',' Imantė yra lietuvių kilmės vardas.'),(1129,'Hildegarda',' Hildegarda yra Moteriškas vardas.','Trumpa reikšmė: germ., trump. Hilda, Garda, baž. lot. Hildegardis iš germ. Hildegard: sen. vok. aukšt. hiltja „kova“ + sen. saksų gard „gardas, aptvaras“.','Vardo reikšmė: Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais.',' Hildegarda yra vokiečių kilmės vardas.'),(1130,'Grintautas',' Grintautas yra Vyriškas vardas.','Trumpa reikšmė: grin- (grynas „tyras, doras“) + taut- (tauta).','Vardo reikšmė: Grintautas – (1) liet., trump. Grinys, Grintas, grin- (: liet. grynas „tyras, doras“) + taut- (žr. Gantautas).',' Grintautas yra lietuvių kilmės vardas.'),(1131,'Helė',' Helė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Helianta: „pakalnutė“.','Vardo reikšmė: Helė – (2) graik. trumpinys iš Helianta.',' Helė yra graikų kilmės vardas.'),(1132,'Imantas',' Imantas yra Vyriškas vardas.','Trumpa reikšmė: liet. ir latv., trump. Imas, Mantas, i- iš im- (:liet. im-ti, im-a) + mant- (: liet. mant-us „sumanus“).','Vardo reikšmė: Imantas – (1) liet. ir latv., trump. Imas, Mantas, i- iš im- (:liet. im-ti, im-a) + mant- (: liet. mant-us „sumanus“).',' Imantas yra lietuvių kilmės vardas.'),(1133,'Hilda',' Hilda yra Moteriškas vardas.','Trumpa reikšmė: „kova“ – „kovinga mergaitė“.','Vardo reikšmė: Hilda – (1) germ., baž. lot. Hilda iš germ. Hilda, Hilde, sen. vok. aukšt. hiltja „kova“.',' Hilda yra vokiečių kilmės vardas.'),(1134,'Helga',' Helga yra Moteriškas vardas.','Trumpa reikšmė: „sveika, laiminga“.','Vardo reikšmė: Jūs esate tikri romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jūsų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose..',' Helga yra skandinavų kilmės vardas.'),(1135,'Hektoras',' Hektoras yra Vyriškas vardas.','Trumpa reikšmė: „tvirtai laikantis“.','Vardo reikšmė: Jūs gerai numatote vedybų perspektyvas, ir jeigu vedate ar ištekate, tai tik su dideliu kraičiu. Kartais gaunate didelį palikimą iš tolimų giminaičių. Su antrąja puse gyvenate labai paslaptingą ir keistą gyvenimą.',' Hektoras yra graikų kilmės vardas.'),(1136,'Haroldas',' Haroldas yra Vyriškas vardas.','Trumpa reikšmė: har- „kariuomenė“ + baldan „valdyti“ – „valdantis kariuomenę“.','Vardo reikšmė: Haroldas – (1) germ., trump. Haris, skand. vardo Harald variantas, žr. Haraldas.',' Haroldas yra skandinavų kilmės vardas.'),(1137,'Ilona',' Ilona yra Moteriškas vardas.','Trumpa reikšmė: iš graikiško Helena „šviesioji“.','Vardo reikšmė: Ilonoms geriausiai sekasi reklaminis darbas. Kai kurios dirba komercijoje. Teatras – štai arena, kurioje jos gali pilnai atsiskleisti. Ir dar – politika.',' Ilona yra vengrų kilmės vardas.'),(1138,'Ilma',' Ilma yra Moteriškas vardas.','Trumpa reikšmė: iš upėvardžio Ilma (Pabradė).','Vardo reikšmė: Ilma – (1) liet., iš upėvardžio Ilma (Pabradė).',' Ilma yra lietuvių kilmės vardas.'),(1139,'Hiacintas',' Hiacintas yra Vyriškas vardas.','Trumpa reikšmė: hiacintas (augalas), graikų augalų dievas.','Vardo reikšmė: Vardadienis: Rugpjūčio 17 d., rugsėjo 11 d.',' Hiacintas yra graikų kilmės vardas.'),(1140,'Haraldas',' Haraldas yra vyriškas vardas.','Trumpa reikšmė: skand., trump. Haris, baž. lot. Haroldus iš skandinavų Harald : har- (iš heri) „kariuomenė“.','Vardo reikšmė: Haraldas – (1) skand., trump. Haris, baž. lot. Haroldus iš skandinavų Harald : har- (iš heri) „kariuomenė“ + waldan „valdyti“.',' Haraldas yra skandinavų kilmės vardas.'),(1141,'Iliuminata',' Iliuminata yra moteriškas vardas.','Trumpa reikšmė: lot., trump. Ilė, Nata, iš lot. Iliuminata: lot. illuminata „apšviesta“.','Vardo reikšmė: Iliuminata – (2) lot., trump. Ilė, Nata, iš lot. Iliuminata: lot. illuminata „apšviesta“',' Iliuminata yra lotynų kilmės vardas.'),(1142,'Hiacinta',' Hiacinta yra Moteriškas vardas.','Trumpa reikšmė: hiacintas (augalas), graikų augalų dievas.','Vardo reikšmė: Hiacinta – (1) graik., var. Jacinta (1), trump. Cinta, iš sulotyninto graik. Hyacintha, kuris iš vyr. v. Hyacinthus, žr. Hiacintas.',' Hiacinta yra graikų kilmės vardas.'),(1143,'Ildefonsas',' Ildefonsas yra Vyriškas vardas.','Trumpa reikšmė: germ., trump. Ildas, baž. lot. Ildefonsus iš germ. Hildefuns: sen. vok. aukšt. hiltja „kova“ + „ūmus, karštas“.','Vardo reikšmė: Ildefonsas – (1) germ., trump. Ildas, baž. lot. Ildefonsus iš germ. Hildefuns: sen. vok. aukšt. hiltja „kova“ + „ūmus, karštas“.',' Ildefonsas yra vokiečių kilmės vardas.'),(1144,'Ignotas',' Ignotas yra Vyriškas vardas.','Trumpa reikšmė: „ugningas, -a; liepsningas, -a“.','Vardo reikšmė: Vardadienis: Vasario 1 d., liepos 31 d., spalio 7 d.',' Ignotas yra lotynų kilmės vardas.'),(1145,'Ignė',' Ignė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Ignacijus ar Ignotas: „ugningas, -a; liepsningas, -a“.','Vardo reikšmė: Ignė – sulietuvintas trumpinys iš lotynų kilmės vardo Ignacija.',' Ignė yra lotynų kilmės vardas.'),(1146,'Ignacijus',' Ignacijus yra Vyriškas vardas.','Trumpa reikšmė: „ugningas, -a; liepsningas, -a“.','Vardo reikšmė: Vardadienis: Vasario 11 d., liepos 30 d.',' Ignacijus yra lotynų kilmės vardas.'),(1147,'Ignacija',' Ignacija yra Moteriškas vardas.','Trumpa reikšmė: „ugningas, -a; liepsningas, -a“.','Vardo reikšmė: Ignacija – (1) lot., trump. Igna, Ignė, iš lot. Ignatia, kuris iš vyr. v. Ignatius, žr. Ignacijus.',' Ignacija yra lotynų kilmės vardas.'),(1148,'Ignacas',' Ignacas yra Vyriškas vardas.','Trumpa reikšmė: „ugningas, -a; liepsningas, -a“.','Vardo reikšmė: Vardadienis: liepos 31 d., spalio 17 d.',' Ignacas yra lotynų kilmės vardas.'),(1149,'Ifigenija',' Ifigenija yra Moteriškas vardas.','Trumpa reikšmė: graik., trump. Ifigenė, Genė, baž. lot. Iphigenia iš graik. Iphigeneia — „karališkos giminės“ : graik. ifi- „jėga, valdžia“ + genos „giminė“.','Vardo reikšmė: Turite stipriai išreikštą kūno energetiką. Šie vardo savininkai rūpinasi materialine ateitimi, apie tai, kas būtina pasiturinčiam gyvenimui, ir tai jiems sekasi gana gerai, nes jie tikri finansų genijai; žino, kur taupyti ir kaip paskirstyti pinigus. ',' Ifigenija yra graikų kilmės vardas.'),(1150,'Ieva',' Ieva yra Moteriškas vardas.','Trumpa reikšmė: „gyvybinga, gyvenimo davėja“.','Vardo reikšmė: Ievos gali būti ateityje puikios mokslininkės ir revoliucionierės, svajojančios sukurti laimingą rytojų. Tai gėrio simbolis.',' Ieva yra hebrajų kilmės vardas.'),(1151,'Ira',' Ira yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Irena: „taika, ramybė“.','Vardo reikšmė: Ira – (2) 1. hebr., iš hebr. Ira – „atsargi“, 2. liet. trumpinys iš Irena.',' Ira yra graikų kilmės vardas.'),(1152,'Ipolitas',' Ipolitas yra Vyriškas vardas.','Trumpa reikšmė: „arklių iškinkytojas“.','Vardo reikšmė: Ipolitams patartina vengti piktnaudžiavimo alkoholiniais gėrimais, kurie jiems gali sukelti kepenų ir inkstų susirgimus. Jie linkę į šiuos susirgimus.',' Ipolitas yra graikų kilmės vardas.'),(1153,'Inocentas',' Inocentas yra Vyriškas vardas.','Trumpa reikšmė: „nekaltas, doras“.','Vardo reikšmė: Jūs apsigimę kolekcionieriai. Jūsų namuose daugybė įdomių daiktų. Sienas puošia antikvariniai paveikslai, turi daug muzikos įrašų. Jūsų profesijos: ekonomistai, teisininkai, mokslininkai, rašytojai, profesionalūs sportininkai, dvasininkai, slaptieji agentai, šnipai.',' Inocentas yra lotynų kilmės vardas.'),(1154,'Inocenta',' Inocenta yra Moteriškas vardas.','Trumpa reikšmė: „nekaltas, doras“.','Vardo reikšmė: Jūs apsigimę kolekcionieriai. Jūsų namuose daugybė įdomių daiktų. Sienas puošia antikvariniai paveikslai, turi daug muzikos įrašų. Jūsų profesijos: ekonomistai, teisininkai, mokslininkai, rašytojai, profesionalūs sportininkai, dvasininkai, slaptieji agentai, šnipai.',' Inocenta yra lotynų kilmės vardas.'),(1155,'Ingvaras',' Ingvaras yra Vyriškas vardas.','Trumpa reikšmė: „dievo Ingo armija, kariauna“; Ingas – skandinavų derliaus dievas.','Vardo reikšmė: (1) skand., trump. Ingas, Ingis, iš skand. Ingvarr — „(dievo) Ingo saugomas“',' Ingvaras yra skandinavų kilmės vardas.'),(1156,'Ingrida',' Ingrida yra Moteriškas vardas.','Trumpa reikšmė: „dievo Ingo ratai“, Ingas – skandinavų derliaus dievas.','Vardo reikšmė: Ingridas traukia meno horizontai ir noras visus valdyti. Labai didelį vaidmenį gyvenime vaidina draugai. Daugelis mano, kad jos draugiškos ir filantropės. Ne veltui jos aktyviai padeda kitiems žmonėms pinigais ir patarimais.',' Ingrida yra skandinavų kilmės vardas.'),(1157,'Irvaidas',' Irvaidas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Irvas, Vaidas, ir- (žr. Irdangas) + vaid- (: liet. vaid-ytis „rodytis“, vaid-entis).','Vardo reikšmė: Irvaidas – (1) liet., trump. Irvas, Vaidas, ir- (žr. Irdangas) + vaid- (: liet. vaid-ytis „rodytis“, vaid-entis).',' Irvaidas yra lietuvių kilmės vardas.'),(1158,'Ineza',' Ineza yra Moteriškas vardas.','Trumpa reikšmė: variantas Agnė (Agnez/ Inez) iš graikų: „tyra“.','Vardo reikšmė: Ineza – (2) isp., trump. Ina, Inė, iš isp. Inez, kuris yra ispaniškas vardo Agnė variantas.',' Ineza yra lietuvių kilmės vardas.'),(1159,'Irtuona',' Irtuona yra Moteriškas vardas.','Trumpa reikšmė: liet., iš upėvardžio Irtuona (Tauragė).','Vardo reikšmė: Irtuona – (1) liet., iš upėvardžio Irtuona (Tauragė).',' Irtuona yra lietuvių kilmės vardas.'),(1160,'Irtautė',' Irtautė yra Moteriškas vardas.','Trumpa reikšmė: ir (ir, irgi) + taut- (tauta) – „irgi iš tautos, palaikantis tautą“.','Vardo reikšmė: Irtautė – (1) liet., trump. Irtė, Tautė, iš vyr. v. Irtautas.',' Irtautė yra lietuvių kilmės vardas.'),(1161,'Irtautas',' Irtautas yra Vyriškas vardas.','Trumpa reikšmė: ir (ir, irgi) + taut- (tauta) – „irgi iš tautos, palaikantis tautą“.','Vardo reikšmė: Irtautas – (1) liet., trump. Irtas, Tautas, ir- (žr. Irdangas) + taut- (: liet. tauta).',' Irtautas yra lietuvių kilmės vardas.'),(1162,'Indrė',' Indrė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Indraja, rytų aukštaičių „nendrė“.','Vardo reikšmė: Indrės meilę demonstruoja labai atvirai. Tokia povyza dažnai atbaido jų gerbėjus. Jie juk nežino, kad jos mėgsta meilės preliudijas. Pavyzdžiui, prieš meilės aktą, jų partneris turi pavaišinti šokoladu, vynuogėmis, kūną ištepti aromatiniais aliejais.',' Indrė yra lietuvių kilmės vardas.'),(1163,'Indrajas',' Indrajas yra Vyriškas vardas.','Trumpa reikšmė: rytų aukštaičių „nendrė“. Lietuvių pagonių deivė, vyriausioji Saulės dukra. Indraja – lietuviškas planetos Jupiteris pavadinimas..','Vardo reikšmė: Indrajas – (1) liet., trump. Indrys, iš ežero vardo Indrajai (Daugailiai).',' Indrajas yra lietuvių kilmės vardas.'),(1164,'Irmina',' Irmina yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Irmigarda: „dievo Irmino apsauga“.','Vardo reikšmė: Irmina – (2) germ., trump. Irma, iš sulotyninto germ. Irmina, kuris yra trumpinys iš Irmingard, žr. Irmgarda/',' Irmina yra vokiečių kilmės vardas.'),(1165,'Indraja',' Indraja yra Moteriškas vardas.','Trumpa reikšmė: rytų aukštaičių „nendrė“. Lietuvių pagonių deivė, vyriausioji Saulės dukra. Indraja – lietuviškas planetos Jupiteris pavadinimas..','Vardo reikšmė: Indraja – (3a) liet., trump. Indrė, iš upėvardžio Indraja (Antalieptė): ryt. aukšt. Indrė „nendrė“.',' Indraja yra lietuvių kilmės vardas.'),(1166,'Irmgarda',' Irmgarda yra Moteriškas vardas.','Trumpa reikšmė: „dievo Irmino apsauga“.','Vardo reikšmė: Nors dažnai būdami užsiėmę svarbiais darbais, labai vertina namų židinį. Jūs dažniausiai nesate romantikai, todėl flirtas ir seksas jus mažai domina. Jums svarbi tik meilė, į kurią jūs žiūrite labai atsargiai. Tik įsitikinę jausmų tikrumu kuriate šeimą.',' Irmgarda yra vokiečių kilmės vardas.'),(1167,'Ina',' Ina yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Katerina, Regina, Ineza, Inocenta.','Vardo reikšmė: Jūs – tvirtų pažiūrų žmonės, savarankiški, užsispyrę, protingi, talentingi ir ambicingi. Nepaprastai seksualūs, tačiau būdami drovūs dažnai patiria skaudžių išgyvenimų. Šeimoje ištikimi ir prieraišūs, tačiau sugyventi su jais nelengva. Draugų turi nedaug.',' Ina yra germanų kilmės vardas.'),(1168,'Iminas',' Iminas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Imas, Minius, i- iš im- (žr. Imantas) + min- (:liet. min-ti, min-ėti, min-i).','Vardo reikšmė: Iminas – (1) liet., trump. Imas, Minius, i- iš im- (žr. Imantas) + min- (:liet. min-ti, min-ėti, min-i).',' Iminas yra lietuvių kilmės vardas.'),(1169,'Irmė',' Irmė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Irmgarda, Irmina.','Vardo reikšmė: Irmė – (2) liet., trumpinys iš Irmantė.',' Irmė yra graikų kilmės vardas.'),(1170,'Izolda',' Izolda yra Moteriškas vardas.','Trumpa reikšmė: „gražioji, žavioji“.','Vardo reikšmė: Izoldos nelinkusios pilnėti, nes jų organizmas labai greitai įsisavina gautą su maistu energiją. Todėl joms bet kokia dieta nėra sunki. Joms tik rekomenduotina mažinti maisto kaloringumą, vartoti daugiau baltymų, šviežių vaisių, daug vaikščioti.',' Izolda yra keltų kilmės vardas.'),(1171,'Irmantė',' Irmantė yra Moteriškas vardas.','Trumpa reikšmė: ir (ir, irgi) + mant- (mantus „sumanus“) – „irgi sumanus, protingas“.','Vardo reikšmė: Irmantė – (1) liet., trump. Irmė, iš vyr. v. Irmantas.',' Irmantė yra lietuvių kilmės vardas.'),(1172,'Izidorius',' Izidorius yra Vyriškas vardas.','Trumpa reikšmė: „deivės Iridės dovana“.','Vardo reikšmė: Jūs tai dievo dovana, nes visus savo sugebėjimus, talentus, kuriais gamta dosniai apdovanojo, skiriate tarnavimui žmonėms, savo tėvynei, kurioje jie gyvena.',' Izidorius yra graikų kilmės vardas.'),(1173,'Irmantas',' Irmantas yra Vyriškas vardas.','Trumpa reikšmė: ir (ir, irgi) + mant- (mantus „sumanus“) – „irgi sumanus, protingas“.','Vardo reikšmė: Irmantas – (1) liet., trump. Irmas, ir- (žr. Irdangas) + mant- (žr. Imantas)',' Irmantas yra lietuvių kilmės vardas.'),(1174,'Irma',' Irma yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Irmgarda, Irmina.','Vardo reikšmė: Irmų vestuvės sėkmingos tada, kai sutuoktinis ne tik turtingas, bet ir malonios išvaizdos, sugebantis jautriai reaguoti į jų romantinius nusiteikimus, nesugriauna to iliuzinio pasaulio, kuris joms labai artimas ir svarbus.',' Irma yra vokiečių kilmės vardas.'),(1175,'Izidora',' Izidora yra Moteriškas vardas.','Trumpa reikšmė: graik., trump. Iza, Dora, iš sulotyninto graik. Isidora, kuris iš vyr. v. Isidorus, žr. Izidorius.','Vardo reikšmė: Jūs tai dievo dovana, nes visus savo sugebėjimus, talentus, kuriais gamta dosniai apdovanojo, skiriate tarnavimui žmonėms, savo tėvynei, kurioje jie gyvena.',' Izidora yra graikų kilmės vardas.'),(1176,'Irenius',' Irenius yra Vyriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Irenius – (2) liet. trumpinys iš Irenėjas, vardo Irenius trumpiniai – Iras, Renius.',' Irenius yra graikų kilmės vardas.'),(1177,'Izaokas',' Izaokas yra Vyriškas vardas.','Trumpa reikšmė: „jis juoksis“.','Vardo reikšmė: Izaokas – (2) hebr., trump. Izokas vak. aukšt., iš sulotyninto hebr. Izaak, Isaak — „linksmuolis“: hebr. jišak „jis juoksis“.',' Izaokas yra hebrajų kilmės vardas.'),(1178,'Irenėjas',' Irenėjas yra Vyriškas vardas.','Trumpa reikšmė: „taikingas, ramus“.','Vardo reikšmė: Irenėjas – (1) graik., sen. Irenėjus, Ireniejus, trump. Irenius, Irenas, Iras, iš sulotyninto graik. Irenaeus: graik. eirenaios „taikingas, ramus“.',' Irenėjas yra graikų kilmės vardas.'),(1179,'Izabelė',' Izabelė yra Moteriškas vardas.','Trumpa reikšmė: iš Elžbieta - „prisiekiu dievu“.','Vardo reikšmė: Izabelėms tinka visi darbai, kuriuose jos galėtų užsidirbti pinigų. Gali darbuotis vien iš altruistinių paskatų. Labai geros kulinarės.',' Izabelė yra ispanų kilmės vardas.'),(1180,'Irena',' Irena yra Moteriškas vardas.','Trumpa reikšmė: „taika, ramybė“.','Vardo reikšmė: Irenos turi nuostabią regimą atmintį. Jas galima sutikti kavinėje su draugais arba tiesiog vieną ir susimąsčiusią. Dažniausiai jos laiką leidžia bibliotekose ar namie už rašomojo stalo, dirba iki vėlumos.',' Irena yra graikų kilmės vardas.'),(1181,'Irdangė',' Irdangė yra Moteriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Irdangė – (1) liet., trump. Irė, iš vyr. v. Irdangas.',' Irdangė yra lietuvių kilmės vardas.'),(1182,'Irdangas',' Irdangas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Iras, ir- (: liet. ir, irgi „taip pat“) + dang- (: liet. dang-inti(s), plg. deng-ti „greitai bėgti“).','Vardo reikšmė: Irdangas – (1) liet., trump. Iras, ir- (: liet. ir, irgi „taip pat“) + dang- (: liet. dang-inti(s), plg. deng-ti „greitai bėgti“).',' Irdangas yra lietuvių kilmės vardas.'),(1183,'Ivona',' Ivona yra Moteriškas vardas.','Trumpa reikšmė: „kukmedžio lankas“.','Vardo reikšmė: Ivonos puikios poetės, rašytojos, dailininkės, kurios gali savo idėjas išreikšti bet kokiomis priemonėmis. Mėgstamiausia tyrinėjimo tema – filosofija, todėl jos puikios mokslininkės.',' Ivona yra vokiečių kilmės vardas.'),(1184,'Iza',' Iza yra Moteriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Izabelė ir Izolda.','Vardo reikšmė: Iza – (2) liet. trumpinys iš Izabelė ir Izolda.',' Iza yra lietuvių kilmės vardas.'),(1185,'Iveta',' Iveta yra Moteriškas vardas.','Trumpa reikšmė: iš sen. vokiečių: „kukmedžio lankas“ + -ette- (mažybinė priesaga).','Vardo reikšmė: Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs gerai numatote vedybų perspektyvas, ir jeigu vedate ar ištekate, tai tik su dideliu kraičiu. Kartais gaunate didelį palikimą iš tolimų giminaičių. Su antrąja puse gyvenate labai paslaptingą ir keistą gyvenimą.',' Iveta yra prancūzų kilmės vardas.'),(1186,'Ivas',' Ivas yra Vyriškas vardas.','Trumpa reikšmė: „kukmedžio lankas“.','Vardo reikšmė: Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs gerai numatote vedybų perspektyvas, ir jeigu vedate ar ištekate, tai tik su dideliu kraičiu. Kartais gaunate didelį palikimą iš tolimų giminaičių. Su antrąja puse gyvenate labai paslaptingą ir keistą gyvenimą.',' Ivas yra vokiečių kilmės vardas.'),(1187,'Iva',' Iva yra Moteriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Iveta ir Ivona.','Vardo reikšmė: Iva – (2) liet. trumpinys iš Iveta ir Ivona.',' Iva yra lietuvių kilmės vardas.'),(1188,'Irvydas',' Irvydas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Irvas, Vydas, ir- (žr. Irdangas) + vyd- (:liet. iš-vyd-o, išvysti).','Vardo reikšmė: Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais.',' Irvydas yra lietuvių kilmės vardas.'),(1189,'Irvainė',' Irvainė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Irvė, Vainė, iš vyr. v. Irvainas.','Vardo reikšmė: Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais.',' Irvainė yra lietuvių kilmės vardas.'),(1190,'Irvainas',' Irvainas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Irvas, Vainius, ir- (žr. Irdangas) + vain- (: sen. liet. vaina „priežastis, kaltė“).','Vardo reikšmė: Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais.',' Irvainas yra lietuvių kilmės vardas.'),(1191,'Irvaidė',' Irvaidė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Irvė, Vaidė, iš vyr. v. Irvaidas.','Vardo reikšmė: Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais.',' Irvaidė yra lietuvių kilmės vardas.'),(1192,'Jacinta',' Jacinta yra Moteriškas vardas.','Trumpa reikšmė: Hiacinta, Hiacintas variantas – graikų augalų dievas Hiacintas.','Vardo reikšmė: Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs esate tikri romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jūsų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose..',' Jacinta yra graikų kilmės vardas.'),(1193,'Jaunė',' Jaunė yra Moteriškas vardas.','Trumpa reikšmė: liet., iš vyr. v. Jaunys, Jaunius.','Vardo reikšmė: Jaunė – (2) liet., iš vyr. v. Jaunys, Jaunius.',' Jaunė yra lietuvių kilmės vardas.'),(1194,'Jaumantė',' Jaumantė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Mantė, iš vyr. v. Jaumantas.','Vardo reikšmė: Jaumantė – (1) liet., trump. Mantė, iš vyr. v. Jaumantas.',' Jaumantė yra lietuvių kilmės vardas.'),(1195,'Jaumantas',' Jaumantas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Mantas, jau- (žr. Jaugedas) + mant- (: liet. mant-us „sumanus“).','Vardo reikšmė: Jaumantas – (1) liet., trump. Mantas, jau- (žr. Jaugedas) + mant- (: liet. mant-us „sumanus“).',' Jaumantas yra Lietuvių kilmės vardas.'),(1196,'Jaukantas',' Jaukantas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Jaukys, Kantas, jau- (žr. Jaugedas) + kant- (: liet. pa-kant-us, kant-rus).','Vardo reikšmė: Jaukantas – (1) liet., trump. Jaukys, Kantas, jau- (žr. Jaugedas) + kant- (: liet. pa-kant-us, kant-rus).',' Jaukantas yra lietuvių kilmės vardas.'),(1197,'Jaugindė',' Jaugindė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Jaugė, iš vyr. v. Jaugindas.','Vardo reikšmė: Jaugindė – (1) liet., trump. Jaugė, iš vyr. v. Jaugindas.',' Jaugindė yra lietuvių kilmės vardas.'),(1198,'Jaugindas',' Jaugindas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Jaugys, jau- (žr. Jaugedas) + gind- (: liet. gind- su balsių kaita iš gend-: pasi-gend-a, pasigesti).','Vardo reikšmė: Jaugindas – (1) liet., trump. Jaugys, jau- (žr. Jaugedas) + gind- (: liet. gind- su balsių kaita iš gend-: pasi-gend-a, pasigesti).',' Jaugindas yra lietuvių kilmės vardas.'),(1199,'Jauginas',' Jauginas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Jaugys, jau- (žr. Jaugedas) + gin- (: liet. gin-ti, gin-a „saugoti“).','Vardo reikšmė: Jauginas – (1) liet., trump. Jaugys, jau- (žr. Jaugedas) + gin- (: liet. gin-ti, gin-a „saugoti“).',' Jauginas yra lietuvių kilmės vardas.'),(1200,'Jadvyga',' Jadvyga yra Moteriškas vardas.','Trumpa reikšmė: „kova“.','Vardo reikšmė: Jadvygos pasižymi konservatyviomis pažiūromis, kurios atsispindi netgi jų išvaizdoje ir manierose rengtis. Darbe nepakeičiamos ir parodo didžiulius dalykinius sugebėjimus, nuostabų darbštumą. Sugeba sunkiai ir ilgai dirbti. Labai domisi profesionaliu tobulėjimu, imasi sunkiausių užduočių.',' Jadvyga yra vokiečių kilmės vardas.'),(1201,'Jackus',' Jackus yra Vyriškas vardas.','Trumpa reikšmė: iš Jacintas, o šis iš Hiacintas – graikų augalų dievas Hiacintas.','Vardo reikšmė: Vardadienis: Rugpjūčio 17 d., rugsėjo 11 d.',' Jackus yra graikų kilmės vardas.'),(1202,'Jadvė',' Jadvė yra Moteriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Jadvyga.','Vardo reikšmė: Jadvygos pasižymi konservatyviomis pažiūromis, kurios atsispindi netgi jų išvaizdoje ir manierose rengtis. Darbe nepakeičiamos ir parodo didžiulius dalykinius sugebėjimus, nuostabų darbštumą. Sugeba sunkiai ir ilgai dirbti. Labai domisi profesionaliu tobulėjimu, imasi sunkiausių užduočių.',' Jadvė yra lietuvių kilmės vardas.'),(1203,'Jacintas',' Jacintas yra Vyriškas vardas.','Trumpa reikšmė: Hiacinta, Hiacintas variantas – graikų augalų dievas Hiacintas.','Vardo reikšmė: Vardadienis: Rugpjūčio 17 d., rugsėjo 11 d.',' Jacintas yra graikų kilmės vardas.'),(1204,'Kajus',' Kajus yra Vyriškas vardas.','Trumpa reikšmė: iš Gajus, Gaja „džiaugsmingas“.','Vardo reikšmė: Kajams reikia stengtis būti ne tokiais ūmiais ir išlaikyti pusiausvyrą. Su jais bendraujantys turi daugiau dėmesio skirti jų vidinėms, o ne išorinėms savybėms, nes tai, ką jie savyje jaučia, gali visiškai nepasireikšti jų išorėje.',' Kajus yra lotynų kilmės vardas.'),(1205,'Kajetonas',' Kajetonas yra Vyriškas vardas.','Trumpa reikšmė: „kajetietis, Kejtos miesto gyventojas“.','Vardo reikšmė: Kajetonas – (2) lot., trump. Kajetas, Kajus, tarm. Kajatas piet. aukšt. (dz.), Kajeta, Kajė žem., iš lot. Caietanus — „kajetietis, Kajetos miesto (dabar Gajeta — Italijoje) gyventojas“.',' Kajetonas yra lotynų kilmės vardas.'),(1206,'Leonas',' Leonas yra Vyriškas vardas.','Trumpa reikšmė: leo „liūtas“.','Vardo reikšmė: Leonai gražūs ir patrauklūs vyrai, todėl jiems nesunku užmegzti naujas pažintis ir meilės istorijas.',' Leonas yra lotynų kilmės vardas.'),(1207,'Largas',' Largas yra Vyriškas vardas.','Trumpa reikšmė: „dosnus“.','Vardo reikšmė: Largas – (1) lot., iš lot. Largus: lot. largus „dosnus“.',' Largas yra lotynų kilmės vardas.'),(1208,'Laiva',' Laiva yra Moteriškas vardas.','Trumpa reikšmė: liet., iš upėvardžio Laiva (Kvėdarna).','Vardo reikšmė: Laiva – (1) liet., iš upėvardžio Laiva (Kvėdarna).',' Laiva yra lietuvių kilmės vardas.'),(1209,'Laisvūnė',' Laisvūnė yra Moteriškas vardas.','Trumpa reikšmė: „laisvas, laisva“.','Vardo reikšmė: Uolumas darbe, atsidavimas artimiesiems ilgainiui Laisvūnes gali paversti įžymiomis, iškiliomis, ir artimųjų kantrybė galiausiai esti dosniai atlyginta.',' Laisvūnė yra lietuvių kilmės vardas.'),(1210,'Laisvūnas',' Laisvūnas yra Vyriškas vardas.','Trumpa reikšmė: „laisvas, laisva“.','Vardo reikšmė: Laisvūnas – (1) liet., trump. Laisvis, Laisvius, priesagos -ūnas vedinys iš liet. laisvė.',' Laisvūnas yra lietuvių kilmės vardas.'),(1211,'Laisvis',' Laisvis yra Vyriškas vardas.','Trumpa reikšmė: „laisvas, laisva“.','Vardo reikšmė: Laisvis – (2) liet., galūnės vedinys iš liet. laisvas.',' Laisvis yra lietuvių kilmės vardas.'),(1212,'Laisvydas',' Laisvydas yra Vyriškas vardas.','Trumpa reikšmė: lais- (laisvas, laisvė) + vyd– (iš-vydo) – „išvydęs, turintis laisvę“.','Vardo reikšmė: Laisvydas – (1) liet., trump. Laisvis, Laisvius, lais- iš laisv- (: liet. laisv-as, laisv-ai) + vyd- (: liet. išvyd-o, iš-vysti).',' Laisvydas yra lietuvių kilmės vardas.'),(1213,'Labys',' Labys yra Vyriškas vardas.','Trumpa reikšmė: lab- (labas „geras“).','Vardo reikšmė: Labys – (4) liet., trumpinys iš avd. su Lab-: Labgaudas, Labvardas ir kt.',' Labys yra lietuvių kilmės vardas.'),(1214,'Labgaudas',' Labgaudas yra Vyriškas vardas.','Trumpa reikšmė: lab- (labas „geras“) + gaud- (gaudyti).','Vardo reikšmė: Labgaudas – (1) liet., trump. Labys, lab- (: liet. labas „geras, taurus“, labas „nauda, turtas“) + gaud- (: liet. gaud-yti, plg. gauti).',' Labgaudas yra lietuvių kilmės vardas.'),(1215,'Otilija',' Otilija yra Moteriškas vardas.','Trumpa reikšmė: othal „tėvynė“.','Vardo reikšmė: Profesijas paprastai pasirenka susietas su žmonių sveikatingumu; tampa aukštųjų mokyklų dėstytojomis; dirba laboratorijų vadovėmis. Geros darbų organizatorės, todėl dažnai užima įvairius vadovaujančius postus.',' Otilija yra vokiečių kilmės vardas.'),(1216,'Osvaldas',' Osvaldas yra Vyriškas vardas.','Trumpa reikšmė: os „dievas“ + weald „valdžia“.','Vardo reikšmė: Osvaldai turi tam tikrų iliuzijų – vesti žemesnio socialinio lygio moterį. Taip elgdamiesi jie įsivaizduoja, kad “neturtinga Pelenė” bus dėkinga visą gyvenimą. Dėl to kartais labai skaudžiai nusivilia.',' Osvaldas yra anglų kilmės vardas.'),(1217,'Osmundas',' Osmundas yra Vyriškas vardas.','Trumpa reikšmė: os „dievas“ + mung „apsauga, gynėjas“.','Vardo reikšmė: Šiems vardų turėtojamss labai gerai sekasi turtiniuose reikaluose, ir jie triumfuoja investavę į labai brangius projektus. Jie stichiški ir plačių užmojų žmonės, kurių veiksmus sunku numatyti. Tai visų darbų meistrai ! Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. ',' Osmundas yra anglų kilmės vardas.'),(1218,'Oskaras',' Oskaras yra Vyriškas vardas.','Trumpa reikšmė: os „dievas“ + gar „ietis“.','Vardo reikšmė: Oskarai geri direktoriai, švietimo ir kultūros darbuotojai. Mėgsta sportuoti. Jie geri leidybininkai, teisėjai ar advokatai.',' Oskaras yra anglų kilmės vardas.'),(1219,'Orintas',' Orintas yra Vyriškas vardas.','Trumpa reikšmė: orus „iškilnus“.','Vardo reikšmė: Orintas – (1) liet., trump. Orys, priesagos -intas vedinys iš liet. orus „iškilnus“.',' Orintas yra lietuvių kilmės vardas.'),(1220,'Otonas',' Otonas yra Vyriškas vardas.','Trumpa reikšmė: 1. graikų: otos „ausis“ – „geros, ypatingos klausos žmogus“; 2. sen. saksų: od „turtas“.','Vardo reikšmė: Vardadienis: Birželio 30 d., lapkričio 18 d.',' Otonas yra graikų kilmės vardas.'),(1221,'Jaugilė',' Jaugilė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Jaugė, iš vyr. v. Jaugilas.','Vardo reikšmė: Jaugilė – (1), (2) liet., trump. Jaugė, iš vyr. v. Jaugilas.',' Jaugilė yra lietuvių kilmės vardas.'),(1222,'Jaugilas',' Jaugilas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Jaugys, jau- (žr. Jaugedas) + gil- (: liet. gil-ti „skaudinti“).','Vardo reikšmė: Jaugilas – (1) liet., trump. Jaugys, jau- (žr. Jaugedas) + gil- (: liet. gil-ti „skaudinti“).',' Jaugilas yra lietuvių kilmės vardas.'),(1223,'Jaugėlė',' Jaugėlė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Jaugė, iš vyr. v. Jaugėlas.','Vardo reikšmė: Jaugėlė – (1) liet., trump. Jaugė, iš vyr. v. Jaugėlas.',' Jaugėlė yra lietuvių kilmės vardas.'),(1224,'Jaugėlas',' Jaugėlas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Jaugys, jau- (žr. Jaugedas) + gėl- (:liet. gėla „skausmas“, širdgėla).','Vardo reikšmė: Jaugėlas – (1) liet., trump. Jaugys, jau- (žr. Jaugedas) + gėl- (:liet. gėla „skausmas“, širdgėla).',' Jaugėlas yra lietuvių kilmės vardas.'),(1225,'Jaugedas',' Jaugedas yra Vyriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Jaugys, Gedas, jau- iš jaun- (: liet. jau, jau-nas, plg. prūs. avd. Jaunegede) + ged- (: liet. gedauti „ilgėtis“, pasi-ged-o).','Vardo reikšmė: Šiems vardų turėtojamss labai gerai sekasi turtiniuose reikaluose, ir jie triumfuoja investavę į labai brangius projektus. Jie stichiški ir plačių užmojų žmonės, kurių veiksmus sunku numatyti. Tai visų darbų meistrai ! Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. ',' Jaugedas yra prūsų kilmės vardas.'),(1226,'Januarijus',' Januarijus yra Vyriškas vardas.','Trumpa reikšmė: dievo Jano mėnesį gimęs (sausio mėnesį). Dievas Janas – laiko ir šviesos dievas.','Vardo reikšmė: Januarijus – (1) lot., trump. Januaras, Janys, iš lot. Januarius – „(dievo) Jano mėnesį gimęs“ (lot. Janus – laiko ir šviesos dievas, Jano mėnuo, arba sausio mėnuo, – lot. Januarius).',' Januarijus yra lotynų kilmės vardas.'),(1227,'Januarija',' Januarija yra Moteriškas vardas.','Trumpa reikšmė: dievo Jano mėnesį gimęs (sausio mėnesį). Dievas Janas – laiko ir šviesos dievas.','Vardo reikšmė: Januarija – (1) lot., trump. Januarė, iš lot. Januaria, kuris iš vyr. v. Januarius, žr. Januarijus.',' Januarija yra lotynų kilmės vardas.'),(1228,'Januaras',' Januaras yra Vyriškas vardas.','Trumpa reikšmė: trump. Janys, liet. trumpinys iš Januarijus.','Vardo reikšmė: Januaras – (2), trump. Janys, liet. trumpinys iš Januarijus.',' Januaras yra lietuvių kilmės vardas.'),(1229,'Janys',' Janys yra Vyriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Januaras , Januarijus.','Vardo reikšmė: Janys – (4) liet. trumpinys iš Januaras , Januarijus.',' Janys yra lietuvių kilmės vardas.'),(1230,'Janina',' Janina yra Moteriškas vardas.','Trumpa reikšmė: „Jahvės (dievo) išklausytas, palaimintas“.','Vardo reikšmė: Meilėje Janinos atviros, nuoširdžios, mėgsta atvirai ir aiškiai reikšti švelnius jausmus. Joms ypač svarbu pajusti partnerio širdies šilumą. Mėgsta sukurti stiprų lizdą ir sukurti materialinį pagrindą būsimai šeimai. Kreipia dėmesį į būsimojo vyro vidų, o ne išorę.',' Janina yra hebrajų kilmės vardas.'),(1231,'Jakimas',' Jakimas yra Vyriškas vardas.','Trumpa reikšmė: hebr., trump. Jakas, Jakys, v. Joakimas sulietuvintas variantas.','Vardo reikšmė: Jakimas – (2) hebr., trump. Jakas, Jakys, v. Joakimas sulietuvintas variantas.',' Jakimas yra hebrajų kilmės vardas.'),(1232,'Janė',' Janė yra Moteriškas vardas.','Trumpa reikšmė: vardas plg. lietuvių Janina iš hebrajų (sen. žydų) : „Jahvės (dievo) išklausytas, palaimintas“.','Vardo reikšmė: Meilėje Janinos atviros, nuoširdžios, mėgsta atvirai ir aiškiai reikšti švelnius jausmus. Joms ypač svarbu pajusti partnerio širdies šilumą. Mėgsta sukurti stiprų lizdą ir sukurti materialinį pagrindą būsimai šeimai. Kreipia dėmesį į būsimojo vyro vidų, o ne išorę.',' Janė yra latvių kilmės vardas.'),(1233,'Joana',' Joana yra Moteriškas vardas.','Trumpa reikšmė: „Jahvės (dievo) išklausytas, palaimintas“.','Vardo reikšmė: Joanos nemėgsta rutinos ir monotoniškumo. Gyvenimą myli iki kraštutinumų ir “pražysta” ten, kur yra veikimas, judėjimas. Negyvena praeities atsiminimais, visiškai atsiduoda šiandieniniam gyvenimui, o žvilgsnį nukreipia į rytdieną, siekia nuotykių ir įspūdžių.',' Joana yra hebrajų kilmės vardas.'),(1234,'Jogintas',' Jogintas yra Vyriškas vardas.','Trumpa reikšmė: jo- (joti) + gint- (ginti).','Vardo reikšmė: Jogintas – (1) liet., trump. Jogys, Gintas, jo- (žr. Jodaugas) + gint- (: liet. ginti, gint-as).',' Jogintas yra lietuvių kilmės vardas.'),(1235,'Jeronimas',' Jeronimas yra Vyriškas vardas.','Trumpa reikšmė: „šventas vardas“.','Vardo reikšmė: (1) suliet. graik., trump. Jeras, Jaras, tarm. Jeronymas žem., Jerys vak. aukšt., iš sulotyninto graik. Hieronymus: graik. hieros „šventas“ + onyma „vardas“',' Jeronimas yra graikų kilmės vardas.'),(1236,'Joginas',' Joginas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Jogys, Ginas, jo- (žr. Jodaugas) + gin- (žr. Jauginas).','Vardo reikšmė: Joginas – (1) liet., trump. Jogys, Ginas, jo- (žr. Jodaugas) + gin- (žr. Jauginas).',' Joginas yra lietuvių kilmės vardas.'),(1237,'Jolanta',' Jolanta yra Moteriškas vardas.','Trumpa reikšmė: „žibutė“.','Vardo reikšmė: Jolantos mėgsta keliauti, be jokio išskaičiavimo ateina į pagalbą pagalbos trokštantiems. Labai išreikštas polinkis į meną, ypač dailę, muziką. Tampa geromis mokytojomis, šou biznio organizatorėmis, muziejų tarnautojomis.',' Jolanta yra graikų kilmės vardas.'),(1238,'Jauvydas',' Jauvydas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Vydas, jau- (žr. Jaugedas) + vyd- (: liet. iš-vyd-o, iš-vysti).','Vardo reikšmė: Jūs labai stiprus, valingas, kartais tiesiog nesuvaldomas charakteris, kuris pasireiškia visose gyvenimo sferose, taip pat ir su moterimis. Norėdami pasiekti savo, jie naudoja įvairius būdus, sugeba būti klastingi ir apgaunantys, dažnai tokiu elgesiu susikuria sau sunkumų ten, kur jų nėra.',' Jauvydas yra lietuvių kilmės vardas.'),(1239,'Jokūbas',' Jokūbas yra Vyriškas vardas.','Trumpa reikšmė: „jis seka paskui Jahvę (dievą)“.','Vardo reikšmė: (2) hebr., trump. Jokas, Jakas, tarm. Jakūbas ryt. aukšt., Jokūbas, Kūbas, Kūbus vak. liet., Jokūpas, Jopė vak. žem., Jaka XVI a. inventoriai, iš sulotyninto hebr. Jacobus, kuris iš hebr. Ja‘akob — „(jis) seka paskui Jahvę“',' Jokūbas yra hebrajų kilmės vardas.'),(1240,'Jogilė',' Jogilė yra Moteriškas vardas.','Trumpa reikšmė: jo- (joti) + gil- (gilti „skaudinti“).','Vardo reikšmė: Šie vardo turėtojai nuo vaikystės svajoja apie tolimus kraštus, naujas keliones ir egzotiką. Jie norėtų išbandyti gyvenime nors vieną kartą viską. Jiems visas gyvenimas – žaidimų aikštelė. Tokia nuostata gali jiems daug kainuoti, nes gali išsekti savi resursai – biologiniai ar socialiniai.',' Jogilė yra lietuvių kilmės vardas.'),(1241,'Jauvainė',' Jauvainė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Vainė, iš vyr. v. Jauvainas.','Vardo reikšmė: Šie vardo turėtojai mėgsta skaniai ir sočiai pavalgyti bei išgerti. Gali piktnaudžiauti seksu ir narkotikais. Jie turi talentą generuoti naujas idėjas; puikios rankos. Mėgsta visa, kas nauja ir neištirta. Jie protingi, tačiau mąstymo procesas, kaip ir pats gyvenimas, neorganizuotas ir išbarstytas.',' Jauvainė yra lietuvių kilmės vardas.'),(1242,'Jauvainas',' Jauvainas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Vainius, jau- (žr. Jaugedas) + vain- (: sen. liet. vaina „priežastis, kaltė“).','Vardo reikšmė: Šie vardo turėtojai mėgsta skaniai ir sočiai pavalgyti bei išgerti. Gali piktnaudžiauti seksu ir narkotikais. Jie turi talentą generuoti naujas idėjas; puikios rankos. Mėgsta visa, kas nauja ir neištirta. Jie protingi, tačiau mąstymo procesas, kaip ir pats gyvenimas, neorganizuotas ir išbarstytas.',' Jauvainas yra lietuvių kilmės vardas.'),(1243,'Jogilas',' Jogilas yra Vyriškas vardas.','Trumpa reikšmė: liet. ir prūs., trump. Jogys, jo- (žr. Jodaugas) + gil- (žr. Jaugilas).','Vardo reikšmė: Šie vardo turėtojai nuo vaikystės svajoja apie tolimus kraštus, naujas keliones ir egzotiką. Jie norėtų išbandyti gyvenime nors vieną kartą viską. Jiems visas gyvenimas – žaidimų aikštelė. Tokia nuostata gali jiems daug kainuoti, nes gali išsekti savi resursai – biologiniai ar socialiniai.',' Jogilas yra lietuvių kilmės vardas.'),(1244,'Jauvaidas',' Jauvaidas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Vaidas, jau- (žr. Jaugedas) + vaid- (: liet. vaid-ytis „rodytis“, vaid-entis).','Vardo reikšmė: Šie vardo turėtojai mėgsta skaniai ir sočiai pavalgyti bei išgerti. Gali piktnaudžiauti seksu ir narkotikais. Jie turi talentą generuoti naujas idėjas; puikios rankos. Mėgsta visa, kas nauja ir neištirta. Jie protingi, tačiau mąstymo procesas, kaip ir pats gyvenimas, neorganizuotas ir išbarstytas.',' Jauvaidas yra lietuvių kilmės vardas.'),(1245,'Jokimė',' Jokimė yra Moteriškas vardas.','Trumpa reikšmė: iš Joakimas „Jehova (dievas) jį kelia, aukština“.','Vardo reikšmė: Jūs – laisvi žmonės, kurie mėgsta permainas, nuotykius ir pasilinksminimus. Jie saugo savo laisvę ir, kaip paukštis be sparnų, negali egzistuoti be jos. Jie labai lengvai prisitaiko. Permainos – jiems malonumas, o bet koks trukdymas – katastrofa.',' Jokimė yra lietuvių kilmės vardas.'),(1246,'Jogėlė',' Jogėlė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Jogė, iš vyr. v. Jogėlas.','Vardo reikšmė: Jūs – laisvi žmonės, kurie mėgsta permainas, nuotykius ir pasilinksminimus. Jie saugo savo laisvę ir, kaip paukštis be sparnų, negali egzistuoti be jos. Jie labai lengvai prisitaiko. Permainos – jiems malonumas, o bet koks trukdymas – katastrofa.',' Jogėlė yra lietuvių kilmės vardas.'),(1247,'Jokimas',' Jokimas yra Vyriškas vardas.','Trumpa reikšmė: iš Joakimas „Jehova (dievas) jį kelia, aukština“.','Vardo reikšmė: Jūs – laisvi žmonės, kurie mėgsta permainas, nuotykius ir pasilinksminimus. Jie saugo savo laisvę ir, kaip paukštis be sparnų, negali egzistuoti be jos. Jie labai lengvai prisitaiko. Permainos – jiems malonumas, o bet koks trukdymas – katastrofa.',' Jokimas yra lietuvių kilmės vardas.'),(1248,'Joris',' Joris yra Vyriškas vardas.','Trumpa reikšmė: jorus „žalias“, jorė „žalumynas, žaluma“; sen. lietuvių pavasario dievas Joris.','Vardo reikšmė: Joris – (2) liet., iš sen. lietuvių pavasario žalio dievo (pagal S. Daukantą) vardo Joris: liet. jorė „žalymas, pavasario žaluma“ jorus „žalias“, jor-iuoti „žaliuoti“, galbūt šio vardo tolimesnis vedinys yra v. Jorigis.',' Joris yra lietuvių kilmės vardas.'),(1249,'Jogėlas',' Jogėlas yra Vyriškas vardas.','Trumpa reikšmė: jo- (joti) + gil- (gilti „skaudinti“).','Vardo reikšmė: Šie vardo turėtojai nuo vaikystės svajoja apie tolimus kraštus, naujas keliones ir egzotiką. Jie norėtų išbandyti gyvenime nors vieną kartą viską. Jiems visas gyvenimas – žaidimų aikštelė. Tokia nuostata gali jiems daug kainuoti, nes gali išsekti savi resursai – biologiniai ar socialiniai.',' Jogėlas yra lietuvių kilmės vardas.'),(1250,'Jogvilė',' Jogvilė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Jogė, Vilė, iš vyr. v. Jogvilas.','Vardo reikšmė: Šie vardo turėtojai nuo vaikystės svajoja apie tolimus kraštus, naujas keliones ir egzotiką. Jie norėtų išbandyti gyvenime nors vieną kartą viską. Jiems visas gyvenimas – žaidimų aikštelė. Tokia nuostata gali jiems daug kainuoti, nes gali išsekti savi resursai – biologiniai ar socialiniai.',' Jogvilė yra lietuvių kilmės vardas.'),(1251,'Jogė',' Jogė yra Moteriškas vardas.','Trumpa reikšmė: liet., iš vyr. v. Jogys, taip pat trumpinys iš vardų su Jo-g- ir Jog-: Jogilė, Jogirdė, Jogmina, Jogvilė ir kt.','Vardo reikšmė: Jūs galite dirbti bet kokioje srityje, kur tik reikia protingai elgtis su pinigais. Jūs atkakliu darbu užsidirbate savo pinigus ir nesiimate lošti nesąžiningų žaidimų.',' Jogė yra lietuvių kilmės vardas.'),(1252,'Jogvilas',' Jogvilas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Jogys, Vilas, jo-g- (žr. Jogminas) + vil- (žr. Jaudvilas).','Vardo reikšmė: Šie vardo turėtojai nuo vaikystės svajoja apie tolimus kraštus, naujas keliones ir egzotiką. Jie norėtų išbandyti gyvenime nors vieną kartą viską. Jiems visas gyvenimas – žaidimų aikštelė. Tokia nuostata gali jiems daug kainuoti, nes gali išsekti savi resursai – biologiniai ar socialiniai.',' Jogvilas yra lietuvių kilmės vardas.'),(1253,'Jaurimtas',' Jaurimtas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Jauras, Rimtas, jau- (žr. Jaugedas) + rim- (: liet. rim-ti, rim-o).','Vardo reikšmė: Jaurimtas – (1) liet., trump. Jauras, Rimtas, jau- (žr. Jaugedas) + rim- (: liet. rim-ti, rim-o).',' Jaurimtas yra lietuvių kilmės vardas.'),(1254,'Jorigė',' Jorigė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Jorė, iš vyr. v. Jorigis.','Vardo reikšmė: Jorigė – (1) liet., trump. Jorė, iš vyr. v. Jorigis.',' Jorigė yra lietuvių kilmės vardas.'),(1255,'Jogundas',' Jogundas yra Vyriškas vardas.','Trumpa reikšmė: jo- (joti) + gund- (gundyti).','Vardo reikšmė: Jogundas – (1) suliet. prūs., trump. Jogys, Gundas, jo- (žr. Jodaugas) + gund- (: liet. gund-a, gusti).',' Jogundas yra lietuvių kilmės vardas.'),(1256,'Jonis',' Jonis yra Vyriškas vardas.','Trumpa reikšmė: „Jahvės (dievo) išklausytas, palaimintas“.','Vardo reikšmė: Jonis – (2) – liet. (žem.) vardo Jonas variantas.',' Jonis yra hebrajų kilmės vardas.'),(1257,'Jaunutis',' Jaunutis yra Vyriškas vardas.','Trumpa reikšmė: „jaunas, jauna“.','Vardo reikšmė: Jaunutis – (2) liet., trump. Jaunius, priesagos -utis vedinys iš sen. avd. Jaunys, Jaunius.',' Jaunutis yra lietuvių kilmės vardas.'),(1258,'Josvainas',' Josvainas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Josvys, Vainius, jos- (žr. Josbutas) + vain- (žr. Jauvainas).','Vardo reikšmė: Šie vardo turėtojai labai prisirišę prie šeimos. Sekso srityje jiems būtina dominuoti. Jei partnerei neprieštarauja, gali griebtis grubiausios fizinės jėgos. Kai jie susižavi ar kažko užsinori – geriau saugotis jų. Labai kūribingi ir užsispyrę žmonės.',' Josvainas yra lietuvių kilmės vardas.'),(1259,'Jogminas',' Jogminas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Jogys, Minius, jo-g- (: liet. jo-ti, jo-ja + -g-, plg. sen. avd. Jogys) + min- (: liet. min-ti, min-ėti, min-i).','Vardo reikšmė: Jogminas – (1) liet., trump. Jogys, Minius, jo-g- (: liet. jo-ti, jo-ja + -g-, plg. sen. avd. Jogys) + min- (: liet. min-ti, min-ėti, min-i).',' Jogminas yra lietuvių kilmės vardas.'),(1260,'Jostautė',' Jostautė yra Moteriškas vardas.','Trumpa reikšmė: jos- (jos-iu) + taut- (tauta).','Vardo reikšmė: Jūs labai atjaučiantys, todėl nėra geresnių slaugytojų už jus. Tačiau dvasinis mąstymas ribotas. Bažnyčią lankote tik dėl to, kad bijote, jog kiti gali blogai apie jus pagalvoti. Jūs puikiausiai suprantate savo prasižengimus šiame pasaulyje, tačiau anapusinis pasaulis jūsų nedomina.',' Jostautė yra lietuvių kilmės vardas.'),(1261,'Jogailė',' Jogailė yra Moteriškas vardas.','Trumpa reikšmė: jo- (joti) + gail- (gailas „stiprus“).','Vardo reikšmė: Vardadienis: Sausio 8 d., rugpjūčio 7 d.',' Jogailė yra lietuvių kilmės vardas.'),(1262,'Jaunutė',' Jaunutė yra Moteriškas vardas.','Trumpa reikšmė: „jaunas, jauna“.','Vardo reikšmė: Jaunutė – (2) liet., trump. Jaunė, iš vyr. v. Jaunutis.',' Jaunutė yra lietuvių kilmės vardas.'),(1263,'Jonė',' Jonė yra Moteriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Joana.','Vardo reikšmė: Jonė – (2) – liet. trumpinys iš Joana.',' Jonė yra lietuvių kilmės vardas.'),(1264,'Jonaudė',' Jonaudė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Naudė, iš vyr. v. Jonaudas.','Vardo reikšmė: Jonaudė – (1) liet., trump. Naudė, iš vyr. v. Jonaudas.',' Jonaudė yra lietuvių kilmės vardas.'),(1265,'Jogaila',' Jogaila yra Vyriškas vardas.','Trumpa reikšmė: jo- (joti) + gail- (gailas „stiprus“).','Vardo reikšmė: Jogailos egoistiški ir agresyvūs, labai sąžiningi ir atviri. Pasitikintys, o apsirikę vėl tiki. Jie neturi gudrumo, ir tokiais išlieka visą gyvenimą. Kartais ima statyti oro pilis, bet ne tam, kad ką apgautų. Paprasčiausiai jie patys tiki visu tuo.',' Jogaila yra lietuvių kilmės vardas.'),(1266,'Jostautas',' Jostautas yra Vyriškas vardas.','Trumpa reikšmė: jos- (jos-iu) + taut- (tauta).','Vardo reikšmė: Jūs labai atjaučiantys, todėl nėra geresnių slaugytojų už jus. Tačiau dvasinis mąstymas ribotas. Bažnyčią lankote tik dėl to, kad bijote, jog kiti gali blogai apie jus pagalvoti. Jūs puikiausiai suprantate savo prasižengimus šiame pasaulyje, tačiau anapusinis pasaulis jūsų nedomina.',' Jostautas yra lietuvių kilmės vardas.'),(1267,'Jovaišas',' Jovaišas yra Vyriškas vardas.','Trumpa reikšmė: „kiemas, kaimas“.','Vardo reikšmė: Šie vardo turėtojai iš pažiūros atrodo abejingi viskam, tačiau tai tik elgesio maniera, po kuria slepiasi didžiuliai dvasiniai išgyvenimai. Jie emocijas slepia viduje, o tai greitai atsiliepia į jų sveikatą – virškinimo ir nervų sistemoms.',' Jovaišas yra lietuvių kilmės vardas.'),(1268,'Jonaudas',' Jonaudas yra Vyriškas vardas.','Trumpa reikšmė: „turtas, gerovė“.','Vardo reikšmė: Jonaudas – (1) liet., trump. Jonys, Naudas, jo- (žr. Jodaugas) + naud- (: liet. naud-a „turtas, gerovė“).',' Jonaudas yra lietuvių kilmės vardas.'),(1269,'Jogys',' Jogys yra Vyriškas vardas.','Trumpa reikšmė: liet., trumpinys iš avd. su Jo-g- ir Jog-: Jogilas, Jogirdas, Jogminas, Jogvilas ir kt.','Vardo reikšmė: Jogys – (4) liet., trumpinys iš avd. su Jo-g- ir Jog-: Jogilas, Jogirdas, Jogminas, Jogvilas ir kt.',' Jogys yra Lietuvių kilmės vardas.'),(1270,'Jostartas',' Jostartas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Jostys, jos- (žr. Josbutas) + tart- (: liet. tarti, tart-as).','Vardo reikšmė: Jostartas – (1) liet., trump. Jostys, jos- (žr. Josbutas) + tart- (: liet. tarti, tart-as).',' Jostartas yra lietuvių kilmės vardas.'),(1271,'Jodaugė',' Jodaugė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Daugė, iš vyr. v. Jodaugas.','Vardo reikšmė: Jodaugė – (1) liet., trump. Daugė, iš vyr. v. Jodaugas.',' Jodaugė yra lietuvių kilmės vardas.'),(1272,'Jonas',' Jonas yra Vyriškas vardas.','Trumpa reikšmė: „Jahvės (dievo) išklausytas, palaimintas“.','Vardo reikšmė: Jonai su neigiamomis savybėmis labai kerštingi, nesusilaikantys, kartais niekšingi, gudrūs, nepasitikintys ir labai egoistiški, inertiški, linkę į tironiją.',' Jonas yra hebrajų kilmės vardas.'),(1273,'Jogirdas',' Jogirdas yra Vyriškas vardas.','Trumpa reikšmė: jo- (joti) + gird- (girdas „žinia, gandas“).','Vardo reikšmė: Jūs galite būti geri teisininkai, medikai, literatūros tyrinėtojai, valstybės vadovai. Socialinis darbas, pedagogika, psichologija, netradicinė medicina – taip pat puikus pasirinkimas, nes jie moka visus išklausyti bei giliai analizuoti. Jus galite būti sapnų pasaulio aiškintojai.',' Jogirdas yra lietuvių kilmės vardas.'),(1274,'Jodaugas',' Jodaugas yra Vyriškas vardas.','Trumpa reikšmė: jo- (joti) + daug- (daug) – „daug jojęs, daug patyręs“.','Vardo reikšmė: Jodaugas – (1) liet., trump. Daugas, jo- (: liet. jo-ti, jo-ja, jo-tis „jojimas, raiteliai“) + daug- (: liet. daug, daug-is „daugumas“).',' Jodaugas yra lietuvių kilmės vardas.'),(1275,'Jovainas',' Jovainas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Jovas, Vainius, jo- (žr. Jodaugas) + vain- (žr. Jauvainas).','Vardo reikšmė: Jovainas (1) liet., trump. Jovas, Vainius, jo- (žr. Jodaugas) + vain- (žr. Jauvainas).',' Jovainas yra lietuvių kilmės vardas.'),(1276,'Jomilė',' Jomilė yra Moteriškas vardas.','Trumpa reikšmė: jo- (joti) + mil- (pa-milti).','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Jūs puikūs originalių idėjų ir efektyvių sistemų šaltinis. Gyvenimas jums žavingas todėl, kad jūs patys suteikiate jam tam tikrą prieskonį.',' Jomilė yra lietuvių kilmės vardas.'),(1277,'Jomilas',' Jomilas yra Vyriškas vardas.','Trumpa reikšmė: jo- (joti) + mil- (pa-milti).','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Jūs puikūs originalių idėjų ir efektyvių sistemų šaltinis. Gyvenimas jums žavingas todėl, kad jūs patys suteikiate jam tam tikrą prieskonį.',' Jomilas yra lietuvių kilmės vardas.'),(1278,'Jovaidas',' Jovaidas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Jovas, Vaidas, jo- (žr. Jodaugas) + vaid- (žr. Jauvaidas).','Vardo reikšmė: Jovaidas – (1) liet., trump. Jovas, Vaidas, jo- (žr. Jodaugas) + vaid- (žr. Jauvaidas).',' Jovaidas yra lietuvių kilmės vardas.'),(1279,'Jostaras',' Jostaras yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Jostys , jos- (žr. Josbutas) + tar- (: liet. tar-ti, tar-ia).','Vardo reikšmė: Jostaras – (1) liet., trump. Jostys , jos- (žr. Josbutas) + tar- (: liet. tar-ti, tar-ia).',' Jostaras yra lietuvių kilmės vardas.'),(1280,'Judita',' Judita yra Moteriškas vardas.','Trumpa reikšmė: „judėjietė, Judėjos gyventoja“.','Vardo reikšmė: Darbe jos labai kruopščios, puikiai susitvarko su bet kokiomis užduotimis, tačiau vadovauti joms sunku. Labai geros muzikantės, artistės, dailininkės, oratorės, mokytojos, žurnalistės bei rašytojos. Kai kurios Juditos gabios matematikės, mechanikės, elektrotechnikės. Puikios mokslininkės.',' Judita yra hebrajų kilmės vardas.'),(1281,'Jomantė',' Jomantė yra Moteriškas vardas.','Trumpa reikšmė: jo- (joti) + mant- (mantas „sumanus“).','Vardo reikšmė: Jomantė – (1) liet. ir prūs., trump. Mantė, iš vyr. v. Jomantas.',' Jomantė yra lietuvių kilmės vardas.'),(1282,'Jovitas',' Jovitas yra Vyriškas vardas.','Trumpa reikšmė: jo- (joti) + vilt- (viltis) – „jojantis su viltimi“.','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Pagrindinis jūsų bruožas – magnetizmas. Jūs stengiatės atitikti maksimalų galimybių potencialą. Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems. ',' Jovitas yra lietuvių kilmės vardas.'),(1283,'Juntautas',' Juntautas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Juntys, Tautas, jun- iš jund- (: liet. su-junda, su-justi) + taut- (žr. Jostautas).','Vardo reikšmė: Juntautas – (1) liet., trump. Juntys, Tautas, jun- iš jund- (: liet. su-junda, su-justi) + taut- (žr. Jostautas).',' Juntautas yra lietuvių kilmės vardas.'),(1284,'Josminas',' Josminas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Josys, Minius, jos- (žr. Josbutas) + min- (žr. Jogminas).','Vardo reikšmė: Josminas – (1) liet., trump. Josys, Minius, jos- (žr. Josbutas) + min- (žr. Jogminas).',' Josminas yra lietuvių kilmės vardas.'),(1285,'Jomantas',' Jomantas yra Vyriškas vardas.','Trumpa reikšmė: jo- (joti) + mant- (mantas „sumanus“).','Vardo reikšmė: Jomantas – (1) liet. ir prūs., trump. Mantas, jo- (žr. Jodaugas) + mant- (žr. Jaumantas).',' Jomantas yra lietuvių kilmės vardas.'),(1286,'Jovita',' Jovita yra Moteriškas vardas.','Trumpa reikšmė: lot. Jovitus - pralinksminti, patenkinti; liet. jo- (joti) + vilt- (viltis) – „jojantis su viltimi“.','Vardo reikšmė: Jovitos vardo trumpinys – Jovė. Tarmiškai vakarų Žemaitijoje Jovita – Jovė. Vardas vyrui – Jovitas.',' Jovita yra lotynų, lietuvių kilmės vardas.'),(1287,'Jotvilė',' Jotvilė yra Moteriškas vardas.','Trumpa reikšmė: jot- (joti) + vil- (viltis) – „jojantis per gyvenimą su viltimi“.','Vardo reikšmė: Jotvilė – (1), (2) liet., trump. Jotvė, Vilė, iš vyr. v. Jotvilas.',' Jotvilė yra lietuvių kilmės vardas.'),(1288,'Jundutis',' Jundutis yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Jundys, priesagos -utis vedinys iš sen. avd. Jundas, žr. Jundilas..','Vardo reikšmė: Jundutis – (2) liet., trump. Jundys, priesagos -utis vedinys iš sen. avd. Jundas, žr. Jundilas.',' Jundutis yra lietuvių kilmės vardas.'),(1289,'Jovirdas',' Jovirdas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Jovas, Virdys, jo- (žr. Jodaugas) + vird- (: prūs. wirds „žodis“, plg. liet. vardas, latv. vards „žodis“).','Vardo reikšmė: Jovirdas – (1) liet., trump. Jovas, Virdys, jo- (žr. Jodaugas) + vird- (: prūs. wirds „žodis“, plg. liet. vardas, latv. vards „žodis“).',' Jovirdas yra lietuvių kilmės vardas.'),(1290,'Jotvilas',' Jotvilas yra Vyriškas vardas.','Trumpa reikšmė: jot- (joti) + vil- (viltis) – „jojantis per gyvenimą su viltimi“.','Vardo reikšmė: Jotvilas – (1) liet., trump. Jotys, Vilas, jot- (žr. Jotautas) + vil- (žr. Jaudvilas).',' Jotvilas yra lietuvių kilmės vardas.'),(1291,'Jolita',' Jolita yra Moteriškas vardas.','Trumpa reikšmė: iš graikų Helena „šviesioji“.','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Kartais jie apie save suburia tvirtovės sieną, atskiriančią juos nuo aistrų ir instinktų, laikydami juos antraeiliais dalykais. Ir visgi jūsų protas bei energija nukreipti saviems egoistiniams tikslams įgyvendinti.',' Jolita yra vengrų kilmės vardas.'),(1292,'Jundutė',' Jundutė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Jundė, iš vyr. v. Jundutis.','Vardo reikšmė: Jundutė – (2) liet., trump. Jundė, iš vyr. v. Jundutis.',' Jundutė yra lietuvių kilmės vardas.'),(1293,'Joskaudė',' Joskaudė yra Moteriškas vardas.','Trumpa reikšmė: jo- (joti) + skaud- (skaudus „griežtas, smarkus“) – „smarkiai jojantis per gyvenimą“..','Vardo reikšmė: Joskaudė – (1) liet., trump. Skaudė, iš vyr. v. Joskaudas.',' Joskaudė yra lietuvių kilmės vardas.'),(1294,'Jurgis',' Jurgis yra Vyriškas vardas.','Trumpa reikšmė: „žemdirbys, -ė“. Variantai: Georgas (rusų), Džordžas (anglų), Ježis (lenkų).','Vardo reikšmė: Neigiamos savybės: nervingi, bailoki, perdaug emocingi, pikti. Kai kurie įklimpsta į alkoholio ar narkotikų liūną. Moterų medžiotojai ir suvedžiotojai.',' Jurgis yra graikų kilmės vardas.'),(1295,'Jotys',' Jotys yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. iš avd. su Jot-: Jotautas, Jotkantas, Jotvilas ir kt.','Vardo reikšmė: Jotys – (2) liet., trump. iš avd. su Jot-: Jotautas, Jotkantas, Jotvilas ir kt.',' Jotys yra lietuvių kilmės vardas.'),(1296,'Jundilė',' Jundilė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Jundė, iš vyr. v. Jundilas.','Vardo reikšmė: Jundilė – (1) liet., trump. Jundė, iš vyr. v. Jundilas.',' Jundilė yra lietuvių kilmės vardas.'),(1297,'Joskaudas',' Joskaudas yra Vyriškas vardas.','Trumpa reikšmė: jo- (joti) + skaud- (skaudus „griežtas, smarkus“) – „smarkiai jojantis per gyvenimą“..','Vardo reikšmė: Joskaudas – (1) liet., trump. Josys, Skaudys, jo- (žr. Jodaugas) + skaud- (: liet. skaud-us „griežtas, smarkus“).',' Joskaudas yra lietuvių kilmės vardas.'),(1298,'Jurgina',' Jurgina yra Moteriškas vardas.','Trumpa reikšmė: iš Jurga + -in „žemdirbys, -ė“.','Vardo reikšmė: Jurgina – graikų kilmės vardas mergaitei. Jurgina – graikiško žodžio Jurga ir -in junginys. Žodis Jurga graikų kalboje reiškia žemdirbė. Taip pat šis vardas siejamas su augalu Jurginas.',' Jurgina yra graikų kilmės vardas.'),(1299,'Jotautė',' Jotautė yra Moteriškas vardas.','Trumpa reikšmė: jo- (joti) + taut- (tauta) – „jojanti į žygį tauta, drąsi tauta“.','Vardo reikšmė: Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Rūpinimasis kitais, mokėjimas spręsti sudėtingus klausimus ir pedagoginis talentas gali jį išskirti iš minios. Jam reikės mokytis suvaldyti pyktį ir norą priimti staigius ir nepamatuotus sprendimus bei norą pasiduoti..',' Jotautė yra lietuvių kilmės vardas.'),(1300,'Joviltas',' Joviltas yra Vyriškas vardas.','Trumpa reikšmė: jo- (joti) + vilt- (viltis).','Vardo reikšmė: Joviltas – (1) liet., trump. Jovas, Viltys, jo- (žr. Jodaugas) + vilt- (: liet. vilt-as, plg. viltis).',' Joviltas yra lietuvių kilmės vardas.'),(1301,'Jolė',' Jolė yra Moteriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Jolanta ir Joleta, Jolita.','Vardo reikšmė: Jolė – (2) liet. trumpinys iš Jolanta ir Joleta, Jolita.',' Jolė yra lietuvių kilmės vardas.'),(1302,'Jotautas',' Jotautas yra Vyriškas vardas.','Trumpa reikšmė: jo- (joti) + taut- (tauta) – „jojanti į žygį tauta, drąsi tauta“.','Vardo reikšmė: Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Rūpinimasis kitais, mokėjimas spręsti sudėtingus klausimus ir pedagoginis talentas gali jį išskirti iš minios. Jam reikės mokytis suvaldyti pyktį ir norą priimti staigius ir nepamatuotus sprendimus bei norą pasiduoti..',' Jotautas yra lietuvių kilmės vardas.'),(1303,'Josgailė',' Josgailė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Gailė, iš vyr. v. Josgaila, žr. Josgailas.','Vardo reikšmė: Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Rūpinimasis kitais, mokėjimas spręsti sudėtingus klausimus ir pedagoginis talentas gali jį išskirti iš minios. Jam reikės mokytis suvaldyti pyktį ir norą priimti staigius ir nepamatuotus sprendimus bei norą pasiduoti..',' Josgailė yra lietuvių kilmės vardas.'),(1304,'Jurgė',' Jurgė yra Moteriškas vardas.','Trumpa reikšmė: suliet. graik., iš vyr. v. Jurgis.','Vardo reikšmė: Jurgė – (1) suliet. graik., iš vyr. v. Jurgis.',' Jurgė yra graikų kilmės vardas.'),(1305,'Josvilė',' Josvilė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Josvė, Vilė, iš vyr. v. Josvilas.','Vardo reikšmė: Josvilė – (1), (2) liet., trump. Josvė, Vilė, iš vyr. v. Josvilas.',' Josvilė yra lietuvių kilmės vardas.'),(1306,'Jurga',' Jurga yra Moteriškas vardas.','Trumpa reikšmė: „žemdirbys, -ė“. Variantai: Georgas (rusų), Džordžas (anglų), Ježis (lenkų).','Vardo reikšmė: (1) liet. trumpinys iš Jurgita',' Jurga yra graikų kilmės vardas.'),(1307,'Julius',' Julius yra Vyriškas vardas.','Trumpa reikšmė: „garbanius, -ė“, legendinio Enėjo sūnaus vardas Julus.','Vardo reikšmė: Juliai gali būti ekstrasensai, žiniuoniai; jiems patinka dirbti su žmonėmis, todėl įgyja daug žinių apie žmogaus vidines būsenas. Taip pat geri gydytojai, advokatai, rašytojai, žiniasklaidos darbuotojai.',' Julius yra graikų kilmės vardas.'),(1308,'Josgailas',' Josgailas yra Vyriškas vardas.','Trumpa reikšmė: „stiprus“.','Vardo reikšmė: Josgailas – (1) liet., var. Josgaila, trump. Josys, Gailas, jos- (žr. Josbutas) + gail- (: sen. liet. gail-as „stiprus“).',' Josgailas yra lietuvių kilmės vardas.'),(1309,'Jovilė',' Jovilė yra Moteriškas vardas.','Trumpa reikšmė: jo- (joti) + vil- (viltis) – „jojantis per gyvenimą su viltimi“.','Vardo reikšmė: Jovilės labai seksualios. Jos labai atkaklios, tad joms atsispirti beveik neįmanoma. Ištekėjusios tampa puikiomis motinomis.',' Jovilė yra lietuvių kilmės vardas.'),(1310,'Julita',' Julita yra Moteriškas vardas.','Trumpa reikšmė: „jauna, jaunuoliška“.','Vardo reikšmė: Vardadienis: Gegužės 18 d., birželio 16 d.',' Julita yra prancūzų kilmės vardas.'),(1311,'Josvilas',' Josvilas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Josvys, Vilas, jos- (žr. Josbutas) + vil- (žr. Jaudvilas).','Vardo reikšmė: Josvilas – (1) liet., trump. Josvys, Vilas, jos- (žr. Josbutas) + vil- (žr. Jaudvilas).',' Josvilas yra lietuvių kilmės vardas.'),(1312,'Jovilas',' Jovilas yra Vyriškas vardas.','Trumpa reikšmė: jo- (joti) + vil- (viltis) – „jojantis per gyvenimą su viltimi“.','Vardo reikšmė: Jovilas – (1) suliet. prūs., trump. Jovas, Vilas, jo- (žr. Jodaugas) + vil- (žr. Jaudvilas).',' Jovilas yra lietuvių kilmės vardas.'),(1313,'Jūratė',' Jūratė yra Moteriškas vardas.','Trumpa reikšmė: jūra + -at- „jūrų mergelė“, paplito iš Maironio baladės „Jūratė ir Kastytis“.','Vardo reikšmė: Teigiamos Jūračių savybės – pasitikėjimas savo jėgomis, lyderio bruožai. Jos sunkiai paklūsta, eina į tikslą tiesiai, laužydamos viską pakelėje. Pasižymi ypatingu kantrumu. Priešininkai bando jas sugniuždyti, tačiau daugeliu atveju tai neįmanoma padaryti.',' Jūratė yra lietuvių kilmės vardas.'),(1314,'Josbutė',' Josbutė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Bute, iš vyr. v. Josbutas.','Vardo reikšmė: Vardas skatina gilumino žavesio pasireiškimą ir stiprių jausmų proveržį. Vyras šiuo vardu gali pasižymėti nuotaikų svyravimais, polinkiu į akibrokštus ir puikiu stiliaus jausmu. Jis gali turėti gydymo galių ir stipriai traukti moterų dėmesį.',' Josbutė yra lietuvių kilmės vardas.'),(1315,'Julijus',' Julijus yra Vyriškas vardas.','Trumpa reikšmė: „garbanius, -ė“, legendinio Enėjo sūnaus vardas Julus.','Vardo reikšmė: Juliai gali būti ekstrasensai, žiniuoniai; jiems patinka dirbti su žmonėmis, todėl įgyja daug žinių apie žmogaus vidines būsenas. Taip pat geri gydytojai, advokatai, rašytojai, žiniasklaidos darbuotojai.',' Julijus yra graikų kilmės vardas.'),(1316,'Jovydas',' Jovydas yra Vyriškas vardas.','Trumpa reikšmė: jo- (joti) + vyd- (iš-vydo).','Vardo reikšmė: Jovydas – (1) liet., trump. Jovas, Vydas, jo- (žr. Jodaugas) + vyd- (žr. Josvydas).',' Jovydas yra lietuvių kilmės vardas.'),(1317,'Josvydas',' Josvydas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Josvys, Vydas, jos- (žr. Josbutas) + vyd- (: liet. iš-vyd-o, išvysti).','Vardo reikšmė: Josvydas – (1) liet., trump. Josvys, Vydas, jos- (žr. Josbutas) + vyd- (: liet. iš-vyd-o, išvysti).',' Josvydas yra lietuvių kilmės vardas.'),(1318,'Juras',' Juras yra Vyriškas vardas.','Trumpa reikšmė: tarminis Jurgis variantas iš graikų: „žemdirbys, -ė“.','Vardo reikšmė: Jurams nesvetimas romantinis nusiteikimas, todėl to pačio reikalauja iš žmonių. Moterys jų gyvenime turi pažinti tuos pačius jausmus, kaip ir jie, turi būti tobulų jausmų ir aktyvios. Sekso reikaluose nepripažįsta jokių draudimų ar apribojimų.',' Juras yra graikų kilmės vardas.'),(1319,'Josbutas',' Josbutas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Josys, Butys, jos- (: liet.jos-iu (jo-ti) + but- (:liet. but-as, bū-ti)..','Vardo reikšmė: Vardas skatina gilumino žavesio pasireiškimą ir stiprių jausmų proveržį. Vyras šiuo vardu gali pasižymėti nuotaikų svyravimais, polinkiu į akibrokštus ir puikiu stiliaus jausmu. Jis gali turėti gydymo galių ir stipriai traukti moterų dėmesį.',' Josbutas yra lietuvių kilmės vardas.'),(1320,'Juzė',' Juzė yra Vyriškas vardas.','Trumpa reikšmė: iš Juozapas „teprideda Jehova (dievas) prie šio (gimusio) dar vieną vaiką“.','Vardo reikšmė: Juzė – (2) liet. trumpinys iš Juozapa ir Juozapota.',' Juzė yra hebrajų kilmės vardas.'),(1321,'Julijonas',' Julijonas yra Vyriškas vardas.','Trumpa reikšmė: „garbanius“, legendomis apipinto Romos įkūrėjo Enėjo sūnaus vardas Julus.','Vardo reikšmė: Juliai gali būti ekstrasensai, žiniuoniai; jiems patinka dirbti su žmonėmis, todėl įgyja daug žinių apie žmogaus vidines būsenas. Taip pat geri gydytojai, advokatai, rašytojai, žiniasklaidos darbuotojai.',' Julijonas yra graikų, lotynų kilmės vardas.'),(1322,'Jūra',' Jūra yra Moteriškas vardas.','Trumpa reikšmė: jūra.','Vardo reikšmė: .',' Jūra yra lietuvių kilmės vardas.'),(1323,'Juventinas',' Juventinas yra Vyriškas vardas.','Trumpa reikšmė: lot., trump. Juventas, Juvas, iš lot. Juventinus, kuris yra priesagos -inus vedinys iš Juventius, žr. Juvencijus.','Vardo reikšmė: Juventinas – (2) lot., trump. Juventas, Juvas, iš lot. Juventinus, kuris yra priesagos -inus vedinys iš Juventius, žr. Juvencijus.',' Juventinas yra lotynų kilmės vardas.'),(1324,'Julijona',' Julijona yra Moteriškas vardas.','Trumpa reikšmė: „garbanė“, legendinio trojėno Enėjo, Romos įkūrėjo, sūnaus vardas buvo Julus.','Vardo reikšmė: Julijonos atviros moterys, ir žmonės tą jaučia. Jos mėgsta išklausyti kitų išgyvenimus ir dėl savo geros intuicijos, pataria, kaip elgtis. Pavargusios nuo intelektualaus darbo mėgsta pasportuoti. Mėgstamiausios sporto šakos: plaukimas, badmintonas ir atpalaiduojantys pratimai',' Julijona yra graikų, lotynų kilmės vardas.'),(1325,'Josvainė',' Josvainė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Josvė, Vainė, iš vyr. v. Josvainas.','Vardo reikšmė: Josvainė – (1) liet., trump. Josvė, Vainė, iš vyr. v. Josvainas.',' Josvainė yra lietuvių kilmės vardas.'),(1326,'Jovardas',' Jovardas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Jovas, Vardys, jo- (žr. Jodaugas) + vard- (: liet. vard-uoti „burti“, plg. vardas, latv. vards „žodis“).','Vardo reikšmė: Jovardas – (1) liet., trump. Jovas, Vardys, jo- (žr. Jodaugas) + vard- (: liet. vard-uoti „burti“, plg. vardas, latv. vards „žodis“).',' Jovardas yra lietuvių kilmės vardas.'),(1327,'Kangailė',' Kangailė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Gailė, iš vyr. avd. Kangaila, žr. Kangailas.','Vardo reikšmė: Kangailė – (1) liet., trump. Gailė, iš vyr. avd. Kangaila, žr. Kangailas.',' Kangailė yra lietuvių kilmės vardas.'),(1328,'Juventas',' Juventas yra Vyriškas vardas.','Trumpa reikšmė: juvens „jaunas“.','Vardo reikšmė: Juventas – (2) liet. trumpinys iš Juventius, žr. Juvencijus.',' Juventas yra lotynų kilmės vardas.'),(1329,'Julija',' Julija yra Moteriškas vardas.','Trumpa reikšmė: „garbanius, -ė“, legendinio Enėjo sūnaus vardas Julus.','Vardo reikšmė: Julijos pasirenka įvairias veiklos sritis. Jeigu jos linkusios į menus, tai tampa puikiomis dailininkėmis, muzikantėmis ar rašytojomis. Gali tapti taip pat istorikėmis, teisėjomis, politikėmis, mokytojomis.',' Julija yra graikų kilmės vardas.'),(1330,'Juozas',' Juozas yra Vyriškas vardas.','Trumpa reikšmė: iš Juozapas „teprideda Jehova (dievas) prie šio (gimusio) dar vieną vaiką“.','Vardo reikšmė: Juozų teigiamos savybės: įkvėptumas, susikaupimas, geraširdiškumas, jautrumas, diplomatiškumas, garbingumas, paslaptingumas, kantrumas.',' Juozas yra hebrajų kilmės vardas.'),(1331,'Juvencijus',' Juvencijus yra Vyriškas vardas.','Trumpa reikšmė: juventus „jaunystė“.','Vardo reikšmė: Juvencijus – (1) lot., trump. Juvas, Juventas, iš lot. Juventius: lot. juventus „jaunystė“.',' Juvencijus yra lotynų kilmės vardas.'),(1332,'Kangailas',' Kangailas yra Vyriškas vardas.','Trumpa reikšmė: liet., sen. var. Kangaila, trump. Gailas, kan- iš kant(i)- (: liet. pa-kantus, kant-rus) + gail- (: sen. liet. gailas „stiprus“).','Vardo reikšmė: Kangailas – (1) liet., sen. var. Kangaila, trump. Gailas, kan- iš kant(i)- (: liet. pa-kantus, kant-rus) + gail- (: sen. liet. gailas „stiprus“).',' Kangailas yra lietuvių kilmės vardas.'),(1333,'Julė',' Julė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Julija: „garbanė“.','Vardo reikšmė: Julijos pasirenka įvairias veiklos sritis. Jeigu jos linkusios į menus, tai tampa puikiomis dailininkėmis, muzikantėmis ar rašytojomis. Gali tapti taip pat istorikėmis, teisėjomis, politikėmis, mokytojomis.',' Julė yra graikų kilmės vardas.'),(1334,'Jovaldė',' Jovaldė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Jovė, Valdė, iš vyr. v. Jovaldas.','Vardo reikšmė: Jovaldė – (1) liet., trump. Jovė, Valdė, iš vyr. v. Jovaldas.',' Jovaldė yra lietuvių kilmės vardas.'),(1335,'Kandidas',' Kandidas yra Vyriškas vardas.','Trumpa reikšmė: „baltas, be dėmės“.','Vardo reikšmė: Kandidas – (2) lot., trump. Didas, iš lot. Candidus: lot. candidus „baltas, be dėmės“.',' Kandidas yra lotynų kilmės vardas.'),(1336,'Juvenalis',' Juvenalis yra Vyriškas vardas.','Trumpa reikšmė: juvenalis „jaunuoliškas“.','Vardo reikšmė: Juvenalis – (2) lot., trump. Juvenas, Juvas, iš lot. Juvenalis: lot. juvenalis „jaunuoliškas, jaunatviškas“.',' Juvenalis yra lotynų kilmės vardas.'),(1337,'Jukundas',' Jukundas yra Vyriškas vardas.','Trumpa reikšmė: „malonus, mielas“.','Vardo reikšmė: Jukundas – (1) lot., iš lot. Jucundus: lot. jucundus „malonus, mielas“.',' Jukundas yra lotynų kilmės vardas.'),(1338,'Jovaldas',' Jovaldas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Jovas, Valdas, jo- (žr. Jodaugas) + vald- (: liet. vald-yti, vald-o).','Vardo reikšmė: Jovaldas – (1) liet., trump. Jovas, Valdas, jo- (žr. Jodaugas) + vald- (: liet. vald-yti, vald-o).',' Jovaldas yra lietuvių kilmės vardas.'),(1339,'Kantrimė',' Kantrimė yra Moteriškas vardas.','Trumpa reikšmė: kan- (pa-kantus, kantrus) + rim- (rimti) – „kantrus, ramus“.','Vardo reikšmė: Kantrimė – (1) liet., trump. Kantė, Kantrė, iš vyr. v. Kantrimas.',' Kantrimė yra lietuvių kilmės vardas.'),(1340,'Kandida',' Kandida yra Moteriškas vardas.','Trumpa reikšmė: „baltas, be dėmės“.','Vardo reikšmė: Kandida – (2) lot., trump. Dida, iš lot. Candida: lot. candida „balta, be dėmės“.',' Kandida yra lotynų kilmės vardas.'),(1341,'Justinas',' Justinas yra Vyriškas vardas.','Trumpa reikšmė: justa, justus „teisinga, -as“ +-in-.','Vardo reikšmė: Vardadienis: Balandžio 14 d., birželio 1 d.',' Justinas yra lotynų kilmės vardas.'),(1342,'Jukunda',' Jukunda yra Moteriškas vardas.','Trumpa reikšmė: „malonus, mielas“.','Vardo reikšmė: Jukunda – (1) lot., iš lot. Jucunda: lot. jucunda „maloni, miela“.',' Jukunda yra lotynų kilmės vardas.'),(1343,'Kamilė',' Kamilė yra Moteriškas vardas.','Trumpa reikšmė: „patarnaujantis, - i aukojant“.','Vardo reikšmė: (2) lot., trump. Kamė, iš vyr. v. Kamilas',' Kamilė yra lotynų kilmės vardas.'),(1344,'Kantrimas',' Kantrimas yra Vyriškas vardas.','Trumpa reikšmė: kan- (pa-kantus, kantrus) + rim- (rimti) – „kantrus, ramus“.','Vardo reikšmė: Kantrimas – (1) liet., trump. Kantas, Kantrys, kant- (žr. Kangailas) + rim- (: liet. rim-ti, rim-o).',' Kantrimas yra lietuvių kilmės vardas.'),(1345,'Juozapina',' Juozapina yra Moteriškas vardas.','Trumpa reikšmė: hebr., trump. Juozė, Juzė, iš sulotyninto Josephina, kuris yra priesagos -ina vedinys iš Josepha, žr. Juozapa.','Vardo reikšmė: Juozapina – (2) hebr., trump. Juozė, Juzė, iš sulotyninto Josephina, kuris yra priesagos -ina vedinys iš Josepha, žr. Juozapa.',' Juozapina yra hebrajų kilmės vardas.'),(1346,'Justina',' Justina yra Moteriškas vardas.','Trumpa reikšmė: justa, justus „teisinga, -as“ +-in-.','Vardo reikšmė: Vardadienis: Rugsėjo 5-26 d., spalio 7 d.',' Justina yra lotynų kilmės vardas.'),(1347,'Juozapas',' Juozapas yra Vyriškas vardas.','Trumpa reikšmė: „teprideda Jehova (dievas) prie šio (gimusio) dar vieną sūnų“.','Vardo reikšmė: Juozapai tiesmuki, būna grubūs ir žiaurūs, tiesiog – storžieviai. Daugelį moka nuteikti prieš save, dėl to įsigydami priešų visam gyvenimui.',' Juozapas yra hebrajų kilmės vardas.'),(1348,'Kantminas',' Kantminas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Kantas, kant- (žr. Kangailas) + min- (žr. Kalminas).','Vardo reikšmė: Kantminas – (1) liet., trump. Kantas, kant- (žr. Kangailas) + min- (žr. Kalminas).',' Kantminas yra lietuvių kilmės vardas.'),(1349,'Justė',' Justė yra Moteriškas vardas.','Trumpa reikšmė: justa „teisinga“.','Vardo reikšmė: Justė – (2) liet. trumpinys iš Justina.',' Justė yra lotynų kilmės vardas.'),(1350,'Juozapa',' Juozapa yra Moteriškas vardas.','Trumpa reikšmė: iš Juozapas „teprideda Jehova (dievas) prie šio (gimusio) dar vieną vaiką“.','Vardo reikšmė: Juozapa – (1), (3b) hebr., trump. Juozė, Juzė, tarm. Jūzupė žem., Juzia piet. aukšt. (dz.), baž. lot. Josepha iš vyr. v. Joseph, žr. Juozapas.',' Juozapa yra hebrajų kilmės vardas.'),(1351,'Justas',' Justas yra Vyriškas vardas.','Trumpa reikšmė: justus „teisingas“.','Vardo reikšmė: Vardadienis: Sausio 26 d., gegužės 28 d., gruodžio 15 d.',' Justas yra lotynų kilmės vardas.'),(1352,'Kalnius',' Kalnius yra Vyriškas vardas.','Trumpa reikšmė: liet., metatoninis galūnės vedinys iš liet. kalnas.','Vardo reikšmė: Kalnius – (2) liet., metatoninis galūnės vedinys iš liet. kalnas.',' Kalnius yra lietuvių kilmės vardas.'),(1353,'Kasijonas',' Kasijonas yra Vyriškas vardas.','Trumpa reikšmė: cassus „tuščias“.','Vardo reikšmė: Kasijonas – (2) lot., trump. Kasijus, Kasius, iš lot. Cassianus, kuris yra priesagos -anus vedinys iš sen. romėnų giminės vardo Cassius — Kasijus: lot. cassus „tuščias“.',' Kasijonas yra lotynų kilmės vardas.'),(1354,'Juntautė',' Juntautė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Juntė, iš vyr. v. Juntautas.','Vardo reikšmė: Juntautė – (1) liet., trump. Juntė, iš vyr. v. Juntautas.',' Juntautė yra lietuvių kilmės vardas.'),(1355,'Kalnė',' Kalnė yra Moteriškas vardas.','Trumpa reikšmė: liet., iš vyr. v. Kalnius.','Vardo reikšmė: Kalnė – (2) liet., iš vyr. v. Kalnius.',' Kalnė yra lietuvių kilmės vardas.'),(1356,'Kantigirdė',' Kantigirdė yra Moteriskas vardas.','Trumpa reikšmė: suliet. prūs., trump. Kantė,iš vyr. v. Kantigirdas.','Vardo reikšmė: Kantigirdė – (1) suliet. prūs., trump. Kantė,iš vyr. v. Kantigirdas.',' Kantigirdė yra prūsų kilmės vardas.'),(1357,'Karolis',' Karolis yra Vyriškas vardas.','Trumpa reikšmė: karl „šaunus, -i“.','Vardo reikšmė: Šeimoje kaprizingumas dažnai užgožia kitus asmeninius bruožus, todėl konfliktai su antrąja puse neišvengiami.',' Karolis yra vokiečių kilmės vardas.'),(1358,'Kalmintas',' Kalmintas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Kalmas, kal- (žr. Kalmantas) + mint- (: liet. minti, mena, mintis).','Vardo reikšmė: Kalmintas – (1) liet., trump. Kalmas, kal- (žr. Kalmantas) + mint- (: liet. minti, mena, mintis).',' Kalmintas yra lietuvių kilmės vardas.'),(1359,'Kantigirdas',' Kantigirdas yra Vyriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Kantas, Kantys, kanti- (žr. Kangailas) + gird- (: liet. gird-ėti, girdas „žinia, gandas“).','Vardo reikšmė: Kantigirdas – (1) suliet. prūs., trump. Kantas, Kantys, kanti- (žr. Kangailas) + gird- (: liet. gird-ėti, girdas „žinia, gandas“).',' Kantigirdas yra prūsų kilmės vardas.'),(1360,'Karolina',' Karolina yra Moteriškas vardas.','Trumpa reikšmė: karl „šauni“.','Vardo reikšmė: Silpniausia vieta Karolinoms yra jų fizinis pažeidžiamumas. Beveik kiekviename žingsnyje Karoliną gali ištikti visai netikėti  nelaimingi nutikimai, nes jai neįprasta iš pradžių galvoti, o tik paskui veikti.',' Karolina yra vokiečių kilmės vardas.'),(1361,'Kantė',' Kantė yra Moteriškas vardas.','Trumpa reikšmė: liet., iš vyr. v. Kantas.','Vardo reikšmė: Kantė – (2) liet., iš vyr. v. Kantas.',' Kantė yra lietuvių kilmės vardas.'),(1362,'Kęsvilė',' Kęsvilė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Kęstė, Kęsvė, iš vyr. v. Kęsvilas.','Vardo reikšmė: Šio vardo savininkai savo gyvenimą dažniausiai pašvenčia visuomeninėms organizacijoms. Nemėgsta pagalbos iš šalies, jums patinka viską daryti patiems. Esate labai užsispyrę. Valios jėga ir rimtas charakteris leidžia susidoroti su bet kokiais projektais, todėl gyvenime palieka gilų pėdsaką.',' Kęsvilė yra lietuvių kilmės vardas.'),(1363,'Karolė',' Karolė yra Moteriškas vardas.','Trumpa reikšmė: karl „šaunus, -i“.','Vardo reikšmė: Karolės silpniausia vieta - fizinis pažeidžiamumas. Beveik kiekviename žingsnyje Karolę gali ištikti netikėti  nelaimingi nutikimai, nes jai neįprasta iš pradžių galvoti, o tik paskui veikti.',' Karolė yra vokiečių kilmės vardas.'),(1364,'Jurgita',' Jurgita yra Moteriškas vardas.','Trumpa reikšmė: „žemdirbė“ +-it-.','Vardo reikšmė: Jurgita – graikų kilmės vardas mergaitei, kurio trumpinys – Jurga. Graikų kalboje Jurga reiškia žemdirbė. Jurgitos vardas įtalų kalboje – Giorgitta. Jurgita vardo vienintelė alternatyva vyrui – Jurgis.',' Jurgita yra graikų kilmės vardas.'),(1365,'Kalminas',' Kalminas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Kalmas, kal- (žr. Kalmantas) + min- (: liet. min-ėti, min-i).','Vardo reikšmė: Kalminas – (1) liet., trump. Kalmas, kal- (žr. Kalmantas) + min- (: liet. min-ėti, min-i).',' Kalminas yra lietuvių kilmės vardas.'),(1366,'Kantenis',' Kantenis yra Vyriškas vardas.','Trumpa reikšmė: liet. ir prūs., trump. Kantas, priesagos -enis vedinys iš sen. trumpinio Kantas.','Vardo reikšmė: Kantenis – (2) liet. ir prūs., trump. Kantas, priesagos -enis vedinys iš sen. trumpinio Kantas.',' Kantenis yra prūsų kilmės vardas.'),(1367,'Kęsvilas',' Kęsvilas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Kęstas, Kęsvys, kęs- iš kęst- (žr. Kęsbartas) + vil- (žr. Kantvilas).','Vardo reikšmė: Šio vardo savininkai savo gyvenimą dažniausiai pašvenčia visuomeninėms organizacijoms. Nemėgsta pagalbos iš šalies, jums patinka viską daryti patiems. Esate labai užsispyrę. Valios jėga ir rimtas charakteris leidžia susidoroti su bet kokiais projektais, todėl gyvenime palieka gilų pėdsaką. ',' Kęsvilas yra lietuvių kilmės vardas.'),(1368,'Karmela',' Karmela yra Moteriškas vardas.','Trumpa reikšmė: carmen „daina“.','Vardo reikšmė: Karmela – (2) isp., trump. Karma, Mela, iš isp. Carmela, kuris yra isp. vardo Carmen (: lot. carmen „daina“) liaudiškas variantas.',' Karmela yra ispanų kilmės vardas.'),(1369,'Karina',' Karina yra Moteriškas vardas.','Trumpa reikšmė: „dailioji, gražioji“.','Vardo reikšmė: Karinos, veikiamos neigiamos skaičių vibracijos, tampa tik savų interesų vykdytojomis. Gali išnaudoti žmogų ir palikti likimo valiai. Joms taikytinas itin svarbus posakis: “Nekask duobės kitam, nes pats įkrisi”.',' Karina yra italų kilmės vardas.'),(1370,'Kazimieras',' Kazimieras yra Vyriškas vardas.','Trumpa reikšmė: „didžiakalbis, garsėjantis kalba“.','Vardo reikšmė: Kazimierams patartina mokytis geriau save išreikšti. Būtina įgyti pasitikėjimą savimi, pažaboti aikštingą temperamentingą charakterį, daugiau bendrauti su žmonėmis.',' Kazimieras yra lotynų kilmės vardas.'),(1371,'Kantautė',' Kantautė yra Moteriškas vardas.','Trumpa reikšmė: kan- (pa-kantus, kantrus) + taut- (tauta).','Vardo reikšmė: Kantautė – (1) liet., trump. Kantė, iš vyr. v. Kantautas.',' Kantautė yra lietuvių kilmės vardas.'),(1372,'Kalmantė',' Kalmantė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Kalmė, iš vyr. v. Kalmantas..','Vardo reikšmė: Kalmantė – (1) liet., trump. Kalmė, iš vyr. v. Kalmantas.',' Kalmantė yra lietuvių kilmės vardas.'),(1373,'Karigailė',' Karigailė yra Moteriškas vardas.','Trumpa reikšmė: kar- (kariuomenė, karys) + gail- (gailas „stiprus“) „stiprus karys“.','Vardo reikšmė: Karigailė – (1) liet., trump. Karė, iš vyr. v. Karigaila.',' Karigailė yra lietuvių kilmės vardas.'),(1374,'Kantautas',' Kantautas yra Vyriškas vardas.','Trumpa reikšmė: kan- (pa-kantus, kantrus) + taut- (tauta).','Vardo reikšmė: Kantautas – (1) liet., trump. Kantas, kan- iš kant- (žr. Kangailas) + taut- (: liet. taut-a).',' Kantautas yra lietuvių kilmės vardas.'),(1375,'Kazimiera',' Kazimiera yra Moteriškas vardas.','Trumpa reikšmė: „didžiakalbis, garsėjantis kalba“.','Vardo reikšmė: Kazimierų neigiamos savybės: paviršutiniškumas, niūrumas, nekantrumas. Būdamos emocingos ir jautrios, kartais įžvelgia kritiką ten, kur jos iš tikrųjų visai nėra. Gali būti pavydžios ir plepios. Joms patartina siekti konkrečių tikslų, nepanirti į mistikos labirintus.',' Kazimiera yra lotynų kilmės vardas.'),(1376,'Kalmantas',' Kalmantas yra Vyriškas vardas.','Trumpa reikšmė: „sumanus“.','Vardo reikšmė: Kalmantas – (1) liet., trump. Kalmas, kai- (: prūs. kal-tza iš kal-sa „skambėti“, latv. kal-uot „šnekėti“, liet. kal-ba) + mant- (: liet. mantus „sumanus“).',' Kalmantas yra lietuvių kilmės vardas.'),(1377,'Kantas',' Kantas yra Vyriškas vardas.','Trumpa reikšmė: liet., trumpinys iš vardų su Kan-t-, Kant-: Kantautas, Kantminas ir kt.','Vardo reikšmė: Kantas – (2) liet., trumpinys iš vardų su Kan-t-, Kant-: Kantautas, Kantminas ir kt.',' Kantas yra lietuvių kilmės vardas.'),(1378,'Karalius',' Karalius yra Vyriškas vardas.','Trumpa reikšmė: sulietuvintas vardo Karolis variantas.','Vardo reikšmė: Karalius – (2) sulietuvintas vardo Karolis variantas.',' Karalius yra lietuvių kilmės vardas.'),(1379,'Kazė',' Kazė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Kazimiera, Kazimieras: „didžiakalbis, garsėjantis kalba“.','Vardo reikšmė: Kazimierų neigiamos savybės: paviršutiniškumas, niūrumas, nekantrumas. Būdamos emocingos ir jautrios, kartais įžvelgia kritiką ten, kur jos iš tikrųjų visai nėra. Gali būti pavydžios ir plepios. Joms patartina siekti konkrečių tikslų, nepanirti į mistikos labirintus.',' Kazė yra lotynų kilmės vardas.'),(1380,'Kanutas',' Kanutas yra Vyriškas vardas.','Trumpa reikšmė: „kilmingasis, kinusis“.','Vardo reikšmė: Kanutas – (2) skand., trump. Kanas, Knutas, baž. lot. Canutus iš skand. Kanut – „kilmingasis, kilnusis“.',' Kanutas yra skandinavų kilmės vardas.'),(1381,'Katrė',' Katrė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Katarina: „tyra, švari“.','Vardo reikšmė: Katrė – (2), (4) liet. trumpinys iš Katryna, žr. Katarina.',' Katrė yra graikų kilmės vardas.'),(1382,'Kantalgė',' Kantalgė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Kantė, iš vyr. v. Kantalgas.','Vardo reikšmė: Kantalgė – (1) liet., trump. Kantė, iš vyr. v. Kantalgas.',' Kantalgė yra lietuvių kilmės vardas.'),(1383,'Kantalgas',' Kantalgas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Kantas, kant- (žr. Kangailas) + alg- (: liet. alg-a „atpildas, atlyginimas“).','Vardo reikšmė: Kantalgas – (1) liet., trump. Kantas, kant- (žr. Kangailas) + alg- (: liet. alg-a „atpildas, atlyginimas“).',' Kantalgas yra lietuvių kilmės vardas.'),(1384,'Kantvilė',' Kantvilė yra Moteriškas vardas.','Trumpa reikšmė: kan- (pa-kantus, kantrus) + vil- (viltis) – „kantriai besiviliantis“.','Vardo reikšmė: Kantvilė – (1), (2) liet. ir prūs., trump. Kantė, iš vyr. v. Kantvilas.',' Kantvilė yra lietuvių kilmės vardas.'),(1385,'Kantvilas',' Kantvilas yra Vyriškas vardas.','Trumpa reikšmė: kan- (pa-kantus, kantrus) + vil- (viltis) – „kantriai besiviliantis“.','Vardo reikšmė: Kantvilas – (1) liet. ir prūs., trump. Kantas, kant- (žr. Kangailas) + vil- (: liet. vil-tis, vil-iasi, vil-tis).',' Kantvilas yra lietuvių kilmės vardas.'),(1386,'Kangedas',' Kangedas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Gedas, kan- (žr. Kangailas) + ged- (: liet. ged-auti „ilgėtis“).','Vardo reikšmė: Kangedas – (1) liet., trump. Gedas, kan- (žr. Kangailas) + ged- (: liet. ged-auti „ilgėtis“).',' Kangedas yra lietuvių kilmės vardas.'),(1387,'Kastytis',' Kastytis yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Kastautas: kas (įvardis kas) + taut- (tauta) „kas ta tauta“; Maironio baladės „Jūratė ir Kastytis“ veikėjas.','Vardo reikšmė: Kastyčiai, kurie laisvalaikiu naudojasi įvairiais malonumais ar tuščiai laiką leidžia, labai retos išimtys.',' Kastytis yra lietuvių kilmės vardas.'),(1388,'Kantvydas',' Kantvydas yra Vyriškas vardas.','Trumpa reikšmė: kan- (pa-kantus, kantrus) + vyd- (iš-vydo).','Vardo reikšmė: Kantvydas – (1) liet. ir prūs., trump. Kantas, kant- (žr. Kangailas) + vyd- (: liet. iš-vyd-o, iš-vysti).',' Kantvydas yra lietuvių kilmės vardas.'),(1389,'Kastė',' Kastė yra Moteriškas vardas.','Trumpa reikšmė: liet., trumpinys iš Kastautė, 2. liet., trumpinys iš sulietuvinto Kastancija, žr. Konstancija..','Vardo reikšmė: Kastė – (2) 1. liet., trumpinys iš Kastautė, 2. liet., trumpinys iš sulietuvinto Kastancija, žr. Konstancija.',' Kastė yra lietuvių kilmės vardas.'),(1390,'Kastautė',' Kastautė yra Moteriškas vardas.','Trumpa reikšmė: kas (įvardis kas) + taut- (tauta) „kas ta tauta“.','Vardo reikšmė: Kastautė – (1) liet., trump. Kastė, iš vyr. v. Kastautas.',' Kastautė yra lietuvių kilmės vardas.'),(1391,'Kintaras',' Kintaras yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Kintas, kin- iš kint- (žr. Kintalgas) + tar- (: liet. tar-ti, tar-yti).','Vardo reikšmė: Turite stipriai išreikštą kūno energetiką. Šie vardo savininkai rūpinasi materialine ateitimi, apie tai, kas būtina pasiturinčiam gyvenimui, ir tai jiems sekasi gana gerai, nes jie tikri finansų genijai; žino, kur taupyti ir kaip paskirstyti pinigus. ',' Kintaras yra lietuvių kilmės vardas.'),(1392,'Kantvainė',' Kantvainė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Kantė, iš vyr. v. Kantvainas.','Vardo reikšmė: Kantvainė – (1) liet., trump. Kantė, iš vyr. v. Kantvainas.',' Kantvainė yra lietuvių kilmės vardas.'),(1393,'Kastautas',' Kastautas yra Vyriškas vardas.','Trumpa reikšmė: kas (įvardis kas) + taut- (tauta) „kas ta tauta“.','Vardo reikšmė: Kastautas – (1) liet., trump. Kastas, Kastys, kas- (: liet. įvardis kas) + taut- (žr. Kantautas).',' Kastautas yra lietuvių kilmės vardas.'),(1394,'Kintalgė',' Kintalgė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Kintė, iš vyr. v. Kintalgas.','Vardo reikšmė: Kintalgė – (1) liet., trump. Kintė, iš vyr. v. Kintalgas.',' Kintalgė yra lietuvių kilmės vardas.'),(1395,'Kastas',' Kastas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Kastautas, Kastautė: kas (įvardis kas) + taut- (tauta) „kas ta tauta“.','Vardo reikšmė: Kastas – (2) 1. liet. trumpinys iš Kastantas, 2. liet., trumpinys iš Kastautas.',' Kastas yra lietuvių kilmės vardas.'),(1396,'Kintalgas',' Kintalgas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Kintas, kint- (: liet. kint- su balsių kaita iš kent-ėti, plg. žiem-kin-tis „kas žiemą iškenčia“) + alg- (žr. Kantalgas).','Vardo reikšmė: Kintalgas – (1) liet., trump. Kintas, kint- (: liet. kint- su balsių kaita iš kent-ėti, plg. žiem-kin-tis „kas žiemą iškenčia“) + alg- (žr. Kantalgas).',' Kintalgas yra lietuvių kilmės vardas.'),(1397,'Kastancija',' Kastancija yra Moteriškas vardas.','Trumpa reikšmė: iš Konstantas, Konstanta: constans „ištvermingas, tvirtas“.','Vardo reikšmė: Kastancija – (1) žr. Konstancija.',' Kastancija yra lotynų kilmės vardas.'),(1398,'Kasparas',' Kasparas yra Vyriškas vardas.','Trumpa reikšmė: „iždininkas“.','Vardo reikšmė: Kasparai gyvenime pasireiškia kaip rašytojai, oratoriai arba aktoriai. Jie turtingos vaizduotės, labai jautrūs, dosnūs ir meilūs.',' Kasparas yra lotynų kilmės vardas.'),(1399,'Kasijus',' Kasijus yra Vyriškas vardas.','Trumpa reikšmė: cassus „tuščias“.','Vardo reikšmė: Jūs apsigimę kolekcionieriai. Jūsų namuose daugybė įdomių daiktų. Sienas puošia antikvariniai paveikslai, turi daug muzikos įrašų. Jūsų profesijos: ekonomistai, teisininkai, mokslininkai, rašytojai, profesionalūs sportininkai, dvasininkai, slaptieji agentai, šnipai.',' Kasijus yra lotynų kilmės vardas.'),(1400,'Kilmintas',' Kilmintas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Kilius, Kilmys, kil- (žr. Kilmantas) + mint- (žr. Kalmintas).','Vardo reikšmė: Kilmintas – (1) liet., trump. Kilius, Kilmys, kil- (žr. Kilmantas) + mint- (žr. Kalmintas).',' Kilmintas yra lietuvių kilmės vardas.'),(1401,'Kilminas',' Kilminas yra vyriškas vardas.','Trumpa reikšmė: liet., trump. Kilius, Kilmys, kil- (žr. Kilmantas) + min- (žr. Kalminas).','Vardo reikšmė: Kilminas – (1) liet., trump. Kilius, Kilmys, kil- (žr. Kilmantas) + min- (žr. Kalminas).',' Kilminas yra lietuvių kilmės vardas.'),(1402,'Kilmantė',' Kilmantė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Kilė, Kilma, iš vyr. v. Kilmantas.','Vardo reikšmė: Kilmantė – (1) liet., trump. Kilė, Kilma, iš vyr. v. Kilmantas.',' Kilmantė yra lietuvių kilmės vardas.'),(1403,'Kilmantas',' Kilmantas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Kilius, Kilmys, kil- (: liet. kil-ti) + mant- (žr. Kalmantas).','Vardo reikšmė: Kilmantas – (1) liet., trump. Kilius, Kilmys, kil- (: liet. kil-ti) + mant- (žr. Kalmantas).',' Kilmantas yra lietuvių kilmės vardas.'),(1404,'Kilijonas',' Kilijonas yra Vyriškas vardas.','Trumpa reikšmė: „šventikas“.','Vardo reikšmė: Nors dažnai būdami užsiėmę svarbiais darbais, labai vertina namų židinį. Jūs dažniausiai nesate romantikai, todėl flirtas ir seksas jus mažai domina. Jums svarbi tik meilė, į kurią jūs žiūrite labai atsargiai. Tik įsitikinę jausmų tikrumu kuriate šeimą.',' Kilijonas yra keltų kilmės vardas.'),(1405,'Kęsvinas',' Kęsvinas yra Vyriškas vardas.','Trumpa reikšmė: „priežastis, kaltė“.','Vardo reikšmė: Kęsvinas – (1) liet., trump. Kęstas, Kęsvys, kęs- iš kęst- (žr. Kęsbartas) + vin- (sen. liet. vin- su balsių kaita iš vaina „priežastis, kaltė“).',' Kęsvinas yra lietuvių kilmės vardas.'),(1406,'Kęsgailas',' Kęsgailas yra Vyriškas vardas.','Trumpa reikšmė: liet., sen. var. Kęsgaila, trump. Kęstas, Kęstys, kęs- iš kęst- (žr. Kęsbartas) + gail- (žr. Kangailas).','Vardo reikšmė: Kęsgailas – (1) liet., sen. var. Kęsgaila, trump. Kęstas, Kęstys, kęs- iš kęst- (žr. Kęsbartas) + gail- (žr. Kangailas).',' Kęsgailas yra lietuvių kilmės vardas.'),(1407,'Kęsbartė',' Kęsbartė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Kęstė, iš vyr. v. Kęsbartas.','Vardo reikšmė: Kęsbartė – (1) liet., trump. Kęstė, iš vyr. v. Kęsbartas.',' Kęsbartė yra lietuvių kilmės vardas.'),(1408,'Kęstutis',' Kęstutis yra Vyriškas vardas.','Trumpa reikšmė: „kęsti“– „kenčiantysis“.','Vardo reikšmė: Kęstučiai turi gerą humoro jausmą, todėl su jais bendrauti labai įdomu. Mėgsta skaityti detektyvinius romanus bei fantastiką. Gyvenime gali būti labai gerais tardytojais, analitikais bei politikais.',' Kęstutis yra lietuvių kilmės vardas.'),(1409,'Kęsbartas',' Kęsbartas yra Vyriškas vardas.','Trumpa reikšmė: kęs- (kęsti) + bart- (barti „kovoti“, plg. rusų „borotsia“) – „kenčiantis ir kovojantis“.','Vardo reikšmė: Kęsbartas – (1) liet., trump. Kęstas, Kęstys, kęs- iš kęst- (: liet. kęsti) + bart- (: liet. bar-ti sen. reikšme „kovoti“, bartas, plg. rus. borotjsia „kovoti“).',' Kęsbartas yra lietuvių kilmės vardas.'),(1410,'Kęstutė',' Kęstutė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Kęstė, iš vyr. v. Kęstutis.','Vardo reikšmė: Jūs – tvirtų pažiūrų žmonės, savarankiški, užsispyrę, protingi, talentingi ir ambicingi. Nepaprastai seksualūs, tačiau būdami drovūs dažnai patiria skaudžių išgyvenimų. Šeimoje ištikimi ir prieraišūs, tačiau sugyventi su jais nelengva. Draugų turi nedaug.',' Kęstutė yra lietuvių kilmės vardas.'),(1411,'Kervydas',' Kervydas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Kerys, ker- (žr. Kergailas) + vyd- (žr. Kantvydas).','Vardo reikšmė: Kervydas – (1) liet., trump. Kerys, ker- (žr. Kergailas) + vyd- (žr. Kantvydas).',' Kervydas yra lietuvių kilmės vardas.'),(1412,'Kęstė',' Kęstė yra Moteriškas vardas.','Trumpa reikšmė: liet. ir prūs., galūnės vedinys iš Kęstas, taip pat trumpinys iš mot. v. Kęs-t-: Kęstartė, Kęstautė.','Vardo reikšmė: Jūs – tvirtų pažiūrų žmonės, savarankiški, užsispyrę, protingi, talentingi ir ambicingi. Nepaprastai seksualūs, tačiau būdami drovūs dažnai patiria skaudžių išgyvenimų. Šeimoje ištikimi ir prieraišūs, tačiau sugyventi su jais nelengva. Draugų turi nedaug.',' Kęstė yra lietuvių kilmės vardas.'),(1413,'Kervainas',' Kervainas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Kerys, ker- (žr. Kergailas) + vain- (žr. Kantvainas).','Vardo reikšmė: Kervainas – (1) liet., trump. Kerys, ker- (žr. Kergailas) + vain- (žr. Kantvainas).',' Kervainas yra lietuvių kilmės vardas.'),(1414,'Kęstautas',' Kęstautas yra Vyriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Jūs – tvirtų pažiūrų žmonės, savarankiški, užsispyrę, protingi, talentingi ir ambicingi. Nepaprastai seksualūs, tačiau būdami drovūs dažnai patiria skaudžių išgyvenimų. Šeimoje ištikimi ir prieraišūs, tačiau sugyventi su jais nelengva. Draugų turi nedaug.',' Kęstautas yra lietuvių kilmės vardas.'),(1415,'Kipras',' Kipras yra Vyriškas vardas.','Trumpa reikšmė: „kiprijietis, Kipro gyventojas“.','Vardo reikšmė: Jūs tai dievo dovana, nes visus savo sugebėjimus, talentus, kuriais gamta dosniai apdovanojo, skiriate tarnavimui žmonėms, savo tėvynei, kurioje jie gyvena.',' Kipras yra graikų kilmės vardas.'),(1416,'Kęstas',' Kęstas yra Vyriškas vardas.','Trumpa reikšmė: „kęsti“– „kenčiantysis“.','Vardo reikšmė: (2) liet, ir prūs., trumpinys iš avd. su Kęs-t-: Kęstartas, Kęstautas ir kt.',' Kęstas yra lietuvių kilmės vardas.'),(1417,'Kertautas',' Kertautas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Kerys, Kertys, ker- (žr. Kergailas) + taut- (žr. Kantautas).','Vardo reikšmė: Kertautas – (1) liet., trump. Kerys, Kertys, ker- (žr. Kergailas) + taut- (žr. Kantautas).',' Kertautas yra lietuvių kilmės vardas.'),(1418,'Kintvilė',' Kintvilė yra Moteriškas vardas.','Trumpa reikšmė: kin- (kentėti, pvz, žiem-kint- is) + vil-(viltis) – „kenčiantis ir besiviliantis“.','Vardo reikšmė: Kintvilė – (1), (2) liet., trump. Kintė, iš vyr. v. Kintvilas.',' Kintvilė yra lietuvių kilmės vardas.'),(1419,'Klarentas',' Klarentas yra Vyriškas vardas.','Trumpa reikšmė: „šviečiantis“.','Vardo reikšmė: Klarentas – (2) lot., trump. Klaras, iš lot. Clarentius: lot. clarens (kilm. clarentis) „šviečiantis“.',' Klarentas yra lotynų kilmės vardas.'),(1420,'Kernius',' Kernius yra Vyriškas vardas.','Trumpa reikšmė: kerna, kernius „mažaūgis“; iš legendinio Kernavės kunigaikščio vardas.','Vardo reikšmė: Kernius – (2) liet., iš legendinio Kernavės kunigaikščio vardo, kuris yra galūnės vedinys iš liet. kerna, kerna „mažaūgis (žmogus)“.',' Kernius yra lietuvių kilmės vardas.'),(1421,'Kintvilas',' Kintvilas yra Vyriškas vardas.','Trumpa reikšmė: kin- (kentėti, pvz, žiem-kint- is) + vil-(viltis) – „kenčiantis ir besiviliantis“.','Vardo reikšmė: Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs gerai numatote vedybų perspektyvas, ir jeigu vedate ar ištekate, tai tik su dideliu kraičiu. Kartais gaunate didelį palikimą iš tolimų giminaičių. Su antrąja puse gyvenate labai paslaptingą ir keistą gyvenimą.',' Kintvilas yra lietuvių kilmės vardas.'),(1422,'Klaras',' Klaras yra Vyriškas vardas.','Trumpa reikšmė: „šviesus, garsus“.','Vardo reikšmė: Klaras – (2) lot., iš lot. Clarus: lot. clarus „šviesus, garsus“.',' Klaras yra lotynų kilmės vardas.'),(1423,'Kermantė',' Kermantė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Kerė, iš vyr. v. Kermantas.','Vardo reikšmė: Kermantė – (1) liet., trump. Kerė, iš vyr. v. Kermantas.',' Kermantė yra lietuvių kilmės vardas.'),(1424,'Klara',' Klara yra Moteriškas vardas.','Trumpa reikšmė: clara „šviesi, garsi“.','Vardo reikšmė: Vardadienis: Rugpjūčio 11-12 d.',' Klara yra lotynų kilmės vardas.'),(1425,'Kęsminas',' Kęsminas yra Vyriškas vardas.','Trumpa reikšmė: kęs- (kęsti) + min- (minėti).','Vardo reikšmė: (1) liet., trump. Kęsmys, kęs- iš kęst- (žr. Kęsbartas) + min- (žr. Kalminas) ',' Kęsminas yra lietuvių kilmės vardas.'),(1426,'Kermantas',' Kermantas yra Vyriškas vardas.','Trumpa reikšmė: liet., Kerys, ker- (žr. Kergailas) + mant- (žr. Kalmantas).','Vardo reikšmė: Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais',' Kermantas yra lietuvių kilmės vardas.'),(1427,'Kintvainas',' Kintvainas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Kintas, kint- (žr. Kintalgas) + vain- (žr. Kantvainas).','Vardo reikšmė: Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs gerai numatote vedybų perspektyvas, ir jeigu vedate ar ištekate, tai tik su dideliu kraičiu. Kartais gaunate didelį palikimą iš tolimų giminaičių. Su antrąja puse gyvenate labai paslaptingą ir keistą gyvenimą.',' Kintvainas yra lietuvių kilmės vardas.'),(1428,'Kyvainė',' Kyvainė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Kyvė, Vainė, iš vyr. v. Kyvainas.','Vardo reikšmė: Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs esate tikri romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jūsų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose..',' Kyvainė yra lietuvių kilmės vardas.'),(1429,'Klausvydas',' Klausvydas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Klausas, klaus- (žr. Klausgailas) + vyd- (žr. Kantvydas).','Vardo reikšmė: Klausvydas – (1) liet., trump. Klausas, klaus- (žr. Klausgailas) + vyd- (žr. Kantvydas).',' Klausvydas yra lietuvių kilmės vardas.'),(1430,'Kergailė',' Kergailė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Kerė, iš vyr. v. Kergaila, žr. Kergailas.','Vardo reikšmė: Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs esate tikri romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jūsų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose..',' Kergailė yra lietuvių kilmės vardas.'),(1431,'Kintrimė',' Kintrimė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Kintė, Kintrė, iš vyr. v. Kintrimas.','Vardo reikšmė: Kintrimė – (1) liet., trump. Kintė, Kintrė, iš vyr. v. Kintrimas.',' Kintrimė yra lietuvių kilmės vardas.'),(1432,'Kyvainas',' Kyvainas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Kyvas, Vainius, ky- (žr. Kytautas) + vain- (žr. Kantvainas).','Vardo reikšmė: Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs esate tikri romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jūsų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose..',' Kyvainas yra lietuvių kilmės vardas.'),(1433,'Kergailas',' Kergailas yra Vyriškas vardas.','Trumpa reikšmė: liet., var. Kergaila, trump. Kerys, ker- (: liet. ker-ėti, ker-ai „burtai“, latv. sa-cer-et „sukurti“) + gail- (žr. Kangailas).','Vardo reikšmė: Kergailas – (1) liet., var. Kergaila, trump. Kerys, ker- (: liet. ker-ėti, ker-ai „burtai“, latv. sa-cer-et „sukurti“) + gail- (žr. Kangailas).',' Kergailas yra lietuvių kilmės vardas.'),(1434,'Koglandas',' Koglandas yra Vyriškas vardas.','Trumpa reikšmė: „paguoda“.','Vardo reikšmė: Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs gerai numatote vedybų perspektyvas, ir jeigu vedate ar ištekate, tai tik su dideliu kraičiu. Kartais gaunate didelį palikimą iš tolimų giminaičių. Su antrąja puse gyvenate labai paslaptingą ir keistą gyvenimą.',' Koglandas yra lietuvių kilmės vardas.'),(1435,'Kęsmantė',' Kęsmantė yra moteriškas vardas.','Trumpa reikšmė: liet., trump. Kęstė, Kęsmė,iš vyr. v. Kęsmantas.','Vardo reikšmė: Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais.',' Kęsmantė yra lietuvių kilmės vardas.'),(1436,'Kintrimas',' Kintrimas yra Vyriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs gerai numatote vedybų perspektyvas, ir jeigu vedate ar ištekate, tai tik su dideliu kraičiu. Kartais gaunate didelį palikimą iš tolimų giminaičių. Su antrąja puse gyvenate labai paslaptingą ir keistą gyvenimą.',' Kintrimas yra lietuvių kilmės vardas.'),(1437,'Kentautė',' Kentautė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Kentė, iš vyr. v. Kentautas.','Vardo reikšmė: Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais.',' Kentautė yra lietuvių kilmės vardas.'),(1438,'Kytautė',' Kytautė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Kytė, iš vyr. v. Kytautas.','Vardo reikšmė: Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais.',' Kytautė yra lietuvių kilmės vardas.'),(1439,'Klausutis',' Klausutis yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Klausas, priesagos -utis vedinys iš sen. trumpinio Klausas, kuris iš Klausgailas.','Vardo reikšmė: Klausutis – (2) liet., trump. Klausas, priesagos -utis vedinys iš sen. trumpinio Klausas, kuris iš Klausgailas.',' Klausutis yra lietuvių kilmės vardas.'),(1440,'Kęsmantas',' Kęsmantas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Kęstas, Kęsmas, kęs- iš kęst- (žr. Kęsbartas) + mant- (žr. Kalmantas).','Vardo reikšmė: Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais.',' Kęsmantas yra lietuvių kilmės vardas.'),(1441,'Kodravė',' Kodravė yra Moteriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Kodrė, iš vyr. v. Kodravas.','Vardo reikšmė: Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs gerai numatote vedybų perspektyvas, ir jeigu vedate ar ištekate, tai tik su dideliu kraičiu. Kartais gaunate didelį palikimą iš tolimų giminaičių. Su antrąja puse gyvenate labai paslaptingą ir keistą gyvenimą.',' Kodravė yra lietuvių kilmės vardas.'),(1442,'Kentautas',' Kentautas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Kentys, ken- iš kent- (: liet. kent-ėti)+ taut- (žr. Kantautas).','Vardo reikšmė: Kentautas – (1) liet., trump. Kentys, ken- iš kent- (: liet. kent-ėti)+ taut- (žr. Kantautas).',' Kentautas yra lietuvių kilmės vardas.'),(1443,'Kintibutas',' Kintibutas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Kintys, kinti- (žr. Kintalgas) + but- (žr. Kaributas).','Vardo reikšmė: Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs gerai numatote vedybų perspektyvas, ir jeigu vedate ar ištekate, tai tik su dideliu kraičiu. Kartais gaunate didelį palikimą iš tolimų giminaičių. Su antrąja puse gyvenate labai paslaptingą ir keistą gyvenimą.',' Kintibutas yra lietuvių kilmės vardas.'),(1444,'Klausutė',' Klausutė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Klausė, iš vyr. v. Klausutis.','Vardo reikšmė: Klausutė – (2) liet., trump. Klausė, iš vyr. v. Klausutis.',' Klausutė yra lietuvių kilmės vardas.'),(1445,'Kodravas',' Kodravas yra Vyriškas vardas.','Trumpa reikšmė: „drevė“.','Vardo reikšmė: Kodravas – (1) suliet. prūs., trump. Kodrys, ko- (žr. Kobutas) + drav- (: liet. drūtas „stiprus“, tvirtas (kaip medis)“, pl. dravė, dravis „drevė“.',' Kodravas yra lietuvių kilmės vardas.'),(1446,'Kęsgilė',' Kęsgilė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Kęstė, iš vyr. v. Kęsgilas.','Vardo reikšmė: Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs esate tikri romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jūsų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose..',' Kęsgilė yra lietuvių kilmės vardas.'),(1447,'Kintenis',' Kintenis yra Vyriškas vardas.','Trumpa reikšmė: kin- (kentėti, pvz, žiem-kint- is) + -en- – „kenčiantysis, -oji“.','Vardo reikšmė: Kintenis – (2) suliet. prūs., trump. Kintas, priesagos -enis vedinys iš sen. trump. Kintas, kuris iš avd. su Kin-t-, Kint-: Kintautas, Kintvainas, Kintvilas ir kt.',' Kintenis yra lietuvių kilmės vardas.'),(1448,'Kazys',' Kazys yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Kazimiera, Kazimieras: „didžiakalbis, garsėjantis kalba“.','Vardo reikšmė: Kazimierams patartina mokytis geriau save išreikšti. Būtina įgyti pasitikėjimą savimi, pažaboti aikštingą temperamentingą charakterį, daugiau bendrauti su žmonėmis.',' Kazys yra lotynų kilmės vardas.'),(1449,'Klausilė',' Klausilė yra Moteriškas vardas.','Trumpa reikšmė: suliet. prūs. trump. Klausė, iš vyr. v. Klausilas.','Vardo reikšmė: Klausilė – (1) suliet. prūs. trump. Klausė, iš vyr. v. Klausilas.',' Klausilė yra lietuvių kilmės vardas.'),(1450,'Kirstautė',' Kirstautė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Kirstė, iš vyr. v. Kirstautas.','Vardo reikšmė: Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs esate tikri romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jūsų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose..',' Kirstautė yra lietuvių kilmės vardas.'),(1451,'Kęsgailas',' Kęsgailas yra vyriškas vardas.','Trumpa reikšmė: liet., trump. Kęstas, Kęstys, kęs- iš kęst- (žr. Kęsbartas) + gil- (: liet. su-gil-ti, gil-dyti širdį).','Vardo reikšmė: Kęsgailas – (1) liet., trump. Kęstas, Kęstys, kęs- iš kęst- (žr. Kęsbartas) + gil- (: liet. su-gil-ti, gil-dyti širdį).',' Kęsgailas yra lietuvių kilmės vardas.'),(1452,'Kobutas',' Kobutas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Butys, ko- (: liet. ko įvardžio kas kilm.) + but- (žr. Kaributas).','Vardo reikšmė: Kobutas – (1) liet., trump. Butys, ko- (: liet. ko įvardžio kas kilm.) + but- (žr. Kaributas).',' Kobutas yra lietuvių kilmės vardas.'),(1453,'Kintenė',' Kintenė yra Moteriškas vardas.','Trumpa reikšmė: kin- (kentėti, pvz, žiem-kint- is) + -en- – „kenčiantysis, -oji“.','Vardo reikšmė: Kintenė – (2) suliet. prūs., trump. Kintė, iš vyr. v. Kintenis.',' Kintenė yra lietuvių kilmės vardas.'),(1454,'Kirstautas',' Kirstautas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Kirstys, kirs- (: liet. pa-kirs-ti „pabusti“) + taut- (žr. Kantautas).','Vardo reikšmė: Kirstautas – (1) liet., trump. Kirstys, kirs- (: liet. pa-kirs-ti „pabusti“) + taut- (žr. Kantautas).',' Kirstautas yra lietuvių kilmės vardas.'),(1455,'Klausilas',' Klausilas yra Vyriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Klausas, priesagos -ilas vedinys iš sen. trump. Klausas, kuris iš Klausgailas.','Vardo reikšmė: Klausilas – (1) suliet. prūs., trump. Klausas, priesagos -ilas vedinys iš sen. trump. Klausas, kuris iš Klausgailas.',' Klausilas yra lietuvių kilmės vardas.'),(1456,'Klotilda',' Klotilda yra Moteriškas vardas.','Trumpa reikšmė: „garsi kova“.','Vardo reikšmė: Klotilda – (1) germ., trump. Tilda, vid. lot. Clotilda (baž. lot. Clotildis) iš germ. Clothilda, Klothilde: sen. vok. aukšt. hlūt „garsus“ + hiltja „kova“.',' Klotilda yra vokiečių kilmės vardas.'),(1457,'Kęsgailė',' Kęsgailė yra Moteriškas vardas.','Trumpa reikšmė: kęs- (kęsti) + gail- (gailas „stiprus“) – „stipriai atlaikantis kančias“.','Vardo reikšmė: Kęsgailė – (1) liet., trump. Kęstė, iš vyr. avd. Kęsgaila žr. Kęsgailas.',' Kęsgailė yra lietuvių kilmės vardas.'),(1458,'Kintė',' Kintė yra moteriškas vardas.','Trumpa reikšmė: liet., galūnės vedinys iš Kintas, taip pat trumpinys iš mot. v. su Kin-t-, Kint-: Kintautė, Kintvainė, Kintvilė ir kt.','Vardo reikšmė: Kintė – (3) liet., galūnės vedinys iš Kintas, taip pat trumpinys iš mot. v. su Kin-t-, Kint-: Kintautė, Kintvainė, Kintvilė ir kt.',' Kintė yra lietuvių kilmės vardas.'),(1459,'Kirmantė',' Kirmantė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Kirė, iš vyr. v. Kirmantas.','Vardo reikšmė: Kirmantė – (1) liet., trump. Kirė, iš vyr. v. Kirmantas.',' Kirmantė yra lietuvių kilmės vardas.'),(1460,'Klausgailė',' Klausgailė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Klausė, iš vyr. avd. Klausgaila, žr. Klausgailas.','Vardo reikšmė: Klausgailė – (1) liet., trump. Klausė, iš vyr. avd. Klausgaila, žr. Klausgailas.',' Klausgailė yra lietuvių kilmės vardas.'),(1461,'Kintautė',' Kintautė yra Moteriškas vardas.','Trumpa reikšmė: kin- (kentėti, pvz, žiem-kint- is) + taut- (tauta) – „kenčiantis už tautą).','Vardo reikšmė: (1) liet., trump. Kintė, iš vyr. v. Kintautas',' Kintautė yra lietuvių kilmės vardas.'),(1462,'Kletas',' Kletas yra Vyriškas vardas.','Trumpa reikšmė: „šauktas“.','Vardo reikšmė: Kletas – (2) graik., iš sulotyninto graik. Cletus — „šauktas“, kuris yra trumpinys iš Anakletas.',' Kletas yra graikų kilmės vardas.'),(1463,'Klausgailas',' Klausgailas yra Vyriškas vardas.','Trumpa reikšmė: liet., sen. var. Klausgaila, trump. Klausas, klaus- (: liet. klausy-ti, klaus-us „paklusnus, turintis klausą“) + gail- (žr. Kangailas).','Vardo reikšmė: Klausgailas – (1) liet., sen. var. Klausgaila, trump. Klausas, klaus- (: liet. klausy-ti, klaus-us „paklusnus, turintis klausą“) + gail- (žr. Kangailas).',' Klausgailas yra lietuvių kilmės vardas.'),(1464,'Kirmantas',' Kirmantas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Kirys, kir- (žr. Kirbutas) + mant- (žr. Kalmantas).','Vardo reikšmė: Kirmantas – (1) liet., trump. Kirys, kir- (žr. Kirbutas) + mant- (žr. Kalmantas).',' Kirmantas yra lietuvių kilmės vardas.'),(1465,'Kintautas',' Kintautas yra Vyriškas vardas.','Trumpa reikšmė: kin- (kentėti, pvz, žiem-kint- is) + taut- (tauta) – „kenčiantis už tautą).','Vardo reikšmė: Kintautas – (1) liet., trump. Kintas, kin- iš kint- (žr. Kintalgas) + taut- (žr. Kantautas).',' Kintautas yra lietuvių kilmės vardas.'),(1466,'Klausenis',' Klausenis yra Vyriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Klausas, priesagos -enis vedinys iš sen. trump. Klausas, kuris iš Klausgailas.','Vardo reikšmė: Klausenis – (2) suliet. prūs., trump. Klausas, priesagos -enis vedinys iš sen. trump. Klausas, kuris iš Klausgailas.',' Klausenis yra lietuvių kilmės vardas.'),(1467,'Kleopatra',' Kleopatra yra Moteriškas vardas.','Trumpa reikšmė: kleos „garbė + pater „tėvas“ – „tėvo garbė“.','Vardo reikšmė: Kleopatros meilėje skiria daug dvasinių savybių. Jos gali metų metais laukti savo išsvajotojo. Įsimylėjusios myli karštai ir ilgai.',' Kleopatra yra graikų kilmės vardas.'),(1468,'Kirkantas',' Kirkantas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Kirys, kir- (žr. Kirbutas) + kant- (žr. Kangailas).','Vardo reikšmė: Kirkantas – (1) liet., trump. Kirys, kir- (žr. Kirbutas) + kant- (žr. Kangailas).',' Kirkantas yra lietuvių kilmės vardas.'),(1469,'Kintas',' Kintas yra Vyriškas vardas.','Trumpa reikšmė: liet., trumpinys iš avd. su Kin-t-, Kint-, Kintautas, Kintvainas, Kintvilas ir kt.','Vardo reikšmė: Kintas – (2) liet., trumpinys iš avd. su Kin-t-, Kint-, Kintautas, Kintvainas, Kintvilas ir kt.',' Kintas yra lietuvių kilmės vardas.'),(1470,'Klausenė',' Klausenė yra Moteriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Klausė, iš vyr. v. Klausenis.','Vardo reikšmė: Klausenė – (2) suliet. prūs., trump. Klausė, iš vyr. v. Klausenis.',' Klausenė yra lietuvių kilmės vardas.'),(1471,'Kleopas',' Kleopas yra Vyriškas vardas.','Trumpa reikšmė: kleos „garbė + pater „tėvas“ – „tėvo garbė“.','Vardo reikšmė: Vardadienis: Balandžio 9 d., rugsėjo 25 d.',' Kleopas yra graikų kilmės vardas.'),(1472,'Kintarė',' Kintarė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Kintė, iš vyr. v. Kintaras.','Vardo reikšmė: Kintarė – (1) liet., trump. Kintė, iš vyr. v. Kintaras.',' Kintarė yra lietuvių kilmės vardas.'),(1473,'Klausė',' Klausė yra Moteriškas vardas.','Trumpa reikšmė: liet., galūnės vedinys iš Klausas, taip pat trumpinys iš mot. v. Klausgailė.','Vardo reikšmė: Klausė – (2) liet., galūnės vedinys iš Klausas, taip pat trumpinys iš mot. v. Klausgailė.',' Klausė yra lietuvių kilmės vardas.'),(1474,'Kleopa',' Kleopa yra Moteriškas vardas.','Trumpa reikšmė: graik., trump. Klevė (Rietavas), iš vyr. v. Kleopas.','Vardo reikšmė: Kleopa – (2) graik., trump. Klevė (Rietavas), iš vyr. v. Kleopas.',' Kleopa yra lietuvių kilmės vardas.'),(1475,'Kirbutas',' Kirbutas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Kirys, kir- (: liet. kir-inti „jaudrinti“, kir-b-inti „judinti“) + but- (žr. Kaributas).','Vardo reikšmė: Kirbutas – (1) liet., trump. Kirys, kir- (: liet. kir-inti „jaudrinti“, kir-b-inti „judinti“) + but- (žr. Kaributas).',' Kirbutas yra lietuvių kilmės vardas.'),(1476,'Kiprijonas',' Kiprijonas yra Vyriškas vardas.','Trumpa reikšmė: „kiprijietis, Kipro gyventojas“.','Vardo reikšmė: (2) sulot. graik., trump. Kipras, per rytų slavų Kiprijan iš sulotyninto graik. Cyprianus – „kiprietis, Kipro salos gyventojas“',' Kiprijonas yra graikų kilmės vardas.'),(1477,'Klementinas',' Klementinas yra Vyriškas vardas.','Trumpa reikšmė: clemens „švelnus, malonus“.','Vardo reikšmė: Klemensai serga kojų ligomis, dažnai jiems skauda galvą, linkę vidurių sutrikimams, nes mėgsta labai daug valgyti, piktnaudžiauja alkoholiu.',' Klementinas yra lotynų kilmės vardas.'),(1478,'Klausas',' Klausas yra Vyriškas vardas.','Trumpa reikšmė: 1. lotynų: „šlubas“; 2. graikų: „žmonijos pergalė“.','Vardo reikšmė: Klausas – (2) liet., trumpinys iš vardų su Klaus-: Klausgailas.',' Klausas yra graikų kilmės vardas.'),(1479,'Klaudijus',' Klaudijus yra Vyriškas vardas.','Trumpa reikšmė: claudus „šlubas“.','Vardo reikšmė: Vardadienis: Balandžio 26 d., birželio 6 d.',' Klaudijus yra lotynų kilmės vardas.'),(1480,'Klementina',' Klementina yra Moteriškas vardas.','Trumpa reikšmė: clemens „švelnus, malonus“.','Vardo reikšmė: Klementina – (2) lot., trump. Klementa, Klema, Klemė, tarm. Klimanta, Klima ryt. aukšt., iš lot. Clementina, kuris yra priesagos -ina vedinys iš lot. Clementia, žr. Klemencija.',' Klementina yra lotynų kilmės vardas.'),(1481,'Klemensas',' Klemensas yra Vyriškas vardas.','Trumpa reikšmė: clemens „švelnus, malonus“.','Vardo reikšmė: Klemensai serga kojų ligomis, dažnai jiems skauda galvą, linkę vidurių sutrikimams, nes mėgsta labai daug valgyti, piktnaudžiauja alkoholiu.',' Klemensas yra lotynų kilmės vardas.'),(1482,'Klaudija',' Klaudija yra Moteriškas vardas.','Trumpa reikšmė: claudus „šlubas“.','Vardo reikšmė: Klaudijos savo veiklą skiria darbams, kurie susiję su kažkokiu perdirbimu, atnaujinimu.Jos savo talentus panaudoja pramonės prekių papuošimui, kvepalų, kosmetikos, juvelyrinių dirbinių sritims. Būdamos turtingos, užsiima labdara.',' Klaudija yra lotynų kilmės vardas.'),(1483,'Klemensa',' Klemensa yra Moteriškas vardas.','Trumpa reikšmė: clemens „švelnus, malonus“.','Vardo reikšmė: Klemensa – (1) lot., trump. Klema,Klemė, iš vyr. v. Clemens, žr. Klemensas.',' Klemensa yra lotynų kilmės vardas.'),(1484,'Klemencija',' Klemencija yra Moteriškas vardas.','Trumpa reikšmė: „švelnumas, malonumas“.','Vardo reikšmė: Klemencija – (1) lot., trump. Klema, Klemė, iš lot. Clementia: lot. clementia „švelnumas, malonumas“ .',' Klemencija yra lietuvių kilmės vardas.'),(1485,'Kotryna',' Kotryna yra Moteriškas vardas.','Trumpa reikšmė: „tyra, švari“.','Vardo reikšmė: Kotrynoms tinka judrūs ir besikeičiantys darbai. Jos geros restoranų padavėjos, kelionių organizatorės, reklamos darbuotojos, manekenės, geografijos mokytojos, artistės, sekretorės, sportininkės.',' Kotryna yra graikų kilmės vardas.'),(1486,'Klemas',' Klemas yra Vyriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Klemensas ir Klementinas.','Vardo reikšmė: Klemas – (2) liet. trumpinys iš Klemensas ir Klementinas.',' Klemas yra lietuvių kilmės vardas.'),(1487,'Kostė',' Kostė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Konstantas, Konstanta: constans „ištvermingas, tvirtas“.','Vardo reikšmė: Kostė – (2) liet. trumpinys iš Konstancija ir Konstantina.',' Kostė yra lotynų kilmės vardas.'),(1488,'Kornelis',' Kornelis yra Vyriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Kornelis – (2) trumpinys iš Kornelijus.',' Kornelis yra lietuvių kilmės vardas.'),(1489,'Kornelijus',' Kornelijus yra Vyriškas vardas.','Trumpa reikšmė: „sedula, kornelinė vyšnia“.','Vardo reikšmė: Vardadienis: Birželio 4 d., rugsėjo 16 d.',' Kornelijus yra lotynų kilmės vardas.'),(1490,'Kornelija',' Kornelija yra Moteriškas vardas.','Trumpa reikšmė: „sedula, kornelinė vyšnia“.','Vardo reikšmė: Kornelijos labai savarankiškos ir nemėgsta jokių patarimų. Jos turi gerą intuiciją ir ja neklysdamos vadovaujasi. Gresia potraukis girtuoklystei bei narkotikams.',' Kornelija yra lotynų kilmės vardas.'),(1491,'Konstantina',' Konstantina yra Moteriškas vardas.','Trumpa reikšmė: constans „ištvermingas, tvirtas“.','Vardo reikšmė: Šiems vardų turėtojamss labai gerai sekasi turtiniuose reikaluose, ir jie triumfuoja investavę į labai brangius projektus. Jie stichiški ir plačių užmojų žmonės, kurių veiksmus sunku numatyti. Tai visų darbų meistrai ! Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. ',' Konstantina yra lotynų kilmės vardas.'),(1492,'Konstancija',' Konstancija yra Moteriškas vardas.','Trumpa reikšmė: constans „ištvermingas, tvirtas“.','Vardo reikšmė: Konstancijoms rekomenduotina nuolat kelti savo kvalifikaciją, įsigyti jaujų žinių. Joms daugiau reikėtų domėtis kitų reikalais. Nebūti nuošalyje ir pasidalyti savo žiniomis su kitais. Ugdykite pakantumą draugams. Saugokitės alkoholinių gėrimų!',' Konstancija yra lotynų kilmės vardas.'),(1493,'Konradas',' Konradas yra Vyriškas vardas.','Trumpa reikšmė: „drąsus patarimas“.','Vardo reikšmė: Konradai nevengia santuokos: norėtų turėti klausytoją, pašnekovę ir vienmintę. Tačiau dar labiau trokšta laisvės, be to, netiki, jog sugebės atrasti giminišką sielą. Patartina nesibaiminti: kandidatų į sutuoktinius magnetizmas bei dvasinės vibracijos padės juos surasti.',' Konradas yra vokiečių kilmės vardas.'),(1494,'Kolumbas',' Kolumbas yra Vyriškas vardas.','Trumpa reikšmė: columbus „balandis“.','Vardo reikšmė: Kolumbas – (1) lot., trump. Kolys, Kolius, iš lot. Columbus: lot. columbus „balandis“.',' Kolumbas yra lotynų kilmės vardas.'),(1495,'Kristijonas',' Kristijonas yra Vyriškas vardas.','Trumpa reikšmė: „krikščionė, krikščionis“.','Vardo reikšmė: Kristijonai daugiausia pasiekia biznio pasaulyje, medicinoje (chirurgijoje). Meno pasaulyje jiems artimiausias teatras, muzika, radijas ir fotografija',' Kristijonas yra lotynų kilmės vardas.'),(1496,'Kolumba',' Kolumba yra Moteriškas vardas.','Trumpa reikšmė: columbus „balandis“.','Vardo reikšmė: Kolumba – (1) lot., trump. Kolė, iš lot. Columba: lot. columba „balandė“.',' Kolumba yra lotynų kilmės vardas.'),(1497,'Kristijona',' Kristijona yra Moteriškas vardas.','Trumpa reikšmė: „krikščionė, krikščionis“.','Vardo reikšmė: Šiems vardų turėtojamss labai gerai sekasi turtiniuose reikaluose, ir jie triumfuoja investavę į labai brangius projektus. Jie stichiški ir plačių užmojų žmonės, kurių veiksmus sunku numatyti. Tai visų darbų meistrai ! Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. ',' Kristijona yra lotynų kilmės vardas.'),(1498,'Koleta',' Koleta yra Moteriškas vardas.','Trumpa reikšmė: iš Nikolė, Milokė – hebrajų (sen. graikų): „kas yra kaip dievas“.','Vardo reikšmė: Koleta – (2) pranc., trump. Leta, baž. lot. Coletta iš pranc. Colette, kuris yra trumpinys iš Nicolette, o šis priesagos -ette (mažyb.) vedinys iš Nicola, padaryto iš vyr. v. Nikolaus, žr. Mikalojus.',' Koleta yra prancūzų kilmės vardas.'),(1499,'Kolangas',' Kolangas yra  vardas.','Trumpa reikšmė: suliet. prūs., trump. Kolys, ko- (žr. Kobutas) + lang- (: prūs. langi-seiligins „lengva-manis“).','Vardo reikšmė: Kolangas – (1) suliet. prūs., trump. Kolys, ko- (žr. Kobutas) + lang- (: prūs. langi-seiligins „lengva-manis“).',' Kolangas yra lietuvių kilmės vardas.'),(1500,'Kristė',' Kristė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Kristina, Kristinas: „krikščionė, krikščionis“.','Vardo reikšmė: Kristė – (2) liet. trumpinys iš Kristina ir Kristijona.',' Kristė yra lotynų kilmės vardas.'),(1501,'Koglandė',' Koglandė yra  vardas.','Trumpa reikšmė: suliet. prūs., trump. Kogė, Glandė, iš vyr. v. Koglandas.','Vardo reikšmė: Koglandė – (1) suliet. prūs., trump. Kogė, Glandė, iš vyr. v. Koglandas.',' Koglandė yra lietuvių kilmės vardas.'),(1502,'Koviltė',' Koviltė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Kovė, Viltė, iš vyr. v. Koviltas.','Vardo reikšmė: Koviltė – (1) liet., trump. Kovė, Viltė, iš vyr. v. Koviltas.',' Koviltė yra lietuvių kilmės vardas.'),(1503,'Koviltas',' Koviltas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Kovys, Viltas, ko-(žr. Kobutas) + vilt- (:liet. viltis „tikėtis“, vilt-is).','Vardo reikšmė: Koviltas – (1) liet., trump. Kovys, Viltas, ko-(žr. Kobutas) + vilt- (:liet. viltis „tikėtis“, vilt-is).',' Koviltas yra lietuvių kilmės vardas.'),(1504,'Kovilė',' Kovilė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Kovė, Vilė, iš vyr. v. Kovilas.','Vardo reikšmė: Kovilė – (1), (2) liet., trump. Kovė, Vilė, iš vyr. v. Kovilas.',' Kovilė yra lietuvių kilmės vardas.'),(1505,'Kovydas',' Kovydas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Kovas, Vydas, ko- (žr. Kobutas) + vyd- (žr. Kantvydas).','Vardo reikšmė: Kovydas – (1) liet., trump. Kovas, Vydas, ko- (žr. Kobutas) + vyd- (žr. Kantvydas).',' Kovydas yra lietuvių kilmės vardas.'),(1506,'Kovilas',' Kovilas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Kovys, Vilas, ko- (žr. Kobutas) + vil- (žr. Kantvilas).','Vardo reikšmė: Kovilas – (1) liet., trump. Kovys, Vilas, ko- (žr. Kobutas) + vil- (žr. Kantvilas).',' Kovilas yra lietuvių kilmės vardas.'),(1507,'Kvirinas',' Kvirinas yra Vyriškas vardas.','Trumpa reikšmė: quirinus „ieties metikas“.','Vardo reikšmė: Kvirinas – (2) lot., trump. Kviras, Kviris, iš lot. Quirinus, kuris iš sen. italikų dievo vardo Quirinus: lot. ąuirinus „ieties metikas, pilietis“.',' Kvirinas yra lotynų kilmės vardas.'),(1508,'Kovaldė',' Kovaldė yra Moteriškas vardas.','Trumpa reikšmė: ko- (kas kilmininko linksnis „ko“) + vald- (valdyti).','Vardo reikšmė: Šiems vardų turėtojamss labai gerai sekasi turtiniuose reikaluose, ir jie triumfuoja investavę į labai brangius projektus. Jie stichiški ir plačių užmojų žmonės, kurių veiksmus sunku numatyti. Tai visų darbų meistrai ! Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. ',' Kovaldė yra lietuvių kilmės vardas.'),(1509,'Kunotas',' Kunotas yra Vyriškas vardas.','Trumpa reikšmė: kun-/kaun (kautis) „tas, kuris mėgsta kautis“.','Vardo reikšmė: .',' Kunotas yra lietuvių kilmės vardas.'),(1510,'Kovaldas',' Kovaldas yra Vyriškas vardas.','Trumpa reikšmė: ko- (kas kilmininko linksnis „ko“) + vald- (valdyti).','Vardo reikšmė: Kovaldas – (1) suliet. prūs., trump. Kovas, Valdas, ko- (žr. Kobutas) + vald- (: liet. vald-yti, vald-o).',' Kovaldas yra lietuvių kilmės vardas.'),(1511,'Kovaidas',' Kovaidas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Kovas, Vaidas, ko- (žr. Kobutas) + vaid- (: liet. vaid-ytis „rodytis“, vaid-entis).','Vardo reikšmė: Kovaidas – (1) liet., trump. Kovas, Vaidas, ko- (žr. Kobutas) + vaid- (: liet. vaid-ytis „rodytis“, vaid-entis).',' Kovaidas yra lietuvių kilmės vardas.'),(1512,'Kunigunda',' Kunigunda yra Moteriškas vardas.','Trumpa reikšmė: kunni „giminė“ + gund „kova“.','Vardo reikšmė: Vardadienis: Kovo 3 d., liepos 24 d.',' Kunigunda yra vokiečių kilmės vardas.'),(1513,'Ksaverija',' Ksaverija yra Moteriškas vardas.','Trumpa reikšmė: „ksaverietis, Ksavero miesto gyventojas“.','Vardo reikšmė: .',' Ksaverija yra ispanų kilmės vardas.'),(1514,'Ksaveras',' Ksaveras yra Vyriškas vardas.','Trumpa reikšmė: „ksaverietis, Ksavero miesto gyventojas“.','Vardo reikšmė: Ksaverų blogybės pasireiškia jų noru perdėtai domėtis kitų reikalais, nuolat patarinėti, net jeigu to jų niekas neprašo. Kerštingi.',' Ksaveras yra ispanų kilmės vardas.'),(1515,'Krizostomas',' Krizostomas yra Vyriškas vardas.','Trumpa reikšmė: chrysos „auksas“ + tomos „burna“ – „aukso burna“.','Vardo reikšmė: Krizostomas – (2) graik., trump. Krizas, iš sulotyninto graik. Chrisostomus — „auksaburnis“: graik. chrysos „auksas“ + tomos „burna“.',' Krizostomas yra graikų kilmės vardas.'),(1516,'Krizas',' Krizas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Kristijonas: „krikščionis“.','Vardo reikšmė: Krizas – (2) liet. trumpinys iš Krizantas, Krizostomas ir Kristijonas.',' Krizas yra lotynų kilmės vardas.'),(1517,'Krizantas',' Krizantas yra Vyriškas vardas.','Trumpa reikšmė: chrysos „auksas“ + antros „žiedas“ – „aukso žiedas“.','Vardo reikšmė: Krizantas – (1) graik., trump. Krizas, iš sulotyninto graik. Chrysanthus: graik. chrysos „auksas“ + anthos „žiedas“.',' Krizantas yra graikų kilmės vardas.'),(1518,'Kristupas',' Kristupas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Kristoforas: „Kristaus nešėjas“.','Vardo reikšmė: Kristupas – (1) trump. Krisčius, Kristis, – liet. trumpinys iš Kristoforas.',' Kristupas yra graikų kilmės vardas.'),(1519,'Kristoforas',' Kristoforas yra Vyriškas vardas.','Trumpa reikšmė: „Kristaus nešėjas“.','Vardo reikšmė: Jūs labai stiprus, valingas, kartais tiesiog nesuvaldomas charakteris, kuris pasireiškia visose gyvenimo sferose, taip pat ir su moterimis. Norėdami pasiekti savo, jie naudoja įvairius būdus, sugeba būti klastingi ir apgaunantys, dažnai tokiu elgesiu susikuria sau sunkumų ten, kur jų nėra.',' Kristoforas yra graikų kilmės vardas.'),(1520,'Kristinas',' Kristinas yra Vyriškas vardas.','Trumpa reikšmė: „krikščionė, krikščionis“.','Vardo reikšmė: Šie vardo turėtojai mėgsta skaniai ir sočiai pavalgyti bei išgerti. Gali piktnaudžiauti seksu ir narkotikais. Jie turi talentą generuoti naujas idėjas; puikios rankos. Mėgsta visa, kas nauja ir neištirta. Jie protingi, tačiau mąstymo procesas, kaip ir pats gyvenimas, neorganizuotas ir išbarstytas.',' Kristinas yra lotynų kilmės vardas.'),(1521,'Kristina',' Kristina yra Moteriškas vardas.','Trumpa reikšmė: „krikščionė, krikščionis“.','Vardo reikšmė: Kristinos geriausiai jaučiasi būdamos mokslo įstaigos dėstytojos. Jos geros visuomenės organizatorės ir reformatorės. Puikios žiniasklaidos darbuotojos.',' Kristina yra lotynų kilmės vardas.'),(1522,'Laisvė',' Laisvė yra Moteriškas vardas.','Trumpa reikšmė: „laisvas, laisva“.','Vardo reikšmė: Jūs – laisvi žmonės, kurie mėgsta permainas, nuotykius ir pasilinksminimus. Jie saugo savo laisvę ir, kaip paukštis be sparnų, negali egzistuoti be jos. Jie labai lengvai prisitaiko. Permainos – jiems malonumas, o bet koks trukdymas – katastrofa.',' Laisvė yra lietuvių kilmės vardas.'),(1523,'Laisva',' Laisva yra Moteriškas vardas.','Trumpa reikšmė: liet.: liet. metatoninis vedinys iš laisva.','Vardo reikšmė: Jūs – laisvi žmonės, kurie mėgsta permainas, nuotykius ir pasilinksminimus. Jie saugo savo laisvę ir, kaip paukštis be sparnų, negali egzistuoti be jos. Jie labai lengvai prisitaiko. Permainos – jiems malonumas, o bet koks trukdymas – katastrofa.',' Laisva yra lietuvių kilmės vardas.'),(1524,'Laimutis',' Laimutis yra Vyriškas vardas.','Trumpa reikšmė: laimė + -ut- – „laimingas, laiminga“.','Vardo reikšmė: Laimučiai labai draugiški ir emocionalūs, tačiau tikrų draugų turi mažai. Tai atsitinka dėl to, kad jie visada labai užsiėmę ir skubantys, dėl to nelieka laiko įsigilinti į draugų problemas. Todėl jie gali tapti dideliais vienišiais.',' Laimutis yra lietuvių kilmės vardas.'),(1525,'Laimutė',' Laimutė yra Moteriškas vardas.','Trumpa reikšmė: laimė + -ut- – „laimingas, laiminga“.','Vardo reikšmė: Laimučių profesijos labai įvairios. Pažymėtina tai, kad darbe, kur jos bedirbtų, idealiai stengiasi taktiškai save išreikšti, todėl visų mylimos už takto saikingumą.',' Laimutė yra lietuvių kilmės vardas.'),(1526,'Laimonas',' Laimonas yra Vyriškas vardas.','Trumpa reikšmė: laimė + -on- – „laimingas, laiminga“.','Vardo reikšmė: Laimonai renkasi profesijas, kurios sužadina kitų aktyvumą. Jie turi vadovauti, nes kitu atveju praranda norą dirbti. Pagrindiniai jų užsiėmimai: kadrų rinkimas, apmokymas, teatras, politika, sportas, armija.',' Laimonas yra lietuvių kilmės vardas.'),(1527,'Laimis',' Laimis yra Vyriškas vardas.','Trumpa reikšmė: „laimingas“.','Vardo reikšmė: Vardadienis: Sausio 14 d., kovo 26 d., liepos 29 d., rugpjūčio 30 d., lapkričio 20 d.',' Laimis yra lietuvių kilmės vardas.'),(1528,'Laimintas',' Laimintas yra Vyriškas vardas.','Trumpa reikšmė: laimė + -in-.','Vardo reikšmė: Jūs galite dirbti bet kokioje srityje, kur tik reikia protingai elgtis su pinigais. Jūs atkakliu darbu užsidirbate savo pinigus ir nesiimate lošti nesąžiningų žaidimų.',' Laimintas yra lietuvių kilmės vardas.'),(1529,'Laigedas',' Laigedas yra Vyriškas vardas.','Trumpa reikšmė: „ilgėtis“.','Vardo reikšmė: Laigedas – (1) suliet. prūs., trump. Laigas, Laigys, lai- (: liet. lai „tegu“) + ged- (: liet. ged-auti „ilgėtis“, ged-ėti).',' Laigedas yra lietuvių kilmės vardas.'),(1530,'Laiminta',' Laiminta yra Moteriškas vardas.','Trumpa reikšmė: laimė + -in-.','Vardo reikšmė: Jūs galite dirbti bet kokioje srityje, kur tik reikia protingai elgtis su pinigais. Jūs atkakliu darbu užsidirbate savo pinigus ir nesiimate lošti nesąžiningų žaidimų.',' Laiminta yra lietuvių kilmės vardas.'),(1531,'Labvardas',' Labvardas yra Vyriškas vardas.','Trumpa reikšmė: lab- (labas „geras“) + vard- (vardas).','Vardo reikšmė: Labvardas – (1) liet., trump. Labys, lab- (žr. Labgaudas) + vard- (: liet. vard-as, latv. vards „žodis, vardas“, plg. liet. varduoti „burti“).',' Labvardas yra lietuvių kilmės vardas.'),(1532,'Legailė',' Legailė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Lega, Gailė, iš vyr. avd. Legaila, žr. Legailas.','Vardo reikšmė: Legailė – (1) liet., trump. Lega, Gailė, iš vyr. avd. Legaila, žr. Legailas.',' Legailė yra lietuvių kilmės vardas.'),(1533,'Leandras',' Leandras yra Vyriškas vardas.','Trumpa reikšmė: leos „tauta“ + aner „vyras“ – „tautai pasišventęs“.','Vardo reikšmė: Leandras – (1) graik., trump. Andras, iš sulotyninto graik. Leander, kuris iš graik. Leiandros, Leandros: graik. leos „tauta“ + aner (kilm. andros) „vyras“.',' Leandras yra graikų kilmės vardas.'),(1534,'Legailas',' Legailas yra Vyriškas vardas.','Trumpa reikšmė: „stiprus, smarkus“.','Vardo reikšmė: Legailas – (1) liet., sen. var. Legaila, trump. Legys, le- iš leg- (su balsių kaita iš liet. lėg-ti „mažėti, lyžti, leisti“, plg. at-lėgti „sumažėti, susilpnėti“) + gail- (: sen. liet. gail-as „stiprus, smarkus“).',' Legailas yra lietuvių kilmės vardas.'),(1535,'Laurynas',' Laurynas yra Vyriškas vardas.','Trumpa reikšmė: „lauras“ (medis), lauro lapai – pasiekimo ženklas, lauro lapais būdavo vainikuojami valdovai, sportininkai..','Vardo reikšmė: Laurynai romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose.',' Laurynas yra lotynų kilmės vardas.'),(1536,'Laurentinas',' Laurentinas yra Vyriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Laurentinas – (2) lot., trump. Lauras, iš lot. Laurentinus — „laurentietis, Laurento miesto (netoli Romos) gyventojas“.',' Laurentinas yra lotynų kilmės vardas.'),(1537,'Laurentina',' Laurentina yra moteriškas vardas.','Trumpa reikšmė: lot., trump. Laura, iš lot. Laurentina, kuris iš vyr. v. Laurentinus, žr. Laurentinas.','Vardo reikšmė: Laurentina – (2) lot., trump. Laura, iš lot. Laurentina, kuris iš vyr. v. Laurentinus, žr. Laurentinas.',' Laurentina yra lotynų kilmės vardas.'),(1538,'Laurencijus',' Laurencijus yra Vyriškas vardas.','Trumpa reikšmė: „laurentietis, Laurento miesto (šalia Romos) gyventojas“.','Vardo reikšmė: Laurencijus – (1) lot., trump. Laurentas, Lauras, tarm. Lauris žem., iš lot. Laurentius — „laurentietis, Laurento miesto (netoli Romos) gyventojas“.',' Laurencijus yra lotynų kilmės vardas.'),(1539,'Laurentas',' Laurentas yra Vyriškas vardas.','Trumpa reikšmė: lot., trumpinys iš Laurentius, žr. Laurencijus.','Vardo reikšmė: Laurentas – (2) lot., trumpinys iš Laurentius, žr. Laurencijus.',' Laurentas yra lotynų kilmės vardas.'),(1540,'Lauras',' Lauras yra Vyriškas vardas.','Trumpa reikšmė: lauras (medis), lauro lapai – pasiekimo ženklas.','Vardo reikšmė: Lauras – (1), (2) 1. lot., iš lot. Laurus: lot. laurus „lauro medis, lauro šakelė, laurų vainikas“, 2. liet. trumpinys iš Laurynas.',' Lauras yra lotynų kilmės vardas.'),(1541,'Laurencija',' Laurencija yra Moteriškas vardas.','Trumpa reikšmė: „laurentietis, Laurento miesto (šalia Romos) gyventojas“.','Vardo reikšmė: Laurencija – (1) lot., trump. Laura, tarm. Laurė žem., iš lot. Laurentia, kuris iš vyr. v. Laurentius, žr. Laurencijus.',' Laurencija yra lotynų kilmės vardas.'),(1542,'Laura',' Laura yra Moteriškas vardas.','Trumpa reikšmė: lauras (medis), lauro lapai – pasiekimo ženklas.','Vardo reikšmė: Lauros domisi mistika, sumanios, drąsios, turi tvirtus principus ir didžiules ambicijas. Didžiuojasi savo šeima, namais ir savo pasirinktu gyvenimo keliu. Reikėtų joms saugotis iliuzijų, nes jų pasitikėjimas gali būti apgaulingas. ',' Laura yra lotynų kilmės vardas.'),(1543,'Lauksvydas',' Lauksvydas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Lauksvys, lauks- (žr. Lauksminas) + vyd- (žr. Laisvydas.','Vardo reikšmė: Lauksvydas – (1) liet., trump. Lauksvys, lauks- (žr. Lauksminas) + vyd- (žr. Laisvydas).',' Lauksvydas yra lietuvių kilmės vardas.'),(1544,'Lauksmis',' Lauksmis yra Vyriškas vardas.','Trumpa reikšmė: liet., trumpinys iš Lauksminas.','Vardo reikšmė: Lauksmis – (2) liet., trumpinys iš Lauksminas.',' Lauksmis yra lietuvių kilmės vardas.'),(1545,'Leonardas',' Leonardas yra Vyriškas vardas.','Trumpa reikšmė: lewo „liūtas“ + hart „stiprus“ – „stiprus kaip liūtas“.','Vardo reikšmė: Leonardai energingi ir pilni entuziazmo, tačiau gali būti lengvai pažeidžiami, nes labai jautrūs. Daug energijos įlieja į kūrybinį darbą. Jiems tik reikėtų vystyti savyje pagarbą kitiems žmonėms.',' Leonardas yra vokiečių kilmės vardas.'),(1546,'Lauksminas',' Lauksminas yra Vyriškas vardas.','Trumpa reikšmė: lauks- (lauks-tus „nedrąsus“) + min- (minėti).','Vardo reikšmė: Lauksminas – (1) liet., trump. Lauksmis, lauks- (: liet. lauks-tus „nedrąsus, ilgus“, lauksmas „laukimas“, lauks-čioti „vengti, varžytis“) + min- (: liet. min-ėti, min-ti, mena).',' Lauksminas yra lietuvių kilmės vardas.'),(1547,'Leonarda',' Leonarda yra Moteriškas vardas.','Trumpa reikšmė: lewo „liūtas“ + hart „stiprus“ – „stiprus kaip liūtas“.','Vardo reikšmė: Šie vardo turėtojai labai prisirišę prie šeimos. Sekso srityje jiems būtina dominuoti. Jei partnerei neprieštarauja, gali griebtis grubiausios fizinės jėgos. Kai jie susižavi ar kažko užsinori – geriau saugotis jų. Labai kūribingi ir užsispyrę žmonės.',' Leonarda yra vokiečių kilmės vardas.'),(1548,'Leokadija',' Leokadija yra Moteriškas vardas.','Trumpa reikšmė: „liaukadietis (-ė), kilęs (-usi) iš Leukadės (sala ir miestas Jordanijos jūroje)“.','Vardo reikšmė: Leokadijos turi stiprią trauką asmeninei laisvei ir nepriklausomybei. Per gyvenimą patiria daugybę pakilimų ir kritimų.',' Leokadija yra graikų kilmės vardas.'),(1549,'Lengvinas',' Lengvinas yra Vyriškas vardas.','Trumpa reikšmė: leng- (lengti „silpnėti, nykti“) + vin- (vin-/vain- vaina „priežastis, kaltė“).','Vardo reikšmė: Lengvinas – (1) liet., trump. Lengys, leng- (: liet. leng-ti „silpnėti, nykti“) + vin- (: vin- su balsių kaita iš vain-, — sen. liet. vaina „priežastis, kaltė“).',' Lengvinas yra lietuvių kilmės vardas.'),(1550,'Lengvenis',' Lengvenis yra Vyriškas vardas.','Trumpa reikšmė: „lengvas“ + -en-.','Vardo reikšmė: Lengvenis – (2) liet., trump. Lengvys, priesagos -enis vedinys iš liet. lengvas.',' Lengvenis yra lietuvių kilmės vardas.'),(1551,'Lelija',' Lelija yra Moteriškas vardas.','Trumpa reikšmė: lelija (gėlė).','Vardo reikšmė: Lelija – (2) sulietuvinta lot. vardo Lilija forma.',' Lelija yra lietuvių kilmės vardas.'),(1552,'Lėja',' Lėja yra Moteriškas vardas.','Trumpa reikšmė: „antilopė“.','Vardo reikšmė: Lėja – (1) hebr., iš sulotyninto hebr. Lea: hebr. le’a „antilopė“.',' Lėja yra hebrajų kilmės vardas.'),(1553,'Leinartė',' Leinartė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Leinė, iš vyr. v. Leinartas.','Vardo reikšmė: Leinartė – (1) liet., trump. Leinė, iš vyr. v. Leinartas.',' Leinartė yra lietuvių kilmės vardas.'),(1554,'Leinartas',' Leinartas yra Vyriškas vardas.','Trumpa reikšmė: „atkaklus“.','Vardo reikšmė: Leinartas – (1) liet., trump. Leinys, lei- (žr. Leikantas) + nart- (: liet. nart-us „atkaklus“).',' Leinartas yra lietuvių kilmės vardas.'),(1555,'Leimantė',' Leimantė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Mantė, iš vyr. v. Leimantas.','Vardo reikšmė: Leimantė – (1) liet., trump. Mantė, iš vyr. v. Leimantas.',' Leimantė yra lietuvių kilmės vardas.'),(1556,'Leikantas',' Leikantas yra Vyriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Kantas, lei- (: latv. lei, lai „tegu“, liet. lai „t. p.“) + kant- (: liet. pa-kant-us, kant-rus.','Vardo reikšmė: Leikantas – (1) suliet. prūs., trump. Kantas, lei- (: latv. lei, lai „tegu“, liet. lai „t. p.“) + kant- (: liet. pa-kant-us, kant-rus).',' Leikantas yra lietuvių kilmės vardas.'),(1557,'Leimantas',' Leimantas yra Vyriškas vardas.','Trumpa reikšmė: „sumanus“.','Vardo reikšmė: Leimantas – (1) liet., trump. Mantas, lei- (žr. Leikantas) + mant- (: liet. mant-us „sumanus“, mant-a „turtas, nauda“).',' Leimantas yra lietuvių kilmės vardas.'),(1558,'Legedas',' Legedas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Legys, le- (žr. Legailas) + ged- (žr. Laigedas).','Vardo reikšmė: Legedas – (1) liet., trump. Legys, le- (žr. Legailas) + ged- (žr. Laigedas).',' Legedas yra lietuvių kilmės vardas.'),(1559,'Legaudas',' Legaudas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Legys, le- iš leg- (žr. Legailas) + gaud- (: liet. gaud-yti, plg. gauti).','Vardo reikšmė: Legaudas – (1) liet., trump. Legys, le- iš leg- (žr. Legailas) + gaud- (: liet. gaud-yti, plg. gauti).',' Legaudas yra lietuvių kilmės vardas.'),(1560,'Mozė',' Mozė yra Vyriškas vardas.','Trumpa reikšmė: moše „vaikas, sūnus“.','Vardo reikšmė: Jūs labai atjaučiantys, todėl nėra geresnių slaugytojų už jus. Tačiau dvasinis mąstymas ribotas. Bažnyčią lankote tik dėl to, kad bijote, jog kiti gali blogai apie jus pagalvoti. Jūs puikiausiai suprantate savo prasižengimus šiame pasaulyje, tačiau anapusinis pasaulis jūsų nedomina.',' Mozė yra hebrajų kilmės vardas.'),(1561,'Mudrė',' Mudrė yra Moteriškas vardas.','Trumpa reikšmė: mudri „šauni, guvi“.','Vardo reikšmė: Šie vardo turėtojai iš pažiūros atrodo abejingi viskam, tačiau tai tik elgesio maniera, po kuria slepiasi didžiuliai dvasiniai išgyvenimai. Jie emocijas slepia viduje, o tai greitai atsiliepia į jų sveikatą – virškinimo ir nervų sistemoms.',' Mudrė yra lietuvių kilmės vardas.'),(1562,'Motiejus',' Motiejus yra Vyriškas vardas.','Trumpa reikšmė: „dievo dovana“.','Vardo reikšmė: Motiejai veda gana vėlai, nes iki to nori sukurti materialinį šeimos pagrindą. Nematydami perspektyvos, jie lieka senberniais. Tačiau jeigu veda, tai laikosi šeimyninio gyvenimo taisyklių. Negali taikstytis su žmonos neištikimybe.',' Motiejus yra hebrajų kilmės vardas.'),(1563,'Morta',' Morta yra Moteriškas vardas.','Trumpa reikšmė: Marta variantas: martha „valdovė, viešpatė“.','Vardo reikšmė: Šie vardo turėtojai iš pažiūros atrodo abejingi viskam, tačiau tai tik elgesio maniera, po kuria slepiasi didžiuliai dvasiniai išgyvenimai. Jie emocijas slepia viduje, o tai greitai atsiliepia į jų sveikatą – virškinimo ir nervų sistemoms.',' Morta yra aramėjų kilmės vardas.'),(1564,'Morkus',' Morkus yra Vyriškas vardas.','Trumpa reikšmė: iš Mars, Marsas – romėnų karo dievas.','Vardo reikšmė: Morkai savo profesiją renkasi labai skrupulingai. Todėl jie geri pasaulinės rinkos analitikai, inžinieriai, finansininkai. Ne mažiau gali pasiekti ir kaip liaudies gydytojas, astrologas ar numerologas.',' Morkus yra lotynų kilmės vardas.'),(1565,'Monika',' Monika yra Moteriškas vardas.','Trumpa reikšmė: monos „vienas, vienišas“.','Vardo reikšmė: Monikos susiderina su panašiais į save, gal dar su tais, kas jų bijo ar kam jos brangios kaip asmenybės. Vyrai joms turi būti lygiaverčiai arba vergai.',' Monika yra graikų kilmės vardas.'),(1566,'Modestas',' Modestas yra Vyriškas vardas.','Trumpa reikšmė: Modestus „kuklus, padorus“.','Vardo reikšmė: Vardadienis: Balandžio 15 d., Spalio 2 d.',' Modestas yra lotynų kilmės vardas.'),(1567,'Modesta',' Modesta yra Moteriškas vardas.','Trumpa reikšmė: Modestus „kuklus, padorus“.','Vardo reikšmė: Šie vardo turėtojai iš pažiūros atrodo abejingi viskam, tačiau tai tik elgesio maniera, po kuria slepiasi didžiuliai dvasiniai išgyvenimai. Jie emocijas slepia viduje, o tai greitai atsiliepia į jų sveikatą – virškinimo ir nervų sistemoms.',' Modesta yra lotynų kilmės vardas.'),(1568,'Ovidijus',' Ovidijus yra Vyriškas vardas.','Trumpa reikšmė: ovis „avis“ – „avininkas“.','Vardo reikšmė: Ovidijus drąsiai galima pavadinti dosniais žmonėmis, atvirais. Jie pripratę nemalonumus nugalėti savo didingumu, kilniaširdiškumu, tikėjimu ateitimi. Jausmingumą gauna iš gamtos.',' Ovidijus yra lotynų kilmės vardas.'),(1569,'Levas',' Levas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Leonidas, Leonida: „panašus į liūtą“.','Vardo reikšmė: Levas – (2) liet. trumpinys iš Leonas ir kt.',' Levas yra graikų kilmės vardas.'),(1570,'Leticija',' Leticija yra Moteriškas vardas.','Trumpa reikšmė: laetitia „linksmumas, džiaugsmumas“.','Vardo reikšmė: Leticija – (1) lot., trump. Leta, Letė, iš lot. Laetitia: lot. laetitia „linksmumas, džiaugsmas“.',' Leticija yra lotynų kilmės vardas.'),(1571,'Leva',' Leva yra Moteriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Leonė ir kt.','Vardo reikšmė: Leva – (2) liet. trumpinys iš Leonė ir kt.',' Leva yra lietuvių kilmės vardas.'),(1572,'Letas',' Letas yra Vyriškas vardas.','Trumpa reikšmė: letus „linksmas, džiugus“.','Vardo reikšmė: Letas – (2) lot., iš lot. Letus: lot. letus „linksmas, džiugus“.',' Letas yra lotynų kilmės vardas.'),(1573,'Leta',' Leta yra Moteriškas vardas.','Trumpa reikšmė: letus „linksmas, džiugus“.','Vardo reikšmė: Leta – (2) 1. lot., iš lot. Leta: lot. leta „linksma, džiugi“, 2. liet. trumpinys iš Violeta ir Leticija.',' Leta yra lotynų kilmės vardas.'),(1574,'Leontina',' Leontina yra Moteriškas vardas.','Trumpa reikšmė: leon „liūtas“ – „stiprus, galingas kaip liūtas“.','Vardo reikšmė: Leontina – (2) lot., trump. Leonta, Leontė, iš lot. Leontina, kuris yra priesagos -ina vedinys iš Leontia, žr. Leoncija.',' Leontina yra graikų kilmės vardas.'),(1575,'Leontas',' Leontas yra Vyriškas vardas.','Trumpa reikšmė: leon „liūtas“ – „stiprus, galingas kaip liūtas“.','Vardo reikšmė: (1) liet. trumpinys iš Leoncijus',' Leontas yra graikų kilmės vardas.'),(1576,'Leonora',' Leonora yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Eleonora „dievas mano šviesa“.','Vardo reikšmė: Leonoros didžiausių pasiekimų turi didelių pinigų pasaulyje, politikoje, biznyje. Jos puikios darbų organizatorės, galinčios koordinuoti pačius sudėtingiausius darbus. Geros advokatės, finansininkės, chirurgės, išradėjos, lakūnės.',' Leonora yra hebrajų kilmės vardas.'),(1577,'Leonilė',' Leonilė yra Moteriškas vardas.','Trumpa reikšmė: leo „liūtas“.','Vardo reikšmė: Jūs galite būti geri teisininkai, medikai, literatūros tyrinėtojai, valstybės vadovai. Socialinis darbas, pedagogika, psichologija, netradicinė medicina – taip pat puikus pasirinkimas, nes jie moka visus išklausyti bei giliai analizuoti. Jus galite būti sapnų pasaulio aiškintojai.',' Leonilė yra lotynų kilmės vardas.'),(1578,'Leonija',' Leonija yra Moteriškas vardas.','Trumpa reikšmė: lot., trump. Leona, Leonė, tarm. Levonija ryt. aukšt., Leonė piet. aukšt. (dz.), iš lot. Leonia, kuris iš vyr. v. Leo (kilm. Leonis), žr. Leonas..','Vardo reikšmė: Jūs galite būti geri teisininkai, medikai, literatūros tyrinėtojai, valstybės vadovai. Socialinis darbas, pedagogika, psichologija, netradicinė medicina – taip pat puikus pasirinkimas, nes jie moka visus išklausyti bei giliai analizuoti. Jus galite būti sapnų pasaulio aiškintojai.',' Leonija yra lotynų kilmės vardas.'),(1579,'Liaudminas',' Liaudminas yra Vyriškas vardas.','Trumpa reikšmė: liaud- (liaudis „žmonės, tauta“) +min-(minėti) – „tautos minimas, -a“.','Vardo reikšmė: Liaudminas – (1) liet., trump. Liaudas, Liaudys, liaud- (žr. Liaudbaras) + min- (žr. Lauksminas).',' Liaudminas yra lietuvių kilmės vardas.'),(1580,'Leonidas',' Leonidas yra Vyriškas vardas.','Trumpa reikšmė: leon „liūtas“ – „panašus į liūtą“.','Vardo reikšmė: Jūs galite būti geri teisininkai, medikai, literatūros tyrinėtojai, valstybės vadovai. Socialinis darbas, pedagogika, psichologija, netradicinė medicina – taip pat puikus pasirinkimas, nes jie moka visus išklausyti bei giliai analizuoti. Jus galite būti sapnų pasaulio aiškintojai.',' Leonidas yra graikų kilmės vardas.'),(1581,'Liaudmantė',' Liaudmantė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Liauda, Liaudė, iš vyr. v. Liaudmantas.','Vardo reikšmė: Liaudmantė – (1) liet., trump. Liauda, Liaudė, iš vyr. v. Liaudmantas.',' Liaudmantė yra lietuvių kilmės vardas.'),(1582,'Leonė',' Leonė yra Moteriškas vardas.','Trumpa reikšmė: leo „liūtas“.','Vardo reikšmė: Jūs galite būti geri teisininkai, medikai, literatūros tyrinėtojai, valstybės vadovai. Socialinis darbas, pedagogika, psichologija, netradicinė medicina – taip pat puikus pasirinkimas, nes jie moka visus išklausyti bei giliai analizuoti. Jus galite būti sapnų pasaulio aiškintojai.',' Leonė yra lotynų kilmės vardas.'),(1583,'Leoncijus',' Leoncijus yra Vyriškas vardas.','Trumpa reikšmė: leon „liūtas“.','Vardo reikšmė: Jūs galite būti geri teisininkai, medikai, literatūros tyrinėtojai, valstybės vadovai. Socialinis darbas, pedagogika, psichologija, netradicinė medicina – taip pat puikus pasirinkimas, nes jie moka visus išklausyti bei giliai analizuoti. Jus galite būti sapnų pasaulio aiškintojai.',' Leoncijus yra graikų kilmės vardas.'),(1584,'Liaudmantas',' Liaudmantas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Liaudas, Liaudys, liaud- (žr. Liaudbaras) + mant- (žr. Leimantas).','Vardo reikšmė: Liaudmantas – (1) liet., trump. Liaudas, Liaudys, liaud- (žr. Liaudbaras) + mant- (žr. Leimantas).',' Liaudmantas yra lietuvių kilmės vardas.'),(1585,'Liaudgintas',' Liaudgintas yra Vyriškas vardas.','Trumpa reikšmė: „užstoti“.','Vardo reikšmė: Liaudgintas – (1) liet., trump. Liaudas, Liaudys, liaud- (žr. Liaudbaras) + gint- (: liet. gint-as, ginti „užstoti“).',' Liaudgintas yra lietuvių kilmės vardas.'),(1586,'Leoncija',' Leoncija yra Moteriškas vardas.','Trumpa reikšmė: leon „liūtas“.','Vardo reikšmė: Jūs galite būti geri teisininkai, medikai, literatūros tyrinėtojai, valstybės vadovai. Socialinis darbas, pedagogika, psichologija, netradicinė medicina – taip pat puikus pasirinkimas, nes jie moka visus išklausyti bei giliai analizuoti. Jus galite būti sapnų pasaulio aiškintojai.',' Leoncija yra graikų kilmės vardas.'),(1587,'Liaudginas',' Liaudginas yra Vyriškas vardas.','Trumpa reikšmė: liaud- (liaudis „žmonės, tauta“) + gin- (ginti).','Vardo reikšmė: Liaudginas – (1) liet., trump. Liaudas, Liaudys, liaud- (žr. Liaudbaras) + gin- (: liet. gin-ti „užstoti“, gin-a).',' Liaudginas yra lietuvių kilmės vardas.'),(1588,'Liepa',' Liepa yra Moteriškas vardas.','Trumpa reikšmė: liepa.','Vardo reikšmė: Liepa linkusi staiga keisti savo pomėgius ar nuomonę, tačiau nelengvai įtakojama pašalinių. Vardas palankus menininkei, teisininkei, kriminalistei, vadybininkei ar moteriai dirbančiai mosklinį tiriamąjį darbą. Vardo savininkei būtina skirti pakankamai laiko miegui bei vengti azartinių lošimų.',' Liepa yra lietuvių kilmės vardas.'),(1589,'Lieda',' Lieda yra Moteriškas vardas.','Trumpa reikšmė: liet., iš upėvardžio Lieda (Raudondvaris).','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Jūs puikūs originalių idėjų ir efektyvių sistemų šaltinis. Gyvenimas jums žavingas todėl, kad jūs patys suteikiate jam tam tikrą prieskonį.',' Lieda yra lietuvių kilmės vardas.'),(1590,'Liaudbaras',' Liaudbaras yra Vyriškas vardas.','Trumpa reikšmė: iet., trump. Liaudas, Liaudys, liaud- (: liet. liaudis „žmonės, tauta“, liaudžia „minia, būrys“) + bar- (žr. Liaubaras).','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Pagrindinis jūsų bruožas – magnetizmas. Jūs stengiatės atitikti maksimalų galimybių potencialą. Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems.',' Liaudbaras yra lietuvių kilmės vardas.'),(1591,'Lidija',' Lidija yra Moteriškas vardas.','Trumpa reikšmė: „liedietė, Lidijos (miestelis Mažojoje Azijoje) gyventoja“.','Vardo reikšmė: Vardadienis: Kovo 27 d., rugpjūčio 3 d.',' Lidija yra graikų kilmės vardas.'),(1592,'Liaudė',' Liaudė yra Moteriškas vardas.','Trumpa reikšmė: liet., iš upėvardžio Liaudė (Baisogala).','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Pagrindinis jūsų bruožas – magnetizmas. Jūs stengiatės atitikti maksimalų galimybių potencialą. Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems.',' Liaudė yra lietuvių kilmės vardas.'),(1593,'Liberatas',' Liberatas yra Vyriškas vardas.','Trumpa reikšmė: „išlaisvintas, išvaduotas“.','Vardo reikšmė: Liberatas – (2) lot., trump. Liberas, iš lot. Liberatus: lot. liberatus „išlaisvintas, išvaduotas“.',' Liberatas yra lotynų kilmės vardas.'),(1594,'Liberata',' Liberata yra Moteriškas vardas.','Trumpa reikšmė: „išlaisvintas, išvaduotas“.','Vardo reikšmė: Liberata – (2) lot., trump. Libera, iš lot. Liberata: lot. liberata „išlaisvinta, išvaduota“.',' Liberata yra lotynų kilmės vardas.'),(1595,'Liaubaras',' Liaubaras yra Vyriškas vardas.','Trumpa reikšmė: „kovoti“.','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Pagrindinis jūsų bruožas – magnetizmas. Jūs stengiatės atitikti maksimalų galimybių potencialą. Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems.',' Liaubaras yra lietuvių kilmės vardas.'),(1596,'Lybartė',' Lybartė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Bartė, iš vyr. v. Lybartas.','Vardo reikšmė: Lybartė – (1) liet., trump. Bartė, iš vyr. v. Lybartas.',' Lybartė yra lietuvių kilmės vardas.'),(1597,'Liaugintas',' Liaugintas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Liaugas, Gintas, liau- (žr. Liaubaras) + gint- (žr. Liaudginas).','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Pagrindinis jūsų bruožas – magnetizmas. Jūs stengiatės atitikti maksimalų galimybių potencialą. Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems.',' Liaugintas yra lietuvių kilmės vardas.'),(1598,'Lybartas',' Lybartas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Bartas, ly- iš lyg- (: liet. lyg-ti, lygus, žr. dar Lygmantas) + bart- (: liet. bart-as, barti - sen. reikšme „kovoti“, plg. rus. borotjsia).','Vardo reikšmė: Lybartas – (1) liet., trump. Bartas, ly- iš lyg- (: liet. lyg-ti, lygus, žr. dar Lygmantas) + bart- (: liet. bart-as, barti – sen. reikšme „kovoti“, plg. rus. borotjsia).',' Lybartas yra lietuvių kilmės vardas.'),(1599,'Liaugedas',' Liaugedas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Liaugas, Gedas, liau- (žr. Liaubaras) + ged- (žr. Laigedas).','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Pagrindinis jūsų bruožas – magnetizmas. Jūs stengiatės atitikti maksimalų galimybių potencialą. Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems.',' Liaugedas yra lietuvių kilmės vardas.'),(1600,'Lymantė',' Lymantė yra Moteriškas vardas.','Trumpa reikšmė: ly- (lyg) + mant- (mantus „sumanus“) – „atrodantis kaip protingas“.','Vardo reikšmė: Lymantė – (1) liet., trump. Lymė, Mantė, iš vyr. v. Lymantas.',' Lymantė yra lietuvių kilmės vardas.'),(1601,'Liaugaudas',' Liaugaudas yra Vyriškas vardas.','Trumpa reikšmė: liaud- (liaudis „žmonės, tauta“) + gaud- (gaudyti, gauti).','Vardo reikšmė: (1) liet., trump. Liaugas, Gaudas, liau- (žr. Liaubaras) + gaud- (žr. Legaudas)',' Liaugaudas yra lietuvių kilmės vardas.'),(1602,'Lymantas',' Lymantas yra Vyriškas vardas.','Trumpa reikšmė: ly- (lyg) + mant- (mantus „sumanus“) – „atrodantis kaip protingas“.','Vardo reikšmė: Lymantas – (1) liet., trump. Lymas, Mantas, ly- iš lyg- (žr. Lybartas) + mant- (žr. Leimantas).',' Lymantas yra lietuvių kilmės vardas.'),(1603,'Lilijana',' Lilijana yra Moteriškas vardas.','Trumpa reikšmė: lilium „lelija“.','Vardo reikšmė: Lilijana – (2) lot., trump. Lilė, Lijana, baž. lot. Liliana, kuris yra priesagos -ana vedinys iš Lilija.',' Lilijana yra lotynų kilmės vardas.'),(1604,'Liaudvilas',' Liaudvilas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Liaudas, Liaudys, liaud- (žr. Liaudbaras) + vil- (: liet. vil-tis, vil-iasi, vil-tis).','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Kartais jie apie save suburia tvirtovės sieną, atskiriančią juos nuo aistrų ir instinktų, laikydami juos antraeiliais dalykais. Ir visgi jūsų protas bei energija nukreipti saviems egoistiniams tikslams įgyvendinti.',' Liaudvilas yra lietuvių kilmės vardas.'),(1605,'Lilija',' Lilija yra Moteriškas vardas.','Trumpa reikšmė: lilium „lelija“.','Vardo reikšmė: Lilija – (1) lot., trump. Lilė, tarm. Lilia ryt. aukšt. (Laičiai), piet. aukšt. (dz.), iš lot. Lilia: lot. lilium „lelija“.',' Lilija yra lotynų kilmės vardas.'),(1606,'Lilė',' Lilė yra Moteriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Lilija ir Lilijana, 2. vok., iš vok. Lili, kuris yra trumpinys iš Elisabeth, žr. Elzbieta.','Vardo reikšmė: Lilė – (2) 1. liet. trumpinys iš Lilija ir Lilijana, 2. vok., iš vok. Lili, kuris yra trumpinys iš Elisabeth, žr. Elzbieta.',' Lilė yra lotynų kilmės vardas.'),(1607,'Lykantė',' Lykantė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Lykė, Kantė, iš vyr. v. Lykantas.','Vardo reikšmė: Lykantė – (1) liet., trump. Lykė, Kantė, iš vyr. v. Lykantas.',' Lykantė yra lietuvių kilmės vardas.'),(1608,'Lijana',' Lijana yra Moteriškas vardas.','Trumpa reikšmė: lilium „lelija“.','Vardo reikšmė: Lijana – italų kilmės vardas iš itališko vardo Liana, kuris yra trumpinys iš Lilijana.',' Lijana yra lotynų kilmės vardas.'),(1609,'Lykantas',' Lykantas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Lykas, Lykys, ly- iš lyg- (žr. Lybartas) + kant- (: liet. pa-kant-us, kant-rus).','Vardo reikšmė: Lykantas – (1) liet., trump. Lykas, Lykys, ly- iš lyg- (žr. Lybartas) + kant- (: liet. pa-kant-us, kant-rus).',' Lykantas yra lietuvių kilmės vardas.'),(1610,'Lygmantė',' Lygmantė yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Lyga, Lygė, iš vyr. v. Lygmantas.','Vardo reikšmė: Lygmantė – (1) liet., trump. Lyga, Lygė, iš vyr. v. Lygmantas.',' Lygmantė yra lietuvių kilmės vardas.'),(1611,'Lygmantas',' Lygmantas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Lygas, Lygys, lyg- (: liet. lyg-ti, lyg-us) + mant- (žr. Leimantas).','Vardo reikšmė: Lygmantas – (1) liet., trump. Lygas, Lygys, lyg- (: liet. lyg-ti, lyg-us) + mant- (žr. Leimantas).',' Lygmantas yra lietuvių kilmės vardas.'),(1612,'Lygirdas',' Lygirdas yra Vyriškas vardas.','Trumpa reikšmė: „žinia, gandas“.','Vardo reikšmė: Lygirdas – (1) liet., trump. Lygas, Lygys, ly- iš lyg- (žr. Lybartas) + gird- (: liet. gird-ėti, gird-as „žinia, gandas“).',' Lygirdas yra lietuvių kilmės vardas.'),(1613,'Lygedas',' Lygedas yra Vyriškas vardas.','Trumpa reikšmė: ly- (lygti, lygus) + (ged- (gedėti „ilgėtis“).','Vardo reikšmė: Lygedas – (1) suliet. prūs., trump. Lygas, Lygys, ly- iš lyg- (žr. Lybartas) + ged- (žr. Laigedas).',' Lygedas yra lietuvių kilmės vardas.'),(1614,'Lygaudas',' Lygaudas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Lygas, Lygys, ly- iš lyg- (žr. Lybartas) + gaud- (žr. Legaudas).','Vardo reikšmė: Lygaudas – (1) liet., trump. Lygas, Lygys, ly- iš lyg- (žr. Lybartas) + gaud- (žr. Legaudas).',' Lygaudas yra lietuvių kilmės vardas.'),(1615,'Liubartas',' Liubartas yra Vyriškas vardas.','Trumpa reikšmė: liu- (liautis) + bart- (barti reikšme „kovoti“) – „besiliaunantis kovoti, taikus“.','Vardo reikšmė: Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Rūpinimasis kitais, mokėjimas spręsti sudėtingus klausimus ir pedagoginis talentas gali jį išskirti iš minios. Jam reikės mokytis suvaldyti pyktį ir norą priimti staigius ir nepamatuotus sprendimus bei norą pasiduoti..',' Liubartas yra lietuvių kilmės vardas.'),(1616,'Liubartė',' Liubartė yra Moteriškas vardas.','Trumpa reikšmė: liu- (liautis) + bart- (barti reikšme „kovoti“) – „besiliaunantis kovoti, taikus“.','Vardo reikšmė: Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Rūpinimasis kitais, mokėjimas spręsti sudėtingus klausimus ir pedagoginis talentas gali jį išskirti iš minios. Jam reikės mokytis suvaldyti pyktį ir norą priimti staigius ir nepamatuotus sprendimus bei norą pasiduoti.',' Liubartė yra lietuvių kilmės vardas.'),(1617,'Liongina',' Liongina yra Moteriškas vardas.','Trumpa reikšmė: „ilgas“ – „aukštaūgis“.','Vardo reikšmė: Liongina – (1) lot., trump. Lionga, Liongė, iš lot. Longina, kuris iš vyr. v. Longinus, žr. Lionginas.',' Liongina yra lotynų kilmės vardas.'),(1618,'Lionė',' Lionė yra Moteriškas vardas.','Trumpa reikšmė: leo „liūtas“.','Vardo reikšmė: Lionė – (2) trumpinys iš Leonora ir kt.',' Lionė yra lotynų kilmės vardas.'),(1619,'Linvydas',' Linvydas yra Vyriškas vardas.','Trumpa reikšmė: lin- (linkti prie ko nors, „turėti patraukimą, norą“) + vyd- (iš-vydo) – „linkęs daug pamatyti, sužinoti“.','Vardo reikšmė: Linvydas – (1) liet., trump. Linys, Linius, lin- iš link- (žr. Lingailas) + vyd- (: liet. iš-vyd-o, iš-vysti).',' Linvydas yra lietuvių kilmės vardas.'),(1620,'Lingailas',' Lingailas yra Vyriškas vardas.','Trumpa reikšmė: lin- (linkti prie ko nors, „turėti patraukimą, norą“) + gail- (gailas „stiprus“) – „stipriai prie ko nors linkstantis (susižavėjęs, įsimylėjęs)“.','Vardo reikšmė: Jūsų gerosios savybės – mokėjimas mylėti, draugiškumas, pagarba aplinkiniams. Gebate suprasti kitus žmones, todėl susilaukiate simpatijų, paslaugumo ir gerumo.',' Lingailas yra lietuvių kilmės vardas.'),(1621,'Lingailė',' Lingailė yra Moteriškas vardas.','Trumpa reikšmė: lin- (linkti prie ko nors, „turėti patraukimą, norą“) + gail- (gailas „stiprus“) – „stipriai prie ko nors linkstantis (susižavėjęs, įsimylėjęs)“.','Vardo reikšmė: Jūsų gerosios savybės – mokėjimas mylėti, draugiškumas, pagarba aplinkiniams. Gebate suprasti kitus žmones, todėl susilaukiate simpatijų, paslaugumo ir gerumo.',' Lingailė yra lietuvių kilmės vardas.'),(1622,'Linius',' Linius yra Vyriškas vardas.','Trumpa reikšmė: liet., galūnės vedinys iš liet. linas.','Vardo reikšmė: Atvirumas ir nuoširdumas leidžia sukurti tvirtus ryšius su artimaisiais. Šio skaičiaus savininkų pagrindinis tikslas – sukurti namus. Asmeninės savybės dažnai suteikia galimybę susikurti prabangų ir pasiturintį gyvenimą.',' Linius yra lietuvių kilmės vardas.'),(1623,'Linė',' Linė yra Moteriškas vardas.','Trumpa reikšmė: 1. lietuvių: linas (augalas), 2 graikų: linos „paguodos giesmė“.','Vardo reikšmė: Atvirumas ir nuoširdumas leidžia sukurti tvirtus ryšius su artimaisiais. Šio skaičiaus savininkų pagrindinis tikslas – sukurti namus. Asmeninės savybės dažnai suteikia galimybę susikurti prabangų ir pasiturintį gyvenimą.',' Linė yra lietuvių kilmės vardas.'),(1624,'Linas',' Linas yra Vyriškas vardas.','Trumpa reikšmė: 1. lietuvių: linas (augalas), 2 graikų: linos „paguodos giesmė“.','Vardo reikšmė: Žodyje „Linas“ vyrauja penketuko vibracijos. Tai labai aktyvus skaičius, esantis visada judėjime. Todėl Linai linkę ieškoti naujovių, mėgsta keliauti ir patirti nuotykius. Jie labai smalsūs. Kai kurie domisi spiritizmu, religija ar ezoterika. Jie azartiški lošėjai, visą laiką ieško būdų praturtėti.',' Linas yra lietuvių kilmės vardas.'),(1625,'Lynartė',' Lynartė yra Moteriškas vardas.','Trumpa reikšmė: ly- (iš lyg) + nart- (nartus „atkaklus“) – „lyg ir narsus“.','Vardo reikšmė: Jei išnaudosite likimo suteiktas galimybes, taktiškumas ir draugiškas elgesys atneš jums populiarumą. Jūs patiksite visiems žmonėms. Jie vertins, kad dirbate ne dėl pinigų, o savo idealų.',' Lynartė yra lietuvių kilmės vardas.'),(1626,'Livijus',' Livijus yra Vyriškas vardas.','Trumpa reikšmė: 1. lotynų: „libietis, Libijos (Afrikoje) gyventojas“; 2. trumpinys iš Olivija lotynų oliv „alyvuogių medis“.','Vardo reikšmė: Livijus – (1) lot., trump. Livas, iš lot. Livius, kuris iš sen. romėnų giminės vardo Livius — „libietis, Libijos (Afrikoje) gyventojas“.',' Livijus yra lotynų kilmės vardas.'),(1627,'Lynartas',' Lynartas yra Vyriškas vardas.','Trumpa reikšmė: ly- (iš lyg) + nart- (nartus „atkaklus“) – „lyg ir narsus“.','Vardo reikšmė: Jei išnaudosite likimo suteiktas galimybes, taktiškumas ir draugiškas elgesys atneš jums populiarumą. Jūs patiksite visiems žmonėms. Jie vertins, kad dirbate ne dėl pinigų, o savo idealų.',' Lynartas yra lietuvių kilmės vardas.'),(1628,'Livija',' Livija yra Moteriškas vardas.','Trumpa reikšmė: 1. lotynų: „libietis, Libijos (Afrikoje) gyventojas“; 2. trumpinys iš Olivija lotynų oliv „alyvuogių medis“.','Vardo reikšmė: Livija – (1) lot., trump. Livė, iš lot. Livia, kuris iš vyr. v. Livius, žr. Livijus.',' Livija yra lotynų kilmės vardas.'),(1629,'Lina',' Lina yra Moteriškas vardas.','Trumpa reikšmė: 1. lietuvių: linas (augalas), 2 graikų: linos „paguodos giesmė“.','Vardo reikšmė: Linos moka ginti savo gerovę ir niekad nepatenka į skurdą; moka darbuotis, bet yra labai neramios, užsigaunančios ir visada nepatenkintos. Šeimoje kenčia dėl savo ir vyro charakterių nesutapimo. Joms dažnai skauda galvą , serga hemorojumi.',' Lina yra lietuvių kilmės vardas.'),(1630,'Liutgardas',' Liutgardas yra Vyriškas vardas.','Trumpa reikšmė: liut „tauta“ + gard „apsauga“ – „tautos saugotojas, -a“.','Vardo reikšmė: Liutgardas – (1) germ., trump. Liutas, Gardas, iš sulotyninto germ. Lutgardus: sen. vok. aukšt. liut „tauta“ + gard „apsauga, saugotojas“.',' Liutgardas yra vokiečių kilmės vardas.'),(1631,'Liutaurė',' Liutaurė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Liutė, Taurė, iš vyr. v. Liutauras.','Vardo reikšmė: Liutaurė – (1) liet., trump. Liutė, Taurė, iš vyr. v. Liutauras.',' Liutaurė yra lietuvių kilmės vardas.'),(1632,'Liutgarda',' Liutgarda yra Moteriškas vardas.','Trumpa reikšmė: liut „tauta“ + gard „apsauga“ – „tautos saugotojas, -a“.','Vardo reikšmė: Liutgarda – (1) germ., trump. Liutė, Garda, iš sulotyninto germ. Lutgarda, Lutgardis iš germ. Luitgard, Luitgardis: sen. vok. aukšt. liut „tauta“ + sen. saksų gard „apsauga, saugotoja“.',' Liutgarda yra vokiečių kilmės vardas.'),(1633,'Liutauras',' Liutauras yra Vyriškas vardas.','Trumpa reikšmė: lut „tauta, liaudis“ + war- (warnen) „įspėti“ –„įspėjantis tautą“.','Vardo reikšmė: Liutaurai neparsiduoda už pinigus, tačiau pinigams nėra abejingi. Greičiau priešingai. Jie neturėtų taip stengti dominuoti, prisimindami, kad stipriam žmogui tai visai lengva, o kitam visada bus ne pagal pečius',' Liutauras yra vokiečių kilmės vardas.'),(1634,'Liudvis',' Liudvis yra Vyriškas vardas.','Trumpa reikšmė: hlut „garsus“ + wig „kova“ – „garsi kova“.','Vardo reikšmė: Vardadienis: Rugpjūčio 25 d., spalio 9 d.',' Liudvis yra vokiečių kilmės vardas.'),(1635,'Liudvina',' Liudvina yra Moteriškas vardas.','Trumpa reikšmė: liut „tauta“ + wini „draugė“ – „tautos draugė“.','Vardo reikšmė: Liudvina – (2) germ., trump. Liudvė, iš sulotyninto germ. Ludvina iš germ. Lutwine: sen. vok. aukšt. liut „tauta“ + wini „draugė“.',' Liudvina yra vokiečių kilmės vardas.'),(1636,'Liudvikas',' Liudvikas yra Vyriškas vardas.','Trumpa reikšmė: hlut „garsus“ + wig „kova“ – „garsi kova“.','Vardo reikšmė: Vardadienis: Rugpjūčio 25 d., spalio 9 d.',' Liudvikas yra vokiečių kilmės vardas.'),(1637,'Lukrecijus',' Lukrecijus yra Vyriškas vardas.','Trumpa reikšmė: lucrum „nauda, turtas“.','Vardo reikšmė: Lukrecijus – (1) lot., trump. Lukas, iš lot. Lucretius, kuris iš sen. romėnų giminės vardo Lucretius: lot. lucrum „nauda, turtas“.',' Lukrecijus yra lotynų kilmės vardas.'),(1638,'Liudvika',' Liudvika yra Moteriškas vardas.','Trumpa reikšmė: hlut „garsus“ + wig „kova“ – „garsi kova“.','Vardo reikšmė: Vardadienis: Sausio 30-31 d., balandžio 14 d.',' Liudvika yra vokiečių kilmės vardas.'),(1639,'Lukrecija',' Lukrecija yra Moteriškas vardas.','Trumpa reikšmė: lucrum „nauda, turtas“.','Vardo reikšmė: Vardadienis: Kovo 15 d., birželio 7 d.',' Lukrecija yra lotynų kilmės vardas.'),(1640,'Lukošius',' Lukošius yra Vyriškas vardas.','Trumpa reikšmė: iš Lukas: „lukanietis, Lukanijos (Italijoje) gyventojas“.','Vardo reikšmė: Lukošius – (2) pasenęs vardas, iš lenkų Lukasz, kuris iš lot. Lucas, žr. Lukas.',' Lukošius yra lotynų kilmės vardas.'),(1641,'Liudvė',' Liudvė yra Moteriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Liudvika.','Vardo reikšmė: Liudvė – (2) liet. trumpinys iš Liudvika.',' Liudvė yra lietuvių kilmės vardas.'),(1642,'Lukas',' Lukas yra Vyriškas vardas.','Trumpa reikšmė: „lukanietis, Lukanijos (Italijoje) gyventojas“.','Vardo reikšmė: Vardadienis: Spalio mėn. 18 d. - Luko vardo diena.',' Lukas yra lotynų kilmės vardas.'),(1643,'Liudgaras',' Liudgaras yra Vyriškas vardas.','Trumpa reikšmė: liut „tauta“ + ger „ietis“.','Vardo reikšmė: Liudgaras – (1) germ., trump. Liudas, iš sulotyninto germ. Ludgarus iš germ. Ludgar, Ludger: sen. vok. aukšt. liut „tauta“ + ger „ietis“.',' Liudgaras yra vokiečių kilmės vardas.'),(1644,'Liudas',' Liudas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Liudvikas, Liudvika: „garsi kova“.','Vardo reikšmė: Vardadienis: Rugpjūčio 25 d., Spalio 9 d.',' Liudas yra vokiečių kilmės vardas.'),(1645,'Liuda',' Liuda yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Liudvikas, Liudvika: „garsi kova“.','Vardo reikšmė: Vardadienis: Sausio 30-31 d., balandžio 14 d., ',' Liuda yra vokiečių kilmės vardas.'),(1646,'Lucijus',' Lucijus yra Vyriškas vardas.','Trumpa reikšmė: žr. Liucijus.','Vardo reikšmė: Jums patinka rutina ir įpročiai. Pasižymite perfekcionizmu, ypatingai darbe. Jūsų tikslas nėra tapti vadovu, bet galite būti puikus jo patarėjas.',' Lucijus yra lietuvių kilmės vardas.'),(1647,'Lucija',' Lucija yra Moteriškas vardas.','Trumpa reikšmė: žr. Liucija.','Vardo reikšmė: Jums patinka rutina ir įpročiai. Pasižymite perfekcionizmu, ypatingai darbe. Jūsų tikslas nėra tapti vadovu, bet galite būti puikus jo patarėjas.',' Lucija yra lietuvių kilmės vardas.'),(1648,'Lucidas',' Lucidas yra Vyriškas vardas.','Trumpa reikšmė: žr. Liucidas.','Vardo reikšmė: Jums patinka rutina ir įpročiai. Pasižymite perfekcionizmu, ypatingai darbe. Jūsų tikslas nėra tapti vadovu, bet galite būti puikus jo patarėjas.',' Lucidas yra lotynų kilmės vardas.'),(1649,'Lucė',' Lucė yra Moteriškas vardas.','Trumpa reikšmė: žr. Liucė.','Vardo reikšmė: Jums patinka rutina ir įpročiai. Pasižymite perfekcionizmu, ypatingai darbe. Jūsų tikslas nėra tapti vadovu, bet galite būti puikus jo patarėjas.',' Lucė yra lotynų kilmės vardas.'),(1650,'Lozorius',' Lozorius yra Vyriškas vardas.','Trumpa reikšmė: „dievas padėjo“.','Vardo reikšmė: Jums patinka rutina ir įpročiai. Pasižymite perfekcionizmu, ypatingai darbe. Jūsų tikslas nėra tapti vadovu, bet galite būti puikus jo patarėjas.',' Lozorius yra hebrajų kilmės vardas.'),(1651,'Loreta',' Loreta yra Moteriškas vardas.','Trumpa reikšmė: mažybinis iš Laura „lauro medis“.','Vardo reikšmė: Loretos gali pasiekti bet kokį užsibrėžtą tikslą. Labiausiai sekasi veikti didelių pinigų pasaulyje, politikoje ir biznyje. Labai geros organizatorės, sugebančios “užkurti” bendradarbius dideliems darbams.',' Loreta yra italų kilmės vardas.'),(1652,'Lora',' Lora yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Loreta.','Vardo reikšmė: Lora – (2) trumpinys iš Loreta.',' Lora yra italų kilmės vardas.'),(1653,'Lolita',' Lolita yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Doloresa: „sopulingoji, kenčiančioji“.','Vardo reikšmė: (2) isp., trump. Lola, iš sulotyninto isp. Lolita, kuris yra priesagos -ita (mažyb.) vedinys iš Lola, o pastarasis yra trumpinys iš v. Dolores, žr. Doloresa',' Lolita yra ispanų kilmės vardas.'),(1654,'Longinas',' Longinas yra  vardas.','Trumpa reikšmė: žr. Lionginas.','Vardo reikšmė: Seksas Lionginams reikalingas tik jų asmeniniams įgeidžiams patenkinti – jie nesidomi partnerės emocijomis. Vedybos retai būna nusisekusios, jeigu partnerė neparodo jų atžvilgiu ypatingo supratimo ir pagarbos. Jie visur kur tvirti ir nepalenkiami, niekada neatsisako įvykdyti to, ką yra užsibrėžę.',' Longinas yra lietuvių kilmės vardas.'),(1655,'Mamerta',' Mamerta yra Moteriškas vardas.','Trumpa reikšmė: oskai ir sabinai taip vadino karo dievą Marsą.','Vardo reikšmė: Mamerta – (1), (2) lot., trump. Merta, iš lot. Mamerta, kuris iš vyr. v. Mamertus, žr. Mamertas.',' Mamerta yra oskų kilmės vardas.'),(1656,'Malvina',' Malvina yra Moteriškas vardas.','Trumpa reikšmė: mahal „teismas“ + wini „draugė“.','Vardo reikšmė: Malvinos nenuilstančios ir smalsios pasaulio stebėtojos. Jos veiklios ir moka uždirbti pinigus, labai energingos.',' Malvina yra vokiečių kilmės vardas.'),(1657,'Maksimilijonas',' Maksimilijonas yra Vyriškas vardas.','Trumpa reikšmė: maximus „labai didelis, didžiausias“.','Vardo reikšmė: Maksimilijonas – (2) lot., trump. Maksimas, Maksas, iš lot. Maximilianus – „didžiausias iš Emilijų (giminės)“: lot. Maximus + Aemilianus – iš Emilijų giminės, žr. Emilijonas.',' Maksimilijonas yra lotynų kilmės vardas.'),(1658,'Maksimas',' Maksimas yra Vyriškas vardas.','Trumpa reikšmė: maximus „labai didelis, didžiausias“.','Vardo reikšmė: Maksimas – (1), (2) lot., trump. Maksas, Simas, tarm. Maksis vak. žem., iš lot. Maximus: lot. maximus „labai didelis, didžiausias“.',' Maksimas yra lotynų kilmės vardas.'),(1659,'Maksima',' Maksima yra Moteriškas vardas.','Trumpa reikšmė: maximus „labai didelis, didžiausias“.','Vardo reikšmė: Maksima – (1), (2) lot., trump. Maksė, Sima, iš lot. Maxima: lot. maxima „labai didelė, didžiausia“.',' Maksima yra lotynų kilmės vardas.'),(1660,'Maksas',' Maksas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Maksimas: „labai didelis, didžiausias“.','Vardo reikšmė: Maksas – (2) trumpinys iš Maksimas ir Maksimilijonas.',' Maksas yra lotynų kilmės vardas.'),(1661,'Mangirdas',' Mangirdas yra Vyriškas vardas.','Trumpa reikšmė: man- (manyti, sumanus) + gird- (girdėti) – „garsus savo protu“.','Vardo reikšmė: Mangirdas – (1) liet., trump. Manys, Manius, man- (žr. Mangailas) + gird- (: liet. gird-ėti, gird-as „žinia, gandas“).',' Mangirdas yra lietuvių kilmės vardas.'),(1662,'Maja',' Maja yra Moteriškas vardas.','Trumpa reikšmė: maius „daugiau“, senovės italikų žemės ir augimo deivė.','Vardo reikšmė: Maja – (2) lot., iš lot. Maia, kuris iš mitologinio v. Maia (= Maiesta) — sen. italikų žemės ir augimo deivė: lot. maius „daugiau“.',' Maja yra lotynų kilmės vardas.'),(1663,'Mangėlas',' Mangėlas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Manys, Manius, man- (žr. Mangailas) + gėl- (: liet. gėl-a, plg. šird-gėla).','Vardo reikšmė: Turite stipriai išreikštą kūno energetiką. Šie vardo savininkai rūpinasi materialine ateitimi, apie tai, kas būtina pasiturinčiam gyvenimui, ir tai jiems sekasi gana gerai, nes jie tikri finansų genijai; žino, kur taupyti ir kaip paskirstyti pinigus.',' Mangėlas yra lietuvių kilmės vardas.'),(1664,'Mainotė',' Mainotė yra Moteriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Mainė, iš vyr. v. Mainotas.','Vardo reikšmė: Mainotė – (1) suliet. prūs., trump. Mainė, iš vyr. v. Mainotas.',' Mainotė yra prūsų kilmės vardas.'),(1665,'Mainotas',' Mainotas yra Vyriškas vardas.','Trumpa reikšmė: „keisti, daryti kitonišką“.','Vardo reikšmė: Mainotas – (1) suliet. prūs., trump. Mainys, priesagos -otas vedinys iš sen. trumpinio Mainas (prūs. Mayne), kuris iš avd. su Main- (: liet. main-yti „keisti, daryti kitonišką“).',' Mainotas yra prūsų kilmės vardas.'),(1666,'Mangaudas',' Mangaudas yra Vyriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Manys, Manius, man- (žr. Mangailas) + gaud- (: liet. gaud-yti, plg. gau-ti).','Vardo reikšmė: Turite stipriai išreikštą kūno energetiką. Šie vardo savininkai rūpinasi materialine ateitimi, apie tai, kas būtina pasiturinčiam gyvenimui, ir tai jiems sekasi gana gerai, nes jie tikri finansų genijai; žino, kur taupyti ir kaip paskirstyti pinigus.',' Mangaudas yra prūsų kilmės vardas.'),(1667,'Magryta',' Magryta yra Moteriškas vardas.','Trumpa reikšmė: vak. liet. trumpinys iš Margarita.','Vardo reikšmė: Magryta – (1) vak. liet. trumpinys iš Margarita.',' Magryta yra lietuvių kilmės vardas.'),(1668,'Mantmilas',' Mantmilas yra Vyriškas vardas.','Trumpa reikšmė: mant- (mantus „sumanus“) + mil- (pa-milti) – „mylimas už protą“.','Vardo reikšmė: Jūs apsigimę kolekcionieriai. Jūsų namuose daugybė įdomių daiktų. Sienas puošia antikvariniai paveikslai, turi daug muzikos įrašų. Jūsų profesijos: ekonomistai, teisininkai, mokslininkai, rašytojai, profesionalūs sportininkai, dvasininkai, slaptieji agentai, šnipai.',' Mantmilas yra lietuvių kilmės vardas.'),(1669,'Magnas',' Magnas yra Vyriškas vardas.','Trumpa reikšmė: magnus „didelis“.','Vardo reikšmė: Turite stipriai išreikštą kūno energetiką. Šie vardo savininkai rūpinasi materialine ateitimi, apie tai, kas būtina pasiturinčiam gyvenimui, ir tai jiems sekasi gana gerai, nes jie tikri finansų genijai; žino, kur taupyti ir kaip paskirstyti pinigus.',' Magnas yra lotynų kilmės vardas.'),(1670,'Mangailė',' Mangailė yra Moteriškas vardas.','Trumpa reikšmė: man- (manyti, sumanus) + gail- (gailas „stiprus“).','Vardo reikšmė: Turite stipriai išreikštą kūno energetiką. Šie vardo savininkai rūpinasi materialine ateitimi, apie tai, kas būtina pasiturinčiam gyvenimui, ir tai jiems sekasi gana gerai, nes jie tikri finansų genijai; žino, kur taupyti ir kaip paskirstyti pinigus.',' Mangailė yra lietuvių kilmės vardas.'),(1671,'Magė',' Magė yra Moteriškas vardas.','Trumpa reikšmė: vak. liet. trumpinys iš Magdalena.','Vardo reikšmė: Turite stipriai išreikštą kūno energetiką. Šie vardo savininkai rūpinasi materialine ateitimi, apie tai, kas būtina pasiturinčiam gyvenimui, ir tai jiems sekasi gana gerai, nes jie tikri finansų genijai; žino, kur taupyti ir kaip paskirstyti pinigus.',' Magė yra lietuvių kilmės vardas.'),(1672,'Mantilė',' Mantilė yra Moteriškas vardas.','Trumpa reikšmė: mant- (mantus „sumanus“) + -il-.','Vardo reikšmė: Jūs apsigimę kolekcionieriai. Jūsų namuose daugybė įdomių daiktų. Sienas puošia antikvariniai paveikslai, turi daug muzikos įrašų. Jūsų profesijos: ekonomistai, teisininkai, mokslininkai, rašytojai, profesionalūs sportininkai, dvasininkai, slaptieji agentai, šnipai.',' Mantilė yra lietuvių kilmės vardas.'),(1673,'Mangailas',' Mangailas yra Vyriškas vardas.','Trumpa reikšmė: man- (manyti, sumanus) + gail- (gailas „stiprus“).','Vardo reikšmė: Turite stipriai išreikštą kūno energetiką. Šie vardo savininkai rūpinasi materialine ateitimi, apie tai, kas būtina pasiturinčiam gyvenimui, ir tai jiems sekasi gana gerai, nes jie tikri finansų genijai; žino, kur taupyti ir kaip paskirstyti pinigus. ',' Mangailas yra lietuvių kilmės vardas.'),(1674,'Magdė',' Magdė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Magdalena: „Magdalietė (iš Magdalos miestelio)“.','Vardo reikšmė: Magdė – (2), (4) liet. trumpinys iš Magdalena.',' Magdė yra hebrajų kilmės vardas.'),(1675,'Mantilas',' Mantilas yra Vyriškas vardas.','Trumpa reikšmė: mant- (mantus „sumanus“) + -il-.','Vardo reikšmė: Nors dažnai būdami užsiėmę svarbiais darbais, labai vertina namų židinį. Jūs dažniausiai nesate romantikai, todėl flirtas ir seksas jus mažai domina. Jums svarbi tik meilė, į kurią jūs žiūrite labai atsargiai. Tik įsitikinę jausmų tikrumu kuriate šeimą.',' Mantilas yra lietuvių kilmės vardas.'),(1676,'Manfredas',' Manfredas yra Vyriškas vardas.','Trumpa reikšmė: man „vyras“ + fridu „apsauga, taika“ – „taikos saugotojas“.','Vardo reikšmė: Manfredas – (1), (2) germ., trump. Fredas, iš germ. Manfred: sen. vok. aukšt. man „vyras“ + fridu „apsauga, taika“.',' Manfredas yra vokiečių kilmės vardas.'),(1677,'Magdalena',' Magdalena yra Moteriškas vardas.','Trumpa reikšmė: „Magdalietė (iš Magdalos miestelio)“.','Vardo reikšmė: Magdalena - hebr., var. Magdelena, trump.Magdalė, Magdė, tarm. Magdalia, Magdžia piet. aukšt. (dz.), Madlyna, Madlynė, Madlė, Madė, Magė, Magužė vak. liet., Magduka piet. aukšt., iš sulotyninto hebr. Magdalena — „magdalietė“, kuris iš Maria Magdalena – Marija iš Magdalos miesto (Palestinoje)',' Magdalena yra hebrajų kilmės vardas.'),(1678,'Mantgirdas',' Mantgirdas yra Vyriškas vardas.','Trumpa reikšmė: mant- (mantus „sumanus“) + gird- (girdėti) – „garsus savo protu“.','Vardo reikšmė: (1) liet., trump. Mantas, mant- iš manti- (žr. Mantartas) + gird- (žr. Mangirdas)',' Mantgirdas yra lietuvių kilmės vardas.'),(1679,'Manė',' Manė yra moteriškas vardas.','Trumpa reikšmė: liet., trumpinys iš mot. vardų su Man-: Mangailė, Mangaudė, Manvyda ir kt., 2. liet. trumpinys iš Monika..','Vardo reikšmė: Nors dažnai būdami užsiėmę svarbiais darbais, labai vertina namų židinį. Jūs dažniausiai nesate romantikai, todėl flirtas ir seksas jus mažai domina. Jums svarbi tik meilė, į kurią jūs žiūrite labai atsargiai. Tik įsitikinę jausmų tikrumu kuriate šeimą.',' Manė yra lietuvių kilmės vardas.'),(1680,'Magdalė',' Magdalė yra Moteriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Magdalena.','Vardo reikšmė: Magdalė – (2) – liet. trumpinys iš Magdalena.',' Magdalė yra lietuvių kilmės vardas.'),(1681,'Mančius',' Mančius yra Vyriškas vardas.','Trumpa reikšmė: liet., galūnės vedinys iš Mantas.','Vardo reikšmė: Mančius – (2) liet., galūnės vedinys iš Mantas.',' Mančius yra lietuvių kilmės vardas.'),(1682,'Mantgailė',' Mantgailė yra Moteriškas vardas.','Trumpa reikšmė: man- (manyti, sumanus) + gail- (gailas „stiprus“).','Vardo reikšmė: Jūs – tvirtų pažiūrų žmonės, savarankiški, užsispyrę, protingi, talentingi ir ambicingi. Nepaprastai seksualūs, tačiau būdami drovūs dažnai patiria skaudžių išgyvenimų. Šeimoje ištikimi ir prieraišūs, tačiau sugyventi su jais nelengva. Draugų turi nedaug.',' Mantgailė yra lietuvių kilmės vardas.'),(1683,'Mandravė',' Mandravė yra Moteriškas vardas.','Trumpa reikšmė: man- (manyti) + drav- (drūtas „stiprus, tvirtas kaip medis“; pvz. dravė „drevė“).','Vardo reikšmė: Jūs tai dievo dovana, nes visus savo sugebėjimus, talentus, kuriais gamta dosniai apdovanojo, skiriate tarnavimui žmonėms, savo tėvynei, kurioje jie gyvena.',' Mandravė yra lietuvių kilmės vardas.'),(1684,'Mandravas',' Mandravas yra Vyriškas vardas.','Trumpa reikšmė: man- (manyti) + drav- (drūtas „stiprus, tvirtas kaip medis“; pvz. dravė „drevė“).','Vardo reikšmė: (1) suliet. prūs., trump. Manys, Manius, man- (: liet. man-yti) + drav- (: liet. drūtas „stiprus, tvirtas (kaip medis)“, plg. dravė, dravis „drevė“',' Mandravas yra lietuvių kilmės vardas.'),(1685,'Mantgailas',' Mantgailas yra Vyriškas vardas.','Trumpa reikšmė: man- (manyti, sumanus) + gail- (gailas „stiprus“).','Vardo reikšmė: Jūs – tvirtų pažiūrų žmonės, savarankiški, užsispyrę, protingi, talentingi ir ambicingi. Nepaprastai seksualūs, tačiau būdami drovūs dažnai patiria skaudžių išgyvenimų. Šeimoje ištikimi ir prieraišūs, tačiau sugyventi su jais nelengva. Draugų turi nedaug.',' Mantgailas yra lietuvių kilmės vardas.'),(1686,'Manvilas',' Manvilas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Manys, Manius, man- (žr. Mangailas) + vil- (žr. Mantvilas).','Vardo reikšmė: Nors dažnai būdami užsiėmę svarbiais darbais, labai vertina namų židinį. Jūs dažniausiai nesate romantikai, todėl flirtas ir seksas jus mažai domina. Jums svarbi tik meilė, į kurią jūs žiūrite labai atsargiai. Tik įsitikinę jausmų tikrumu kuriate šeimą.',' Manvilas yra lietuvių kilmės vardas.'),(1687,'Mantė',' Mantė yra Moteriškas vardas.','Trumpa reikšmė: mantus „sumanus“.','Vardo reikšmė: Nors dažnai būdami užsiėmę svarbiais darbais, labai vertina namų židinį. Jūs dažniausiai nesate romantikai, todėl flirtas ir seksas jus mažai domina. Jums svarbi tik meilė, į kurią jūs žiūrite labai atsargiai. Tik įsitikinę jausmų tikrumu kuriate šeimą.',' Mantė yra lietuvių kilmės vardas.'),(1688,'Manvydas',' Manvydas yra Vyriškas vardas.','Trumpa reikšmė: man- (manyti, sumanus) + vyd- (iš-vydo) – „protingas, praregėjęs“.','Vardo reikšmė: Manvydas – (1) liet., trump. Manys, Manius, man- (žr. Mangailas) + vyd- (žr. Mantvydas).',' Manvydas yra lietuvių kilmės vardas.'),(1689,'Mantautė',' Mantautė yra Moteriškas vardas.','Trumpa reikšmė: liet. ir prūs., trump. Mantė, iš vyr. v. Mantautas.','Vardo reikšmė: Mantautė – (1) liet. ir prūs., trump. Mantė, iš vyr. v. Mantautas.',' Mantautė yra lietuvių kilmės vardas.'),(1690,'Mamertas',' Mamertas yra Vyriškas vardas.','Trumpa reikšmė: oskai ir sabinai taip vadino karo dievą Marsą.','Vardo reikšmė: Mamertai darbe kūrybingi. Dažniausiai dominuoja mokslo technikos ir meno srityse. Kai kurie, būdami filantropais, tampa gerais šventikais. Jie geri vadovai, nors kartais truputį despotiški. Pavaldinius skatina savo pavyzdžiu, nes labai darbštūs.',' Mamertas yra oskų kilmės vardas.'),(1691,'Mantautas',' Mantautas yra Vyriškas vardas.','Trumpa reikšmė: man- (manyti, sumanus) + taut- (tauta) – „protinga tauta“.','Vardo reikšmė: Mantautas – (1) liet. ir prūs., trump. Mantas, man- iš mant(i)- (žr. Mantartas) + taut- (:liet. tauta).',' Mantautas yra lietuvių kilmės vardas.'),(1692,'Mantvinas',' Mantvinas yra Vyriškas vardas.','Trumpa reikšmė: mant- (mantus „sumanus“) + vin- (vin/vain vaina „priežastis“ ) – „svarbi priežastis“.','Vardo reikšmė: Mantvinas – (1) liet., trump. Mantas, mant- (žr. Mantartas) + vin- (: liet. vin- su balsių kaita iš vain-: sen. liet. vaina „priežastis, kaltė“).',' Mantvinas yra lietuvių kilmės vardas.'),(1693,'Mantas',' Mantas yra Vyriškas vardas.','Trumpa reikšmė: mantus „sumanus“.','Vardo reikšmė: Mantai gali daug keliauti, netgi į Tibetą, ieškodami dvasios tobulumo. Jiems dažnai gresia pavojai tapti apgautiems, netekti viso turto, atsidurti kalėjime už įstatymų pažeidimus.',' Mantas yra lietuvių kilmės vardas.'),(1694,'Mantartė',' Mantartė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Mantė, iš vyr. v. Mantartas.','Vardo reikšmė: Mantartė – (1) liet., trump. Mantė, iš vyr. v. Mantartas.',' Mantartė yra lietuvių kilmės vardas.'),(1695,'Mantartas',' Mantartas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Mantas, man- iš mant(i)- (: liet. mant-us „sumanus“, mant-a „turtas“) + tart- (: liet. tart-as, tarti).','Vardo reikšmė: Mantartas – (1) liet., trump. Mantas, man- iš mant(i)- (: liet. mant-us „sumanus“, mant-a „turtas“) + tart- (: liet. tart-as, tarti).',' Mantartas yra lietuvių kilmės vardas.'),(1696,'Mantvilė',' Mantvilė yra Moteriškas vardas.','Trumpa reikšmė: mant- (mantus „sumanus“) + vil- (viltis).','Vardo reikšmė: Mantvilė – (1), (2) liet., trump. Mantė, iš vyr. v. Mantvilas.',' Mantvilė yra lietuvių kilmės vardas.'),(1697,'Mantvilas',' Mantvilas yra Vyriškas vardas.','Trumpa reikšmė: mant- (mantus „sumanus“) + vil- (viltis).','Vardo reikšmė: Mantvilai pikti, pavydūs ir tylūs. Jie retai, bet itin prisiriša prie kokio nors daikto ar asmens. Gali pasiaukoti ar netgi padaryti nusikaltimą; juos palikusiems – baisiai keršija.',' Mantvilas yra lietuvių kilmės vardas.'),(1698,'Mankantas',' Mankantas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Manys, Manius, man- (žr. Mangailas) + kant- (: liet. pa-kant-us, kant-rus).','Vardo reikšmė: Mankantas – (1) liet., trump. Manys, Manius, man- (žr. Mangailas) + kant- (: liet. pa-kant-us, kant-rus).',' Mankantas yra lietuvių kilmės vardas.'),(1699,'Mantvydas',' Mantvydas yra Vyriškas vardas.','Trumpa reikšmė: mant- (mantus „sumanus“) + vyd- (iš-vydo) – „protingas, praregėjęs“.','Vardo reikšmė: Vardadienis: Kovo 29 d., liepos 29 d.',' Mantvydas yra lietuvių kilmės vardas.'),(1700,'Mantrimė',' Mantrimė yra Moteriškas vardas.','Trumpa reikšmė: mant- (mantus „sumanus“) + rim- (rimti) – „miminas kaip ramus“.','Vardo reikšmė: Mantrimė – (1) liet., trump. Mantė, Mantrė, iš vyr. v. Mantrimas.',' Mantrimė yra lietuvių kilmės vardas.'),(1701,'Mantrimas',' Mantrimas yra Vyriškas vardas.','Trumpa reikšmė: mant- (mantus „sumanus“) + rim- (rimti) – „miminas kaip ramus“.','Vardo reikšmė: Mantrimas – (1) liet., trump. Mantas, Mantrius, mant- (žr. Mantartas) + rim- (: liet. rim-ti, rlm-o).',' Mantrimas yra lietuvių kilmės vardas.'),(1702,'Mantotas',' Mantotas yra Vyriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Mantas, priesagos -otas vedinys iš sen. trump. Mantas, kuris iš avd. su Mant(i)-: Mantautas, Mantgailas, Mantminas ir kt..','Vardo reikšmė: Mantotas – (1) suliet. prūs., trump. Mantas, priesagos -otas vedinys iš sen. trump. Mantas, kuris iš avd. su Mant(i)-: Mantautas, Mantgailas, Mantminas ir kt.',' Mantotas yra lietuvių kilmės vardas.'),(1703,'Mantminas',' Mantminas yra Vyriškas vardas.','Trumpa reikšmė: mant- (mantus „sumanus“) +min- (minėti) – „miminas kaip sumanus, protingas“.','Vardo reikšmė: Mantminas – (1) liet. ir prūs., trump. Mantas, mant- (žr. Mantartas) + min- (: liet. min-ėti, min-ti, mena).',' Mantminas yra lietuvių kilmės vardas.'),(1704,'Margiris',' Margiris yra Vyriškas vardas.','Trumpa reikšmė: „margosios girios gyventojas“, Pilėnų kunigaikščio vardas, išplitęs per padavimą apie Pilėnus.','Vardo reikšmė: Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs gerai numatote vedybų perspektyvas, ir jeigu vedate ar ištekate, tai tik su dideliu kraičiu. Kartais gaunate didelį palikimą iš tolimų giminaičių. Su antrąja puse gyvenate labai paslaptingą ir keistą gyvenimą.',' Margiris yra lietuvių kilmės vardas.'),(1705,'Mantmilė',' Mantmilė yra Moteriškas vardas.','Trumpa reikšmė: mant- (mantus „sumanus“) + mil- (pa-milti) – „mylimas už protą“.','Vardo reikšmė: Mantmilė – (1), (2) suliet. prūs., trump. Mantė, iš vyr. v. Mantmilas.',' Mantmilė yra lietuvių kilmės vardas.'),(1706,'Margarita',' Margarita yra Moteriškas vardas.','Trumpa reikšmė: margarites „perlas“.','Vardo reikšmė: Margaritos labai lengvai bendrauja su žiniasklaida, leidybininkais. Paprastai pasiekia aukštąjį išsilavinimą ir užima gerai apmokamas pareigas. Visada pasiruošusios pateikti originalias idėjas.',' Margarita yra graikų kilmės vardas.'),(1707,'Marė',' Marė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Marija: „atkaklioji“.','Vardo reikšmė: Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs gerai numatote vedybų perspektyvas, ir jeigu vedate ar ištekate, tai tik su dideliu kraičiu. Kartais gaunate didelį palikimą iš tolimų giminaičių. Su antrąja puse gyvenate labai paslaptingą ir keistą gyvenimą.',' Marė yra hebrajų kilmės vardas.'),(1708,'Marčius',' Marčius yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Martynas: Marsas, karo dievas.','Vardo reikšmė: Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais.',' Marčius yra lotynų kilmės vardas.'),(1709,'Marcijonas',' Marcijonas yra Vyriškas vardas.','Trumpa reikšmė: iš Marcus: Marsas, karo dievas.','Vardo reikšmė: Marcijonus valdo Mėnulis, kuris suteikia emocionalumo jausmą ir intuiciją. Mėnulis, žmogaus susidvejinimo ir pasirinkimo simbolis, charakterizuoja vidinio pasaulio pokyčius, likimo charakterį, norus, instinktus, dvasines būsenas, sveikatos būklę, moters įtaką.',' Marcijonas yra lotynų kilmės vardas.'),(1710,'Marcys',' Marcys yra Vyriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Marcelis, Marcelinas ir kt.','Vardo reikšmė: Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais.',' Marcys yra lietuvių kilmės vardas.'),(1711,'Marcelis',' Marcelis yra Vyriškas vardas.','Trumpa reikšmė: iš Marcus: Marsas, karo dievas.','Vardo reikšmė: Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais.',' Marcelis yra lotynų kilmės vardas.'),(1712,'Marcijona',' Marcijona yra Moteriškas vardas.','Trumpa reikšmė: iš Marcus: Marsas, karo dievas.','Vardo reikšmė: Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais.',' Marcijona yra lotynų kilmės vardas.'),(1713,'Marcelinas',' Marcelinas yra Vyriškas vardas.','Trumpa reikšmė: iš Marcus: Marsas, karo dievas.','Vardo reikšmė: Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais.',' Marcelinas yra lotynų kilmės vardas.'),(1714,'Marcelina',' Marcelina yra Moteriškas vardas.','Trumpa reikšmė: iš Marcus: Marsas, karo dievas.','Vardo reikšmė: Kadangi Marcelinų varde vibruoja ir “penketukas”, tai jos visą laiką galvoja, kaip užsidirbti pinigų. Dėl jų gali išduoti net savo įsitikinimus. Mėgsta keliones, labai lengvai išmoksta svetimų kalbų.',' Marcelina yra lotynų kilmės vardas.'),(1715,'Marcelijus',' Marcelijus yra Vyriškas vardas.','Trumpa reikšmė: iš Marcus: Marsas, karo dievas.','Vardo reikšmė: Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais.',' Marcelijus yra lotynų kilmės vardas.'),(1716,'Mąstautė',' Mąstautė yra Moteriškas vardas.','Trumpa reikšmė: mąst- (mąstyti) + taut- (tauta).','Vardo reikšmė: Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs esate tikri romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jūsų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose..',' Mąstautė yra lietuvių kilmės vardas.'),(1717,'Mąstautas',' Mąstautas yra Vyriškas vardas.','Trumpa reikšmė: mąst- (mąstyti) + taut- (tauta).','Vardo reikšmė: Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Jūs esate tikri romantikai ir dažnai įsipainioja į meilės romanus. Aromatinės žvakės, putų vonios, šampanas gamtos kampelyje, rožės ilgais stiebais – jūsų svajonė. Kuo daugiau žaidimų lovoje, tuo daugiau vaikų namuose..',' Mąstautas yra lietuvių kilmės vardas.'),(1718,'Marcelijonas',' Marcelijonas yra Vyriškas vardas.','Trumpa reikšmė: lot., trump. Marcelis, Marcys, Marčius, iš lot. Marcellianus, kuris yra priesagos -anus vedinys iš Marcellus, žr. Marcelis.','Vardo reikšmė: Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. Kartais liekate vienišiais.',' Marcelijonas yra lotynų kilmės vardas.'),(1719,'Marcelė',' Marcelė yra Moteriškas vardas.','Trumpa reikšmė: iš Marcus: Marsas, karo dievas.','Vardo reikšmė: (2) lot., trump. Marcė, tarm. Marcelia piet. aukšt. (dz.), Marcė piet. aukšt., ryt. aukšt., iš lot. Marcella, kuris iš vyr. v. Marcellus, žr. Marcelis',' Marcelė yra lotynų kilmės vardas.'),(1720,'Martys',' Martys yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Martynas – Mars: Marsas, karo dievas.','Vardo reikšmė: Martys – (4) liet. trumpinys iš Martynas ir Martinijonas.',' Martys yra lotynų kilmės vardas.'),(1721,'Martinijonas',' Martinijonas yra Vyriškas vardas.','Trumpa reikšmė: Mars: Marsas, karo dievas.','Vardo reikšmė: Martinijonas – (2) lot., trump. Martys, iš lot. Martiniams, kuris yra priesagos -anus vedinys iš Martinus, žr. Martynas.',' Martinijonas yra lotynų kilmės vardas.'),(1722,'Marcė',' Marcė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Marcelė – iš Marcus: Marsas, karo dievas.','Vardo reikšmė: Vardadienis: Birželio 5 d., liepos 9 d.',' Marcė yra lotynų kilmės vardas.'),(1723,'Martynas',' Martynas yra Vyriškas vardas.','Trumpa reikšmė: iš Mars: Marsas, karo dievas.','Vardo reikšmė: Martynai į gyvenimą žiūri rimtai ir linkę į radikalizmą – arba viskas, arba niekas. Nemėgsta banalumo ir linkę užsiimti tik esminiais klausimais.',' Martynas yra lotynų kilmės vardas.'),(1724,'Martyna',' Martyna yra Moteriškas vardas.','Trumpa reikšmė: iš Mars: Marsas, karo dievas.','Vardo reikšmė: Martynas sunku suprasti ar aprašyti. Jos mato žmones, su kuriais bendrauja, tiesiog kiaurai. Niekada nepraranda kantrybės, apdovanotos retu žmonių supratimu, būna jų paslapčių saugotojos.',' Martyna yra lotynų kilmės vardas.'),(1725,'Marta',' Marta yra Moteriškas vardas.','Trumpa reikšmė: martha „valdovė, viešpatė“.','Vardo reikšmė: Martas sunku suprasti ar aprašyti. Jos mato žmones, su kuriais bendrauja, tiesiog kiaurai. Niekada nepraranda kantrybės, apdovanotos retu žmonių supratimu, būna jų paslapčių saugotojos.',' Marta yra aramėjų kilmės vardas.'),(1726,'Marius',' Marius yra Vyriškas vardas.','Trumpa reikšmė: 1. lietuvių: vedinys iš marios „tas, kuris iš marių“; 2. lotynų mare „jūra“.','Vardo reikšmė: (2) 1. liet., galūnės vedinys iš marios, 2. liet. trumpinys iš lot. Marius, žr. Marijus',' Marius yra lotynų kilmės vardas.'),(1727,'Marinas',' Marinas yra Vyriškas vardas.','Trumpa reikšmė: marinus „jūrų, jūrinis“.','Vardo reikšmė: Marinas – (2) lot., trump. Marys, Marius, iš lot. Marinus: lot. marinus „jūrų, jūrinis“.',' Marinas yra lotynų kilmės vardas.'),(1728,'Marina',' Marina yra Moteriškas vardas.','Trumpa reikšmė: marina „jūrų, jūrinė“.','Vardo reikšmė: Marina – (2) lot., trump. Marė, iš lot- Marina, lot. marina „jūrų, jūrinė“.',' Marina yra lotynų kilmės vardas.'),(1729,'Marijus',' Marijus yra Vyriškas vardas.','Trumpa reikšmė: mare „jūra“.','Vardo reikšmė: Vardadienis: Sausio 19 d., vasario 9 d.',' Marijus yra lotynų kilmės vardas.'),(1730,'Marijonas',' Marijonas yra Vyriškas vardas.','Trumpa reikšmė: iš Marijus: mare „jūra“.','Vardo reikšmė: Marijonai jaučia aštuonetuko vibracijas, todėl jie nori viską daryti su užmoju. Jiems tinka būti vadybininkais, lyderiais arba turėti įspūdingą verslą. Trokšta vesti paskui save kitus, o ne vilktis iš paskos.',' Marijonas yra lotynų kilmės vardas.'),(1731,'Marijona',' Marijona yra Moteriškas vardas.','Trumpa reikšmė: iš dvigubo vargo Maria + Ana.','Vardo reikšmė: Marijona – (2) lot., trump. Marė, Marytė, tarm. Marijonė žem. (Salantai), iš lot. Marianna, kuris kilęs iš dvigubo vardo Maria— Anna.',' Marijona yra hebrajų kilmės vardas.'),(1732,'Marija',' Marija yra Moteriškas vardas.','Trumpa reikšmė: „atkaklioji“.','Vardo reikšmė: Kai kurios Marijos veikia neapgalvotai ir todėl gyvenime patiria daug problemų, pakliūva į aferistų pinkles, paskui labai sielojasi.',' Marija yra hebrajų kilmės vardas.'),(1733,'Margryta',' Margryta yra Moteriškas vardas.','Trumpa reikšmė: vak. liet. trumpinys iš Margarita.','Vardo reikšmė: Margryta – (1) vak. liet. trumpinys iš Margarita.',' Margryta yra lietuvių kilmės vardas.'),(1734,'Mečius',' Mečius yra Vyriškas vardas.','Trumpa reikšmė: kilmingas.','Vardo reikšmė: .',' Mečius yra lietuvių kilmės vardas.'),(1735,'Meda',' Meda yra Moteriškas vardas.','Trumpa reikšmė: medos „midas, persas“.','Vardo reikšmė: graik., iš sulotyninto graik. Meda: graik. medos „midas, persas“',' Meda yra graikų kilmės vardas.'),(1736,'Mečislovas',' Mečislovas yra Vyriškas vardas.','Trumpa reikšmė: meč „kalavijas“ + slava „šlovė“ – „kalaviju pasiekęs šlovę“.','Vardo reikšmė: Mečislovai atrodo paslaptingi ir rimti žmonės. Jie kartais užsidaro savyje. Tai inteligentai, turintys aristokratiškų bruožų asmenybės. Mėgsta knygas. Jie geri mokytojai, vienuoliai arba valstybės tarnautojai.',' Mečislovas yra slavų kilmės vardas.'),(1737,'Mažvilė',' Mažvilė yra Moteriškas vardas.','Trumpa reikšmė: maž- (mažas, mažai) + vil- (viltis) – „mažai besiviliantis“.','Vardo reikšmė: (1), (2) liet., trump. Mažvė, Vilė, iš vyr. v. Mažvilas',' Mažvilė yra lietuvių kilmės vardas.'),(1738,'Mažvilas',' Mažvilas yra Vyriškas vardas.','Trumpa reikšmė: maž- (mažas, mažai) + vil- (viltis) – „mažai besiviliantis“.','Vardo reikšmė: Mažvilas – (1) liet., trump. Mažvys, maž- (žr. Mažrimas) + vil- (žr. Mantvilas).',' Mažvilas yra lietuvių kilmės vardas.'),(1739,'Mažvydas',' Mažvydas yra Vyriškas vardas.','Trumpa reikšmė: maž- (mažas, mažai) + vyd- (iš-vydo) – „mažai matęs“.','Vardo reikšmė: Mažvydai geri meno žinovai. Kai kurie turi mediumo savybių. Mėgsta operą, ryškias spalvas ir gražius daiktus. Jie dažniausiai būna rašytojai, aktoriai, mokytojai, sportininkai, leidybininkai.',' Mažvydas yra lietuvių kilmės vardas.'),(1740,'Mažrimas',' Mažrimas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Mažrys, maž- (: liet. maž-as, maž-ai) + rim- (žr. Mantrimas).','Vardo reikšmė: Mažrimas – (1) liet., trump. Mažrys, maž- (: liet. maž-as, maž-ai) + rim- (žr. Mantrimas).',' Mažrimas yra lietuvių kilmės vardas.'),(1741,'Mažrimė',' Mažrimė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Mažrė, iš vyr. v. Mažrimas.','Vardo reikšmė: Mažrimė – (1) liet., trump. Mažrė, iš vyr. v. Mažrimas.',' Mažrimė yra lietuvių kilmės vardas.'),(1742,'Mauricijus',' Mauricijus yra Vyriškas vardas.','Trumpa reikšmė: maurus „tamsiaodis“.','Vardo reikšmė: Mauricijus – (1) lot., trump. Mauricius, Mauricis, Mauras, iš lot. Mauritius, Mauricius, kuris yra priesaginis vedinys iš lot. vardo Maurus, žr. Mauras.',' Mauricijus yra lotynų kilmės vardas.'),(1743,'Mauras',' Mauras yra Vyriškas vardas.','Trumpa reikšmė: maurus „tamsiaodis“.','Vardo reikšmė: Šiems vardų turėtojamss labai gerai sekasi turtiniuose reikaluose, ir jie triumfuoja investavę į labai brangius projektus. Jie stichiški ir plačių užmojų žmonės, kurių veiksmus sunku numatyti. Tai visų darbų meistrai ! Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės.',' Mauras yra lotynų kilmės vardas.'),(1744,'Matilda',' Matilda yra Moteriškas vardas.','Trumpa reikšmė: macht „galia“ + hiltja „kova“.','Vardo reikšmė: Matildoms patartina vengti skubių sprendimų, impulsyvių veiksmų; geriau viską apgalvoti ir tik “septynis kartus atmatavus”, nukirpti. Dvasinė ramybė turėtų ateiti per ramybę ir namų židinį',' Matilda yra vokiečių kilmės vardas.'),(1745,'Matas',' Matas yra Vyriškas vardas.','Trumpa reikšmė: „Dievo dovana“.','Vardo reikšmė: Matai – pasilinksminimų mėgėjai. Jie nepaprastai liberalūs ir stengiasi savo vaikams įdiegti altruizmą, meilę laisvei bei pagarbą aplinkiniams. Jie savo dvasia visada jauni, atviraširdžiai ir truputį naivoki, todėl randa kalbą su visais.',' Matas yra hebrajų kilmės vardas.'),(1746,'Mąstvilas',' Mąstvilas yra Vyriškas vardas.','Trumpa reikšmė: mąst- (mąstyti) + vil- (viltis).','Vardo reikšmė: Mąstvilas – (1) liet., trump. Mąstys, mąst- (žr. Mąstautas) + vil- (žr. Mantvilas).',' Mąstvilas yra lietuvių kilmės vardas.'),(1747,'Mėgotas',' Mėgotas yra  vardas.','Trumpa reikšmė: suliet. prūs., trump. Mėgys, priesagos -otas vedinys iš aen. avd. Mėgys.','Vardo reikšmė: Mėgotas – (1) suliet. prūs., trump. Mėgys, priesagos -otas vedinys iš aen. avd. Mėgys.',' Mėgotas yra prūsų kilmės vardas.'),(1748,'Mėgys',' Mėgys yra Vyriškas vardas.','Trumpa reikšmė: liet.: liet. mėg-ti, mėg-o.','Vardo reikšmė: Mėgys – (4) liet.: liet. mėg-ti, mėg-o.',' Mėgys yra lietuvių kilmės vardas.'),(1749,'Medvilė',' Medvilė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Medė, iš vyr. v. Medvilas.','Vardo reikšmė: Jūs labai stiprus, valingas, kartais tiesiog nesuvaldomas charakteris, kuris pasireiškia visose gyvenimo sferose, taip pat ir su moterimis. Norėdami pasiekti savo, jie naudoja įvairius būdus, sugeba būti klastingi ir apgaunantys, dažnai tokiu elgesiu susikuria sau sunkumų ten, kur jų nėra.',' Medvilė yra lietuvių kilmės vardas.'),(1750,'Medvilas',' Medvilas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Medys, med- (žr. Medginas) + vil- (žr. Mantvilas).','Vardo reikšmė: Medvilas – (1) liet., trump. Medys, med- (žr. Medginas) + vil- (žr. Mantvilas).',' Medvilas yra lietuvių kilmės vardas.'),(1751,'Miglovaras',' Miglovaras yra Vyriškas vardas.','Trumpa reikšmė: liet., iš aušrininko poeto Juozo Miliausko slapyvardžio Miglovara: miglo- (: liet. migla) + var- (: liet. varyti).','Vardo reikšmė: Miglovaras – (1) liet., iš aušrininko poeto Juozo Miliausko slapyvardžio Miglovara: miglo- (: liet. migla) + var- (: liet. varyti).',' Miglovaras yra lietuvių kilmės vardas.'),(1752,'Medvaišas',' Medvaišas yra Vyriškas vardas.','Trumpa reikšmė: „kaimas“.','Vardo reikšmė: Medvaišas – (1) liet., trump. Medys, med- (žr. Medginas) + vaiš- (: liet. vaiš-ės, plg. viešas, viešė „kiemas, kaimas“ ir sen. indų vis- „namas“, got. weihs „kaimas“).',' Medvaišas yra lietuvių kilmės vardas.'),(1753,'Miglė',' Miglė yra Moteriškas vardas.','Trumpa reikšmė: migla „rūkas“.','Vardo reikšmė: Miglės gyvenime siekia visapusiško idealumo, nors pačios gyvenime turi daug negatyvaus. Pavyzdžiui, jos įsitikinusios, kad niekas kitas nepadarys darbo geriau už jas. Kartais jos tampa tiesiog furijomis, tačiau tai pasitaiko rečiau. Jos nepriima bet kokios kritikos jų adresu.',' Miglė yra lietuvių kilmės vardas.'),(1754,'Medūnas',' Medūnas yra Vyriškas vardas.','Trumpa reikšmė: liet. ir prūs., trump. Medys, priesagos -ūnas vedinys iš sen. trumpinio Medas, kuris iš avd. su Med-: Medginas, Medvaišas ir k.','Vardo reikšmė: Šie vardo turėtojai mėgsta skaniai ir sočiai pavalgyti bei išgerti. Gali piktnaudžiauti seksu ir narkotikais. Jie turi talentą generuoti naujas idėjas; puikios rankos. Mėgsta visa, kas nauja ir neištirta. Jie protingi, tačiau mąstymo procesas, kaip ir pats gyvenimas, neorganizuotas ir išbarstytas.',' Medūnas yra lietuvių kilmės vardas.'),(1755,'Michalina',' Michalina yra Moteriškas vardas.','Trumpa reikšmė: „kas yra kaip dievas“.','Vardo reikšmė: Šie vardo turėtojai nuo vaikystės svajoja apie tolimus kraštus, naujas keliones ir egzotiką. Jie norėtų išbandyti gyvenime nors vieną kartą viską. Jiems visas gyvenimas – žaidimų aikštelė. Tokia nuostata gali jiems daug kainuoti, nes gali išsekti savi resursai – biologiniai ar socialiniai.',' Michalina yra hebrajų kilmės vardas.'),(1756,'Metodijus',' Metodijus yra Vyriškas vardas.','Trumpa reikšmė: „tyrinėtojas“.','Vardo reikšmė: Jūs – laisvi žmonės, kurie mėgsta permainas, nuotykius ir pasilinksminimus. Jie saugo savo laisvę ir, kaip paukštis be sparnų, negali egzistuoti be jos. Jie labai lengvai prisitaiko. Permainos – jiems malonumas, o bet koks trukdymas – katastrofa.',' Metodijus yra graikų kilmės vardas.'),(1757,'Medys',' Medys yra Vyriškas vardas.','Trumpa reikšmė: liet., žr. Medas.','Vardo reikšmė: Šie vardo turėtojai mėgsta skaniai ir sočiai pavalgyti bei išgerti. Gali piktnaudžiauti seksu ir narkotikais. Jie turi talentą generuoti naujas idėjas; puikios rankos. Mėgsta visa, kas nauja ir neištirta. Jie protingi, tačiau mąstymo procesas, kaip ir pats gyvenimas, neorganizuotas ir išbarstytas.',' Medys yra lietuvių kilmės vardas.'),(1758,'Milgaudas',' Milgaudas yra Vyriškas vardas.','Trumpa reikšmė: mil- (pa-milo) + gaud- (gaudyti) – „mylimas ir gaudomas“.','Vardo reikšmė: Jūs – laisvi žmonės, kurie mėgsta permainas, nuotykius ir pasilinksminimus. Jie saugo savo laisvę ir, kaip paukštis be sparnų, negali egzistuoti be jos. Jie labai lengvai prisitaiko. Permainos – jiems malonumas, o bet koks trukdymas – katastrofa.',' Milgaudas yra lietuvių kilmės vardas.'),(1759,'Medgintas',' Medgintas yra Vyriškas vardas.','Trumpa reikšmė: „užstoti“.','Vardo reikšmė: Šie vardo turėtojai mėgsta skaniai ir sočiai pavalgyti bei išgerti. Gali piktnaudžiauti seksu ir narkotikais. Jie turi talentą generuoti naujas idėjas; puikios rankos. Mėgsta visa, kas nauja ir neištirta. Jie protingi, tačiau mąstymo procesas, kaip ir pats gyvenimas, neorganizuotas ir išbarstytas.',' Medgintas yra lietuvių kilmės vardas.'),(1760,'Mėta',' Mėta yra Moteriškas vardas.','Trumpa reikšmė: liet.: liet. mėta.','Vardo reikšmė: .',' Mėta yra lietuvių kilmės vardas.'),(1761,'Merūnas',' Merūnas yra Vyriškas vardas.','Trumpa reikšmė: mer- (merėti „liūdėti, rūpintis, geisti“) + -ūn- – „besirūpinantis, besiilgintis“.','Vardo reikšmė: Jūs galite dirbti bet kokioje srityje, kur tik reikia protingai elgtis su pinigais. Jūs atkakliu darbu užsidirbate savo pinigus ir nesiimate lošti nesąžiningų žaidimų.',' Merūnas yra lietuvių kilmės vardas.'),(1762,'Milė',' Milė yra Moteriškas vardas.','Trumpa reikšmė: lietuvių kalbos trumpinys iš vardų Milbartė, Milbutė ir kt..','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Netgi nereikšmingos užduotys jų akimis įgyja pirmaeilės svarbos.',' Milė yra lietuvių kilmės vardas.'),(1763,'Medginas',' Medginas yra vyriškas vardas.','Trumpa reikšmė: „užstoti“.','Vardo reikšmė: Ypač rūpi buities problemos ir savojo “Aš” pažinimas. Turi labai stiprius jausmus, užjaučia draugus ir artimuosius. Kartais jiems sunku bendrauti su aplinkiniais, tačiau įgimtas protas visada padeda. Tie, kurie išdrįsta su jais užmegzti draugystę, niekada nebūna atstumti.',' Medginas yra lietuvių kilmės vardas.'),(1764,'Milda',' Milda yra Moteriškas vardas.','Trumpa reikšmė: mildingai „draugiškai, meiliai“, lietuvių pagonių Meilės ir meilinimosi deivė.','Vardo reikšmė: (1) liet., iš vieno T. Narbuto minimos sen. liet. „meilės ir meilinimosi deivės“ vardo Milda: sen. liet. mild-ingai „draugiškai“ (vieno Doričiaus iš Marcinkonių užrašytas žodis), jotv. mild-at „mylėti“',' Milda yra lietuvių kilmės vardas.'),(1765,'Merkys',' Merkys yra Vyriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Pagrindinis jūsų bruožas – magnetizmas. Jūs stengiatės atitikti maksimalų galimybių potencialą. Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems. ',' Merkys yra lietuvių kilmės vardas.'),(1766,'Merkelis',' Merkelis yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Melchioras: „šviesos valdovas“.','Vardo reikšmė: Šis vardas Merkelis turėtų priklausyti žmogui, kuriam labai svarbūs yra namai. Jis ko gero daug laiko skirs namų puoselėjimui, palaikymui bei įrengimui. Greičiausiai šiam vyrui tiktų posakis “mano namai-mano tvirtovė”. ',' Merkelis yra hebrajų, prancūzų kilmės vardas.'),(1767,'Milbutė',' Milbutė yra Moteriškas vardas.','Trumpa reikšmė: lietuvių kalbos trumpinys: Milė, kuris kildinamas iš vyriško vardo Milbutas..','Vardo reikšmė: Finansine prasme, tai vardas skatinantis šiokį tokį savanaudiškumą. Priešingai, tai gali būti žmogus gerai skaičiuojantis pinigus.',' Milbutė yra lietuvių kilmės vardas.'),(1768,'Medenis',' Medenis yra Vyriškas vardas.','Trumpa reikšmė: priesagos -enis vedinys iš sen. trumpinio Medys, kuris iš vardų prasidedančių šaknimi su Med- : Medginas, Medvaišas ir kt..','Vardo reikšmė: Žmogus Medenio vardu ko gero turės pakankamai ištvermės, kad galėtų suvaldyti nuosavą verslą. Vardas gali būti ypač sėkmingas menininkams, poetams, muzikantams ir šokėjams.',' Medenis yra lietuvių kilmės vardas.'),(1769,'Milbutas',' Milbutas yra Vyriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Finansine prasme, tai vardas skatinantis šiokį tokį savanaudiškumą. Priešingai, tai gali būti žmogus gerai skaičiuojantis pinigus.',' Milbutas yra lietuvių kilmės vardas.'),(1770,'Miltaras',' Miltaras yra Vyriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Miltarai – aštrialiežuviai, linksmi, išradingi ir nesugebate nė minutei būti ramūs. Jūs esate visų mylimi, aplinkiniai negali atsispirti jūsų spinduliuojam geriui. ',' Miltaras yra lietuvių kilmės vardas.'),(1771,'Melita',' Melita yra Moteriškas vardas.','Trumpa reikšmė: melitta „bitė“.','Vardo reikšmė: Vardadienis: Gruodžio mėn. 1 d. – Melitos vardo diena.',' Melita yra graikų kilmės vardas.'),(1772,'Medas',' Medas yra Vyriškas vardas.','Trumpa reikšmė: sulietuvintas prusų kilmės vardas: Medys lietuvių - trumpinys iš vardų, kurių šaknis Med- : Medginas, Medvaišas ir kt..','Vardo reikšmė: Vardadienis: Sausio mėn. 12 d. – Medo vardo diena.',' Medas yra lietuvių, prūsų kilmės vardas.'),(1773,'Milbartė',' Milbartė yra Moteriškas vardas.','Trumpa reikšmė: mil- (pa-milo) + bart- (arti „kovoti“, plg rusų borotsia) – „tas, kuris mylimas, dėl kurio meilės kovojama“.','Vardo reikšmė: Gera intuicija leidžia planuoti tolimą ateitį. Labai mokate prisiderinti prie žymiausių autoritetų. jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai.',' Milbartė yra lietuvių kilmės vardas.'),(1774,'Melė',' Melė yra Moteriškas vardas.','Trumpa reikšmė: lietuviškas trumpinys iš vardų: Amelija ir Melanija..','Vardo reikšmė: Vardadienis: Gruodžio mėn. 28 d. – Melės vardo diena.',' Melė yra lietuvių kilmės vardas.'),(1775,'Milbartas',' Milbartas yra Vyriškas vardas.','Trumpa reikšmė: mil- (pa-milo) + bart- (arti „kovoti“, plg rusų borotsia) – „tas, kuris mylimas, dėl kurio meilės kovojama“.','Vardo reikšmė: Gera intuicija leidžia planuoti tolimą ateitį. Labai mokate prisiderinti prie žymiausių autoritetų. jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai.',' Milbartas yra lietuvių kilmės vardas.'),(1776,'Melchioras',' Melchioras yra Vyriškas vardas.','Trumpa reikšmė: „šviesos valdovas“.','Vardo reikšmė: Jeigu jums nepasiseka atsidurti valdžioje ir turėti bent keletą pavaldinių, jaučiatės nepasiekę tikslo. Šie vardo turėtojai paklūsta griežtai disciplinai ir to paties reikalauja iš kitų. Dominuodami jie nesugeba įsiklausyti į kitų nuomonę girdi tik save.',' Melchioras yra hebrajų kilmės vardas.'),(1777,'Medardas',' Medardas yra Vyriškas vardas.','Trumpa reikšmė: macht „galia“ + hart „stiprus“ – „stiprios galios“.','Vardo reikšmė: Gera intuicija leidžia planuoti tolimą ateitį. Labai mokate prisiderinti prie žymiausių autoritetų. jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai.',' Medardas yra vokiečių kilmės vardas.'),(1778,'Milotas',' Milotas yra Vyriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Milius, priesagos -otas vedinys iš sen. trump. Milius, kuris iš avd. su Mil-: Milbutas, Milgaudas, Milmantas ir kt..','Vardo reikšmė: Niekas ir niekada neturi kėsintis į Jūsų laisvę ar kaip kitaip varžyti.',' Milotas yra lietuvių, prūsų kilmės vardas.'),(1779,'Milnoras',' Milnoras yra Vyriškas vardas.','Trumpa reikšmė: mil- (pa-milti) + nor- (norėti) – „mylimas ir norimas“.','Vardo reikšmė: Jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai.',' Milnoras yra lietuvių kilmės vardas.'),(1780,'Melanijus',' Melanijus yra Vyriškas vardas.','Trumpa reikšmė: „tamsus, juodbruvis“.','Vardo reikšmė: Melanijai rūpinasi materialine ateitimi, apie tai, kas būtina pasiturinčiam gyvenimui, ir tai jiems sekasi gana gerai, nes jie tikri finansų genijai; žino, kur taupyti ir kaip paskirstyti pinigus.',' Melanijus yra graikų kilmės vardas.'),(1781,'Milkantas',' Milkantas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Milius, mil- (žr. Milbartas) + kant- (: liet. pa-kant-us, kant-rus)..','Vardo reikšmė: Vardadienis: Lapkričio mėn. 30 d. – Milkanto vardo diena.',' Milkantas yra lietuvių kilmės vardas.'),(1782,'Mykolė',' Mykolė yra Moteriškas vardas.','Trumpa reikšmė: „kas yra kaip dievas“..','Vardo reikšmė: Gera intuicija leidžia planuoti tolimą ateitį. Labai mokate prisiderinti prie žymiausių autoritetų. jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai.',' Mykolė yra hebrajų kilmės vardas.'),(1783,'Melanija',' Melanija yra Moteriškas vardas.','Trumpa reikšmė: „tamsi, juodbruvė“.','Vardo reikšmė: Melanijos rūpinasi materialine ateitimi, apie tai, kas būtina pasiturinčiam gyvenimui, ir tai jiems sekasi gana gerai, nes jie tikri finansų genijai; žino, kur taupyti ir kaip paskirstyti pinigus.',' Melanija yra graikų kilmės vardas.'),(1784,'Minbartė',' Minbartė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Minė, iš vyr. v. Minbartas..','Vardo reikšmė: Gera intuicija leidžia planuoti tolimą ateitį. Labai mokate prisiderinti prie žymiausių autoritetų. jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai.',' Minbartė yra lietuvių kilmės vardas.'),(1785,'Mikolė',' Mikolė yra Moteriškas vardas.','Trumpa reikšmė: „kas yra kaip dievas“.','Vardo reikšmė: (2) graik., trump. Mikė, iš sulotyninto graik. Nicola, kuris iš vyr. v. Nicolaus, žr. Mikalojus',' Mikolė yra hebrajų kilmės vardas.'),(1786,'Mykolas',' Mykolas yra Vyriškas vardas.','Trumpa reikšmė: „kas yra kaip dievas“..','Vardo reikšmė: Turite sugebėjimų veikti jus supančią aplinką.',' Mykolas yra hebrajų kilmės vardas.'),(1787,'Meilė',' Meilė yra Moteriškas vardas.','Trumpa reikšmė: meilė.','Vardo reikšmė: Gera intuicija leidžia planuoti tolimą ateitį. Labai mokate prisiderinti prie žymiausių autoritetų. jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai.',' Meilė yra lietuvių kilmės vardas.'),(1788,'Milius',' Milius yra Vyriškas vardas.','Trumpa reikšmė: liet., trumpinys iš avd. su Mil-: Milbutas, Milgaudas, Milvydas ir kt..','Vardo reikšmė: Turi blogybių. Viena iš jų – polinkis į egoizmą. Kartais gali būti ryžtingi, o kartais tiesiog užsispyrę. Dažnai kritikuoja kitus, teikdami, kad anie neturi ryžto. Todėl toks iškreiptas supratimas gali atstumti juos nuo draugų ir šeimos narių.',' Milius yra lietuvių kilmės vardas.'),(1789,'Mikita',' Mikita yra Moteriškas vardas.','Trumpa reikšmė: žr. Nicetas.','Vardo reikšmė: Vardadienis: Gruodžio mėn. 11d. – Mikitos vardo diena.',' Mikita yra lietuvių kilmės vardas.'),(1790,'Milgintas',' Milgintas yra Vyriškas vardas.','Trumpa reikšmė: mil- (pa-milo) + gint- (ginti) – „mylimas ir apgintas“.','Vardo reikšmė: Milgintai gali turėti gydymo galių ir stipriai traukti moterų dėmesį.',' Milgintas yra lietuvių kilmės vardas.'),(1791,'Minalgė',' Minalgė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Minė, iš vyr. v. Minalgas..','Vardo reikšmė: Minalgės turtus kraunasi rizikuodami finansinėmis akcijomis ir įkyriomis avantiūromis. Netgi patyrę pralaimėjimą, tokie žmonės sugeba vėl atkurti save. Pavojaus minutėmis jų fizinės jėgos labai padidėja.',' Minalgė yra lietuvių kilmės vardas.'),(1792,'Mikas',' Mikas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Mykolas: „kas yra kaip dievas“.','Vardo reikšmė: Abejonės, dvejonės, nepasitikėjimas kitų sprendimais ir išankstinės nuomonės susidarymas gali būti vardo nešiotojo bruožais.',' Mikas yra hebrajų kilmės vardas.'),(1793,'Minalgas',' Minalgas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Minas, Minius, min- (: liet. min-ėti, min-ti, mena) + alg- (: liet. alg-a „atpildas, atlyginimas“, prūs. algas „t.p.“)..','Vardo reikšmė: Minalgai turtus kraunasi rizikuodami finansinėmis akcijomis ir įkyriomis avantiūromis. Netgi patyrę pralaimėjimą, tokie žmonės sugeba vėl atkurti save. Pavojaus minutėmis jų fizinės jėgos labai padidėja.',' Minalgas yra lietuvių kilmės vardas.'),(1794,'Mikalojus',' Mikalojus yra Vyriškas vardas.','Trumpa reikšmė: „kas yra kaip dievas“.','Vardo reikšmė: Gyvenime dažnai gali pasitaikyti momentų, kai reikės suprasti, jog tobulų nėra ir nesitikėti, jog viskas bus taip kaip jis nori.',' Mikalojus yra hebrajų kilmės vardas.'),(1795,'Milgydė',' Milgydė yra Moteriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Milė, iš vyr. v. Milgydas..','Vardo reikšmė: Tai žmogus, kuris jausis laimingu darydamas gera kitiems, ypač silpnesniems už save. Jis sugebės atjausti kitą, tačiau giliai viduje pats trokš meilės ir įvertinimo.',' Milgydė yra lietuvių kilmės vardas.'),(1796,'Milvinas',' Milvinas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Milius, mil- (žr. Miltautas) + vin- (žr. Mantvinas).','Vardo reikšmė: Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Rūpinimasis kitais, mokėjimas spręsti sudėtingus klausimus ir pedagoginis talentas gali jus išskirti iš minios. Jums reikės mokytis suvaldyti pyktį ir norą priimti staigius ir nepamatuotus sprendimus bei norą pasiduoti..',' Milvinas yra lietuvių kilmės vardas.'),(1797,'Minginas',' Minginas yra Vyriškas vardas.','Trumpa reikšmė: lietuviško vardo trumpiniai: Minas, Mingas, min- (žr. Mindaugas) + gin- (žr. Medginas)..','Vardo reikšmė: Šie vardo turėtojai labai myli vaikus – tiek savus, tiek svetimus, tačiau be didesnio sentimentalumo. Vaikai jums – tas pats kas ir suaugę, tik laimingas vaikas turi savyje daugiau džiaugsmo, lūkesčių ateičiai.',' Minginas yra lietuvių kilmės vardas.'),(1798,'Milgydas',' Milgydas yra Vyriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Milius, mil- (žr. Milbartas) + gyd- (: prūs. sen-gid-aut „gauti, pasiekti“, kuris su balsių kaita iš geid-, plg. geisti, geidė, geidauti „ilgėtis“).','Vardo reikšmė: Milgydas – tai žmogus, kuris jausis laimingu darydamas gera kitiems, ypač silpnesniems už save. Jis sugebės atjausti kitą, tačiau giliai viduje pats trokš meilės ir įvertinimo.',' Milgydas yra lietuvių, prūsų kilmės vardas.'),(1799,'Milvydas',' Milvydas yra Vyriškas vardas.','Trumpa reikšmė: mil- (pa-milo) + vyd- (išvydo).','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas.',' Milvydas yra lietuvių kilmės vardas.'),(1800,'Milgeidas',' Milgeidas yra Vyriškas vardas.','Trumpa reikšmė: sulietuvintas prūsų trumpinys - Milius, mil- (žr. Milbartas) + geid- (: liet. geid-ė, geisti, geid-auti).','Vardo reikšmė: Šie vardo turėtojai labai myli vaikus – tiek savus, tiek svetimus, tačiau be didesnio sentimentalumo. Vaikai jums – tas pats kas ir suaugę, tik laimingas vaikas turi savyje daugiau džiaugsmo, lūkesčių ateičiai.',' Milgeidas yra lietuvių, prūsų kilmės vardas.'),(1801,'Mingėlas',' Mingėlas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Minius, Mingas, min- (žr. Mindaugas) + gėl- (žr. Mangėlas)..','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Netgi nereikšmingos užduotys jų akimis įgyja pirmaeilės svarbos.',' Mingėlas yra lietuvių kilmės vardas.'),(1802,'Mingedas',' Mingedas yra Vyriškas vardas.','Trumpa reikšmė: min- (minėti) + ged- (gedėti „ilgėtis“) – „tas, kuris minimas, kurio ilgimasi“.','Vardo reikšmė: Vardadienis: Vasario mėn. 6 d. – Mingedo vardo diena.',' Mingedas yra lietuvių kilmės vardas.'),(1803,'Milgedas',' Milgedas yra Vyriškas vardas.','Trumpa reikšmė: mil- (pa-milo) + ged- (gedėti „ilgėtis“) – „mylintis ir besiilgintis“.','Vardo reikšmė: (1) liet. ir prūs., trump. Milius, mil- (žr. Milbartas) + ged- (: liet. ged-auti „ilgėtis“, ged-ėti)',' Milgedas yra lietuvių kilmės vardas.'),(1804,'Milvardas',' Milvardas yra Vyriškas vardas.','Trumpa reikšmė: liet. trump. Milius, mil- (žr. Miltautas) + vard- (: liet. vard-as, latv. vards, vard-uoti)..','Vardo reikšmė: Vardadienis: Gegužės mėn. 26 d. – Milvardo vardo diena.',' Milvardas yra lietuvių kilmės vardas.'),(1805,'Mingaudas',' Mingaudas yra Vyriškas vardas.','Trumpa reikšmė: min- (minėti) + gaud- (gaudyti) – „minimas ir gaudomas (geidžiamas)“.','Vardo reikšmė: Jūs mielai pasirenkate pramogų vadovo postą. Loginis mąstymas atveria kelią į mokslinį darbą. ',' Mingaudas yra lietuvių kilmės vardas.'),(1806,'Milvainė',' Milvainė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Milė, iš vyriško vardo Milvainas..','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Pagrindinis jūsų bruožas – magnetizmas. Jūs stengiatės atitikti maksimalų galimybių potencialą. Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems.',' Milvainė yra lietuvių kilmės vardas.'),(1807,'Mingailė',' Mingailė yra Moteriškas vardas.','Trumpa reikšmė: min- (minėti) + gail- (gailas „stiprus“) – „minimas kaip stipruolis“.','Vardo reikšmė: Jūs nemokate ilgai sėdėti ar būti vienoje vietoje – tuojau imate vaikštinėti po kambarį, perstatinėjate kėdes.',' Mingailė yra lietuvių kilmės vardas.'),(1808,'Mingailas',' Mingailas yra Vyriškas vardas.','Trumpa reikšmė: min- (minėti) + gail- (gailas „stiprus“) – „minimas kaip stipruolis“.','Vardo reikšmė: Kartais Jūs elgiatės nenuspėjamai, kalbate šiurkščiai. Stengdamiesi pajungti žmones savo valiai, jie į kairę ir dešinę svaido “vertingus” nurodymus. Jums patinka kirsti iš peties, ir tokiomis minutėmis jūs galite priminti įsiutusį bulių.',' Mingailas yra lietuvių kilmės vardas.'),(1809,'Miltautė',' Miltautė yra moteriškas vardas.','Trumpa reikšmė: šio vardo lietuviškas trumpinys - Milė, iš vyriško vardo Miltautas.','Vardo reikšmė: Jos emocijas slepia viduje, o tai greitai atsiliepia į jų sveikatą – virškinimo ir nervų sistemoms.',' Miltautė yra lietuvių kilmės vardas.'),(1810,'Miltautas',' Miltautas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Milius, mil- (: liet. pa-mil-ti, pa-mil-o) + taut- (: liet. taut-a)..','Vardo reikšmė: Jie emocijas slepia viduje, o tai greitai atsiliepia į jų sveikatą – virškinimo ir nervų sistemoms.',' Miltautas yra lietuvių kilmės vardas.'),(1811,'Mindaugė',' Mindaugė yra Moteriškas vardas.','Trumpa reikšmė: min- (minėti) + daug- (daug) – „daugelio minimas, garsus“.','Vardo reikšmė: Vardo nešiotojas gali būti ypač energingas, dominuojantis ir linkęs elgtis azartiškai. Nepaisant to, finansinis saugumas visada bus vienas iš jo gyvenimo prioritetų.',' Mindaugė yra lietuvių kilmės vardas.'),(1812,'Mintautas',' Mintautas yra Vyriškas vardas.','Trumpa reikšmė: min- (minėti) + taut- (taut) – „tautos minimas“.','Vardo reikšmė: Jūs puikiausiai suprantate savo prasižengimus šiame pasaulyje, tačiau anapusinis pasaulis jūsų nedomina.',' Mintautas yra lietuvių kilmės vardas.'),(1813,'Mintas',' Mintas yra Vyriškas vardas.','Trumpa reikšmė: min- (minėti) – „minimas, minima“.','Vardo reikšmė: Vardo nešiotojas gali būti ypač energingas, dominuojantis ir linkęs elgtis azartiškai. Nepaisant to, finansinis saugumas visada bus vienas iš jo gyvenimo prioritetų.',' Mintas yra lietuvių kilmės vardas.'),(1814,'Mindaugas',' Mindaugas yra Vyriškas vardas.','Trumpa reikšmė: min- (minėti) + daug- (daug) – „daugelio minimas, garsus“.','Vardo reikšmė: Vardo nešiotojas gali būti ypač energingas, dominuojantis ir linkęs elgtis azartiškai. Nepaisant to, finansinis saugumas visada bus vienas iš jo gyvenimo prioritetų.',' Mindaugas yra lietuvių kilmės vardas.'),(1815,'Mindas',' Mindas yra Vyriškas vardas.','Trumpa reikšmė: liet., trumpinys iš Mindaugas..','Vardo reikšmė: Vardadienis: Liepos mėn. 13 d. – Mindo vardo diena.',' Mindas yra lietuvių kilmės vardas.'),(1816,'Mintartas',' Mintartas yra Vyriškas vardas.','Trumpa reikšmė: .','Vardo reikšmė: Vardo nešiotojas gali būti ypač energingas, dominuojantis ir linkęs elgtis azartiškai. Nepaisant to, finansinis saugumas visada bus vienas iš jo gyvenimo prioritetų.',' Mintartas yra lietuvių kilmės vardas.'),(1817,'Minė',' Minė yra Moteriškas vardas.','Trumpa reikšmė: liet., galūnės vedinys iš vyr. v. Minas, Minius, taip pat trumpinys iš mot. vardų su Min-: Minbutė, Minkantė, Minvainė ir kt..','Vardo reikšmė: Žmogus šiuo vardu ko gero turės pakankamai ištvermės, kad galėtų suvaldyti nuosavą verslą. Vardas gali būti ypač sėkmingas menininkams, poetams, muzikantams ir šokėjams.',' Minė yra lietuvių kilmės vardas.'),(1818,'Minbutė',' Minbutė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Minė, iš vyriško vardo Minbutas..','Vardo reikšmė: Vardadienis: Rugsėjo mėn. 18 d. – Minbutės vardo diena.',' Minbutė yra lietuvių kilmės vardas.'),(1819,'Mintaras',' Mintaras yra Vyriškas vardas.','Trumpa reikšmė: min- (minėti) + tar- (tarti) – „tas, kurios vardas minimas, tariamas“.','Vardo reikšmė: (1) liet., trump. Minius, Mintas, min- (žr. Mindaugas) + tar- (: liet. tar-ti, tar-ia)',' Mintaras yra lietuvių kilmės vardas.'),(1820,'Minbutas',' Minbutas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Minas, Minius, min-(žr. Minalgas) + but- (žr. Milbutas)..','Vardo reikšmė: Vardadienis: Rugsėjo mėn. 18 d. – Minbuto vardo diena.',' Minbutas yra lietuvių kilmės vardas.'),(1821,'Minotas',' Minotas yra Vyriškas vardas.','Trumpa reikšmė: sulietuvinti prūsiški trumpiniai: Minas, Minius, priesagos -otas vedinys iš sen. trumpinio Minas, kuris iš asmenvardžių su Min-: Minalgas, Mingaudas, Minvydas ir kt..','Vardo reikšmė: Geri matematikai; politikoje jie agitatoriai ir demagogai, dažniausiai – tarpininkai, tačiau kartais jiems pavyksta ir kūrimas.',' Minotas yra lietuvių kilmės vardas.'),(1822,'Minmantė',' Minmantė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Minė, iš vyr. v. Minmantas..','Vardo reikšmė: Minmantė – tai moteris, kuri ieško meilės, namų ir šeimos židinio, tačiuo tuo pačiu nori būti ir viso to centre. Jūs trokštate, kad jus suptų grožis, komfortas, muzika, harmonija ir taika. O pati nuostabiausia savybė, kuria kiti dievina, tai noras padėti žmonėms, netgi jei to niekas ir neprašo.',' Minmantė yra lietuvių kilmės vardas.'),(1823,'Minmantas',' Minmantas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Minas, Minius, min- (žr. Mindaugas) + mant- (žr. Mantartas)..','Vardo reikšmė: Mėgsta padėti žmonėms, netgi jei to niekas ir neprašo.',' Minmantas yra lietuvių kilmės vardas.'),(1824,'Minkantas',' Minkantas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Minas, Minius, min- (žr. Mindaugas) + kant- (žr. Milkantas)..','Vardo reikšmė: Mėgsta padėti žmonėms, netgi jei to niekas ir neprašo.',' Minkantas yra lietuvių kilmės vardas.'),(1825,'Mirga',' Mirga yra Moteriškas vardas.','Trumpa reikšmė: mirgėti „šviesti tamsoje“ – „nušviečianti kelią, išsiskirianti žibėjimu“.','Vardo reikšmė: Permainos – jiems malonumas, o bet koks trukdymas – katastrofa.',' Mirga yra lietuvių kilmės vardas.'),(1826,'Minžadas',' Minžadas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Minas, Minius, min- (žr. Mindaugas) + žad- (: liet. žad-ėti)..','Vardo reikšmė: Jūs galite dirbti bet kokioje srityje, kur tik reikia protingai elgtis su pinigais. Jūs atkakliu darbu užsidirbate savo pinigus ir nesiimate lošti nesąžiningų žaidimų.',' Minžadas yra lietuvių kilmės vardas.'),(1827,'Mingintas',' Mingintas yra Vyriškas vardas.','Trumpa reikšmė: min- (minėti) + gint- (ginti „užstoti“) – „minimas ir ginamas“.','Vardo reikšmė: Šie vardo turėtojai nuo vaikystės svajoja apie tolimus kraštus, naujas keliones ir egzotiką. Jie norėtų išbandyti gyvenime nors vieną kartą viską. Jiems visas gyvenimas – žaidimų aikštelė. ',' Mingintas yra lietuvių kilmės vardas.'),(1828,'Minvilė',' Minvilė yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Minė, iš vyriško vardo Minvilas..','Vardo reikšmė: Jie protingi, tačiau mąstymo procesas, kaip ir pats gyvenimas, neorganizuotas ir išbarstytas.',' Minvilė yra lietuvių kilmės vardas.'),(1829,'Minvilas',' Minvilas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Minas, Minius, min- (žr. Mindaugas) + vil- (žr. Mantvilas)..','Vardo reikšmė: Jie protingi, tačiau mąstymo procesas, kaip ir pats gyvenimas, neorganizuotas ir išbarstytas.',' Minvilas yra lietuvių kilmės vardas.'),(1830,'Minvydas',' Minvydas yra Vyriškas vardas.','Trumpa reikšmė: min- (minėti) + vyd- (iš-vydo) – „minimas kaip daug matęs, patyręs“.','Vardo reikšmė: Jie protingi, tačiau mąstymo procesas, kaip ir pats gyvenimas, neorganizuotas ir išbarstytas. ',' Minvydas yra lietuvių kilmės vardas.'),(1831,'Minvainė',' Minvainė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Minė, iš vyriškas vardo Minvainas..','Vardo reikšmė: Jie protingi, tačiau mąstymo procesas, kaip ir pats gyvenimas, neorganizuotas ir išbarstytas.',' Minvainė yra lietuvių kilmės vardas.'),(1832,'Minvainas',' Minvainas yra Vyriškas vardas.','Trumpa reikšmė: „priežastis, kaltė“.','Vardo reikšmė: Vardadienis: Liepos mėn. 14 d. – Minvaino vardo diena.',' Minvainas yra lietuvių kilmės vardas.'),(1833,'Minvaidas',' Minvaidas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Minas, Minius, min- (žr. Mindaugas) + vaid- (: liet. vaid-ytis „rodytis“, vaid-entis)..','Vardo reikšmė: Vardadienis: Liepos mėn. 14 d. – Minvaido vardo diena.',' Minvaidas yra lietuvių kilmės vardas.'),(1834,'Mintgailė',' Mintgailė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Mintė, iš vyr. v. Mintgaila, žr. Mintgailas..','Vardo reikšmė: Vaikai jiems – tas pat kaip ir suaugusieji, tiktai laimingi vaikai savyje sukaupia daugiau džiaugsmo, tikėjimo laiminga ateitimi. Todėl Jūs vaikus laikote tikrais savo draugais.',' Mintgailė yra lietuvių kilmės vardas.'),(1835,'Mintgailas',' Mintgailas yra Vyriškas vardas.','Trumpa reikšmė: mint- (minti, mintis) + gail- (gailas „stiprus“) – „minimas kaip stipruolis“.','Vardo reikšmė: Vaikai jiems – tas pat kaip ir suaugusieji, tiktai laimingi vaikai savyje sukaupia daugiau džiaugsmo, tikėjimo laiminga ateitimi. Todėl Jūs vaikus laikote tikrais savo draugais.',' Mintgailas yra lietuvių kilmės vardas.'),(1836,'Mintė',' Mintė yra Moteriškas vardas.','Trumpa reikšmė: min- (minėti) – „minimas, minima“.','Vardo reikšmė: Tai visų darbų meistrai ! Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. ',' Mintė yra lietuvių kilmės vardas.'),(1837,'Mintautė',' Mintautė yra Moteriškas vardas.','Trumpa reikšmė: min- (minėti) + taut- (taut) – „tautos minimas“.','Vardo reikšmė: Tai visų darbų meistrai ! Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. ',' Mintautė yra lietuvių kilmės vardas.'),(1838,'Romualdas',' Romualdas yra Vyriškas vardas.','Trumpa reikšmė: hruom „garbė“ + waltan „valdyti“.','Vardo reikšmė: Vyras šiuo vardu gali pasižymėti nuotaikų svyravimais, polinkiu į akibrokštus ir puikiu stiliaus jausmu. Jis gali turėti gydymo galių ir stipriai traukti moterų dėmesį.',' Romualdas yra vokiečių kilmės vardas.'),(1839,'Namkintas',' Namkintas yra Vyriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Namys, nam- (žr. Namgailas) + kint- (: liet. kint- su balsių kaita kent-ėti, žiem-kint-is).','Vardo reikšmė: Vyras šiuo vardu gali pasižymėti nuotaikų svyravimais, polinkiu į akibrokštus ir puikiu stiliaus jausmu. Jis gali turėti gydymo galių ir stipriai traukti moterų dėmesį.',' Namkintas yra lietuvių kilmės vardas.'),(1840,'Namvaldas',' Namvaldas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Namys, nam- (žr. Namgailas) + vald- (: liet. vald-yti)..','Vardo reikšmė: Vyras šiuo vardu gali pasižymėti nuotaikų svyravimais, polinkiu į akibrokštus ir puikiu stiliaus jausmu. Jis gali turėti gydymo galių ir stipriai traukti moterų dėmesį.',' Namvaldas yra lietuvių kilmės vardas.'),(1841,'Namkantas',' Namkantas yra Vyriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Namys, nam- (žr. Namgailas) + kant- (: liet. pa--kant-us, kant-rus)..','Vardo reikšmė: Vyras šiuo vardu gali pasižymėti nuotaikų svyravimais, polinkiu į akibrokštus ir puikiu stiliaus jausmu. Jis gali turėti gydymo galių ir stipriai traukti moterų dėmesį.',' Namkantas yra lietuvių kilmės vardas.'),(1842,'Namgaudas',' Namgaudas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Namys, nam- (žr. Namgailas) + gaud- (: liet. gaud-yti, plg. gauti)..','Vardo reikšmė: Vyras šiuo vardu gali pasižymėti nuotaikų svyravimais, polinkiu į akibrokštus ir puikiu stiliaus jausmu. Jis gali turėti gydymo galių ir stipriai traukti moterų dėmesį.',' Namgaudas yra lietuvių kilmės vardas.'),(1843,'Namgaudė',' Namgaudė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Namė, iš vyr. v. Namgaudas..','Vardo reikšmė: Moteris šiuo vardu gali pasižymėti nuotaikų svyravimais, polinkiu į akibrokštus ir puikiu stiliaus jausmu. Ji gali turėti gydymo galių ir stipriai traukti vyrų dėmesį.',' Namgaudė yra lietuvių kilmės vardas.'),(1844,'Namgailė',' Namgailė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Namė, iš vyriškų asmenvardžių Namgaila, žr. Namgailas..','Vardo reikšmė: Moteris šiuo vardu gali pasižymėti nuotaikų svyravimais, polinkiu į akibrokštus ir puikiu stiliaus jausmu. Ji gali turėti gydymo galių ir stipriai traukti vyrų dėmesį.',' Namgailė yra lietuvių kilmės vardas.'),(1845,'Naglis',' Naglis yra Vyriškas vardas.','Trumpa reikšmė: iš padavimo apie Neringą ir Naglį; Naglis – kalno Palangoje pavadinimas.','Vardo reikšmė: Tai protingo, talentingo ir mažai kuo pasikliaujančio žmogaus vardas. ',' Naglis yra lietuvių kilmės vardas.'),(1846,'Namgailas',' Namgailas yra Vyriškas vardas.','Trumpa reikšmė: „stiprus, smarkus“.','Vardo reikšmė: Vyras šiuo vardu gali pasižymėti nuotaikų svyravimais, polinkiu į akibrokštus ir puikiu stiliaus jausmu. Jis gali turėti gydymo galių ir stipriai traukti moterų dėmesį.',' Namgailas yra lietuvių kilmės vardas.'),(1847,'Nadruvis',' Nadruvis yra Vyriškas vardas.','Trumpa reikšmė: suliet.prūs., iš prūsų genties vardo nadruviai (vns. nadruvis).','Vardo reikšmė: Abejonės, dvejonės, nepasitikėjimas kitų sprendimais ir išankstinės nuomonės susidarymas gali būti vardo nešiotojo bruožas.',' Nadruvis yra prūsų, lietuvių kilmės vardas.'),(1848,'Nadruvė',' Nadruvė yra Moteriškas vardas.','Trumpa reikšmė: suliet. prūs., žr. vyr. v. Nadruvis..','Vardo reikšmė: Abejonės, dvejonės, nepasitikėjimas kitų sprendimais ir išankstinės nuomonės susidarymas gali būti vardo nešiotojo bruožas.',' Nadruvė yra prūsų, lietuvių kilmės vardas.'),(1849,'Natalija',' Natalija yra Moteriškas vardas.','Trumpa reikšmė: „(viešpaties) gimimo diena“.','Vardo reikšmė: Tai žmogus, kuris jausis laimingu darydamas gera kitiems, ypač silpnesniems už save. Jis sugebės atjausti kitą, tačiau giliai viduje pats trokš meilės ir įvertinimo. Rūpinimasis kitais, mokėjimas spręsti sudėtingus klausimus ir pedagoginis talentas gali jį išskirti iš minios. ',' Natalija yra lotynų kilmės vardas.'),(1850,'Natalė',' Natalė yra Moteriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Natalija..','Vardo reikšmė: Tai žmogus, kuris jausis laimingu darydamas gera kitiems, ypač silpnesniems už save. Jis sugebės atjausti kitą, tačiau giliai viduje pats trokš meilės ir įvertinimo. Rūpinimasis kitais, mokėjimas spręsti sudėtingus klausimus ir pedagoginis talentas gali jį išskirti iš minios. ',' Natalė yra lietuvių kilmės vardas.'),(1851,'Nastys',' Nastys yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Anastazas: „prisikėlęs“.','Vardo reikšmė: Jūsų teigiamos savybės: artistiškumas, potraukis į nežabotas linksmybes, polinkis į kūrybą, romantiškumas, aistringumas, linksmumas, platūs interesai.',' Nastys yra graikų kilmės vardas.'),(1852,'Nazaras',' Nazaras yra Vyriškas vardas.','Trumpa reikšmė: nazar „pasišventęs dievui“.','Vardo reikšmė: Šio vardo savininkų gyvenimiškoji užduotis – išmokti savąją energiją nukreipti konkretiems uždaviniams spręsti. Būtina vykdyti savus talentus ir atlikti kuo daugiau gerų darbų.',' Nazaras yra hebrajų kilmės vardas.'),(1853,'Nastazija',' Nastazija yra Moteriškas vardas.','Trumpa reikšmė: Nastazia, Nasta piet. aukšt. (dz.), Nastazė, Nastė vak. aukšt., — liet. trumpinys iš Anastazija..','Vardo reikšmė: Juose susimaišęs įdomaus jausmingumo, kuklumo ir valios nugalėti kokteilis. Žmonės dažnai prisimena raminamą ir dvasią gydančią jūsų bendriją.',' Nastazija yra graikų kilmės vardas.'),(1854,'Nauvydas',' Nauvydas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Vydas, nau- (žr. Naubartas) + vyd- (: liet. iš-vyd-o, iš-vys-ti)..','Vardo reikšmė: Jūsų atidumas detalėms ir iškalba leidžia jums tapti talentingais scenaristais, dramaturgais, aktoriais, naudingų patarimų ir pokalbių vedėjais televizijoje arba žurnalistais. Dėl savo originalumo jūs galite sublizgėti bet kokioje meno srityje.',' Nauvydas yra lietuvių kilmės vardas.'),(1855,'Nastė',' Nastė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Anastazija: „prisikėlusi“.','Vardo reikšmė: Juose susimaišęs įdomaus jausmingumo, kuklumo ir valios nugalėti kokteilis. Žmonės dažnai prisimena raminamą ir dvasią gydančią jūsų bendriją.',' Nastė yra graikų kilmės vardas.'),(1856,'Narvydas',' Narvydas yra Vyriškas vardas.','Trumpa reikšmė: Norvydas, Norvyda, Norvydė variantai: nor- (norėti) + vyd- (iš-vydo) – „norintis viską matyti“.','Vardo reikšmė: Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. ',' Narvydas yra lietuvių kilmės vardas.'),(1857,'Narimantė',' Narimantė yra Moteriškas vardas.','Trumpa reikšmė: Norimantas, Norimantė variantas – nor- (norėti) + rim- (rimti).','Vardo reikšmė: (1) liet., trump. Nara, žr. Narimantė',' Narimantė yra lietuvių kilmės vardas.'),(1858,'Narimantas',' Narimantas yra Vyriškas vardas.','Trumpa reikšmė: Norimantas, Norimantė variantas – nor- (norėti) + rim- (rimti).','Vardo reikšmė: Turite paslaptingų magiškų jėgų, kurios prie jų pritraukia kitus žmones. Turite gana sunkų ir slegiantį charakterį. Jūs atvirai kovojate iki visiškos pergalės. Kerštingi. ',' Narimantas yra lietuvių kilmės vardas.'),(1859,'Naumintas',' Naumintas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Naumys, Naumius, nau- (žr. Naubartas) + mint- (: liet. minti, mint-as, mint-is)..','Vardo reikšmė: Jūsų atidumas detalėms ir iškalba leidžia jums tapti talentingais scenaristais, dramaturgais, aktoriais, naudingų patarimų ir pokalbių vedėjais televizijoje arba žurnalistais. Dėl savo originalumo jūs galite sublizgėti bet kokioje meno srityje.',' Naumintas yra lietuvių kilmės vardas.'),(1860,'Naumantė',' Naumantė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Naumė, iš vyr. v. Naumantas..','Vardo reikšmė: Jūsų atidumas detalėms ir iškalba leidžia jums tapti talentingais scenaristais, dramaturgais, aktoriais, naudingų patarimų ir pokalbių vedėjais televizijoje arba žurnalistais. Dėl savo originalumo jūs galite sublizgėti bet kokioje meno srityje.',' Naumantė yra lietuvių kilmės vardas.'),(1861,'Napoleonas',' Napoleonas yra Vyriškas vardas.','Trumpa reikšmė: napos „miškas, giria“ + leon „liūtas“ – „girių liūtas“.','Vardo reikšmė: Geri finansininkai, įmonių bei fabrikų vadovai, bankų valdytojai. Jūs savo rankose laikote šeimos biudžetą. Dažnai tampate gerais psichologais, seksualių problemų specialistais.',' Napoleonas yra graikų kilmės vardas.'),(1862,'Naumantas',' Naumantas yra Vyriškas vardas.','Trumpa reikšmė: „sumanus“.','Vardo reikšmė: Jūsų atidumas detalėms ir iškalba leidžia jums tapti talentingais scenaristais, dramaturgais, aktoriais, naudingų patarimų ir pokalbių vedėjais televizijoje arba žurnalistais. Dėl savo originalumo jūs galite sublizgėti bet kokioje meno srityje.',' Naumantas yra lietuvių kilmės vardas.'),(1863,'Napalys',' Napalys yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Napoleonas napos „miškas, giria“ + leon „liūtas“ – „girių liūtas“.','Vardo reikšmė: Geri finansininkai, įmonių bei fabrikų vadovai, bankų valdytojai. Jūs savo rankose laikote šeimos biudžetą. Dažnai tampate gerais psichologais, seksualių problemų specialistais.',' Napalys yra graikų kilmės vardas.'),(1864,'Nerutė',' Nerutė yra Moteriškas vardas.','Trumpa reikšmė: liet., priesagos -utė vedinys iš v. Nerė..','Vardo reikšmė: Šeimoje retai jaučiatės laimingi. Pavydas ir įtarinėjimai sukelia šeimoje vaidus ir nemalonumus.',' Nerutė yra lietuvių kilmės vardas.'),(1865,'Nermedas',' Nermedas yra Vyriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Nerys, Nerius, ner- (žr. Nerdingas) + med- (: liet. medė „giria“)..','Vardo reikšmė: Jūs tai dievo dovana, nes visus savo sugebėjimus, talentus, kuriais gamta dosniai apdovanojo, skiriate tarnavimui žmonėms, savo tėvynei, kurioje jie gyvena.',' Nermedas yra lietuvių kilmės vardas.'),(1866,'Naudravė',' Naudravė yra Moteriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Naudrė, iš vyr. v. Naudravas..','Vardo reikšmė: Jūs puikiai išmanote visko kainą, netikite jokiais pažadais ir nesiremiate kitais, todėl kartais jums tiesiog neužtenka jėgų įvykdyti savo idėjas.',' Naudravė yra lietuvių kilmės vardas.'),(1867,'Namvaldė',' Namvaldė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Namė, iš vyr. v. Namvaldas..','Vardo reikšmė: Jūs puikiai išmanote visko kainą, netikite jokiais pažadais ir nesiremiate kitais, todėl kartais jums tiesiog neužtenka jėgų įvykdyti savo idėjas.',' Namvaldė yra lietuvių kilmės vardas.'),(1868,'Naudravas',' Naudravas yra Vyriškas vardas.','Trumpa reikšmė: „drevė“.','Vardo reikšmė: Jūs tai dievo dovana, nes visus savo sugebėjimus, talentus, kuriais gamta dosniai apdovanojo, skiriate tarnavimui žmonėms, savo tėvynei, kurioje jie gyvena.',' Naudravas yra lietuvių kilmės vardas.'),(1869,'Nerita',' Nerita yra Moteriškas vardas.','Trumpa reikšmė: neritos „begalinis, amžinas“.','Vardo reikšmė: Šeimoje ištikimi ir prieraišūs, tačiau sugyventi su jumis nelengva. Draugų turite nedaug.',' Nerita yra graikų kilmės vardas.'),(1870,'Naubartė',' Naubartė yra Moteriškas vardas.','Trumpa reikšmė: nau- (naujas) + bart- (barti reikšme „kovoti“) – „naujas kovotojas“.','Vardo reikšmė: Jūs tai dievo dovana, nes visus savo sugebėjimus, talentus, kuriais gamta dosniai apdovanojo, skiriate tarnavimui žmonėms, savo tėvynei, kurioje jie gyvena.',' Naubartė yra lietuvių kilmės vardas.'),(1871,'Naubartas',' Naubartas yra Vyriškas vardas.','Trumpa reikšmė: nau- (naujas) + bart- (barti reikšme „kovoti“) – „naujas kovotojas“.','Vardo reikšmė: Jūs tai dievo dovana, nes visus savo sugebėjimus, talentus, kuriais gamta dosniai apdovanojo, skiriate tarnavimui žmonėms, savo tėvynei, kurioje jie gyvena.',' Naubartas yra lietuvių kilmės vardas.'),(1872,'Neringa',' Neringa yra Moteriškas vardas.','Trumpa reikšmė: iš lietuvių padavimo apie Neringą ir Naglį.','Vardo reikšmė: Vardadienis: Rugpjūčio mėn. 20 d. – Neringos vardo diena.',' Neringa yra lietuvių kilmės vardas.'),(1873,'Natas',' Natas yra Vyriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Natalis..','Vardo reikšmė: Tačiau apskritai gali tapti įvairių gyvenimo sričių profesionalais ir talentingais žmonėmis.',' Natas yra lietuvių kilmės vardas.'),(1874,'Nerimantas',' Nerimantas yra Vyriškas vardas.','Trumpa reikšmė: nerim- (nerimti) + mant- (mantus „sumanus“) – „nerimstantis, vis mąstantis“.','Vardo reikšmė: Tačiau apskritai gali tapti įvairių gyvenimo sričių profesionalais ir talentingais žmonėmis. ',' Nerimantas yra lietuvių kilmės vardas.'),(1875,'Natalis',' Natalis yra Vyriškas vardas.','Trumpa reikšmė: „(viešpaties) gimimo diena“.','Vardo reikšmė: Tačiau apskritai gali tapti įvairių gyvenimo sričių profesionalais ir talentingais žmonėmis.',' Natalis yra lotynų kilmės vardas.'),(1876,'Nerė',' Nerė yra Moteriškas vardas.','Trumpa reikšmė: liet., iš vyr. v. Nerius, taip pat trumpinys iš mot. vardų su Ner- : Nervyda, Nervilė ir kt.','Vardo reikšmė: Vardadienis: Rugpjūčio mėn. 20 d. – Nerės vardo diena.',' Nerė yra lietuvių kilmės vardas.'),(1877,'Nerdingas',' Nerdingas yra Vyriškas vardas.','Trumpa reikšmė: „pykti, niršti“.','Vardo reikšmė: Tačiau apskritai gali tapti įvairių gyvenimo sričių profesionalais ir talentingais žmonėmis.',' Nerdingas yra lietuvių, prūsų kilmės vardas.'),(1878,'Nina',' Nina yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Antanina: antius „laimingas, -as; džiaugsmingas, -a“.','Vardo reikšmė: Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Turėdami teigiamų savybių, jie užsispyrę, paslaptingi, geri praktikai ir gerai orientuojasi finansų klausimuose. Labai įžvalgūs ir stoikai. ',' Nina yra graikų kilmės vardas.'),(1879,'Nikodemas',' Nikodemas yra Vyriškas vardas.','Trumpa reikšmė: nike „pergalė“ + demos „liaudis“ – „pergalė liaudžiai“.','Vardo reikšmė: Jūs fiziškai tvirti, kupini slaptų įvairių galimybių žmonės. Turėdami teigiamų savybių, jie užsispyrę, paslaptingi, geri praktikai ir gerai orientuojasi finansų klausimuose. Labai įžvalgūs ir stoikai. ',' Nikodemas yra graikų kilmės vardas.'),(1880,'Nemunas',' Nemunas yra Vyriškas vardas.','Trumpa reikšmė: liet., iš upėvardžio Nemunas.','Vardo reikšmė: Šie vardo savininkai rūpinasi materialine ateitimi, apie tai, kas būtina pasiturinčiam gyvenimui, ir tai jiems sekasi gana gerai, nes jie tikri finansų genijai; žino, kur taupyti ir kaip paskirstyti pinigus.',' Nemunas yra lietuvių kilmės vardas.'),(1881,'Nelė',' Nelė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Anelė: „pranešėja, -as“.','Vardo reikšmė: Tačiau daugumai Jums kažkokiu būdu disponuoja pakankamomis lėšomis ir problemų dėl išlaidumo nejaučia, nes jums dažniausiai nuskyla būti santuokoje su pasiturinčiais partneriais.',' Nelė yra graikų kilmės vardas.'),(1882,'Nikas',' Nikas yra Vyriškas vardas.','Trumpa reikšmė: nike „pergalė“.','Vardo reikšmė: Jei prieš akis regimas konkretus, apčiuopiamas tikslas, jūs parodote nemenką darbštumą, nors iš esmės linkę kūnu ir siela atsiduoti gyvenimo džiaugsmams, malonumams.',' Nikas yra graikų kilmės vardas.'),(1883,'Nykantas',' Nykantas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Nykas, ny- (žr. Nygailas) + kant- (žr. Namkantas)..','Vardo reikšmė: Jei prieš akis regimas konkretus, apčiuopiamas tikslas, jūs parodote nemenką darbštumą, nors iš esmės linkę kūnu ir siela atsiduoti gyvenimo džiaugsmams, malonumams.',' Nykantas yra lietuvių kilmės vardas.'),(1884,'Neimantė',' Neimantė yra Moteriškas vardas.','Trumpa reikšmė: nei (nei „negu, nė“) + mant- (mantus „sumanus“).','Vardo reikšmė: Jūs pritariate laikmečiui, madoms, esate veiklūs, stengiatės atsiskleisti menui. ',' Neimantė yra lietuvių kilmės vardas.'),(1885,'Nikandras',' Nikandras yra Vyriškas vardas.','Trumpa reikšmė: nike „pergalė“ + aner „vyras“ – „nugalėtojas, atnešęs pergalę“.','Vardo reikšmė: Jei prieš akis regimas konkretus, apčiuopiamas tikslas, jūs parodote nemenką darbštumą, nors iš esmės linkę kūnu ir siela atsiduoti gyvenimo džiaugsmams, malonumams.',' Nikandras yra graikų kilmės vardas.'),(1886,'Nijolė',' Nijolė yra Moteriškas vardas.','Trumpa reikšmė: sen. mitologijoje – požemio valdovė Nijolė.','Vardo reikšmė: Vardadienis: Sausio mėn. 28 d. – Nijolės vardo diena.',' Nijolė yra lietuvių kilmės vardas.'),(1887,'Nygailas',' Nygailas yra Vyriškas vardas.','Trumpa reikšmė: liet., sen. var. Nygaila, trump. Nygas, Gailas, ny- (: balt. ni virtęs ni, plg. latv. ni, liet. nei) + gail- (žr. Namgailas)..','Vardo reikšmė: Jei prieš akis regimas konkretus, apčiuopiamas tikslas, jūs parodote nemenką darbštumą, nors iš esmės linkę kūnu ir siela atsiduoti gyvenimo džiaugsmams, malonumams.',' Nygailas yra lietuvių kilmės vardas.'),(1888,'Nygailė',' Nygailė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Nygė, Gailė, iš vyr. avd. Nygaila, žr. Nygailas..','Vardo reikšmė: Jei prieš akis regimas konkretus, apčiuopiamas tikslas, jūs parodote nemenką darbštumą, nors iš esmės linkę kūnu ir siela atsiduoti gyvenimo džiaugsmams, malonumams.',' Nygailė yra lietuvių kilmės vardas.'),(1889,'Nida',' Nida yra Moteriškas vardas.','Trumpa reikšmė: iš vietovardžio Nida.','Vardo reikšmė: Net didžiausias chaosas jūsų rankose gali virsti harmonija. Jūs visada būsite nepakeičiamas darbo komandos ar šeimos narys. ',' Nida yra lietuvių kilmės vardas.'),(1890,'Nervilė',' Nervilė yra Moteriškas vardas.','Trumpa reikšmė: ner- (nertėti „pykti, niršti“) + vil- (viltis) – „pykstantis iš nevilties“.','Vardo reikšmė: Jums patinka rutina ir įpročiai. Pasižymite perfekcionizmu, ypatingai darbe. Jūsų tikslas nėra tapti vadovu, bet galite būti puikus jo patarėjas.',' Nervilė yra lietuvių kilmės vardas.'),(1891,'Nervilas',' Nervilas yra Vyriškas vardas.','Trumpa reikšmė: ner- (nertėti „pykti, niršti“) + vil- (viltis) – „pykstantis iš nevilties“.','Vardo reikšmė: Jums patinka rutina ir įpročiai. Pasižymite perfekcionizmu, ypatingai darbe. Jūsų tikslas nėra tapti vadovu, bet galite būti puikus jo patarėjas.',' Nervilas yra lietuvių kilmės vardas.'),(1892,'Nervydas',' Nervydas yra Vyriškas vardas.','Trumpa reikšmė: ner- (nertėti „pykti, niršti“) + vyd- (iš-vydo).','Vardo reikšmė: Jums patinka rutina ir įpročiai. Pasižymite perfekcionizmu, ypatingai darbe. Jūsų tikslas nėra tapti vadovu, bet galite būti puikus jo patarėjas.',' Nervydas yra lietuvių kilmės vardas.'),(1893,'Norbertas',' Norbertas yra Vyriškas vardas.','Trumpa reikšmė: nord „šiaurė“ + beraht „spindintis, garsus“.','Vardo reikšmė: Asmeniniai poreikiai ir troškimai užima labai svarbų vaidmenį jūsų gyvenime, todėl jiems skiriate didelį dėmesį. Jūs greitai pavargstate nuo rutinos, jus vargina nuobodžios ir techninės užduotys.',' Norbertas yra vokiečių kilmės vardas.'),(1894,'Norberta',' Norberta yra Moteriškas vardas.','Trumpa reikšmė: nord „šiaurė“ + beraht „spindintis, garsus“.','Vardo reikšmė: Asmeniniai poreikiai ir troškimai užima labai svarbų vaidmenį jūsų gyvenime, todėl jiems skiriate didelį dėmesį. Jūs greitai pavargstate nuo rutinos, jus vargina nuobodžios ir techninės užduotys.',' Norberta yra vokiečių kilmės vardas.'),(1895,'Nomedas',' Nomedas yra Vyriškas vardas.','Trumpa reikšmė: no- (nuo) + med- (medė „giria, miškas“) – „miško gyventoja, -as“.','Vardo reikšmė: Vardadienis: Gruodžio mėn. 30 d. – Nomedo vardo diena.',' Nomedas yra lietuvių kilmės vardas.'),(1896,'Nora',' Nora yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Eleonora: „dievas mano šviesa“.','Vardo reikšmė: Asmeniniai poreikiai ir troškimai užima labai svarbų vaidmenį jūsų gyvenime, todėl jiems skiriate didelį dėmesį. Jūs greitai pavargstate nuo rutinos, jus vargina nuobodžios ir techninės užduotys.',' Nora yra hebrajų kilmės vardas.'),(1897,'Nomeda',' Nomeda yra Moteriškas vardas.','Trumpa reikšmė: no- (nuo) + med- (medė „giria, miškas“) – „miško gyventoja, -as“.','Vardo reikšmė: Jūs traukiate žmones, o jų palaikymas jums labai svarbus. Jei jaučiate aplinkinių neprielankumą, dėl to labai jaudinatės ir sunkiai suvaldote emocijas.',' Nomeda yra lietuvių kilmės vardas.'),(1898,'Nogintas',' Nogintas yra Vyriškas vardas.','Trumpa reikšmė: „užstoti, saugoti“.','Vardo reikšmė: Vardadienis: Balandžio mėn. 17 d. – Noginto vardo diena.',' Nogintas yra lietuvių kilmės vardas.'),(1899,'Nogailė',' Nogailė yra moteriškas vardas.','Trumpa reikšmė: liet., trump. Nogė, iš vyr. avd. Nogaila, žr. Nogailas..','Vardo reikšmė: Taigi šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgstantis dovanoti ir gauti dovanas, sugeba būti labai svetingas. Šis vardas simbolizuoja norą imtis naujų planų ir juos įgyvendinti.',' Nogailė yra lietuvių kilmės vardas.'),(1900,'Normantas',' Normantas yra Vyriškas vardas.','Trumpa reikšmė: nor- (norėti) + mant- (mantus „sumanus“).','Vardo reikšmė: Taip pat reikėtų mokytis, kaip racionaliau tvarkyti savo pinigus.',' Normantas yra lietuvių kilmės vardas.'),(1901,'Nogailas',' Nogailas yra Vyriškas vardas.','Trumpa reikšmė: liet., sen. var. Nogaila, trump. Nogys, no- (žr. Nodravas) + gail- (žr. Namgailas)..','Vardo reikšmė: Taigi šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgstantis dovanoti ir gauti dovanas, sugeba būti labai svetingas. Šis vardas simbolizuoja norą imtis naujų planų ir juos įgyvendinti.',' Nogailas yra lietuvių kilmės vardas.'),(1902,'Normainė',' Normainė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Norė, iš vyr. v. Normainas.','Vardo reikšmė: Taip pat reikėtų mokytis, kaip racionaliau tvarkyti savo pinigus.',' Normainė yra lietuvių kilmės vardas.'),(1903,'Normainas',' Normainas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Norys, nor- (žr. Norbudas) + main- (: liet. main-ytis „keistis“, main-ai).','Vardo reikšmė: Šio vardo savininkai amžini klajokliai, lengvai įsisavinate užsienio kalbas. Šio vardo savininkas yra labai draugiškas, dėmesingas ir rūpestingas. Jis atsargus, kartais netgi įtarus, mėgsta dovanoti ir gauti dovanas. Esant reikalui, gali būti labai drąsus ir labai atkaklus.',' Normainas yra lietuvių kilmės vardas.'),(1904,'Nodravė',' Nodravė yra Moteriškas vardas.','Trumpa reikšmė: no- (nuo) + drav- (drevė, dravis „stiprus kaip medis“) – „kilęs iš miško“.','Vardo reikšmė: Taigi šio vardo savininkas yra labai draugiškas, geranoriškas ir rūpestingas. Jis