 + ged- (: liet. ged-auti „ilgėtis“, ged-ėti)',' Norgedas yra lietuvių kilmės vardas.'),(1917,'Norgailė',' Norgailė yra Moteriškas vardas.','Trumpa reikšmė: nor- (norėti) + gail- (gailas „stiprus“) – „stiprus noras“.','Vardo reikšmė: (1) liet., trump. Norė, iš vyr. avd. Norgaila, žr. Norgailas',' Norgailė yra lietuvių kilmės vardas.'),(1918,'Nortilė',' Nortilė yra Moteriškas vardas.','Trumpa reikšmė: nor- (norėti) + til- (nu-tilti) – „norintis, bet neryžtingas, tylintis“.','Vardo reikšmė: (1), (2) liet., trump. Norta, Nortė, iš vyr. v. Nortilas',' Nortilė yra lietuvių kilmės vardas.'),(1919,'Norgailas',' Norgailas yra Vyriškas vardas.','Trumpa reikšmė: nor- (norėti) + gail- (gailas „stiprus“) – „stiprus noras“.','Vardo reikšmė: (1) liet., sen. var. Norgaila, trump. Norys, nor- (žr. Norbudas) + gail- (žr. Namgailas)',' Norgailas yra lietuvių kilmės vardas.'),(1920,'Nortilas',' Nortilas yra Vyriškas vardas.','Trumpa reikšmė: nor- (norėti) + til- (nu-tilti) – „norintis, bet neryžtingas, tylintis“.','Vardo reikšmė: (1) liet., trump. Nortas, nor- (žr. Norbudas) + til- (: liet. til-ti, til-o)',' Nortilas yra lietuvių kilmės vardas.'),(1921,'Nortautė',' Nortautė yra Moteriškas vardas.','Trumpa reikšmė: nor- (norėti) + taut- (tauta).','Vardo reikšmė: (1) liet., trump. Norta, Nortė, iš vyr. v. Nortautas ',' Nortautė yra lietuvių kilmės vardas.'),(1922,'Nortautas',' Nortautas yra Vyriškas vardas.','Trumpa reikšmė: nor- (norėti) + taut- (tauta).','Vardo reikšmė: liet., trump. Nortas, nor- (žr. Norbudas) + taut- (: liet. taut-a, prūs. tauto „kraštas“)',' Nortautas yra lietuvių kilmės vardas.'),(1923,'Normilė',' Normilė yra Moteriškas vardas.','Trumpa reikšmė: nor- (norėti) + mil- (pa-milti).','Vardo reikšmė: (1), (2) liet., trump. Norė, Milė, iš vyr. v. Normilas',' Normilė yra lietuvių kilmės vardas.'),(1924,'Normilas',' Normilas yra Vyriškas vardas.','Trumpa reikšmė: nor- (norėti) + mil- (pa-milti).','Vardo reikšmė: (1) liet., trump. Norys, Milius, nor- (žr. Norbudas) + mil- (