das.','Trumpa reikšmė: suliet. prūs., trump. Novė, iš vyr v. Novaidas..','Vardo reikšmė: Vardadienis: Spalio mėn. 26 d. – Novaidės vardo diena.',' Novaidė yra lietuvių, prūsų kilmės vardas.'),(1934,'Orinta',' Orinta yra Moteriškas vardas.','Trumpa reikšmė: orus „iškilnus“.','Vardo reikšmė: Vardadienis: Gegužės 30 d. – Orintos vardo diena.',' Orinta yra lietuvių kilmės vardas.'),(1935,'Orestas',' Orestas yra Vyriškas vardas.','Trumpa reikšmė: „kalnietis, kalnius“.','Vardo reikšmė: Vardadienis: Lapkričio mėn. 23 d. – Oresto vardo diena.',' Orestas yra graikų kilmės vardas.'),(1936,'Notangė',' Notangė yra  vardas.','Trumpa reikšmė: suliet. prūs., žr. vyr. v. Notangas..','Vardo reikšmė: Labai mokate prisiderinti prie žymiausių autoritetų. Jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai.',' Notangė yra lietuvių, prūsų kilmės vardas.'),(1937,'Notangas',' Notangas yra  vardas.','Trumpa reikšmė: suliet. prūs., iš prūsų genties vardo notangai (vns. notangas)..','Vardo reikšmė: Labai mokate prisiderinti prie žymiausių autoritetų. Jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai.',' Notangas yra lietuvių, prūsų kilmės vardas.'),(1938,'Onė',' Onė yra Moteriškas vardas.','Trumpa reikšmė: liet. (žem.) vardo Ona variantas..','Vardo reikšmė: Vardadienis: Liepos mėn. 26 d. – Onės vardo diena.',' Onė yra lietuvių kilmės vardas.'),(1939,'Ona',' Ona yra Moteriškas vardas.','Trumpa reikšmė: „patraukli, žavi“.','Vardo reikšmė: Vardadieniai: liepos mėn. 26 d., gruodžio 15 d. – Onos vardo dienos.',' Ona yra hebrajų kilmės vardas.'),(1940,'Norvilė',' Norvilė yra Moteriškas vardas.','Trumpa reikšmė: nor- (norėti) + vil- (viltis).','Vardo reikšmė: Vardadienis: Kovo mėn. 16 d. – Norvilės vardo diena.',' Norvilė yra lietuvių kilmės vardas.'),(1941,'Norvilas',' Norvilas yra Vyriškas vardas.','Trumpa reikšmė: nor- (norėti) + vil- (viltis).','Vardo reikšmė: Vardadienis: Kovo mėn. 6 d. – Norvilo vardo diena.',' Norvilas yra lietuvių kilmės vardas.'),(1942,'Olivija',' Olivija yra Moteriškas vardas.','Trumpa reikšmė: oliva „alyvmedis“.','Vardo reikšmė: Neteisingai panaudotos seksualinės energijos pertekliai gali joms sutrikdyti sveikatą ir ištuštinti pinigines. Jūs užsigalvoję, kantrūs, pastovūs, patikimi, energingi, diplomatiški ir konservatyvūs. ',' Olivija yra lotynų kilmės vardas.'),(1943,'Olimpijus',' Olimpijus yra Vyriškas vardas.','Trumpa reikšmė: „olimpietis, Olimpo gyventojas“.','Vardo reikšmė: Gera intuicija leidžia planuoti tolimą ateitį. Labai mokate prisiderinti prie žymiausių autoritetų. jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai.',' Olimpijus yra graikų kilmės vardas.'),(1944,'Olimpija',' Olimpija yra Moteriškas vardas.','Trumpa reikšmė: „olimpietis, Olimpo gyventojas“.','Vardo reikšmė: Gera intuicija leidžia planuoti tolimą ateitį. Labai mokate prisiderinti prie žymiausių autoritetų. jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai.',' Olimpija yra graikų kilmės vardas.'),(1945,'Olavas',' Olavas yra Vyriškas vardas.','Trumpa reikšmė: „protėvių atžala, dievų vaikas“.','Vardo reikšmė: Jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai.',' Olavas yra skandinavų kilmės vardas.'),(1946,'Oktavijus',' Oktavijus yra Vyriškas vardas.','Trumpa reikšmė: oktavus „aštuntas“.','Vardo reikšmė: Jeigu teisingas posakis, kad “genijus – tai begalinis sugebėjimas kentėti”, tai Jūs tikrai genialus. Nuo gimimo jums būdingas meistriškumas ir tikslumas. Tikslas visur: laiko atžvilgiu, matinimosi, ėjimo miegoti ir t.t. ',' Oktavijus yra lotynų kilmės vardas.'),(1947,'Oktavijonas',' Oktavijonas yra Vyriškas vardas.','Trumpa reikšmė: lot., trump. Oktavijus, Oktavas, Oktas, iš lot. Octavianus, kuris yra priesagos -anus vedinys iš Octavius, žr. Oktavijus..','Vardo reikšmė: Jeigu teisingas posakis, kad “genijus – tai begalinis sugebėjimas kentėti”, tai Jūs tikrai genialus. Nuo gimimo jums būdingas meistriškumas ir tikslumas. Tikslas visur: laiko atžvilgiu, matinimosi, ėjimo miegoti ir t.t. ',' Oktavijonas yra lotynų kilmės vardas.'),(1948,'Oktavija',' Oktavija yra Moteriškas vardas.','Trumpa reikšmė: oktavus „aštuntas“.','Vardo reikšmė: Jeigu teisingas posakis, kad “genijus – tai begalinis sugebėjimas kentėti”, tai Jūs tikrai genialus. Nuo gimimo jums būdingas meistriškumas ir tikslumas. Tikslas visur: laiko atžvilgiu, matinimosi, ėjimo miegoti ir t.t. ',' Oktavija yra lotynų kilmės vardas.'),(1949,'Ofelija',' Ofelija yra Moteriškas vardas.','Trumpa reikšmė: „nauda, pagalba“.','Vardo reikšmė: Jos iš prigimties užprogramuoti lyderiai. Jos nepriklausomi ir individualūs, bet kokia kaina trokštantys garbės. Labai judrūs, energingi, nenustygstantys vietoje, linksmi, draugiški.',' Ofelija yra graikų kilmės vardas.'),(1950,'Odilija',' Odilija yra Moteriškas vardas.','Trumpa reikšmė: iš sen. saksų „turtas“.','Vardo reikšmė: Tai tyrėjai ir racionalizatoriai. Turite vykdytojų savybių ir labai sekasi savas verslas arba vadovavimas jam. Jums reikalinga laisvė, nes norite patys priimti sprendimus, pasikliaudami savomis idėjomis. Turite sugebėjimų veikti jus supančią aplinką.',' Odilija yra vokiečių kilmės vardas.'),(1951,'Odeta',' Odeta yra Moteriškas vardas.','Trumpa reikšmė: iš sen. saksų „turtas“.','Vardo reikšmė: Tai tyrėjai ir racionalizatoriai. Turite vykdytojų savybių ir labai sekasi savas verslas arba vadovavimas jam. Jums reikalinga laisvė, nes norite patys priimti sprendimus, pasikliaudami savomis idėjomis. Turite sugebėjimų veikti jus supančią aplinką.',' Odeta yra prancūzų kilmės vardas.'),(1952,'Palma',' Palma yra Moteriškas vardas.','Trumpa reikšmė: palma „palmė“.','Vardo reikšmė: Dažnai kritikuoja kitus, teikdami, kad anie neturi ryžto. todėl toks iškreiptas supratimas gali atstumti juos nuo draugų ir šeimos narių.',' Palma yra lotynų kilmės vardas.'),(1953,'Palemonas',' Palemonas yra Vyriškas vardas.','Trumpa reikšmė: „triūsti, darbuotis“.','Vardo reikšmė: Netgi patyrę pralaimėjimą, tokie žmonės sugeba vėl atkurti save. Pavojaus minutėmis jų fizinės jėgos labai padidėja.',' Palemonas yra graikų kilmės vardas.'),(1954,'Pajauta',' Pajauta yra Moteriškas vardas.','Trumpa reikšmė: pajaut- (pajausti, jautotis „klausti, teirautis“) – „ta, kuri rūpinasi, užjaučia kitus“.','Vardo reikšmė: Abejonės, dvejonės, nepasitikėjimas kitų sprendimais ir išankstinės nuomonės susidarymas gali būti vardo nešiotojo bruožais.',' Pajauta yra lietuvių kilmės vardas.'),(1955,'Pabangas',' Pabangas yra Vyriškas vardas.','Trumpa reikšmė: „smarkus, didelis, staigus“.','Vardo reikšmė: Abejonės, dvejonės, nepasitikėjimas kitų sprendimais ir išankstinės nuomonės susidarymas gali būti vardo nešiotojo bruožais.',' Pabangas yra lietuvių, prūsų kilmės vardas.'),(1956,'Padravas',' Padravas yra Vyriškas vardas.','Trumpa reikšmė: „stiprus“.','Vardo reikšmė: Abejonės, dvejonės, nepasitikėjimas kitų sprendimais ir išankstinės nuomonės susidarymas gali būti vardo nešiotojo bruožais.',' Padravas yra lietuvių kilmės vardas.'),(1957,'Paulius',' Paulius yra Vyriškas vardas.','Trumpa reikšmė: paulus „mažas“.','Vardo reikšmė: Šie vardo turėtojai labai myli vaikus – tiek savus, tiek svetimus, tačiau be didesnio sentimentalumo. Vaikai jums – tas pats kas ir suaugę, tik laimingas vaikas turi savyje daugiau džiaugsmo, lūkesčių ateičiai.',' Paulius yra lotynų kilmės vardas.'),(1958,'Paulinas',' Paulinas yra Vyriškas vardas.','Trumpa reikšmė: paulus „mažas“ + -in-.','Vardo reikšmė: Šie vardo turėtojai labai myli vaikus – tiek savus, tiek svetimus, tačiau be didesnio sentimentalumo. Vaikai jums – tas pats kas ir suaugę, tik laimingas vaikas turi savyje daugiau džiaugsmo, lūkesčių ateičiai.',' Paulinas yra lotynų kilmės vardas.'),(1959,'Paulė',' Paulė yra Moteriškas vardas.','Trumpa reikšmė: variantas Paulė iš lotynų paula „maža“.','Vardo reikšmė: (2) lot., tarm. Paulė, Paulia ryt. aukšt., iš lot. Paula: lot. paula „maža“',' Paulė yra lietuvių kilmės vardas.'),(1960,'Paulina',' Paulina yra Moteriškas vardas.','Trumpa reikšmė: paula „maža“ + -in-.','Vardo reikšmė: Šie vardo turėtojai labai myli vaikus – tiek savus, tiek svetimus, tačiau be didesnio sentimentalumo. Vaikai jums – tas pats kas ir suaugę, tik laimingas vaikas turi savyje daugiau džiaugsmo, lūkesčių ateičiai.',' Paulina yra lotynų kilmės vardas.'),(1961,'Patrimpas',' Patrimpas yra Vyriškas vardas.','Trumpa reikšmė: sulietuvintas prūsų: pa (po) + trimp- ( trimpterėti „trypti“).','Vardo reikšmė: Šių vardų savininkai visada randasi pačios triukšmingiausios kompanijos centre, mėgsta papasakoti keistų istorijų ar anekdotų. Jūs – aštrialiežuviai, linksmi, išradingi ir nesugebate nė minutei būti ramūs. Jūs esate visų mylimi, aplinkiniai negali atsispirti jūsų spinduliuojam geriui. ',' Patrimpas yra lietuvių kilmės vardas.'),(1962,'Patrikas',' Patrikas yra Vyriškas vardas.','Trumpa reikšmė: iš Patricijus lotynų: patricius „kilmingasis“.','Vardo reikšmė: Tačiau daugumai Jums kažkokiu būdu disponuoja pakankamomis lėšomis ir problemų dėl išlaidumo nejaučia, nes jums dažniausiai nuskyla būti santuokoje su pasiturinčiais partneriais.',' Patrikas yra airių kilmės vardas.'),(1963,'Patricijus',' Patricijus yra Vyriškas vardas.','Trumpa reikšmė: patricius „kilmingasis“.','Vardo reikšmė: Gera intuicija leidžia planuoti tolimą ateitį. Labai mokate prisiderinti prie žymiausių autoritetų. Jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai. ',' Patricijus yra lotynų kilmės vardas.'),(1964,'Patricija',' Patricija yra Moteriškas vardas.','Trumpa reikšmė: patricia „kilmingoji“.','Vardo reikšmė: Patricijos labai myli vaikus – tiek savus, tiek svetimus, tačiau be didesnio sentimentalumo. Vaikai jums – tas pats kas ir suaugę, tik laimingas vaikas turi savyje daugiau džiaugsmo, lūkesčių ateičiai.',' Patricija yra lotynų kilmės vardas.'),(1965,'Patrė',' Patrė yra Moteriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Patricija..','Vardo reikšmė: Tačiau daugumai Jums kažkokiu būdu disponuoja pakankamomis lėšomis ir problemų dėl išlaidumo nejaučia, nes jums dažniausiai nuskyla būti santuokoje su pasiturinčiais partneriais.',' Patrė yra lietuvių kilmės vardas.'),(1966,'Pastoras',' Pastoras yra Vyriškas vardas.','Trumpa reikšmė: pastor „ganytojas“.','Vardo reikšmė: Jūs intravertai, labai kantrūs, rimti ir melancholiškai nusiteikę žmonės. Gera intuicija leidžia planuoti tolimą ateitį. ',' Pastoras yra lotynų kilmės vardas.'),(1967,'Paskalis',' Paskalis yra Vyriškas vardas.','Trumpa reikšmė: „Velykos“.','Vardo reikšmė: Labai mokate prisiderinti prie žymiausių autoritetų. Jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai.',' Paskalis yra hebrajų kilmės vardas.'),(1968,'Pilėnas',' Pilėnas yra Vyriškas vardas.','Trumpa reikšmė: liet., atgalinis darinys iš kunigaikščio Margirio pilies tariamo v. Pilėnai: pilėnas „pilies gyventojas“ - priesagos -ėnas vedinys iš liet. pilis..','Vardo reikšmė: Valios jėga ir rimtas charakteris leidžia susidoroti su bet kokiais projektais, todėl gera intuicija leidžia planuoti tolimą ateitį.',' Pilėnas yra lietuvių kilmės vardas.'),(1969,'Pijus',' Pijus yra Vyriškas vardas.','Trumpa reikšmė: lot. pius - „pamaldus“.','Vardo reikšmė: Jeigu jums nepasiseka atsidurti valdžioje ir turėti bent keletą pavaldinių, jaučiatės nepasiekę tikslo. Šie vardo turėtojai paklūsta griežtai disciplinai ir to paties reikalauja iš kitų. Dominuodami jie nesugeba įsiklausyti į kitų nuomonę girdi tik save.',' Pijus yra lotynų kilmės vardas.'),(1970,'Pamela',' Pamela yra Moteriškas vardas.','Trumpa reikšmė: graik., trump. Melė, iš sulotyninto graik. Pamela: graik. pan „visa“ + meli „medus“..','Vardo reikšmė: Labai mylite gyvenimą ir paprastai save aukojate kitų labui. Gera intuicija leidžia planuoti tolimą ateitį. Labai mokate prisiderinti prie žymiausių autoritetų. Jūs puikūs politiniai stra