ti momentų, kai reikės suprasti, jog tobulų nėra ir nesitikėti, jog viskas bus taip kaip jis nori. ',' Sinotas yra lietuvių kilmės vardas.'),(2243,'Sinotė',' Sinotė yra Moteriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Sinė, iš vyr. v. Sinotas..','Vardo reikšmė: Gyvenime dažnai gali pasitaikyti momentų, kai reikės suprasti, jog tobulų nėra ir nesitikėti, jog viskas bus taip kaip ji nori. ',' Sinotė yra lietuvių kilmės vardas.'),(2244,'Singailas',' Singailas yra Vyriškas vardas.','Trumpa reikšmė: „manyti, galvoti“.','Vardo reikšmė: Jis sugebės atjausti kitą, tačiau giliai viduje pats trokš meilės ir įvertinimo.',' Singailas yra lietuvių kilmės vardas.'),(2245,'Singailė',' Singailė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Sinė, iš vyr. avd. Singaila, žr. Singailas..','Vardo reikšmė: Jis sugebės atjausti kitą, tačiau giliai viduje pats trokš meilės ir įvertinimo.',' Singailė yra lietuvių kilmės vardas.'),(2246,'Simonas',' Simonas yra Vyriškas vardas.','Trumpa reikšmė: šimon „išklausymas“; dievas išklausė duodamas Lėjai sūnų.','Vardo reikšmė: Šie vardo turėtojai labai myli vaikus – tiek savus, tiek svetimus, tačiau be didesnio sentimentalumo. Vaikai jums – tas pats kas ir suaugę, tik laimingas vaikas turi savyje daugiau džiaugsmo, lūkesčių ateičiai.',' Simonas yra hebrajų kilmės vardas.'),(2247,'Simeonas',' Simeonas yra Vyriškas vardas.','Trumpa reikšmė: šimon „išklausymas“; dievas išklausė duodamas Lėjai sūnų.','Vardo reikšmė: Šie vardo turėtojai labai myli vaikus – tiek savus, tiek svetimus, tačiau be didesnio sentimentalumo. Vaikai jums – tas pats kas ir suaugę, tik laimingas vaikas turi savyje daugiau džiaugsmo, lūkesčių ateičiai.',' Simeonas yra hebrajų kilmės vardas.'),(2248,'Simas',' Simas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Simonas, Simona šimon „išklausymas“.','Vardo reikšmė: Šie vardo turėtojai labai myli vaikus – tiek savus, tiek svetimus, tačiau be didesnio sentimentalumo. Vaikai jums – tas pats kas ir suaugę, tik laimi