eigu kokiu nors žmogumi susidomite, tai šiam nebedaug lieka šansų nuo jūsų pasislėpti, kadangi Jums labai sunku nepaklusti.',' Sirmantė yra lietuvių kilmės vardas.'),(2261,'Sirmantas',' Sirmantas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Sirmas, sir- (žr. Sirgaudas) + mant- (žr. Symantas).','Vardo reikšmė: Jūsų partneriams turėtų būti paklusnios, švelnios antrosios pusės. Jūs – medžiotojai, turintys labai gerai išlavėjusią uoslę. Jeigu kokiu nors žmogumi susidomite, tai šiam nebedaug lieka šansų nuo jūsų pasislėpti, kadangi Jums labai sunku nepaklusti.',' Sirmantas yra lietuvių kilmės vardas.'),(2262,'Sirgaudė',' Sirgaudė yra Moteriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Sira, iš vyr. v. Sirgaudas.','Vardo reikšmė: Šių vardų savininkai visada randasi pačios triukšmingiausios kompanijos centre, mėgsta papasakoti keistų istorijų ar anekdotų. Jūs – aštrialiežuviai, linksmi, išradingi ir nesugebate nė minutei būti ramūs.',' Sirgaudė yra lietuvių, prūsų kilmės vardas.'),(2263,'Skiriotė',' Skiriotė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Skira, iš vyr. v. Skiriotas.','Vardo reikšmė: Šių vardų savininkai visada randasi pačios triukšmingiausios kompanijos centre, mėgsta papasakoti keistų istorijų ar anekdotų. Jūs – aštrialiežuviai, linksmi, išradingi ir nesugebate nė minutei būti ramūs.',' Skiriotė yra lietuvių kilmės vardas.'),(2264,'Skiriotas',' Skiriotas yra Vyriškas vardas.','Trumpa reikšmė: iš sen. trumpinio Skiras, kuris iš avd. su Skir-: Skirgaila, Skirvainas ir kt..','Vardo reikšmė: Šių vardų savininkai visada randasi pačios triukšmingiausios kompanijos centre, mėgsta papasakoti keistų istorijų ar anekdotų. Jūs – aštrialiežuviai, linksmi, išradingi ir nesugebate nė minutei būti ramūs.',' Skiriotas yra lietuvių kilmės vardas.'),(2265,'Skirgaila',' Skirgaila yra Vyriškas vardas.','Trumpa reikšmė: skir- (skirti„teikti, nustatyti, lemti) + gail- (gailas „stiprus“).','Vardo reikšmė: (1) liet., nauj. var. Skirgailas, trump. Skiras, skir- (: liet. skir-ti „teikti, nustatyti, lemti“) + gail- (žr. Sangailas)',' Skirgaila yra lietuvių kilmės vardas.'),(2266,'Skirgailė',' Skirgailė yra Moteriškas vardas.','Trumpa reikšmė: skir- (skirti„teikti, nustatyti, lemti) + gail- (gailas „stiprus“).','Vardo reikšmė: (1) liet., trump. Skira, iš vyr. v. Skirgaila',' Skirgailė yra lietuvių kilmės vardas.'),(2267,'Skiras',' Skiras yra Vyriškas vardas.','Trumpa reikšmė: liet., sen. trumpinys iš avd. su Skir-: Skirgaila, Skirvainas ir kt.','Vardo reikšmė: Vardadienis: Balandžio mėn. 12 d. – Skiro vardo diena.',' Skiras yra lietuvių kilmės vardas.'),(2268,'Skira',' Skira yra Moteriškas vardas.','Trumpa reikšmė: iš vyr. v. Skiras, taip pat trumpinys iš mot. vardų su Skir-: Skirgailė, Skirvainė, Skirvyda ir kt.','Vardo reikšmė: Šių vardų savininkai visada randasi pačios triukšmingiausios kompanijos centre, mėgsta papasakoti keistų istorijų ar anekdotų. Jūs – aštrialiežuviai, linksmi, išradingi ir nesugebate nė minutei būti ramūs.',' Skira yra lietuvių kilmės vardas.'),(2269,'Skaudvilė',' Skaudvilė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Skaudvė, iš vyr. v. Skaudvilas.','Vardo reikšmė: Jeigu teisingas posakis, kad “genijus – tai begalinis sugebėjimas kentėti”, tai Jūs tikrai genialus. Nuo gimimo jums būdingas meistriškumas ir tikslumas. Jei specializuojasi kokioje nors veikloje – geresnio už jį specialisto nerasi. Gera intuicija leidžia planuoti tolimą ateitį.',' Skaudvilė yra lietuvių kilmės vardas.'),(2270,'Skinija',' Skinija yra Moteriškas vardas.','Trumpa reikšmė: liet., iš upėvardžio Skinija (Gargždai).','Vardo reikšmė: Jūs nepriklausomi ir individualūs, bet kokia kaina trokštantys garbės. labai judrūs, energingi, nenustygstantys vietoje, linksmi, draugiški.',' Skinija yra lietuvių kilmės vardas.'),(2271,'Skaudvilas',' Skaudvilas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Skaudvys, skaud- (žr. Skaudminas) + vil- (žr. Sirvilas)..','Vardo reikšmė: Jeigu teisingas posakis, kad “genijus – tai begalinis sugebėjimas kentėti”, tai Jūs tikrai genialus. Nuo gimimo jums būdingas meistriškumas ir tikslumas. Jei specializuojasi kokioje nors veikloje – geresnio už jį specialisto nerasi. Gera intuicija leidžia planuoti tolimą ateitį.',' Skaudvilas yra lietuvių kilmės vardas.'),(2272,'Skaudminas',' Skaudminas yra Vyriškas vardas.','Trumpa reikšmė: „skriausti, engti“.','Vardo reikšmė: Jeigu teisingas posakis, kad “genijus – tai begalinis sugebėjimas kentėti”, tai Jūs tikrai genialus. Nuo gimimo jums būdingas meistriškumas ir tikslumas. Jei specializuojasi kokioje nors veikloje – geresnio už jį specialisto nerasi. Gera intuicija leidžia planuoti tolimą ateitį.',' Skaudminas yra lietuvių kilmės vardas.'),(2273,'Skalvis',' Skalvis yra Vyriškas vardas.','Trumpa reikšmė: lietuvių genties pavadinimas skalviai.','Vardo reikšmė: Jums reikalinga laisvė, nes norite patys priimti sprendimus, pasikliaudami savomis idėjomis. Turite sugebėjimų veikti jus supančią aplinką.',' Skalvis yra lietuvių kilmės vardas.'),(2274,'Skalvė',' Skalvė yra Moteriškas vardas.','Trumpa reikšmė:  lietuvių genties pavadinimas skalviai.','Vardo reikšmė: Jums reikalinga laisvė, nes norite patys priimti sprendimus, pasikliaudami savomis idėjomis. Turite sugebėjimų veikti jus supančią aplinką.',' Skalvė yra lietuvių kilmės vardas.'),(2275,'Skalamintė',' Skalamintė yra Moteriškas vardas.','Trumpa reikšmė: liet., nauj. var. Skalmintė (1), trump. Skalė, iš vyr. v. Skalamintas.','Vardo reikšmė: Šie vardo turėtojai turtus kraunasi rizikuodami finansinėmis akcijomis ir įkyriomis avantiūromis. Netgi patyrę pralaimėjimą, tokie žmonės sugeba vėl atkurti save. Pavojaus minutėmis jų fizinės jėgos labai padidėja.',' Skalamintė yra lietuvių kilmės vardas.'),(2276,'Skominas',' Skominas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Skomys, sko- (žr. Skomantas) + min- (žr. Skaudminas).','Vardo reikšmė: Šis Vyras gali būti labai intelektualus ir domėtis bet kuo, tačiau viskas kas susiję su paslaptimis, senove ir menu jį gali traukti labiausiai. Be to jam ypač gali sektis mechanikos ir elektronikos srityse. ',' Skominas yra lietuvių kilmės vardas.'),(2277,'Skomantė',' Skomantė yra Moteriškas vardas.','Trumpa reikšmė: sko- (skototis „rūpintis, stengtis“) + mant- (mantus „sumanus“).','Vardo reikšmė: Šis vardo savininkas gali būti labai intelektualus ir domėtis bet kuo, tačiau viskas kas susiję su paslaptimis, senove ir menu jį gali traukti labiausiai. Be to jam ypač gali sektis mechanikos ir elektronikos srityse. ',' Skomantė yra lietuvių kilmės vardas.'),(2278,'Skomantas',' Skomantas yra Vyriškas vardas.','Trumpa reikšmė: sko- (skototis „rūpintis, stengtis“) + mant- (mantus „sumanus“).','Vardo reikšmė: Šis vyras gali būti labai intelektualus ir domėtis bet kuo, tačiau viskas kas susiję su paslaptimis, senove ir menu jį gali traukti labiausiai. Be to jam ypač gali sektis mechanikos ir elektronikos srityse. ',' Skomantas yra lietuvių kilmės vardas.'),(2279,'Skolastika',' Skolastika yra Moteriškas vardas.','Trumpa reikšmė: scholastika „mokinė“.','Vardo reikšmė: Abejonės, nepasitikėjimas kitų sprendimais ir išankstinės nuomonės susidarymas gali būti vardo nešiotojo bruožas.',' Skolastika yra lotynų kilmės vardas.'),(2280,'Skirvydas',' Skirvydas yra Vyriškas vardas.','Trumpa reikšmė: skir- (skirti„teikti, nustatyti, lemti) + vyd- (iš-vydo).','Vardo reikšmė: Gyvenime dažnai gali pasitaikyti momentų, kai reikės suprasti, jog tobulų nėra ir nesitikėti, jog viskas bus taip kaip jis nori. ',' Skirvydas yra lietuvių kilmės vardas.'),(2281,'Skirvainas',' Skirvainas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Skiras, skir- (žr. Skirgaila) + vain- (žr. Syvainas).','Vardo reikšmė: Gyvenime dažnai gali pasitaikyti momentų, kai reikės suprasti, jog tobulų nėra ir nesitikėti, jog viskas bus taip kaip jis nori.',' Skirvainas yra lietuvių kilmės vardas.'),(2282,'Skirvainė',' Skirvainė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Skira, iš vyr. v. Skirvainas.','Vardo reikšmė: Gyvenime dažnai gali pasitaikyti momentų, kai reikės suprasti, jog tobulų nėra ir nesitikėti, jog viskas bus taip kaip ji nori.',' Skirvainė yra lietuvių kilmės vardas.'),(2283,'Skirtautė',' Skirtautė yra Moteriškas vardas.','Trumpa reikšmė: skir- (skirti„teikti, nustatyti, lemti) + taut- (tauta).','Vardo reikšmė: Rūpinimasis kitais, mokėjimas spręsti sudėtingus klausimus ir pedagoginis talentas gali jus išskirti iš minios.',' Skirtautė yra lietuvių kilmės vardas.'),(2284,'Skirtautas',' Skirtautas yra Vyriškas vardas.','Trumpa reikšmė: skir- (skirti„teikti, nustatyti, lemti) + taut- (tauta).','Vardo reikšmė: Rūpinimasis kitais, mokėjimas spręsti sudėtingus klausimus ir pedagoginis talentas gali jus išskirti iš minios.',' Skirtautas yra lietuvių kilmės vardas.'),(2285,'Skirmas',' Skirmas yra Vyriškas vardas.','Trumpa reikšmė: liet., trumpinys iš Skirmantas.','Vardo reikšmė: Rūpinimasis kitais, mokėjimas spręsti sudėtingus klausimus ir pedagoginis talentas gali jus išskirti iš minios.',' Skirmas yra lietuvių kilmės vardas.'),(2286,'Skirmantas',' Skirmantas yra Vyriškas vardas.','Trumpa reikšmė: skir- (skirti„teikti, nustatyti, lemti) +mant- (mantus „sumanus“).','Vardo reikšmė: Rūpinimasis kitais, mokėjimas spręsti sudėtingus klausimus ir pedagoginis talentas gali jus išskirti iš minios.',' Skirmantas yra lietuvių kilmės vardas.'),(2287,'Skirmantė',' Skirmantė yra Moteriškas vardas.','Trumpa reikšmė: skir- (skirti„teikti, nustatyti, lemti) +mant- (mantus „sumanus“).','Vardo reikšmė: Rūpinimasis kitais, mokėjimas spręsti sudėtingus klausimus ir pedagoginis talentas gali jus išskirti iš minios.',' Skirmantė yra lietuvių kilmės vardas.'),(2288,'Skirma',' Skirma yra Moteriškas vardas.','Trumpa reikšmė: liet., trumpinys iš Skirmantė.','Vardo reikšmė: Rūpinimasis kitais, mokėjimas spręsti sudėtingus klausimus ir pedagoginis talentas gali jus išskirti iš minios.',' Skirma yra lietuvių kilmės vardas.'),(2289,'Stasė',' Stasė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš St