viems egoistiniams tikslams įgyvendinti.',' Sofronija yra graikų kilmės vardas.'),(2297,'Sofija',' Sofija yra Moteriškas vardas.','Trumpa reikšmė: sophia „išmintis“.','Vardo reikšmė: Jūsų protas bei energija nukreipti saviems egoistiniams tikslams įgyvendinti.',' Sofija yra graikų kilmės vardas.'),(2298,'Snieguolė',' Snieguolė yra Moteriškas vardas.','Trumpa reikšmė: sniegas; pasakos „Snieguolė ir septyni nykštukai“ herojės vardas.','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Netgi nereikšmingos užduotys jų akimis įgyja pirmaeilės svarbos.',' Snieguolė yra lietuvių kilmės vardas.'),(2299,'Sniega',' Sniega yra Moteriškas vardas.','Trumpa reikšmė: liet., var. Sniegė, iš pasakos „Snieguolė ir septyni nykštukai“ herojės vardo varianto Sniega, — galūnės vedinys iš liet. sniegas..','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Netgi nereikšmingos užduotys jų akimis įgyja pirmaeilės svarbos.',' Sniega yra lietuvių kilmės vardas.'),(2300,'Skovilas',' Skovilas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Skovys, sko- (žr. Skomantas) + vil- (žr. Sirvilas).','Vardo reikšmė: Darbe, kaip ir visur, į pirmą vietą skiriate discipliną. Jūsų principas: geriau turėti žvirblį rankose negu gervę danguje.',' Skovilas yra lietuvių kilmės vardas.'),(2301,'Skovilė',' Skovilė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Skovė, iš vyr. v. Skovilas.','Vardo reikšmė: Darbe, kaip ir visur, į pirmą vietą skiriate discipliną. Jūsų principas: geriau turėti žvirblį rankose negu gervę danguje.',' Skovilė yra lietuvių kilmės vardas.'),(2302,'Skovydas',' Skovydas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Skovys, sko- (žr. Skomantas) + vyd- (žr. Sanvydas).','Vardo reikšmė: Turi labai stiprius jausmus, užjaučia draugus ir artimuosius. Kartais jiems sunku bendrauti su aplinkiniais, tačiau įgimtas protas visada padeda. Tie, kurie išdrįsta su jais užmegzti draugystę, niekada nebūna atstumti.',' Skovydas yra lietuvių kilmės vardas.'),(2303,'Sugaudas',' Sugaudas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Gaudas, su- (žr. Subartas) + gaud- (žr. Sangaudas).','Vardo reikšmė: Turi labai stiprius jausmus, užjaučia draugus ir artimuosius. Kartais jiems sunku bendrauti su aplinkiniais, tačiau įgimtas protas visada padeda. Tie, kurie išdrįsta su jais užmegzti draugystę, niekada nebūna atstumti.',' Sugaudas yra lietuvių kilmės vardas.'),(2304,'Steponė',' Steponė yra Moteriškas vardas.','Trumpa reikšmė: „vainikas“.','Vardo reikšmė: Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems.',' Steponė yra graikų kilmės vardas.'),(2305,'Steponas',' Steponas yra Vyriškas vardas.','Trumpa reikšmė: „vainikas“.','Vardo reikšmė: Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems. ',' Steponas yra graikų kilmės vardas.'),(2306,'Stepas',' Stepas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Steponas – „vainikas“.','Vardo reikšmė: Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems. ',' Stepas yra graikų kilmės vardas.'),(2307,'Stengvilė',' Stengvilė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Stengė, iš vyr. v. Stengvilas.','Vardo reikšmė: Gyvenimas jums žavingas todėl, kad jūs patys suteikiate jam tam tikrą prieskonį.',' Stengvilė yra lietuvių kilmės vardas.'),(2308,'Stengvilas',' Stengvilas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Stengys, steng- (: liet. steng-tis) + vil- (žr. Sirvilas).','Vardo reikšmė: Gyvenimas jums žavingas todėl, kad jūs patys suteikiate jam tam tikrą prieskonį.',' Stengvilas yra lietuvių kilmės vardas.'),(2309,'Stela',' Stela yra Moteriškas vardas.','Trumpa reikšmė: stella „žvaigždė“.','Vardo reikšmė: Jūs mielai pasirenkate pramogų vadovo postą. Loginis mąstymas atveria kelią į mokslinį darbą. ',' Stela yra lotynų kilmės vardas.'),(2310,'Steigvilas',' Steigvilas yra Vyriškas vardas.','Trumpa reikšmė: steig- (steigti „labai norėti“, steigtis „stengtis“) + vil- (viltis) – „viltis besistengiant pasiekti tikslą“.','Vardo reikšmė: Jūs mielai pasirenkate pramogų vadovo postą. Loginis mąstymas atveria kelią į mokslinį darbą. ',' Steigvilas yra lietuvių kilmės vardas.'),(2311,'Steigvilė',' Steigvilė yra Moteriškas vardas.','Trumpa reikšmė: steig- (steigti „labai norėti“, steigtis „stengtis“) + vil- (viltis) – „viltis besistengiant pasiekti tikslą“.','Vardo reikšmė: Jūs mielai pasirenkate pramogų vadovo postą. Loginis mąstymas atveria kelią į mokslinį darbą. ',' Steigvilė yra lietuvių kilmės vardas.'),(2312,'Steigintas',' Steigintas yra Vyriškas vardas.','Trumpa reikšmė: steig- (steigti „labai norėti“, steigtis „stengtis“) + gin- (ginti) –„besistengiantis apginti“.','Vardo reikšmė: Jūs galite būti geri teisininkai, medikai, literatūros tyrinėtojai, valstybės vadovai. Socialinis darbas, pedagogika, psichologija, netradicinė medicina – taip pat puikus pasirinkimas, nes jie moka visus išklausyti bei giliai analizuoti. ',' Steigintas yra lietuvių kilmės vardas.'),(2313,'Svajonė',' Svajonė yra Moteriškas vardas.','Trumpa reikšmė: svajonė „geidžiamas dalykas, apie kurį svajojama“.','Vardo reikšmė: Jūs galite būti geri teisininkai, medikai, literatūros tyrinėtojai, valstybės vadovai. Socialinis darbas, pedagogika, psichologija, netradicinė medicina – taip pat puikus pasirinkimas, nes jie moka visus išklausyti bei giliai analizuoti.',' Svajonė yra lietuvių kilmės vardas.'),(2314,'Svaja',' Svaja yra Moteriškas vardas.','Trumpa reikšmė: svaja „svajonė, svaigulys“.','Vardo reikšmė: Jūs galite būti geri teisininkai, medikai, literatūros tyrinėtojai, valstybės vadovai. Socialinis darbas, pedagogika, psichologija, netradicinė medicina – taip pat puikus pasirinkimas, nes jie moka visus išklausyti bei giliai analizuoti.',' Svaja yra lietuvių kilmės vardas.'),(2315,'Svaigedas',' Svaigedas yra Vyriškas vardas.','Trumpa reikšmė: sulietuvintas prūsų: svai- (prūs. swais „savas“) + ged- (gedėti „ilgėtis“) – „gedintis savų, artimųjų“.','Vardo reikšmė: Kartais Jūs elgiatės nenuspėjamai, kalbate šiurkščiai. Stengdamiesi pajungti žmones savo valiai, jie į kairę ir dešinę svaido “vertingus” nurodymus. Jums patinka kirsti iš peties, ir tokiomis minutėmis jūs galite priminti įsiutusį bulių.',' Svaigedas yra lietuvių kilmės vardas.'),(2316,'Svaigaudas',' Svaigaudas yra Vyriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Svaigas, svai- (žr. Svaidargas) + gaud- (žr. Sangaudas)..','Vardo reikšmė: Kartais Jūs elgiatės nenuspėjamai, kalbate šiurkščiai. Stengdamiesi pajungti žmones savo valiai, jie į kairę ir dešinę svaido “vertingus” nurodymus. Jums patinka kirsti iš peties, ir tokiomis minutėmis jūs galite priminti įsiutusį bulių.',' Svaigaudas yra lietuvių kilmės vardas.'),(2317,'Svaidargė',' Svaidargė yra Moteriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Svaida, iš vyr. v. Svaidargas.','Vardo reikšmė: Būdami savo darbo vergais, nuolat pabrėžia savo teisumą ir stengiasi vis pamokyti artimuosius bei bendradarbius. jūs turite tam tikrą išskirtinį bruožą. Jūs nemokate ilgai sėdėti ar būti vienoje vietoje – tuojau imate vaikštinėti po kambarį, perstatinėjate kėdes.',' Svaidargė yra lietuvių kilmės vardas.'),(2318,'Svaidargas',' Svaidargas yra Vyriškas vardas.','Trumpa reikšmė: „brangus“.','Vardo reikšmė: Būdami savo darbo vergais, nuolat pabrėžia savo teisumą ir stengiasi vis pamokyti artimuosius bei bendradarbius. jūs turite tam tikrą išskirtinį bruožą. Jūs nemokate ilgai sėdėti ar būti vienoje vietoje – tuojau imate vaikštinėti po kambarį, perstatinėjate kėdes.',' Svaidargas yra lietuvių kilmės vardas.'),(2319,'Suvainė',' Suvainė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Vainė, iš vyr. v. Suvainas.','Vardo reikšmė: Jos emocijas slepia viduje, o tai greitai atsiliepia į jų sveikatą – virškinimo ir nervų sistemoms.',' Suvainė yra lietuvių kilmės vardas.'),(2320,'Suvainas',' Suvainas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Vainius, Vainys, su- (žr. Subartas) + vain- (žr. Syvainas).','Vardo reikšmė: Šie vardo turėtojai iš pažiūros atrodo abejingi viskam, tačiau tai tik elgesio maniera, po kuria slepiasi didžiuliai dvasiniai išgyvenimai. Jie emocijas slepia viduje, o tai greitai atsiliepia į jų sveikatą – virškinimo ir nervų sistemoms.',' Suvainas yra lietuvių kilmės vardas.'),(2321,'Suvaidė',' Suvaidė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Vaidė, iš vyr. v. Suvaidas.','Vardo reikšmė: Šie vardo turėtojai iš pažiūros atrodo abejingi viskam, tačiau tai tik elgesio maniera, po kuria slepiasi didžiuliai dvasiniai išgyvenimai. Jie emocijas slepia viduje, o tai greitai atsiliepia į jų sveikatą – virškinimo ir nervų sistemoms.',' Suvaidė yra lietuvių kilmės vardas.'),(2322,'Suvaidas',' Suvaidas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Vaidas, su- (žr. Subartas) + vaid- (: liet. vaid-ytis „rodytis“, vaid-entis).','Vardo reikšmė: Šie vardo turėtojai iš pažiūros atrodo abejingi viskam, tačiau tai tik elgesio maniera, po kuria slepiasi didžiuliai dvasiniai išgyvenimai. Jie emocijas slepia viduje, o tai greitai atsiliepia į jų sveikatą – virškinimo ir nervų sistemoms.',' Suvaidas yra lietuvių kilmės vardas.'),(2323,'Sugintas',' Sugintas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Gintas, su- (žr. Subartas) + gint- (žr. Steigintas).','Vardo reikšmė: Jūs labai atjaučiantys, todėl nėra geresnių slaugytojų už jus. Tačiau dvasinis mąstymas ribotas. Bažnyčią lankote tik dėl to, kad bijote, jog kiti gali blogai apie jus pagalvoti. Jūs puikiausiai suprantate savo prasižengimus šiame pasaulyje, tačiau anapusinis pasaulis jūsų nedomina.',' Sugintas yra lietuvių kilmės vardas.'),(2324,'Svirmantas',' Svirmantas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Sviras, Svirius, svir- (žr. Svirgailas) + mant- (žr. Symantas).','Vardo reikšmė: Šis žmogus gali būti smulkmeniškas, linkęs į tobulumo paieškas, tačiau sąžiningas ir vertas pasitikėjimo. Vardo nešiotojas gali būti ypač energingas, dominuojantis ir linkęs elgtis azartiškai. Nepaisant to, finansinis saugumas visada bus vienas iš jo gyvenimo prioritetų.',' Svirmantas yra lietuvių kilmės vardas.'),(2325,'Svirmantė',' Svirmantė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Svira, Svirė, iš vyr. v. Svirmantas.','Vardo reikšmė: Šis žmogus gali būti smulkmeniškas, linkęs į tobulumo paieškas, tačiau sąžiningas ir vertas pasitikėjimo. Vardo nešiotojas gali būti ypač energingas, dominuojantis ir linkęs elgtis azartiškai. Nepaisant to, finansinis saugumas visada bus vienas iš jo gyvenimo prioritetų.',' Svirmantė yra lietuvių kilmės vardas.'),(2326,'Svirkantas',' Svirkantas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Sviras, Svirius, svir- (žr. Svirgailas) + kant- (: liet. pa-kant-us, kant-rus).','Vardo reikšmė: Vardadienis: Balandžio mėn. 9 d. – Svirkanto vardo diena.',' Svirkantas yra lietuvių kilmės vardas.'),(2327,'Svirgedas',' Svirgedas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Sviras, Svirius, svir- (žr. Svirgailas) + ged- (žr. Sangedas).','Vardo reikšmė: Apskritai taktiški, jų aistros gilios, turi potraukį mokslams, dažniausiai geri lektoriai. Jie gali puikiai vesti pokalbius, turi rašytojo talentą, puikų intelektą; kūrybiškai mažiau aktyvūs.',' Svirgedas yra lietuvių kilmės vardas.'),(2328,'Svirgaudas',' Svirgaudas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Sviras, Svirius, svir- (žr. Svirgailas) + gaud- (žr. Sangaudas).','Vardo reikšmė: Apskritai taktiški, jų aistros gilios, turi potraukį mokslams, dažniausiai geri lektoriai. Jie gali puikiai vesti pokalbius, turi rašytojo talentą, puikų intelektą; kūrybiškai mažiau aktyvūs.',' Svirgaudas yra lietuvių kilmės vardas.'),(2329,'Svirgantas',' Svirgantas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Sviras, Svirius, svir- (žr. Svirgailas) + gant- (: liet. gan-yti „saugoti“, plg. gin-ti).','Vardo reikšmė: Apskritai taktiški, jų aistros gilios, turi potraukį mokslams, dažniausiai geri lektoriai. Jie gali puikiai vesti pokalbius, turi rašytojo talentą, puikų intelektą; kūrybiškai mažiau aktyvūs.',' Svirgantas yra lietuvių kilmės vardas.'),(2330,'Svirgailė',' Svirgailė yra Moteriškas vardas.','Trumpa reikšmė: svir- (svirti, svirus, svarbus ) + gail- (gailas „stiprus“).','Vardo reikšmė: Žmogus šiuo vardu ko gero turės pakankamai ištvermės, kad galėtų suvaldyti nuosavą verslą.',' Svirgailė yra lietuvių kilmės vardas.'),(2331,'Svirgailas',' Svirgailas yra Vyriškas vardas.','Trumpa reikšmė: svir- (svirti, svirus, svarbus ) + gail- (gailas „stiprus“).','Vardo reikšmė: Žmogus šiuo vardu ko gero turės pakankamai ištvermės, kad galėtų suvaldyti nuosavą verslą.',' Svirgailas yra lietuvių kilmės vardas.'),(2332,'Svalia',' Svalia yra Moteriškas vardas.','Trumpa reikšmė: iš upėvardžio Svalia (Pasvalys).','Vardo reikšmė: Moka prisitaikyti, gali lengvai pamėgdžioti, tačiau tuo pačiu labai jausmingi ir užsigaunantys. ',' Svalia yra lietuvių kilmės vardas.'),(2333,'Svajūnė',' Svajūnė yra Moteriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Svaja, iš vyr. v. Svajūnas.','Vardo reikšmė: Moka prisitaikyti, gali lengvai pamėgdžioti, tačiau tuo pačiu labai jausmingi ir užsigaunantys.',' Svajūnė yra lietuvių kilmės vardas.'),(2334,'Svajūnas',' Svajūnas yra Vyriškas vardas.','Trumpa reikšmė: „svajojantis“.','Vardo reikšmė: Moka prisitaikyti, gali lengvai pamėgdžioti, tačiau tuo pačiu labai jausmingi ir užsigaunantys.',' Svajūnas yra lietuvių kilmės vardas.'),(2335,'Tamošius',' Tamošius yra Vyriškas vardas.','Trumpa reikšmė: pasenęs vardas iš lenkų Tomasz, kuris iš sulotyninto hebr. Thomas, žr. Tomas..','Vardo reikšmė: Geri matematikai; politikoje jie agitatoriai ir demagogai, dažniausiai – tarpininkai, tačiau kartais jiems pavyksta ir kūrimas.',' Tamošius yra lietuvių kilmės vardas.'),(2336,'Tamara',' Tamara yra Moteriškas vardas.','Trumpa reikšmė: „palmė“.','Vardo reikšmė: (2) hebr., trump. Tamė, Mara: iš sulotyninto hebr. Tamara iš hebr. Tamar -„palmė“',' Tamara yra hebrajų kilmės vardas.'),(2337,'Talius',' Talius yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Vitalius.','Vardo reikšmė: Jie trokšta, kad juos suptų grožis, komfortas, muzika, harmonija ir taika. Mėgsta padėti žmonėms, netgi jei to niekas ir neprašo.',' Talius yra lotynų kilmės vardas.'),(2338,'Tadė',' Tadė yra Moteriškas vardas.','Trumpa reikšmė: „drąsusis, ryžtingas“.','Vardo reikšmė: Jūs galite dirbti bet kokioje srityje, kur tik reikia protingai elgtis su pinigais. Jūs atkakliu darbu užsidirbate savo pinigus ir nesiimate lošti nesąžiningų žaidimų.',' Tadė yra hebrajų kilmės vardas.'),(2339,'Tadas',' Tadas yra Vyriškas vardas.','Trumpa reikšmė: drąsusis, ryžtingas.','Vardo reikšmė: Tokia nuostata gali jiems daug kainuoti, nes gali išsekti savi resursai – biologiniai ar socialiniai.',' Tadas yra hebrajų kilmės vardas.'),(2340,'Tarvilas',' Tarvilas yra Vyriškas vardas.','Trumpa reikšmė: tar- (tarti) + vil- (viltis).','Vardo reikšmė: Jie protingi, tačiau mąstymo procesas, kaip ir pats gyvenimas, neorganizuotas ir išbarstytas.',' Tarvilas yra lietuvių kilmės vardas.'),(2341,'Tarvilė',' Tarvilė yra Moteriškas vardas.','Trumpa reikšmė: tar- (tarti) + vil- (viltis).','Vardo reikšmė: Jie protingi, tačiau mąstymo procesas, kaip ir pats gyvenimas, neorganizuotas ir išbarstytas.',' Tarvilė yra lietuvių kilmės vardas.'),(2342,'Tarvydas',' Tarvydas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Tarys, Vydas, tar- (žr. Tarvainas) + vyd- (: liet. iš-vyd-o, iš-vysti).','Vardo reikšmė: Jūs labai stiprus, valingas, kartais tiesiog nesuvaldomas charakteris, kuris pasireiškia visose gyvenimo sferose, taip pat ir su moterimis. Norėdami pasiekti savo, jie naudoja įvairius būdus, sugeba būti klastingi ir apgaunantys, dažnai tokiu elgesiu susikuria sau sunkumų ten, kur jų nėra.',' Tarvydas yra lietuvių kilmės vardas.'),(2343,'Tarvainas',' Tarvainas yra Vyriškas vardas.','Trumpa reikšmė: tar- (tarti) + vain- (vaina „priežastis, kaltė“).','Vardo reikšmė: Gerai, kai jų praktiškumas paremiamas įvairiapusiu darbu. Jie puikūs visokiausių darbų specialistai, nors intelektualinius klausimus sprendžia sunkiai. Filosofija, kaip ir fantastika – ne jiems.',' Tarvainas yra lietuvių kilmės vardas.'),(2344,'Tarvainė',' Tarvainė yra Moteriškas vardas.','Trumpa reikšmė: tar- (tarti) + vain- (vaina „priežastis, kaltė“).','Vardo reikšmė: Gerai, kai jų praktiškumas paremiamas įvairiapusiu darbu. Jie puikūs visokiausių darbų specialistai, nors intelektualinius klausimus sprendžia sunkiai. Filosofija, kaip ir fantastika – ne jiems.',' Tarvainė yra lietuvių kilmės vardas.'),(2345,'Tariotė',' Tariotė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Tarė, iš vyr. v. Tariotas.','Vardo reikšmė: Ypatingai draugiški su vaikais – savais ir svetimais, tačiau tai daro be perdėto sentimentalumo. Vaikai jiems – tas pat kaip ir suaugusieji, tiktai laimingi vaikai savyje sukaupia daugiau džiaugsmo, tikėjimo laiminga ateitimi. Todėl Jūs vaikus laikote tikrais savo draugais.',' Tariotė yra lietuvių kilmės vardas.'),(2346,'Tariotas',' Tariotas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Tarys, priesagos -io-tas vedinys iš sen. trump. Taras, Tarys, kurie iš vardų su Tar-: Tarvainas, Tarvydas, Tarvilas ir kt.','Vardo reikšmė: Ypatingai draugiški su vaikais – savais ir svetimais, tačiau tai daro be perdėto sentimentalumo. Vaikai jiems – tas pat kaip ir suaugusieji, tiktai laimingi vaikai savyje sukaupia daugiau džiaugsmo, tikėjimo laiminga ateitimi. Todėl Jūs vaikus laikote tikrais savo draugais.',' Tariotas yra lietuvių kilmės vardas.'),(2347,'Tanvilas',' Tanvilas yra Vyriškas vardas.','Trumpa reikšmė: tan- (tanus „linkęs tinti, didėti“, tandus „standus, tamprus“) + vil- (viltis).','Vardo reikšmė: Šiems vardų turėtojamss labai gerai sekasi turtiniuose reikaluose, ir jie triumfuoja investavę į labai brangius projektus.',' Tanvilas yra lietuvių kilmės vardas.'),(2348,'Tanvilė',' Tanvilė yra Moteriškas vardas.','Trumpa reikšmė: tan- (tanus „linkęs tinti, didėti“, tandus „standus, tamprus“) + vil- (viltis).','Vardo reikšmė: Šiems vardų turėtojamss labai gerai sekasi turtiniuose reikaluose, ir jie triumfuoja investavę į labai brangius projektus.',' Tanvilė yra lietuvių kilmės vardas.'),(2349,'Tanmantė',' Tanmantė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Tanė, iš vyr. v. Tanmantas.','Vardo reikšmė: Jie stichiški ir plačių užmojų žmonės, kurių veiksmus sunku numatyti. Tai visų darbų meistrai ! ',' Tanmantė yra lietuvių kilmės vardas.'),(2350,'Tanmantas',' Tanmantas yra Vyriškas vardas.','Trumpa reikšmė: „turtas“.','Vardo reikšmė: Jie stichiški ir plačių užmojų žmonės, kurių veiksmus sunku numatyti. Tai visų darbų meistrai ! ',' Tanmantas yra lietuvių kilmės vardas.'),(2351,'Tangėlė',' Tangėlė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Tanė, Tangė, iš vyr. v. Tangėlas.','Vardo reikšmė: Šis žmogus turėtų labai atsakingai rūpintis šeima, tačiau permainos, pokyčiai ir nuotykiai bus dažni jo palydovai. Vardas skatina gilumino žavesio pasireiškimą ir stiprių jausmų proveržį. ',' Tangėlė yra lietuvių kilmės vardas.'),(2352,'Tangėlas',' Tangėlas yra Vyriškas vardas.','Trumpa reikšmė: „didelis skausmas“.','Vardo reikšmė: Šis žmogus turėtų labai atsakingai rūpintis šeima, tačiau permainos, pokyčiai ir nuotykiai bus dažni jo palydovai. Vardas skatina gilumino žavesio pasireiškimą ir stiprių jausmų proveržį. ',' Tangėlas yra lietuvių kilmės vardas.'),(2353,'Tanbutas',' Tanbutas yra Vyriškas vardas.','Trumpa reikšmė: „linkęs pūstis, didėti“.','Vardo reikšmė: Šis žmogus turėtų labai atsakingai rūpintis šeima, tačiau permainos, pokyčiai ir nuotykiai bus dažni jo palydovai. Vardas skatina gilumino žavesio pasireiškimą ir stiprių jausmų proveržį. ',' Tanbutas yra lietuvių kilmės vardas.'),(2354,'Tautgirdė',' Tautgirdė yra Moteriškas vardas.','Trumpa reikšmė: taut- (tauta) + gird- (girdi) – „girdinti tauta“.','Vardo reikšmė: Šie vardo savininkai gali būti labai intelektualūs ir domėtis bet kuo, tačiau viskas kas susiję su paslaptimis, senove ir menu jį gali traukti labiausiai. Be to jam ypač gali sektis mechanikos ir elektronikos srityse. Tai protingo, talentingo ir mažai kuo pasikliaujančio žmogaus vardas. ',' Tautgirdė yra lietuvių kilmės vardas.'),(2355,'Tautgirdas',' Tautgirdas yra Vyriškas vardas.','Trumpa reikšmė: taut- (tauta) + gird- (girdi) – „girdinti tauta“.','Vardo reikšmė: (1) liet., trump. Tautas, Taučius, taut- (žr. Tautgailas) + gird- (: liet. gird-ėti, gird-as „žinia, gandas“)',' Tautgirdas yra lietuvių kilmės vardas.'),(2356,'Tautginas',' Tautginas yra Vyriškas vardas.','Trumpa reikšmė: taut- (tauta) + gin- (ginti) – „ginantis tautą“.','Vardo reikšmė: (1) liet., trump. Tautas, Taučius, taut- (žr. Tautgailas) + gin- (: liet. gin-ti, gin-a „užstoti, saugoti“)',' Tautginas yra lietuvių kilmės vardas.'),(2357,'Tautgintas',' Tautgintas yra Vyriškas vardas.','Trumpa reikšmė: taut- (tauta) + gint- (ginti) – „ginantis tautą“.','Vardo reikšmė: (1) liet., trump. Tautas, Taučius, taut- (žr. Tautgailas) + gint- (: liet. gint-as, ginti)',' Tautgintas yra lietuvių kilmės vardas.'),(2358,'Tautgailas',' Tautgailas yra Vyriškas vardas.','Trumpa reikšmė: taut- (tauta) + gail- (gailas „stiprus“) – „stipri tauta“.','Vardo reikšmė: Šie vardo savininkai gali būti labai intelektualūs ir domėtis bet kuo, tačiau viskas kas susiję su paslaptimis, senove ir menu jį gali traukti labiausiai. Be to jam ypač gali sektis mechanikos ir elektronikos srityse. Tai protingo, talentingo ir mažai kuo pasikliaujančio žmogaus vardas. ',' Tautgailas yra lietuvių kilmės vardas.'),(2359,'Tautgailė',' Tautgailė yra Moteriškas vardas.','Trumpa reikšmė: taut- (tauta) + gail- (gailas „stiprus“) – „stipri tauta“.','Vardo reikšmė: Šie vardo savininkai gali būti labai intelektualūs ir domėtis bet kuo, tačiau viskas kas susiję su paslaptimis, senove ir menu jį gali traukti labiausiai. Be to jam ypač gali sektis mechanikos ir elektronikos srityse. Tai protingo, talentingo ir mažai kuo pasikliaujančio žmogaus vardas. ',' Tautgailė yra lietuvių kilmės vardas.'),(2360,'Tautenis',' Tautenis yra Vyriškas vardas.','Trumpa reikšmė: tauta – „tautos žmogus, atsidavęs tautai“.','Vardo reikšmė: Tai žmogus, kuris jausis laimingu darydamas gera kitiems, ypač silpnesniems už save. Jis sugebės atjausti kitą, tačiau giliai viduje pats trokš meilės ir įvertinimo. Rūpinimasis kitais, mokėjimas spręsti sudėtingus klausimus ir pedagoginis talentas gali jį išskirti iš minios.',' Tautenis yra lietuvių kilmės vardas.'),(2361,'Tautenė',' Tautenė yra Moteriškas vardas.','Trumpa reikšmė: tauta – „tautos žmogus, atsidavęs tautai“.','Vardo reikšmė: Tai žmogus, kuris jausis laimingu darydamas gera kitiems, ypač silpnesniems už save. Jis sugebės atjausti kitą, tačiau giliai viduje pats trokš meilės ir įvertinimo. Rūpinimasis kitais, mokėjimas spręsti sudėtingus klausimus ir pedagoginis talentas gali jį išskirti iš minios.',' Tautenė yra lietuvių kilmės vardas.'),(2362,'Tautė',' Tautė yra Moteriškas vardas.','Trumpa reikšmė: tauta – „tautos žmogus, atsidavęs tautai“.','Vardo reikšmė: Tai žmogus, kuris jausis laimingu darydamas gera kitiems, ypač silpnesniems už save. Jis sugebės atjausti kitą, tačiau giliai viduje pats trokš meilės ir įvertinimo. Rūpinimasis kitais, mokėjimas spręsti sudėtingus klausimus ir pedagoginis talentas gali jį išskirti iš minios.',' Tautė yra lietuvių kilmės vardas.'),(2363,'Tautas',' Tautas yra Vyriškas vardas.','Trumpa reikšmė: tauta – „tautos žmogus, atsidavęs tautai“.','Vardo reikšmė: Tai žmogus, kuris jausis laimingu darydamas gera kitiems, ypač silpnesniems už save. Jis sugebės atjausti kitą, tačiau giliai viduje pats trokš meilės ir įvertinimo. Rūpinimasis kitais, mokėjimas spręsti sudėtingus klausimus ir pedagoginis talentas gali jį išskirti iš minios.',' Tautas yra lietuvių kilmės vardas.'),(2364,'Taurė',' Taurė yra Moteriškas vardas.','Trumpa reikšmė: „dora, kilni“.','Vardo reikšmė: Abejonės, nepasitikėjimas kitų sprendimais ir išankstinės nuomonės susidarymas gali būti vardo nešiotojo bruožas.',' Taurė yra lietuvių kilmės vardas.'),(2365,'Tauras',' Tauras yra Vyriškas vardas.','Trumpa reikšmė: tauras „laukinis jautis“.','Vardo reikšmė: Abejonės, nepasitikėjimas kitų sprendimais ir išankstinės nuomonės susidarymas gali būti vardo nešiotojo bruožas.',' Tauras yra lietuvių kilmės vardas.'),(2366,'Tautvaldė',' Tautvaldė yra Moteriškas vardas.','Trumpa reikšmė: taut- (tauta) + vald- (valdyti) – „valdantis tautą“.','Vardo reikšmė: Jūsų teigiamos savybės: artistiškumas, potraukis į nežabotas linksmybes, polinkis į kūrybą, romantiškumas, aistringumas, linksmumas, platūs interesai.',' Tautvaldė yra lietuvių kilmės vardas.'),(2367,'Tautvaldas',' Tautvaldas yra Vyriškas vardas.','Trumpa reikšmė: taut- (tauta) + vald- (valdyti) – „valdantis tautą“.','Vardo reikšmė: Jūsų teigiamos savybės: artistiškumas, potraukis į nežabotas linksmybes, polinkis į kūrybą, romantiškumas, aistringumas, linksmumas, platūs interesai.',' Tautvaldas yra lietuvių kilmės vardas.'),(2368,'Tautvaišas',' Tautvaišas yra Vyriškas vardas.','Trumpa reikšmė: „kiemas, kaimas“.','Vardo reikšmė: Sugebate paversti savo emocijas žodžiais. ',' Tautvaišas yra lietuvių kilmės vardas.'),(2369,'Tautvaišė',' Tautvaišė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Tautė, iš vyr. v. Tautvaišas.','Vardo reikšmė: Sugebate paversti savo emocijas žodžiais. ',' Tautvaišė yra lietuvių kilmės vardas.'),(2370,'Tautrimas',' Tautrimas yra Vyriškas vardas.','Trumpa reikšmė: taut- (tauta) + rim- (rimti) – „ramaus būdo tauta“.','Vardo reikšmė: Dėl savo originalumo jūs galite sublizgėti bet kokioje meno srityje.',' Tautrimas yra lietuvių kilmės vardas.'),(2371,'Tautrimė',' Tautrimė yra Moteriškas vardas.','Trumpa reikšmė: taut- (tauta) + rim- (rimti) – „ramaus būdo tauta“.','Vardo reikšmė: Dėl savo originalumo jūs galite sublizgėti bet kokioje meno srityje.',' Tautrimė yra lietuvių kilmės vardas.'),(2372,'Tautminas',' Tautminas yra Vyriškas vardas.','Trumpa reikš