mi, kai kuriuos kamuoja neurastenija ar kokia nors manija. ',' Tolvaldė yra lietuvių kilmės vardas.'),(2408,'Tolvaldas',' Tolvaldas yra Vyriškas vardas.','Trumpa reikšmė: tol- (toli) + vald- (valdyti).','Vardo reikšmė: Kartais išgyvena nepasitikėjimą savimi, kai kuriuos kamuoja neurastenija ar kokia nors manija. ',' Tolvaldas yra lietuvių kilmės vardas.'),(2409,'Tolvaišė',' Tolvaišė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Tolė, iš vyr. v. Tolvaišas.','Vardo reikšmė: Kartais išgyvena nepasitikėjimą savimi, kai kuriuos kamuoja neurastenija ar kokia nors manija. ',' Tolvaišė yra lietuvių kilmės vardas.'),(2410,'Tolvaišas',' Tolvaišas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Tolys, tol- (žr. Tolbaudas) + vaiš- (žr. Tautvaišas).','Vardo reikšmė: Kartais išgyvena nepasitikėjimą savimi, kai kuriuos kamuoja neurastenija ar kokia nors manija. ',' Tolvaišas yra lietuvių kilmės vardas.'),(2411,'Tolminas',' Tolminas yra Vyriškas vardas.','Trumpa reikšmė: tol- (toli) + min- (minėti).','Vardo reikšmė: Kartais išgyvena nepasitikėjimą savimi, kai kuriuos kamuoja neurastenija ar kokia nors manija. ',' Tolminas yra lietuvių kilmės vardas.'),(2412,'Tolmantė',' Tolmantė yra Moteriškas vardas.','Trumpa reikšmė: tol- (toli) + mant- (mantus „sumanus“).','Vardo reikšmė: Jūs – mąstytojai, turintys tvirtą valią ir nusistatymą. Metodiški, drausmingi ir mylintys darbą, galimi aiškiaregystės pasireiškimai. ',' Tolmantė yra lietuvių kilmės vardas.'),(2413,'Tolmantas',' Tolmantas yra Vyriškas vardas.','Trumpa reikšmė: tol- (toli) + mant- (mantus „sumanus“).','Vardo reikšmė: Kartais išgyvena nepasitikėjimą savimi, kai kuriuos kamuoja neurastenija ar kokia nors manija. ',' Tolmantas yra lietuvių kilmės vardas.'),(2414,'Tolys',' Tolys yra Vyriškas vardas.','Trumpa reikšmė: liet., trumpinys iš avd. su Tol-: Tolmantas, Tolminas, Tolvydas ir kt..','Vardo reikšmė: Kartais išgyvena nepasitikėjimą savimi, kai kuriuos kamuoja neurastenija ar kokia nors manija. ',' Tolys yra lietuvių kilmės vardas.'),(2415,'Toliotė',' Toliotė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Tolė, iš vyr. v. Toliotas..','Vardo reikšmė: Tačiau nepastovaus charakterio, dėl ko kartais tampate šiurkštūs. Jūs išdidūs, tačiau jautrūs žmonės. Visur ir visada teisūs, todėl sunku su jumis bendrauti.',' Toliotė yra lietuvių kilmės vardas.'),(2416,'Toliotas',' Toliotas yra Vyriškas vardas.','Trumpa reikšmė: „jojimas“.','Vardo reikšmė: Tačiau nepastovaus charakterio, dėl ko kartais tampate šiurkštūs. Jūs išdidūs, tačiau jautrūs žmonės. Visur ir visada teisūs, todėl sunku su jumis bendrauti.',' Toliotas yra lietuvių kilmės vardas.'),(2417,'Toldravas',' Toldravas yra Moteriškas vardas.','Trumpa reikšmė: „stiprus, tvirtas (kaip medis)“.','Vardo reikšmė: Tačiau nepastovaus charakterio, dėl ko kartais tampate šiurkštūs. Jūs išdidūs, tačiau jautrūs žmonės. Visur ir visada teisūs, todėl sunku su jumis bendrauti.',' Toldravas yra lietuvių kilmės vardas.'),(2418,'Toldravė',' Toldravė yra Moteriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Tolė, iš vyr. v. Toldravas.','Vardo reikšmė: Tačiau nepastovaus charakterio, dėl ko kartais tampate šiurkštūs. Jūs išdidūs, tačiau jautrūs žmonės. Visur ir visada teisūs, todėl sunku su jumis bendrauti.',' Toldravė yra lietuvių kilmės vardas.'),(2419,'Tulgirdas',' Tulgirdas yra Vyriškas vardas.','Trumpa reikšmė: sulietuvintas prūsų: tul- (tulan „daug“, tūlas „dažnas, daugelis“) + gird- (girdėti).','Vardo reikšmė: Tačiau nepastovaus charakterio, dėl ko kartais tampate šiurkštūs. Jūs išdidūs, tačiau jautrūs žmonės. Visur ir visada teisūs, todėl sunku su jumis bendrauti.',' Tulgirdas yra lietuvių kilmės vardas.'),(2420,'Tulgedas',' Tulgedas yra Vyriškas vardas.','Trumpa reikšmė: sulietuvintas prūsų: tul- (tulan „daug“, tūlas „dažnas, daugelis“) + ged- (gedėti „ilgėtis“).','Vardo reikšmė: Jūs gimę kolekcionieriai. Jūsų namuose daugybė įdomių daiktų. Sienas puošia antikvariniai paveikslai, turi daug muzikos įrašų. Jūsų profesijos: ekonomistai, teisininkai, profesionalūs sportininkai, dvasininkai, slaptieji agentai, šnipai.',' Tulgedas yra lietuvių kilmės vardas.'),(2421,'Tulgaudas',' Tulgaudas yra Vyriškas vardas.','Trumpa reikšmė: sulietuvintas prūsų: tul- (tulan „daug“, tūlas „dažnas, daugelis“) + gaud- (gaudyti).','Vardo reikšmė: Jūs gimę kolekcionieriai. Jūsų namuose daugybė įdomių daiktų. Sienas puošia antikvariniai paveikslai, turi daug muzikos įrašų. Jūsų profesijos: ekonomistai, teisininkai, profesionalūs sportininkai, dvasininkai, slaptieji agentai, šnipai.',' Tulgaudas yra lietuvių kilmės vardas.'),(2422,'Tulė',' Tulė yra Moteriškas vardas.','Trumpa reikšmė:  trumpinys iš Tulgauda, Tulgeda, Tulkantas sulietuvintas prūsų: tul- (tulan „daug“, tūlas „dažnas, daugelis“).','Vardo reikšmė: Jūs gimę kolekcionieriai. Jūsų namuose daugybė įdomių daiktų. Sienas puošia antikvariniai paveikslai, turi daug muzikos įrašų. Jūsų profesijos: ekonomistai, teisininkai, profesionalūs sportininkai, dvasininkai, slaptieji agentai, šnipai.',' Tulė yra lietuvių kilmės vardas.'),(2423,'Trynė',' Trynė yra Moteriškas vardas.','Trumpa reikšmė: vak. liet. trumpinys iš Katrynė, žr. Katarina.','Vardo reikšmė: Kaip bendradarbiai – patikimi, geri draugai, bebaimiai, dosnūs. Juos daugiau valdo jausmai negu protas. ',' Trynė yra lietuvių kilmės vardas.'),(2424,'Trūdė',' Trūdė yra Moteriškas vardas.','Trumpa reikšmė: vak. liet. trumpinys iš Gertrūda.','Vardo reikšmė: Šie vardo savininkai rūpinasi materialine ateitimi, apie tai, kas būtina pasiturinčiam gyvenimui, ir tai jiems sekasi gana gerai, nes jie tikri finansų genijai; žino, kur taupyti ir kaip paskirstyti pinigus. ',' Trūdė yra lietuvių kilmės vardas.'),(2425,'Traidenis',' Traidenis yra Vyriškas vardas.','Trumpa reikšmė: traid- (traidalioti „smarkauti; daug plepėti“) +-en- – „tas, kuris daug kalba, energingas“.','Vardo reikšmė: Tai šaunus vardas Jums patinka viskas, kas puiku, ir jūs patys nestokojate linksmo būdo. Dažnai patys esate išoriškai itin patrauklūs, seksualūs, retkarčiais ir išdidūs, itin daug dėmesio skiriate savo išvaizdai, jos priežiūrai. ',' Traidenis yra lietuvių kilmės vardas.'),(2426,'Topilis',' Topilis yra Vyriškas vardas.','Trumpa reikšmė: žr. Teofilis..','Vardo reikšmė: Mėgstantis vadovauti, energingas ir užsispyręs, gan ūmaus būdo, tačiau vengiantis konfliktų.',' Topilis yra graikų kilmės vardas.'),(2427,'Topilė',' Topilė yra Moteriškas vardas.','Trumpa reikšmė: žr. Teofilė.','Vardo reikšmė: Mėgstantis vadovauti, energingas ir užsispyręs, gan ūmaus būdo, tačiau vengiantis konfliktų.',' Topilė yra graikų kilmės vardas.'),(2428,'Tvirmantas',' Tvirmantas yra Vyriškas vardas.','Trumpa reikšmė: tvir- (tvirtas) + mant- (mantus „sumanus“).','Vardo reikšmė: Vardadienis: Birželio mėn. 11 d. – Tvirmanto vardo diena.',' Tvirmantas yra lietuvių kilmės vardas.'),(2429,'Tvirmantė',' Tvirmantė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Tvira, iš vyr. v. Tvirmantas.','Vardo reikšmė: Vardadienis: Sausio mėn. 12 d. – Tvirmantės vardo diena.',' Tvirmantė yra lietuvių kilmės vardas.'),(2430,'Tvirgedas',' Tvirgedas yra Vyriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Tviras, tvir- (žr. Tvirbutas) + ged- (žr. Tulgedas).','Vardo reikšmė: Dažniau pasikliaukite savimi, kadangi mokate aiškiai matyti ir suprasti įvairių žmonių nuomones, išgirsti jų argumentus, suprasti jų pozicijas. Įvairiose srityse reikia tokiais gebėjimais pasižyminčių žmonių, kurie sugebėtų suburti bendram tikslui skirtingas asmenybes. ',' Tvirgedas yra lietuvių kilmės vardas.'),(2431,'Tvirbutė',' Tvirbutė yra Moteriškas vardas.','Trumpa reikšmė: liet., trump. Tvira, iš vyr. v. Tvirbutas.','Vardo reikšmė: Dažniau pasikliaukite savimi, kadangi mokate aiškiai matyti ir suprasti įvairių žmonių nuomones, išgirsti jų argumentus, suprasti jų pozicijas. Įvairiose srityse reikia tokiais gebėjimais pasižyminčių žmonių, kurie sugebėtų suburti bendram tikslui skirtingas asmenybes. ',' Tvirbutė yra lietuvių kilmės vardas.'),(2432,'Tulvirdas',' Tulvirdas yra Vyriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Tulys, tul- (žr. Tulgaudas) + vird- (: prūs. wirds „žodis“, plg. latv. vards „žodis“, liet. vardas).','Vardo reikšmė: Jūs gimę kolekcionieriai. Jūsų namuose daugybė įdomių daiktų. Sienas puošia antikvariniai paveikslai, turi daug muzikos įrašų. Jūsų profesijos: ekonomistai, teisininkai, profesionalūs sportininkai, dvasininkai, slaptieji agentai, šnipai.',' Tulvirdas yra lietuvių kilmės vardas.'),(2433,'Tulminas',' Tulminas yra Vyriškas vardas.','Trumpa reikšmė: liet., trump. Tulys, tul- (žr. Tulgaudas) + min- (žr. Tautminas)..','Vardo reikšmė: Net didžiausias chaosas jūsų rankose gali virsti harmonija. Galite pasitikėti savimi, nes visada būsite nepakeičiamas darbo komandos ar šeimos narys. ',' Tulminas yra lietuvių kilmės vardas.'),(2434,'Tulkantas',' Tulkantas yra Vyriškas vardas.','Trumpa reikšmė: suliet. prūs., trump. Tulys, tul- (žr. Tulgaudas) + kant- (žr. Tautkantas).','Vardo reikšmė: Jūsų tikslas nėra tapti vadovu, bet galite būti puikus jo patarėjas.',' Tulkantas yra lietuvių kilmės vardas.'),(2435,'Urtė',' Urtė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Dorotėja doron „dovana“ + teos „dievas“ – „dievo dovana“.','Vardo reikšmė: Asmeniniai poreikiai ir troškimai užima labai svarbų vaidmenį jūsų gyvenime, todėl jiems skiriate didelį dėmesį. Jūs greitai pavargstate nuo rutinos, jus vargina nuobodžios ir techninės užduotys.',' Urtė yra graikų kilmės vardas.'),(2436,'Uršulė',' Uršulė yra Moteriškas vardas.','Trumpa reikšmė: ursula „lokutė, meškutė“.','Vardo reikšmė: Jūs traukiate žmones, o jų palaikymas jums labai svarbus. Jei jaučiate aplinkinių neprielankumą, dėl to labai jaudinatės ir sunkiai suvaldote emocijas. ',' Uršulė yra lotynų kilmės vardas.'),(2437,'Uršulina',' Uršulina yra Moteriškas vardas.','Trumpa reikšmė: lot., trump. Uršulė, Lina, iš lot. Ursulina, kuris yra priesagos -ina vedinys iš Ursula, žr. Uršulėlot., trump. Uršulė, Lina, iš lot. Ursulina, kuris yra priesagos -ina vedinys iš Ursula, žr. Uršulė.','Vardo reikšmė: Jūs traukiate žmones, o jų palaikymas jums labai svarbus. Jei jaučiate aplinkinių neprielankumą, dėl to labai jaudinatės ir sunkiai suvaldote emocijas.',' Uršulina yra lotynų kilmės vardas.'),(2438,'Uršė',' Uršė yra Moteriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Uršulė.','Vardo reikšmė: Jūs traukiate žmones, o jų palaikymas jums labai svarbus. Jei jaučiate aplinkinių neprielankumą, dėl to labai jaudinatės ir sunkiai suvaldote emocijas.',' Uršė yra lotynų kilmės vardas.'),(2439,'Ursas',' Ursas yra Vyriškas vardas.','Trumpa reikšmė: ursus „lokys“.','Vardo reikšmė: Jūs – aštrialiežuviai, linksmi, išradingi ir nesugebate nė minutei būti ramūs. Jūs esate visų mylimi, aplinkiniai negali atsispirti jūsų spinduliuojam geriui. ',' Ursas yra lotynų kilmės vardas.'),(2440,'Urbonas',' Urbonas yra Vyriškas vardas.','Trumpa reikšmė: urbanus „miestietis“.','Vardo reikšmė: Urbonas - lot., trump. Urbas, tarm. Urbonas žem., Urbanas, Urbys, Urba ryt. aukšt., iš lot. Urbanus: lot. urbanus „miesto, miestietis“',' Urbonas yra lotynų kilmės vardas.'),(2441,'Upyna',' Upyna yra Moteriškas vardas.','Trumpa reikšmė: liet., iš upėvardžio Upyna (Luokė).','Vardo reikšmė: Vardadienis: Sausio mėn. 12 d. – Upynos vardo diena.',' Upyna yra lietuvių kilmės vardas.'),(2442,'Uosis',' Uosis yra Vyriškas vardas.','Trumpa reikšmė: uosis (medis); iš pasakos „Eglė žalčių karalienė“, Eglės sūnaus vardas.','Vardo reikšmė: Vardadienis: Kovo mėn. 3 d. – Uosio vardo diena.',' Uosis yra lietuvių kilmės vardas.'),(2443,'Unė',' Unė yra Moteriškas vardas.','Trumpa reikšmė: una „vienintelė“.','Vardo reikšmė: Jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai, naujų idėjų generatoriai. ',' Unė yra lotynų kilmės vardas.'),(2444,'Ulrikas',' Ulrikas yra Vyriškas vardas.','Trumpa reikšmė: „kilmingas valdovas“.','Vardo reikšmė: Jūs užsispyrę darbuotojai, lengvai apsikraunantys įvairiausiais darbais; jūsų rankose negalimas tampa galimu.',' Ulrikas yra vokiečių kilmės vardas.'),(2445,'Undinė',' Undinė yra Moteriškas vardas.','Trumpa reikšmė: „banga, vanduo“.','Vardo reikšmė: Gera intuicija leidžia planuoti tolimą ateitį. Labai mokate prisiderinti prie žymiausių autoritetų. ',' Undinė yra lotynų kilmės vardas.'),(2446,'Ulrika',' Ulrika yra Moteriškas vardas.','Trumpa reikšmė: uodal „paveldimas turtas + richi „galingasis“ – „turtingas ir galingas“.','Vardo reikšmė: Jūs užsispyrę darbuotojai, lengvai apsikraunantys įvairiausiais darbais; jūsų rankose negalimas tampa galimu.',' Ulrika yra vokiečių kilmės vardas.'),(2447,'Ulijona',' Ulijona yra Moteriškas vardas.','Trumpa reikšmė: iš Julija: „garbanotų plaukų“.','Vardo reikšmė: Valios jėga ir rimtas charakteris leidžia susidoroti su bet kokiais projektais, todėl gera intuicija leidžia planuoti tolimą ateitį.',' Ulijona yra graikų kilmės vardas.'),(2448,'Ulė',' Ulė yra moteriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Ulijona ir Uršulė..','Vardo reikšmė: Valios jėga ir rimtas charakteris leidžia susidoroti su bet kokiais projektais, todėl gera intuicija leidžia planuoti tolimą ateitį.',' Ulė yra graikų kilmės vardas.'),(2449,'Vaclova',' Vaclova yra Moteriškas vardas.','Trumpa reikšmė: „didelė šlovė“.','Vardo reikšmė: Dominuodami jie nesugeba įsiklausyti į kitų nuomonę girdi tik save.',' Vaclova yra slavų kilmės vardas.'),(2450,'Vaclas',' Vaclas yra vyriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Vaclovas.','Vardo reikšmė: Dominuodami jie nesugeba įsiklausyti į kitų nuomonę girdi tik save.',' Vaclas yra slavų kilmės vardas.'),(2451,'Vacė',' Vacė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Vaclova, Vaclovas: „didelė šlovė“.','Vardo reikšmė: Dominuodami jie nesugeba įsiklausyti į kitų nuomonę girdi tik save.',' Vacė yra slavų kilmės vardas.'),(2452,'Vaidys',' Vaidys yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Vaidginas, Vaidmantas, Vaidotas: vaidytis, vaidentis – „tas kuris rodosi, vaidenasi“.','Vardo reikšmė: (3) liet., trumpinys iš Vaidevutis',' Vaidys yra lietuvių kilmės vardas.'),(2453,'Vaidmantas',' Vaidmantas yra Vyriškas vardas.','Trumpa reikšmė: vaid- (vaidytis „rodytis“, vaidentis) + mant- (mantus „sumanus“).','Vardo reikšmė: Labai mokate prisiderinti prie žymiausių autoritetų. Jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai.',' Vaidmantas yra lietuvių kilmės vardas.'),(2454,'Vaidilutė',' Vaidilutė yra Moteriškas vardas.','Trumpa reikšmė: vaidilutė „amžinosios ugnies saugotoja pagonybės laikais“.','Vardo reikšmė: Labai mokate prisiderinti prie žymiausių autoritetų. Jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai.',' Vaidilutė yra lietuvių kilmės vardas.'),(2455,'Vaidilė',' Vaidilė yra Moteriškas vardas.','Trumpa reikšmė: vaid- (vaidytis „rodytis“, vaidentis) + -il- – „tas kuris rodosi, vaidenasi“.','Vardo reikšmė: Labai mokate prisiderinti prie žymiausių autoritetų. Jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai.',' Vaidilė yra lietuvių kilmės vardas.'),(2456,'Vaidilas',' Vaidilas yra Vyriškas vardas.','Trumpa reikšmė: vaid- (vaidytis „rodytis“, vaidentis) + -il- – „tas kuris rodosi, vaidenasi“.','Vardo reikšmė: Labai mokate prisiderinti prie žymiausių autoritetų. Jūs puikūs politiniai strategai, karščiausių ir uždegančių kalbų autoriai.',' Vaidilas yra lietuvių kilmės vardas.'),(2457,'Vaidginas',' Vaidginas yra Vyriškas vardas.','Trumpa reikšmė: vaid- (vaidytis „rodytis“, vaidentis) + gin- (ginti „užstoti, saugoti“).','Vardo reikšmė: Šie vardo savininkai rūpinasi materialine ateitimi, apie tai, kas būtina pasiturinčiam gyvenimui, ir tai jiems sekasi gana gerai, nes jie tikri finansų genijai; žino, kur taupyti ir kaip paskirstyti pinigus.',' Vaidginas yra lietuvių kilmės vardas.'),(2458,'Vaidevutis',' Vaidevutis yra Vyriškas vardas.','Trumpa reikšmė: sulietuvintas prūsų: vaidevis „žinantis“; pirmojo prūsų kunigaikščio vardas.','Vardo reikšmė: (2) suliet. prūs., trump. Vaidys, iš istorijos šaltiniuose iškreipto legendinio pirmojo prūsų kunigaikščio v. Videvutis (pagal K. Būgą), kuris yra priesagos -utis vedinys iš prūs. vid-ev-is „žinantis“',' Vaidevutis yra lietuvių kilmės vardas.'),(2459,'Vaidaugas',' Vaidaugas yra vyriškas vardas.','Trumpa reikšmė: „gainioti“.','Vardo reikšmė: Šie vardo savininkai rūpinasi materialine ateitimi, apie tai, kas būtina pasiturinčiam gyvenimui, ir tai jiems sekasi gana gerai, nes jie tikri finansų genijai; žino, kur taupyti ir kaip paskirstyti pinigus.',' Vaidaugas yra lietuvių kilmės vardas.'),(2460,'Vaidas',' Vaidas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Vaidginas, Vaidmantas, Vaidotas: vaidytis, vaidentis – „tas kuris rodosi, vaidenasi“.','Vardo reikšmė: Jūsų mintys ir veiksmai labai greiti, tačiau nedažnai įdiegiami praktiškai. Turite labai aiškų mąstymo būdą, atvirą charakterį. Mėgstate keisti profesijas, turite polinkį įsigyti kelias profesijas. Karjera jums labai daug ką reiškia.',' Vaidas yra lietuvių kilmės vardas.'),(2461,'Vaclovas',' Vaclovas yra Vyriškas vardas.','Trumpa reikšmė: „didelė šlovė“.','Vardo reikšmė: Dominuodami jie nesugeba įsiklausyti į kitų nuomonę girdi tik save.',' Vaclovas yra slavų kilmės vardas.'),(2462,'Vaida',' Vaida yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Vaidgina, Vaidmantė, Vaidotė.','Vardo reikšmė: Jūsų mintys ir veiksmai labai greiti, tačiau nedažnai įdiegiami praktiškai. Turite labai aiškų mąstymo būdą, atvirą charakterį. Mėgstate keisti profesijas, turite polinkį įsigyti kelias profesijas. Karjera jums labai daug ką reiškia.',' Vaida yra lietuvių kilmės vardas.'),(2463,'Vaigedas',' Vaigedas yra Vyriškas vardas.','Trumpa reikšmė: vai- (vajoti „gainioti“, vajys „žygūnas“) + ged- (gedėti „ilgėtis“).','Vardo reikšmė: Šie vardo savininkai rūpinasi materialine ateitimi, apie tai, kas būtina pasiturinčiam gyvenimui, ir tai jiems sekasi gana gerai, nes jie tikri finansų genijai; žino, kur taupyti ir kaip paskirstyti pinigus.',' Vaigedas yra lietuvių kilmės vardas.'),(2464,'Vaigaudas',' Vaigaudas yra Vyriškas vardas.','Trumpa reikšmė: vai- (vajoti „gainioti“, vajys „žygūnas“) + gaud- (gaudyti).','Vardo reikšmė: (1) liet., trump. Vaigas, Vaigys, vai- (žr. Vaidaugas) + gaud- (: liet. gaud-yti, plg. gau-ti)',' Vaigaudas yra lietuvių kilmės vardas.'),(2465,'Vaigailas',' Vaigailas yra Vyriškas vardas.','Trumpa reikšmė: vai- (vajoti „gainioti“, vajys „žygūnas“) + gail- (gailas „stiprus“).','Vardo reikšmė: Gera intuicija leidžia planuoti tolimą ateitį. Labai mokate prisiderinti prie žymiausių autoritetų.',' Vaigailas yra lietuvių kilmės vardas.'),(2466,'Vaigailė',' Vaigailė yra Moteriškas vardas.','Trumpa reikšmė: vai- (vajoti „gainioti“, vajys „žygūnas“) + gail- (gailas „stiprus“).','Vardo reikšmė: Gera intuicija leidžia planuoti tolimą ateitį. Labai mokate prisiderinti prie žymiausių autoritetų.',' Vaigailė yra lietuvių kilmės vardas.'),(2467,'Vaidvilė',' Vaidvilė yra Moteriškas vardas.','Trumpa reikšmė: vaid- (vaidytis „rodytis“, vaidentis) + vil- (viltis).','Vardo reikšmė: (1), (2) liet., trump. Vaida, iš vyr. v. Vaidvilas',' Vaidvilė yra lietuvių kilmės vardas.'),(2468,'Vaidvilas',' Vaidvilas yra Vyriškas vardas.','Trumpa reikšmė: vaid- (vaidytis „rodytis“, vaidentis) + vil- (viltis).','Vardo reikšmė: Jūs – aštrialiežuviai, linksmi, išradingi ir nesugebate nė minutei būti ramūs.',' Vaidvilas yra lietuvių kilmės vardas.'),(2469,'Vaidotas',' Vaidotas yra Vyriškas vardas.','Trumpa reikšmė:  vaid- (vaidytis „rodytis“, vaidentis) + -ot- – „tas kuris rodosi, vaidenasi“.','Vardo reikšmė: Jūs nepriklausomi ir individualūs, bet kokia kaina trokštantys garbės. labai judrūs, energingi, nenustygstantys vietoje, linksmi, draugiški.',' Vaidotas yra lietuvių kilmės vardas.'),(2470,'Vaidminas',' Vaidminas yra Vyriškas vardas.','Trumpa reikšmė: vaid- (vaidytis „rodytis“, vaidentis) + min- (minėti).','Vardo reikšmė: Jūs nepriklausomi ir individualūs, bet kokia kaina trokštantys garbės. labai judrūs, energingi, nenustygstantys vietoje, linksmi, draugiški.',' Vaidminas yra lietuvių kilmės vardas.'),(2471,'Vaidmantė',' Vaidmantė yra Moteriškas vardas.','Trumpa reikšmė: vaid- (vaidytis „rodytis“, vaidentis) + mant- (mantus „sumanus“).','Vardo reikšmė: Jūs nepriklausomi ir individualūs, bet kokia kaina trokštantys garbės. labai judrūs, energingi, nenustygstantys vietoje, linksmi, draugiški.',' Vaidmantė yra lietuvių kilmės vardas.'),(2472,'Vaišginas',' Vaišginas yra Vyriškas vardas.','Trumpa reikšmė: vaiš- (vaišės) + gin- (ginti „užstoti, saugoti“).','Vardo reikšmė: Turite vykdytojų savybių ir labai sekasi savas verslas arba vadovavimas jam. ',' Vaišginas yra lietuvių kilmės vardas.'),(2473,'Vainotas',' Vainotas yra Vyriškas vardas.','Trumpa reikšmė: perdarytas Vainora, Vainoras: vai- (vajoti „gainioti“, vajys „žygūnas“) + nor- (norėti).','Vardo reikšmė: Jūs nepriklausomi ir individualūs, bet kokia kaina trokštantys garbės. labai judrūs, energingi, nenustygstantys vietoje, linksmi, draugiški.',' Vainotas yra lietuvių kilmės vardas.'),(2474,'Vainoras',' Vainoras yra Vyriškas vardas.','Trumpa reikšmė: vai- (vajoti „gainioti“, vajys „žygūnas“) + nor- (norėti).','Vardo reikšmė: Turite vykdytojų savybių ir labai sekasi savas verslas arba vadovavimas jam. ',' Vainoras yra lietuvių kilmės vardas.'),(2475,'Vaingedas',' Vaingedas yra Vyriškas vardas.','Trumpa reikšmė: vain- (vaina „priežastis, kaltė“) + ged- (gedėti „ilgėtis“) – „ilgesio priežastis“.','Vardo reikšmė: Jums reikalinga laisvė, nes norite patys priimti sprendimus, pasikliaudami savomis idėjomis. Turite sugebėjimų veikti jus supančią aplinką.',' Vaingedas yra lietuvių kilmės vardas.'),(2476,'Vaigintas',' Vaigintas yra Vyriškas vardas.','Trumpa reikšmė: vai- (vajoti „gainioti“, vajys „žygūnas“) + gint- (ginti „saugoti, užstoti“).','Vardo reikšmė: Jums reikalinga laisvė, nes norite patys priimti sprendimus, pasikliaudami savomis idėjomis. Turite sugebėjimų veikti jus supančią aplinką.',' Vaigintas yra lietuvių kilmės vardas.'),(2477,'Vaiginas',' Vaiginas yra vyriškas vardas.','Trumpa reikšmė: liet., trump. Vaigas, Vaigys, vai- (žr. Vaidaugas) + gin- (žr. Vaidginas).','Vardo reikšmė: Jums reikalinga laisvė, nes norite patys priimti sprendimus, pasikliaudami savomis idėjomis. Turite sugebėjimų veikti jus supančią aplinką.',' Vaiginas yra lietuvių kilmės vardas.'),(2478,'Vaitilas',' Vaitilas yra vyriškas vardas.','Trumpa reikšmė: liet., trump. Vaitys, priesagos -ilas vedinys iš sen. trump. Vaitys, kuris iš avd. su Vait-: Vaitkantas, Vaitnoras, Vaitvilas ir kt..','Vardo reikšmė: Šis žmogus turėtų labai atsakingai rūpintis šeima, tačiau permainos, pokyčiai ir nuotykiai bus dažni jo palydovai.',' Vaitilas yra lietuvių kilmės vardas.'),(2479,'Vaitilė',' Vaitilė yra moteriškas vardas.','Trumpa reikšmė: liet., trump. Vaitė, iš vyr. v. Vaitilas.','Vardo reikšmė: Šis žmogus turėtų labai atsakingai rūpintis šeima, tačiau permainos, pokyčiai ir nuotykiai bus dažni jo palydovai.',' Vaitilė yra lietuvių kilmės vardas.'),(2480,'Vaitiekus',' Vaitiekus yra vyriškas vardas.','Trumpa reikšmė: suliet. var. Vaitkus, trump. Vaitys, Vaičius, iš čekų Vojtech (lenk. Wojciech): sen. slav. voj „karys, kareivis“ + po-techa „džiaugsmas“, u-techa „paguoda“..','Vardo reikšmė: Jis gali turėti gydymo galių ir stipriai traukti moterų dėmesį.',' Vaitiekus yra lietuvių kilmės vardas.'),(2481,'Vaišviltas',' Vaišviltas yra Vyriškas vardas.','Trumpa reikšmė: vaiš- (vaišės) + vilt- (viltis).','Vardo reikšmė: Šie vardo turėtojai turtus kraunasi rizikuodami finansinėmis akcijomis ir įkyriomis avantiūromis. ',' Vaišviltas yra lietuvių kilmės vardas.'),(2482,'Vaišvilkas',' Vaišvilkas yra Vyriškas vardas.','Trumpa reikšmė: vaiš- (vaišės) + -ok (slavų mažybinė priesaga).','Vardo reikšmė: Šie vardo turėtojai turtus kraunasi rizikuodami finansinėmis akcijomis ir įkyriomis avantiūromis. ',' Vaišvilkas yra lietuvių kilmės vardas.'),(2483,'Vaišvilas',' Vaišvilas yra Vyriškas vardas.','Trumpa reikšmė: vaiš- (vaišės) + vil- (viltis).','Vardo reikšmė: Šie vardo turėtojai turtus kraunasi rizikuodami finansinėmis akcijomis ir įkyriomis avantiūromis. ',' Vaišvilas yra lietuvių kilmės vardas.'),(2484,'Vaišvilė',' Vaišvilė yra Moteriškas vardas.','Trumpa reikšmė: vaiš- (vaišės) + vil- (viltis).','Vardo reikšmė: Šie vardo turėtojai turtus kraunasi rizikuodami finansinėmis akcijomis ir įkyriomis avantiūromis. ',' Vaišvilė yra lietuvių kilmės vardas.'),(2485,'Vaišvydas',' Vaišvydas yra Vyriškas vardas.','Trumpa reikšmė: vaiš- (vaišės) + vyd- (iš-vydo).','Vardo reikšmė: Tai žmogus, kuris jausis laimingu darydamas gera kitiems, ypač silpnesniems už save. Jis sugebės atjausti kitą, tačiau giliai viduje pats trokš meilės ir įvertinimo.',' Vaišvydas yra lietuvių kilmės vardas.'),(2486,'Vaištartė',' Vaištartė yra moteriškas vardas.','Trumpa reikšmė: liet., trump. Vaišė, iš vyr. v. Vaištartas..','Vardo reikšmė: Tai žmogus, kuris jausis laimingu darydamas gera kitiems, ypač silpnesniems už save. Jis sugebės atjausti kitą, tačiau giliai viduje pats trokš meilės ir įvertinimo.',' Vaištartė yra lietuvių kilmės vardas.'),(2487,'Vaištartas',' Vaištartas yra vyriškas vardas.','Trumpa reikšmė: liet., trump. Vaišys, Vaišius, vaiš- (žr. Vaišgantas) + tart- (: liet. tart-as, tart-i).','Vardo reikšmė: Gyvenime dažnai gali pasitaikyti momentų, kai reikės suprasti, jog tobulų nėra ir nesitikėti, jog viskas bus taip kaip jis nori.',' Vaištartas yra lietuvių kilmės vardas.'),(2488,'Vaišmantas',' Vaišmantas yra Vyriškas vardas.','Trumpa reikšmė: vaiš- (vaišės) +mant- (mantus „sumanus“) – „vaišingas ir sumanus“.','Vardo reikšmė: Jums reikės mokytis suvaldyti pyktį ir norą priimti staigius ir nepamatuotus sprendimus bei norą pasiduoti..',' Vaišmantas yra lietuvių kilmės vardas.'),(2489,'Vaišmantė',' Vaišmantė yra Moteriškas vardas.','Trumpa reikšmė: vaiš- (vaišės) +mant- (mantus „sumanus“) – „vaišingas ir sumanus“.','Vardo reikšmė: Jums reikės mokytis suvaldyti pyktį ir norą priimti staigius ir nepamatuotus sprendimus bei norą pasiduoti..',' Vaišmantė yra lietuvių kilmės vardas.'),(2490,'Vaišgirdas',' Vaišgirdas yra vyriškas vardas.','Trumpa reikšmė: „žinia, gandas“.','Vardo reikšmė: Galite daug atidžiau išklausyti ir padėti žmonėms, analizuoti reiškinius ir padaryti teisingas išvadas. Jūs talentingi ir daugiausiai pasireiškiate moksle ir mene, taip pat daug galite pasiekti religinėje veikloje.',' Vaišgirdas yra lietuvių kilmės vardas.'),(2491,'Valdė',' Valdė yra moteriškas vardas.','Trumpa reikšmė: liet., trumpinys iš mot. v. su -vald-: Tautvaldė, Visvaldė ir kt..','Vardo reikšmė: Šie vardo turėtojai labai myli vaikus – tiek savus, tiek svetimus, tačiau be didesnio sentimentalumo. Vaikai jums – tas pats kas ir suaugę, tik laimingas vaikas turi savyje daugiau džiaugsmo, lūkesčių ateičiai.',' Valdė yra lietuvių kilmės vardas.'),(2492,'Valdas',' Valdas yra vyriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Valdemaras, Evaldas ir kt..','Vardo reikšmė: Šie vardo turėtojai labai myli vaikus – tiek savus, tiek svetimus, tačiau be didesnio sentimentalumo. Vaikai jums – tas pats kas ir suaugę, tik laimingas vaikas turi savyje daugiau džiaugsmo, lūkesčių ateičiai.',' Valdas yra lietuvių kilmės vardas.'),(2493,'Valda',' Valda yra Moteriškas vardas.','Trumpa reikšmė: trumpiniai iš Valdemara, Tautvaldė, Visvaldė: 1. lietuvių valdyti „valdantysis“ 2. sen. vokiečių waltan „valdyti“.','Vardo reikšmė: Šie vardo turėtojai labai myli vaikus – tiek savus, tiek svetimus, tačiau be didesnio sentimentalumo. Vaikai jums – tas pats kas ir suaugę, tik laimingas vaikas turi savyje daugiau džiaugsmo, lūkesčių ateičiai.',' Valda yra vokiečių kilmės vardas.'),(2494,'Vakaris',' Vakaris yra Vyriškas vardas.','Trumpa reikšmė: vakaras – „vakarinis, vakarinė“.','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas.',' Vakaris yra lietuvių kilmės vardas.'),(2495,'Vakarė',' Vakarė yra Moteriškas vardas.','Trumpa reikšmė: vakaras – „vakarinis, vakarinė“.','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas.',' Vakarė yra lietuvių kilmės vardas.'),(2496,'Vaižgantas',' Vaižgantas yra Vyriškas vardas.','Trumpa reikšmė: vaiš- (vaišės) + gan- (ganyti, ginti) – „vaišingas“; Vaižgantas – sen. lietuvių pagonių linų ir kanapių dievas.','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Kartais jie apie save suburia tvirtovės sieną, atskiriančią juos nuo aistrų ir instinktų, laikydami juos antraeiliais dalykais. ',' Vaižgantas yra lietuvių kilmės vardas.'),(2497,'Vaiva',' Vaiva yra Moteriškas vardas.','Trumpa reikšmė: „vaivorykštė“; sen. lietuvių deivė Laimos pavidalas (Laimos juosta – vaivorykštė).','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Netgi nereikšmingos užduotys jų akimis įgyja pirmaeilės svarbos.',' Vaiva yra lietuvių kilmės vardas.'),(2498,'Vaitvilė',' Vaitvilė yra moteriškas vardas.','Trumpa reikšmė: liet., trump. Vaitė, iš vyr. v. Vaitvilas..','Vardo reikšmė: Vardadienis: Vasario mėn. 12 d. – Vaitvilės vardo diena.',' Vaitvilė yra lietuvių kilmės vardas.'),(2499,'Vaitvilas',' Vaitvilas yra vyriškas vardas.','Trumpa reikšmė: liet., trump. Vaitys, vait- (žr. Vaitkantas) + vil- (žr. Vaidvilas).','Vardo reikšmė: Vardadienis: Vasario mėn. 12 d. – Vaitvilo vardo diena.',' Vaitvilas yra lietuvių kilmės vardas.'),(2500,'Vaitkantas',' Vaitkantas yra vyriškas vardas.','Trumpa reikšmė: „kalbėti, šnekėti“.','Vardo reikšmė: Darbe, kaip ir visur, į pirmą vietą skiriate discipliną. Jūsų principas: geriau turėti žvirblį rankose negu gervę danguje. Šie vardo savininkai garbina pasisekimą, tradicijas.',' Vaitkantas yra lietuvių kilmės vardas.'),(2501,'Vaitys',' Vaitys yra vyriškas vardas.','Trumpa reikšmė: liet., trumpinys iš avd. su Vait-: Vaitkantas, Vaitnoras, Vaitvilas ir kt..','Vardo reikšmė: Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems. ',' Vaitys yra lietuvių kilmės vardas.'),(2502,'Valiotė',' Valiotė yra moteriškas vardas.','Trumpa reikšmė: liet. ir prūs., trump. Valia, iš vyr. v. Valiotas..','Vardo reikšmė: Kartais jiems sunku bendrauti su aplinkiniais, tačiau įgimtas protas visada padeda. Tie, kurie išdrįsta su jais užmegzti draugystę, niekada nebūna atstumti.',' Valiotė yra lietuvių kilmės vardas.'),(2503,'Valiotas',' Valiotas yra vyriškas vardas.','Trumpa reikšmė: liet. ir prūs., trump. Valys, priesagos -(i)otas vedinys iš sen. trump. Vala, Valys, kuris iš avd. su Val-: Valimantas, Valmantas ir kt..','Vardo reikšmė: Kartais jiems sunku bendrauti su aplinkiniais, tačiau įgimtas protas visada padeda. Tie, kurie išdrįsta su jais užmegzti draugystę, niekada nebūna atstumti.',' Valiotas yra lietuvių kilmės vardas.'),(2504,'Valimantė',' Valimantė yra moteriškas vardas.','Trumpa reikšmė: liet., trump. Valia, iš vyr. v. Valimantas..','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Pagrindinis jūsų bruožas – magnetizmas. Jūs stengiatės atitikti maksimalų galimybių potencialą. Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems. ',' Valimantė yra lietuvių kilmės vardas.'),(2505,'Valimantas',' Valimantas yra vyriškas vardas.','Trumpa reikšmė: „įstengti, pajėgti, apgalėti“.','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Pagrindinis jūsų bruožas – magnetizmas. Jūs stengiatės atitikti maksimalų galimybių potencialą. Gyvenimiškai stiprūs ir pasiekiate norimų rezultatų. Labai stengiatės parodyti savo gerą įvaizdį kitiems. ',' Valimantas yra lietuvių kilmės vardas.'),(2506,'Valerijus',' Valerijus yra Vyriškas vardas.','Trumpa reikšmė: valeo „būti sveikam“.','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Jūs puikūs originalių idėjų ir efektyvių sistemų šaltinis. Gyvenimas jums žavingas todėl, kad jūs patys suteikiate jam tam tikrą prieskonį.',' Valerijus yra lotynų kilmės vardas.'),(2507,'Valerijonas',' Valerijonas yra Vyriškas vardas.','Trumpa reikšmė: iš Valerijus lotynų: „būti sveikam“.','Vardo reikšmė: Šie vardo savininkai garbina pasisekimą, valdžią, pagarbą, tradicijas. Jūs puikūs originalių idėjų ir efektyvių sistemų šaltinis. Gyvenimas jums žavingas todėl, kad jūs patys suteikiate jam tam tikrą prieskonį.',' Valerijonas yra lotynų kilmės vardas.'),(2508,'Valerija',' Valerija yra Moteriškas vardas.','Trumpa reikšmė: valeo „būti sveikam“.','Vardo reikšmė: Vardo savininkai garbina pasisekimą, valdžią ir tradicijas. Valerija – puikus originalių idėjų ir efektyvių sistemų šaltinis. Gyvenimas jums žavingas todėl, kad patys suteikiate jam nuostabų prieskonį.',' Valerija yra lotynų kilmės vardas.'),(2509,'Valentinas',' Valentinas yra Vyriškas vardas.','Trumpa reikšmė: valens „gyvuojantis“.','Vardo reikšmė: Jūs mielai pasirenkate pramogų vadovo postą. ',' Valentinas yra lotynų kilmės vardas.'),(2510,'Valentina',' Valentina yra Moteriškas vardas.','Trumpa reikšmė: valens „gyvuojantis“.','Vardo reikšmė: Jūs mielai pasirenkate pramogų vadovo postą. ',' Valentina yra lotynų kilmės vardas.'),(2511,'Valė',' Valė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Valerija ir Valentina; Valerijus ir Valentinas.','Vardo reikšmė: Jūs galite būti geri teisininkai, medikai, literatūros tyrinėtojai, valstybės vadovai. Socialinis darbas, pedagogika, psichologija, netradicinė medicina – taip pat puikus pasirinkimas, nes jie moka visus išklausyti bei giliai analizuoti. ',' Valė yra lotynų kilmės vardas.'),(2512,'Valdonė',' Valdonė yra Moteriškas vardas.','Trumpa reikšmė: valdyti „valdančioji“.','Vardo reikšmė: Stengdamiesi pajungti žmones savo valiai, jie į kairę ir dešinę svaido “vertingus” nurodymus. Jums patinka kirsti iš peties, ir tokiomis minutėmis jūs galite priminti įsiutusį bulių.',' Valdonė yra lietuvių kilmės vardas.'),(2513,'Valdimantas',' Valdimantas yra vyriškas vardas.','Trumpa reikšmė: liet., trump. Valdas, Mantas, valdi- (: liet. vald-yti, vald-o) + mant- (: liet. mant-us „sumanus“).','Vardo reikšmė: Stengdamiesi pajungti žmones savo valiai, jie į kairę ir dešinę svaido “vertingus” nurodymus. Jums patinka kirsti iš peties, ir tokiomis minutėmis jūs galite priminti įsiutusį bulių.',' Valdimantas yra lietuvių kilmės vardas.'),(2514,'Velta',' Velta yra moteriškas vardas.','Trumpa reikšmė: latv., iš latv. v. Velta: latv. velte „dovana“..','Vardo reikšmė: Jūs nemokate ilgai sėdėti ar būti vienoje vietoje – tuojau imate vaikštinėti po kambarį.',' Velta yra slavų kilmės vardas.'),(2515,'Vasaris',' Vasaris yra Vyriškas vardas.','Trumpa reikšmė: vasaris (mėnuo).','Vardo reikšmė: Jūs labai atjaučiantys, todėl nėra geresnių slaugytojų už jus. Tačiau dvasinis mąstymas ribotas. Bažnyčią lankote tik dėl to, kad bijote, jog kiti gali blogai apie jus pagalvoti. Jūs puikiausiai suprantate savo prasižengimus šiame pasaulyje, tačiau anapusinis pasaulis jūsų nedomina.',' Vasaris yra lietuvių kilmės vardas.'),(2516,'Vasarė',' Vasarė yra Moteriškas vardas.','Trumpa reikšmė: vasaris (mėnuo).','Vardo reikšmė: Jūs labai atjaučiantys, todėl nėra geresnių slaugytojų už jus. Tačiau dvasinis mąstymas ribotas. Bažnyčią lankote tik dėl to, kad bijote, jog kiti gali blogai apie jus pagalvoti. Jūs puikiausiai suprantate savo prasižengimus šiame pasaulyje, tačiau anapusinis pasaulis jūsų nedomina.',' Vasarė yra lietuvių kilmės vardas.'),(2517,'Varbutė',' Varbutė yra moteriškas vardas.','Trumpa reikšmė: liet., trump. Vara, iš vyr. v. Varbutas..','Vardo reikšmė: Jis gali būti smulkmeniškas, linkęs į tobulumo paieškas, tačiau sąžiningas ir vertas pasitikėjimo. Vardo nešiotojas gali būti ypač energingas, dominuojantis ir linkęs elgtis azartiškai. Nepaisant to, finansinis saugumas visada bus vienas iš jo gyvenimo prioritetų.',' Varbutė yra lietuvių kilmės vardas.'),(2518,'Varbutas',' Varbutas yra vyriškas vardas.','Trumpa reikšmė: liet., trump. Varys, var- (: liet. var-yti „liepti, versti (ką daryti), kalti, vyti“) + but- (žr. Vainbutas).','Vardo reikšmė: Jis gali būti smulkmeniškas, linkęs į tobulumo paieškas, tačiau sąžiningas ir vertas pasitikėjimo. Vardo nešiotojas gali būti ypač energingas, dominuojantis ir linkęs elgtis azartiškai. Nepaisant to, finansinis saugumas visada bus vienas iš jo gyvenimo prioritetų.',' Varbutas yra lietuvių kilmės vardas.'),(2519,'Vandenė',' Vandenė yra Moteriškas vardas.','Trumpa reikšmė: vand- (vanduo) + -en- – „vandens telkinių gyventojas“.','Vardo reikšmė: Tai protingo, gabaus techniniams mokslams ir elektronikai žmogaus vardas. Jis nevengs konfliktų ir ginčytis su šiuo žmogumi turėtų būti sunkoka, nes logikos ir ambicijų jam nepritruks. Deja, šias ambicijas reikėtų pastoviai stimuliuoti, nes jos gali staiga išblėsti. ',' Vandenė yra lietuvių kilmės vardas.'),(2520,'Vandalius',' Vandalius yra Vyriškas vardas.','Trumpa reikšmė: iš germanų genties pavadinimo „vandalai“.','Vardo reikšmė: Tai protingo, gabaus techniniams mokslams ir elektronikai žmogaus vardas. Jis nevengs konfliktų ir ginčytis su šiuo žmogumi turėtų būti sunkoka, nes logikos ir ambicijų jam nepritruks. Deja, šias ambicijas reikėtų pastoviai stimuliuoti, nes jos gali staiga išblėsti.',' Vandalius yra vokiečių kilmės vardas.'),(2521,'Vandalinas',' Vandalinas yra Vyriškas vardas.','Trumpa reikšmė: iš Vandalius, kuris kilęs iš germanų genties pavadinimo „vandalai“.','Vardo reikšmė: Tai protingo, gabaus techniniams mokslams ir elektronikai žmogaus vardas. Jis nevengs konfliktų ir ginčytis su šiuo žmogumi turėtų būti sunkoka, nes logikos ir ambicijų jam nepritruks. Deja, šias ambicijas reikėtų pastoviai stimuliuoti, nes jos gali staiga išblėsti.',' Vandalinas yra vokiečių kilmės vardas.'),(2522,'Vanda',' Vanda yra Moteriškas vardas.','Trumpa reikšmė: 1. lietuvių: vand- (vanduo); populiaraus padavimo mergina skenduolė; 2. lenkų iš upėvardžio Vandalus (vandalai – viena iš germanų genčių).','Vardo reikšmė: Tai protingo, gabaus techniniams mokslams ir elektronikai žmogaus vardas. Jis nevengs konfliktų ir ginčytis su šiuo žmogumi turėtų būti sunkoka, nes logikos ir ambicijų jam nepritruks. Deja, šias ambicijas reikėtų pastoviai stimuliuoti, nes jos gali staiga išblėsti.',' Vanda yra lietuvių kilmės vardas.'),(2523,'Valtrūda',' Valtrūda yra Moteriškas vardas.','Trumpa reikšmė: waltan „valdyti“ + trūt „stipri“.','Vardo reikšmė: Tai protingo, gabaus techniniams mokslams ir elektronikai žmogaus vardas. Jis nevengs konfliktų ir ginčytis su šiuo žmogumi turėtų būti sunkoka, nes logikos ir ambicijų jam nepritruks. Deja, šias ambicijas reikėtų pastoviai stimuliuoti, nes jos gali staiga išblėsti.',' Valtrūda yra vokiečių kilmės vardas.'),(2524,'Valteris',' Valteris yra Vyriškas vardas.','Trumpa reikšmė: waltan „valdyti“ + heri „kariuomenė“.','Vardo reikšmė: Vardadienis: Balandžio mėn. 8 d. – Valterio vardo diena.',' Valteris yra vokiečių kilmės vardas.'),(2525,'Valmantas',' Valmantas yra Vyriškas vardas.','Trumpa reikšmė: val- (valioti „įstengti“) + mant- (mantus „sumanus“).','Vardo reikšmė: Apskritai taktiški, jų aistros gilios, turi potraukį mokslams, dažniausiai geri lektoriai. Jie gali puikiai vesti pokalbius, turi rašytojo talentą, puikų intelektą; kūrybiškai mažiau aktyvūs. ',' Valmantas yra lietuvių kilmės vardas.'),(2526,'Valmantė',' Valmantė yra Moteriškas vardas.','Trumpa reikšmė: val- (valioti „įstengti“) + mant- (mantus „sumanus“).','Vardo reikšmė: Apskritai taktiški, jų aistros gilios, turi potraukį mokslams, dažniausiai geri lektoriai. Jie gali puikiai vesti pokalbius, turi rašytojo talentą, puikų intelektą; kūrybiškai mažiau aktyvūs. ',' Valmantė yra lietuvių kilmės vardas.'),(2527,'Valius',' Valius yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Valerija ir Valentina; Valerijus ir Valentinas.','Vardo reikšmė: Patinka komanduoti, keisti profesijas ir pasilinksminimų pobūdį, taip pat perstatinėti baldus kambariuose, nori dirbti kelis darbus vienu metu ir todėl pradeda blaškytis. Moka prisitaikyti, gali lengvai pamėgdžioti, tačiau tuo pačiu labai jausmingi ir užsigaunantys. ',' Valius yra lotynų kilmės vardas.'),(2528,'Valys',' Valys yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Valentas, Valerijus, Valmantas.','Vardo reikšmė: Patinka komanduoti, keisti profesijas ir pasilinksminimų pobūdį, taip pat perstatinėti baldus kambariuose, nori dirbti kelis darbus vienu metu ir todėl pradeda blaškytis. Moka prisitaikyti, gali lengvai pamėgdžioti, tačiau tuo pačiu labai jausmingi ir užsigaunantys. ',' Valys yra lotynų kilmės vardas.'),(2529,'Vestina',' Vestina yra Moteriškas vardas.','Trumpa reikšmė: „namų židinys“.','Vardo reikšmė: Vardadienis: Balandžio mėn. 12 d. – Vestinos vardo diena.',' Vestina yra graikų kilmės vardas.'),(2530,'Vesta',' Vesta yra Moteriškas vardas.','Trumpa reikšmė: „namų židinys“.','Vardo reikšmė: Vardadienis: Balandžio mėn. 12 d. – Vestos vardo diena.',' Vesta yra lotynų kilmės vardas.'),(2531,'Veronė',' Veronė yra Moteriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Veronika..','Vardo reikšmė: Jūs galite dirbti bet kokioje srityje, kur tik reikia protingai elgtis su pinigais. Jūs atkakliu darbu užsidirbate savo pinigus ir nesiimate lošti nesąžiningų žaidimų.',' Veronė yra lotynų kilmės vardas.'),(2532,'Vergilijus',' Vergilijus yra Vyriškas vardas.','Trumpa reikšmė: žr. Virgilijus.','Vardo reikšmė: Jūs – laisvi žmonės, kurie mėgsta permainas, nuotykius ir pasilinksminimus. Jie saugo savo laisvę ir, kaip paukštis be sparnų, negali egzistuoti be jos. Jie labai lengvai prisitaiko. Permainos – jiems malonumas, o bet koks trukdymas – katastrofa.',' Vergilijus yra lietuvių kilmės vardas.'),(2533,'Verena',' Verena yra Moteriškas vardas.','Trumpa reikšmė: „drovioji“.','Vardo reikšmė: Jūs galite dirbti bet kokioje srityje, kur tik reikia protingai elgtis su pinigais. Jūs atkakliu darbu užsidirbate savo pinigus ir nesiimate lošti nesąžiningų žaidimų.',' Verena yra lotynų kilmės vardas.'),(2534,'Verė',' Verė yra Moteriškas vardas.','Trumpa reikšmė: liet. trumpinys iš Veronika.','Vardo reikšmė: Jūs galite dirbti bet kokioje srityje, kur tik reikia protingai elgtis su pinigais. Jūs atkakliu darbu užsidirbate savo pinigus ir nesiimate lošti nesąžiningų žaidimų.',' Verė yra lotynų kilmės vardas.'),(2535,'Veras',' Veras yra Vyriškas vardas.','Trumpa reikšmė: verus „tikras, teisinga“.','Vardo reikšmė: Jūs galite dirbti bet kokioje srityje, kur tik reikia protingai elgtis su pinigais. Jūs atkakliu darbu užsidirbate savo pinigus ir nesiimate lošti nesąžiningų žaidimų.',' Veras yra lotynų kilmės vardas.'),(2536,'Veranas',' Veranas yra Vyriškas vardas.','Trumpa reikšmė: lot., trump. Veras, iš lot. Veranus, kuris yra priesagos -anus vedinys iš Verus, žr. Veras..','Vardo reikšmė: Jūs galite dirbti bet kokioje srityje, kur tik reikia protingai elgtis su pinigais. Jūs atkakliu darbu užsidirbate savo pinigus ir nesiimate lošti nesąžiningų žaidimų.',' Veranas yra lotynų kilmės vardas.'),(2537,'Vera',' Vera yra Moteriškas vardas.','Trumpa reikšmė: vera „teisinga“.','Vardo reikšmė: Jūs galite dirbti bet kokioje srityje, kur tik reikia protingai elgtis su pinigais. Jūs atkakliu darbu užsidirbate savo pinigus ir nesiimate lošti nesąžiningų žaidimų.',' Vera yra lotynų kilmės vardas.'),(2538,'Ventūra',' Ventūra yra Moteriškas vardas.','Trumpa reikšmė: ventura „ateisianti, laukiama“.','Vardo reikšmė: (2) lot., trump. Vena, Venė, iš lot. Ventura, lot. ventura „ateisianti, laukiama“',' Ventūra yra lotynų kilmės vardas.'),(2539,'Venta',' Venta yra Moteriškas vardas.','Trumpa reikšmė: iš upėvardžio Venta (Mažeikiai).','Vardo reikšmė: (4) liet., iš upėvardžio Venta (Mažeikiai)',' Venta yra lietuvių kilmės vardas.'),(2540,'Veneranda',' Veneranda yra Moteriškas vardas.','Trumpa reikšmė: „gerbtina, gerbtinas“.','Vardo reikšmė: (1) lot., trump. Venė, iš lot. Veneranda: lot. veneranda „gerbtina, pagarbos verta“',' Veneranda yra lotynų kilmės vardas.'),(2541,'Venantas',' Venantas yra Vyriškas vardas.','Trumpa reikšmė: venans „medžiojantis“.','Vardo reikšmė: .',' Venantas yra lotynų kilmės vardas.'),(2542,'Vydgailė',' Vydgailė yra Moteriškas vardas.','Trumpa reikšmė: vyd- (iš-vydo) + gail- (gailas „stiprus“) – „daug išvydęs, patyręs“.','Vardo reikšmė: Vydgina, Vidgina, Vydginė, Vidginė',' Vydgailė yra lietuvių kilmės vardas.'),(2543,'Vydenis',' Vydenis yra Vyriškas vardas.','Trumpa reikšmė: vid- (iš-vydo) + -en- – „išvydęs, daug matęs“.','Vardo reikšmė: (2) liet. ir prūs., trump. Vydas, priesagos -enis vedinys iš sen. trumpinio Vydas, kuris iš avd. su Vyd-: Vydginas, Vydmantas, Vydminas ir kt.',' Vydenis yra lietuvių kilmės vardas.'),(2544,'Vydenė',' Vydenė yra Moteriškas vardas.','Trumpa reikšmė: vid- (iš-vydo) + -en- – „išvydęs, daug matęs“.','Vardo reikšmė: (2) liet. ir prūs., trump. Vydė, iš vyr. v. Vydenis',' Vydenė yra lietuvių kilmės vardas.'),(2545,'Vydė',' Vydė yra Moteriškas vardas.','Trumpa reikšmė: trumpiniai iš Vydginas, Vydgina, Vydmantas, Vydmantė, Vydminas, Vydmina.','Vardo reikšmė: .',' Vydė yra lietuvių kilmės vardas.'),(2546,'Vydas',' Vydas yra Vyriškas vardas.','Trumpa reikšmė: trumpiniai iš Vydginas, Vydgina, Vydmantas, Vydmantė, Vydminas, Vydmina.','Vardo reikšmė: (1) liet., trumpinys iš avd. su Vyd-: Vydginas, Vydmantas, Vydminas ir kt.',' Vydas yra lietuvių kilmės vardas.'),(2547,'Vidas',' Vidas yra Vyriškas vardas.','Trumpa reikšmė: witu „miškas, giria“.','Vardo reikšmė: Vidas – vokiškos kilmės vardas, kuris taip pat yra trumpinys asmenvardžių su Vid- : Vidginas, Vidmantas, Vidminas ir kt. Vardas Vidas kildinamas iš germanų kalbos asmenvardžio Wido, kuris yra germanų vardų su Widu- trumpinys: sen. vok. aukšt. witu „miškas, giria“.',' Vidas yra vokiečių kilmės vardas.'),(2548,'Vida',' Vida yra Moteriškas vardas.','Trumpa reikšmė: witu „miškas, giria“.','Vardo reikšmė: (2) liet., iš vyr. v. Vidas, taip pat trumpinys iš mot. v. su Vid-: Vidgina, Vidmantė, Vidmina ir kt.',' Vida yra vokiečių kilmės vardas.'),(2549,'Vygandas',' Vygandas yra Vyriškas vardas.','Trumpa reikšmė: vy- (iš-vydo) + gand- (gandas).','Vardo reikšmė: (1) germ., trump. Vygas, tarm. Vygis piet. aukšt. (dz.), Vigis ryt. aukšt., iš sulotyninto germ. Vigandus iš germ. Wigand: sen. vok. aukšt. wigand „kovojantis, kovotojas“',' Vygandas yra lietuvių kilmės vardas.'),(2550,'Vygailas',' Vygailas yra Vyriškas vardas.','Trumpa reikšmė: vyd- (iš-vydo) + gail- (gailas „stiprus“).','Vardo reikšmė: (1) liet. ir prūs., sen. var. Vygaila, trump. Vygas: vy- (: liet. vy-ti „ginti, varyti“) + gail- (žr. Vaigailas)',' Vygailas yra lietuvių kilmės vardas.'),(2551,'Vygailė',' Vygailė yra Moteriškas vardas.','Trumpa reikšmė: vyd- (iš-vydo) + gail- (gailas „stiprus“).','Vardo reikšmė: (1) liet. ir prūs., trump. Vyga, iš vyr. avd. Vygaila, žr. Vygailas',' Vygailė yra lietuvių kilmės vardas.'),(2552,'Viešvilas',' Viešvilas yra Vyriškas vardas.','Trumpa reikšmė: vieš- (viešėti, viešė „kaimas, kiemas“) + vil- (viltis).','Vardo reikšmė: (1) liet., trump. Viešys, Vilys, vieš- (žr. Vieštautas) + vil- (žr. Vaidvilas)',' Viešvilas yra lietuvių kilmės vardas.'),(2553,'Viešvilė',' Viešvilė yra Moteriškas vardas.','Trumpa reikšmė: vieš- (viešėti, viešė „kaimas, kiemas“) + vil- (viltis).','Vardo reikšmė: (1), (2) liet., trump. Viešė, Vilė, iš vyr. v. Viešvilas',' Viešvilė yra lietuvių kilmės vardas.'),(2554,'Vientautė',' Vientautė yra Moteriškas vardas.','Trumpa reikšmė: vien- (vienyti) + taut- (tauta) – „vienijantis tautą“.','Vardo reikšmė: (1) liet., trump. Vienė, Tautė, iš vyr. v. Vientautas',' Vientautė yra lietuvių kilmės vardas.'),(2555,'Vydotas',' Vydotas yra Vyriškas vardas.','Trumpa reikšmė: iš-vydo „daug matęs, išvydęs; žiniuonis“.','Vardo reikšmė: (1) suliet. prūs., trump. Vydas, priesagos -otas vedinys iš sen. trump. Vydas, kuris iš avd. su Vyd-: Vydgailas, Vydmantas, Vydminas ir kt.',' Vydotas yra lietuvių kilmės vardas.'),(2556,'Vydūnas',' Vydūnas yra Vyriškas vardas.','Trumpa reikšmė: iš-vydo „daug matęs, išvydęs; žiniuonis“.','Vardo reikšmė: (1) liet., trump. Vydas, priesagos -ūnas vedinys iš sen. trumpinio Vydas, kuris iš avd. su Vyd: Vydgailas, Vydmantas, Vydminas ir kt., Vydūnas — Mažosios Lietuvos rašytojo ir filosofo Viliaus Storastos slapyvardis',' Vydūnas yra lietuvių kilmės vardas.'),(2557,'Vykintas',' Vykintas yra Vyriškas vardas.','Trumpa reikšmė: vy- (iš-vydo) + kin- (kentėti, plg. žiem-kintis) – „daug matęs, daug patyręs“.','Vardo reikšmė: (1) liet., trump. Vykas, Vykis, vy- (žr. Vygailas) + kint- (: liet. žiem-kintis „kas žiemą iškenčia“, plg. kent-ėti)',' Vykintas yra lietuvių kilmės vardas.'),(2558,'Vykantas',' Vykantas yra Vyriškas vardas.','Trumpa reikšmė: vyt- (vyt/vyd išvydo) + kant- (pa-kantus).','Vardo reikšmė: (1) liet., trump. Vykas, vy- (žr. Vygailas) + kant- (žr. Vaitkantas)',' Vykantas yra lietuvių kilmės vardas.'),(2559,'Vygirdas',' Vygirdas yra Vyriškas vardas.','Trumpa reikšmė: vyd- (iš-vydo) + gird- (girdėti) – „daug išvydęs (matęs), daug išgirdęs“.','Vardo reikšmė: (l) liet., trump. Vygas, vy- (žr. Vygailas) + gird- (žr. Vaišgirdas)',' Vygirdas yra lietuvių kilmės vardas.'),(2560,'Vijolė',' Vijolė yra Moteriškas vardas.','Trumpa reikšmė: 1. lietuvių iš upėvardžio Vijolė (Šiauliai); 2. lotynų: viola „žibuoklė“.','Vardo reikšmė: (2) 1. liet., iš upėvardžio Vijolė (Šiauliai), 2. lot., iš lot. Viola, žr. Violė',' Vijolė yra lotynų kilmės vardas.'),(2561,'Vygintas',' Vygintas yra Vyriškas vardas.','Trumpa reikšmė: vyd- (iš-vydo) + gint- (ginti).','Vardo reikšmė: (1) liet., trump. Vygas, vy- (žr. Vygailas) + gint- (: liet. gintas, ginti)',' Vygintas yra lietuvių kilmės vardas.'),(2562,'Vygaudas',' Vygaudas yra Vyriškas vardas.','Trumpa reikšmė: vyd- (iš-vydo) + gaud- (gaudyti).','Vardo reikšmė: (1) liet., trump. Vygas, vy- (žr. Vygailas) + gaud- (žr. Vaigaudas)',' Vygaudas yra lietuvių kilmės vardas.'),(2563,'Vygantas',' Vygantas yra Vyriškas vardas.','Trumpa reikšmė: vyd- (iš-vydo) + gan- (ganyti „saugoti“) – „daug matęs ir saugus, dievo saugomas“.','Vardo reikšmė: (1) liet., trump. Vygas, vy- (žr. Vygailas) + gant- (: liet. gan-yti „saugoti“, plg. gin-ti)',' Vygantas yra lietuvių kilmės vardas.'),(2564,'Vygandė',' Vygandė yra Moteriškas vardas.','Trumpa reikšmė: vy- (iš-vydo) + gand- (gandas).','Vardo reikšmė: (1) germ., trump. Vyga: iš vyr. v. Vygandas',' Vygandė yra lietuvių kilmės vardas.'),(2565,'Vilgaudas',' Vilgaudas yra Vyriškas vardas.','Trumpa reikšmė: vil- (viltis) + gaud- (gaudyti).','Vardo reikšmė: (1) liet., trump. Vilas, vil- (žr. Vilbutas) + gaud- (žr. Vaigaudas)',' Vilgaudas yra lietuvių kilmės vardas.'),(2566,'Vilgardas',' Vilgardas yra Vyriškas vardas.','Trumpa reikšmė: vil- (viltis) + gard- (gardinti „pranešti, garsinti“).','Vardo reikšmė: (1) liet., trump. Vilas, vil- (žr. Vilbutas) + gard- (: liet. gard-inti „pranešti, garsinti“, plg. prūs. gerd-aut „sakyti“)',' Vilgardas yra lietuvių kilmės vardas.'),(2567,'Vilgailė',' Vilgailė yra Moteriškas vardas.','Trumpa reikšmė: vil- (viltis) + gail- (gailas „stiprus“).','Vardo reikšmė: (1) liet., trump. Vilė, iš vyr. avd. Vilgaila, žr. Vilgailas',' Vilgailė yra lietuvių kilmės vardas.'),(2568,'Vilfreda',' Vilfreda yra Moteriškas vardas.','Trumpa reikšmė: willo „valia, noras“ + fridu „taika“.','Vardo reikšmė: (2) germ., trump. Vilė, Freda, iš sulotyninto germ. Vilfreda iš germ. Wilfriede: sen. vok. aukšt. willo „valia, noras“ + fridu „taika“',' Vilfreda yra vokiečių kilmės vardas.'),(2569,'Vilgailas',' Vilgailas yra Vyriškas vardas.','Trumpa reikšmė: vil- (viltis) + gail- (gailas „stiprus“).','Vardo reikšmė: (1) liet., sen. var. Vilgaila, trump. Vilas, vil- (žr. Vilbutas) + gail- (žr. Vaigailas)',' Vilgailas yra lietuvių kilmės vardas.'),(2570,'Vilė',' Vilė yra Moteriškas vardas.','Trumpa reikšmė: viltis – „besiviliantis, turintis vilties“.','Vardo reikšmė: 1. liet., trumpinys iš mot. v. su Vil-: Vilbutė, Vilgailė, Vilgarda ir kt., 2. liet. trumpinys iš Akvilė, Vilhelmina ir kt.',' Vilė yra lietuvių kilmės vardas.'),(2571,'Vilbutas',' Vilbutas yra Vyriškas vardas.','Trumpa reikšmė: vil- (viltis) + but- (būti).','Vardo reikšmė: (1) liet., trump. Vilas, vil- (: liet. vil-tis, vil-iasi,) + but- (: liet. but-as)',' Vilbutas yra lietuvių kilmės vardas.'),(2572,'Vilbutė',' Vilbutė yra Moteriškas vardas.','Trumpa reikšmė: vil- (viltis) + but- (būti).','Vardo reikšmė: (1) liet., trump. Vilė, iš vyr. v. Vilbutas',' Vilbutė yra lietuvių kilmės vardas.'),(2573,'Viktorinas',' Viktorinas yra Vyriškas vardas.','Trumpa reikšmė: victoria „pergalė“ – „laimėtojas, laimėtoja“.','Vardo reikšmė: (2) lot., trump. Viktoras, Viktas, iš lot. Victorinus, kuris yra priesagos -inus vedinys iš Victor, žr. Viktoras',' Viktorinas yra lotynų kilmės vardas.'),(2574,'Viktoras',' Viktoras yra Vyriškas vardas.','Trumpa reikšmė: victoria „pergalė“.','Vardo reikšmė: (1) lot., trump. Viktas, tarm. Viktaras ryt. aukšt., Viktis žem., Viktaris, Vikčius piet. aukšt. (dz.), iš lot. Victor: lot. victor ,,nugalėtojas“',' Viktoras yra lotynų kilmės vardas.'),(2575,'Viktorija',' Viktorija yra Moteriškas vardas.','Trumpa reikšmė: victoria „pergalė“.','Vardo reikšmė: (1) lot., trump. Viktorė, Viktė, tarm. Vikta ryt. aukšt. (Obeliai), Vikčia piet. aukšt. (dz.), iš lot. Victoria: lot. victoria „pergalė“',' Viktorija yra lotynų kilmės vardas.'),(2576,'Vilmantas',' Vilmantas yra Vyriškas vardas.','Trumpa reikšmė: vil- (viltis) + mant- (mantus „sumanus“).','Vardo reikšmė: Vilmantas - liet., trump. Vilmas, Vilas, vil- (žr. Vilbutas) + mant- (žr. Vaidmantas)',' Vilmantas yra lietuvių kilmės vardas.'),(2577,'Vilius',' Vilius yra Vyriškas vardas.','Trumpa reikšmė: iš Vilhelmas: willo „valia, noras“+ helm „šalmas“.','Vardo reikšmė: (2) liet. trumpinys iš Vilhelmas',' Vilius yra vokiečių kilmės vardas.'),(2578,'Vilma',' Vilma yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Vilmantė arba Vilhelmina.','Vardo reikšmė: (1) 1. liet., trumpinys iš Vilmantė, 2. liet. trumpinys iš Vilhelma ir Vilhelmina',' Vilma yra vokiečių kilmės vardas.'),(2579,'Vilintas',' Vilintas yra Vyriškas vardas.','Trumpa reikšmė: vil- (viltis, viliasi) – „tas, kuris viliasi; nepararnda vilties“.','Vardo reikšmė: (1) suliet. prūs., trump. Vilys, priesagos -intas vedinys iš sen. trump. Vilas, kuris iš avd. su Vil-: Vilbutas, Vilgailas, Vilgardas ir kt.',' Vilintas yra lietuvių kilmės vardas.'),(2580,'Vilija',' Vilija yra Moteriškas vardas.','Trumpa reikšmė: iš upėvardžio Vilija, antrojo upės Nėries vardo.','Vardo reikšmė: (1) liet., trump. Vilė, iš upėvardžio Vilija — antrojo Neries vardo',' Vilija yra lietuvių kilmės vardas.'),(2581,'Vyliaudas',' Vyliaudas yra Vyriškas vardas.','Trumpa reikšmė: vyt- (vyt/vyd išvydo) + liaud- (liaudis).','Vardo reikšmė: (1) liet., trump. Vylys, vy- (žr. Vygailas) + liaud- (: liet. liaudis „žmonės, tauta“, liaudžia „minia, būrys“)',' Vyliaudas yra lietuvių kilmės vardas.'),(2582,'Vilhelmas',' Vilhelmas yra Vyriškas vardas.','Trumpa reikšmė: willo „valia, noras“+ helm „šalmas“.','Vardo reikšmė: (1) germ., suliet. var. Vilemas, Vilimas, trump. Vilius, tarm. Vilumas vak. liet., Vilis vak. žem., iš sulotyninto germ. Vilhelmus, Guilielmus iš germ. Willihelm: sen. vok. aukšt. willo „valia, noras“ + helm „šalmas“',' Vilhelmas yra vokiečių kilmės vardas.'),(2583,'Vilhelmina',' Vilhelmina yra Moteriškas vardas.','Trumpa reikšmė: willo „valia, noras“+ helm „šalmas“ – „stiprios, tvirtos valios“.','Vardo reikšmė: Vilhelmina - sulot. germ., trump. Vilhelma, Vilė, Vilma, iš sulotyninto germ. Vilhelmina, kuris yra priesagos –ina vedinys iš Vilhelma.',' Vilhelmina yra vokiečių kilmės vardas.'),(2584,'Vilgirdas',' Vilgirdas yra Vyriškas vardas.','Trumpa reikšmė: vil- (viltis) + gird- (girdėti).','Vardo reikšmė: (1) liet., trump. Vilas, vil- (žr. Vilbutas) + gird- (žr. Vaišgirdas)',' Vilgirdas yra lietuvių kilmės vardas.'),(2585,'Vilhelma',' Vilhelma yra Moteriškas vardas.','Trumpa reikšmė: willo „valia, noras“+ helm „šalmas“.','Vardo reikšmė: (1) germ., trump. Vilė, Vilma, iš sulotyninto germ. Vilhelma, kuris iš vyr. v. Vilhelmus, žr. Vilhelmas',' Vilhelma yra vokiečių kilmės vardas.'),(2586,'Vingailas',' Vingailas yra Vyriškas vardas.','Trumpa reikšmė: vin- (vin-/vain- vaina „priežastis, kaltė“) + gail- (gailas „stiprus“).','Vardo reikšmė: (1) liet., var. Vingaila, trump. Vinas, Vingas, vin- (žr. Viešvinas) + gail- (žr. Vaigailas)',' Vingailas yra lietuvių kilmės vardas.'),(2587,'Vingailė',' Vingailė yra Moteriškas vardas.','Trumpa reikšmė: vin- (vin-/vain- vaina „priežastis, kaltė“) + gail- (gailas „stiprus“).','Vardo reikšmė: (l) liet., trump. Vina, Vinga, iš vyr. v. Vingaila, žr. Vingailas',' Vingailė yra lietuvių kilmės vardas.'),(2588,'Vincė',' Vincė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Vincentas, Vincenta: vincens „nugalintis“.','Vardo reikšmė: (2) liet. trumpinys iš Vincenta',' Vincė yra lotynų kilmės vardas.'),(2589,'Vincenta',' Vincenta yra Moteriškas vardas.','Trumpa reikšmė: vincens „nugalintis“.','Vardo reikšmė: (2) lot., trump. Vincė, tarm. Vincė ryt. aukšt., Vinciūnė piet. žem. (švd.), iš lot. Vincentia, kuris iš vyr. v. Vincentius, žr. Vincentas',' Vincenta yra lotynų kilmės vardas.'),(2590,'Vincas',' Vincas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Vincentas: lot. vincens \"nugalintis\".','Vardo reikšmė: Vincas – sulietuvintas lotynų kilmės vyriškas vardas. Tai trumpinys iš vardo Vincentas, kuris iš lotyniško vardo Vincentius. Lotynų kalboje žodis vincens reiškia nugalintis, vyraujantis, dominuojantis, paplitęs.',' Vincas yra lotynų kilmės vardas.'),(2591,'Viltenis',' Viltenis yra Vyriškas vardas.','Trumpa reikšmė: vil- (viltis) + -en-.','Vardo reikšmė: (2) liet., trump. Viltys, priesagos -enis vedinys iš sen. trump. Viltys, kuris iš avd. Viltautas',' Viltenis yra lietuvių kilmės vardas.'),(2592,'Viltenė',' Viltenė yra Moteriškas vardas.','Trumpa reikšmė: vil- (viltis) + -en-.','Vardo reikšmė: Vaišvilta, Vaišvilta, Vaišviltė',' Viltenė yra lietuvių kilmės vardas.'),(2593,'Viltė',' Viltė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Viltautė: vil- (vitis) + taut- (tauta) – „tautos viltis“.','Vardo reikšmė: (1) liet., trumpinys iš Viltautė',' Viltė yra lietuvių kilmės vardas.'),(2594,'Vilnius',' Vilnius yra Vyriškas vardas.','Trumpa reikšmė: iš miesto pavadinimo Vilnius.','Vardo reikšmė: (1) liet., iš miesto vardo Vilnius',' Vilnius yra lietuvių kilmės vardas.'),(2595,'Viltautė',' Viltautė yra Moteriškas vardas.','Trumpa reikšmė: vil- (viltis) + taut- (tauta).','Vardo reikšmė: Vaišvilta, Vaišvilta, Vaišviltė',' Viltautė yra lietuvių kilmės vardas.'),(2596,'Vilmantė',' Vilmantė yra Moteriškas vardas.','Trumpa reikšmė: vil- (viltis) + mant- (mantus „sumanus“).','Vardo reikšmė: Vilmantė – lietuvių kilmės vardas, kurio trumpiniai – Vilma, Vilė, iš vyr. v. Vilmantas.',' Vilmantė yra lietuvių kilmės vardas.'),(2597,'Virgaudas',' Virgaudas yra Vyriškas vardas.','Trumpa reikšmė: vir- (vyras, vyrauti „įsigalėti, viešpatauti“) + gaud- (gaudyti).','Vardo reikšmė: (1) suliet. prūs., trump. Virgas, vir- (žr. Virbutas) + gaud- (žr. Vaigaudas)',' Virgaudas yra lietuvių kilmės vardas.'),(2598,'Virgas',' Virgas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Virginijus, Virgilijus, Virgailas, Virgaudas.','Vardo reikšmė: (1) 1. liet., trumpinys iš avd. su Vir-g-: Virgailas, Virgaudas ir kt. 2. liet. trumpinys iš Virgilijus ir Virginijus',' Virgas yra lotynų kilmės vardas.'),(2599,'Virgailas',' Virgailas yra Vyriškas vardas.','Trumpa reikšmė: vir- (vyras, vyrauti „įsigalėti, viešpatauti“) + gail- (gailas „stiprus“).','Vardo reikšmė: (1) liet., var. Virgaila, trump. Virgas, vir- (žr. Virbutas) + gail- (žr. Vaigailas)',' Virgailas yra lietuvių kilmės vardas.'),(2600,'Virgailė',' Virgailė yra Moteriškas vardas.','Trumpa reikšmė: vir- (vyras, vyrauti „įsigalėti, viešpatauti“) + gail- (gailas „stiprus“).','Vardo reikšmė: (1) liet., trump. Virga, Gailė, iš vyr. v. Virgaila, žr. Virgailas',' Virgailė yra lietuvių kilmės vardas.'),(2601,'Virga',' Virga yra Moteriškas vardas.','Trumpa reikšmė: „mergaitė“.','Vardo reikšmė: (1) 1. liet., trumpinys iš mot. v. su Vir-g-: Virgailė, Virgauda ir kt., 2. liet. trumpinys iš Virginija',' Virga yra lotynų kilmės vardas.'),(2602,'Violeta',' Violeta yra Moteriškas vardas.','Trumpa reikšmė: iš Violė lotynų: „žibuoklė“.','Vardo reikšmė: (2) ital., trump. Vilė, Leta, baž. lot. Violetta iš italų Violetta, kuris yra priesagos -etta (mažyb.) vedinys iš Viola, žr. Violė',' Violeta yra italų kilmės vardas.'),(2603,'Virbutas',' Virbutas yra Vyriškas vardas.','Trumpa reikšmė: vir- (vyras, vyrauti „įsigalėti, viešpatauti“) + but- (būti, butas).','Vardo reikšmė: (1) liet. ir prūs., trump. Virius, Butys, vir- (: liet. vyr-as, vyr-auti „įsigalėti, viešpatauti“) + but- (žr. Vilbutas)',' Virbutas yra lietuvių kilmės vardas.'),(2604,'Visalgas',' Visalgas yra Vyriškas vardas.','Trumpa reikšmė: visa (visas, visai) + alg- (alga „atpildas, atlyginimas“).','Vardo reikšmė: (1) liet. ir prūs., trump. Algas, vis- (: liet. visas, visai, prūs. wissa „visa“) + alg- (: liet. alg-a „atpildas, atlyginimas“, prūs. algas „t. p.“)',' Visalgas yra lietuvių kilmės vardas.'),(2605,'Visalgė',' Visalgė yra Moteriškas vardas.','Trumpa reikšmė: visa (visas, visai) + alg- (alga „atpildas, atlyginimas“).','Vardo reikšmė: (1) liet. ir prūs., trump. Algė, iš vyr. v. Visalgas',' Visalgė yra lietuvių kilmės vardas.'),(2606,'Virmantė',' Virmantė yra Moteriškas vardas.','Trumpa reikšmė: vir- (vyras, vyrauti „įsigalėti, viešpatauti“) + mant- (mantus „sumanus“).','Vardo reikšmė: (1) liet., trump. Virma, iš vyr. v. Virmantas',' Virmantė yra lietuvių kilmės vardas.'),(2607,'Virkantas',' Virkantas yra Vyriškas vardas.','Trumpa reikšmė: vir- (vyras, vyrauti „įsigalėti, viešpatauti“) + kant- (pa-kantus).','Vardo reikšmė: (1) suliet. prūs., trump. Virys, Kantas, vir- (žr. Virbutas) + kant- (žr. Vaitkantas)',' Virkantas yra lietuvių kilmės vardas.'),(2608,'Virmantas',' Virmantas yra Vyriškas vardas.','Trumpa reikšmė: vir- (vyras, vyrauti „įsigalėti, viešpatauti“) + mant- (mantus „sumanus“).','Vardo reikšmė: (1) liet., trump. Virmas, vir- (žr. Virbutas) + mant- (: liet. mant-us „sumanus“)',' Virmantas yra lietuvių kilmės vardas.'),(2609,'Virginija',' Virginija yra Moteriškas vardas.','Trumpa reikšmė: virga „mergaitė“ – „jaunatviškas, mergaitiškas“.','Vardo reikšmė: (1) lot., trump. Virga, Virgė, iš lot. Virginia, kuris iš vyr. v. Virginius, žr. Virginijus',' Virginija yra lotynų kilmės vardas.'),(2610,'Virginijus',' Virginijus yra Vyriškas vardas.','Trumpa reikšmė: virga „mergaitė“ – „jaunatviškas, mergaitiškas“.','Vardo reikšmė: (1) lot., trump. Virgas, Virgius, Virgis, tarm. Virgys, Virgus piet. aukšt. (dz.), iš lot. Virginius, Verginius, kuris iš sen. romėnų giminės vardo Virginius, Verginius',' Virginijus yra lotynų kilmės vardas.'),(2611,'Vismantas',' Vismantas yra Vyriškas vardas.','Trumpa reikšmė: visa (visas, visai) + mant- (mantus „sumanus“).','Vardo reikšmė: (1) liet. ir prūs., trump. Mantas, vis- (žr. Visalgas) + mant- (žr. Vaidmantas)',' Vismantas yra lietuvių kilmės vardas.'),(2612,'Vismantė',' Vismantė yra Moteriškas vardas.','Trumpa reikšmė: visa (visas, visai) + mant- (mantus „sumanus“).','Vardo reikšmė: (1) liet. ir prūs., trump. Mantė, iš vyr. v. Vismantas ',' Vismantė yra lietuvių kilmės vardas.'),(2613,'Visgaudas',' Visgaudas yra Vyriškas vardas.','Trumpa reikšmė: vis- (visa) + gaud- (gaudyti) – „visa gaudantis, gaudantis kiekvieną akimirką, norintis viską išgyventi“.','Vardo reikšmė: (1) suliet. prūs., trump. Gaudas, vis- (žr. Visalgas) + gaud- (žr. Vaigaudas)',' Visgaudas yra lietuvių kilmės vardas.'),(2614,'Visgailė',' Visgailė yra Moteriškas vardas.','Trumpa reikšmė: visa (visas, visai) + gail- (gailas „stiprus“).','Vardo reikšmė: (1) liet., trump. Gailė, iš vyr. avd. Visgaila, žr. Visgailas',' Visgailė yra lietuvių kilmės vardas.'),(2615,'Vytaras',' Vytaras yra Vyriškas vardas.','Trumpa reikšmė: vyt- (vyt/vyd išvydo) + tar- (tarti).','Vardo reikšmė: (1) liet. ir prūs., trump. Vytas, vy- iš vyd- (žr. Vydgailas) + tar- (žr. Vintaras)',' Vytaras yra lietuvių kilmės vardas.'),(2616,'Vitalija',' Vitalija yra Moteriškas vardas.','Trumpa reikšmė: vitalis „gyvybingas“.','Vardo reikšmė: (1) lot., trump. Vitalė, Vita, Vitė, iš lot. Vitalia, kuris iš vyr. v. Vitalis, žr. Vitalis',' Vitalija yra lotynų kilmės vardas.'),(2617,'Vitalė',' Vitalė yra Moteriškas vardas.','Trumpa reikšmė: vitalis „gyvybingas“.','Vardo reikšmė: (2) liet. trumpinys iš Vitalija',' Vitalė yra lotynų kilmės vardas.'),(2618,'Vita',' Vita yra Moteriškas vardas.','Trumpa reikšmė: vita „gyvenimas“.','Vardo reikšmė: (2) 1. lot., iš lot. Vita: lot. vita „gyvenimas“, 2. liet. trumpinys iš Vitalija',' Vita yra lotynų kilmės vardas.'),(2619,'Visvilas',' Visvilas yra Vyriškas vardas.','Trumpa reikšmė: visa (visas, visai) + vil- (viltis).','Vardo reikšmė: (1) liet. ir prūs., trump. Vilas, Vilys, vis- (žr. Visalgas) + vil- (žr. Vaidvilas)',' Visvilas yra lietuvių kilmės vardas.'),(2620,'Visvilė',' Visvilė yra Moteriškas vardas.','Trumpa reikšmė: visa (visas, visai) + vil- (viltis).','Vardo reikšmė: (1), (2) liet. ir prūs., trump. Vilė, iš vyr. v. Visvilas',' Visvilė yra lietuvių kilmės vardas.'),(2621,'Visvydas',' Visvydas yra Vyriškas vardas.','Trumpa reikšmė: vis- (visa) + vyd- (iš-vydo) – „visa išvydęs; daug matęs“.','Vardo reikšmė: (1) suliet. prūs., trump. Vydas, vis- (žr. Visalgas) + vyd- (žr. Vydgailas)',' Visvydas yra lietuvių kilmės vardas.'),(2622,'Visvaldas',' Visvaldas yra Vyriškas vardas.','Trumpa reikšmė: visa (visas, visai) + vald- (valdyti).','Vardo reikšmė: (1) liet., trump. Valdas, vis- (žr. Visalgas) + vald- (: liet. vald-yti, vald-o)',' Visvaldas yra lietuvių kilmės vardas.'),(2623,'Visvaldė',' Visvaldė yra Moteriškas vardas.','Trumpa reikšmė: visa (visas, visai) + vald- (valdyti).','Vardo reikšmė: (1) liet., trump. Valdė, iš vyr. v. Visvaldas',' Visvaldė yra lietuvių kilmės vardas.'),(2624,'Vladislovas',' Vladislovas yra Vyriškas vardas.','Trumpa reikšmė: vladi „valdyk“ + slava „šlovė“ – „valdantis šlovę“.','Vardo reikšmė: .',' Vladislovas yra slavų kilmės vardas.'),(2625,'Vladislova',' Vladislova yra Moteriškas vardas.','Trumpa reikšmė: vladi „valdyk“ + slava „šlovė“ – „valdantis šlovę“.','Vardo reikšmė: .',' Vladislova yra slavų kilmės vardas.'),(2626,'Viviana',' Viviana yra Moteriškas vardas.','Trumpa reikšmė: „gyva, gyvybinga“.','Vardo reikšmė: (2) lot., trump. Viva, iš lot. Viviana, lot. viva „gyva, gyvybinga“',' Viviana yra lotynų kilmės vardas.'),(2627,'Vytenė',' Vytenė yra Moteriškas vardas.','Trumpa reikšmė: vyt- (vyt/vyd išvydo) – „išvydęs, daug matęs“.','Vardo reikšmė: (2) liet., trump. Vyta, Vytė, iš vyr. v. Vytenis',' Vytenė yra lietuvių kilmės vardas.'),(2628,'Vytis',' Vytis yra Vyriškas vardas.','Trumpa reikšmė: vyt- (vyt/vyd išvydo) + -en- – „išvydęs, daug matęs“.','Vardo reikšmė: Vytis kaip ir Vytas yra trumpinys iš Vytautas: vyt- (vyt/vyd išvydo) + taut- (tauta) – „išvydęs tautą, žinantis, kas svarbu tautai“.',' Vytis yra lietuvių kilmės vardas.'),(2629,'Vytė',' Vytė yra Moteriškas vardas.','Trumpa reikšmė: vyt- (vyt/vyd išvydo) + -en- – „išvydęs, daug matęs“.','Vardo reikšmė: .',' Vytė yra lietuvių kilmės vardas.'),(2630,'Vytenis',' Vytenis yra Vyriškas vardas.','Trumpa reikšmė: vyt- (vyt/vyd išvydo) – „išvydęs, daug matęs“.','Vardo reikšmė: (2) liet., trump. Vytas, Vytis, priesagos -enis vedinys iš sen. trump. Vytas, kuris iš avd. su Vy-t-: Vytaras, Vytartas, Vytautas ir kt.',' Vytenis yra lietuvių kilmės vardas.'),(2631,'Vytautė',' Vytautė yra Moteriškas vardas.','Trumpa reikšmė: vyt- (vyt/vyd išvydo) + taut- (tauta) – „išvydęs tautą, žinantis, kas svarbu tautai“.','Vardo reikšmė: (1) liet., trump. Vytė, iš vyr. v. Vytautas',' Vytautė yra lietuvių kilmės vardas.'),(2632,'Vitas',' Vitas yra Vyriškas vardas.','Trumpa reikšmė: vita „gyvenimas“.','Vardo reikšmė: (2) lot., iš lot. Vitus: lot. vita „gyvenimas“',' Vitas yra lotynų kilmės vardas.'),(2633,'Zosė',' Zosė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Zofija: „išmintis“.','Vardo reikšmė: .',' Zosė yra graikų kilmės vardas.'),(2634,'Zuzana',' Zuzana yra Moteriškas vardas.','Trumpa reikšmė: šošanna „lelija.','Vardo reikšmė: (2) hebr., trump. Zuzė, Zana, tarm. Zuzana, Zūzanė, Zūzė, Zūnė, Žanė, Uzanė, Uzė žem., iš sulotyninto hebr. Susanna iš hebr. Šošanna: hebr. šošanna „lelija“',' Zuzana yra hebrajų kilmės vardas.'),(2635,'Zita',' Zita yra Moteriškas vardas.','Trumpa reikšmė: Sitta iš Sidona „sidonietė, Sidono (Finikijos sostinė) gyventoja“.','Vardo reikšmė: (2) finik., baž. lot. Zita iš vok. Sitta, kuris yra sulotyninto finikiečių Sidonia (žr. Sidona) trumpinys ',' Zita yra finikiečių kilmės vardas.'),(2636,'Zofija',' Zofija yra Moteriškas vardas.','Trumpa reikšmė: Sofija: sophia „išmintis“.','Vardo reikšmė: (1) graik., trump. Zosė, tarm. Zopija, Zapė žem., iš sulotyninto graik. Sophia, žr. Sofija',' Zofija yra graikų kilmės vardas.'),(2637,'Zina',' Zina yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Zinaida: „Dzeuso kūrinys“.','Vardo reikšmė: (2) liet. trumpinys iš Zinaida',' Zina yra graikų kilmės vardas.'),(2638,'Zinaida',' Zinaida yra Moteriškas vardas.','Trumpa reikšmė: „Dzeuso kūrinys“.','Vardo reikšmė: (2) graik., trump. Zina, iš sulotyninto graik. Zinaida – „Dzeuso tvarinys“: graik. Zenos „Dzeuso“ + idea „pavidalas, tvarinys“',' Zinaida yra graikų kilmės vardas.'),(2639,'Zigmantas',' Zigmantas yra Vyriškas vardas.','Trumpa reikšmė: sigis „pegalė“ + munth „apsauga, saugotojas“.','Vardo reikšmė: (1) germ., trump. Zigmas, tarm. Zigmus piet. aukšt. (dz.), Zigmis, Zigmė žem., iš sulotyninto germ. Sigismundus iš gotų Sigismunth: got. sigis „pergalė“ + munth „apsauga, saugotojas“',' Zigmantas yra vokiečių kilmės vardas.'),(2640,'Zigmas',' Zigmas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Zigmantas: sigis „pegalė“ + munth „apsauga, saugotojas“.','Vardo reikšmė: (2) liet. trumpinys iš Zigmantas',' Zigmas yra vokiečių kilmės vardas.'),(2641,'Zenonas',' Zenonas yra Vyriškas vardas.','Trumpa reikšmė: „priklausantis Dzeusui“.','Vardo reikšmė: (1) graik., trump. Zenas, Zenius, tarm. Zenonas, Zenis, Zenius šiaur. žem., Zanis, Zanius vak. žem., iš sulotyninto graik. Zeno (kilm. Zenonis) – „Dzeuso, priklausantis Dzeusui“: graik. Zeus (kilm. Zenos) – Dzeusas, graikų Olimpo dievų valdovas',' Zenonas yra graikų kilmės vardas.'),(2642,'Zenona',' Zenona yra Moteriškas vardas.','Trumpa reikšmė: „priklausantis Dzeusui“.','Vardo reikšmė: (1) graik., trump. Zena, Zenė, iš sulotyninto graik. Zenona, kuris iš vyr. v. Zeno, žr. Zenonas',' Zenona yra graikų kilmės vardas.'),(2643,'Žana',' Žana yra Moteriškas vardas.','Trumpa reikšmė: iš Joana, Janas hebrajų (sen. žydų): „Jahvės (dievo) išklausytas, palaimintas“.','Vardo reikšmė: Vardas Žana –  kildinamas iš prancūzų bei  hebrajų kalbų. Iš pranc. Jeanne, kuris iš vid. lot. Joanna, Johanna, žr. Joana. Žanai giminingas vardas – Žaneta',' Žana yra prancūzų, hebrajų kilmės vardas.'),(2644,'Žadvydas',' Žadvydas yra Vyriškas vardas.','Trumpa reikšmė: žad- (žadėti „ketinti, rengtis, skirti“) + vyd- (iš-vydo).','Vardo reikšmė: (1) liet., trump. Žadys, žad- (žr. Žadgailas) + vyd- (: liet. iš-vyd-o, iš-vysti)',' Žadvydas yra lietuvių kilmės vardas.'),(2645,'Žadvainė',' Žadvainė yra Moteriškas vardas.','Trumpa reikšmė: žad- (žadėti „ketinti, rengtis, skirti“) + vain- (vaina „priežastis, kaltė“).','Vardo reikšmė: (1) liet., trump. Žadė, iš vyr. v. Žadvainas',' Žadvainė yra lietuvių kilmės vardas.'),(2646,'Žadvainas',' Žadvainas yra Vyriškas vardas.','Trumpa reikšmė: žad- (žadėti „ketinti, rengtis, skirti“) + vain- (vaina „priežastis, kaltė“).','Vardo reikšmė: (1) liet., trump. Žadys, žad- (žr. Žadgailas) + vain- (: sen. liet. vaina „priežastis, kaltė“)',' Žadvainas yra lietuvių kilmės vardas.'),(2647,'Žadmantė',' Žadmantė yra Moteriškas vardas.','Trumpa reikšmė: žad- (žadėti „ketinti, rengtis, skirti“) + mant- (mantus „sumanus“).','Vardo reikšmė: (1) liet., trump. Žadė, iš vyr. v. Žadmantas',' Žadmantė yra lietuvių kilmės vardas.'),(2648,'Žadmantas',' Žadmantas yra Vyriškas vardas.','Trumpa reikšmė: žad- (žadėti „ketinti, rengtis, skirti“) + mant- (mantus „sumanus“).','Vardo reikšmė: (1) liet., trump. Žadys, žad- (žr. Žadgailas) + mant- (: liet. mant-us „sumanus“, mant-a „turtas“)',' Žadmantas yra lietuvių kilmės vardas.'),(2649,'