edinys iš lot. avd. Agrippa — „gimęs kojomis j priekį',' Agripina yra lotynų kilmės vardas.'),(4664,'Aida',' Aida yra Moteriškas vardas.','Trumpa reikšmė: 1. iš vyriško vardo Aidas – lietuvių „aidas“; 2. arabų: „malonė, nauda“.','Vardo reikšmė: .',' Aida yra lietuvių kilmės vardas.'),(4665,'Agnė',' Agnė yra Moteriškas vardas.','Trumpa reikšmė: „tyra, skaisti“.','Vardo reikšmė: (2) graik., iš sulotyninto graik. Agnes (kilm. Agnetis): graik. hagne „tyra: skaisti',' Agnė yra graikų kilmės vardas.'),(4666,'Agnetė',' Agnetė yra Moteriškas vardas.','Trumpa reikšmė: „tyra, skaisti“.','Vardo reikšmė: (2) sulot. graik., var. Agnietė suliet., trump. Agnė, tarm. Agnyta vak. liet., Agnieška ryt. aukšt,, Jagnieška piet. aukšt. (dz.), Jonieška vak. aukšt., Egnieškė, Egnė piet. žem. (švd.), iš vid. lot. Agneta, kuris padarytas iš vardo Agnes (žr. Agnė) lotyniškos kilmininko formos Agnetis',' Agnetė yra graikų kilmės vardas.'),(4667,'Agnietė',' Agnietė yra Moteriškas vardas.','Trumpa reikšmė: „tyra, skaisti“.','Vardo reikšmė: .',' Agnietė yra graikų kilmės vardas.'),(4668,'Agatonas',' Agatonas yra Vyriškas vardas.','Trumpa reikšmė: agathon „gėris, gerumas“.','Vardo reikšmė: (2) graik., trump. Agatas, Agas, iš sulotyninto graik. Agatho (kilm. Agathonis) iš graik. Agathon: graik. agathon „gėris, gerumas',' Agatonas yra graikų kilmės vardas.'),(4669,'Agatas',' Agatas yra Vyriškas vardas.','Trumpa reikšmė: „geras (-a), kilnus (-i)“.','Vardo reikšmė: (2) graik., trump. Agas, iš sulolyninto graik. Agathus: graik. agathos „geras, kilnus',' Agatas yra graikų kilmės vardas.'),(4670,'Agna',' Agna yra Moteriškas vardas.','Trumpa reikšmė: agni „judri, guvi“.','Vardo reikšmė: (4) liet.: liet. agni „judri, guvi',' Agna yra lietuvių kilmės vardas.'),(4671,'Adrijonas',' Adrijonas yra Vyriškas vardas.','Trumpa reikšmė: „tamsus“; vardas kilęs iš Adrijos jūros pavadinimo, turint omenyje žmogų, gyvenantį prie Adrijos jūros „adrijietis“.','Vardo reikšmė: (2) lot., trump. Adrijus, Adrius, iš lot. Adrianus, Hadrianus — „adrijietis, Adrijos miesto (Italijoje) gyventojas',' Adrijonas yra lotynų kilmės vardas.'),(4672,'Adriana',' Adriana yra Moteriškas vardas.','Trumpa reikšmė: „tamsus“; vardas kilęs iš Adrijos jūros pavadinimo, turint omenyje žmogų, gyvenantį prie Adrijos jūros „adrijietis“.','Vardo reikšmė: (2) lot., trump. Adrija, Adrė, iš lot. Adriana, Hadriana, kuris iš vyr, v. Adrianus, Hadrianus, žr. Adrijonas',' Adriana yra lotynų kilmės vardas.'),(4673,'Adonis',' Adonis yra Vyriškas vardas.','Trumpa reikšmė: „viešpats“.','Vardo reikšmė: (2) finik., trump. Adas, iš sugraikinto finikiečių Adonis: finik. ‘adon „viešpats, valdovas',' Adonis yra finikiečių kilmės vardas.'),(4674,'Adolfina',' Adolfina yra Moteriškas vardas.','Trumpa reikšmė: adal „kilmingas“ + wolf „vilkas“ + mažybinė priesaga -in.','Vardo reikšmė: (2) sulot. germ., trump. Adolfa, Ada, tarm. Adolpina vak. aukšt., Adulpė, Dulpė vak. žem. Adė piet. žem., baž. lot. Adolphina iš germ. Adolfina, Adolfine, kuris yra priesagos -ina vedinys iš Adolfa',' Adolfina yra vokiečių kilmės vardas.'),(4675,'Adolis',' Adolis yra Vyriškas vardas.','Trumpa reikšmė: adal „kilmingas“.','Vardo reikšmė: (1) liet. trumpinys iš Adolfas',' Adolis yra vokiečių kilmės vardas.'),(4676,'Adomas',' Adomas yra Vyriškas vardas.','Trumpa reikšmė: „žmogus“.','Vardo reikšmė: (2) hebr., trump. Adas, tarm. Adomis, Adis, Domė vak. žem., Adasius piet. aukšt. (dz.), iš sulotyninto hebr. Adamus, kuris iš hebr. Adam: hebr. adam „žmogus”',' Adomas yra hebrajų kilmės vardas.'),(4677,'Adolfas',' Adolfas yra Vyriškas vardas.','Trumpa reikšmė: adal „kilmingas“ + wolf „vilkas“.','Vardo reikšmė: germ., trump. Adolis, Adas, tarm. Adolpas, Adalpa, Adzius piet. aukšt. (dz.), Adolpis šiaur. žem., Adulis, Adis žem. (Plungė), Adolpas, Adolpa, Adelpas ryt. aukšt., Adulpis, Dulpis, Dulpė vak. žem., baž. lot. Adolphus iš germ. Adolph, Adolf: sen. vok. aukšt. adal „kilmingas, kilnus + wolf „vilkas',' Adolfas yra vokiečių kilmės vardas.'),(4678,'Adelina',' Adelina yra Moteriškas vardas.','Trumpa reikšmė: „kilmingas“ + mažybinė priesaga -in.','Vardo reikšmė: (2) sulot. germ., trump. Ada, iš sulotyninto germ. Adelina, kuris yra priesagos -ina vedinys iš Adela, žr. Adelė',' Adelina yra vokiečių kilmės vardas.'),(4679,'Adeodatas',' Adeodatas yra Vyriškas vardas.','Trumpa reikšmė: „padovanotas“.','Vardo reikšmė: (2) lot., trump. Deodatas, Datas, iš lot. Adeodatus: lot. a deo datus „dievo duotas',' Adeodatas yra graikų kilmės vardas.'),(4680,'Adolfa',' Adolfa yra Moteriškas vardas.','Trumpa reikšmė: adal „kilmingas“ + wolf „vilkas“.','Vardo reikšmė: (1) germ., trump. Ada, tarm. Adolpa vak. aukšt., Adulpė, Dulpė vak. žem., Adė piet. žem., iš germ. Adolfa, kuris iš vyr. v. Adolph(us), žr. Adolfas',' Adolfa yra vokiečių kilmės vardas.'),(4681,'Adalberta',' Adalberta yra Moteriškas vardas.','Trumpa reikšmė: adal „kilmingas“ + beraht „spindintis, žymus“.','Vardo reikšmė: (1) germ., trump. Ada, iš germ. Adalberta, kuris iš vyr. v. Adalbertas',' Adalberta yra vokiečių kilmės vardas.'),(4682,'Adalbertas',' Adalbertas yra Vyriškas vardas.','Trumpa reikšmė: adal „kilmingas“ + beraht „spindintis, žymus“.','Vardo reikšmė: (1) germ., trump. Adas, tarm. Adelbertas piet. aukšt. (dz.), iš germ. Adalbert, sen. vok. aukšt. adal „kilmingas + beraht „spindintis, žymus',' Adalbertas yra vokiečių kilmės vardas.'),(4683,'Adas',' Adas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Adomas – „žmogus“.','Vardo reikšmė: (2) — liet., trumpinys iš Adomas, Adolfas ir kt.',' Adas yra hebrajų kilmės vardas.'),(4684,'Adelė',' Adelė yra Moteriškas vardas.','Trumpa reikšmė: „kilminga“.','Vardo reikšmė: Adelė - germanų kilmės moteriškas vardas, kurio trumpiniai yra šie: Ada, Adė, tarm. Adulia piet. aukšt. (dz.), Adulė ryt. aukšt., Adušė vak. liet., baž. lot. Adela iš vok. Adela, Adele, kuris iš germ. Adelheid — “kilnaus būdo”: sen. vok. aukšt. adal “kilmingas, kilnus” + heit “būdas”.',' Adelė yra vokiečių kilmės vardas.'),(4685,'Achilas',' Achilas yra Vyriškas vardas.','Trumpa reikšmė: „belūpis“.','Vardo reikšmė: (2) graik., sen. var, Achilejus, Achilejas, baž. lot. Achilles, Achilleus iš sen. graikų v. Achillėus – „belūpis (?)',' Achilas yra graikų kilmės vardas.'),(4686,'Ada',' Ada yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Adomas – „žmogus“.','Vardo reikšmė: (2) 1. hebr., iš hebr. Ada — „puošnioji: hebr. ‘ada „puoštis, 2. germ.: iš germ. Ada, Adda, kuris yra vardų su Adal- (Adalberta, Adelaidė ir kt.) trumpinys: germ. adal „kilminga',' Ada yra hebrajų kilmės vardas.'),(4687,'Galvirdas',' Galvirdas yra Vyriškas vardas.','Trumpa reikšmė: gal- (galėti, gali) + vird- (prūs. wirds „žodis, vardas“) – „galingas vardas“.','Vardo reikšmė: (1) liet., trump. Galius, Galvis, gal- (žr. Galigantas) + vird- (: prūs. wirds „žodis“, plg. latv. vards „žodis“, liet. vardas)',' Galvirdas yra lietuvių kilmės vardas.'),(4688,'Galmantas',' Galmantas yra Vyriškas vardas.','Trumpa reikšmė: gal- (galėti, gali) + mant- (mantus „sumanus“).','Vardo reikšmė: (1) liet., trump. Galius, gal- (žr. Galigantas) + mant- (žr. Gailimantas)',' Galmantas yra lietuvių kilmės vardas.'),(4689,'Galminas',' Galminas yra Vyriškas vardas.','Trumpa reikšmė: gal- (galėti, gali) + min- (minėti) – „gali būti minimas, garsus“.','Vardo reikšmė: (1) liet., trump. Galius, Galmis, gal- (žr. Galigantas)+ min- (žr. Gailiminas)',' Galminas yra lietuvių kilmės vardas.'),(4690,'Galvydas',' Galvydas yra Vyriškas vardas.','Trumpa reikšmė: gal- (galėti) + vyd- (iš-vydo) – „galintis daug išvysti, pamatyti“.','Vardo reikšmė: (1) liet., trump. Galius, Galvis, gal- (žr. Galigantas) + vyd- (liet. iš-vys-ti, iš-vyd-o)',' Galvydas yra lietuvių kilmės vardas.'),(4691,'Galigantas',' Galigantas yra Vyriškas vardas.','Trumpa reikšmė: gali- (galėti, gali) + gant- (ganyti, ginti „saugoti“).','Vardo reikšmė: (1) liet., trump. Galius, gali- (: liet. gal-ėti, gali) + gant- (: liet. gan-yti „saugoti“, plg. gin-ti, gan-ioti) Galigina, Galiginė / (1) liet., trump. Galė, iš vyr. v. Galiginas',' Galigantas yra lietuvių kilmės vardas.'),(4692,'Galius',' Galius yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Galintė, Galintas: gal- (galėti, gali) – „daug galintis“.','Vardo reikšmė: (2) liet., trumpinys iš Galigantas, Galmantas, Galvydas ir kt.',' Galius yra lietuvių kilmės vardas.'),(4693,'Galigintas',' Galigintas yra Vyriškas vardas.','Trumpa reikšmė: gali- (galėti, gali) + gin- (ginti „saugoti“).','Vardo reikšmė: (1) liet., trump. Galius, gali- (žr. Galigantas)+ gint- (:liet. ginti „saugoti“, gintas)',' Galigintas yra lietuvių kilmės vardas.'),(4694,'Galiginas',' Galiginas yra Vyriškas vardas.','Trumpa reikšmė: gal- (galėti) + gin- (ginti) – „galintis (-i) apginti“.','Vardo reikšmė: (1) liet., trump. Galius, gali- (žr. Galigantas) + gin- (: liet. gin-ti, gin-a „saugoti“)',' Galiginas yra lietuvių kilmės vardas.'),(4695,'Dingailas',' Dingailas yra Vyriškas vardas.','Trumpa reikšmė: ding- (dingoti „manyti, rodytis“) + gail- (gailas „stiprus“).','Vardo reikšmė: (1) liet., sen. var. Dingaila, trump. Dingas, ding- (: liet. ding-oti „manyti, rodytis“ + gail- (žr. Dargailas) Dingailė / (1) liet., trump. Dinga iš vyr. avd. Dingaila, žr. Dingailas',' Dingailas yra lietuvių kilmės vardas.'),(4696,'Darvainas',' Darvainas yra  vardas.','Trumpa reikšmė: .','Vardo reikšmė: (1) liet., trump. Daras, Darys, Darius, dar- (žr. Darbutas) + vain- (: sen. liet. vaina „kaltė, priežastis“) Darvainė / (1) liet., trump. Darė, iš vyr. v. Darvainas',' Darvainas yra Lietuvių kilmės vardas.'),(4697,'Demetrija',' Demetrija yra Moteriškas vardas.','Trumpa reikšmė: „priklausantis, -i Demetrai“, Demetra – graikų derliaus ir žemdirbystės deivė.','Vardo reikšmė: (1) graik., trump. Demetra, Dema, iš sulotyninto graik. Demetria, kuris iš vyr. v. Demetrius, žr. Demetrijus Demetrijus / (1) graik., trump. Demetras, Demas, iš sulotyninto graik. Demetrius — „Demetros, priklausantis Demetrai“   (Demetra — sen. graikų derliaus ir žemdirbystės deivė)',' Demetrija yra graikų kilmės vardas.'),(4698,'Leopolda',' Leopolda yra Moteriškas vardas.','Trumpa reikšmė: liut „tauta“ + bald „drąsus, narsus“.','Vardo reikšmė: (1) germ., trump. Leopa, Polda, iš sulotyninto germ. Leopolda, kuris iš vyr. v. Leopoldus, žr. Leopoldas Leopoldas / (1) germ., trump. Leopas, Poldas, iš sulotyninto germ. Leopoldus, o šis iš sen. germ. Luitpold: sen. vok. aukšt. liut „tauta“ + bald „drąsus, narsus“',' Leopolda yra vokiečių kilmės vardas.'),(4699,'Žygintas',' Žygintas yra Vyriškas vardas.','Trumpa reikšmė: žy- (žygiuoti, žygis) + gin- (ginti).','Vardo reikšmė: (1) liet., trump. Žygas, žy- iš žyg(i)- (žr. Žybantas) + gint- (: liet. gint-as, ginti „saugoti, užstoti“)',' Žygintas yra lietuvių kilmės vardas.'),(4700,'Žilvinas',' Žilvinas yra Vyriškas vardas.','Trumpa reikšmė: žilvis „atžala“; želvys „ūglys, nesubrendęs medis“.','Vardo reikšmė: (1) liet., trump. Žilvys, priesagos -inas vedinys iš liet. žilv-is ,,metūgė, atžala“, plg. želvys „jaunas, nesubrendęs medis“ (: liet. želvas „žalsvas, gelsvas“, žel-ti). Išplito iš pasakos „Eglė žalčių karalienė“',' Žilvinas yra lietuvių kilmės vardas.'),(4701,'Žymantas',' Žymantas yra Vyriškas vardas.','Trumpa reikšmė: žy- (žygiuoti, žygis) + mant- (mantus „sumanus“).','Vardo reikšmė: (1) liet., trump. Žymas, žy- iš žyg(i)- (žr. Žybantas) + mant- (žr. Žadmantas)',' Žymantas yra lietuvių kilmės vardas.'),(4702,'Žintautas',' Žintautas yra Vyriškas vardas.','Trumpa reikšmė: žin-(žinoti) + taut-(tauta).','Vardo reikšmė: (1) liet., trump. Žintys, žin- (: liet. pa-žinti, žin-oti) + taut- (: liet. tauta, prūs. tauto „kraštas“)',' Žintautas yra lietuvių kilmės vardas.'),(4703,'Žyvilas',' Žyvilas yra Vyriškas vardas.','Trumpa reikšmė: žy- (žygiuoti) + vil- (viltis).','Vardo reikšmė: (1) liet., var. Živilis (2), trump. Vilas, Vilis, žy- iš žyg(i)- (žr. Žybantas) + vil- (žr. Žadvilas)',' Žyvilas yra lietuvių kilmės vardas.'),(4704,'Žintautė',' Žintautė yra Moteriškas vardas.','Trumpa reikšmė: žin-(žinoti) + taut-(tauta).','Vardo reikšmė: (1) liet., trump. Žintė, iš vyr. v. Žintautas',' Žintautė yra lietuvių kilmės vardas.'),(4705,'Kargaudas',' Kargaudas yra Vyriškas vardas.','Trumpa reikšmė: kar- (kariuomenė, karys) + gaud- (gaudyti) „kariuomenės vadas“.','Vardo reikšmė: (1) liet., trump. Karius, kar- iš kari- (: liet. kar-ias „kariuomenė, karas“) + gaud- (: liet. gaud-yti, gau-ti) Kaributas / (1) liet., trump. Karius, kari- (žr. Kargaudas) + but- (: liet. but-as, būti)',' Kargaudas yra lietuvių kilmės vardas.'),(4706,'Vaištautas',' Vaištautas yra Vyriškas vardas.','Trumpa reikšmė: vaiš- (vaišės) + taut- (tauta).','Vardo reikšmė: (1) liet. ir prūs., trump. Vaišys, Tautas, vaiš- (žr. Vaišgantas) + taut- (: liet. tauta, prūs. tauto „kraštas“) Vaištautė / (1) liet., trump. Vaišė, iš vyr. v. Vaištautas',' Vaištautas yra lietuvių kilmės vardas.'),(4707,'Emanuelis',' Emanuelis yra Vyriškas vardas.','Trumpa reikšmė: „dievas su mumis“.','Vardo reikšmė: (2) hebr., trump. Emas, Elis, iš sulotyninto hebr. Emmanuel, kuris iš hebr. ‘Immanū’el – „dievas su mumis“ Emerencija / (1) lot., trump. Emera, Ema, iš lot. Emerentia: lot. emereo „nusipelnyti“',' Emanuelis yra hebrajų kilmės vardas.'),(4708,'Gedimtas',' Gedimtas yra Vyriškas vardas.','Trumpa reikšmė: ged- (gedėti „ilgėtis“) + imt- (imti) – „tas, kurio ilgimasi“.','Vardo reikšmė: (1) suliet. prūs., trump. Gedas, Gedys, ged- (žr. Gedartas) + imt- (: liet. imti, imu, imt-as, prūs. imt „imti“) Gedimtė / (1) suliet. prūs., trump. Gedė, iš vyr. v. Gedimtas',' Gedimtas yra lietuvių kilmės vardas.'),(4709,'Danguolis',' Danguolis yra Vyriškas vardas.','Trumpa reikšmė: dangus + -uol- „dangiškoji, dangiškasis“.','Vardo reikšmė: (2) liet., trump. Dangins, Dangis, priesagos -uolis vedinys iš liet. dangus, lot. vardo Celestinas vertinys Danielė / (2)  hebr., trump. Dana, Danė, baž. lot. Daniela iš hebr. vyr. v. Daniel, žr. Danielius',' Danguolis yra lietuvių kilmės vardas.'),(4710,'Diodoras',' Diodoras yra Vyriškas vardas.','Trumpa reikšmė: „dievo dovana“.','Vardo reikšmė: (2) graik., trump. Doras, iš sulotyninto graik. Diodorus: graik. Dio- „dievo (Dzeuso)“ + doron „dovana“ Diomedas / (2) graik., trump. Medas, iš sulotyninto graik. Diomedes, kuris iš sen. graikų v. Diomedes: Dio- „dievo (Dzeuso)“ + medea „išmintis“',' Diodoras yra graikų kilmės vardas.'),(4711,'Daugirdas',' Daugirdas yra Vyriškas vardas.','Trumpa reikšmė: dau- (daug) + gir- (girdėti) – „daug girdėtas, žymus“.','Vardo reikšmė: (1) liet., trump. Daugas, Daugys, dau- (žr. Daubaras) + gird- (: liet. gird-ėti, gird-as „žinia, gandas“) Daugirutė / (2) liet. trump. Dauga, Daugė, iš vyr. v. Daugirutis',' Daugirdas yra lietuvių kilmės vardas.'),(4712,'Tarvinas',' Tarvinas yra Vyriškas vardas.','Trumpa reikšmė: tar- (tarti) + vin- (vin/vain vaina „priežastis, kaltė“).','Vardo reikšmė: (1) liet., trump. Tarys, tar- (žr. Tarvainas) + vin- (liet. sen. vin- su balsių kaita vain-: vaina „priežastis, kaltė“) Taučius / (2) liet., galūnės vedinys iš sen. trump. Tautas, kuris iš avd. su Taut-: Tautgailas, Tautminas, Tautvydas ir kt.',' Tarvinas yra lietuvių kilmės vardas.'),(4713,'Liucilė',' Liucilė yra Moteriškas vardas.','Trumpa reikšmė: lux (lucis) „šviesa“.','Vardo reikšmė: Liucilės vardo alternatyvos vyrams – Liucius, Liucijonas.',' Liucilė yra lotynų kilmės vardas.'),(4714,'Bernardina',' Bernardina yra Moteriškas vardas.','Trumpa reikšmė: iš Benardas + -in- (mažybinė priesaga): bern „lokys“ + hart „stiprus, tvirtas“.','Vardo reikšmė: (2) sulot. germ., trump. Bernarda, baž. lot. Bernardina, kuris iš vyr. v. Bernardinus, žr. Bernardinas Bernardinas / (2) sulot. germ., trump. Bernardas, baž. lot. Bernardinus yra priesagos -inus vedinys iš Bernardus, žr. Bernardas',' Bernardina yra vokiečių kilmės vardas.'),(4715,'Daugantas',' Daugantas yra Vyriškas vardas.','Trumpa reikšmė: dau- (daug) + gant- (ganyti, ginti) – „ganytojas“.','Vardo reikšmė: (1) liet., trump. Daugas, Daugys, dau- (žr. Daubaras) + gan-t- (: liet. gan-yti, determinantas -t-, plg. gin-ti) Daugarda, Daugarda, Daugardė / (3b), (1), (1) liet., trump. Dauga, Daugė, iš vyr. v. Daugardas',' Daugantas yra lietuvių kilmės vardas.'),(4716,'Konstantas',' Konstantas yra Vyriškas vardas.','Trumpa reikšmė: constans „ištvermingas, tvirtas“.','Vardo reikšmė: (1) lot., trump. Kostas, suliet. var. Kastantas, tarm. Kastantas, Kastis šiaur. žem., Kostis piet. žem., iš lot. Constantius / Constans : lot. constans (kilm. constantis) „ištvermingas, tvirtas“',' Konstantas yra lotynų kilmės vardas.'),(4717,'Florentas',' Florentas yra Vyriškas vardas.','Trumpa reikšmė: florens „žydinti, -is“.','Vardo reikšmė: (2) lot., trump. Floras, iš lot. Florentius / Florens: lot. florens (kilm. florentis) „žydintis“',' Florentas yra lotynų kilmės vardas.'),(4718,'Fulgentas',' Fulgentas yra Vyriškas vardas.','Trumpa reikšmė: fulgens „spinduliuojantis“.','Vardo reikšmė: (2) lot., trump. Fulgis, tarm. Pulgenta piet. aukšt. (dz.), Pulgentas, Pulgis vak. ir ryt. aukšt., iš lot. Fulgentius / Fulgens: lot. fulgens (kilm. fulgentis) „spindintis“',' Fulgentas yra lotynų kilmės vardas.'),(4719,'Gaudentas',' Gaudentas yra Vyriškas vardas.','Trumpa reikšmė: gaudens „besidžiaugiantis, džiūgaujantis“.','Vardo reikšmė: (2) lot., trump. Gaudas, Gaudys, iš lot. Gaudentius / Gaudens : lot. gaudens (kilm. gaudentis) „besidžiaugiantis, džiūgaujantis“',' Gaudentas yra lietuvių kilmės vardas.'),(4720,'Šarūnas',' Šarūnas yra Vyriškas vardas.','Trumpa reikšmė: šarus „greitas“ (šariuoti „skubiai eiti, šarioti „lakstyti“).','Vardo reikšmė: .',' Šarūnas yra lietuvių kilmės vardas.'),(4721,'Nicetas',' Nicetas yra Vyriškas vardas.','Trumpa reikšmė: nike „pergalė“.','Vardo reikšmė: (2) graik., trump. Nicius, iš sulotyninto graik. Nicetus, o šis iš graik. Niketas — „nugalėtojas“ (: graik. nike „pergalė“). Rytų slavų kalbose susidarė šio vardo variantai Nikita / Mikita, iš čia liet. Mikita',' Nicetas yra graikų kilmės vardas.'),(4722,'Veronika',' Veronika yra Moteriškas vardas.','Trumpa reikšmė: phero „nešti“ + nike „pergalė“.','Vardo reikšmė: (1) sulot. graik., trump. Vera, Veronė, Verė, Nika, tarm. Varonika, Varutė, Varusė ryt. aukšt., iš sulotyninto graik. Veronica iš graik. – maked. Berenike / Pherenike : graik. phero „nešti“ + nike „pergalė“',' Veronika yra graikų kilmės vardas.'),(4723,'Valentas',' Valentas yra Vyriškas vardas.','Trumpa reikšmė: valens „gyvuojantis“.','Vardo reikšmė: (1), (2) lot., trump. Valys, Valius, tarm. Valenta ryt. aukšt., Valis šiaur. žem., iš lot. Valentinus / Valens : lot. valens (kilm. valentis) „gyvuojantis“',' Valentas yra lotynų kilmės vardas.'),(4724,'Vincentas',' Vincentas yra Vyriškas vardas.','Trumpa reikšmė: vincens „nugalintis“.','Vardo reikšmė: lot., trump. Vincas, tarm. Vicentas vak. ir piet. aukšt., žem., Vincė žem., Vincus, Vinca piet. aukšt. (dz.), Vincas, Vinca ryt. aukšt., iš lot. Vincentius / Vincens: lot. vincens (kilm. vincentis) „nugalintis“',' Vincentas yra lotynų kilmės vardas.'),(4725,'Viventas',' Viventas yra Vyriškas vardas.','Trumpa reikšmė: vivens „gyvybingas“.','Vardo reikšmė: (2) lot., trump. Vivas, iš lot. Viventius / Vivens: lot. vivens (kilm. viventis) „gyvenantis, gyvuojantis“',' Viventas yra lotynų kilmės vardas.'),(4726,'Adelija',' Adelija yra Moteriškas vardas.','Trumpa reikšmė: „kilmingas“ mažybinė priesaga –ij.','Vardo reikšmė: (1) germ., trump. Adelė, Ada, iš sulotyninto germ. Adelia, kuris yra vardo Ade/a variantas, žr. Adelė',' Adelija yra vokiečių kilmės vardas.'),(4727,'Henrieta',' Henrieta yra Moteriškas vardas.','Trumpa reikšmė: iš Henrika sen. vokiečių heim „namai“ + richi „galingas“ – „namų galiūnė“.','Vardo reikšmė: (2) pranc., trump. Henrė, iš sulotyninto Henrietta, kuris iš pranc. Henriette (tai mažybinė vardo Henrika forma) Henrika / (1) germ., trump. Henrė, baž. lot. Henrica iš germ. Henrika, kuris iš vyr. v. Henrik, žr. Henrikas',' Henrieta yra prancūzų kilmės vardas.'),(4728,'Simonas',' Simonas yra Vyriškas vardas.','Trumpa reikšmė: šimon „išklausymas“; dievas išklausė duodamas Lėjai sūnų.','Vardo reikšmė: Ukrainiečių k.: Семен (Semen), Симон (Symon)',' Simonas yra hebrajų kilmės vardas.'),(4729,'Karigaila',' Karigaila yra Vyriškas vardas.','Trumpa reikšmė: kar- (kariuomenė, karys) + gail- (gailas „stiprus“) „stiprus karys“.','Vardo reikšmė: (1) liet., trump. Karius, kari- (žr. Kargaudas) + gail- (: sen. liet. gail-as „stiprus“)',' Karigaila yra lietuvių kilmės vardas.'),(4730,'Kastantas',' Kastantas yra Vyriškas vardas.','Trumpa reikšmė: iš Konstantas, Konstanta: constans „ištvermingas, tvirtas“.','Vardo reikšmė: (1) lot., trump. Kastas, tarm. Kastis, Kastantas šiaur. žem., — sulietuvintas vardo Konstantas variantas',' Kastantas yra lotynų kilmės vardas.'),(4731,'Konstantinas',' Konstantinas yra Vyriškas vardas.','Trumpa reikšmė: constans „ištvermingas, tvirtas“.','Vardo reikšmė: (2) lot., trump. Kostas, suliet. var. Kastantinas, Kastas, tarm. Kastantas, Kastis šiaur. žem., Kostas, Kostis piet. žem., Kasčius piet. aukšt. (dz.), iš lot. Constantinus, kuris yra priesagos -inus vedinys iš Constantius, žr. Konstantas',' Konstantinas yra lotynų kilmės vardas.'),(4732,'Kostas',' Kostas yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Konstantas, Konstanta: constans „ištvermingas, tvirtas“.','Vardo reikšmė: (2) liet. trumpinys iš Konstantas ir Konstantinas',' Kostas yra lotynų kilmės vardas.'),(4733,'Dargailas',' Dargailas yra Vyriškas vardas.','Trumpa reikšmė: dar- (daryti) + gail- (gailas „stiprus“).','Vardo reikšmė: (1) liet. var. Dargaila, trump. Daras, Darys, Dargis, dar- (žr. Darbutas) + gail- (: sen. liet. gailas „stiprus“)',' Dargailas yra lietuvių kilmės vardas.'),(4734,'Dargaudas',' Dargaudas yra Vyriškas vardas.','Trumpa reikšmė: dar- (daryti) + gaud- (gaudyti).','Vardo reikšmė: (1) suliet. prūs., trump. Daras, Darys, Dargis, dar- (žr. Darbutas) + gaud- (: liet. gaud-yti, gauti)',' Dargaudas yra lietuvių kilmės vardas.'),(4735,'Darginas',' Darginas yra Vyriškas vardas.','Trumpa reikšmė: dar- (daryti) + gin- (ginti) – „aktyvus gynėjas, -a“.','Vardo reikšmė: (1) liet., trump. Daras, Darys, Dargis, dar- (žr. Dar-butas) + gin- (: liet. gin-ti „užstoti, saugoti“)',' Darginas yra lietuvių kilmės vardas.'),(4736,'Dargintas',' Dargintas yra Vyriškas vardas.','Trumpa reikšmė: dar- (daryti) + gint- (ginti) – „ginantis, -i“.','Vardo reikšmė: (1) liet., trump. Daras, Darys, Dargis, dar- (žr. Darbutas) + gint- (: liet. gint-as „užstotas, saugotas“) ',' Dargintas yra lietuvių kilmės vardas.'),(4737,'Dargvilas',' Dargvilas yra Vyriškas vardas.','Trumpa reikšmė: dar- (daryti) + vil- (vitis).','Vardo reikšmė: (1) liet., trump. Dargis, darg- (žr. Dargvainas) + vil- (: liet. vil-tis, vil-iasi, vil-tis)',' Dargvilas yra lietuvių kilmės vardas.'),(4738,'Daugailas',' Daugailas yra Vyriškas vardas.','Trumpa reikšmė: dau- (daug) + gail- (gailas „stiprus“ – „labai stiprus, galingas“.','Vardo reikšmė: (1) liet., sen. var. Daugaila, trump. Daugas, Daugys, dau- (žr. Daubaras) + gail-(: sen. liet. gailas „stiprus“) Daugailė / (1) liet., trump. Dauga, Daugė iš vyr. avd. Daugaila, žr. Daugailas',' Daugailas yra lietuvių kilmės vardas.'),(4739,'Tolvinas',' Tolvinas yra Vyriškas vardas.','Trumpa reikšmė: tol- (toli) + vin- (vin-/vain- vaina „kaltė, priežastis“).','Vardo reikšmė: (1) liet., trump. Tolys, tol- (žr. Tolbaudas) + vin- (žr. Tarvinas)',' Tolvinas yra lietuvių kilmės vardas.'),(4740,'Vientautas',' Vientautas yra Vyriškas vardas.','Trumpa reikšmė: vien- (vienyti) + taut- (tauta) – „vienijantis tautą“.','Vardo reikšmė: (1) liet., trump. Vienys, Tautas, vien- (: liet. vienas, vien-yti) + taut- (žr. Vaištautas)',' Vientautas yra lietuvių kilmės vardas.'),(4741,'Viltautas',' Viltautas yra Vyriškas vardas.','Trumpa reikšmė: vil- (viltis) + taut- (tauta).','Vardo reikšmė: (1) liet., trump. Viltys, Vilas, vil- (žr. Vilbutas) + taut- (žr. Vaištautas)',' Viltautas yra lietuvių kilmės vardas.'),(4742,'Vytautas',' Vytautas yra Vyriškas vardas.','Trumpa reikšmė: vyt- (vyt/vyd išvydo) + taut- (tauta) – „išvydęs tautą, žinantis, kas svarbu tautai“.','Vardo reikšmė: (1) liet., trump. Vytas, Vytis, tarm. Vytė žem., vy- iš vyd- (žr. Vydgailas) + taut- (žr. Vaištautas)',' Vytautas yra lietuvių kilmės vardas.'),(4743,'Neimantas',' Neimantas yra Vyriškas vardas.','Trumpa reikšmė: nei (nei „negu, nė“) + mant- (mantus „sumanus“).','Vardo reikšmė: (1) liet., trump. Neimys, Mantas, nei- (žr. Neikantas) + mant- (žr. Naumantas)',' Neimantas yra lietuvių kilmės vardas.'),(4744,'Žvainys',' Žvainys yra Vyriškas vardas.','Trumpa reikšmė: žvainus „akylas, gyvus“.','Vardo reikšmė: (4) liet., iš V. Mykolaičio-Putino poemos „Kunigaikštis Žvainys“ herojaus vardo Žvainys, kuris yra galūnės vedinys iš liet. žvain-us „akylas, guvus“, plg. pvd. Žvainys',' Žvainys yra lietuvių kilmės vardas.'),(4745,'Demetras',' Demetras yra Vyriškas vardas.','Trumpa reikšmė: trumpinys iš Demetrijus, Demetrija „priklausantis, -i Demetrai“, Demetra – graikų derliaus ir žemdirbystės deivė.','Vardo reikšmė: (2) liet. trumpinys iš Demetrijus',' Demetras yra graikų kilmės vardas.'),(4746,'Dovainas',' Dovainas yra Vyriškas vardas.','Trumpa reikšmė: do- (dotas, dovis „davimas“) + vain- (baltų vaina „priežastis, kaltė“).','Vardo reikšmė: (1) liet., trump. Dovas, do- (žr. Domantas) + vain- (žr. Darvainas)',' Dovainas yra lietuvių kilmės vardas.'),(4747,'Boleslovas',' Boleslovas yra Vyriškas vardas.','Trumpa reikšmė: bolje „daugiau“ + slava „šlovė“ – „dar šlovingesnė, -is“.','Vardo reikšmė: Boleslovų žmonų idealas – jų mylimoji turi savyje suderinti namų šeimininkę, virėją, kolegę ir draugę, sekretorę ir savų vaikų motiną. Išrinktosios rankos ir širdies paprašo po didžiausių svyravimų, kruopščios kandidačių atrankos ir pasitikrinimo.',' Boleslovas yra slavų kilmės vardas.'),(4748,'Adauktas',' Adauktas yra Vyriškas vardas.','Trumpa reikšmė: adauctus: „padidintas, padaugintas“.','Vardo reikšmė: (1) lot., trump, Adas, iš lot. Adauktus: lot. adauctus „padidintas, padaugintas',' Adauktas yra lotynų kilmės vardas.'),(4749,'Abdonas',' Abdonas yra Vyriškas vardas.','Trumpa reikšmė: „tarnas“.','Vardo reikšmė: Abdonas - hebr., trump. Abdas, iš sulotyninto hebr. Abdon: hebr. ‘abd „tarnas“.',' Abdonas yra hebrajų kilmės vardas.'),(4750,'Abraomas',' Abraomas yra Vyriškas vardas.','Trumpa reikšmė: „išaukštintas tėvas“.','Vardo reikšmė: (2) hebr., sen. var. Abromas trump. Abrys, tarm. Obromas, Obras, Obrys vak. liet., iš sulotyninto hebr. Abraham, kuris iš hebr. ‘Abraham — „išaukštintas tėvas, žmonių tėvas',' Abraomas yra arabų kilmės vardas.'),(4751,'Žvainibudas',' Žvainibudas yra Vyriškas vardas.','Trumpa reikšmė: žvain- (žvainus „akylas, guvus“) + bud- (budėti, budinti) – „akylai budintis, stebintis“.','Vardo reikšmė: žvain- (žvainus „akylas, guvus“) + bud- (budėti, budinti) – „akylai budintis, stebintis“',' Žvainibudas yra lietuvių kilmės vardas.'),(4752,'Živilis',' Živilis yra Vyriškas vardas.','Trumpa reikšmė: žy- (žygiuoti) + vil- (viltis).','Vardo reikšmė: .',' Živilis yra lietuvių kilmės vardas.'),(4753,'Laertas',' Laertas yra Vyriškas vardas.','Trumpa reikšmė: neaiški pirminė reikšmė. pradėtas vartoti iš graikų mito apie Odisėją. Laertas buvo Odisėjo tėvas;.','Vardo reikšmė: Pirminė reikšmė nėra žinoma. Vardas pradėtas vartoti iš graikų mito apie Odisėją. Laertas buvo Odisėjo tėvas.',' Laertas yra graikų kilmės vardas.'),(4754,'Kainas',' Kainas yra Vyriškas vardas.','Trumpa reikšmė: „mokestis, duoklė“.','Vardo reikšmė: .',' Kainas yra škotų kilmės vardas.'),(4755,'Domingas',' Domingas yra Vyriškas vardas.','Trumpa reikšmė: Dominykas variantas lotynų: dominus „ponas, dievas“ – „gimęs, -usi viešpaties dieną, t.y., sekmadienį“.','Vardo reikšmė: Dominykas variantas lotynų: dominus „ponas, dievas“ – „gimęs, -usi viešpaties dieną, t.y., sekmadienį“',' Domingas yra ispanų kilmės vardas.'),(4756,'Ąžuolas',' Ąžuolas yra Vyriškas vardas.','Trumpa reikšmė: ąžuolas „stiprus, stipri kaip ąžuolas“.','Vardo reikšmė: (1) liet., iš pasakos „Eglė žalčių karalienė“ Eglės vyriausiojo sūnaus vardo Ąžuolas: liet. ąžuolas — tvirtumo simbolis',' Ąžuolas yra lietuvių kilmės vardas.'),(4757,'Ąžuolis',' Ąžuolis yra Vyriškas vardas.','Trumpa reikšmė: ąžuolas „stiprus, stipri kaip ąžuolas“.','Vardo reikšmė: (2) liet., metatoninis galūnės vedinys iš liet. ąžuolas',' Ąžuolis yra lietuvių kilmės vardas.'),(4758,'Visgailas',' Visgailas yra Vyriškas vardas.','Trumpa reikšmė: visa (visas, visai) + gail- (gailas „stiprus“).','Vardo reikšmė: (1) liet., sen. var. Visgaila, trump. Gailas, vis- (žr. Visalgas) + gail- (žr. Vaigailas)',' Visgailas yra lietuvių kilmės vardas.'),(4759,'Ūdrys',' Ūdrys yra Vyriškas vardas.','Trumpa reikšmė: ūdra „vandeninis žvėrelis“ – „žvitrus kaip ūdra“.','Vardo reikšmė: (3) liet., galūnės vedinys iš liet. ūdra „vandeninis žvėrelis (Lutra lutra)“, plg. dar dab. pvd. Ūdra, Ūdras',' Ūdrys yra lietuvių kilmės vardas.'),(4760,'Ubaldas',' Ubaldas yra Vyriškas vardas.','Trumpa reikšmė: hugu „dvasia“ + bald „drąsus, narsus“ – „drąsios dvasios“.','Vardo reikšmė: (1) germ., trump. Ubas, Aldas, baž. lot. Ubaldus iš italų Ubaldo, kuris iš germ. Hugibald: sen. vok. aukšt. hugu „dvasia“ + bald „drąsus, narsus“',' Ubaldas yra vokiečių kilmės vardas.'),(4761,'Ugnius',' Ugnius yra Vyriškas vardas.','Trumpa reikšmė: ugnis – „ugningas, energingas“.','Vardo reikšmė: (2) liet., galūnės vedinys iš liet. ugnis, plg. Ugnė',' Ugnius yra lietuvių kilmės vardas.'),(4762,'Švitrigaila',' Švitrigaila yra Vyriškas vardas.','Trumpa reikšmė: švit- (švitrus „vikrus, greitas“) +gail- (gailas „stiprus“).','Vardo reikšmė: (1) liet., trump. Švitrys, švitri- (: liet. švitr-ūs „greitas, vikrus, žvitrus, žvalus“) + gail- (: liet. gail-as „smarkus, stiprus“)',' Švitrigaila yra lietuvių kilmės vardas.'),(4763,'Gaudenta',' Gaudenta yra Moteriškas vardas.','Trumpa reikšmė: gaudens „besidžiaugiantis, džiūgaujantis“.','Vardo reikšmė: (2) liet. trumpinys iš Gaudencija',' Gaudenta yra lietuvių kilmės vardas.'),(4764,'Gaudencija',' Gaudencija yra Moteriškas vardas.','Trumpa reikšmė: gaudens „besidžiaugiantis, džiūgaujantis“.','Vardo reikšmė: (1) lot., trump. Gaudenta, Gauda, iš lot. Gaudentia, kuris iš vyr. v. Gaudentius, žr. Gaudentas',' Gaudencija yra lotynų kilmės vardas.'),(4765,'Florenta',' Florenta yra Moteriškas vardas.','Trumpa reikšmė: florens „žydinti, -is“.','Vardo reikšmė: (2) lot., trump. Flora, iš lot. Florentia, kuris iš vyr. v. Florentius, žr. Florentas',' Florenta yra lotynų kilmės vardas.'),(4766,'Krescencija',' Krescencija yra Moteriškas vardas.','Trumpa reikšmė: „augantis, -i“.','Vardo reikšmė: (1) lot., trump. Krescenta, iš lot. Crescentia, kuris iš vyr. v. Crescentius, žr. Krescentas',' Krescencija yra lotynų kilmės vardas.'),(4767,'Barvainė',' Barvainė yra Moteriškas vardas.','Trumpa reikšmė: bar- (barti reikšme „kovoti“, plg. rusų „borotsia“) + vain- (senovės lietuvių vaina „priežastis, kaltė“).','Vardo reikšmė: (1) liet., trump. Barė, Barvė, iš vyr. v. Barvainas',' Barvainė yra lietuvių kilmės vardas.'),(4768,'Liucė',' Liucė yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Liucija, Liucijus: „šviesa“.','Vardo reikšmė: (2) liet. trumpinys iš Liucija, Liucina ir Liucilė',' Liucė yra lotynų kilmės vardas.'),(4769,'Emanuelė',' Emanuelė yra Moteriškas vardas.','Trumpa reikšmė: „dievas su mumis“.','Vardo reikšmė: Šio vardo savininkė labai tvarkinga moteris. Su ja nesutarsite jeigu atidėliosite problemų sprendimą, pastoviai vėluosite ar bandysite jai vadovauti. Šios moters nesutiksite grūstyje, bet ji visada žinos karščiausias naujienas. Emanuelės vertins ramybę, stabilumą ir sunkiai pakęs miesto triukšmą.',' Emanuelė yra hebrajų kilmės vardas.'),(4770,'Dorotėja',' Dorotėja yra Moteriškas vardas.','Trumpa reikšmė: doron „dovana“ + teos „dievas“ – „dievo dovana“.','Vardo reikšmė: Dorotėjos turi ir neigiamų savybių kaip: nepunktualios, nekantrios, užsisklendusios savyje. Labai seksualios ir aistringos ir tuo puikiai naudojasi suvilioti kitiems, pasinaudoti kitų silpnybe seksualiomis moterimis. ',' Dorotėja yra graikų kilmės vardas.'),(4771,'Demetra',' Demetra yra Moteriškas vardas.','Trumpa reikšmė: trumpinys iš Demetrijus, Demetrija „priklausantis, -i Demetrai“, Demetra – graikų derliaus ir žemdirbystės deivė.','Vardo reikšmė: (2) liet. trumpinys iš Demetrija',' Demetra yra graikų kilmės vardas.'),(4772,'Vaidutė',' Vaidutė yra Moteriškas vardas.','Trumpa reikšmė: vaidytis, vaidentis – „tas kuris rodosi, vaidenasi“.','Vardo reikšmė: vaidytis, vaidentis – „tas kuris rodosi, vaidenasi“',' Vaidutė yra lietuvių kilmės vardas.'),(4773,'Laima',' Laima yra Moteriškas vardas.','Trumpa reikšmė: Laimė - lietuvių pagonių gyvenimo, gimimo ir likimo deivės vardas..','Vardo reikšmė: Vardas Laima yra kilęs iš Laimės, kuri lietuvių pagonių gyvenimo, gimimo ir likimo deivė.',' Laima yra lietuvių kilmės vardas.'),(4774,'Lada',' Lada yra Moteriškas vardas.','Trumpa reikšmė: slaviškas ir probaltiškas vardas, kuriuo buvo vadinama namų ir meilės deivė gimdytoja..','Vardo reikšmė: slaviškas ir probaltiškas vardas, kuriuo buvo vadinama namų ir meilės deivė gimdytoja.',' Lada yra slavų kilmės vardas.'),(4775,'Simona',' Simona yra Moteriškas vardas.','Trumpa reikšmė: šimon „išklausymas“; dievas išklausė duodamas Lėjai sūnų.','Vardo reikšmė: šimon „išklausymas“; dievas išklausė duodamas Lėjai sūnų',' Simona yra hebrajų kilmės vardas.'),(4776,'Ąžuolė',' Ąžuolė yra Moteriškas vardas.','Trumpa reikšmė: ąžuolas „stiprus, stipri kaip ąžuolas“.','Vardo reikšmė: (2) liet., metatoninis galūnės vedinys iš liet. ąžuolas',' Ąžuolė yra lietuvių kilmės vardas.'),(4777,'Elona',' Elona yra Moteriškas vardas.','Trumpa reikšmė: „ąžuolas“.','Vardo reikšmė: (2) hebr., trump. Elė, iš sulotyninto hebr. Elona, kuris iš hebr. vyr. v. Elon — „ąžuolas“',' Elona yra hebrajų kilmės vardas.'),(4778,'Butvydė',' Butvydė yra Moteriškas vardas.','Trumpa reikšmė: bu- (būti) + vyd (iš-vydo).','Vardo reikšmė: .',' Butvydė yra lietuvių kilmės vardas.'),(4779,'Ūla',' Ūla yra Moteriškas vardas.','Trumpa reikšmė: iš upėvardžio Ūla (Marcinkonyse).','Vardo reikšmė: (4) liet., iš upėvardžio Ūla (Marcinkonys)',' Ūla yra lietuvių kilmės vardas.'),(4780,'Ugnė',' Ugnė yra Moteriškas vardas.','Trumpa reikšmė: ugnis – „ugningas, energingas“.','Vardo reikšmė: Ugnė – lietuviškas vardas. Galūnės vedinys iš lietuviško žodžio ugnis (plg. liet. mitologijos įvaizdžius: amžinoji ugnis, šventoji ugnis)',' Ugnė yra lietuvių kilmės vardas.'),(4781,'Švitrigailė',' Švitrigailė yra Moteriškas vardas.','Trumpa reikšmė: švit- (švitrus „vikrus, greitas“) +gail- (gailas „stiprus“).','Vardo reikšmė: (1) liet., trump. Švitrė, iš vyr. v. Švitrigaila',' Švitrigailė yra lietuvių kilmės vardas.');
